INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(1, '01111', 'Pertanian Jagung', 'Kelompok ini mencakup usaha pertanian komoditas jagung mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman jagung. Termasuk kegiatan pembibitan dan pembenihan tanaman jagung.', 'kbli_01111', NULL, NULL),
(2, '01112', 'Pertanian Gandum', 'Kelompok ini mencakup usaha pertanian gandum mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman serealia gandum, seperti sorgum/cantel, gandum (wheat/oats), jelai (barley), gandum hitam (rye), jawawut (millet) dan sejenisnya. Termasuk kegiatan pembibitan dan pembenihan tanaman gandum.', 'kbli_01112', NULL, NULL),
(3, '01113', 'Pertanian Kedelai', 'Kelompok ini mencakup usaha pertanian kedelai mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman kedelai (kacang palawija). Termasuk kegiatan pembibitan dan pembenihan tanaman kedelai.', 'kbli_01113', NULL, NULL),
(4, '01114', 'Pertanian Kacang Tanah', 'Kelompok ini mencakup usaha pertanian kacang tanah mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman kacang tanah (kacang palawija). Termasuk kegiatan pembibitan dan pembenihan tanaman kacang tanah.', 'kbli_01114', NULL, NULL),
(5, '01115', 'Pertanian Kacang Hijau', 'Kelompok ini mencakup usaha pertanian kacang hijau mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman kacang hijau (kacang palawija). Termasuk kegiatan pembibitan dan pembenihan tanaman kacang hijau.', 'kbli_01115', NULL, NULL),
(6, '01116', 'Pertanian Aneka Kacang Hortikultura', 'Kelompok ini mencakup usaha pertanian aneka kacang hortikultura mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman aneka kacang hortikultura, seperti buncis, buncis besar, kacang panjang, kacang merah, gude, kara, kapri, kecipir, cow peas, miju-miju, lupin, kacang polong, pigeon peas dan tanaman aneka kacang lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman aneka kacang hortikultura.', 'kbli_01116', NULL, NULL),
(7, '01117', 'Pertanian Biji-bijian Penghasil Minyak Makan', 'Kelompok ini mencakup usaha pertanian biji-bijian penghasil minyak makan mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman biji-bijian penghasil minyak makan, seperti biji wijen, biji bunga matahari dan tanaman biji-bijian penghasil minyak makan lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman biji-bijian penghasil minyak makan.', 'kbli_01117', NULL, NULL),
(8, '01118', 'Pertanian Biji-bijian Penghasil Bukan Minyak Makan', 'Kelompok ini mencakup usaha pertanian biji-bijian penghasil bukan minyak makan mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman biji-bijian penghasil bukan minyak makan, seperti biji kapas, biji rami, biji mustard, niger seeds, biji jarak pohon dan tanaman biji-bijian penghasil bukan minyak makan lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman biji-bijian penghasil bukan minyak makan.', 'kbli_01118', NULL, NULL),
(9, '01119', 'Pertanian Serealia Lainnya, Aneka Kacang dan Biji-Bijian Penghasil Minyak Lainnya', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman serealia lainnya bukan padi, jagung dan gandum, tanaman aneka kacang palawija lainnya dan pertanian tanaman lainnya yang belum diklasifikasikan pada kelompok 01111 s.d. 01118. Termasuk kegiatan pembibitan dan pembenihan tanaman serealia dan biji-bijian penghasil minyak lainnya.', 'kbli_01119', NULL, NULL),
(10, '01121', 'Pertanian Padi Hibrida', 'Kelompok ini mencakup usaha pertanian padi hibrida mulai dari kegiatan pengolahan lahan, penyemaian, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan sampai dengan dihasilkan komoditas gabah kering panen (GKP). Termasuk kegiatan pembibitan dan pembenihan tanaman padi hibrida. Padi hibrida adalah keturunan pertama (F1) yang dihasilkan dari persilangan antara dua galur atau lebih tetua pembentuknya dan/atau galur/inbrida homozigot. Contohnya: Bernas Super, Bernas Prima, Sembada B3, SL 11 SHS. Turunan dari padi hibrida tidak termasuk sebagai padi hibrida.', 'kbli_01121', NULL, NULL),
(11, '01122', 'Pertanian Padi Inbrida', 'Kelompok ini mencakup usaha pertanian inbrida (bukan hibrida) mulai dari kegiatan pengolahan lahan, penyemaian, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan sampai dengan dihasilkan komoditas gabah kering panen (GKP). Termasuk kegiatan pembibitan dan pembenihan tanaman padi in hibrida. Padi in hibrida adalah padi yang produksi benihnya dilakukan melalui penyerbukan sendiri atau terjadi secara alami. Terdiri dari Padi varietas Unggul Non Hibrida seperti Memberamo, Menkongga, Ciherang, IR-6, Inpari, Inpara, Inpago dan Padi Varietas Lokas yang telah ada dan dibudidayakan secara turun temurun oleh petani.', 'kbli_01122', NULL, NULL),
(12, '01131', 'Pertanian Hortikultura Sayuran Daun', 'Kelompok ini mencakup usaha pertanian hortikultura dan sayuran daun mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan, dan pasca panen jika menjadi satu kesatuan kegiatan tanaman hortikultura sayuran yang dipanen sekali, seperti petsai/sawi, asparagus, kubis/kol, kembang kol dan brokoli, selada dan seledri/chicory, daun bawang, bayam, kangkung, tumbuhan yang bunganya dimakan sebagai sayur dan sayuran daun dan batang lainnya. Bayam dan kangkung yang dipanen dengan akarnya juga dimasukkan dalam kelompok ini. Termasuk kegiatan pembibitan dan pembenihan tanaman hortikultura sayuran daun.', 'kbli_01131', NULL, NULL),
(13, '01132', 'Pertanian Hortikultura Buah', 'Kelompok ini mencakup usaha pertanian hortikultura buah mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman hortikultura buah, seperti semangka, belewah, melon, timun suri dan sejenisnya. Termasuk kegiatan pembibitan dan pembenihan tanaman hortikultura buah.', 'kbli_01132', NULL, NULL),
(14, '01133', 'Pertanian Hortikultura Sayuran Buah', 'Kelompok ini mencakup usaha pertanian hortikultura sayuran buah mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman hortikultura buah yang dipakai sebagai sayuran (labu), seperti mentimun, terung, tomat, belimbing sayur dan labu sayur (siam), waluh/labu kuning, gambas/oyong dan sejenisnya. Termasuk kegiatan pembibitan dan pembenihan tanaman hortikultura sayuran buah.', 'kbli_01133', NULL, NULL),
(15, '01134', 'Pertanian Hortikultura Sayuran Umbi', 'Kelompok ini mencakup usaha pertanian hortikultura sayuran umbi mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, pemanenan, dan pasca panen jika menjadi satu kesatuan kegiatan tanaman umbi-umbian hortikultura, seperti kentang, kentang manis, wortel, lobak cina, rebung, bawang putih, bawang bombay atau bawang merah, bawang perai dan sayuran alliaceous lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman hortikultura sayuran umbi.', 'kbli_01134', NULL, NULL),
(16, '01135', 'Pertanian Aneka Umbi Palawija', 'Kelompok ini mencakup usaha pertanian aneka umbi palawija mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, dan juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman aneka umbi palawija, seperti ubi kayu, ubi jalar, talas, ganyong dan irut, gembili dan tanaman palawija, iles-iles, porang dan umbi-umbian palawija lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman aneka umbi palawija.', 'kbli_01135', NULL, NULL),
(17, '01136', 'Pertanian Jamur', 'Kelompok ini mencakup usaha pertanian jamur mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman jamur dan truffle, seperti jamur merang, jamur tiram, jamur shitake, jamur kuping dan sejenisnya. Termasuk kegiatan pembibitan dan pembenihan tanaman jamur.', 'kbli_01136', NULL, NULL),
(18, '01137', 'Pertanian Bit Gula Dan Tanaman Pemanis Bukan Tebu', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman bit gula dan tanaman pemanis lainnya bukan tebu, seperti stevia dan sorgum manis. Termasuk kegiatan pembibitan dan pembenihan tanaman bit gula dan tanaman pemanis bukan tebu.', 'kbli_01137', NULL, NULL),
(19, '01139', 'Pertanian Sayuran, Buah dan Aneka Umbi Lainnya', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penanaman, pemeliharaan, juga pemanenan dan pasca panen jika menjadi satu kesatuan kegiatan tanaman sayuran, buah dan aneka umbi lainnya yang dipanen lebih dari sekali; dan pertanian sayuran lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman sayuran lainnya, kecuali bibit tanaman bit.', 'kbli_01139', NULL, NULL),
(20, '01140', 'Perkebunan Tebu', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan jika menjadi satu kesatuan kegiatan tanaman tebu. Termasuk kegiatan pembibitan dan pembenihan tebu.', 'kbli_01140', NULL, NULL),
(21, '01150', 'Perkebunan Tembakau', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan jika menjadi satu kesatuan kegiatan tanaman tembakau. Termasuk kegiatan pembersihan dan perajangan tembakau yang tidak dapat dipisahkan dari kegiatan perkebunannya. Kegiatan pembibitan dan pembenihan tanaman tembakau juga tercakup dalam kelompok ini.', 'kbli_01150', NULL, NULL),
(22, '01160', 'Pertanian Tanaman Berserat', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan jika menjadi satu kesatuan kegiatan tanaman  berserat sebagai bahan baku tekstil, seperti kapuk, kapas, rosela, rami, yute, linen, agave, abaca dan kenaf, pertanian sisal dan tanaman bahan baku tekstil lainnya termasuk genus agave dan pertanian tanaman serat lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman berserat.', 'kbli_01160', NULL, NULL),
(23, '01191', 'Pertanian Tanaman Pakan Ternak', 'Kelompok ini mencakup bidang usaha produksi  hijauan pakan ternak mulai dari kegiatan penyiapan dan pengolahan lahan, penyemaian, penanaman, pemeliharaan, pemanenan dan pengolahan pasca panen. Meliputi rumput pakan ternak dan leguminosa/kacang-kacangan tanaman pakan ternak seperti Rumput Gajah, Rumput Raja, Rumput Odot, Rumput Setaria, Alfalfa, Kaliandra, Gamal, Lamtoro, Indigofera Zollingeriana dll.', 'kbli_01191', NULL, NULL),
(24, '01192', 'Perbenihan Tanaman Pakan Ternak dan Pembibitan Bit (Bukan Bit Gula)', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan dan pengolahan lahan, penyemaian, penanaman, pemeliharaan, pemanenan dan pengolahan pascapanen, perbenihan tanaman pakan ternak dan pembibitan bit (bukan bit gula). Perbenihan tanaman pakan ternak meliputi rumput pakan ternak dan leguminosa/kacang-kacangan tanaman pakan ternak seperti Rumput Gajah, Rumput Raja, Rumput Odot, Rumput Setaria, Alfalfa, Kaliandra, Gamal, Lamtoro, Indigofera Zollingeriana dll.', 'kbli_01192', NULL, NULL),
(25, '01193', 'Pertanian Tanaman Bunga', 'Kelompok  ini mencakup pertanian tanaman bunga, yang produksinya adalah bunga potong dan kuncup bunga. Tanaman bunga pada kelompok ini misalnya anggrek, anyelir, gerbera/hebras, gladiol, krisan, mawar, melati, sedap malam dan tanaman bunga lainnya. Termasuk tanaman bunga lainnya yang diambil bunganya. Pertanian tanaman bunga yang hasilnya adalah tanaman bunga hidup masuk ke golongan 013.', 'kbli_01193', NULL, NULL),
(26, '01194', 'Pertanian Pembibitan Tanaman Bunga', 'Kelompok ini mencakup usaha pertanian pembibitan tanaman bunga.', 'kbli_01194', NULL, NULL),
(27, '01199', 'Pertanian tanaman semusim lainnya ytdl', 'Kelompok ini mencakup pertanian tanaman semusim lainnya yang belum terklasifikasi di tempat lain dan kegiatan pembibitannya.', 'kbli_01199', NULL, NULL),
(28, '01210', 'Pertanian Buah Anggur', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan atau pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah anggur. Termasuk kegiatan pembibitan dan pembenihan tanaman buah anggur.', 'kbli_01210', NULL, NULL),
(29, '01220', 'Pertanian Buah-Buahan Tropis dan Subtropis', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan/pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah-buahan tropis dan subtropis, seperti rambutan, alpukat, durian, duku, pisang dan pisang raja, kurma, buah ara, pepaya, jambu biji, jambu air, lengkeng, nangka, nenas, mangga, manggis, sawo, belimbing, salak, sirsak, buah naga dan sejenisnya. Termasuk kegiatan pembibitan dan pembenihan tanaman buat tropis dan subtropis.', 'kbli_01220', NULL, NULL),
(30, '01230', 'Pertanian Buah Jeruk', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan/pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah jeruk besar dan jeruk keprok atau jeruk siam, seperti jeruk bali, jeruk lemon dan limau, jeruk orange, jeruk keprok, jeruk tangerin, jeruk mandarin dan clementine, dan buah jeruk lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman buah jeruk.', 'kbli_01230', NULL, NULL),
(31, '01240', 'Pertanian Buah Apel dan Buah Batu (Pome and Stone Fruits)', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan/pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah apel dan buah batu, seperti apel, aprikot, cherry, peach dan nectarine, pear dan quince, plum dan sloe, markisa, kepel, terong Belanda dan buah delima, dan buah batu lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman buah apel dan buah batu.', 'kbli_01240', NULL, NULL),
(32, '01251', 'Pertanian Buah Beri', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan penyiapan atau pelaksanaan, penanaman, pembibitan, pemeliharaan, pemanenan dan pasca panen buah beri, seperti blueberry, gooseberry, kiwi, raspberry, strawberry dan beri lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman buah beri.', 'kbli_01251', NULL, NULL),
(33, '01252', 'Pertanian Buah Biji Kacang-Kacangan', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman buah biji kacang-kacangan  yang dapat dimakan, seperti almond, kacang mede, chestnut, kenari, walnut dan kacang-kacangan yang lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman buah biji kacang-kacangan.', 'kbli_01252', NULL, NULL),
(34, '01253', 'Pertanian Sayuran Tahunan', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman sayuran tahunan, seperti kluwih atau timbul, sukun, nangka sayur, petai, jengkol, melinjo dan sejenisnya. Kegiatan pembibitan dan pembenihan tanaman sayuran tahunan.', 'kbli_01253', NULL, NULL),
(35, '01259', 'Pertanian Buah Semak Lainnya', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman buah semak lainnya, termasuk locust beans. Termasuk kegiatan pembibitan dan pembenihan tanaman buah semak lainnya.', 'kbli_01259', NULL, NULL),
(36, '01261', 'Perkebunan Buah Kelapa', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan buah kelapa. Termasuk kegiatan pembibitan dan pembenihan tanaman buah kelapa.', 'kbli_01261', NULL, NULL),
(37, '01262', 'Perkebunan Buah Kelapa Sawit', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan buah kelapa sawit. Termasuk kegiatan pembibitan dan pembenihan tanaman buah kelapa sawit.', 'kbli_01262', NULL, NULL),
(38, '01269', 'Perkebunan Buah Oleaginous Lainnya', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman buah oleaginous lain, seperti buah zaitun dan lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman buah oleoginous lainnya.', 'kbli_01269', NULL, NULL),
(39, '01270', 'Pertanian Tanaman Untuk Bahan Minuman', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman untuk bahan minuman, seperti tanaman kopi, teh, mate dan kakao. Termasuk kegiatan pembibitan dan pembenihan tanaman untuk bahan minuman.', 'kbli_01270', NULL, NULL),
(40, '01281', 'Perkebunan Lada', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan lada atau merica (piper spp). Termasuk kegiatan pembibitan dan pembenihan tanaman lada.', 'kbli_01281', NULL, NULL),
(41, '01282', 'Perkebunan Cengkeh', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan cengkeh. Termasuk kegiatan pembibitan dan pembenihan tanaman cengkeh.', 'kbli_01282', NULL, NULL),
(42, '01283', 'Pertanian Cabai', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, pemanenan dan pasca panen sayuran cabai (capsicum spp), seperti cabai besar, cabai rawit dan paprika. Termasuk kegiatan pembibitan dan pembenihan tanaman cabai.', 'kbli_01283', NULL, NULL),
(43, '01284', 'Perkebunan Tanaman Aromatik/Penyegar', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman perkebunan minyak atsiri, seperti sereh wangi, nilam, menthol, kenanga, ilang-ilang, gandapura, lawang. Termasuk kegiatan pembibitan dan pembenihan tanaman aromatik/penyegar.', 'kbli_01284', NULL, NULL),
(44, '01285', 'Pertanian Tanaman Obat atau Biofarmaka Rimpang', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman obat atau biofarmaka rimpang (termasuk pula tanaman bahan insektisida dan fungisida dan yang sejenis), seperti jahe, kunyit, temulawak, temugiring, temuireng, temukunci, kencur, lengkuas, lempuyang, dlingo dan sejenisnya. Termasuk kegiatan pembibitan dan pembenihan tanaman obat atau biofarmaka rimpang.', 'kbli_01285', NULL, NULL),
(45, '01286', 'Pertanian Tanaman Obat atau Biofarmaka Non Rimpang', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman obat atau biofarmaka non rimpang (termasuk pula tanaman bahan insektisida dan fungisida dan yang sejenis), seperti kina, adas, kapulaga, orang-aring, iles-iles, pinang, gambir, lidah buaya, kejibeling, sambiloto, kumis kucing, mengkudu atau pace, mahkota dewa dan sejenisnya. Termasuk kegiatan pembibitan dan pembenihan tanaman obat atau biofarmaka non rimpang.', 'kbli_01286', NULL, NULL),
(46, '01287', 'Pertanian Tanaman Narkotika dan Tanaman Obat Terlarang', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman narkotika dan tanaman obat terlarang.', 'kbli_01287', NULL, NULL),
(47, '01289', 'Pertanian Tanaman Rempah-Rempah, Aromatik/Penyegar, dan Obat Lainnya', 'Kelompok ini mencakup usaha pertanian mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan, dan pemanenan tanaman rempah lainnya, seperti kemiri, panili, kayu manis dan pala. Termasuk kegiatan pembibitan dan pembenihannya.', 'kbli_01289', NULL, NULL),
(48, '01291', 'Perkebunan Karet Dan Tanaman Penghasil Getah Lainnya', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan tanaman karet dan tanaman penghasil getah lainnya, seperti getah perca dan kemenyan. Termasuk pengolahan hasil tanaman karet yang tidak dapat dipisahkan dari kegiatan perkebunan. Termasuk kegiatan pembibitan dan pembenihan tanaman karet dan tanaman penghasil getah lainnya.', 'kbli_01291', NULL, NULL),
(49, '01299', 'Pertanian Cemara dan Tanaman Tahunan Lainnya', 'Kelompok ini mencakup usaha perkebunan mulai dari kegiatan pengolahan lahan, penyemaian, pembibitan, penanaman, pemeliharaan dan pemanenan pohon cemara, tanaman jarak pagar dan tanaman tahunan lainnya. Termasuk kegiatan pembibitan dan pembenihan tanaman cemara dan tanaman tahunan lainnya.', 'kbli_01299', NULL, NULL),
(50, '01301', 'Pertanian Tanaman Hias', 'Kelompok ini mencakup pertanian atau budidaya tanaman hias daun dan tanaman hias bunga hidup, seperti bonsai, suplir, kuping gajah, heliconia (pisang-pisangan), dracaena, phylodendrom, monstera, cordyline, anthurium daun, pakis, aglonema, difenbacia, sansifera (lidah mertua), caladium (keladi), palem dan tanaman hias bunga, seperti  anggrek, mawar, adenium (kaboja jepang, anthurium bunga, euphorbia, ixora (soka) dan tanaman bunga lainnya. Termasuk penanaman tumbuhan untuk tujuan ornamen dan tanah berumput untuk transplantasi.', 'kbli_01301', NULL, NULL),
(51, '01302', 'Pertanian Pengembangbiakan Tanaman', 'Kelompok ini mencakup produksi semua bibit tanaman secara vegetatif termasuk batang stek, potongan dan pembibitan untuk kelangsungan pengembangbiakan tanaman atau membuat batang okulasi tanaman pada keturunannya terpilih yang diokulasi yang pada akhirnya ditanam untuk menghasilkan tanaman. Termasuk kegiatan penanaman tumbuhan untuk ditanam kembali, penanaman tumbuhan hidup untuk umbi-umbian, akar-akaran; pemotongan, stek dan cangkokan; spawn jamur dan kebun bibit tanaman, kecuali kebun bibit tanaman hutan.\Z\ZJasa Pekerjaan Konstruksi Prapabrikasi Bangunan Sipil', 'kbli_01302', NULL, NULL),
(52, '01411', 'Pembibitan Dan Budidaya Sapi Potong', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan sapi potong, untuk menghasilkan ternak bibit sapi potong, semen dan embrio, dan kegiatan budidaya sapi potong berupa  pengembangbiakan untuk menghasilkan anak atau calon indukan dan penggemukan untuk menghasilkan calon sapi siap potong.', 'kbli_01411', NULL, NULL),
(53, '01412', 'Pembibitan Dan Budidaya Sapi Perah', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan sapi perah untuk menghasilkan ternak bibit sapi perah, semen dan embrio dan usaha budidaya sapi perah berupa pengembangbiakan untuk menghasilkan anak atau calon indukan dan untuk menghasilkan susu dan penggemukan.', 'kbli_01412', NULL, NULL),
(54, '01413', 'Pembibitan Dan Budidaya Kerbau Potong', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan kerbau potong untuk menghasilkan ternak bibit kerbau potong, semen dan embrio dan usaha budidaya kerbau potong berupa pengembangbiakan untuk menghasilkan anak atau calon indukan dan penggemukan untuk menghasilkan calon kerbau siap potong.', 'kbli_01413', NULL, NULL),
(55, '01414', 'Pembibitan Dan Budidaya Kerbau Perah', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan kerbau perah untuk menghasilkan ternak bibit kerbau perah, semen dan embrio dan usaha budidaya kerbau perah yang menyelenggarakan pengembangbiakan untuk menghasilkan anak atau calon indukan dan untuk menghasilkan susu.', 'kbli_01414', NULL, NULL),
(56, '01420', 'Peternakan Kuda dan Sejenisnya', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan kuda dan sejenisnya, untuk menghasilkan ternak bibit kuda dan sejenisnya, semen dan embrio dan usaha budidaya kuda yang  melakukan kegiatan pengembangbiakan untuk menghasilkan kuda potong, kuda perah, kuda pacu, kuda tunggang, kuda tarik, kuda kavaleri, kuda polo, dan kuda kesayangan, bagal, hinni dan sejenisnya\r\nKelompok ini mencakup :\r\n-Produksi Susu Kuda dan Sejenisnya', 'kbli_01420', NULL, NULL),
(57, '01430', 'Peternakan unta dan sejenisnya', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan unta dan sejenisnya untuk menghasilkan ternak bibit unta dan sejenisnya, semen dan embrio dan melakukan kegiatan budidaya unta berupa pengembangbiakan untuk menghasilkan unta potong, unta perah dan sejenisnya seperti llama, alpacas, vicunas dan guanacos.\r\nKelompok ini mencakup :\r\n- Produksi susu unta dan sejenisnya', 'kbli_01430', NULL, NULL),
(58, '01441', 'Pembibitan Dan Budidaya Domba Potong', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan domba potong untuk menghasilkan ternak bibit domba potong, semen dan embrio dan kegiatan budidaya domba potong berupa pengembangbiakan untuk menghasilkan anak atau calon indukan dan penggemukan untuk menghasilkan calon domba siap potong.', 'kbli_01441', NULL, NULL),
(59, '01442', 'Pembibitan Dan Budidaya Kambing Potong', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan kambing potong untuk menghasilkan ternak bibit kambing potong, semen dan embrio dan kegiatan budidaya kambing potong berupa pengembangbiakan untuk menghasilkan anak atau calon indukan dan penggemukan untuk menghasilkan calon kambing siap potong.', 'kbli_01442', NULL, NULL),
(60, '01443', 'Pembibitan Dan Budidaya Kambing Perah', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan kambing perah, untuk menghasilkan ternak bibit kambing perah, semen dan embrio; dan kegiatan budidaya kambing perah berupa pengembangbiakan untuk menghasilkan anak atau calon indukan dan untuk menghasilkan susu. (sama dengan sapi perah)', 'kbli_01443', NULL, NULL),
(61, '01444', 'Pembibitan Dan Budidaya Domba Perah', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan domba perah untuk menghasilkan ternak bibit domba perah, semen dan embrio; dan kegiatan budidaya domba perah berupa pengembangbiakan untuk menghasilkan anak atau calon indukan dan untuk menghasilkan susu.', 'kbli_01444', NULL, NULL),
(62, '01445', 'Produksi Bulu Domba Mentah/Raw Wool', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan produksi bulu domba (wool) mentah.', 'kbli_01445', NULL, NULL),
(63, '01450', 'Peternakan Babi', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan babi, untuk menghasilkan ternak bibit babi, semen dan embrio dan usaha budidaya babi berupa pengembangbiakan untuk menghasilkan anak atau calon indukan dan penggemukan untuk menghasilkan calon babi siap potong.', 'kbli_01450', NULL, NULL),
(64, '01461', 'Budidaya Ayam Ras Pedaging', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan budidaya ayam ras untuk menghasilkan ayam pedaging.', 'kbli_01461', NULL, NULL),
(65, '01462', 'Budidaya Ayam Ras Petelur', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan budidaya ayam ras untuk menghasilkan telur konsumsi dan lainnya.', 'kbli_01462', NULL, NULL),
(66, '01463', 'Pembibitan Ayam Lokal dan Persilangannya', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan ayam lokal dan persilangannya,untuk menghasilkan ternak bibit ayam dan telur tetas ayam lokal petelur dan pedaging,dan persilangannya.', 'kbli_01463', NULL, NULL),
(67, '01464', 'Budidaya Ayam Lokal dan Persilangannya', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan budidaya ayam lokal dan persilangannya, untuk menghasilkan pullet, ayam lokal pedaging siap potong dan telur konsumsi.', 'kbli_01464', NULL, NULL),
(68, '01465', 'Pembibitan dan Budidaya Itik dan/atau Bebek', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan itik dan/atau bebek, untuk menghasilkan telur tetas, ternak bibit itik dan/atau bebek dan peternakan yang menyelenggarakan budidaya itik dan/atau bebek untuk menghasilkan itik dan/atau bebek pedaging, itik dan/atau bebek petelur, telur konsumsi dan lainnya.', 'kbli_01465', NULL, NULL),
(69, '01466', 'Pembibitan Dan Budidaya Burung Puyuh', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan burung puyuh, untuk menghasilkan ternak bibit burung puyuh dan atau telur tetas dan peternakan yang menyelenggarakan budidaya burung puyuh untuk menghasilkan burung puyuh potong, burung puyuh petelur atau telur konsumsi.', 'kbli_01466', NULL, NULL),
(70, '01467', 'Pembibitan Dan Budidaya Burung Merpati', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan burung merpati, untuk menghasilkan ternak bibit burung merpati dan atau telur tetas dan peternakan yang menyelenggarakan budidaya burung merpati untuk menghasilkan burung merpati potong atau untuk keperluan lainnya.', 'kbli_01467', NULL, NULL),
(71, '01468', 'Pembibitan Ayam Ras', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan ayam ras pedaging dan ayam ras petelur untuk menghasilkan ayam bibit, telur tetas, bibit niaga (final stock) day old chick (DOC) dari ayam ras pedaging dan ayam ras petelur.', 'kbli_01468', NULL, NULL),
(72, '01469', 'Pembibitan Dan Budidaya Ternak Unggas Lainnya', 'Kelompok ini mencakup usaha peternakan yang melakukan kegiatan pembibitan ternak unggas lainnya, seperti kalkun, angsa, unggas persilangan dan unggas lainnya untuk menghasilkan bibit dan atau telur tetas dan peternakan yang melakukan kegiatan budidaya unggas tersebut untuk menghasilkan,unggas pedaging, unggas petelur dan telur.', 'kbli_01469', NULL, NULL),
(73, '01491', 'Pembibitan Dan Budidaya Burung Unta', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan burung unta, untuk menghasilkan ternak bibit burung unta dan atau telur tetas dan peternakan yang menyelenggarakan budidaya burung unta konsumsi untuk menghasilkan burung unta potong, telur dan atau lainnya.', 'kbli_01491', NULL, NULL),
(74, '01492', 'Pengusahaan Kokon/Kepompong Ulat Sutera', 'Kelompok ini mencakup usaha penanaman, pemeliharaan, pemungutan hasil, pengolahan dan pemasaran kokon/kepompong ulat sutera.', 'kbli_01492', NULL, NULL),
(75, '01493', 'Pembibitan Dan Budidaya Lebah', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan dan budidaya lebah, termasuk pengusahaan madu.', 'kbli_01493', NULL, NULL),
(76, '01494', 'Pembibitan Dan Budidaya Rusa', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan dan budidaya ternak rusa/kijang, baik untuk menghasilkan bibit dan daging, kulit dan lainnya.', 'kbli_01494', NULL, NULL),
(77, '01495', 'Pembibitan Dan Budidaya Kelinci', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan dan budidaya ternak kelinci, baik untuk menghasilkan bibit dan daging, kulit dan lainnya.', 'kbli_01495', NULL, NULL),
(78, '01496', 'Pembibitan Dan Budidaya Cacing', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan dan budidaya ternak cacing, baik untuk menghasilkan bibit dan daging, dan lainnya.', 'kbli_01496', NULL, NULL),
(79, '01497', 'Pembibitan dan Budidaya Burung Walet', 'Kelompok ini mencakup usaha pembibitan dan budidaya burung walet untuk menghasilkan burung dan sarang burung walet, termasuk pengusahaan pembersihan, pencucian, pengolahan dan pengemasan sarang burung walet.', 'kbli_01497', NULL, NULL),
(80, '01499', 'Pembibitan Dan Budidaya Aneka Ternak Lainnya', 'Kelompok ini mencakup usaha peternakan yang menyelenggarakan pembibitan aneka ternak, seperti marmut, anjing, kucing, kera/primata lainnya, ulat, jangkrik dan aneka ternak lainnya, untuk menghasilkan bibit dan peternakan yang menyelenggarakan budidaya aneka ternak untuk menghasilkan daging, kulit dan lainnya.', 'kbli_01499', NULL, NULL),
(81, '01611', 'Jasa Pengolahan Lahan', 'Kelompok ini mencakup usaha pengolahan lahan pertanian tanaman pangan dan perkebunan atas dasar balas jasa (fee) atau kontrak dengan tujuan untuk persiapan penanaman, baik di lahan sawah maupun di lahan kering.', 'kbli_01611', NULL, NULL),
(82, '01612', 'Jasa Pemupukan, Penanaman Bibit/Benih Dan Pengendalian Hama dan Gulma', 'Kelompok ini mencakup usaha yang bergerak dalam pemupukan lahan pertanian, penanaman bibit/benih dan pengendalian hama penyakit dan tanaman pengganggu (gulma) tanaman pangan dan perkebunan atas dasar balas jasa (fee) atau kontrak.', 'kbli_01612', NULL, NULL),
(83, '01613', 'Jasa Pemanenan', 'Kelompok ini mencakup usaha pemanenan tanaman atas dasar balas jasa (fee) atau kontrak.', 'kbli_01613', NULL, NULL),
(84, '01614', 'Jasa Penyemprotan Dan Penyerbukan Melalui Udara', 'Kelompok ini mencakup usaha penyemprotan dan penyerbukan melalui udara dengan pesawat udara khusus berdasarkan keadaan tertentu.', 'kbli_01614', NULL, NULL),
(85, '01619', 'Jasa Penunjang Pertanian Lainnya', 'Kelompok ini mencakup jasa penunjang pertanian lainnya yang belum termasuk dalam kelompok jasa penunjang pertanian di atas, seperti penyelenggaraan pengairan/penyiraman serta penyediaan alat pertanian berikut operatornya, pemeliharaan dan perawatan alat pertanian atas dasar balas  jasa (fee) atau kontrak. Penyewaan khusus alat pertanian tanpa operatornya dimasukkan dalam 77305.', 'kbli_01619', NULL, NULL),
(86, '01621', 'Jasa Pelayanan Kesehatan Ternak', 'Kelompok ini mencakup usaha yang bergerak dalam bidang pelayanan kesehatan/pengobatan ternak atas dasar balas jasa (fee) atau kontrak.', 'kbli_01621', NULL, NULL),
(87, '01622', 'Jasa Perkawinan Ternak', 'Kelompok ini mencakup usaha yang bergerak dalam bidang perkawinan ternak atas dasar balas jasa (fee) atau kontrak, seperti inseminasi buatan, transfer embrio, pemeriksaan kebuntingan, pelayanan kuda biak.', 'kbli_01622', NULL, NULL),
(88, '01623', 'Jasa Penetasan Telur', 'Kelompok ini mencakup usaha yang bergerak dalam bidang penetasan telur atas dasar balas jasa (fee) atau kontrak.', 'kbli_01623', NULL, NULL),
(89, '01629', 'Jasa Penunjang Peternakan Lainnya', 'Kelompok ini mencakup usaha yang bergerak dalam jasa penunjang peternakan lainnya atas dasar balas jasa (fee) atau kontrak, seperti pencukuran bulu ternak, pemasangan dan pemberian identitas ternak, pembersihan kandang ternak, termasuk juga usaha pelayanan pencari rumput, pemeliharaan dan perawatan hewan dan penggembalaan ternak. Termasuk juga kegiatan farrier (tukang tapal kuda) dan pengebirian hewan.', 'kbli_01629', NULL, NULL),
(90, '01630', 'Jasa Pasca Panen', 'Kelompok ini mencakup usaha pasca panen meliputi usaha penyiapan hasil panen pertanian untuk dijual, seperti pembersihan, sortasi, pengupasan, pengeringan dengan sinar matahari dan pengepakan dari macam-macam hasil pertanian atas dasar balas jasa (fee) atau kontrak. Termasuk usaha  disinfektan hasil panen, pemisahan biji kapas, penyiapan daun tembakau, penyiapan biji cokelat dan pemberian lilin pada buah-buahan.', 'kbli_01630', NULL, NULL),
(91, '01640', 'Pemilihan benih tanaman untuk pengembangbiakan', 'Kelompok ini mencakup semua kegiatan pasca panen yang ditujukan untuk meningkatkan perkembangan kualitas benih melalui pemilahan material non benih, benih berukuran terlalu kecil, benih yang rusak secara mekanik atau kerusakan benih karena serangga dan benih yang belum matang,  dan juga menjaga kelembaban benih ke kondisi aman untuk penyimpanan benih. Kegiatan ini mencakup pengeringan, pembersihan, sortasi dan lainnya sampai benih dipasarkan. Pemeliharaan benih yang telah dimodifikasi juga termasuk di sini.', 'kbli_01640', NULL, NULL),
(92, '01711', 'Perburuan dan Penangkapan Primata', 'Kelompok ini mencakup usaha perburuan dan penangkapan primata dalam rangka pengendalian populasi dan pelestarian. Termasuk perburuan dan penangkapan primata dengan perangkap, penangkapan primata (mati atau hidup) untuk makanan, bulu, kulit atau untuk penelitian, untuk  ditempatkan dalam kebun binatang atau sebagai hewan peliharaan. Termasuk perburuan dan penangkapan primata untuk diambil organnya. Contohnya kera, monyet dan primata lainnya.', 'kbli_01711', NULL, NULL),
(93, '01712', 'Perburuan dan Penangkapan Mamalia', 'Kelompok ini mencakup usaha perburuan dan penangkapan mamalia dalam rangka pengendalian populasi dan pelestarian. Termasuk perburuan dan penangkapan mamalia dengan perangkap, penangkapan mamalia (mati atau hidup) untuk makanan, bulu, kulit atau untuk penelitian, untuk  ditempatkan dalam kebun binatang atau sebagai hewan peliharaan. Termasuk perburuan dan penangkapan mamalia untuk diambil organnya. Contohnya rusa, babi, kelinci, dan mamalia lainnya.', 'kbli_01712', NULL, NULL),
(94, '01713', 'Perburuan dan Penangkapan Reptil', 'Kelompok ini mencakup usaha perburuan dan penangkapan reptil dalam rangka pengendalian populasi dan pelestarian. Termasuk perburuan dan penangkapan reptil dengan perangkap, penangkapan reptil (mati atau hidup) untuk makanan, bulu, kulit atau untuk penelitian, untuk  ditempatkan dalam kebun binatang atau sebagai hewan peliharaan. Termasuk perburuan dan penangkapan reptil untuk diambil organnya. Contohnya buaya, ular, dan reptil lainnya.', 'kbli_01713', NULL, NULL),
(95, '01714', 'Perburuan dan Penangkapan Burung', 'Kelompok ini mencakup usaha perburuan dan penangkapan segala jenis burung dalam rangka pengendalian populasi dan pelestarian. Termasuk perburuan dan penangkapan burung dengan perangkap, penangkapan burung (mati atau hidup) untuk makanan, bulu, kulit atau untuk penelitian, untuk  ditempatkan dalam kebun binatang atau sebagai hewan peliharaan. Termasuk perburuan dan penangkapan burung untuk diambil organnya.', 'kbli_01714', NULL, NULL),
(96, '01715', 'Perburuan dan Penangkapan Insekta', 'Kelompok ini mencakup usaha perburuan dan penangkapan insekta dalam rangka pengendalian populasi dan pelestarian. Termasuk perburuan dan penangkapan insekta dengan perangkap, penangkapan insekta (mati atau hidup) untuk makanan,  kulit atau untuk penelitian, untuk  ditempatkan dalam kebun binatang atau sebagai hewan peliharaan. Termasuk perburuan dan penangkapan insekta untuk diambil organnya. Contohnya kupu-kupu, dan insekta lainnya.', 'kbli_01715', NULL, NULL),
(97, '01719', 'Perburuan dan Penangkapan Satwa Liar Lainnya', 'Kelompok ini mencakup usaha perburuan dan penangkapan satwa liar lainnya dalam rangka pengendalian populasi dan pelestarian. Termasuk perburuan dan penangkapan satwa liar lainnya  dengan perangkap, penangkapan satwa liar lainnya (mati atau hidup) untuk makanan,  kulit atau untuk penelitian, untuk  ditempatkan dalam kebun binatang atau sebagai hewan peliharaan. Termasuk perburuan dan penangkapan satwa liar lainnya untuk diambil organnya. Termasuk dalam kelompok ini adalah satwa liar yang belum tercakup dalam kelompok 01711 s.d. 01715.', 'kbli_01719', NULL, NULL),
(98, '01721', 'Penangkaran Primata', 'Kelompok ini mencakup usaha penangkaran, pembesaran, pembiakan dan penelitian untuk pelestarian orang utan, beruk, bekantan, kera ekor panjang, dan primata lainnya.', 'kbli_01721', NULL, NULL),
(99, '01722', 'Penangkaran Mamalia', 'Kelompok ini mencakup usaha penangkaran, pembesaran, pembiakan dan penelitian untuk pelestarian mamalia, seperti hariamau, badak, anoa, dan mamalia lainnya.', 'kbli_01722', NULL, NULL),
(100, '01723', 'Penangkaran Reptil', 'Kelompok ini mencakup usaha penangkaran, pembesaran, pembiakan dan penelitian untuk pelestarian reptil, seperti komodo, buaya, dan reptil lainnya.', 'kbli_01723', NULL, NULL),
(101, '01724', 'Penangkaran Burung', 'Kelompok ini mencakup usaha penangkaran, pembesaran, pembiakan dan penelitian untuk pelestarian burung, seperti kakatua, cendrawasih, rangkong, dan burung lainnya.', 'kbli_01724', NULL, NULL),
(102, '01725', 'Penangkaran Insekta', 'Kelompok ini mencakup usaha penangkaran, pembesaran, pembiakan dan penelitian untuk pelestarian insekta, seperti kupu-kupu, lebah, dan insekta lainnya.', 'kbli_01725', NULL, NULL),
(103, '01726', 'Penangkaran Anggrek', 'Kelompok ini mencakup usaha penangkaran, pembesaran, pembiakan dan penelitian untuk pelestarian jenis anggrek, seperti anggrek hitam, dan jenis anggrek lainnya yang dilindungi.', 'kbli_01726', NULL, NULL),
(104, '01727', 'Penangkaran Ikan dan Coral/karang', 'Kelompok ini mencakup usaha penangkaran, pembesaran, pembiakan dan penelitian untuk pelestarian berbagai jenis ikan dan coral/karang, seperti ikan arwana (super red, golden, green, banjar, jardini/payang Irian), kima, dan jenis lainnya.', 'kbli_01727', NULL, NULL),
(105, '01729', 'Penangkaran Tumbuhan/Satwa Liar Lainnya', 'Kelompok ini mencakup usaha penangkaran, pembesaran, pembiakan dan penelitian untuk pelestarian tumbuhan/satwa liar lainnya, baik yang hidup di darat maupun di laut.', 'kbli_01729', NULL, NULL),
(106, '02111', 'Pemanfaatan Kayu Hutan Tanaman pada Hutan Produksi', 'Kelompok ini mencakup usaha pemanfaatan kayu yang meliputi penanaman atau pengayaan, pemeliharaan, pemanenan atau penebangan hasil yang berasal dari hutan tanaman pada hutan produksi. Jenis tanaman kayu kehutanan seperti jati, pinus, mahoni, sonokeling, sengon/albasia/jeunjing, jabon, akasia, ekalitus, cendana, dan tanaman kayu kehutanan lainnya.', 'kbli_02111', NULL, NULL),
(107, '02112', 'Pemanfaatan kayu hutan tanaman hasil rehabilitasi pada hutan produksi', 'Kelompok ini mencakup usaha pemanfaatan kayu yang meliputi penanaman atau pengayaan, pemeliharaan, pemanenan atau penebangan hasil yang berasal dari hutan tanaman yang dibangun melalui kegiatan merehabilitasi lahan dan hutan pada hutan produksi. Jenis tanaman kayu kehutanan seperti jati, pinus, mahoni, sonokeling, sengon/albasia/jeunjing, jabon, akasia, ekalitus, cendana, dan tanaman kayu kehutanan lainnya.', 'kbli_02112', NULL, NULL),
(108, '02113', 'Pemanfaatan kayu hutan tanaman rakyat', 'Kelompok ini mencakup usaha pemanfaatan kayu yang meliputi penanaman atau pengayaan, pemeliharaan, pemanenan atau penebangan hasil yang berasal dari hutan tanaman rakyat yang dibangun oleh kelompok masyarakat untuk meningkatkan potensi dan kualitas hutan produksi dengan menerapkan silvikultur dalam rangka menjamin kelestarian sumber daya hutan. Jenis tanaman kayu kehutanan seperti jati, pinus, mahoni, sonokeling, sengon/albasia/jeunjing, jabon, akasia, ekalitus, cendana, dan tanaman kayu kehutanan lainnya.\Z\ZPemanfaatan kayu hutan tanaman lainnya', 'kbli_02113', NULL, NULL),
(109, '02119', 'Pemanfaatan kayu hutan tanaman lainnya', 'Kelompok ini mencakup usaha pemanfaatan hasil hutan kayu yang berasal dari hutan tanaman lainnya yang tidak termasuk  dalam kelompok  diatas yang merupakan hasil inovasi pemanfaatan hasil hutan tanaman. Contoh hutan rakyat seperti tanaman kehutanan yang dikelola oleh masyarakat yang berada di luar hutan.', 'kbli_02119', NULL, NULL),
(110, '02121', 'Pemanfaatan Kayu Hutan Alam', 'Kelompok ini mencakup usaha pemanfaatan hutan alam melalui kegiatan pemanenan atau penebangan dengan batas diameter, pengayaan, dan pemeliharaan. Kegiatan pemanenan/penebangan/pengayaan/penanaman  dilakukan terhadap jenis-jenis pohon yang dikelompokan ke dalam kelompok jenis meranti, kelompok rimba campuran, kelompok kayu indah dan kelompok kayu jenis lainnya yang berlaku di seluruh indonesia, tidak termasuk jenis kayu yang dilindungi.', 'kbli_02121', NULL, NULL),
(111, '02122', 'Pemanfaatan kayu hasil restorasi ekosistem pada hutan alam', 'Kelompok ini mencakup usaha untuk membangun kawasan dalam hutan alam yang memiliki ekosistem penting sehingga dapat dipertahankan fungsi dan keterwakilannya melalui kegiatan pemeliharaan, perlindungan dan pemulihan ekosistem hutan termasuk penanaman, pengayaan, penjarangan, penangkaran satwa, pelepasliaran flora dan fauna  untuk mengembalikan unsur hayati (flora dan fauna) dan unsur non hayati (tanah, iklim, dan tofografi) pada suatu kawasan kepada jenis yang asli, sehingga tercapai keseimbangan ekosistemnya, serta usaha pemanfaatan kayu hasil restorasi ekosistem yang sudah tercapai keseimbangan ekosistemnya.', 'kbli_02122', NULL, NULL),
(112, '02130', 'Pemanfaatan Hasil Hutan Bukan Kayu', 'Kelompok ini mencakup pemanfaatan hasil hutan bukan kayu yang meliputi penanaman atau pengayaan, pemeliharaan, pemanenan atau penebangan hasil hutan bukan kayu (rotan, getah pinus, daun kayu putih, bambu, damar, gaharu, dan lainnya).', 'kbli_02130', NULL, NULL),
(113, '02140', 'Pengusahaan Perbenihan Tanaman Kehutanan', 'Kelompok ini mencakup usaha pengadaan benih dan/atau pembuatan bibit tanaman hutan dan pemeliharaannya sampai dengan umur tertentu untuk ditanam dengan tujuan komersil. Jenis benih/bibit tanaman kayu kehutanan seperti jati, pinus, mahoni, sonokeling, sengon/albasia/jeunjing, jabon, akasia, ekalitus, cendana, dan tanaman kayu kehutanan lainnya.', 'kbli_02140', NULL, NULL),
(114, '02201', 'Pemanenan kayu', 'Kelompok ini mencakup kegiatan poduksi kayu gelondongan untuk industri pengolahan dan produksi kayu gelondongan digunakan dalam bentuk yang tidak diolah, seperti pit-props, tonggak pagar dan tiang listrik atau telepon.', 'kbli_02201', NULL, NULL),
(115, '02202', 'Usaha Pemungutan Kayu', 'Kelompok ini mencakup usaha pemungutan hasil kayu dengan batas diameter tertentu yang terpisah dari usaha pengusahaan kayu. Termasuk kegiatan pengumpulan dan produksi kayu bakar.', 'kbli_02202', NULL, NULL),
(116, '02209', 'Usaha Kehutanan Lainnya', 'Kelompok ini mencakup usaha di bidang kehutanan yang tidak tercakup dalam kelompok manapun, seperti produksi arang di hutan dengan cara tradisional.', 'kbli_02209', NULL, NULL),
(117, '02301', 'Pemungutan Getah Karet', 'Kelompok ini mencakup usaha pemungutan getah tanaman karet dan tanaman penghasil getah lainnya, seperti pemungutan getah tanaman karet hutan, getah perca, jelutung dan kemenyan.', 'kbli_02301', NULL, NULL),
(118, '02302', 'Pemungutan Rotan', 'Kelompok ini mencakup usaha pemungutan jenis tanaman rotan.', 'kbli_02302', NULL, NULL),
(119, '02303', 'Pemungutan Getah Pinus', 'Kelompok ini mencakup usaha pemungutan getah pinus.', 'kbli_02303', NULL, NULL),
(120, '02304', 'Pemungutan Daun Kayu Putih', 'Kelompok ini mencakup usaha pemungutan daun tanaman kayu putih.', 'kbli_02304', NULL, NULL),
(121, '02305', 'Pemungutan Kokon/Kepompong Ulat Sutera', 'Kelompok ini mencakup usaha pemungutan kokon/kepompong ulat sutera.', 'kbli_02305', NULL, NULL),
(122, '02306', 'Pemungutan Damar', 'Kelompok ini mencakup usaha pemungutan damar.', 'kbli_02306', NULL, NULL),
(123, '02307', 'Pemungutan Madu', 'Kelompok ini mencakup usaha pemungutan madu.', 'kbli_02307', NULL, NULL),
(124, '02308', 'Pemungutan Bambu', 'Kelompok ini mencakup usaha pemungutan bambu.', 'kbli_02308', NULL, NULL),
(125, '02309', 'Pemungutan Bukan Kayu Lainnya', 'Kelompok ini mencakup usaha pemungutan hasil bukan kayu yang tidak dicakup dalam 02301 s.d. 02308 yang terpisah dari usaha pengusahaan hasil hutan bukan kayu, misalnya pemungutan gumpalan shellak, jernang, daun ekaliptus, kulit kayu lawang dan kayu manis, kenanga, daun/kulit/ranting cendana, kopal, pandan, purun, jamur, berry, lumut, dan lainnya. Termasuk pemungutan hasil hutan bukan kayu seperti gaharu dan sarang burung walet.', 'kbli_02309', NULL, NULL),
(126, '02401', 'Jasa Penggunaan Kawasan Hutan Di Luar Sektor Kehutanan', 'Kelompok ini mencakup jasa kehutanan bidang penggunaan kawasan hutan/planologi dalam rangka penyiapan data dasar pengelolaan hutan di kawasan untuk usaha di luar sektor kehutanan.', 'kbli_02401', NULL, NULL),
(127, '02402', 'Jasa Perlindungan Hutan Dan Konservasi Alam', 'Kelompok ini mencakup usaha dalam rangka menunjang Pemantauan Informasi Lingkungan (PIL)/ ANDAL, Usaha Kelola Lingkungan (UKL), Usaha Pemantauan Lingkungan (UPL). Termasuk didalamnya usaha pemanfaatan jasa penyimpanan dan penyerapan karbon.', 'kbli_02402', NULL, NULL),
(128, '02403', 'Jasa Rehabilitasi Dan Restorasi Kehutanan Sosial', 'Kelompok ini mencakup usaha dalam rangka rehabilitasi lahan dan kehutanan sosial baik di dalam maupun kawasan hutan.', 'kbli_02403', NULL, NULL),
(129, '02404', 'Jasa Kehutanan Bidang Perencanaan Kehutanan', 'Kelompok ini mencakup usaha jasa kehutanan dalam rangka penyiapan data dasar seperti inventarisasi hutan, pengukuran dan penataan batas, dan penafsiran citra indra jarak jauh.', 'kbli_02404', NULL, NULL),
(130, '02409', 'Jasa Penunjang Kehutanan Lainnya', 'Kelompok ini mencakup usaha jasa di bidang kehutanan lainnya  yang tidak tercakup dalam kelompok 02401 s.d. 02404, seperti kegiatan pengevaluasian kayu, pemadaman kebakaran hutan dan pengendalian hama dan jasa penebangan kayu, serta jasa pengangkutan kayu di dalam hutan.', 'kbli_02409', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(131, '03111', 'Penangkapan Pisces/Ikan Bersirip Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan pisces/ikan bersirip dengan alat penangkapan ikan: jaring lingkar (surrounding nets) termasuk pukat cincin pelagis besar dengan satu kapal, pukat cincin pelagis kecil dengan satu kapal, pukat cincin teri, pukat cincin pelagis besar dengan dua kapal, pukat cincin pelagis kecil dengan dua kapal, yang menangkap jenis ikan cakalang, madidihang, tongkol krai, tongkol komo, pelagis besar lainya, layang, kembung, selar, lemuru, kembang, pelagis kecil lainnya, dll); pukat tarik (seine nets) termasuk pukat tarik pantai (beach seine), dogol (danish seine), payang, cantrang, yang menangkap jenis ikan kakap putih, kakap merah, kuwe, manyung, cucut, kerapu, pari, kurisi, remang, layang, kembung, selar, lemuru, tembang, siro, dll; pukat hela (trawls) berupa pukat hela dasar udang, yang menangkap jenis ikan pelagis kecil, pelagis besar, demersal, dll; jaring angkat (lift nets) termasuk anco (portable lift net), bagan berperahu, bouke ami, bagan tancap, yang menangkap jenis ikan tongkol krai, tongkol komo, madidihang, cakalang, kembung, pelagis besar lainnya, pelagis kecil lainnya, dll; alat yang dijatuhkan atau ditebarkan (falling gears), termasuk jala jatuh berkapal (cast net) dan jala tebar (falling gear not specified) menangkap jenis ikan beronang, biji nangka, pelagis kecil lainya, dll; jaring insang (gillnets and entangling nets), termasuk jaring insang tetap (set gillnet (anchored)), jaring insang hanyut (drift gillnet), jaring insang lingkar (encircling gillnets), jaring insang berpancang (fixed gillnet (on stakes)), jaring insang berlapis (trammel net), combined gillnets-trammel net, yang menangkap jenis ikan cucut, pari, demersal lainya, cakalang, tongkol krai, tongkol komo, madidihang, tenggiri bulat, cucut, pelagis besar lainnya, pelagis kecil lainnya, dll; perangkap (traps), termasuk set net, bubu (pot), bubu bersayap (fyke net), pukat labuh (long bag set net), togo, ambai, jermal, pengerih, sero, yang menangkap jenis ikan Belanak, kuwe, julung-julung, pelagis kecil lainnya dll; pancing (hooks and lines), termasuk pancing ulur nontuna, pancing ulur tuna, pancing berjoran, huhate, pancing cumi, pancing cumi mekanis (squid jigging), huhate mekanis, rawai dasar (set longline), rawai tuna, tonda, pancing layang-layang, yang menangkap jenis ikan cakalang, tongkol krai, tongkol komo, tuna lainnya, tenggiri, pelagis besar lainnya, ikan tuna mata besar, madidihang, albacora, marlin, meka, kakap putih, kakap merah, kuwe, manyung, cucut, kerapu, pari, kurisi, remang, demersal lainya, karang lainnya, kerapu, kurisi, lencam, dll; alat penangkapan ikan lainnya (miscellaneous gears), termasuk tombak (harpoon), ladung, panah, pukat dorong (pushnet), muro ami (drive-in net), seser, yang menangkap jenis ikan ekor kuning, pisang-pisang, kapas-kapas, ikan karang dan ikan demersal, dll di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut. Termasuk pula kegiatan kapal yang digunakan baik untuk menangkap ikan maupun pengolahan dan pengawetan ikan.', 'kbli_03111', NULL, NULL),
(132, '03112', 'Penangkapan Crustacea Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan crustacea dengan alat penangkapan ikan: pukat hela (trawls) berupa pukat hela dasar udang; pukat tarik (seine nets), termasuk pukat tarik pantai, dogol (danish seine), payang, cantrang; penggaruk (dredges), berupa penggaruk tanpa kapal (hand dredge); jaring angkat (lift nets), termasuk bagan berperahu, bagan tancap; alat yang dijatuhkan atau ditebarkan (falling gears), berupa jala tebar (falling gear not specified); jaring insang (gillnets and entangling nets), termasuk jaring insang berpancang (fixed gillnet (on stakes)), jaring insang tetap (set gillnet (anchored)); perangkap (traps), termasuk bubu (pot), pukat labuh (long bag set net), ambai, pengerih; pancing (hooks and lines), termasuk pancing berjoran, pancing ulur; alat penangkap ikan lainnya (miscellaneous gears), termasuk seser, ladung, dll yang menangkap jenis ikan udang (udang windu, udang putih, udang dogol), lobster dan crustacea laut lainnya (kepiting dan rajungan) di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut.', 'kbli_03112', NULL, NULL),
(133, '03113', 'Penangkapan Mollusca Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan mollusca dengan alat penangkapan ikan: pancing (hooks and lines) termasuk pancing cumi, yang menangkap jenis ikan cumi-cumi, sotong, gurita, dll; alat yang dijatuhkan atau ditebarkan (falling gear), termasuk Jala jatuh berkapal, yang menangkap jenis ikan cumi-cumi, sotong, gurita, dll; jaring angkat (lift nets), termasuk bouke ami, yang menangkap jenis ikan cumi-cumi, dll; penggaruk (dredges), yang menangkap jenis kekerangan, seperti remis, simping, kerang darah, kerang hijau dan tiram,\r\ndi laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut.', 'kbli_03113', NULL, NULL),
(134, '03114', 'Penangkapan/Pengambilan Tumbuhan Air Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan semua jenis tumbuhan air, seperti algae, rumput laut, ganggang laut, dan tumbuhan hias di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut dengan alat penangkapan ikan penggaruk (dredges) berupa penggaruk tanpa kapal (hand dredge).', 'kbli_03114', NULL, NULL),
(135, '03115', 'Penangkapan/Pengambilan Induk/Benih Ikan Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan induk/benih ikan seperti induk/benih ikan bersirip, induk/benih udang, induk/benih kerang, induk/benih kepiting, dan induk/benih biota lainnya di laut, muara sungai, laguna dan tempat lain yang dipengaruhi pasang surut dengan alat penangkapan ikan : perangkap (traps) berupa bubu (induk/benih ikan); alat penangkapan ikan lainnya (miscellaneous gears) berupa seser (induk/benih ikan); penggaruk (dregdes) (induk/benih kerang, induk/benih kepiting, dan induk/benih biota lainnya); jaring angkat (lift nets) berupa anco (induk/benih ikan).', 'kbli_03115', NULL, NULL),
(136, '03116', 'Penangkapan Echinodermata Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan jenis hewan lautseperti bintang laut, teripang, bulu babi, lili laut , dan lainnya, dengan alat penangkapan ikan penggaruk (dredges) termasuk penggaruk tanpa kapal dan alat penangkapan ikan lainnya (miscellaneous gears) termasuk tombak, ladung, dll di laut, muara sungai, laguna, dan tempat lain yang dipengaruhi pasang surut.', 'kbli_03116', NULL, NULL),
(137, '03117', 'Penangkapan Coelenterata Di Laut', 'Kelompok ini mencakup usaha atau kegiatanpenangkapan ikan dengan alat penangkapan ikan anemon laut, karang laut, terumbu karang, polip, ubur-ubur, dan lainnya dengan alat penangkapan ikan jaring lingkar (surrounding nets), termasuk pukat cincin pelagis besar dengan satu kapal; jaring angkat (lift nets), termasuk bagan tancap (shore-operated stationary lift net); penggaruk (dredges) termasuk penggaruk tanpa kapal (hand dredge); alat yang ditebarkan (falling gears), termasuk jala tebar; jaring insang (gillnets and endtangling nets), termasuk jaring insang berpancang; perangkap (traps), termasuk pukat labuh; alat penangkapan ikan lainnya (miscellaneous gears), termasuk ladung, seser dll di laut, muara sungai, laguna, dan tempat lain yang dipengaruhi pasang surut.', 'kbli_03117', NULL, NULL),
(138, '03118', 'Penangkapan Ikan Hias Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan ikan hias laut, seperti kuda laut (hippocampus), angel fish, clown fish, lion fish, ikan sekar taji layar lurik, ikan buntel pasir, ikan kalong, dan ikan hias lainnya di laut, muara sungai, laguna, dan tempat lain yang dipengaruhi pasang surut dengan alat penangkapan ikan bubu; alat penangkapan ikan lainnya (miscellaneous gears), termasuk seser dan panah; penggaruk (dredges), baik penggaruk berkapal (towed dredge) atau penggaruk tanpa kapal (hand dredge).', 'kbli_03118', NULL, NULL),
(139, '03119', 'Penangkapan Biota Air Lainnya Di Laut', 'Kelompok ini mencakup usaha atau kegiatan penangkapan dan pengumpulan biota laut lainnya seperti cacing laut, siput laut di laut, muara sungai, laguna, dan tempat lain yang dipengaruhi pasang surut dengan alat tangkap penggaruk (dredges), baik penggaruk berkapal (towed dredge) atau penggaruk tanpa kapal (hand dredge).', 'kbli_03119', NULL, NULL),
(140, '03121', 'Penangkapan Pisces/Ikan Bersirip Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan penangkapan pisces/ikan bersirip air tawar dengan alat penangkapan ikan: alat yang dijatuhkan atau ditebarkan (falling gears) yang meliputi jala jatuh berkapal (cast net) dan jala tebar (falling gear not specified), menangkap jenis ikan betok, sepat, bilih, depik, genggehek, kancera, kendia, lalang, mas, lukas, repang, lampan, tawes,seren, tontong tebu, tambakan, tempe, sumpit, dll; jaring angkat (lift nets) termasuk anco, menangkap jenis ikan betok, sepat rawa, berukung, depik, jelawat, kendia, lalang, lukas, parang, teri, lampan, seren, tontong tebu, tambakan, tempe, bentilak, lais, sumpit, dll; alat penangkapan ikan lainnya (miscellaneous gears), termasuk seser, menangkap jenis ikan betok, sepat siam, lalang, teri, betutu, jenis bilih, dll; pancing (hooks and lines), menangkap jenis ikan gurame, betok, sidat, baung, keting, sepat, gabus, toman, lele, berukung, hampal, lalawak, mas, nilem, parang, teri, semah, tawes, betutu, silih, belida, siluk/arwana, patin, tempe, bentilak, lais, lempuk, sumpit, dll\r\n5. perangkap (traps), termasuk bubu (pot), sero, menangkap jenis ikan sidat, gabus, mujair, nila, jelawat, bentilak, lais, ikan bersirip, dll; Jaring Insang (gillnets and entangling nets), menangkap jenis ikan baung, keting, sepat siam, gabus, mujair, nila, berukung, beunteur, bilih, depik, genggehek, hampal, jelawat, kendia, koan, lalawak, lukas, mas, nilem, parang, repang, lampan, semah, seren, tawes, totong tebu, betutu, silih, patin, tempe, lempuk, sumpit, dll\r\ndi perairan darat, seperti di danau, sungai, waduk, rawa dan genangan air lainnya.', 'kbli_03121', NULL, NULL),
(141, '03122', 'Penangkapan Crustacea Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan penangkapan crustacea air tawar, seperti udang grago (Athya spp.), udang galah (Macrobrachium rosenbergii), udang tawar (Palaemon spp), dll dengan alat penangkapan ikan: alat yang di jatuhkan atau ditebarkan (falling gears), meliputi jala jatuh berkapal (cast net) dan jala tebar (falling gear not specified); perangkap (traps), termasuk bubu, jermal, pengerih; alat penangkapan ikan lainnya (miscleeaneous gears) termasuk seser, dll; di perairan darat, seperti di danau, sungai, waduk, rawa dan genangan air lainnya.', 'kbli_03122', NULL, NULL),
(142, '03123', 'Penangkapan Mollusca Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan penangkapan mollusca air tawar seperti remis (Meretrix spp.), siput (Philalanka sp) dll dengan alat penangkapan ikan penggaruk (dredges) di perairan darat, seperti di danau, sungai, waduk, rawa dan genangan air lainnya.', 'kbli_03123', NULL, NULL),
(143, '03124', 'Penangkapan/Pengambilan Tumbuhan Air Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/pengambilan semua jenis tumbuhan air, seperti ganggang, eceng gondok, lumut, dan tumbuhan hias di perairan darat seperti di danau, sungai, waduk, rawa, dan genangan air lainnya dengan alat penangkapana ikan penggaruk (dredges).', 'kbli_03124', NULL, NULL),
(144, '03125', 'Penangkapan/Pengambilan Induk/Benih Ikan Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan penangkapan induk/benih ikan sidat, arwana, baung dengan alat penangkapan ikan : pancing (hooks and lines) termasuk pancing berjoran; perangkap (traps) termasuk bubu (pot); jaring angkat (lift nets) termasuk anco (portable lift net), dan; alat penangkapan ikan lainnya (miscellaneous gears) termasuk seser: di perairan darat seperti di danau, sungai, waduk, rawa, dan genangan air lainnya.', 'kbli_03125', NULL, NULL),
(145, '03126', 'Penangkapan Ikan Hias di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan penangkapan ikan hias di perairan darat seperti di danau, sungai, waduk, rawa, dan genangan air lainnya, seperti ikan pelangi dan botia dengan alat penangkapan ikan lainnya (miscellaneous gears) termasuk seser, perangkat (traps) termasuk bubu (pot).', 'kbli_03126', NULL, NULL),
(146, '03129', 'Penangkapan Biota Air Lainnya Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan penangkapan/ pengambilan hewan atau biota air tawar seperti katak, bulus, labi-labi, belut, dan lainnya di perairan darat seperti di danau, sungai, waduk, rawa, dan genangan air lainnya dengan alat penangkapan ikan : perangkap (traps) termasuk bubu (pot); penggaruk (dredges); dan alat penangkapan ikan lainnya (miscellaneous gears) termasuk seser.', 'kbli_03129', NULL, NULL),
(147, '03131', 'Jasa Sarana Produksi Penangkapan Ikan Di Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana penangkapan ikan dan biota laut yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa penyediaan alat tangkap, jasa penyediaan armada penangkapan, jasa rumpon, jasa perbengkelan, jasa perbaikan alat tangkap, slipway/docking, dan lainnya.', 'kbli_03131', NULL, NULL),
(148, '03132', 'Jasa Produksi Penangkapan Ikan Di Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi penangkapan ikan dan biota laut yang dilakukan atas dasar balas jasa (fee) atau kontrak seperti jasa penyediaan logistik kapal, dan lainnya.', 'kbli_03132', NULL, NULL),
(149, '03133', 'Jasa Pasca Panen Penangkapan Ikan Di Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen penangkapan ikan dan biota laut yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa persiapan lelang, jasa sortasi dan gradasi, jasa uji mutu dan sebagainya.', 'kbli_03133', NULL, NULL),
(150, '03141', 'Jasa Sarana Produksi Penangkapan Ikan Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana penangkapan ikan air tawar di perairan darat yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pengolahan lahan, alat tangkap, jasa penyediaan logistik kapal, jasa perbengkelan, jasa perbaikan alat tangkap, dan sebagainya.', 'kbli_03141', NULL, NULL),
(151, '03142', 'Jasa Produksi Penangkapan Ikan Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi penangkapan ikan air tawar di perairan darat yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa perubahan benih, jasa penebaran benih, jasa pengendalian jasad pengganggu, jasa pemantauan dan sebagainya.', 'kbli_03142', NULL, NULL),
(152, '03143', 'Jasa Pasca Panen Penangkapan Ikan Di Perairan Darat', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen penangkapan ikan air tawar di perairan darat yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa persiapan lelang, jasa sortasi dan gradasi, jasa uji mutu, jasa pengeringan, jasa pemberian es, jasa pengepakan dan penyimpanan dan sebagainya.', 'kbli_03143', NULL, NULL),
(153, '03151', 'Penangkapan/Pengambilan Ikan Bersirip (Pisces) yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha atau kegiatan penangkapan jenis ikan taksa ikan bersirip (Pisces) yang dilindungi dan/atau Appendiks CITES sesuai ketentuan perlindungannya, yang hidup di perairan laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan komersial, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria, pertukaran dan pemeliharaan untuk kesenangan. Contoh ikan bersirip yang termasuk kelompok ini: Ikan Napoleon, Ikan Capungan Banggai, Ikan Hiu Lanjaman, Ikan Hiu Martil, Ikan Pari Mobula, dll. Kelompok ini tidak mencakup penangkapan untuk tujuan perdagangan jenis ikan bersirip yang dilindungi penuh, dilarang peredarannya berdasarkan regulasi nasional dan/atau tercantum dalam daftar Appendiks I CITES, seperti Ikan Arwana Merah dan Ikan Pari Gergaji.', 'kbli_03151', NULL, NULL),
(154, '03152', 'Penangkapan/Pengambilan Crustacea yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha atau kegiatan penangkapan jenis ikan taksa Crustacea yang dilindungi dan/atau Appendiks CITES sesuai ketentuan perlindungannya, yang hidup di perairan laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan komersial, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria, pertukaran dan pemeliharaan untuk kesenangan. Kelompok ini tidak mencakup penangkapan jenis ikan taksa CRUSTACEA yang dilindungi penuh, dilarang peredarannya berdasarkan regulasi nasional dan/atau tercantum dalam daftar Appendiks I CITES, seperti Tachypleus gigas, Tachypleus tridentatus dan Carcinoscorpius rotundicauda.', 'kbli_03152', NULL, NULL),
(155, '03153', 'Penangkapan/Pengambilan Mollusca yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha atau kegiatan penangkapan jenis ikan taksa Mollusca yang dilindungi dan/atau Appendiks CITES sesuai ketentuan perlindungannya, yang hidup di perairan laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan komersial, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria, pertukaran dan pemeliharaan untuk kesenangan. Contoh Mollusca yang masuk dalam kelompok ini: Tridacna spp., (Kima) dan Strombus gigas (Keong Ratu). Kelompok ini tidak mencakup penangkapan untuk tujuan perdagangan jenis ikan taksa Mollusca yang dilindungi penuh, dilarang peredarannya berdasarkan regulasi nasional dan/atau tercantum dalam daftar Appendiks I CITES, seperti: Nautilus spp., Hippopus hippopus, Hippopus porcellanus, Cassis cornuta dan Charonia tritonis.', 'kbli_03153', NULL, NULL),
(156, '03154', 'Penangkapan/Pengambilan Coelenterata yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pemanfaatan yang mengambil Coelenterata yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Daftar Coelenterata yang masuk dalam kelompok ini dapat mengalami perubahan sesuai dengan perubahan regulasi dan/atau keputusan Konvensi CITES. Kelompok ini tidak mencakup pengambilan jenis Coelenterata yang dilindungi penuh berdasarkan regulasi nasional, termasuk dalam daftar Appendiks I CITES dan/atau dilarang penangkapan/ pengambilannya berdasarkan kebijakan Pemerintah. Contoh: karang keras Ordo Scleractinia.', 'kbli_03154', NULL, NULL),
(157, '03155', 'Penangkapan/Pengambilan Echinodermata yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pemanfaatan yang mengambil echinodermata yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh Echinodermata yang masuk dalam kelompok ini: Holothoria fuscogilva, Holothuria nobilis, dan Holothuria whitmaei. Kelompok ini tidak mencakup pengambilan jenis Echinodermata yang dilindungi penuh berdasarkan regulasi nasional, termasuk dalam daftar Appendiks I CITES dan/atau dilarang penangkapan/pengambilannya berdasarkan kebijakan Pemerintah.', 'kbli_03155', NULL, NULL),
(158, '03156', 'Penangkapan/Pengambilan Amphibia yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pemanfaatan yang mengambil Amphibia yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh Amphibia yang masuk dalam kelompok ini: Amyda cartiliginea (Labi-Labi) dan Orlitia borneensis (Kura-Kura Sungai Kalimantan). Kelompok ini tidak mencakup pengambilan jenis Amphibia yang dilindungi penuh berdasarkan regulasi nasional, termasuk dalam daftar Appendiks I CITES dan/atau dilarang penangkapan/pengambilannya berdasarkan kebijakan Pemerintah.', 'kbli_03156', NULL, NULL),
(159, '03157', 'Penangkapan/Pengambilan Reptilia yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pemanfaatan yang mengambil reptilia yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Kelompok ini tidak mencakup pengambilan jenis reptilia yang dilindungi penuh berdasarkan regulasi nasional, termasuk dalam daftar Appendiks I CITES dan/atau dilarang penangkapan/pengambilannya berdasarkan kebijakan Pemerintah, seperti: Penyu.', 'kbli_03157', NULL, NULL),
(160, '03158', 'Penangkapan/Pengambilan Mamalia yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pemanfaatan yang mengambil mamalia yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Kelompok ini tidak mencakup pengambilan jenis mamalia yang dilindungi penuh berdasarkan regulasi nasional, termasuk dalam daftar Appendiks I CITES dan/atau dilarang penangkapan/pengambilannya berdasarkan kebijakan pemerintah seperti: paus, lumba-lumba, dan dugong.', 'kbli_03158', NULL, NULL),
(161, '03159', 'Penangkapan/Pengambilan Algae dan Biota Perairan Lainnya yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pemanfaatan yang mengambil Algae dan biota perairan lainnya yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Kelompok ini tidak mencakup pengambilan jenis Algae danbiota perairan lainnya yang dilindungi penuh berdasarkan regulasi nasional, termasuk dalam daftar Appendiks I CITES dan/atau dilarang penangkapan/pengambilannya berdasarkan kebijakan Pemerintah.', 'kbli_03159', NULL, NULL),
(162, '03211', 'Pembesaran Pisces/ Ikan Bersirip  Laut', 'Kelompok ini mencakup usaha atau kegiatan pemeliharaan dan pembesaran serta pemanenan pisces/ikan bersirip di laut, muara sungai, laguna, tempat lain yang dipengaruhi pasang surut dan fasilitas buatan lainnya, seperti ikan kerapu, kakap putih, cobia, bawal bintang, ikan bubara. Tidak termasuk kegiatan budidaya ikan hias air laut.', 'kbli_03211', NULL, NULL),
(163, '03212', 'Pembenihan Ikan Laut', 'Kelompok ini mencakup usaha pembenihan (produksi induk, telur, larva sampai dengan benih siap tebar) ikan bersirip, mollusca, crustacea, echinodermata dan biota air laut lainnya dengan media air laut, seperti benih ikan kerapu, benih kakap putih, benih bawal bintang, benih lobster, benih abalone, benih kerang mutiara, benih kerang darah, benih teripang, dan bibit rumput laut (mencakup semua jenis rumput laut). Termasuk pembibitan algae untuk menghasilkan bioenergi dan non-pangan lainnya. Tidak termasuk kegiatan pembenihan ikan hias air laut.', 'kbli_03212', NULL, NULL),
(164, '03213', 'Budidaya Ikan Hias Air Laut', 'Kelompok ini mencakup usaha atau kegiatan pembenihan, pemeliharaan, dan pembesaran serta pemanenan ikan hias air laut dengan menggunakan lahan perairan dan fasilitas buatan lainnya, seperti kuda laut, clownfish, cardinal fish, angel piyama, blue devil dan lainnya.', 'kbli_03213', NULL, NULL),
(165, '03214', 'Budidaya Karang (Coral)', 'Kelompok ini mencakup usaha atau kegiatan budidaya/pemeliharaan dan pembesaran serta pemanenan karang (coral) dan pemanfaatannya, seperti pembesaran ornamental coral, pembesaran sponge, dan pembesaran karang (soft coral maupun sel). Termasuk juga kegiatan transplantasinya.', 'kbli_03214', NULL, NULL),
(166, '03215', 'Pembesaran Mollusca Laut', 'Kelompok ini mencakup usaha atau kegiatan pemeliharaan dan pembesaran serta pemanenan mollusca di laut, muara sungai, laguna, tempat lain yang dipengaruhi pasang surut dan fasilitas buatan lainnya, seperti kerang darah, kerang hijau, kerang mutiara, dan abalone.', 'kbli_03215', NULL, NULL),
(167, '03216', 'Pembesaran Crustacea Laut', 'Kelompok ini mencakup usaha atau kegiatan pemeliharaan dan pembesaran serta pemanenan crustacea di laut, muara sungai, laguna, tempat lain yang dipengaruhi pasang surut dan fasilitas buatan lainnya, seperti lobster, udang barong', 'kbli_03216', NULL, NULL),
(168, '03217', 'Pembesaran Tumbuhan air Laut', 'Kelompok ini mencakup usaha atau kegiatan pemeliharaan dan pembesaran serta pemanenan tumbuhan laut di laut, muara sungai, laguna, tempat lain yang dipengaruhi pasang surut dan fasilitas buatan lainnya, seperti rumput laut (makro algae penghasil karaginan, agar dan alginat). Termasuk pembesaran algae untuk menghasilkan bioenergi dan non-pangan lainnya.', 'kbli_03217', NULL, NULL),
(169, '03219', 'Budidaya Biota Air Laut Lainnya', 'Kelompok ini mencakup usaha atau kegiatan budidaya biota air laut lainnya di laut, muara sungai, laguna, tempat lain yang dipengaruhi pasang surut dan fasilitas buatan lainnya.', 'kbli_03219', NULL, NULL),
(170, '03221', 'Pembesaran Ikan Air Tawar Di Kolam', 'Kelompok ini mencakup usaha atau kegiatan pemeliharaan dan pembesaran serta pemanenan ikan bersirip, mollusca, crustacea, katak dan biota air tawar lainnya seperti buaya, labi-labi, kura-kura, sidat, patin, ikan mas, nila, gurame, lele, lobster air tawar, dan udang galah di kolam tanah/kolam semen/kolam terpal. Termasuk pembesaran ikan tawar di bak, tong atau drum.', 'kbli_03221', NULL, NULL),
(171, '03222', 'Pembesaran Ikan Air Tawar Di Karamba Jaring Apung', 'Kelompok ini mencakup usaha pembesaran ikan bersirip, mollusca, crustacea, dan biota air tawar lainnya di karamba jaring apung dengan menggunakan lahan, perairan dan fasilitas buatan lainnya. Contohnya nila, patin, ikan mas, bandeng, dan lainnya.', 'kbli_03222', NULL, NULL),
(172, '03223', 'Pembesaran Ikan Air Tawar Di Karamba', 'Kelompok ini mencakup usaha pembesaran ikan bersirip, crustacea, mollusca, dan pembesaran biota air tawar lainnya di karamba dengan menggunakan lahan, perairan dan fasilitas buatan lainnya. Contohnya nila, patin, ikan mas.', 'kbli_03223', NULL, NULL),
(173, '03224', 'Pembesaran Ikan Air Tawar Di Sawah', 'Kelompok ini mencakup usaha pembesaran ikan bersirip , crustacea, mollusca, dan biota air tawar lainnya di sawah. Contohnya udang galah, nila, ikan mas, lele.', 'kbli_03224', NULL, NULL),
(174, '03225', 'Budidaya Ikan Hias Air Tawar', 'Kelompok ini mencakup usaha pembenihan, pemeliharaan, pembesaran dan pemanenan ikan hias air tawar dengan menggunakan lahan, perairan dan fasilitas buatan lainnya seperti ikan diskus, botia, mas koki, mas koi, arwana, black ghost, cupang, silver dollar, palmas, rainbow, tetra, diamond tetra, barnabus fish dan manfish. Termasuk juga budidaya tanaman hias air tawar, seperti cabomba, egeria densa, cryptocoryne longicauda, anubias.', 'kbli_03225', NULL, NULL),
(175, '03226', 'Pembenihan Ikan Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan pembenihan (produksi induk, telur, larva sampai dengan benih siap tebar), ikan bersirip, mollusca, crustacea dan biota air tawar lainnya di air tawar. Contohnya patin, ikan mas, lele, gurame, lobster air tawar, nila, katak, dan buaya.', 'kbli_03226', NULL, NULL),
(176, '03227', 'Pembesaran Ikan Air Tawar Di Karamba Jaring Tancap', 'Kelompok ini mencakup usaha pembesaran ikan bersirip, mollusca, crustacea,  dan biota air tawar lainnya di karamba jaring tancap dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.  Contohnya nila, patin, ikan mas, bandeng, dan lainnya.', 'kbli_03227', NULL, NULL),
(177, '03229', 'Budidaya Ikan Air Tawar di Media Lainnya', 'Kelompok ini mencakup usaha atau kegiatan budidaya biota air tawar di media lainnya, seperti bekas galian tambang dan pasir, saluran irigasi (sariban) dan lainnya. Contohnya ikan lele, patin, nila dan ikan mas.', 'kbli_03229', NULL, NULL),
(178, '03231', 'Jasa Sarana Produksi Budidaya Ikan Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana budidaya ikan yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pengikatan bibit rumput laut, pembuatan jaring, pelampung, pakan/alami, karamba dan jaring apung dan sebagainya.', 'kbli_03231', NULL, NULL),
(179, '03232', 'Jasa Produksi Budidaya Ikan Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi budidaya ikan yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa sortir, pemberian pakan/pakan alami, pemantauan, pengendalian lingkungan dan penyakit, dan sebagainya. Contohnya KSO (kerjasama operasional)', 'kbli_03232', NULL, NULL),
(180, '03233', 'Jasa Pasca Panen Budidaya Ikan Laut', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen budidaya ikan yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa sortasi dan gradasi, jasa uji mutu dan sebagainya.', 'kbli_03233', NULL, NULL),
(181, '03241', 'Jasa Sarana Produksi Budidaya Ikan Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana budidaya ikan air tawar yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa penyediaan terpal, jaring, pakan, probiotik, vaksin, kapur, pupuk, pengolahan lahan, pembuatan kolam, karamba jaring apung, jasa penampungan hasil budidaya, dan sebagainya.', 'kbli_03241', NULL, NULL),
(182, '03242', 'Jasa Produksi Budidaya Ikan Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi budidaya ikan air tawar yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa sortasi, pemberian pakan, jasa pengendalian jasad pengganggu, jasa pemantauan dan sebagainya.', 'kbli_03242', NULL, NULL),
(183, '03243', 'Jasa Pasca Panen Budidaya Ikan Air Tawar', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen budidaya ikan air tawar yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa sortasi dan gradasi, jasa uji mutu, jasa pengeringan, jasa pemberian es, jasa pengepakan dan penyimpanan, dan sebagainya.', 'kbli_03243', NULL, NULL),
(184, '03251', 'Pembesaran Pisces/Ikan Bersirip Air Payau', 'Kelompok ini mencakup usaha atau kegiatan pembesaran pisces/ikan bersirip air payau (ikan bandeng,  patin, nila, ikan mas dan kakap putih dan kerapu),  di air payau dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.', 'kbli_03251', NULL, NULL),
(185, '03252', 'Pembenihan Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan pembenihan (produksi induk, telur, larva sampai dengan benih siap tebar), ikan air payau (bandeng dan kakap putih), udang galah, udang windu, udang putih dan biota air payau lainnya (kepiting dan rumput laut/Gracilaria) di air payau dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.', 'kbli_03252', NULL, NULL),
(186, '03253', 'Pembesaran Mollusca Air Payau', 'Kelompok ini mencakup usaha atau kegiatan pembesaran mollusca air payau dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.', 'kbli_03253', NULL, NULL),
(187, '03254', 'Pembesaran Crustacea Air Payau', 'Kelompok ini mencakup usaha atau kegiatan pembesaran crustacea air payau seperti, udang galah, udang windu, udang putih, di air payau dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.', 'kbli_03254', NULL, NULL),
(188, '03255', 'Pembesaran Tumbuhan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan pembesaran tumbuhan air payau seperti rumput laut/Gracilaria dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.', 'kbli_03255', NULL, NULL),
(189, '03259', 'Budidaya Biota Air Payau Lainnya', 'Kelompok ini mencakup usaha atau kegiatan budaidaya biota air payau lainnya dengan menggunakan lahan, perairan dan fasilitas buatan lainnya.', 'kbli_03259', NULL, NULL),
(190, '03261', 'Jasa Sarana Produksi Budidaya Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha penyiapan sarana budidaya ikan air payau yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pembuatan tambak, dan sebagainya', 'kbli_03261', NULL, NULL),
(191, '03262', 'Jasa Produksi Budidaya Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha produksi budidaya ikan air payau yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa penebaran benih, jasa pengendalian jasad pengganggu, jasa pengendalian lingkungan dan penyakit, jasa pemberian pakan, jasa pemantauan dan sebagainya.', 'kbli_03262', NULL, NULL),
(192, '03263', 'Jasa Pasca Panen Budidaya Ikan Air Payau', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pasca panen budidaya ikan air payau yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa pemanenan, jasa sortasi dan gradasi, jasa uji mutu, jasa pengeringan, jasa pemberian es, jasa pengepakan dan penyimpanan, dan sebagainya.', 'kbli_03263', NULL, NULL),
(193, '03271', 'Pengembangbiakan Ikan Bersirip (Pisces) yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan ikan bersirip (Pisces) yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh ikan bersirip yang termasuk kelompok ini: Ikan Napoleon, Ikan Capungan Banggai, Ikan Hiu Lanjaman, Ikan Hiu Martil, Ikan Pari Mobula, Kuda Laut, Ikan Arwana, dll.', 'kbli_03271', NULL, NULL),
(194, '03272', 'Pengembangbiakan Crustacea yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan Custacea yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh Crustacea yang masuk dalam kelompok ini:  Tachypleus gigas, Tachypleus tridentatus dan Carcinoscorpius rotundicauda.', 'kbli_03272', NULL, NULL),
(195, '03273', 'Pengembangbiakan Mollusca yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan Mollusca yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh Mollusca yang masuk dalam kelompok ini: Tridacna spp., (Kima) dan Strombus gigas (Keong Ratu).', 'kbli_03273', NULL, NULL),
(196, '03274', 'Pengembangbiakan Coelenterata yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan Coelenterata yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh Coelenterata yang masuk dalam kelompok ini: Antipatharia spp., Helioporidae spp., Sclerectinia spp., Tubiporidae spp., dan Milleporidae spp.', 'kbli_03274', NULL, NULL),
(197, '03275', 'Pengembangbiakan Echinodermata yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan Echinodermata yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh Ceolenterata yang masuk dalam kelompok ini: Holothoria fuscogilva., Holothuria nobilis., dan Holothoria whitmaei.', 'kbli_03275', NULL, NULL),
(198, '03276', 'Pengembangbiakan Amphibia yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan Amphibia yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran.', 'kbli_03276', NULL, NULL),
(199, '03277', 'Pengembangbiakan Reptilia yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan Reptilia yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh Reptilia yang masuk dalam kelompok ini: Amyda cartilaginea, Chitra chitra, dan Carettochelys insculpta.', 'kbli_03277', NULL, NULL),
(200, '03278', 'Pengembangbiakan Mamalia yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan mamalia yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran. Contoh mamalia yang masuk dalam kelompok ini: lumba-lumba.', 'kbli_03278', NULL, NULL),
(201, '03279', 'Pengembangbiakan Algae dan Biota Perairan Lainnya yang Dilindungi dan/atau Termasuk dalam Appendiks CITES', 'Kelompok ini mencakup usaha pengembangbiakan Algae dan biota perairan lainnya yang dilindungi dan/atau Appendiks CITES terbatas diluar ketentuan perlindungannya dan/atau yang dibatasi pemanfaatannya sesuai ketentuan konvensi internasional yang diratifikasi  yang hidup di habitat laut, perairan tawar dan perairan payau untuk kegiatan penelitian dan pengembangan, pengembangbiakan, perdagangan dalam negeri, perdagangan luar negeri, aquaria dan pertukaran.', 'kbli_03279', NULL, NULL),
(202, '05100', 'Pertambangan Batu Bara', 'Kelompok ini mencakup usaha operasi pertambangan, pengeboran berbagai kualitas batu bara seperti antrasit, bituminous dan subbitominous baik pertambangan di permukaan tanah atau bawah tanah, termasuk pertambangan dengan cara pencairan (liquefaction). Operasi pertambangan tersebut meliputi penggalian, penghancuran, pencucian, penyaringan dan pencampuran serta pemadatan untuk meningkatkan kualitas atau memudahkan pengangkutan dan penyimpanan/penampungan. Termasuk pencarian batu bara dari kumpulan tepung bara (culm bank).', 'kbli_05100', NULL, NULL),
(203, '05200', 'Pertambangan Lignit', 'Kelompok ini mencakup usaha operasi pertambangan, pengeboran berbagai kualitas lignit, seperti pertambangan lignit di permukaan tanah atau bawah tanah, termasuk pertambangan dengan cara pencairan (liquefaction). Operasi pertambangan tersebut meliputi penggalian, penghancuran, pencucian, penyaringan dan pencampuran serta pemadatan lignit untuk meningkatkan kualitas dan memudahkan pengangkutan dan penyimpanan/penampungan.', 'kbli_05200', NULL, NULL),
(204, '06100', 'Pertambangan Minyak Bumi', 'Kelompok ini mencakup usaha atau kegiatan pertambangan minyak bumi mentah termasuk usaha pencarian kandungan minyak bumi, pengeboran, penambangan, pemisahan serta penampungan, produksi minyak bumi mentah kondensat, pemrosesan untuk menghasilkan minyak mentah dengan cara penampungan, penyaringan, pengeringan, stabilisasi dan lain-lain. Hasil pertambangan minyak bumi antara lain minyak mentah atau crude oil dan kondensat. Kelompok ini juga mencakup usaha operasi penambangan pasir bituminous atau oil shale (serpihan minyak) dan pasir aspal. Kegiatan pertambangan tersebut meliputi penggalian, pengeboran, penghancuran, pencucian, penyaringan dan pencampuran serta penampungan. Termasuk kegiatan produksi minyak bumi mentah dari serpihan minyak dan pasir bituminous jika terkait dengan pertambangannya. Pengolahan lanjut dari hasil minyak bumi dimasukkan dalam kelompok 19211.', 'kbli_06100', NULL, NULL),
(205, '06201', 'Pertambangan Gas Alam', 'Kelompok ini mencakup usaha pencarian kandungan gas alam, pengeboran, penambangan, pemisahan serta penampungan. Hasil pertambangan gas alam antara lain gas alam. Pencairan gas alam menjadi LNG sampai ke pengapalannya masih termasuk kegiatan pertambangan. Termasuk kegiatan CBM (Coalbed Methane).', 'kbli_06201', NULL, NULL),
(206, '06202', 'Pengusahaan Tenaga Panas Bumi', 'Kelompok ini mencakup usaha pencarian dan pengeboran tenaga panas bumi termasuk lokasi di kawasan hutan. Termasuk kegiatan lain yang berhubungan dengan pengusahaan tenaga panas bumi sampai ke tempat pemanfaatannya. Kegiatan pengubahan tenaga panas bumi menjadi tenaga listrik termasuk golongan pokok 35.', 'kbli_06202', NULL, NULL),
(207, '07101', 'Pertambangan Pasir Besi', 'Kelompok ini mencakup usaha pertambangan pasir besi. Termasuk kegiatan sortasi, pemisahan, dan pembersihannya.', 'kbli_07101', NULL, NULL),
(208, '07102', 'Pertambangan Bijih Besi', 'Kelompok ini mencakup usaha pertambangan bijih besi termasuk kegiatan peningkatan mutu dan aglomerasi bijih besi serta konsentratnya.', 'kbli_07102', NULL, NULL),
(209, '07210', 'Pertambangan Bijih Uranium Dan Torium', 'Kelompok ini mencakup usaha pertambangan bijih uranium dan torium. Termasuk kegiatan pengkonsentratan uranium dan torium dan produksi yellow cake.', 'kbli_07210', NULL, NULL),
(210, '07291', 'Pertambangan Bijih Timah', 'Kelompok ini mencakup usaha pertambangan bijih timah.', 'kbli_07291', NULL, NULL),
(211, '07292', 'Pertambangan Bijih Timah Hitam', 'Kelompok ini mencakup usaha pertambangan bijih timah hitam.', 'kbli_07292', NULL, NULL),
(212, '07293', 'Pertambangan Bijih Bauksit', 'Kelompok ini mencakup usaha pertambangan dan penampungan bijih bauksit.', 'kbli_07293', NULL, NULL),
(213, '07294', 'Pertambangan Bijih Tembaga', 'Kelompok ini mencakup usaha pertambangan bijih tembaga, yang terdiri dari kalkosit serta batuan berupa campuran monticellit dan skarnyakut.', 'kbli_07294', NULL, NULL),
(214, '07295', 'Pertambangan Bijih Nikel', 'Kelompok ini mencakup usaha pertambangan bijih nikel.', 'kbli_07295', NULL, NULL),
(215, '07296', 'Pertambangan Bijih Mangan', 'Kelompok ini mencakup usaha pertambangan bijih mangan.', 'kbli_07296', NULL, NULL),
(216, '07299', 'Pertambangan Bahan Galian Lainnya Yang Tidak Mengandung Bijih Besi', 'Kelompok ini mencakup usaha pertambangan bahan galian lainnya yang tidak mengandung bijih besi yang belum termasuk kelompok 07291 s.d. 07296, seperti bijih seng platinum dan silicon, serta litium, berilium, magnesium, kalium, kalsium, bismuth, molibdenum, raksa, wolfram, titanium, vanadium, kromit, antimoni, kobalt, tantalum, cadmium, galium, indium, yitrium, magnetit, niobium, zirkonium, ilmenit, khrom, cesium, niobium, hafnium, scandium, ruthenium, selenium, telluride, stronium, germanium, zenotin, dan sejenisnya.', 'kbli_07299', NULL, NULL),
(217, '07301', 'Pertambangan Emas Dan Perak', 'Kelompok ini mencakup usaha pertambangan, pembersihan, dan pemisahan bijih emas dan perak.', 'kbli_07301', NULL, NULL),
(218, '07309', 'Pertambangan Bijih Logam Mulia Lainnya', 'Kelompok ini mencakup usaha pertambangan, dan pembersihan bijih logam mulia lainnya, selain bijih logam emas dan perak, seperti bijih platina.', 'kbli_07309', NULL, NULL),
(219, '08101', 'Penggalian Batu Hias Dan Batu Bangunan', 'Kelompok ini mencakup usaha penggalian batu hias dan batu bangunan seperti batu pualam atau marmer, batu andesit (batu gajah, base course), paras, obsidian, dan granit. Termasuk disini kegiatan pemecahan, pemisahan dan pembersihannya.', 'kbli_08101', NULL, NULL),
(220, '08102', 'Penggalian Batu Kapur/Gamping', 'Kelompok ini mencakup usaha penggalian batu kapur atau gamping. Termasuk disini kegiatan pemecahan, penghancuran, penyaringan dan penghalusannya.', 'kbli_08102', NULL, NULL),
(221, '08103', 'Penggalian Kerikil/Sirtu', 'Kelompok ini mencakup usaha penggalian, pembersihan dan pemisahan kerikil. Hasil dari penggalian kerikil antara lain batu pasir, bongkah keras dan pasir kerikil.', 'kbli_08103', NULL, NULL),
(222, '08104', 'Penggalian Pasir', 'Kelompok ini mencakup usaha penggalian, pembersihan dan pemisahan pasir. Hasil dari penggalian pasir berupa pasir beton, pasir pasang (sedikit mengandung tanah), pasir uruk (banyak mengandung tanah), pasir laut dan lainnya.', 'kbli_08104', NULL, NULL),
(223, '08105', 'Penggalian Tanah dan Tanah Liat', 'Kelompok ini mencakup usaha penggalian tanah dan tanah liat. Kegiatan pembentukan, penghancuran dan penggilingan  tanah dan tanah liat dimasukkan dalam kelompok ini. Hasil dari penggalian tanah dan tanah liat/lempung antara lain kaolin (china clay), ball clay (firing clay), abu bumi, serpih dan tanah urug.', 'kbli_08105', NULL, NULL),
(224, '08106', 'Penggalian Gips', 'Kelompok ini mencakup usaha penggalian gips. Termasuk disini kegiatan pembersihan, dan penghalusannya.', 'kbli_08106', NULL, NULL),
(225, '08107', 'Penggalian Tras', 'Kelompok ini mencakup usaha penggalian tras (batuan gunung api yang mengalami perubahan kimia karena pelapukan dan kondisi air bawah tanah). Termasuk disini kegiatan pembersihannya.', 'kbli_08107', NULL, NULL),
(226, '08108', 'Penggalian Batu Apung', 'Kelompok ini mencakup usaha penggalian batu apung (jenis batuan yang berwarna terang, mengandung buih yang terbuat dari gelembung berdinding gelas, dan biasanya disebut juga sebagai batuan gelas vulkanik silikat). Termasuk disini kegiatan pembersihannya.', 'kbli_08108', NULL, NULL),
(227, '08109', 'Penggalian batu, pasir dan tanah liat lainnya', 'Kelompok ini mencakup usaha penggalian batu, pasir dan tanah liat lainnya, yang tidak terklasifikasikan di kelompok 08101 - 08108. Kegiatan penggalian yang masuk dalam kelompok ini seperti penggalian diorit, basalt, breksi, dan lainnya. Termasuk disini kegiatan pemecahan, penghancuran, pemisahan, penyaringan, dan penghalusannya.', 'kbli_08109', NULL, NULL),
(228, '08911', 'Pertambangan Belerang', 'Kelompok ini mencakup usaha pertambangan bijih belerang. Termasuk juga kegiatan penghancuran, dan pembersihan terhadap mineral belerang.  Pengolahan lanjutan dari mineral belerang dimasukkan dalam kelompok 20114.', 'kbli_08911', NULL, NULL),
(229, '08912', 'Pertambangan Fosfat', 'Kelompok ini mencakup usaha pertambangan bahan galian fosfat. Termasuk disini kegiatan sortasi, penghancuran, pembersihan dan peningkatan kadar bahan galian fosfat.', 'kbli_08912', NULL, NULL),
(230, '08913', 'Pertambangan Nitrat', 'Kelompok ini mencakup usaha pertambangan bahan galian nitrat. Termasuk disini kegiatan pembersihan, pemecahan, dan sortasi dengan cara lain terhadap bahan galian nitrat.', 'kbli_08913', NULL, NULL),
(231, '08914', 'Pertambangan Yodium', 'Kelompok ini mencakup usaha pertambangan ekstraksi air tanah yang mengandung yodium. Termasuk disini kegiatan distilasi dari ekstraksi mineral tersebut.', 'kbli_08914', NULL, NULL),
(232, '08915', 'Pertambangan Potash (Kalium Karbonat)', 'Kelompok ini mencakup usaha pertambangan potash dalam bentuk garam, feldpar dan leusit analeum. Termasuk disini kegiatan penghancuran dan pembersihan terhadap mineral tersebut.', 'kbli_08915', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(233, '08919', 'Pertambangan Mineral, Bahan Kimia Dan Bahan Pupuk Lainnya', 'Kelompok ini mencakup usaha pertambangan mineral bahan kimia dan bahan pupuk lainnya yang belum tercakup dalam kelompok 08911 s.d. 08915. Misalnya pertambangan barium sulfat alam dan karbonat (barite dan witherit), borat alam, magnesium sulfat alam (kiserit), pertambangan earth coulor, flour, bentonite, dolomit, magnesit, phiroplit, tawas, diatomea, dan mineral lain yang utamanya sebagai bahan kimia dan  pertambangan guano (bahan pupuk dari kotoran burung atau kelelawar). Termasuk disini kegiatan pembersihan, pemisahan dan sortasi.', 'kbli_08919', NULL, NULL),
(234, '08920', 'Ekstraksi Tanah Gemuk (Peat)', 'Kelompok ini mencakup usaha operasi ekstraksi dan penggalian tanah gemuk, aglomerasi tanah gemuk dan pencampuran tanah gemuk (peat) untuk meningkatkan kualitas atau memudahkan pengangkutan atau penyimpanan. Operasi ekstraksi tersebut meliputi penggalian, penghancuran, pencucian, penyaringan, serta penampungannya.', 'kbli_08920', NULL, NULL),
(235, '08930', 'Ekstraksi Garam', 'Kelompok ini mencakup usaha ekstraksi garam yaitu pengambilan garam dari bawah tanah termasuk dengan pelarutan dan pemompaan, serta produksi garam dengan penguapan air laut atau air garam lainnya di tambak/empang/media lainnya, dan penghancuran, pemisahan dan penyulingan garam oleh petani garam.', 'kbli_08930', NULL, NULL),
(236, '08991', 'Pertambangan Batu Mulia', 'Kelompok ini mencakup usaha pertambangan dan penggalian  batu mulia/batu permata, seperti intan. Termasuk kegiatan pemisahan/sortasi, dan pembersihannya dengan cara lain terhadap batu mulia/batu permata.', 'kbli_08991', NULL, NULL),
(237, '08992', 'Penggalian Feldspar dan Kalsit', 'Kelompok ini mencakup usaha penggalian feldspar dan kalsit, serta  batu tulis/sabak. Termasuk disini kegiatan pemecahan, penghancuran, penyaringan dan penghalusannya.', 'kbli_08992', NULL, NULL),
(238, '08993', 'Pertambangan Aspal Alam', 'Kelompok ini mencakup usaha pertambangan aspal alam, batu beraspal dan bitumen padat alam. Termasuk disini kegiatan pemisahan dan penuangan terhadap mineral tersebut.', 'kbli_08993', NULL, NULL),
(239, '08994', 'Penggalian Asbes', 'Kelompok ini mencakup usaha penggalian asbes dalam bentuk serabut maupun tidak. Termasuk disini kegiatan pembersihan dan pemisahannya.', 'kbli_08994', NULL, NULL),
(240, '08995', 'Penggalian Kuarsa/Pasir Kuarsa', 'Kelompok ini mencakup usaha penggalian kuarsa/pasir kuarsa/pasir silika. Termasuk disini kegiatan pemecahan, penghancuran, penyaringan dan penghalusannya.', 'kbli_08995', NULL, NULL),
(241, '08999', 'Pertambangan Dan Penggalian Lainnya Ytdl', 'Kelompok ini mencakup usaha pertambangan dan penggalian lainnya yang belum termasuk dalam golongan manapun. Termasuk kegiatan pemisahan/sortasi, dan pembersihan dengan cara lain terhadap bahan tambang/galian tersebut. Pertambangan dan penggalian ini antara lain mika, leusit, yarosit, zeolit, batu penggosok, grafit alam, steatite (talc), tepung fosil siliceous, oker, toseki dan mineral logam tanah jarang lainnya.', 'kbli_08999', NULL, NULL),
(242, '09100', 'Aktivitas Penunjang Pertambangan Minyak Bumi Dan Gas Alam', 'Kelompok ini mencakup kegiatan jasa yang berkaitan dengan pertambangan minyak dan gas bumi yang dilakukan atas dasar balas jasa (fee) atau kontrak, seperti jasa eksplorasi pengambilan minyak atau gas dengan cara tradisional yaitu membuat observasi geologi, pemasangan alat pengeboran, perbaikan dan pembongkaran penyemenan sumur minyak dan sumur gas, pembuatan saluran sumur, pemompaan sumur produksi, penyumbatan dan penutupan sumur  produksi, pengujian produksi, dismantling, pencairan dan regasifikasi gas alam untuk kebutuhan transportasi di lokasi pertambangan, pengeboran percobaan dalam rangka penyulingan minyak bumi dan gas alam dan jasa pemadam kebakaran ladang minyak bumi dan gas alam.', 'kbli_09100', NULL, NULL),
(243, '09900', 'Aktivitas Penunjang pertambangan dan penggalian lainnya', 'Kelompok ini mencakup jasa penunjang atas dasar balas jasa atau kontrak, yang dibutuhkan dalam kegiatan pertambangan golongan pokok 05, 07, dan 08, seperti jasa eksplorasi misalnya dengan cara tradisional seperti mengambil contoh bijih dan membuat observasi geologi, jasa pemompaan dan penyaluran hasil tambang dan jasa percobaan penggalian dan pengeboran ladang atau sumur tambang.', 'kbli_09900', NULL, NULL),
(244, '10110', 'Kegiatan Rumah Potong Dan Pengepakan Daging Bukan Unggas', 'Kelompok ini mencakup kegiatan operasional rumah potong hewan yang berkaitan dengan kegiatan pemotongan, pengulitan, pembersihan dan pengepakan daging, seperti daging sapi, babi, biri-biri, kelinci, domba, unta dan daging segar lainnya bukan unggas, kegiatan pengurusan hasil sampingan, seperti produksi kulit dan jangat dari tempat pemotongan hewan termasuk fellmongery, penjemuran tulang, pengolahan sisaan atau kotoran hewan, penyortiran wol dan bulu dan pembersihan lemak. Termasuk kegiatan pemotongan dan pengolahan paus di darat atau di kapal khusus. Pemotongan yang dilakukan oleh pedagang dimasukkan dalam golongan 462, 472 dan 478.', 'kbli_10110', NULL, NULL),
(245, '10120', 'Kegiatan Rumah Potong Dan Pengepakan Daging Unggas', 'Kelompok ini mencakup kegiatan operasional rumah potong unggas dan pengepakan daging unggas, termasuk kegiatan pengurusan hasil sampingan, seperti pemrosesan sisa atau kotoran unggas, pementangan kulit, penyortiran bulu dan pembersihan lemak. Pemotongan yang dilakukan oleh pedagang dimasukkan dalam golongan 462, 472 dan 478.', 'kbli_10120', NULL, NULL),
(246, '10130', 'Industri Pengolahan dan Pengawetan Produk Daging dan Daging Unggas', 'Kelompok ini mencakup usaha pengolahan dan pengawetan produk daging dan daging unggas dengan cara pengalengan, pengasapan, penggaraman, pembekuan, pemanisan, pengiradiasian (dengan iradiator) dan sebagainya. Kegiatannya mencakup produksi daging beku dalam bentuk carcase, produksi daging beku yang telah dipotong, produksi daging beku dalam porsi tersendiri, produksi daging yang dikeringkan, daging yang diasinkan atau daging yang diasapkan, produksi produk-produk daging, seperti sosis, salami, puding, \"\"\"\"andovillettes\"\"\"\", saveloy, bologna, patc, rillet, dan  daging ham. Termasuk kegiatan pengolahan daging paus di darat atau di kapal khusus.', 'kbli_10130', NULL, NULL),
(247, '10211', 'Industri Penggaraman/Pengeringan Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses penggaraman/pengeringan, seperti ikan tembang asin, ikan teri asin, dan ikan kering tawar.', 'kbli_10211', NULL, NULL),
(248, '10212', 'Industri Pengasapan/Pemanggangan Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pengasapan/pemanggangan seperti ikan bandeng asap, ikan julung-julung/roa asap, ikan fufu/asar asap, ikan lele asap, dan ikan patin asap.', 'kbli_10212', NULL, NULL),
(249, '10213', 'Industri Pembekuan Ikan', 'Kelompok ini mencakup usaha pengawetan ikan (bersirip/pisces) melalui proses pembekuan, seperti ikan bandeng beku, ikan tuna/cakalang beku dan kakap beku. Termasuk juga ikan utuh maupun dipotong (fillet, loin, saku, steak, chunk, brown meat) yang dibekukan.  Kegiatan ini tidak termasuk usaha pendinginan ikan dengan es yang dimaksud untuk mempertahankan kesegaran ikan tersebut (10217).', 'kbli_10213', NULL, NULL),
(250, '10214', 'Industri Pemindangan Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pemindangan, seperti pindang bandeng/paso, pindang tongkol, pindang cuwe, pindang naya,  pindang  lemuru/tembang, pindang layang, dan pindang cakalang.', 'kbli_10214', NULL, NULL),
(251, '10215', 'Industri Peragian/Fermentasi Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses peragian/fermentasi, seperti peragian/fermentasi peda, ikan kayu, dan kecap ikan.', 'kbli_10215', NULL, NULL),
(252, '10216', 'Industri Berbasis Daging Lumatan Dan Surimi', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pelumatan daging ikan/ penggilingan. Termasuk industri daging lumat yang dicampur bahan tambahan melalui proses pemasakan atau tidak dimasak kemudian dibekukan.  Contoh berbasis daging lumatan dan surimi: mata goyang, kurisi, dll. Berbasis surimi: baso, nuget, otak-otak, kamaboko, sosis, pempek, siomay, dimsum, chikuwa, imitation crab.', 'kbli_10216', NULL, NULL),
(253, '10217', 'Industri Pendinginan/Pengesan Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pendinginan/pengesan.', 'kbli_10217', NULL, NULL),
(254, '10219', 'Industri Pengolahan Dan Pengawetan Lainnya untuk Ikan', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) dengan cara selain yang tercakup dalam kelompok 10211 s.d. 10217. Termasuk kegiatan kapal yang digunakan hanya untuk pengolahan dan pengawetan ikan dan biota air lainnya (dalam hal ini tidak termasuk pengalengannya), produksi tepung ikan untuk konsumsi manusia dan makanan hewan dan produksi daging dan bagian dari ikan bukan untuk konsumsi manusia, konsentrat tepung ikan. Termasuk dalam kelompok ini adalah industri pengolahan dan pengawetan ikan dengan menggunakan radiasi (dengan iradiator).', 'kbli_10219', NULL, NULL),
(255, '10221', 'Industri Pengolahan dan Pengawetan Ikan dan Biota Air  (Bukan Udang) Dalam Kaleng', 'Kelompok ini mencakup usaha pengolahan dan pengawetan ikan dan biota perairan lainnya kecuali udang melalui proses pengalengan, seperti ikan sardencis dalam kaleng, kerang dalam kaleng, lemuru dalam kaleng, mackarel  dalam kaleng, cephalopoda (cumi/gurita/sotong) dalam kaleng, tuna dalam kaleng, rajungan/kepiting dalam kaleng. Kegiatan kapal pengolah ikan yang hanya melakukan pengolahan dan pengawetan dalam kaleng (tanpa melakukan kegiatan penangkapan) termasuk dalam kelompok ini.', 'kbli_10221', NULL, NULL),
(256, '10222', 'Industri Pengolahan dan Pengawetan Udang Dalam Kaleng', 'Kelompok ini mencakup usaha pengolahan dan pengawetan udang melalui proses pengalengan (udang dalam kaleng). Kegiatan kapal pengolah udang yang hanya melakukan pengolahan dan pengawetan dalam kaleng (tanpa melakukan kegiatan penangkapan) termasuk dalam kelompok ini.', 'kbli_10222', NULL, NULL),
(257, '10291', 'Industri Penggaraman/Pengeringan Biota Air Lainnya', 'Kelompok ini mencakup usaha pengolahan dan pengawetan crustacea, mollusca, echinodermata dan biota perairan lainnya melalui proses penggaraman/pengeringan, seperti udang asin, cumi-cumi asin, ebi, ubur-ubur asin, sotong asin, teripang kering, sotong kering, dan lainnya.', 'kbli_10291', NULL, NULL),
(258, '10292', 'Industri Pengasapan/Pemanggangan Biota Air Lainnya', 'Kelompok ini mencakup usaha pengolahan dan pengawetan crustacea, mollusca, echinodermata dan biota perairan lainnya melalui proses pengasapan/pemanggangan, seperti sotong asap/panggang, teripang asap/panggang.', 'kbli_10292', NULL, NULL),
(259, '10293', 'Industri Pembekuan Biota Air Lainnya', 'Kelompok ini mencakup usaha pengawetan crustacea, mollusca, echinodermata dan biota perairan lainnya melalui proses pembekuan, seperti udang beku, paha kodok beku, cephalopoda (cumi/sotong/gurita) beku, kepiting/rajungan beku, dan kerang beku.  Kegiatan ini tidak termasuk usaha pendinginan crustacea, mollusca dan biota air lainnya dengan es yang dimaksud untuk mempertahankan kesegarannya (10297).', 'kbli_10293', NULL, NULL),
(260, '10294', 'Industri Pemindangan Biota Air Lainnya', 'Kelompok ini mencakup usaha pengolahan dan pengawetan crustacea, mollusca, echinodermata dan biota perairan lainnya melalui proses pemindangan.', 'kbli_10294', NULL, NULL),
(261, '10295', 'Industri Peragian/Fermentasi Biota Air Lainnya', 'Kelompok ini mencakup usaha pengolahan dan pengawetan crustacea, mollusca, echinodermata dan biota perairan lainnya melalui proses peragian/fermentasi seperti terasi udang.', 'kbli_10295', NULL, NULL),
(262, '10296', 'Industri Berbasis Lumatan Biota Air Lainnya', 'Kelompok ini mencakup usaha pengolahan dan pengawetan biota air lainnya melalui proses pelumatan daging/penggilingan/pencampuran bahan tambahan/pengukusan, seperti lumatan cumi, lumatan udang, baso udang, baso cumi, baso kepiting, dan kaki naga udang.', 'kbli_10296', NULL, NULL),
(263, '10297', 'Industri Pendinginan/Pengesan Biota Air Lainnya', 'Kelompok ini mencakup usaha pengolahan dan pengawetan crustacea, mollusca, echinodermata dan biota perairan lainnya melalui proses pendinginan/pengesan, seperti cumi segar, kerang segar, teripang segar, dan kepiting segar.', 'kbli_10297', NULL, NULL),
(264, '10298', 'Industri pengolahan rumput laut', 'Kelompok ini mencakup usaha pengolahan rumput laut menjadi rumput laut kering dan olahan (alkali treated caragenan chips), gelatin, agar-agar, karagenan dan lainnya.', 'kbli_10298', NULL, NULL),
(265, '10299', 'Industri Pengolahan Dan Pengawetan Lainnya untuk Biota Air Lainnya', 'Kelompok ini mencakup usaha pengolahan dan pengawetan crustacea, mollusca, echinodermata dan biota perairan lainnya dengan cara selain yang tercakup dalam kelompok 10291 s.d. 10298, seperti tepung udang, tepung kerang, dan tepung kodok. Termasuk dalam kelompok ini adalah industri pengolahan dan pengawetan untuk biota air lainnya dengan menggunakan radiasi (dengan iradiator).', 'kbli_10299', NULL, NULL),
(266, '10311', 'Industri Pengasinan Buah-buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pengasinan, baik dalam bentuk kemasan ataupun tidak, seperti asinan kedondong, asinan wortel.', 'kbli_10311', NULL, NULL),
(267, '10312', 'Industri Pelumatan Buah-buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pelumatan, baik dalam bentuk kemasan ataupun tidak, seperti selai mangga, jelly murbai, dan cabe giling.', 'kbli_10312', NULL, NULL),
(268, '10313', 'Industri Pengeringan Buah-buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan cara pengeringan, baik dalam bentuk kemasan ataupun tidak, seperti kismis (anggur), bawang merah, bawang putih, cabe kering, rebung kering dan jamur kering. Termasuk Industri keripik dari buah dan sayuran.', 'kbli_10313', NULL, NULL),
(269, '10314', 'Industri Pembekuan Buah-buahan Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pembekuan, seperti buah-buahan beku dan sayur-sayuran beku.', 'kbli_10314', NULL, NULL),
(270, '10320', 'Industri Pengolahan dan Pengawetan Buah-buahan dan Sayuran Dalam Kaleng', 'Kelompok ini mencakup usaha pengolahan dan pengawetan buah-buahan dan sayuran melalui proses pengalengan, seperti nanas dalam kaleng, rambutan dalam kaleng, kacang dalam kaleng dan wortel dalam kaleng. Yang dimaksud pengalengan di sini merupakan proses pengawetan dan bukan hanya pengemasan.', 'kbli_10320', NULL, NULL),
(271, '10330', 'Industri Pengolahan Sari Buah Dan Sayuran', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan cara pengolahan sari buah-buahan dan sayuran, seperti bubuk sari buah-buahan, air/sari pekat buah-buahan dan air/sari pekat sayuran (konsentrat), nektar buah dan atau sayuran.', 'kbli_10330', NULL, NULL),
(272, '10391', 'Industri Tempe Kedelai', 'Kelompok ini mencakup usaha pembuatan tempe dari kedelai. Usaha pembuatan tempe yang bahan bakunya selain kedelai (dari kacang tanah/kacang-kacangan lainnya), seperti tempe bongkrek, dimasukkan dalam kelompok 10393.', 'kbli_10391', NULL, NULL),
(273, '10392', 'Industri Tahu Kedelai', 'Kelompok ini mencakup usaha pembuatan tahu dari kedelai. Usaha pembuatan tahu yang bahan bakunya selain kedelai (dari kacang tanah/kacang-kacangan lainnya) dimasukkan dalam kelompok 10393.', 'kbli_10392', NULL, NULL),
(274, '10393', 'Industri Pengolahan dan Pengawetan Kedelai dan Kacang-kacangan Lainnya Selain Tahu dan Tempe', 'Kelompok ini mencakup usaha pengolahan dan pengawetan kedelai dan kacang-kacangan lainnya selain tahu dan tempe seperti natto, yuba/kembang tahu, fu zhu, dan douchi. Termasuk tempe gembus dan tempe bongkrek.', 'kbli_10393', NULL, NULL),
(275, '10399', 'Industri Pengolahan dan Pengawetan Lainnya Buah-buahan Dan Sayuran Bukan Kacang-kacangan', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran dengan cara selain yang tercakup dalam subgolongan 10391 s.d. 10393, seperti industri pengupasan kentang, produk buah-buahan dan sayuran yang diproses dengan pasteurisasi atau sterilisasi dan dikemas dalam kemasan selain kaleng.', 'kbli_10399', NULL, NULL),
(276, '10411', 'Industri Minyak Mentah dan Lemak Nabati', 'Kelompok ini mencakup usaha pengolahan bahan-bahan dari nabati menjadi minyak mentah (crude oil) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain (kecuali minyak mentah kelapa sawit (crude plam oil) dan minyak mentah kelapa) termasuk juga industri hasil lemak dari nabati yang dapat digunakan sebagai bahan makanan, seperti minyak bunga matahari.', 'kbli_10411', NULL, NULL),
(277, '10412', 'Industri Margarine', 'Kelompok ini mencakup usaha pembuatan margarine dari minyak makan nabati.', 'kbli_10412', NULL, NULL),
(278, '10413', 'Industri Minyak Mentah Dan Lemak Hewani Selain Ikan', 'Kelompok ini mencakup usaha pengolahan bahan-bahan dari hewani selain ikan menjadi minyak mentah dan lemak hewani, seperti minyak/lemak babi, lemak sapi dan lemak unggas.', 'kbli_10413', NULL, NULL),
(279, '10414', 'Industri Minyak Ikan', 'Kelompok ini mencakup usaha pembuatan minyak yang berbahan baku dari badan ikan yang berlemak tinggi, seperti lemuru, atau dari organ badan ikan seperti hati cucut.  Mencakup juga industri minyak yang dihasilkan dari hasil sampingan pengalengan ikan, seperti hasil pengalengan sarden.  Pengolahan minyak ikan/biota perairan lainnya yang digunakan untuk bahan farmasi ataupun kosmetik dimasukkan dalam subgolongan 2101 dan 2102.', 'kbli_10414', NULL, NULL),
(280, '10415', 'Industri Minyak Goreng Bukan Minyak Kelapa Dan Minyak Kelapa Sawit', 'Kelompok ini mencakup usaha pembuatan minyak goreng lainnya, bukan minyak goreng kelapa dan minyak goreng kelapa sawit, seperti minyak bekatul, minyak goreng babi dan minyak goreng unggas.', 'kbli_10415', NULL, NULL),
(281, '10421', 'Industri Kopra', 'Kelompok ini mencakup usaha pembuatan kopra.', 'kbli_10421', NULL, NULL),
(282, '10422', 'Industri Minyak Mentah Kelapa', 'Kelompok ini mencakup usaha pengolahan kelapa menjadi minyak mentah (crude oil) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain.', 'kbli_10422', NULL, NULL),
(283, '10423', 'Industri Minyak Goreng Kelapa', 'Kelompok ini mencakup usaha pengolahan lebih lanjut (pemurnian, pemucatan dan penghilangan bau yang tidak dikehendaki) dari minyak mentah kelapa menjadi minyak goreng kelapa.', 'kbli_10423', NULL, NULL),
(284, '10424', 'Industri Pelet Kelapa', 'Kelompok ini mencakup usaha pengolahan lebih lanjut kelapa, seperti pelet kelapa.', 'kbli_10424', NULL, NULL),
(285, '10431', 'Industri Minyak Mentah Kelapa Sawit (Crude Palm Oil)', 'Kelompok ini mencakup usaha pengolahan kelapa sawit menjadi minyak mentah (crude palm oil/CPO) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain.', 'kbli_10431', NULL, NULL),
(286, '10432', 'Industri Minyak Mentah Inti Kelapa Sawit (Crude Palm Kernel Oil)', 'Kelompok ini mencakup usaha pengolahan inti kelapa sawit menjadi minyak mentah inti  (crude palm kernel oil/CPKO) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain.', 'kbli_10432', NULL, NULL),
(287, '10433', 'Industri Pemisahan/Fraksinasi Minyak Mentah Kelapa Sawit dan Minyak Mentah Inti Kelapa Sawit', 'Kelompok ini mencakup pemisahan fraksi padat dan fraksi cair dari minyak mentah kelapa sawit menjadi minyak mentah kelapa sawit olein (Crude Palm Olein) dan minyak mentah kelapa sawit stearin (Crude Palm Stearin) atau dari minyak mentah inti kelapa sawit menjadi minyak mentah inti kelapa sawit olein (Crude Palm Kernel Olein) dan minyak mentah inti kelapa sawit stearin (Crude Palm Kernel Stearin) yang masih perlu diolah lebih lanjut.', 'kbli_10433', NULL, NULL),
(288, '10434', 'Industri Pemurnian Minyak Mentah Kelapa Sawit dan Minyak Mentah Inti Kelapa Sawit', 'Kelompok ini mencakup pemurnian minyak mentah dari kelapa sawit menjadi minyak murni kelapa sawit (Refined Bleached Deodorized  Palm Oil) atau dari minyak inti kelapa sawit menjadi minyak murni inti kelapa sawit (Refined  Bleached Deodorized Palm Kernel Oil) yang masih perlu diolah lebih lanjut.', 'kbli_10434', NULL, NULL),
(289, '10435', 'Industri Pemisahan/Fraksinasi Minyak Murni Kelapa Sawit', 'Kelompok ini mencakup usaha pemisahan fraksi padat dan fraksi cair dari minyak murni kelapa sawit menjadi miyak murni kelapa sawit olein (Refined Bleached Deodorized Palm Olein) dan minyak murni kelapa sawit stearin (Refined Bleached Deodorized Palm Stearin).', 'kbli_10435', NULL, NULL),
(290, '10436', 'Industri Pemisahan/Fraksinasi Minyak Murni Inti Kelapa Sawit', 'Kelompok ini mencakup usaha pemisahan fraksi padat dan fraksi cair dari minyak murni inti kelapa sawit menjadi minyak murni inti kelapa sawit olein (Refined Bleached Deodorized Palm Kernel Olein) dan miyak murni inti kelapa sawit stearin (Refined Bleached Deodorized Palm Kernel Stearin).', 'kbli_10436', NULL, NULL),
(291, '10437', 'Industri Minyak Goreng Kelapa Sawit', 'Kelompok ini mencakup usaha pengolahan lebih lanjut (pemurnian, pemucatan dan penghilangan bau yang tidak dikehendaki) dari minyak mentah kelapa sawit (CPO) menjadi minyak goreng kelapa sawit yang siap dikonsumsi. Termasuk pengolahan minyak merah kelapa sawit (red palm oil) dan/atau aktivitas penambahan zat tertentu pada minyak goreng untuk meningkatkan kualitas/nilai tambah.', 'kbli_10437', NULL, NULL),
(292, '10490', 'Industri Minyak Mentah Dan Lemak Nabati Dan Hewani Lainnya', 'Kelompok ini mencakup usaha pengolahan lainnya untuk minyak dan lemak, yang belum tercakup pada subgolongan 1041 s.d. 1043, seperti industri shorterning (minyak roti), industri minyak dan lemak dari binatang yang tidak dapat dimakan, produksi (linter) sisaan kapas, bungkil atau ampas dan hasil sisaan lainnya dari produksi minyak dan penyulingan minyak dari ikan dan mamalia laut.', 'kbli_10490', NULL, NULL),
(293, '10510', 'Industri Pengolahan Susu Segar dan Krim', 'Kelompok ini mencakup usaha industri pengolahan susu cair segar, susu dipasteurisasi, disterilisasi, homogenisasi dan atau pemanasan ultra (UHT) dan industri pengolahan krim dari susu cair segar, pasteurisasi, sterilisasi dan homogenisasi, dalam bentuk cair atau semi cair dan produk sejenis lainnya.', 'kbli_10510', NULL, NULL),
(294, '10520', 'Industri Pengolahan Susu Bubuk dan Susu Kental', 'Kelompok ini mencakup usaha industri pengolahan susu bubuk atau susu kental atau krimer kental, susu evaporasi, dengan pemanis atau tidak dan industri pengolahan susu atau krim dalam bentuk yang padat, dan produk sejenis lainnya.', 'kbli_10520', NULL, NULL),
(295, '10531', 'Industri Pengolahan Es Krim', 'Kelompok ini mencakup usaha pembuatan berbagai macam es krim yang bahan utamanya dari susu. Pembuatan es krim yang bahan utamanya bukan dari susu dimasukkan dalam kelompok 10532.', 'kbli_10531', NULL, NULL),
(296, '10532', 'Industri Pengolahan Es Sejenisnya Yang Dapat Dimakan (Bukan Es Batu dan Es Balok)', 'Kelompok ini mencakup usaha pembuatan berbagai macam es yang bahan utamanya bukan dari susu, seperti sorbet, es lilin, ice drop, es dengan berbagai rasa lainnya, es mambo dan es puter, premiks es rasa dan produk sejenis es untuk dimakan lainnya. Usaha es kering (dry ice) dimasukkan dalam kelompok 20112.', 'kbli_10532', NULL, NULL),
(297, '10590', 'Industri Pengolahan Produk dari Susu Lainnya', 'Kelompok ini mencakup usaha pengolahan produk dari susu lainnya, seperti mentega, yoghurt, keju dan dadih, air dadih, kaseinatau laktosa (susu manis), premiks es krim bubuk (bubuk es krim), premiks es krim cair, susu fermentasi, whey, dan produk-produk olahan susu sejenis lainnya. Pembuatan es krim yang bahan utamanya dari susu dimasukkan dalam kelompok 10531', 'kbli_10590', NULL, NULL),
(298, '10611', 'Industri Penggilingan Gandum dan Serelia Lainnya', 'Kelompok ini mencakup usaha penggilingan gandum dan serelia lainnya menjadi tepung dan pelet , seperti gandum dan sorghum, rye, oat dan  serelia lainnya.', 'kbli_10611', NULL, NULL),
(299, '10612', 'Industri Penggilingan Aneka Kacang (Termasuk leguminous)', 'Kelompok ini mencakup usaha pembuatan tepung dari aneka kacang melalui proses penggilingan, seperti tepung tepung kacang hijau, tepung kacang kedelai dan tepung lainnya (seperti dari kacang tanah, kacang merah dan tanaman leguminous lainnya).', 'kbli_10612', NULL, NULL),
(300, '10613', 'Industri Penggilingan Aneka  Umbi Dan Sayuran (Termasuk Rhizoma)', 'Kelompok ini mencakup usaha pembuatan tepung dari aneka umbi dan sayuran termasuk rhizoma melalui proses penggilingan, seperti tepung dari ubi kayu (gaplek), ubi jalar, talas, irut, jahe, temulawak, kunyit dan kapulaga dan sayuran.', 'kbli_10613', NULL, NULL),
(301, '10614', 'Industri Tepung Campuran dan Adonan Tepung', 'Kelompok ini mencakup usaha pembuatan  tepung campuran dan adonan tepung yang sudah dicampur untuk roti, kue, biskuit, kue dadar, termasuk tepung untuk adonan, misalnya untuk melapisi permukaan ikan atau daging ayam, seperti tepung pelapis, tepung bumbu, tepung bakwan, tepung bakso, premiks untuk makanan pencuci mulut berbasis serealia dan pati dan tepung custard tanpa telur.', 'kbli_10614', NULL, NULL),
(302, '10615', 'Industri Makanan Sereal', 'Kelompok ini mencakup usaha pembuatan makanan sereal termasuk semua jenis produk sereal siap santap, instan dan sereal panas. Contoh rolled sereal, granola sereal, oatmeal instan, corn flakes, puffed gandum atau beras, muesli,produk sereal dari kedelai dan produk sereal dari tepung serealia dengan menggunakan proses ekstrusi.', 'kbli_10615', NULL, NULL),
(303, '10616', 'Industri Tepung Terigu', 'Kelompok ini mencakup usaha pembuatan tepung terigu.', 'kbli_10616', NULL, NULL),
(304, '10621', 'Industri Pati Ubi Kayu', 'Kelompok ini mencakup usaha pembuatan pati ubi kayu melalui ekstraksi, seperti tepung tapioka.', 'kbli_10621', NULL, NULL),
(305, '10622', 'Industri Berbagai Macam Pati Palma', 'Kelompok ini mencakup usaha pembuatan pati dari berbagai macam tanaman suku palma, seperti pati sagu/pati mutiara dan pati aren.', 'kbli_10622', NULL, NULL),
(306, '10623', 'Industri Glukosa Dan Sejenisnya', 'Kelompok ini mencakup usaha pembuatan gula glukosa, selain yang termasuk dalam kelompok 10721 dan 10722, seperti glucosa, fructosa, lactosa, maltosa, sacharosa, dan sediaan pemanis lainnya. Termasuk  pemanis  buatan.', 'kbli_10623', NULL, NULL),
(307, '10629', 'Industri Pati dan Produk Pati Lainnya', 'Kelompok ini mencakup usaha pembuatan berbagai macam pati melalui proses ekstraksi yang belum termasuk kelompok 10621 s.d. 10623, seperti pati kentang, pati bengkoang, pati temulawak, pati irut dan pati biji mangga.', 'kbli_10629', NULL, NULL),
(308, '10631', 'Industri Penggilingan Padi Dan Penyosohan Beras', 'Kelompok ini mencakup usaha penggilingan padi menjadi beras, termasuk penyosohan beras yang terpisah dengan usaha penggilingan padi.', 'kbli_10631', NULL, NULL),
(309, '10632', 'Industri Penggilingan Dan Pembersihan Jagung', 'Kelompok ini mencakup usaha penggilingan dan pembersihan jagung.', 'kbli_10632', NULL, NULL),
(310, '10633', 'Industri Tepung Beras Dan Tepung Jagung', 'Kelompok ini mencakup usaha pembuatan tepung beras dan tepung jagung.', 'kbli_10633', NULL, NULL),
(311, '10634', 'Industri Pati Beras dan Jagung', 'Kelompok ini mencakup usaha pembuatan pati beras dan pati jagung (maizena).', 'kbli_10634', NULL, NULL),
(312, '10635', 'Industri Pemanis dari Beras dan Jagung', 'Kelompok ini mencakup usaha pembuatan pemanis dari beras dan jagung seperti fructosa, glucosa, maltosa, sacharosa dan dextrosa.', 'kbli_10635', NULL, NULL),
(313, '10636', 'Industri Minyak Dari Jagung dan Beras', 'Kelompok ini mencakup usaha pembuatan minyak dari dan jagung dan beras.', 'kbli_10636', NULL, NULL),
(314, '10710', 'Industri Produk Roti Dan Kue', 'Kelompok ini mencakup usaha pembuatan berbagai macam roti, kue dan produk bakeri lainnya seperti industri roti tawar dan roti kadet; industri kue, pie, tart; industri biskuit dan produk roti kering lainnya; industri pengawetan kue kering dan cake; industri produk makanan ringan baik yang manis atau asin; industri tortillas; dan industri produk roti yang dibekukan, seperti pancake, waffle dan roti kadet.', 'kbli_10710', NULL, NULL),
(315, '10721', 'Industri Gula Pasir', 'Kelompok ini mencakup usaha pembuatan gula yang berbentuk kristal (pasir), bahan utamanya dari tebu, bit ataupun lainnya.', 'kbli_10721', NULL, NULL),
(316, '10722', 'Industri Gula Merah', 'Kelompok ini mencakup usaha pembuatan gula merah baik berbentuk cetakan, serbuk/granul maupun cair, yang murni dari nira sebagai bahan baku baik berasal dari  tebu maupun tanaman palma (aren, kelapa dan sejenisnya).', 'kbli_10722', NULL, NULL),
(317, '10723', 'Industri Sirop', 'Kelompok ini mencakup usaha pengolahan gula menjadi sirop, seperti industri sirup gula dan produksi sirup dan gula maple. Kegiatan pembuatan sirop yang tergabung dengan pabrik gula dan tidak dapat dipisahkan tersendiri dimasukkan dalam kelompok 10721 atau 10722.', 'kbli_10723', NULL, NULL),
(318, '10729', 'Industri Pengolahan Gula Lainnya Bukan Sirop', 'Kelompok ini mencakup usaha pengolahan gula ke dalam bentuk lain, termasuk pembuatan gula batu, gula cair, tepung gula, gula pengganti dari jus tebu, bit, maple gula cair, gula stevia, kelapa, nira, aren dan molasse (harum manis), toping (non-buah) saus manis, dan gula merah yang tidak murni dari nira sebagai bahan baku utamanya dan yang tidak termasuk dalam kelompok 10721 sd. 10723.', 'kbli_10729', NULL, NULL),
(319, '10731', 'Industri Kakao', 'Kelompok ini mencakup usaha pengolahan biji kakao menjadi bubuk kakao, lemak kakao, pasta kakao, bungkil kakao dan produk kakao lainnya.', 'kbli_10731', NULL, NULL),
(320, '10732', 'Industri Makanan Dari Cokelat Dan Kembang Gula dari Coklat', 'Kelompok ini mencakup usaha pembuatan segala macam makanan yang bahan utamanya dari cokelat seperti cokelat, cokelat compound, coklat couverture, cokelat imitasi, coklat putih, gula-gula dari cokelat, olesan dan isian berbasis kakao. Termasuk industri minuman dari cokelat dalam bentuk bubuk maupun cair.', 'kbli_10732', NULL, NULL),
(321, '10733', 'Industri Manisan Buah-buahan Dan Sayuran Kering', 'Kelompok ini mencakup usaha pengawetan buah-buahan dan sayuran baik buah, kacang, kulit buah dan bagian lain dari tumbuhan dengan proses pemanisan dan pengeringan, baik dalam bentuk kemasan ataupun tidak, seperti manisan pala dan manisan mangga kering, sayuran dan buah-buahan kering lainnya.', 'kbli_10733', NULL, NULL),
(322, '10734', 'Industri Kembang Gula', 'Kelompok ini mencakup usaha pembuatan kembang gula termasuk seluruh kembang gula keras, kembang gula lunak, kembang gula karet, caramel, cachous, nougat, foundant, dan marzipan, yang bahan utamanya bukan dari coklat.', 'kbli_10734', NULL, NULL),
(323, '10739', 'Industri Kembang Gula Lainnya', 'Kelompok ini mencakup usaha industri kembang gula lainnya, yang tidak termasuk pada kategori 10731 sd. 10734 seperti permen karet dan permen obat batuk dan pastilles.', 'kbli_10739', NULL, NULL),
(324, '10750', 'Industri Makanan dan Masakan Olahan', 'Kelompok ini mencakup industri makanan siap saji (diolah, dibumbui dan dimasak)  diolah untuk tujuan diawetkan dalam kaleng atau dibekukan dan biasanya dikemas dan dilabel untuk dijual kembali. Mencakup juga industri masakan daging atau unggas, industri masakan ikan (kecuali masakan ikan dan udang dalam kaleng), industri masakan sayuran siap saji, industri masakan rebusan dalam kaleng dan makanan di dalam wadah hampa udara dan industri masakan siap saji yang lain. Termasuk industri pizza beku, pepes, presto, dendeng ikan, baby fish goreng/crispy ikan, udang tepung dan ikan tepung.', 'kbli_10750', NULL, NULL),
(325, '10761', 'Industri Pengolahan Kopi', 'Kelompok ini mencakup usaha penyangraian, penggilingan dan pensarian (ekstraksi) kopi menjadi berbagai macam bubuk atau cairan, seperti kopi sangrai, kopi bubuk, kopi instan, ekstrak dan sari kopi. Termasuk industri pengganti kopi. Penggilingan kopi bubuk di tempat pedagang kopi dimasukkan dalam kelompok 47222 dan 47823.', 'kbli_10761', NULL, NULL),
(326, '10762', 'Industri Pengolahan Herbal (herb infusion)', 'Kelompok ini mencakup usaha pengolahan herbal (mint, vervain, chamomil). Termasuk industri seduhan herbal.', 'kbli_10762', NULL, NULL),
(327, '10763', 'Industri Pengolahan Teh', 'Kelompok ini mencakup usaha pengolahan daun teh menjadi teh. Termasuk kegiatan pencampuran teh dan mate, industri ekstraksi dan olahan berbahan dasar teh dan mate.', 'kbli_10763', NULL, NULL),
(328, '10771', 'Industri Kecap', 'Kelompok ini mencakup usaha pembuatan kecap dari kedele/kacang-kacangan lainnya, dan pembuatan tauco (baik dari kedelai/kacang-kacangan lainnya yang masih segar, maupun dari hasil sisa pembuatan kecap). Usaha pembuatan kecap ikan tercakup dalam kelompok 10215.', 'kbli_10771', NULL, NULL),
(329, '10772', 'Industri Bumbu Masak Dan Penyedap Masakan', 'Kelompok ini mencakup usaha pembuatan bumbu masak dalam keadaan sudah diramu atau belum, baik berbentuk bubuk ataupun lainnya, seperti bumbu gulai, bumbu kari, bumbu merica, bubuk jahe, bubuk jinten, bubuk pala, bubuk cabe dan bubuk kayu manis. Termasuk usaha industri penyedap masakan baik yang asli, natura maupun sintesa khemis, seperti vetsin dan serbuk panili dan industri bumbu-bumbu, saus dan rempah-rempah, seperti mayonais, tepung mustar, mustar olahan, sauce tomat, sauce selada, dan pengganti garam yang digunakan sebagai bumbu pada produk pangan.', 'kbli_10772', NULL, NULL),
(330, '10773', 'Industri Produk Masak Dari Kelapa', 'Kelompok ini mencakup usaha pembuatan produk masak dari kelapa yang belum tercakup dalam golongan manapun, seperti santan pekat dan santan cair, kecap kelapa, sari kelapa (nata de coco), kelapa parut kering (dicicated coconut), krim kelapa dan tepung kelapa.', 'kbli_10773', NULL, NULL),
(331, '10774', 'Industri Pengolahan Garam', 'Kelompok ini mencakup usaha pengolahan garam dapur/konsumsi.', 'kbli_10774', NULL, NULL),
(332, '10779', 'Industri Produk Masak  Lainnya', 'Kelompok ini mencakup usaha pembuatan petis, saus tiram, terasi, khitin/khitosan, atau yang sejenisnya, dengan bahan baku utamanya ikan dan udang ataupun bagian-bagiannya, industri madu dan karamel buatan,  industri ekstraksi dan jus dari daging dan ikan, industri konsentrat buatan/pembuatan macam-macam makanan yang belum tercakup dalam golongan manapun, seperti cincau, gist, baking powder, essence dan cuka makan. Usaha pembuatan terasi udang tercakup dalam kelompok 10295.', 'kbli_10779', NULL, NULL),
(333, '10791', 'Industri Makanan Bayi', 'Kelompok ini mencakup usaha pembuatan makanan bayi, seperti formula bayi, susu lanjutan dan makanan lanjutan lainnya, makanan bayi dan makanan yang mengandung bahan yang dihomogenisasi. Termasuk pembuatan pangan diet dan keperluan medis khusus bayi dan anak, seperti formula pertumbuhan, makanan pendamping ASI, dan makanan selingan untuk anak.', 'kbli_10791', NULL, NULL),
(334, '10792', 'Industri Kue Basah', 'Kelompok ini mencakup usaha pembuatan macam-macam makanan kue basah, yaitu sejenis kue yang relatif tidak tahan lama, seperti wajik, lemper, kue lapis, lumpia, dan martabak (termasuk pembuatan tape dan lempok).', 'kbli_10792', NULL, NULL),
(335, '10793', 'Industri Makanan Dari Kedele Dan Kacang-kacangan Lainnya Bukan Kecap, Tempe Dan Tahu', 'Kelompok ini mencakup usaha pembuatan makanan dari kedele/kacang-kacangan lainnya bukan kecap dan tempe, seperti keripik/peyek dari kacang-kacangan, daging sintetis, kacang kapri, kacang asin, kacang telur, kacang sukro, kacang bogor, kacang atom, kacang mete dan enting-enting. Termasuk produk protein kedelai dan texturized vegetable protein.', 'kbli_10793', NULL, NULL),
(336, '10794', 'Industri Kerupuk, Keripik, Peyek Dan Sejenisnya', 'Kelompok ini mencakup usaha industri berbagai macam kerupuk, keripik, peyek dan sejenisnya, seperti kerupuk udang, kerupuk ikan dan kerupuk pati (kerupuk terung). Dan usaha pembuatan berbagai macam makanan sejenis kerupuk, seperti macam-macam emping, kecimpring, karak, gendar, opak, keripik paru, keripik bekicot dan keripik kulit, peyek teri, peyek udang. Kegiatan atau usaha pembuatan keripik/peyek dari kacang kacangan dimasukkan dalam kelompok 10793', 'kbli_10794', NULL, NULL),
(337, '10795', 'Industri Krimer Nabati', 'Kelompok ini mencakup usaha pembuatan krimer nabati emulsi lemak nabati yang berasal dari kelapa atau kelapa sawit yang digunakan sebagai campuran makanan atau minuman.', 'kbli_10795', NULL, NULL),
(338, '10796', 'Industri Dodol', 'Kelompok ini mencakup usaha pembuatan dodol yang terbuat diperoleh dari bahan utama tepung beras atau tepung beras ketan, santan kelapa dan gula, dengan atau tanpa bahan tambahan lain yang dimasak hingga mencapai tekstur yang diinginkan.\r\nPembuatan lempok masuk kedalam kelompok 10792', 'kbli_10796', NULL, NULL),
(339, '10799', 'Industri Produk Makanan Lainnya', 'Kelompok ini mencakup usaha pembuatan produk makanan lainnya yang tidak diklasifikasikan di tempat lain, seperti telur asin, soup dan kaldu, makanan yang tidak tahan lama, seperti sandwich, pizza mentah, selongsong sosis dari kolagen, selulosa, usus hewan, dan lainnya. Termasuk industri ragi, susu dan keju pengganti dari selain susu dan produk telur dan albumin telur, pangan diet khusus dewasa dan pangan keperluan medis khusus dewasa, seperti minuman untuk ibu hamil dan menyusui, makanan untuk penderita penyakit tertentu, pangan protein produk seperti Hydrolised Vegetable Protein (HVP).', 'kbli_10799', NULL, NULL),
(340, '10801', 'Industri Ransum Makanan Hewan', 'Kelompok ini mencakup usaha pembuatan berbagai macam ransum pakan ternak, unggas, ikan dan hewan lainnya.', 'kbli_10801', NULL, NULL),
(341, '10802', 'Industri Konsentrat Makanan Hewan', 'Kelompok ini mencakup usaha pembuatan konsentrat pakan ternak, unggas dan hewan lainnya. Pengolahan konsentrat pakan ternak, unggas dan hewan lainnya yang tidak dapat di pisahkan dari usaha peternakan dimasukkan dalam golongan 014(Peternakan).', 'kbli_10802', NULL, NULL),
(342, '11010', 'Industri Minuman Beralkohol Hasil Destilasi', 'Kelompok ini mencakup industri pengolahan minuman yang menggunakan bahan baku alkohol (ethyl alcohol) dengan proses destilasi seperti whisky, brandy, rum, gin, liqueurs, tidak termasuk residu sulphite dari pabrik pulp dan pencampuran minuman beralkohol, termasuk produk minuman beralkohol netral (tanpa rasa/flavor) dan produk minuman beralkohol hasil destilasi yang dibuat secara tradisional. Industri alkohol murni dimasukkan dalam kelompok 20115.', 'kbli_11010', NULL, NULL),
(343, '11020', 'Industri Minuman Beralkohol Hasil Fermentasi Anggur dan Hasil Pertanian Lainnya', 'Kelompok ini mencakup industri pengolahan minuman secara fermentasi dengan bahan baku anggur, apel, buah-buahan lain atau hasil pertanian lainnya, seperti beras, sayuran, daun, batang dan akar (kecuali malt). Kegiatan yang tercakup adalah industri minuman anggur, sparkling wine, minuman anggur dari sari anggur, fermentasi tanpa destilasi  minuman beralkohol, seperti sake, sari buah apel, perry, mead, minuman anggur dari buah lain dan minuman campuran yang mengandung alkohol, minuman anggur putih dan sejenisnya, fermentasi tanpa destilasi minuman beralkohol yang dibuat secara tradisional, pencampuran minuman anggur dan minuman anggur beralkohol rendah atau tidak beralkohol.', 'kbli_11020', NULL, NULL),
(344, '11031', 'Industri Minuman Beralkohol Hasil Fermentasi Malt', 'Kelompok ini mencakup industri minuman beralkohol  dari malt, seperti bir, ale, porter dan stout. Termasuk Industri bir beralkohol rendah atau tanpa alkohol.', 'kbli_11031', NULL, NULL),
(345, '11032', 'Industri Malt', 'Kelompok ini mencakup industri pembuatan malt (kecambah barley atau sereal lainnya yang dikeringkan).', 'kbli_11032', NULL, NULL),
(346, '11040', 'Industri Minuman Ringan', 'Kelompok ini mencakup usaha industri minuman yang tidak mengandung alkohol, kecuali bir dan anggur tanpa alkohol. Termasuk industri minuman ringan beraroma tanpa alkohol dan atau rasa manis, seperti lemonade, orangeade, cola, minuman buah, air tonik, limun, air soda, krim soda dan air anggur, minuman yang dikarbonasi maupun tidak, dan minuman yang mengandung konsentrat, dan minuman serbuk.', 'kbli_11040', NULL, NULL),
(347, '11050', 'INDUSTRI AIR MINUM DAN AIR MINERAL', 'Kelompok ini mencakup usaha pembuatan air minum dalam kemasan dan air mineral, air mineral alami, air demineral, termasuk industri air isi ulang.', 'kbli_11050', NULL, NULL),
(348, '11051', 'Industri Air Kemasan', 'Kelompok ini mencakup usaha industri yang melakukan proses pengolahan air baku menjadi air minum yang dikemas dan siap dikonsumsi langsung, mengandung mineral ataupun tidak, dengan atau tanpa penambahan gas seperti O2 ataupun CO2, dengan atau tanpa penambahan mineral.', 'kbli_11051', NULL, NULL),
(349, '11052', 'Industri Air Minum Isi Ulang', 'Kelompok ini mencakup industri air minum yang dapat langsung dikonsumsi berupa depot air isi ulang baik yang dioperasikan manual oleh manusia maupun mesin pengisi otomatis (automatic tap water machine) dengan menggunakan wadah dan tutup tanpa merk yang dapat disediakan oleh depot dan/atau dibawa sendiri oleh konsumen.', 'kbli_11052', NULL, NULL),
(350, '11090', 'Industri Minuman Lainnya', 'Kelompok ini mencakup usaha industri minuman lainnya yang tidak termasuk dalam subgolongan 1101 s.d 1105, seperti minuman penyegar, nira, air tebu, air kelapa, minuman sereal panas, serbuk sekoteng, dan serealia celup.', 'kbli_11090', NULL, NULL),
(351, '12011', 'Industri Sigaret Kretek Tangan', 'Kelompok ini mencakup usaha pembuatan kretek yang mengandung tembakau rajangan, krosok rajang, cengkeh rajang, dan tambahan bahan-bahan perisa, yang menghasilkan campuran beraroma khas, dilinting dengan berbagai bahan pembungkus (ambri/papir/tipping).  Termasuk industri kretek tangan, kretek tangan dan kretek tangan filter.', 'kbli_12011', NULL, NULL),
(352, '12012', 'Industri Rokok Putih', 'Kelompok ini mencakup usaha pembuatan rokok putih yang tidak mengandung komponen cengkeh.', 'kbli_12012', NULL, NULL),
(353, '12013', 'Industri Sigaret Kretek Mesin', 'Kelompok ini mencakup usaha pembuatan kretek yang mengandung tembakau rajangan, krosok rajang, cengkeh rajang, dan tambahan bahan-bahan perisa, yang menghasilkan campuran beraroma khas, dilinting dengan berbagai bahan pembungkus (ambri/papir/tipping). Termasuk industri kretek mesin.', 'kbli_12013', NULL, NULL),
(354, '12019', 'Industri Rokok Lainnya', 'Kelompok ini mencakup usaha pembuatan rokok lainnya, selain kretek atau rokok putih, seperti cerutu, rokok kelembak menyan dan rokok klobot/kawung, tembakau iris (TIS), cerutek, dan hasil pengolahan tembakau lainnya (HPTL). Termasuk industri tembakau pipa, tembakau yang dikunyah dan tembakau sedot (snuff).', 'kbli_12019', NULL, NULL),
(355, '12091', 'Industri Pengeringan Dan Pengolahan Tembakau', 'Kelompok ini mencakup usaha pengeringan daun tembakau dengan pengasapan atau dengan cara lain termasuk juga usaha perajangan daun tembakau.', 'kbli_12091', NULL, NULL),
(356, '12099', 'Industri Bumbu Rokok Serta Kelengkapan Rokok Lainnya', 'Kelompok ini mencakup industri pengolahan tembakau yang belum diklasifikasikan ditempat lain, seperti industri homogenisasi atau rekonstitusi tembakau dan tembakau bersaus. Termasuk pembuatan bumbu rokok, serta kelengkapan  rokok lainnya, seperti kelembak menyan, saus rokok/tembakau, uwur, klobot, kawung serta pembuatan filter.', 'kbli_12099', NULL, NULL),
(357, '13111', 'Industri Persiapan Serat Tekstil', 'Kelompok ini mencakup usaha persiapan serat tekstil, seperti reeling (pilin/menggulung) dan pencucian serat sutera, degreasasi (penghilangan lemak) dan karbonisasi wol dan pencelupan bulu domba, termasuk proses penyusunan dan penyisiran (carding atau combing) dari serat rambut hewan serat tumbuhan, dan serat buatan (sintetis dan artifisial).', 'kbli_13111', NULL, NULL),
(358, '13112', 'Industri Pemintalan Benang', 'Kelompok ini mencakup usaha pemintalan serat menjadi benang, kecuali benang jahit. Termasuk kegiatan penteksturan, penyimpulan, pelipatan dan pencucian benang rajutan filamen sintetis dan benang artifisial (dari bubur kayu).', 'kbli_13112', NULL, NULL),
(359, '13113', 'Industri Pemintalan Benang Jahit', 'Kelompok ini mencakup usaha pembuatan benang jahit, baik dengan bahan baku serat maupun benang.  termasuk kegiatan penteksturan, penyimpulan, pelipatan dan pencucian benang jahit.', 'kbli_13113', NULL, NULL),
(360, '13121', 'Industri Pertenunan (Bukan Pertenunan Karung Goni Dan Karung Lainnya)', 'Kelompok ini mencakup usaha pertenunan, baik yang dibuat dengan alat gedogan, alat tenun bukan mesin (ATBM), alat tenun mesin (ATM) ataupun alat tenun lainnya, termasuk pembuatan sarung, kecuali industri kain tenun ikat. Usaha pertenunan karung goni dan karung lainnya dimasukkan dalam kelompok 13925, 13926, 13929.', 'kbli_13121', NULL, NULL),
(361, '13122', 'Industri Kain Tenun Ikat', 'Kelompok ini mencakup usaha pembuatan kain tenun ikat dan usaha pewarnaan benang dengan cara mengikat terlebih dahulu.', 'kbli_13122', NULL, NULL),
(362, '13123', 'Industri Bulu Tiruan Tenunan', 'Kelompok ini mencakup usaha pembuatan bulu tiruan dengan penenunan.', 'kbli_13123', NULL, NULL),
(363, '13131', 'Industri Penyempurnaan Benang', 'Kelompok ini mencakup usaha pengelantangan, pencelupan dan penyempurnaan lainnya untuk benang maupun benang jahit.', 'kbli_13131', NULL, NULL),
(364, '13132', 'Industri Penyempurnaan Kain', 'Kelompok ini mencakup usaha pengelantangan, pencelupan dan penyempurnaan lainnya untuk kain.', 'kbli_13132', NULL, NULL),
(365, '13133', 'Industri Pencetakan Kain', 'Kelompok ini mencakup usaha pencetakan kain dengan media perantara seperti kasa dan sebagainya, termasuk juga pencetakan kain motif batik.', 'kbli_13133', NULL, NULL),
(366, '13134', 'Industri Batik', 'Kelompok ini mencakup usaha pembatikan dengan proses malam (lilin), baik yang dilakukan dengan tulis, cap maupun kombinasi antara cap dan tulis.', 'kbli_13134', NULL, NULL),
(367, '13911', 'Industri Kain Rajutan', 'Kelompok ini mencakup usaha pembuatan kain yang dibuat dengan cara rajut seperti handuk, kain ihram, vitrase.', 'kbli_13911', NULL, NULL),
(368, '13912', 'Industri Kain Sulaman', 'Kelompok ini mencakup usaha kain sulaman dikerjakan dengan tangan.', 'kbli_13912', NULL, NULL),
(369, '13913', 'Industri Bulu Tiruan Rajutan', 'Kelompok ini mencakup usaha pembuatan bulu tiruan rajutan.', 'kbli_13913', NULL, NULL),
(370, '13921', 'Industri Barang Jadi Tekstil Untuk Keperluan Rumah Tangga', 'Kelompok ini mencakup usaha pembuatan barang-barang jadi tekstil, seperti selimut, seprei, taplak meja, sarung bantal, bed cover, gorden, handuk, sarung alas kursi, sajadah/penutup lantai yang dibuat dengan proses penggabungan dan/atau penjahitan beberapa bahan tekstil, selubung mobil dan selimut listrik dan lain-lain. Sajadah/penutup lantai dari karpet/permadani dimasukkan dalam kelompok 13930.', 'kbli_13921', NULL, NULL),
(371, '13922', 'Industri Barang Jadi Tekstil Sulaman', 'Kelompok ini mencakup usaha barang jadi tekstil sulaman, baik yang dikerjakan dengan tangan maupun dengan mesin, seperti pakaian/barang jadi sulaman dan badge.', 'kbli_13922', NULL, NULL),
(372, '13923', 'Industri Bantal dan Sejenisnya', 'Kelompok ini mencakup usaha pembuatan bantal dan sejenisnya, seperti bantal dan guling, selimut kapas, selimut bulu angsa, bantal kursi, kantong tidur dan lain-lain dari kapuk, dakron dan sejenisnya.', 'kbli_13923', NULL, NULL),
(373, '13924', 'Industri Barang Jadi Rajutan dan Sulaman', 'Kelompok ini mencakup usaha pembuatan barang jadi rajutan, seperti kaos lampu, deker, bando.', 'kbli_13924', NULL, NULL),
(374, '13925', 'Industri Karung Goni', 'Kelompok ini mencakup usaha pembuatan karung goni.', 'kbli_13925', NULL, NULL),
(375, '13926', 'Industri Karung Bukan Goni', 'Kelompok ini mencakup usaha pembuatan karung bagor (karung terigu/gula blacu) dan karung lainnya. Kecuali pembuatan karung plastik masuk dalam kelompok 22220.', 'kbli_13926', NULL, NULL),
(376, '13929', 'Industri Barang Jadi Tekstil Lainnya', 'Kelompok ini mencakup usaha pembuatan barang jadi tekstil lainnya, seperti layar, tenda, bendera, terpal, parasut, pelampung/jaket penyelamat dan lain-lain: lap pembersih, serbet piring dan barang perlengkapan sejenisnya dan lain-lain.', 'kbli_13929', NULL, NULL),
(377, '13930', 'Industri Karpet dan Permadani', 'Kelompok ini mencakup usaha pembuatan karpet, permadani, sajadah, dan sejenisnya yang terbuat dari serat, baik serat alam, sintetis maupun serat campuran, baik yang dikerjakan dengan proses tenun (woven), tufting, braiding, flocking dan needle punching. Termasuk industri penutup lantai dari lakan atau bulu kempa yang dibuat dengan jarum tenun. Karpet yang terbuat dari bahan-bahan gabus, karet atau plastik  masing-masing dimasukkan dalam kelompok 16299, 22191 atau 22210. Sajadah/penutup lantai yang dibuat dengan proses penggabungan dan/atau penjahitan beberapa bahan tekstil dimasukkan dalam kelompok 13921. Kain alas lantai dengan lapisan permukaan keras dimasukkan dalam kelompok 13999.', 'kbli_13930', NULL, NULL),
(378, '13941', 'Industri Tali', 'Kelompok ini mencakup usaha pembuatan berbagai macam tali, baik terbuat dari serat alam maupun serat sintetis atau serat campuran, seperti tali rami, tali goni (yute), tali sisal (agave), tali rafia dan tali nylon.', 'kbli_13941', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(379, '13942', 'Industri Barang Dari Tali', 'Kelompok ini mencakup usaha pembuatan barang-barang dari tali, seperti jaring ikan, jala ikan, tali kapal, tali sepatu, sumbu kompor dan sumbu lampu, baik terbuat dari tali serat alam, tali serat sintetis atau tali serat campuran.', 'kbli_13942', NULL, NULL),
(380, '13991', 'Industri Kain Pita (Narrow Fabric)', 'Kelompok ini mencakup usaha pembuatan kain pita, seperti kain pita, renda, kain label, velcro, dan badges.', 'kbli_13991', NULL, NULL),
(381, '13992', 'Industri Yang Menghasilkan Kain Keperluan Industri', 'Kelompok ini mencakup usaha pembuatan kain dilapisi/ditutupi/diresapi dengan plastik atau karet dan selanjutnya digunakan untuk keperluan industri, seperti kain terpal, kain layar, kain tenda, kain payung, kain kanvas untuk melukis dan kulit imitasi dari media tekstil.', 'kbli_13992', NULL, NULL),
(382, '13993', 'Industri Non Woven (bukan Tenunan)', 'Kelompok ini mencakup usaha industri kain yang dibuat tanpa dengan proses anyaman atau perajutan, seperti kain kempa, kain felting dan kain laken. Termasuk industri kain untuk keperluan pelayanan kesehatan manusia, seperti duk operasi (surgical drape); baju, masker, penutup kepala dan perlengkapan non woven lain untuk operasi; dan pembalut luka non woven.', 'kbli_13993', NULL, NULL),
(383, '13994', 'Industri Kain Ban', 'Kelompok ini mencakup usaha pembuatan kain ban dari benang sintetik kekuatan tinggi, seperti kain ban dari nylon dan kain ban dari polyester.', 'kbli_13994', NULL, NULL),
(384, '13995', 'Industri Kapuk', 'Kelompok ini mencakup usaha pengolahan kapuk.', 'kbli_13995', NULL, NULL),
(385, '13996', 'Industri Kain Tulle dan Kain Jaring', 'Kelompok ini mencakup usaha pembuatan kain tulle, kain trikot, kain bordir, dan kain jaring lainnya. Jaring ikan dikelompokkan ke dalam 13942.', 'kbli_13996', NULL, NULL),
(386, '13999', 'Industri Tekstil Lainnya YTDL', 'Kelompok ini mencakup usaha industri tekstil lainnya yang belum/tidak tercakup dalam golongan industri tekstil manapun, seperti benang karet, benang logam dan pipa/selang kain dan lainnya.', 'kbli_13999', NULL, NULL),
(387, '14111', 'Industri Pakaian Jadi (Konveksi) Dari Tekstil', 'Kelompok ini mencakup usaha pembuatan pakaian jadi (konveksi) dari tekstil/kain (tenun maupun rajutan) dengan cara memotong dan menjahit sehingga siap dipakai, seperti kemeja, celana, kebaya, blus, rok, baju bayi, pakaian tari dan pakaian olahraga.', 'kbli_14111', NULL, NULL),
(388, '14112', 'Industri Pakaian Jadi (Konveksi) Dari Kulit', 'Kelompok ini mencakup usaha pembuatan pakaian jadi (konveksi) dari kulit atau kulit imitasi, dengan cara memotong dan menjahit sehingga siap pakai, seperti jaket, mantel, rompi, celana dan rok. Termasuk  pembuatan aksesori pakaian dari kulit seperti pakaian pekerja las (welder) dari kulit.', 'kbli_14112', NULL, NULL),
(389, '14120', 'Penjahitan Dan Pembuatan Pakaian Sesuai Pesanan', 'Kelompok ini mencakup usaha penjahitan dan pembuatan pakaian sesuai pesanan yang melayani masyarakat umum  dengan tujuan komersil.', 'kbli_14120', NULL, NULL),
(390, '14131', 'Industri Perlengkapan Pakaian Dari Tekstil', 'Kelompok ini mencakup usaha pembuatan perlengkapan pakaian jadi (konveksi) tekstil dan dari kain dengan cara memotong dan menjahit sehingga siap dipakai, seperti topi, peci, dasi, sarung tangan, mukena, selendang, kerudung, ikat pinggang, syal, bando, dasi tuksedo, jaring rambut, dan lain-lain, baik dari kain tenun maupun kain rajut yang dijahit. Termasuk industri alas kaki dari bahan kain tanpa sol dan bagian-bagian dari produk yang disebutkan sebelumnya.', 'kbli_14131', NULL, NULL),
(391, '14132', 'Industri Perlengkapan Pakaian Dari Kulit', 'Kelompok ini mencakup usaha pembuatan perlengkapan pakaian jadi dari kulit atau kulit imitasi, dengan cara memotong dan menjahit sehingga siap pakai, seperti topi, sarung tangan, ikat pinggang, bando, jaring rambut, dan lain-lain.  Termasuk industri penutup kepala dari kulit berbulu dan bagian-bagian dari produk yang disebutkan sebelumnya.', 'kbli_14132', NULL, NULL),
(392, '14200', 'Industri Pakaian Jadi dan Barang Dari Kulit Berbulu', 'Kelompok ini mencakup usaha pembuatan pakaian jadi/barang jadi dari kulit berbulu dan atau perlengkapannya, seperti mantel berbulu, berbagai barang dari kulit berbulu, misalnya gambar, tikar, keset dan barang lain dari kulit berbulu, seperti permadani, pouffes tanpa isi, kain kilap industri.', 'kbli_14200', NULL, NULL),
(393, '14301', 'Industri Pakaian Jadi Rajutan', 'Kelompok ini mencakup usaha pembuatan pakaian jadi, seperti sweater, kardigan, baju kaos, mantel, dan barang sejenisnya, termasuk topi yang dibuat dengan cara dirajut ataupun renda, kecuali industri rajutan kaos kaki.', 'kbli_14301', NULL, NULL),
(394, '14302', 'Industri Pakaian Jadi Sulaman/Bordir', 'Kelompok ini mencakup usaha pakaian jadi sulaman, baik yang dikerjakan dengan tangan maupun dengan mesin.', 'kbli_14302', NULL, NULL),
(395, '14303', 'Industri Rajutan Kaos Kaki dan Sejenisnya', 'Kelompok ini mencakup usaha pembuatan kaos kaki yang dibuat dengan cara rajut ataupun renda, seperti kaos kaki, termasuk kaos kaki, stocking, pantyhose.', 'kbli_14303', NULL, NULL),
(396, '15111', 'Industri Pengawetan Kulit', 'Kelompok ini mencakup usaha pengawetan kulit yang berasal dari hewan besar, hewan kecil, reptil, ikan dan hewan lainnya, baik yang dilakukan dengan pengeringan, penggaraman, maupun pengasaman (pikel), seperti kulit hewan besar (sapi, kerbau), kulit hewan kecil (domba, kambing), kulit reptil (buaya, ular, biawak), kulit ikan (ikan pari,hiu/cucut, kakap, belut) dan kulit hewan lainnya.', 'kbli_15111', NULL, NULL),
(397, '15112', 'Industri Penyamakan Kulit', 'Kelompok ini mencakup usaha penyamakan kulit yang berasal dari ternak besar (sapi, kerbau), ternak kecil (domba, kambing), reptil (buaya, ular, biawak), ikan (ikan pari, hiu cucut, kakap, belut) dan hewan lainnya yang dimasak dengan chrome nabati, sintetis, samak minyak dan samak kombinasi menjadi kulit tersamak, seperti wet blue, crust, sol, vache raam, kulit box, kulit beludru, kulit gelase dan kulit hiasan, kulit berbulu, kulit laminasi, kulit patent, kulit jaket, kulit sarung tangan, kulit chamois dan lainnya.', 'kbli_15112', NULL, NULL),
(398, '15113', 'Industri Pencelupan Kulit Bulu', 'Kelompok ini mencakup usaha pemberian warna atau pencelupan pada kulit bulu yang digunakan pada barang jadi kulit.', 'kbli_15113', NULL, NULL),
(399, '15114', 'Industri Kulit Komposisi', 'Kelompok ini mencakup usaha pembuatan kulit komposisi yang berasal dari potongan/remahan kulit hewan yang direkatkan kembali. Industri kulit buatan/imitasi yang berbahan utama tekstil dimasukkan dalam kelompok 13992. Industri kulit buatan/imitasi yang berbahan utama karet dimasukkan dalam kelompok 2219; dan industri kulit buatan/imitasi yang berbahan utama plastik dimasukkan dalam kelompok 2229.', 'kbli_15114', NULL, NULL),
(400, '15121', 'Industri Barang Dari Kulit Dan Kulit Komposisi Untuk Keperluan Pribadi', 'Kelompok ini mencakup usaha pembuatan barang-barang dari kulit dan kulit komposisi atau bahan lain seperti plastik, tekstil, serat yang divulkanisir atau paperboard untuk keperluan pribadi, seperti koper, ransel, tas, dompet, kotak rias, sarung senjata, tempat kaca mata dan tali jam. Termasuk industri tali sepatu kulit.', 'kbli_15121', NULL, NULL),
(401, '15122', 'Industri Barang Dari Kulit Dan Kulit Komposisi Untuk Keperluan Teknik/Industri', 'Kelompok ini mencakup usaha pembuatan barang-barang dari kulit dan kulit komposisi untuk keperluan teknik/industri, seperti klep, packing, rem pickers, sarung tangan kerja, kulit pompa, kulit ban mesin (belt), kulit apron dan sisir kulit pada mesin (combing leather).', 'kbli_15122', NULL, NULL),
(402, '15123', 'Industri Barang Dari Kulit Dan Kulit Komposisi Untuk Keperluan Hewan', 'Kelompok ini mencakup usaha pembuatan barang-barang dari kulit dan kulit komposisi untuk keperluan hewan, seperti ikat leher hewan, tali kekang hewan, pelana hewan, brongsong mulut hewan, cambuk dan sepatu hewan.', 'kbli_15123', NULL, NULL),
(403, '15129', 'Industri Barang Dari Kulit Dan Kulit Komposisi Untuk Keperluan Lainnya', 'Kelompok ini mencakup usaha pembuatan barang-barang dari kulit dan kulit komposisi untuk keperluan yang belum terliput dalam kelompok 15121 sampai dengan 15123, seperti jok, sabuk pengaman, alat pengepak dan kerajinan tatah sungging (hiasan, wayang dan kap lampu) dan lain-lain.', 'kbli_15129', NULL, NULL),
(404, '15201', 'Industri Alas Kaki Untuk Keperluan Sehari-hari', 'Kelompok ini mencakup usaha pembuatan alas kaki keperluan sehari-hari dari kulit dan kulit buatan, karet, kanvas dan kayu, seperti sepatu harian, sepatu santai (casual shoes), sepatu sandal, sandal kelom dan selop. Termasuk juga usaha pembuatan bagian-bagian dari alas kaki tersebut, seperti atasan, sol dalam, sol luar, penguat depan, penguat tengah, penguat belakang, lapisan dan aksesori dari kulit dan kulit buatan.', 'kbli_15201', NULL, NULL),
(405, '15202', 'Industri Sepatu Olahraga', 'Kelompok ini mencakup usaha pembuatan sepatu untuk olahraga dari kulit dan kulit buatan, karet dan kanvas, seperti sepatu sepak bola, sepatu atletik, sepatu senam, sepatu jogging dan sepatu ballet. Termasuk juga usaha pembuatan bagian bagian dari sepatu olahraga tersebut, meliputi atasan, sol luar, sol dalam, lapisan dan aksesori.', 'kbli_15202', NULL, NULL),
(406, '15203', 'Industri Sepatu Teknik Lapangan/Keperluan Industri', 'Kelompok ini mencakup usaha pembuatan sepatu termasuk pembuatan bagian-bagian dari sepatu untuk keperluan teknik lapangan/industri dari kulit, kulit buatan, karet dan plastik,  seperti sepatu tahan kimia, sepatu tahan panas, sepatu pengaman.', 'kbli_15203', NULL, NULL),
(407, '15209', 'Industri Alas Kaki Lainnya', 'Kelompok ini mencakup usaha pembuatan alas kaki lainnya yang belum termasuk golongan manapun, seperti sepatu kesehatan dan sepatu lainnya, misalnya sepatu dari gedebog (pelepah batang pisang) dan eceng gondok. Termasuk industri gaiter, legging dan barang sejenisnya.', 'kbli_15209', NULL, NULL),
(408, '16101', 'Industri Penggergajian Kayu', 'Kelompok ini mencakup usaha penggergajian, pengirisan, pengulitan dan pemotongan kayu gelondongan menjadi balok, kaso (usuk), reng, papan dan sebagainya. Termasuk industri kayu untuk bantalan rel kereta dan bahan baku untuk pembuatan lantai kayu.', 'kbli_16101', NULL, NULL),
(409, '16102', 'Industri Pengawetan Kayu', 'Kelompok ini mencakup usaha pengawetan kayu dengan cara pengeringan kayu, pengolahan kimia dan perendaman kayu dengan bahan pengawet atau bahan lainnya.', 'kbli_16102', NULL, NULL),
(410, '16103', 'Industri Pengawetan Rotan, Bambu Dan Sejenisnya', 'Kelompok ini mencakup usaha pengawetan rotan, bambu dan sejenisnya.', 'kbli_16103', NULL, NULL),
(411, '16104', 'Industri Pengolahan Rotan', 'Kelompok ini mencakup usaha pengolahan rotan menjadi bahan setengah jadi, seperti rotan poles, hati rotan dan kulit rotan.', 'kbli_16104', NULL, NULL),
(412, '16105', 'Industri Partikel Kayu dan Sejenisnya', 'Kelompok ini mencakup usaha pembuatan partikel kayu dan sejenisnya seperti wol kayu, tepung kayu, dan irisan atau serpih kayu (woodchips).', 'kbli_16105', NULL, NULL),
(413, '16211', 'Industri Kayu Lapis', 'Kelompok ini mencakup usaha pembuatan kayu lapis biasa, seperti kayu lapis tripleks, multipleks, kayu lapis interior, eksterior dan sejenisnya. Termasuk juga kayu lapis konstruksi, seperti kayu lapis cetak beton, kayu lapis tahan air dan sejenisnya.', 'kbli_16211', NULL, NULL),
(414, '16212', 'Industri Kayu Lapis Laminasi, Termasuk Decorative Plywood', 'Kelompok ini mencakup usaha pembuatan kayu lapis yang dilaminasi, seperti teak wood, rose wood, polyester plywood dan sejenisnya. Termasuk juga bambu lapis yang dilaminasi.', 'kbli_16212', NULL, NULL),
(415, '16213', 'Industri Panel Kayu Lainnya', 'Kelompok ini mencakup usaha pembuatan panel kayu lainnya, seperti particle board, chip board, fibre board, Medium Density Fibreboard (MDF) dan sejenisnya.', 'kbli_16213', NULL, NULL),
(416, '16214', 'Industri Veneer', 'Kelompok ini mencakup usaha pembuatan serutan pelapis (veneer) dengan cara pengupasan (rotary), penyayatan (slicer) dan sejenisnya.', 'kbli_16214', NULL, NULL),
(417, '16215', 'Industri Kayu Laminasi', 'Kelompok ini mencakup industri kayu laminasi seperti barecore, blockboard, dan lamin board.', 'kbli_16215', NULL, NULL),
(418, '16221', 'Industri Barang Bangunan Dari Kayu', 'Kelompok ini mencakup industri komponen bahan bangunan dari kayu yang digunakan utamanya untuk industri konstruksi, seperti balok, kaso, rangka atap yang dihaluskan keempat sisinya; tiang penopang yang dibuat dari kayu secara bilah sambung (finger joint) dengan perekat atau dihubungkan dengan logam (metal); profil dan moulding kayu, daun pintu/jendela dan rangkanya (kusen), tangga dan susuran tangga, manik-manik dari kayu dan papan penghias tembok dan papan nama; atap sirap, lantai kayu siap pasang yang terbuat dari kayu solid (solid wood) atau engineering wood; serta pengerjaan kayu untuk bahan bangunan lainnya.', 'kbli_16221', NULL, NULL),
(419, '16222', 'Industri Bangunan Prafabrikasi Dari Kayu', 'Kelompok ini mencakup usaha pengerjaan kayu untuk bangunan prafabrikasi. Termasuk industri rumah bergerak dan partisi kayu (tidak termasuk penyekat ruangan yang berdiri sendiri/furnitur)', 'kbli_16222', NULL, NULL),
(420, '16230', 'Industri Wadah Dari Kayu', 'Kelompok ini mencakup usaha pembuatan segala macam wadah atau peti/kotak dari kayu untuk pengemasan, seperti kotak kemas, boks, peti kayu, drum kayu dan kemasan sejenisnya dari kayu; palet (pallets), kotak palet dan papan muat dari kayu lainnya; barel, tong, ember dan produk dari kayu lainnya; dan gulungan kawat dari kayu.', 'kbli_16230', NULL, NULL),
(421, '16291', 'Industri Barang Anyaman Dari Rotan Dan Bambu', 'Kelompok ini mencakup usaha pembuatan macam-macam tikar, webbing, lampit, tas, topi, tampah, kukusan, bakul, kipas, tatakan, bilik/gedek dan sejenisnya yang bahan utamanya dari rotan atau bambu.', 'kbli_16291', NULL, NULL),
(422, '16292', 'Industri barang Anyaman Dari Tanaman Bukan Rotan Dan Bambu', 'Kelompok ini mencakup usaha pembuatan macam-macam tikar, keset, tas, topi, tatakan dan kerajinan tangan lainnya yang bahan utamanya bukan rotan dan bambu, seperti pandan, mendong, serat, rumput dan sejenisnya.', 'kbli_16292', NULL, NULL),
(423, '16293', 'Industri Kerajinan Ukiran Dari Kayu Bukan Mebeller', 'Kelompok ini mencakup usaha pembuatan macam-macam barang kerajinan dan ukir-ukiran dari kayu, seperti relief, topeng, patung, wayang, vas bunga, pigura dan kap lampu.', 'kbli_16293', NULL, NULL),
(424, '16294', 'Industri Alat Dapur Dari Kayu, Rotan Dan Bambu', 'Kelompok ini mencakup usaha pembuatan macam-macam barang kerajinan dan ukir-ukiran dari kayu, seperti relief, topeng, patung, wayang, vas bunga, pigura dan kap lampu.', 'kbli_16294', NULL, NULL),
(425, '16295', 'Industri Kayu Bakar dan Pelet Kayu', 'Kelompok ini mencakup industri kayu bakar dan pelet kayu yang dibuat dari serbuk kayu atau bahan substitusi seperti ampas kopi atau biji kedelai yang dipres.', 'kbli_16295', NULL, NULL),
(426, '16299', 'Industri Barang Dari Kayu, Rotan, Gabus Lainnya YTDL', 'Kelompok ini mencakup usaha pembuatan barang-barang dari kayu, rotan dan gabus lainnya yang belum tercakup sebelumnya. Barang-barang dari kayu misalnya alat tenun, gantungan baju, chopstik, tusuk gigi, sempoa (alat hitung), penggaris dan papan tulis. Termasuk juga pembuatan alat-alat kerja dari kayu, seperti plesteran, palu, rumah serutan kayu, gagang pegangan perkakas, palet, papan cucian dan sejenisnya. Barang dari gabus misalnya gabus lembaran, sumbat, piringan, cincin, pelapis, pelampung dan lainnya.', 'kbli_16299', NULL, NULL),
(427, '17011', 'Industri Bubur Kertas (Pulp)', 'Kelompok ini mencakup usaha pembuatan bubur kertas dengan bahan dari kayu atau serat lainnya dan atau kertas bekas. Kegiatannya mencakup industri  bubur kertas yang diputihkan, separuh putihkan atau yang tidak diputihkan baik melalui proses mekanis, kimia (pelarutan atau non pelarutan), maupun semi kimia, industri bubur kertas cotton-linters dan penghilangan tinta dan industri bubur kertas dari kertas bekas.', 'kbli_17011', NULL, NULL),
(428, '17012', 'Industri Kertas Budaya', 'Kelompok ini mencakup usaha pembuatan kertas koran dan kertas tulis cetak.', 'kbli_17012', NULL, NULL),
(429, '17013', 'Industri Kertas Berharga', 'Kelompok ini mencakup usaha pembuatan kertas bandrol, bank notes, cheque paper, security paper, watermark paper, meterai, perangko dan sejenisnya.', 'kbli_17013', NULL, NULL),
(430, '17014', 'Industri Kertas Khusus', 'Kelompok ini mencakup usaha pembuatan kertas khusus, seperti cardiopan, kertas litmus/lakmus, metalic paper, acid proof paper, kertas pola, kertas tersalut, kertas celopan dan sejenisnya. Pengerjaan kertas yang melapisi dengan segala cara, seperti coating, glazing, gumming, dan laminating serta pembuatan kertas karbon dan stensil dimasukkan dalam kelompok 17099, jika dalam bentuk potongan siap dijual ke konsumen. Pembuatan kertas fotografi dimasukkan dalam kelompok 20299. Pembuatan kertas penggosok/amplas (abrasive paper) dimasukkan dalam kelompok 23990.', 'kbli_17014', NULL, NULL),
(431, '17019', 'Industri Kertas Lainnya', 'Kelompok ini mencakup usaha pembuatan kertas magnetik, kertas kerut (crep) dan gumpalan selulosa dan webs serat selulosa.', 'kbli_17019', NULL, NULL),
(432, '17021', 'Industri Kertas dan Papan Kertas Bergelombang', 'Kelompok ini mencakup usaha pembuatan kertas konstruksi (kertas isolasi, condensor, roofing board, building board dan lain-lain), kertas bungkus dan pengepakan (kraftliner, medium liner/corrugating medium, ribbed kraft paper/kertas payung, kraft paper), board (post card karthotek, kertas londen, triplex, multiplex, bristol, straw board, chip board, duplex).', 'kbli_17021', NULL, NULL),
(433, '17022', 'Industri Kemasan Dan Kotak Dari Kertas Dan Karton', 'Kelompok ini mencakup usaha pembuatan segala macam kemasan dan kotak dari kertas/karton yang digunakan untuk pembungkus/pengepakan, termasuk juga pembuatan kotak untuk rokok dan barang lainnya. Misalnya kemasan dan kotak dari kertas dan papan kertas bergelombang, kemasan dan kotak papan kertas yang dapat dilipat, kemasan dan kotak dari papan padat, kemasan dan kotak lain dari kertas dan papan kertas, sak dan kantong kertas dan kotak file kantor dan barang sejenisnya.', 'kbli_17022', NULL, NULL),
(434, '17091', 'Industri Kertas Tissue', 'Kelompok ini mencakup usaha pembuatan kertas untuk kertas rumah tangga, kertas kebersihan pribadi dan barang kertas kapas selulosa, seperti tisu pembersih, facial tissue, toilet tissue, lens tissue, sapu tangan, handuk, serbet, kertas toilet, napkin, napkin untuk bayi, sanitary napkin (pembalut wanita), tampon, popok dewasa, dan napkin untuk cangkir, piring dan baki dan usaha pembuatan kertas kapas dan barang dari kertas kapas, seperti handuk/lap, kertas sigaret dan cork tipping paper.', 'kbli_17091', NULL, NULL),
(435, '17099', 'Industri Barang Dari Kertas Dan Papan Kertas Lainnya YTDL', 'Kelompok ini mencakup usaha pembuatan barang dari kertas dan papan kertas atau karton yang belum tercakup dalam subgolongan lain, seperti industri kertas tulis dan kertas cetak siap pakai, industri kertas printout komputer siap pakai, industri kertas kopi siap pakai, industri kertas tempel atau berperekat siap pakai, industri buku register, buku akuntansi, binder, album dan alat-alat tulis baik yang bersifat komersil atau untuk pendidikan sejenisnya, industri kotak, kantong, dompet dan buku catatan yang mengandung susunan kertas, industri wallpaper (kertas dinding) dan jenis pelapis dinding lainnya, termasuk wallpaper berlapis vinyl dan tekstil, industri label, industri kertas filter dan papan kertas filter, industri gulungan kertas dan papan kertas, gelendong kertas dan papan kertas dan sebagainya, industri tempat telur dan barang lainnya yang dibuat dari cetakan bubur kertas dan sebagainya, dan industri kertas kreasi baru. Termasuk di sini pengerjaan kertas dan karton dengan segala cara, seperti coating, glazing, gumming, laminating, pembuatan kertas karbon dan kertas stensil sheet dalam bentuk potongan siap dijual ke konsumen. Termasuk juga pembuatan kertas EKG dan pembuatan alat tulis kantor (stationeries) yang tidak dicetak, seperti amplop, kertas surat, kertas pembersih, dinner ware dari kertas dan sejenisnya. Pembuatan alat tulis kantor dan kartu yang dicetak dimasukkan dalam kelompok 18111.', 'kbli_17099', NULL, NULL),
(436, '18111', 'Industri Pencetakan Umum', 'Kelompok ini mencakup kegiatan industri percetakan surat kabar, majalah dan periodik lainnya seperti tabloid, surat kabar, majalah, jurnal, pamflet, buku dan brosur, naskah musik, peta, atlas, poster, katalog periklanan, prospektus dan iklan cetak lainnya, buku harian, kalender, formulir bisnis dan barang-barang cetakan komersial lainnya, kertas surat atau alat tulis pribadi dan barang-barang cetakan lainnya hasil mesin cetak, offset, klise foto, fleksografi dan sejenisnya, mesin pengganda, printer komputer, huruf timbul dan sebagainya termasuk alat cetak cepat; pencetakan secara langsung tanpa adanya media perantara ke bahan tekstil, plastik, kaca, logam, kayu dan keramik, kecuali pencetakan tabir sutera pada kain dan pakaian jadi; dan pencetakan pada label atau tanda pengenal (litografi, pencetakan tulisan di makam, pencetakan fleksografi dan sebagainya). Termasuk pula mencetak ulang melalui komputer, mesin stensil dan sejenisnya. Barang cetakan ini biasanya merupakan hak cipta. Industri label kertas atau karton termasuk kelompok 17099.', 'kbli_18111', NULL, NULL),
(437, '18112', 'Industri Pencetakan Khusus', 'Kelompok ini mencakup industri pencetakan perangko pos, perangko perpajakan, dokumen, cek dan kertas rahasia lainnya, materai, uang kertas, blangko cek, giro, surat andil, obligasi surat saham, surat berharga lainnya, paspor, tiket pesawat terbang dan cetakan khusus lainnya.', 'kbli_18112', NULL, NULL),
(438, '18113', 'Industri Pencetakan 3D Printing', 'Kelompok ini mencakup industri percetakan tiga dimensi (3D Printing) untuk berbagai keperluan dari polimer, plastik, clay, bijih logam dan lainnya.', 'kbli_18113', NULL, NULL),
(439, '18120', 'Kegiatan Jasa Penunjang Pencetakan', 'Kelompok ini mencakup usaha penjilidan lembar cetakan, misalnya menjadi buku, brosur, majalah, katalog dan sebagainya, dengan melipat, memasang, menjahit, merekatkan, menyatukan, penjilidan dengan perekat, perapihan dan gold stamping; produksi composed type, plates atau cylinders, penjilidan buku; komposisi, pemasangan huruf, pemasangan foto, input data mencakup scanning dan pengenalan karakter atau huruf optik, penyusunan elektronik; pembuatan gambar mencakup pemasangan image atau gambar (untuk proses pencetakan mesin cetak dan offset); pengukiran atau sketsa cylinders untuk gravure; proses pembuatan gambar langsung di atas pelat (temasuk pelat fotopolimer); pembuatan gambar untuk pencetakan dan pengecapan relief; pembuatan cetakan untuk percobaan; pekerjaan artistik mencakup penyiapan batu litho dan woodblocks (produksi batu lithographic, untuk digunakan dalam kegiatan percetakan di unit lain); pembuatan barang reprografi; desain barang cetakan seperti sketsa, layout, barang contoh dan sebagainya; dan kegiatan grafis lainnya seperti die-sinking dan die-stamping, penggandaan huruf braille, pemukulan dan pengeboran, penyulaman timbul, pemvernisan dan pelapisan, penyisipan dan pelipatan.', 'kbli_18120', NULL, NULL),
(440, '18201', 'Reproduksi Media Rekaman Suara dan Piranti Lunak', 'Kelompok ini mencakup usaha reproduksi dari kopi master pelat atau piringan gramofon, compact disk atau CD dan pita yang berisikan musik atau rekaman suara (audio) dan reproduksi dari kopi master perangkat lunak atau software dan data pada disk dan pita magnetik. Pembuatan piringan hitam kosong, pita kaset kosong, pita komputer dan disket kosong untuk merekam data dimasukkan dalam kelompok 26800. Industri rekaman suara di piringan hitam, pita kaset dan sejenisnya dimasukkan dalam kelompok 59201.', 'kbli_18201', NULL, NULL),
(441, '18202', 'Reproduksi Media Rekaman Film Dan Video', 'Kelompok ini mencakup usaha reproduksi dari kopi master rekaman, compact disk atau CD dan tape yang berisikan gambar bergerak atau film dan rekaman video lainnya. Penerbitan rekaman film dan video dimasukkan dalam kelompok 59131 dan 59132.', 'kbli_18202', NULL, NULL),
(442, '19100', 'Industri produk dari batu bara', 'Kelompok ini mencakup usaha industri pengolahan gas, kokas dari batu bara, termasuk juga destilasi batu bara yang bukan merupakan bagian pabrik gas atau besi dan baja, atau destilasi batu bara yang menjadi bagian pabrik besi dan baja yang pembukuannya dapat dipisahkan.  Termasuk pengoperasian tungku kokas, produksi kokas dan semi kokas, produksi pitch kokas, produksi kokas mentah dan ter lignit dan pengaglomerasian kokas.  Usaha destilasi gas oleh pabrik gas yang penyalurannya melalui pipa saluran dimasukkan dalam kelompok 35202. Usaha pembuatan gas dan kokas yang tergabung dalam kegiatan pengolahan besi dan baja dimasukkan dalam kelompok 24101 sampai dengan 24103.', 'kbli_19100', NULL, NULL),
(443, '19211', 'Industri Bahan Bakar Dari Pemurnian Dan Pengilangan Minyak Bumi', 'Kelompok ini mencakup usaha pemurnian dan pengilangan minyak bumi yang menghasilkan bahan bakar seperti  Avigas, Avtur, Gasoline, Minyak Tanah atau Kerosin, Minyak Solar, Minyak Diesel, Minyak Bakar atau Bensin,  Solvent/Pelarut,  termasuk LPG dari hasil pengilangan minyak bumi.', 'kbli_19211', NULL, NULL),
(444, '19212', 'Industri Pembuatan Minyak Pelumas', 'Kelompok ini mencakup usaha pembuatan minyak pelumas, oli dan gemuk yang berbahan dasar minyak.', 'kbli_19212', NULL, NULL),
(445, '19213', 'Industri Pengolahan Kembali Minyak Pelumas Bekas', 'Kelompok ini mencakup usaha pengolahan kembali minyak pelumas bekas untuk dapat digunakan sebagai minyak pelumas.', 'kbli_19213', NULL, NULL),
(446, '19214', 'Industri Pengolahan Minyak Pelumas Bekas Menjadi Bahan Bakar', 'Kelompok ini mencakup usaha pengolahan kembali minyak pelumas bekas untuk dapat digunakan sebagai bahan bakar minyak.', 'kbli_19214', NULL, NULL),
(447, '19291', 'Industri Produk Dari Hasil Kilang Minyak Bumi', 'Kelompok ini mencakup usaha industri pengolahan aspal/ter, bitumen dan lilin (dapat digunakan untuk lapisan jalan, atap, kayu, kertas dan sebagainya) serta Petroleum Coke. Termasuk industri produk untuk industri petrokimia, industri bermacam-macam produk, seperti white spirit, vaseline, lilin parafin, jeli minyak bumi (petroleum jelly), industri briket minyak bumi dan pencampuran biofuel, seperti pencampuran alkohol dengan minyak bumi (misalnya gasohol).', 'kbli_19291', NULL, NULL),
(448, '19292', 'Industri Briket Batu Bara', 'Kelompok ini mencakup usaha pembuatan briket dari batu bara atau lignit, baik di lokasi penambangan maupun di luar lokasi penambangan. Termasuk pula pembuatan briket yang menggunakan batu bara atau lignit yang dibeli dari pihak lain.', 'kbli_19292', NULL, NULL),
(449, '20111', 'Industri Kimia Dasar Anorganik Khlor Dan Alkali', 'Kelompok ini mencakup usaha industri kimia dasar yang menghasilkan bahan kimia khlor dan alkali, seperti soda kostik, soda abu, natrium khlorida, kalium hidroksida dan senyawa khlor lainnya. Termasuk juga usaha industri yang menghasilkan logam alkali, seperti lithium, natrium dan kalium, serta senyawa alkali lainnya. Industri pembuatan garam dapur/konsumsi dimasukkan dalam kelompok 10774.', 'kbli_20111', NULL, NULL),
(450, '20112', 'Industri Kimia Dasar Anorganik Gas Industri', 'Kelompok ini mencakup usaha industri kimia dasar yang menghasilkan bahan kimia gas industri, seperti zat asam, zat lemas, zat asam arang, amoniak dan dry ice. Termasuk juga usaha industri kimia dasar yang menghasilkan gas mulia, seperti helium, neon, argon dan radon; serta jenis-jenis gas industri lainnya.', 'kbli_20112', NULL, NULL),
(451, '20113', 'Industri Kimia Dasar Anorganik Pigmen', 'Kelompok ini mencakup usaha industri kimia dasar yang menghasilkan bahan anorganik pigment, seperti meni merah, chrome yellow, zinc yellow, barium sulphate, pigmen serbuk aluminium, oker dan pigment dengan dasar titanium.', 'kbli_20113', NULL, NULL),
(452, '20114', 'Industri Kimia Dasar Anorganik Lainnya', 'Kelompok ini mencakup usaha industri kimia dasar anorganik yang belum tercakup dalam golongan industri kimia dasar anorganik di atas, seperti fosfor dengan turunannya, belerang dengan turunannya, nitrogen dengan turunannya, dan industri kimia dasar yang menghasilkan senyawa halogen dengan turunannya, logam kecuali logam alkali, senyawa oksida kecuali pigmen. Termasuk industri bahan baku untuk bahan peledak.', 'kbli_20114', NULL, NULL),
(453, '20115', 'Industri Kimia Dasar Organik Yang Bersumber Dari Hasil Pertanian', 'Kelompok ini mencakup usaha industri kimia organik yang menghasilkan bahan kimia dari hasil pertanian termasuk kayu, getah (gum), minyak nabati industri (IVO) dengan produk antara lain: asam alufamat, asam asetat, asam citrat, asam benzoat, fatty acid, fatty alcohol, glycerine, furfural, sarbitol, dan bahan kimia organik lainnya dari hasil pertanian. Kelompok ini juga mencakup pembuatan biofuel, arang kayu, arang batok kelapa dengan produk: biofuel cair (biodiesel dan bioethanol anhidrat), biohidrokarbon (minyak diesel nabati, minyak bensin nabati, minyak avtur/jet fuel nabati) dan bahan kimia resin/damar buatan berbasis bahan terbarukan (biobenzene, biotoluene dan bioxylene dan biopolymer - bioplastik dari bahan terbarukan).', 'kbli_20115', NULL, NULL),
(454, '20116', 'Industri Kimia Dasar Organik Untuk  Bahan Baku Zat Warna Dan Pigmen, Zat Warna Dan Pigmen', 'Kelompok ini mencakup usaha industri kimia dasar yang menghasilkan bahan kimia organik, zat warna dan pigment dengan hasil antara siklisnya, seperti hasil antara phenol dan turunannya, zat warna tekstil dan zat warna untuk makanan dan obat-obatan.', 'kbli_20116', NULL, NULL),
(455, '20117', 'Industri Kimia Dasar Organik Yang Bersumber Dari Minyak Bumi, Gas Alam Dan Batu Bara', 'Kelompok ini mencakup usaha industri kimia dasar organik yang menghasilkan bahan kimia, yang bahan bakunya berasal dari minyak bumi dan gas bumi maupun batu bara, seperti ethylene, propilene, benzena, toluena, caprolactam termasuk pengolahan coaltar.', 'kbli_20117', NULL, NULL),
(456, '20118', 'Industri Kimia Dasar Organik Yang Menghasilkan Bahan Kimia Khusus', 'Kelompok ini mencakup usaha industri kimia dasar organik yang menghasilkan bahan kimia khusus, seperti bahan kimia khusus untuk minyak dan gas bumi, pengolahan air, karet, kertas, konstruksi, otomotif, bahan tambahan makanan (food additive), tekstil, kulit, elektronik, katalis, minyak rem (brake fluid), serta bahan kimia khusus lainnya.', 'kbli_20118', NULL, NULL),
(457, '20119', 'Industri Kimia Dasar Organik Lainnya', 'Kelompok ini mencakup usaha industri Kimia Dasar Organik yang belum tercakup dalam golongan Industri Kimia Dasar Organik, seperti plasticizer, bahan untuk bahan baku pestisida, zat aktif permukaan, bahan pengawet.', 'kbli_20119', NULL, NULL),
(458, '20121', 'Industri Pupuk Alam/Non Sintetis Hara Makro Primer', 'Kelompok ini mencakup usaha pembuatan pupuk hara makro primer jenis pupuk alam seperti pupuk fosfat alam (pupuk alam anorganik).', 'kbli_20121', NULL, NULL),
(459, '20122', 'Industri Pupuk Buatan Tunggal Hara Makro Primer', 'Kelompok ini mencakup usaha pembuatan pupuk hara makro primer jenis pupuk buatan tunggal seperti urea, ZA, TSP, DSP dan Kalsium Sulfat. Termasuk juga pembuatan gas CO2, asam sulfat, amoniak, asam fosfat, asam nitrat dan lain-lain yang berkaitan dengan pembuatan pupuk dan tidak dapat dilaporkan secara terpisah.', 'kbli_20122', NULL, NULL),
(460, '20123', 'Industri Pupuk Buatan Majemuk Hara Makro Primer', 'Kelompok ini mencakup usaha pembuatan pupuk yang mengandung minimal 2 unsur hara makro primer melalui proses reaksi kimia seperti Mono Amonium Fosfat (pupuk buatan majemuk nitrogen fosfat), Kalium Amonium Khlorida (pupuk buatan majemuk nitrogen kalium), Kalium Metafosfat (pupuk buatan majemuk fosfat kalium) dan Amonium Kalium Fosfat (pupuk buatan majemuk nitrogen fosfat kalium). Total kandungan unsur hara makro primer minimal 10 persen sampai dengan 30 persen.', 'kbli_20123', NULL, NULL),
(461, '20124', 'Industri Pupuk Buatan Campuran Hara Makro Primer', 'Kelompok ini mencakup usaha pembuatan pupuk yang mengandung minimal 2 unsur hara makro primer melalui pencampuran pupuk secara fisik tanpa merubah sifat kimia dan sifat pupuk aslinya. Total kandungan unsur hara makro primer minimal 10 persen.', 'kbli_20124', NULL, NULL),
(462, '20125', 'Industri Pupuk Hara Makro Sekunder', 'Kelompok ini mencakup usaha pembuatan pupuk yang mengandung unsur hara makro sekunder jenis Ca, Mg, dan S seperti Kiserit (Mg, S), Oksida Magnio (Mg).', 'kbli_20125', NULL, NULL),
(463, '20126', 'Industri Pupuk Hara Mikro', 'Kelompok ini mencakup usaha pembuatan pupuk yang mengandung unsur hara mikro seperti Seng, Besi, Tembaga, Mangan, Boron dan Molybdenum.', 'kbli_20126', NULL, NULL),
(464, '20127', 'Industri Pupuk Pelengkap', 'Kelompok ini mencakup usaha pembuatan pupuk yang mengandung mikro organisme atau formula pupuk yang berasal dari hasil samping industri yang mempunyai kandungan hara mikro sebagai komponen utama serta mengandung total unsur hara makro primer dalam jumlah rendah sampai sedang (kurang dari 30 persen).', 'kbli_20127', NULL, NULL),
(465, '20128', 'Industri Media Tanam', 'Kelompok ini mencakup usaha pembuatan media tanam dengan tanah gemuk/gambut sebagai unsur pokok. Termasuk juga usaha pembuatan media tanam campuran dari tanah alami, pasir, tanah liat dan mineral.', 'kbli_20128', NULL, NULL),
(466, '20129', 'Industri Pupuk Lainnya', 'Kelompok ini mencakup usaha pembuatan pupuk yang belum termasuk dalam kelompok manapun.', 'kbli_20129', NULL, NULL),
(467, '20131', 'Industri Damar Buatan (Resin Sintetis) Dan Bahan Baku Plastik', 'Kelompok ini mencakup usaha pembuatan damar buatan dan bahan baku plastik (bijih plastik murni), seperti alkid, poliester, aminos, poliamid, epoksid, silikon, poliuretan, polietilen (PE), polipropilen (PP), polistiren, polivinil klorid, selulosa asetat dan selulosa nitrat. Pengolahan lanjutan dari damar buatan dan bahan plastik yang dibeli untuk menghasilkan barang dari bahan baku tersebut, seperti barang plastik, film dan lembaran film yang belum peka terhadap sinar dimasukkan dalam kelompok 26800.', 'kbli_20131', NULL, NULL),
(468, '20132', 'Industri Karet Buatan', 'Kelompok ini mencakup usaha pembuatan karet buatan, seperti styrene butadiene rubber (SBR), polychloroprene (neoprene), acrylonitrile butadine rubber (nitrile rubber), silicone rubber (polysiloxane) dan isoprene rubber.', 'kbli_20132', NULL, NULL),
(469, '20211', 'Industri Bahan Baku Pemberantas Hama (Bahan Aktif)', 'Kelompok ini mencakup usaha pembuatan bahan baku untuk pestisida, seperti buthyl phenyl methyl carbamat (BPMC), methyl isopropyl carbamat (MIPC), diazinon, carbofuran, glyphosate, monocrotophos, arsentrioxyde dan copper sulphate.', 'kbli_20211', NULL, NULL),
(470, '20212', 'Industri Pemberantas Hama (Formulasi)', 'Kelompok ini mencakup usaha pengolahan bahan aktif menjadi pemberantas hama (pestisida) dalam bentuk siap dipakai seperti insektisida, fungisida, rodentisida, herbisida, nematisida, molusida dan akarisida. Termasuk juga pembuataan disinfektan untuk pertanian dan kegunaan lainnya.', 'kbli_20212', NULL, NULL),
(471, '20213', 'Industri Zat Pengatur Tumbuh', 'Kelompok ini mencakup usaha pengolahan bahan kimia menjadi zat pengatur tumbuh, seperti atonik, ethrel, cepha, dekamon, mixtalol, hidrasil dan sitozim.', 'kbli_20213', NULL, NULL),
(472, '20214', 'Industri Bahan Amelioran (Pembenah Tanah)', 'Kelompok ini mencakup usaha pembuatan bahan amelioran (pembenah tanah) seperti kapur pertanian, kapur fosfat, dolomit, zeolit dan bahan amelioran yang mengandung bahan organik.', 'kbli_20214', NULL, NULL),
(473, '20221', 'Industri Cat dan Tinta Cetak', 'Kelompok ini mencakup usaha pembuatan macam-macam cat, seperti cat dasar, cat logam, cat kayu, cat tembok, cat kapal, cat epoksi dan email dan lacquer. Termasuk Industri pigmen dan bahan celup olahan, pewarna dan opacifier (pembuat tidak jelas), industri email pengkilap dan pelapis dan preparat sejenisnya, tinta cetak dan cat untuk melukis.', 'kbli_20221', NULL, NULL),
(474, '20222', 'Industri Pernis (Termasuk Mastik)', 'Kelompok ini mencakup usaha pembuatan berbagai macam pernis, seperti pelarut komposit organik dan tiner dan penghapus cat atau pernis. Termasuk Mastik.', 'kbli_20222', NULL, NULL),
(475, '20223', 'Industri Lak', 'Kelompok ini mencakup usaha pembuatan lak. Termasuk industri dempul dan plamur atau senyawa dempul dan dempul non refraktori atau bahan penutup permukaan sejenis.', 'kbli_20223', NULL, NULL),
(476, '20231', 'Industri Sabun Dan Bahan Pembersih Keperluan Rumah Tangga', 'Kelompok ini mencakup usaha pembuatan sabun (selain sabun yang tercakup dalam kelompok 20232) dalam berbagai bentuk, baik padat, bubuk, cream atau cair, industri pembuatan deterjen dan bahan pembersih rumah tangga lainnya, seperti pembersih lantai organik; kertas, gumpalan kapas, laken dan sebagainya yang dilapisi dengan sabun atau deterjen seperti tisue basah; gliserol mentah; pembersih permukaan, seperti bubuk pencuci baik padat maupun cair dan deterjen, preparat pencuci piring dan pelembut bahan pakaian; produk pembersih dan pengkilap, seperti pengharum dan deodorant ruangan, lilin buatan dan lilin olahan (wax), pengilap dan krim untuk barang dari kulit, pengilap dan krim untuk kayu, pengilap kaca dan logam, pasta dan bubuk gosok, termasuk kertas, gumpalan dan lain-lain yang dilapisi dengan pasta dan bubuk penggosok.', 'kbli_20231', NULL, NULL),
(477, '20232', 'Industri Kosmetik Untuk Manusia, Termasuk Pasta Gigi', 'Kelompok ini mencakup usaha pembuatan kosmetik untuk manusia, seperti tata rias muka, wangi-wangian atau parfum, produk perawatan rambut (shampo, obat pengeriting dan pelurus rambut, dan lain-lain), produk perawatan kuku atau menikur dan pedikur, produk perawatan kulit (krim atau lotion pencegah terbakar sinar matahari dan krim atau lotion agar kulit terlihat cokelat setelah berjemur), produk untuk kebersihan badan (sabun kosmetik, sabun mandi, sabun antiseptik, external intimate hygiene, deodorant, garam mandi dan lain-lain), produk untuk bercukur. Kosmetik dekoratif seperti tata rias muka, tata rias mata, wangi-wangian atau parfum, tata rias kuku dan tata rias rambut termasuk pewarna rambut. Termasuk pasta gigi dan produk untuk menjaga higienitas mulut, termasuk produk kosmetik pemutih gigi.', 'kbli_20232', NULL, NULL),
(478, '20233', 'Industri Kosmetik Untuk Hewan', 'Kelompok ini mencakup usaha pembuatan kosmetik untuk hewan, termasuk parfum, shampo, sabun, bedak, krim atau lotion, dan lainnya.', 'kbli_20233', NULL, NULL),
(479, '20234', 'Industri Perekat Gigi', 'Kelompok ini mencakup usaha pembuatan produk perekat gigi.', 'kbli_20234', NULL, NULL),
(480, '20291', 'Industri Perekat/Lem', 'Kelompok ini mencakup usaha pembuatan perekat/lem untuk keperluan industri atau alat rumah tangga yang berasal dari tanaman, hewan atau plastik, seperti starch, perekat dari tulang, cellulose ester dan ether, phenol formaldehyde, urea formaldehyde, melamine formaldehyde dan perekat epoksi.', 'kbli_20291', NULL, NULL),
(481, '20292', 'Industri Bahan Peledak', 'Kelompok ini mencakup usaha pembuatan barang peledak, seperti mesiu, dinamit, detonator, kembang api, petasan, mercuri fulminat dan bahan pendorong roket.', 'kbli_20292', NULL, NULL),
(482, '20293', 'Industri Tinta', 'Kelompok ini mencakup usaha pembuatan macam-macam tinta, seperti tinta tulis dan tinta khusus.', 'kbli_20293', NULL, NULL),
(483, '20294', 'Industri Minyak Atsiri', 'Kelompok ini mencakup usaha pembuatan minyak atsiri, seperti minyak jahe, minyak keningar, minyak ketumbar, minyak cengkeh, minyak kapol, minyak pala, minyak melati, minyak kenanga, minyak mawar, minyak akar wangi, minyak sereh, minyak nilam, minyak cendana, minyak kayu putih, minyak permen, minyak rempah-rempah, minyak jarak dan minyak dari rumput-rumputan/semak, daun dan kayu yang belum termasuk kelompok manapun.', 'kbli_20294', NULL, NULL),
(484, '20295', 'Industri Korek Api', 'Kelompok ini mencakup usaha pembuatan korek api dalam bentuk batangan (matches). Pembuatan batu korek api (flint) dimasukkan dalam kelompok 23990. Industri korek api dari logam (lighter) dimasukkan dalam kelompok 32909.', 'kbli_20295', NULL, NULL),
(485, '20296', 'Industri Minyak Atsiri Rantai Tengah', 'Kelompok ini mencakup usaha pengolahan lebih lanjut dari minyak atsiri yang masuk pada KBLI 20294 menjadi aneka produk hilir minyak atsiri untuk bahan baku produksi bahan perasa (flavour) dan produksi bahan perisa/wewangian (fragrance), termasuk untuk  produksi aneka bahan kimia yang berbasis pengolahan hilir minyak atsiri. Termasuk didalamnya industri bioaditif bahanbakar minyak dari minyak atsiri. Contoh minyak atsiri rantai tengah/hilir yaitu turunan minyak cengkeh antara lain carryophyllene, eugenol, methyl eugenol, vaniline; turunan minyak sereh wangi antara lain citronellol, geraniol, citronellal, rodinol, dsb.', 'kbli_20296', NULL, NULL),
(486, '20299', 'Industri Barang Kimia Lainnya YTDL', 'Kelompok ini mencakup usaha pembuatan bermacam-macam bahan-bahan dan barang-barang kimia yang belum diklasifikasikan dalam kelompok manapun seperti gelatin, bahan isolasi panas selain plastik dan karet, bahan semir/polish. Termasuk juga pembuatan film yang peka terhadap cahaya dan kertas fotografi.', 'kbli_20299', NULL, NULL),
(487, '20301', 'Industri Serat/Benang/Strip Filamen Buatan', 'Kelompok ini mencakup usaha pembuatan serat, benang, atau strip filamen buatan dalam bentuk gulungan tow, seperti poliamida, poliester, polipropilena, akrilik, selulosa asetat dan sebagainya untuk diolah lebih lanjut dalam industri tekstil.', 'kbli_20301', NULL, NULL),
(488, '20302', 'Industri Serat Stapel Buatan', 'Kelompok ini mencakup usaha pembuatan serat stapel buatan, seperti poliamida, poliester, rayon viskosa, akrilik, selulosa asetat dan sebagainya (kecuali serat gelas dan serat optik) untuk diolah lebih lanjut dalam industri tekstil. Serat stapel adalah serat buatan yang dipotong pendek-pendek.', 'kbli_20302', NULL, NULL),
(489, '21011', 'Industri Bahan Farmasi Untuk Manusia', 'Kelompok ini mencakup usaha pembuatan dan pengolahan bahan obat, bahan pembantu dan bahan pengemas untuk manusia, yang berasal dari bahan kimia, bahan alam, hewan dan tumbuh-tumbuhan termasuk yang berasal dari hasil biologis, seperti bahan obat-obatan, seperti antisera dan fraksi darah lainnya, vaksin dan preparat homeopatik. Termasuk industri substansi aktif obat (antibiotik, vitamin, salisilik dan asam o-asetilsalsilik dan lain-lain) untuk bahan farmakologi dalam industri obat-obatan, pengolahan darah, industri gula murni kimia dan pengolahan kelenjar dan industri ekstraksi kelenjar dan lain-lain.', 'kbli_21011', NULL, NULL),
(490, '21012', 'Industri Produk Farmasi Untuk Manusia', 'Kelompok ini mencakup usaha pembuatan dan pengolahan obat-obatan, suplemen kesehatan/makanan, yang berbentuk jadi (sediaan) untuk manusia, misalnya dalam bentuk tablet, kapsul, salep, bubuk, larutan, larutan parenteral dan suspensi, obat kontrasepsi hormonal, industri produksi radiofarmaka, dan industri farmasi bioteknologi.', 'kbli_21012', NULL, NULL),
(491, '21013', 'Industri Produk Farmasi Untuk Hewan', 'Kelompok ini mencakup usaha pembuatan, pengolahan dan pengemasan ulang obat-obatan yang berbentuk jadi (sediaan) untuk hewan, misalnya dalam bentuk serbuk, tablet, kapsul, salep, larutan, suspensi, aerosol dan lainnya. Termasuk industri produk benang bedah,  industri alat-alat diagnosa medis, industri produksi radioisotop untuk radiofarmaka, industri farmasi bioteknologi dan industri pembalut medis, perban dan sejenisnya yang dikhususkan untuk hewan.', 'kbli_21013', NULL, NULL),
(492, '21014', 'Industri Bahan Farmasi Untuk Hewan', 'Kelompok ini mencakup usaha pembuatan dan pengolahan bahan obat, bahan pembantu dan bahan pengemas untuk hewan, yang berasal dari bahan kimia, bahan alam, hewan dan tumbuh-tumbuhan termasuk yang berasal dari hasil biologis, seperti bahan obat-obatan, seperti antisera dan fraksi darah lainnya, vaksin dan preparat homeopatik. Termasuk industri substansi aktif obat untuk bahan farmakologi dalam industri obat-obatan, seperti antibiotik, vitamin, salisilik dan asam o-asetilsalsilik dan lain-lain, pengolahan darah, industri gula murni kimia dan pengolahan kelenjar dan industri ekstraksi kelenjar dan lain-lain.', 'kbli_21014', NULL, NULL),
(493, '21015', 'Industri Alat Kesehatan dalam Subgolongan 2101', 'Kelompok ini mencakup usaha pembuatan dan pengolahan alat kesehatan terkait diagnosa medis dan produk lainnya dalam subgolongan 2011. Kelompok ini mencakup industri produk kontrasepsi untuk penggunaan eksternal, industri alat-alat diagnosa medis seperti uji kehamilan, dan industri pembalut medis, perban dan sejenisnya dan kapas kosmetik.', 'kbli_21015', NULL, NULL),
(494, '21021', 'Industri Bahan Baku Obat Tradisional untuk Manusia', 'Kelompok ini mencakup usaha pengolahan macam-macam ekstrak dan simplisia, sediaan galenik, bahan tambahan atau bahan lainnya, baik yang berkhasiat maupun yang tidak berkhasiat, yang berubah maupun yang tidak berubah, yang digunakan dalam pengolahan obat tradisional, walaupun tidak semua bahan tersebut masih terdapat di dalam produk ruahan.', 'kbli_21021', NULL, NULL),
(495, '21022', 'Industri Produk Obat Tradisional untuk Manusia', 'Kelompok ini mencakup usaha pengolahan macam-macam produk obat tradisional yang bahannya berasal dari tumbuh-tumbuhan, bahan hewan, bahan mineral, sediaan sarian (galenik), atau campuran dari bahan tersebut yang berbentuk serbuk, rajangan, pil, dodol/jenang, pastiles, tablet, kapsul, cairan, larutan, emulsi dan suspensi, salep, krim dan gel, supositoria. Termasuk industri minuman jamu dan suplemen kesehatan/makanan bukan produk farmasi.', 'kbli_21022', NULL, NULL),
(496, '21023', 'Industri Produk Obat Tradisional Untuk Hewan', 'Kelompok ini mencakup usaha pengolahan macam-macam produk obat tradisional atau obat alami untuk hewan yang bahannya berasal antara lain dari tumbuh-tumbuhan, bahan hewan, bahan mineral, sediaan sarian (galenik), atau campuran dari bahan tersebut yang berbentuk serbuk, rajangan, pil, dodol/jenang, pastiles, tablet, kapsul, cairan, larutan, emulsi dan suspensi, salep, krim dan gel, supositoria.', 'kbli_21023', NULL, NULL),
(497, '21024', 'Industri Bahan Baku Obat Tradisional Untuk Hewan', 'Kelompok ini mencakup usaha pengolahan macam-macam ekstrak dan simplisia, sediaan galenik, bahan tambahan atau bahan lainnya, baik yang berkhasiat maupun yang tidak berkhasiat, yang berubah maupun yang tidak berubah, yang digunakan dalam pengolahan obat tradisional untuk hewan.', 'kbli_21024', NULL, NULL),
(498, '22111', 'Industri Ban Luar Dan Ban Dalam', 'Kelompok ini mencakup usaha pembuatan ban luar dan ban dalam dengan bahan utamanya dari karet alam ataupun karet buatan untuk semua jenis kendaraan bermotor, sepeda, kendaraan angkutan lainnya dan peralatan yang memakai ban.', 'kbli_22111', NULL, NULL),
(499, '22112', 'Industri Vulkanisir Ban', 'Kelompok ini mencakup usaha perbaikan ban yang telah terpakai (ban bekas) menjadi seperti ban baru, sehingga dapat digunakan lagi untuk kendaraan bermotor, sepeda, kendaraan angkutan lainnya dan peralatan yang memakai ban.', 'kbli_22112', NULL, NULL),
(500, '22121', 'Industri Pengasapan Karet', 'Kelompok ini mencakup usaha pengasapan karet yang dilakukan dengan tujuan mengawetkan karet, seperti Ribbed Smoked Sheet (RSS) dan brown crepe dari pengasapan.', 'kbli_22121', NULL, NULL),
(501, '22122', 'Industri Remilling Karet', 'Kelompok ini mencakup usaha pengolahan karet dengan cara digiling sehingga menghasilkan karet dalam bentuk lembaran, seperti sheet (lembaran karet halus) dan crepe (lembaran karet yang berkeriput).', 'kbli_22122', NULL, NULL),
(502, '22123', 'Industri Karet Remah (Crumb Rubber)', 'Kelompok ini mencakup usaha pengolahan karet yang menghasilkan karet remah, termasuk karet spon (busa).', 'kbli_22123', NULL, NULL),
(503, '22191', 'Industri Barang Dari Karet Untuk Keperluan Rumah Tangga', 'Kelompok ini mencakup usaha pembuatan barang-barang dari karet, untuk keperluan rumah tangga, seperti karpet karet, selang karet, tabung, pipa atau selang air, benang dan tali karet, benang rajut atau tenun dan kain berlapis karet, penutup bingkai penggulung dari karet, matras karet yang bisa dipompa, balon yang bisa dipompa, sikat dari karet dan matras waterbed (kasur air) dari karet. Termasuk usaha pembuatan keset, tali timba dan pot bunga dari karet.', 'kbli_22191', NULL, NULL),
(504, '22192', 'Industri Barang Dari Karet Untuk Keperluan Industri', 'Kelompok ini mencakup usaha pembuatan barang-barang dari karet, untuk keperluan industri, seperti belt conveyor, fan belt, engine mounting, lining dari karet, karet berbentuk plat, lembaran, potongan, batangan dan bentuk profil, perkakas, cincin dan segel dari karet, batang pipa untuk uap panas dari karet keras dan bahan repair dari karet. Seal/segel dari karet bagian dan kelengkapan dari motor penggerak, transmisi, body, frame, suspensi, steering, axle terbuat dari karet.', 'kbli_22192', NULL, NULL),
(505, '22193', 'Industri Barang dari Karet untuk Keperluan Infrastruktur', 'Kelompok ini mencakup usaha pembuatan kompon dan barang-barang dari karet untuk keperluan infrastruktur, seperti: kompon untuk aspal karet, serbuk karet alam teraktivasi (SKAT), dock fender, seismic bearing, bantalan jembatan, rubber dam, road bump, rail pad, rail guard, canal blocking, traffic cone.', 'kbli_22193', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(506, '22194', 'Industri Barang Dari Karet Untuk Kesehatan', 'Kelompok ini mencakup usaha pembuatan barang dari karet untuk kebutuhan menunjang kesehatan, antara lain seperti sarung kontrasepsi (KB)/kondom, dot dan alat kompres, sarung tangan karet medis, dan kateter urin (folley catheter).', 'kbli_22194', NULL, NULL),
(507, '22199', 'Industri Barang Dari Karet Lainnya Ytdl', 'Kelompok ini mencakup usaha pembuatan barang lainnya dari karet, seperti pembuatan barang dari ban bekas dan sisa macam-macam barang dari karet, antara lain sarung tangan karet selain medis. Termasuk barang-barang karet untuk pakaian (jika hanya disatukan bersama, bukan dijahit), sisir, jepit rambut, rol rambut dan sejenisnya dari karet keras, kain tekstil  yang diresapi, dilapisi atau dilaminasi dengan karet, di mana karet adalah bahan pokok, topi dan baju mandi dari karet, jas hujan dan pakaian menyelam dari karet dan alat-alat seks dari karet.', 'kbli_22199', NULL, NULL),
(508, '22210', 'Industri Barang dari Plastik Untuk Bangunan', 'Kelompok ini mencakup usaha pembuatan barang dari plastik untuk bangunan, seperti pintu, jendela, kusin, daun penutup jendela, kerai, skirting boards dari plastik, tangki, tandon air dari plastik, penutup lantai, dinding dan langit-langit plastik dalam bentuk gulungan atau lembaran dan peralatan kebersihan dari plastik, seperti hordeng plastik, shower, wastafel, lavatory pan, bak penyiram (flushing) dan lain-lain.', 'kbli_22210', NULL, NULL),
(509, '22220', 'Industri Barang Dari Plastik Untuk Pengemasan', 'Kelompok ini mencakup usaha pembuatan kemasan dari plastik, seperti tas atau kantong plastik, sak atau karung plastik, kemasan kosmetik, kemasan film, kemasan obat, kemasan makanan dan kemasan lainnya dari plastik (wadah, botol, boks, kotak, rak dan lain-lain).', 'kbli_22220', NULL, NULL),
(510, '22230', 'Industri Pipa Plastik Dan Perlengkapannya', 'Kelompok ini mencakup usaha pembuatan pipa dan selang dari plastik, seperti pipa PVC/PE/PP dan selang plastik PVC/PE/PP. Termasuk tabung plastik dan perlengkapan pipa.', 'kbli_22230', NULL, NULL),
(511, '22291', 'Industri Barang Plastik Lembaran', 'Kelompok ini mencakup usaha pembuatan barang plastik lembaran, seperti plastik lembaran berbagai jenis PE/PP/PVC, kulit imitasi, formika, kaca plastik dan plastik lembaran lainnya. Termasuk plate plastik, lembaran plastik, balok plastik, film, foil, potongan plastik dan lain-lain (baik berperekat atau tidak).', 'kbli_22291', NULL, NULL),
(512, '22292', 'Industri Perlengkapan Dan Peralatan Rumah Tangga (tidak Termasuk Furnitur)', 'Kelompok ini mencakup usaha pembuatan barang-barang perlengkapan dan peralatan rumah tangga dari plastik, seperti tikar, karpet, ember, sikat gigi, vas dan peralatan rumah tangga lainnya. Termasuk industri peralatan makan, peralatan dapur dan barang-barang toilet plastik serta industri penutup lantai elastis, seperti vynil, linoleum dan sebagainya.', 'kbli_22292', NULL, NULL),
(513, '22293', 'Industri Barang Dan Peralatan Teknik/Industri Dari Plastik', 'Kelompok ini mencakup usaha pembuatan barang-barang dan peralatan teknik/industri dari plastik, seperti bagian-bagian mesin, bagian dan kelengkapan dari motor penggerak, transmisi, body, frame, suspensi, steering, axle terbuat dari plastik, botol-botol, pipa-pipa dan lemari plastik untuk keperluan teknik/industri. Termasuk industri ban berjalan pembawa barang (conveyer belt).', 'kbli_22293', NULL, NULL),
(514, '22299', 'Industri Barang Plastik Lainnya Ytdl', 'Kelompok ini mencakup usaha pembuatan barang-barang yang belum diklasifikasikan dimanapun, seperti peralatan kantor/pendidikan, peralatan kesehatan/laboratorium dari plastik, film atau lembaran kertas kaca (cellophane), batu buatan dari plastik, tanda dari plastik (bukan listrik), berbagai barang plastik, seperti tutup kepala, peralatan penyekat, bagian dari peralatan penerangan, barang-barang kantor atau sekolah, barang-barang pakaian (jika hanya disegel atau disatukan, tidak dijahit), perlengkapan untuk furnitur, patung, tape perekat dari plastik, kertas dinding plastik, alas sepatu dari plastik, pegangan cerutu dan rokok dari plastik, sisir, pengeriting rambut dari plastik, barang kesenangan dari plastik dan sebagainya. Termasuk juga pembuatan barang dari busa plastik. Pembuatan barang-barang peralatan olahraga dimasukkan dalam kelompok 32300. Pembuatan mainan anak-anak dari plastik dimasukkan dalam kelompok 32402. Pembuatan tas, buku saku dan sejenisnya dari kulit dan kulit buatan diklasifikasikan dalam kelompok 15121.', 'kbli_22299', NULL, NULL),
(515, '23111', 'Industri Kaca Lembaran', 'Kelompok ini mencakup usaha pembuatan macam-macam kaca lembaran, seperti kaca lembaran bening tak berwarna, kaca lembaran bening berwarna, kaca lembaran buram berwarna, kaca patri, kaca berukir dan kaca cermin.', 'kbli_23111', NULL, NULL),
(516, '23112', 'Industri Kaca Pengaman', 'Kelompok ini mencakup usaha pembuatan macam-macam kaca pengaman seperti kaca pengaman diperkeras, kaca pengaman berlapis, kaca pengaman isolasi dan kaca pengaman lainnya.', 'kbli_23112', NULL, NULL),
(517, '23119', 'Industri Kaca Lainnya', 'Kelompok ini mencakup usaha pembuatan macam-macam kaca yang belum termasuk kelompok 23111 dan 23112, seperti tubes, rods, kaca batangan atau kaca pipa.', 'kbli_23119', NULL, NULL),
(518, '23121', 'Industri Perlengkapan Dan Peralatan Rumah Tangga Dari Kaca', 'Kelompok ini mencakup usaha pembuatan macam-macam perlengkapan rumah tangga dari kaca , seperti cangkir, piring, mangkok, teko, stoples, asbak dan botol susu bayi. Termasuk juga usaha pembuatan barang-barang pajangan dari kaca, seperti patung atau arca dari kaca, vas, lampu kristal, semprong lampu tekan dan semprong lampu tempel.', 'kbli_23121', NULL, NULL),
(519, '23122', 'Industri Alat-alat Laboratorium Non Klinis, Farmasi Dan Kesehatan Dari Kaca', 'Kelompok ini mencakup usaha pembuatan macam-macam alat laboratorium selain laboratorium klinis, farmasi dan kesehatan dari gelas, seperti botol serum/infus, ampul, tabung uji, tabung ukur, kaca sorong mikroskop, cuvet dan dessicator.', 'kbli_23122', NULL, NULL),
(520, '23123', 'Industri Kemasan Dari Kaca', 'Kelompok ini mencakup usaha pembuatan macam-macam barang untuk kemasan dari kaca, seperti botol dan guci. Termasuk wadah lain dari kaca atau kristal.', 'kbli_23123', NULL, NULL),
(521, '23124', 'Industri Alat Laboratorium Klinis dari Kaca', 'Kelompok ini mencakup usaha pembuatan macam-macam alat laboratorium klinis, pada umumnya untuk keperluan diagnosis, seperti tabung uji untuk sampel biologis (darah, urin, saliva).', 'kbli_23124', NULL, NULL),
(522, '23129', 'Industri Barang Lainnya Dari Kaca', 'Kelompok ini mencakup usaha pembuatan macam-macam barang lainnya dari gelas yang belum tercakup dalam kelompok 23121 s.d. 23123  seperti tasbih, rosario, manik gelas, gelas enamel dan aquarium, serat kaca (fiberglass), termasuk produk-produk dari wol kaca dan non woven kaca, kaca jam dinding atau kaca arloji, kaca dan elemen optik yang tidak bekerja secara optis, barang kaca yang digunakan pada perhiasan imitasi dan kaca isolasi dan perlengkapan isolasi kaca. Termasuk juga usaha pembuatan bahan bangunan dari gelas seperti bata, ubin, genteng, paving blocks dan sekat dinding dari kaca.', 'kbli_23129', NULL, NULL),
(523, '23911', 'Industri Bata, Mortar, Semen, dan Sejenisnya yang Tahan Api', 'Kelompok ini mencakup usaha pembuatan macam-macam bata tahan api, mortar tahan api dan semen tahan api, beton dan komposit sejenisnya yang tahan api, seperti alumina, silica dan basic.', 'kbli_23911', NULL, NULL),
(524, '23919', 'Industri Barang Tahan Api Dari Tanah Liat/Keramik Lainnya', 'Kelompok ini mencakup usaha pembuatan macam-macam barang tahan api, selain bata tahan api. Termasuk barang keramik penyekat panas dari tepung fossil siliceous; ubin dan balok refraktori; tabung kimia atau labu destilasi, wadah tempat melebur logam, penyaring, tabung, pipa dan sebagainya; dan barang refraktori yang mengandung magnet, dolomit atau kromit.', 'kbli_23919', NULL, NULL),
(525, '23921', 'Industri Batu Bata Dari Tanah Liat/Keramik', 'Kelompok ini mencakup usaha pembuatan macam-macam batu bata seperti bata pres, bata berongga, bata hiasan, bata bukan pres dan bata lubang. Termasuk juga pembuatan semen merah dan kerikil tanah liat.', 'kbli_23921', NULL, NULL),
(526, '23922', 'Industri Genteng Dari Tanah Liat/Keramik', 'Kelompok ini mencakup usaha pembuatan macam-macam genteng tanah liat/keramik, seperti genteng pres, genteng biasa, genteng kodok dan genteng yang diglazur.', 'kbli_23922', NULL, NULL),
(527, '23923', 'Industri Peralatan Saniter Dari Porselen', 'Kelompok ini mencakup usaha pembuatan macam-macam peralatan saniter dari porselen seperti kloset, bidet, wastafel, urinoir, bak cuci, bak mandi dan lain-lain.', 'kbli_23923', NULL, NULL),
(528, '23929', 'Industri Bahan Bangunan Dari Tanah Liat/Keramik Bukan Batu Bata Dan Genteng', 'Kelompok ini mencakup usaha pembuatan barang dari tanah liat/keramik untuk keperluan bahan bangunan bukan batu bata, genteng dan peralatan saniter dari porselen, seperti saluran air, ubin, lubang angin dan buis (cincin untuk sumur). Termasuk tungku keramik atau ubin dinding non refraktori, kubus mosaik  dan sebagainya, paving atau ubin keramik non refraktori, ubin untuk atap, cerobong asap, pipa, saluran keramik dan sebagainya dan balok lantai dari tanah liat yang dibakar.', 'kbli_23929', NULL, NULL),
(529, '23931', 'Industri Perlengkapan Rumah Tangga Dari Porselen', 'Kelompok ini mencakup usaha pembuatan macam-macam perlengkapan rumah tangga dari porselen, seperti piring, tatakan, cangkir, mangkok, teko, kendi, sendok , asbak, barang toilet dan toples dan barang-barang sejenis yang digunakan untuk pengangkutan atau pengepakan barang. Termasuk juga usaha pembuatan barang pajangan dari porselen seperti arca atau patung dan barang keramik ornamental lainnya, tempat bunga, kotak rokok dan guci.', 'kbli_23931', NULL, NULL),
(530, '23932', 'Industri Perlengkapan Rumah Tangga Dari Tanah Liat/Keramik', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari tanah liat untuk perlengkapan rumah tangga, pajangan/hiasan dan sejenisnya, seperti piring, cangkir, mangkok, kendi, teko, periuk, tempayan, patung, vas bunga, tempat sirih, kotak sigaret,  celengan,  toples, dan barang-barang sejenis yang digunakan untuk pengangkutan atau pengepakan barang dan lain-lain.', 'kbli_23932', NULL, NULL),
(531, '23933', 'Industri Alat Laboratorium Dan Alat Listrik/Teknik Dari Porselen', 'Kelompok ini mencakup usaha pembuatan macam-macam alat laboratorium, listrik dan teknik serta perlengkapan dari porselen seperti lumpang dan alu, piring penapis, tabung kimia, botol/guci, cawan, rumah sekering, insulator, isolator tegangan rendah dan isolator tegangan tinggi. Termasuk  magnet ferit dan keramik  dan barang-barang keramik laboratorium, kimia dan industrial.', 'kbli_23933', NULL, NULL),
(532, '23939', 'Industri Barang Tanah Liat/Keramik dan Porselen Lainnya Bukan Bahan Bangunan', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari tanah liat/keramik dan porselen lainnya bukan bahan bangunan yang belum tercakup dalam kelompok 23931 sampai dengan 23933. Termasuk furnitur keramik dan barang-barang keramik lainnya, ytdl.', 'kbli_23939', NULL, NULL),
(533, '23941', 'Industri Semen', 'Kelompok ini mencakup usaha pembuatan macam-macam semen (semen hidrolik dan arang atau kerak besi), seperti portland, natural, semen mengandung alumunium, semen terak dan semen superfosfat dan jenis semen lainnya.', 'kbli_23941', NULL, NULL),
(534, '23942', 'Industri Kapur', 'Kelompok ini mencakup usaha pembuatan macam-macam kapur dari batu kapur, seperti kapur tohor, kapur tembok dan kapur lepaan. Termasuk kapur slaked lime dan kapur hidrolik.', 'kbli_23942', NULL, NULL),
(535, '23943', 'Industri Gips', 'Kelompok ini mencakup usaha pembuatan gips, yang terbentuk dari calcined gipsum atau calsium sulphate. Termasuk calcined dolomite.', 'kbli_23943', NULL, NULL),
(536, '23951', 'Industri Barang Dari Semen', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari semen, seperti patung, pot kembang dan lain-lain.', 'kbli_23951', NULL, NULL),
(537, '23952', 'Industri Barang Dari Kapur', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari kapur, seperti kapur tulis, kapur gambar, batako dan dempul.', 'kbli_23952', NULL, NULL),
(538, '23953', 'Industri Barang Dari Semen Dan Kapur Untuk Konstruksi', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari semen dan atau kapur atau batu buatan untuk keperluan konstruksi seperti ubin, bata/dinding, pipa beton dan beton praktekan, papan, lembaran, panel, tonggak dan sebagainya, komponen struktur prafabrik untuk gedung atau bangunan sipil dan bahan-bahan bangunan dari substansi tumbuh-tumbuhan (wol kayu, alang-alang, jerami dan lain-lain) yang disatukan dengan semen atau bahan pencampur mineral lainnya.', 'kbli_23953', NULL, NULL),
(539, '23954', 'Industri Barang dari Gips Untuk Konstruksi', 'Kelompok ini mencakup pembuatan barang dari gips yang digunakan dalam konstruksi, seperti papan, lembaran, panel dan lain-lain. Termasuk Industri bahan bangunan dari substansi tumbuh-tumbuhan (wol kayu, alang-alang, jerami dan lain-lain) yang disatukan plester gips.', 'kbli_23954', NULL, NULL),
(540, '23955', 'Industri Barang Dari Asbes Untuk Keperluan Bahan Bangunan', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari asbes untuk keperluan bahan bangunan seperti asbes gelombang, asbes rata, pipa asbes bertekanan dan asbes berlapis.', 'kbli_23955', NULL, NULL),
(541, '23956', 'Industri Barang Dari Asbes Untuk Keperluan Industri', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari asbes untuk keperluan industri.', 'kbli_23956', NULL, NULL),
(542, '23957', 'Industri Mortar atau Beton Siap Pakai', 'Kelompok ini mencakup usaha pembuatan mortar atau beton siap pakai (ready mixed and dry mixed concrete and mortar).', 'kbli_23957', NULL, NULL),
(543, '23959', 'Industri Barang Dari Semen, Kapur, Gips dan Asbes Lainnya', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari semen, kapur, gips dan asbes lainnya, yang belum tercakup dalam kelompok 23951 sampai dengan 23957, seperti industri  barang dari semen serat selulosa atau sejenisnya, seperti reservoir, palung atau bak, kolam, bak cuci piring, guci, mebel, rangka jendela dan lain-lain, barang lainnya dari beton, plester gips, semen atau batu buatan, seperti patung, furnitur, relief gambar timbul dan sebagainya dan mortar bubuk.', 'kbli_23959', NULL, NULL),
(544, '23961', 'Industri Barang Dari Marmer Dan Granit Untuk Keperluan Rumah Tangga Dan Pajangan', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari marmer/granit untuk keperluan rumah tangga dan pajangan, seperti daun meja, ornamen dan patung. Termasuk pembuatan furnitur dari marmer dan granit.', 'kbli_23961', NULL, NULL),
(545, '23962', 'Industri Barang Dari Marmer Dan Granit Untuk Keperluan Bahan Bangunan', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari marmer/granit untuk keperluan bahan bangunan, seperti ubin dan bak mandi.', 'kbli_23962', NULL, NULL),
(546, '23963', 'Industri Barang Dari Batu Untuk Keperluan Rumah Tangga, Pajangan, dan Bahan Bangunan', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari batu untuk keperluan rumah tangga, pajangan, dan bahan bangunan, seperti lumpang, cobek, batu pipisan, batu asah, batu lempengan, batu pecah-pecahan, abu batu dan kubus mozaik.', 'kbli_23963', NULL, NULL),
(547, '23969', 'Industri Barang Dari Marmer, Granit Dan Batu Lainnya', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari batu marmer, granit atau batu lainnya untuk keperluan lainnya yang belum tercakup dalam kelompok 23961 hingga 23963,  seperti industri batu monumen.', 'kbli_23969', NULL, NULL),
(548, '23990', 'Industri Barang Galian Bukan Logam Lainnya Ytdl', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari bahan galian lainnya yang belum tercakup di tempat lain, seperti tepung kaolin, tepung gips, dan tepung talk. Termasuk juga usaha pembuatan kertas penggosok (abrasive paper) dan gerinda, penajaman dan pengilapan batu dan batu abrasi atau penggosok baik alami atau buatan, batu korek api (lighter flint); bahan friksi dan barang tak berbingkai dengan bahan pokok substansi mineral atau selulosa; bahan penyekat dari mineral, seperti wol terak, wol batu dan jenis wol lainnya; exfoliated vermiculate, tanah liat yang dikembangkan dan sejenis penyekat dengan panas, bahan penyerap suara; barang dari berbagai substansi mineral, seperti mika dan barang dari mika, barang dari tanah gemuk (peat) sebagai bahan pembakar, barang dari grafit (barang elektris); barang dari aspal atau material sejenisnya, misalnya perekat berbahan dasar aspal, aspal karet alam, ter batu bara dan sebagainya; dan karbon dan serat grafit dan barang turunannya (kecuali elektroda dan peralatan elektris).', 'kbli_23990', NULL, NULL),
(549, '24101', 'Industri Besi Dan Baja Dasar (Iron And Steel Making)', 'Kelompok ini mencakup usaha pembuatan besi dan baja dalam bentuk dasar, seperti pellet bijih besi, besi spons, besi kasar (pig iron) dan pembuatan besi dan baja dalam bentuk baja kasar seperti ingot baja, billet baja, baja bloom dan baja slab. Termasuk juga pembuatan besi dan baja paduan. Termasuk kegiatan tungku pembakar, steel converter, pabrik penggulungan dan finishing; produksi besi kasar dalam bentuk dasar seperti balok; produksi besi campuran; produksi produk besi yang direduksi langsung dari bijih besi dan produk besi berongga lainnya; produksi besi dari hasil pemurnian dengan proses elektrolisis dan proses kimia lainnya; produksi butir besi dan bubuk besi; produksi baja batangan (ingot) atau bentuk dasar lainnya; peleburan kembali ingot sisaan besi atau baja; dan  produksi baja setengah jadi.', 'kbli_24101', NULL, NULL),
(550, '24102', 'Industri Penggilingan Baja (Steel Rolling)', 'Kelompok ini mencakup usaha penggilingan baja, baik penggilingan panas maupun dingin, yang membuat produk-produk gilingan batang kawat baja, baja tulangan, baja profil (H-beam, I-beam dan sejenisnya), baja strip, baja rel,  pelat baja, baja lembaran hasil gilingan panas (hot rolled sheet) dan baja lembaran hasil gilingan dingin (cold rolled sheet) dilapisi atau tidak dilapisi dengan logam atau non logam lainnya termasuk penggilingan baja scrap. Termasuk  industri baja balok atau potongan gulungan panas, industri baja open section gulungan panas, industri baja balok dan baja solid section hasil proses cold drawing, grinding dan turning, industri baja open section hasil pembentukan dingin progresif pada mesin penggulung atau pelipatan pada mesin pres atau pada penggulungan flat baja, industri kawat baja baik kawat satuan maupun pilinan (strand) hasil proses cold drawing, tempering, dan  stressing, industri lembaran tiang pancang baja atau baja las open section, industri material rel kereta api baja (rel belum terpasang).', 'kbli_24102', NULL, NULL),
(551, '24103', 'Industri Pipa Dan Sambungan Pipa Dari Baja Dan Besi', 'Kelompok ini mencakup usaha pembuatan tabung, pipa dan sambungan pipa dari besi dan baja. Termasuk Industri tabung, pipa dan profile berongga baja tanpa kelim hasil pembentukan gulungan panas, hot drawing atau hot extruding, gulungan dingin atau cold drawing; industri tabung dan pipa baja las hasil pengelasan dan pembentukan panas atau dingin, sebagai proses lanjutan dari gulungan dingin atau cold drawing; dan industri fittings pipa baja, seperti flat flanges dan flanges with forged collar, butt-welded fittings, threaded fittings dan socket-welded fiitings.', 'kbli_24103', NULL, NULL),
(552, '24201', 'Industri Pembuatan Logam Dasar Mulia', 'Kelompok ini mencakup usaha pemurnian, peleburan, pemaduan dan penuangan logam mulia dalam bentuk dasar (ingot, billet, slab, batang, pellet, block, sheet, pig, paduan dan bubuk) seperti ingot perak, ingot emas, pellet platina dan sebagainya.', 'kbli_24201', NULL, NULL),
(553, '24202', 'Industri Pembuatan Logam Dasar Bukan Besi', 'Kelompok ini mencakup usaha pemurnian, peleburan, pemaduan dan penuangan logam-logam bukan besi dalam bentuk dasar (ingot, billet, slab, batang, pellet, block, sheet, pig, paduan dan bubuk) seperti ingot kuningan, ingot aluminium, ingot seng, ingot tembaga, ingot timah, billet kuningan, billet aluminium, slab kuningan, slab aluminium, batang (rod) kuningan, batang aluminium, pellet kuningan, pellet aluminium, paduan perunggu, paduan nikel dan logam anti gesekan (bearing metal) serta logam tanah jarang dan paduan logam tanah jarang (15 unsur lantanida ditambah unsur scandium dan yttrium).', 'kbli_24202', NULL, NULL),
(554, '24203', 'Industri Penggilingan Logam Bukan Besi', 'Kelompok ini mencakup usaha penggilingan logam bukan besi, baik penggilingan panas maupun penggilingan dingin, seperti pelat tembaga, pelat aluminium, sheet (lembaran) tembaga, sheet aluminium, strip (jalur) perak, strip seng, strip aluminium, sheet tembaga, sheet magnesium, tin foil dan strip platina. Termasuk pembuatan kawat logam.', 'kbli_24203', NULL, NULL),
(555, '24204', 'Industri Ekstrusi Logam Bukan Besi', 'Kelompok ini mencakup usaha ekstrusi logam bukan besi, seperti ekstrusi tembaga dan paduannya, ekstrusi aluminium dan ekstrusi tungsten.', 'kbli_24204', NULL, NULL),
(556, '24205', 'Industri Pipa Dan Sambungan Pipa Dari Logam Bukan Besi Dan Baja', 'Kelompok ini mencakup usaha pembuatan tabung, pipa dan sambungan pipa dari logam bukan besi dan baja.', 'kbli_24205', NULL, NULL),
(557, '24206', 'Industri Pengolahan Uranium dan Bijih Uranium', 'Kelompok ini mencakup pemurnian logam uranium dari bijih uranium atau bijih lainnya yang mengandung uranium, pengolahan uranium alam dan persenyawaannya, pengayaan uranium dan persenyawaannya, plutonium dan persenyawaannya, atau pemisahan dan penggabungan persenyawaan tersebut.', 'kbli_24206', NULL, NULL),
(558, '24310', 'Industri Pengecoran Besi Dan Baja', 'Kelompok ini mencakup usaha peleburan, pencampuran dan pengecoran atau penuangan logam besi dan baja yang menghasilkan produk-produk tuangan dalam bentuk kasar, seperti besi tuang, baja tuang dan baja tuang paduan.  Termasuk pengecoran produk besi setengah jadi, pengecoran besi tuang abu-abu, pengecoran besi tuang grafit spheroid, pengecoran besi tuang yang dapat ditempa, pengecoran produk baja setengah jadi, pengecoran baja tuang, industri tabung, pipa dan profile berongga serta fittings tabung dan pipa yang terbuat dari besi tuang, industri tabung dan pipa baja tanpa kelim dari proses pengecoran sentrifugal dan industri tabung dan pipa fittings yang terbuat dari baja tuang.', 'kbli_24310', NULL, NULL),
(559, '24320', 'Industri Pengecoran Logam Bukan Besi Dan Baja', 'Kelompok ini mencakup usaha peleburan, pemaduan dan pengecoran atau penuangan logam-logam bukan besi dalam bentuk dasar, seperti tuangan tembaga dan paduannya, tuangan aluminium dan paduannya, tuangan nikel dan paduannya.  Termasuk Pengecoran produk setengah jadi dari aluminium, magnesium, titanium, seng dan lain-lain, pengecoran logam ringan tuang, pengecoran logam berat tuang, pengecoran logam mulia tuang dan die-casting logam bukan besi.', 'kbli_24320', NULL, NULL),
(560, '25111', 'Industri Barang Dari Logam Bukan Aluminium Siap Pasang Untuk Bangunan', 'Kelompok ini mencakup usaha pembuatan bahan bangunan siap pasang dari logam bukan aluminium, seperti pagar besi, teralis, pintu/jendela, lubang  angin,  tangga dan produk-produk konstruksi ringan lainnya. Industri pembuatan bahan konstruksi berat siap pasang dari baja, seperti untuk jembatan, menara listrik tegangan tinggi, pintu air dan sejenisnya dimasukkan dalam kelompok 25113, sedangkan industri pembuatan ketel uap, bejana tekan dan sejenisnya dimasukkan dalam kelompok 25120.', 'kbli_25111', NULL, NULL),
(561, '25112', 'Industri Barang Dari Logam Aluminium Siap Pasang Untuk Bangunan', 'Kelompok ini mencakup usaha pembuatan bahan bangunan siap pasang dari logam aluminium, seperti kusen jendela, kusen pintu, teralis aluminium, atap aluminium (awning), rolling door, krei aluminium dan produk-produk konstruksi ringan lainnya.', 'kbli_25112', NULL, NULL),
(562, '25113', 'Industri Konstruksi Berat Siap Pasang Dari Baja Untuk Bangunan', 'Kelompok ini mencakup usaha pembuatan bahan bangunan konstruksi berat siap pasang dari baja untuk jembatan, bangunan hanggar, menara listrik tegangan tinggi, pintu air dan sejenisnya.', 'kbli_25113', NULL, NULL),
(563, '25119', 'Industri Barang Dari Logam Siap Pasang Untuk Konstruksi Lainnya', 'Kelompok ini mencakup usaha pembuatan barang-barang dari logam siap pasang untuk konstruksi yang belum tercakup dalam kelompok 25111 s.d. 25113.', 'kbli_25119', NULL, NULL),
(564, '25120', 'Industri Tangki, Tandon Air Dan Wadah Dari Logam', 'Kelompok ini mencakup usaha pembuatan ketel uap untuk proses pengolahan (industri boiler), ketel untuk keperluan pembangkit tenaga (utility boiler), bejana tekan (presure vessel), scrubber dan sejenisnya. Termasuk pula usaha pembuatan tangki-tangki lainnya yang bertekanan seperti autoclave, tabung gas bertekanan (tabung gas LPG), tangki-tangki silo, alat penukar panas (heat exchanger) dan berbagai jenis alat penghasil uap gas lainnya. Termasuk  tandon, tangki dan wadah dari logam yang secara umum dibuat untuk perlengkapan/tempat penyimpanan atau untuk keperluan industri dan ketel pemanas dan radiator.', 'kbli_25120', NULL, NULL),
(565, '25130', 'Industri Generator Uap, Bukan Ketel Pemanas', 'Kelompok ini mencakup usaha pembuatan generator uap, termasuk komponen dan perlengkapannya, seperti steam accumulatator, economizer dan sejenisnya. Termasuk industri mesin uap lainnya, mesin tambahan yang digunakan dengan generator uap (kondenser, economizer, superheater, steam collectors dan accumulators), suku cadang ketel kapal laut atau ketel tenaga, reaktor nuklir beserta komponen dan perlengkapannya kecuali pemisah isotop.', 'kbli_25130', NULL, NULL),
(566, '25200', 'Industri Senjata Dan Amunisi', 'Kelompok ini mencakup pembuatan senjata berat (meriam, mobile guns, peluncur roket, tabung torpedo, senjata mesin berat), pembuatan senjata ringan/kecil (revolver, senapan, senapan mesin ringan) baik untuk militer atau polisi, pembuatan senjata gas dan amunisinya, senapan angin atau pistol dan amunisi perang. Termasuk pembuatan senjata api untuk berburu, olahraga atau perlindungan dan amunisinya, alat peledak seperti bom, granat, torpedo, ranjau, roket dan sebagainya.', 'kbli_25200', NULL, NULL),
(567, '25910', 'Industri Penempaan, Pengepresan, Pencetakan Dan Pembentukan Logam; Metalurgi Bubuk', 'Kelompok ini mencakup pembuatan berbagai barang jadi dan setengah jadi dari logam baik baja, besi maupun logam bukan besi menjadi logam dalam bentuk logam tempaan, pres-an dan atau logam gulungan.', 'kbli_25910', NULL, NULL),
(568, '25920', 'Jasa Industri Untuk Berbagai Pengerjaan Khusus Logam Dan Barang Dari Logam', 'Kelompok ini mencakup kegiatan jasa industri untuk pelapisan, pemolesan, pewarnaan, pengukiran, pengerasan, pengkilapan, pengelasan, pemotongan dan berbagai pekerjaan khusus terhadap logam atau barang-barang dari logam. Kegiatannya termasuk industri penyepuhan logam, anodizing dan lain-lain; industri pengolahan panas logam; deburring, penyemprotan pasir (sandbalasting), perobohan (tumbling) dan pembersihan logam; industri pewarnaan dan pengukiran atau pemahatan logam; industri pelapisan bukan metalik logam, seperti pelapisan dengan plastik, email atau porselain, lak/pernis dan lain-lain; industri pengerasan dan pengkilapan logam; industri pengeboran, pengolahan, penggilingan, pengikisan, pembentukan, pemutaran, broaching, leveling, penggergajian, penghalusan, penajaman,  penyemiran, pengelasan, penyambungan dan lain-lain bagian pekerjaan logam; dan industri pemotongan atau penulisan pada logam dengan sinar laser.', 'kbli_25920', NULL, NULL),
(569, '25931', 'Industri Alat Potong dan Perkakas Tangan Untuk Pertanian', 'Kelompok ini mencakup usaha pembuatan alat-alat/perkakas tangan pertanian yang tidak digerakkan dengan tenaga dari logam, seperti cangkul, sekop, bajak, garu, sabit, ani-ani, alat perontok padi, alat pemipil jagung dan hand sprayer.', 'kbli_25931', NULL, NULL),
(570, '25932', 'Industri Alat Potong dan Perkakas Tangan Pertukangan', 'Kelompok ini mencakup usaha pembuatan alat-alat pertukangan dari logam, seperti water pass, siku-siku, beliung, pahat, obeng, martil, serut/ketam, gergaji dan mata gergaji, mata gergaji bundar dan mata gergaji rantai, mata bor dan sejenisnya, kampak dan pisau pemotong kaca. Termasuk industri pisau dan mata pisau untuk mesin atau untuk peralatan mekanik, perkakas tangan (tang, obeng dan lain-lain), perkakas tangan pertanian yang tidak digerakkan dengan tenaga, alat yang dapat dipertukarkan untuk perkakas tangan, baik yang tidak digerakkan dengan tenaga atau mesin perkakas (seperti bor, pemukul, pisau penggiling dan lain-lain), perkakas pengepres, perkakas pandai besi (seperti alat tempa, landasan tempa dan lain-lain), kotak cetakan dan cetakan (kecuali cetakan ingot) dan perkakas kelim.', 'kbli_25932', NULL, NULL),
(571, '25933', 'Industri Alat Potong Dan Perkakas Tangan Yang Digunakan Dalam Rumah Tangga', 'Kelompok ini mencakup usaha pembuatan bermacam-macam pisau, parang/golok, pisau bergerigi, pisau cukur, silet, gunting, hair clipper, gunting rambut, gunting kuku, sendok, garpu dan peralatan sejenisnya yang digunakan di dapur dan meja makan.  Industri alat-alat dapur (misalnya periuk, panci, dandang dan kompor) dimasukkan dalam kelompok 25992.', 'kbli_25933', NULL, NULL),
(572, '25934', 'Industri Peralatan Umum', 'Kelompok ini mencakup usaha pembuatan peralatan lainnya dari logam yang belum termasuk dalam kelompok 25931 s.d. 25933, misalnya kunci, gembok, kunci pintu, engsel, gerendel dan peralatan sejenisnya untuk bangunan, furnitur dan lainnya. Termasuk industri pisau pendek atau belati, pedang, bayonet, dan lain-lain.', 'kbli_25934', NULL, NULL),
(573, '25940', 'Industri Ember, Kaleng, Drum Dan Wadah Sejenis Dari Logam', 'Kelompok ini mencakup usaha pembuatan wadah dari logam/kaleng, seperti kaleng makanan/minuman, kaleng cat/bahan kimia lainnya, tong, drum, ember, kotak, jerrycan dan sejenisnya. Termasuk industri metallic closure.', 'kbli_25940', NULL, NULL),
(574, '25951', 'Industri Barang Dari Kawat', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari kawat logam, termasuk tali kawat logam, seperti kawat berduri, pagar kawat, kasa kawat, jaring kawat dan alat pemanggang (grill). Industri kabel listrik dan komunikasi dimasukkan dalam kelompok 27310 dan 27320. Termasuk industri pegas (selain pegas jam), seperti leaf springs, helical springs, torsion bar springs dan lembaran untuk pegas dan industri rantai (kecuali power transmission chain).', 'kbli_25951', NULL, NULL),
(575, '25952', 'Industri Paku, Mur Dan Baut', 'Kelompok ini mencakup usaha pembuatan paku, mur, baut dan barang berulir sejenis yang terbuat dari besi, baja, tembaga, alumunium dan logam lainnya.', 'kbli_25952', NULL, NULL),
(576, '25991', 'Industri Brankas, Filling Kantor dan Sejenisnya', 'Kelompok ini mencakup pembuatan alat-alat kantor dari logam, seperti brankas, filling cabinet, tidak termasuk furnitur dari logam. Termasuk industri peti besi, lemari besi, pintu lapis baja dan lain-lain.', 'kbli_25991', NULL, NULL),
(577, '25992', 'Industri Peralatan Dapur Dan Peralatan Meja Dari Logam', 'Kelompok ini mencakup usaha pembuatan alat-alat dapur baik dari alumunium maupun dari logam bukan alumunium seperti peralatan makan, piring, piring ceper, mangkok, teko, panci, wajan ketel, periuk, dandang, ketel masak, rantang, baskom, baki, pot dan sejenisnya.  Termasuk  peralatan bukan listrik lainnya yang digunakan di meja atau di dapur, peralatan kecil dapur lainnya yang digerakkan dengan tangan dan aksesorinya dan alat penggosok dari logam.', 'kbli_25992', NULL, NULL),
(578, '25993', 'Industri Keperluan Rumah Tangga Dari Logam Bukan Peralatan Dapur dan Peralatan Meja', 'Kelompok ini mencakup usaha pembuatan alat-alat untuk keperluan rumah tangga lainnya baik dari alumunium maupun dari logam bukan alumunium seperti jemuran, tangga, lemari dapur dan lain-lain.  Termasuk industri bak mandi, bak cuci (piring), wastafel dan peralatan sejenis.', 'kbli_25993', NULL, NULL),
(579, '25994', 'Industri Pembuatan Profil', 'Kelompok ini mencakup usaha pembuatan baja profil dengan cara las, seperti profil H (H-Beam), profil I (I-Beam) dan sejenisnya.', 'kbli_25994', NULL, NULL),
(580, '25995', 'Industri Lampu Dari Logam', 'Kelompok ini mencakup usaha pembuatan macam-macam lampu yang bahan utamanya dari logam, seperti lampu mercu suar, lampu tekan dan lampu gantung termasuk komponennya.', 'kbli_25995', NULL, NULL),
(581, '25999', 'Industri Barang Logam Lainnya YTDL', 'Kelompok ini mencakup usaha pembuatan macam-macam barang dari logam, yang belum tercakup di subgolongan manapun seperti jepitan rambut, peniti, stapless, paper clips, jarum, jarum jahit, jarum bordir dan jarum sejenisnya, kepala gesper, rantai logam, bel, bingkai (lis) gambar, papan nama logam dan berbagai barang logam yang kecil. Termasuk baling-baling, rantai kapal, jangkar kapal, lonceng, perlengkapan tetap (fixture) rel kereta api yang terpasang, kabel logam yang dijalin pembalut sejenisnya, kabel logam yang tidak terisolasi atau kabel logam terisolasi yang tidak dapat digunakan sebagai konduktor listrik, paku dan paku payung, paku sumbat/keling, cincing penutup dan barang-barang tidak berulir sejenis, screw machine product, kantong timah, magnet logam permanen, botol atau kendi logam hampa udara, tanda logam (bukan listrik), lencana logam dan lencana militer logam dan pengeriting rambut dan sisir logam, kerangka dan pegangan payung.', 'kbli_25999', NULL, NULL),
(582, '26110', 'Industri Tabung Elektron Dan Konektor Elektronik', 'Kelompok ini mencakup pembuatan tabung gambar televisi, tabung kamera televisi, tabung dan katup amplifier dan receiver. Termasuk tabung elektron, konektor elektronik, kabel printer, kabel monitor, kabel USB, konektor dan lain-lain, katup elektronik dan tabung lampu.', 'kbli_26110', NULL, NULL),
(583, '26120', 'Industri Semi Konduktor Dan Komponen Elektronik Lainnya', 'Kelompok ini mencakup pembuatan semi konduktor dan komponen elektronik lainnya, seperti transistor dan peralatan semi konduktor yang sejenis, integrated circuits, printed circuits, induktor, resistor, kapasitor dan berbagai komponen elektronik lainnya. Termasuk industri mikroprosesor, induktor jenis komponen elektronik (misalnya cok, gulungan, trafo), kristal elektronik dan crystal assemblies, solenoida, switch dan transducer untuk aplikasi elektronik, interface cards (misalnya sound (kartu suara), video (kartu video), kontroler, kartu jaringan, modem), komponen layar (plasma, polimer, LCD), light emitting diodes (LED), IC atau integrated circuit (analog, digital, maupun hibrid) dan dioda. Termasuk juga pembuatan sel fotovoltaik dan chip smartcard.', 'kbli_26120', NULL, NULL),
(584, '26210', 'Industri Komputer Dan/Atau Perakitan Komputer', 'Kelompok ini mencakup usaha pembuatan berbagai macam mesin komputasi, seperti komputer desktop, komputer laptop, komputer mainframe, komputer ukuran tangan (misal PDA), komputer tablet, dan server komputer. Termasuk kegiatan perakitan komputer.', 'kbli_26210', NULL, NULL),
(585, '26220', 'Industri Perlengkapan Komputer', 'Kelompok ini mencakup pembuatan perlengkapan komputer, seperti disk drive magnetik, flash drive dan alat penyimpanan lainnya, disk drive optik (misalnya CD-RW, CD-ROM, DVD-ROM, DVD-RW), printer, monitor, keyboard, mouse, joystick, dan aksesori trackball, terminal komputer, scanner, bar code scanner, smart card reader, proyektor komputer (video beamer), alat perlengkapan media imersif (virtual reality/augmented reality/mixed reality) seperti virtual reality helmets, augmented reality glasses, dan alat pendukung lainnya. Termasuk industri terminal komputer, seperti anjungan tunai mandiri (ATM), terminal point of sale (POS), yang tidak dioperasikan secara mekanis dan peralatan kantor multifungsi, seperti kombinasi faks-scanner-fotokopi.', 'kbli_26220', NULL, NULL),
(586, '26310', 'Industri Peralatan Telepon Dan Faksimili', 'Kelompok ini mencakup pembuatan alat-alat transmisi komunikasi, seperti peralatan pesawat telepon dan faksimili, termasuk di dalamnya mesin penjawab dan lainnya.', 'kbli_26310', NULL, NULL),
(587, '26320', 'Industri Peralatan Komunikasi Tanpa kabel (Wireless)', 'Kelompok ini mencakup pembuatan alat-alat transmisi komunikasi, seperti peralatan pager, telepon selular, tablet seluler, dan peralatan komunikasi bergerak (mobile) dan lainnya.', 'kbli_26320', NULL, NULL),
(588, '26391', 'Industri Kartu Cerdas (Smart Card)', 'Kelompok ini mencakup pembuatan smart card, seperti perencanaan design chip (design house), perencanaan tata letak sirkuit smart card, industri chip foundry, industri chip module packaging, pembuatan firmware dan software yang berkaitan langsung dengan smart card, chip packaging. Contoh smart card seperti simcard, Near Field Communications (NFC), dengan teknologi 2G, 3G, 4G, 5G dst, kartu perbankan, kartu akses, micro dan macro payment, kartu kredit dan semua kartu yang menggunakan pengaman data dan atau komunikasi.', 'kbli_26391', NULL, NULL),
(589, '26399', 'Industri Peralatan Komunikasi Lainnya', 'Kelompok ini mencakup pembuatan alat-alat transmisi komunikasi lainnya, peralatan Private Branch Exchange (PBX), peralatan komunikasi data (bridge, router, gateway), pesawat telepon tanpa kabel, peralatan TV kabel, antena transmisi (pemancar) dan penerima, peralatan studio televisi dan radio dan peralatan siaran termasuk kamera televisi, modem peralatan carrier, sistem alarm kebakaran dan pencurian, transmitor radio dan televisi, peralatan infrared (misalnya remote kontrol), EDC (Electronic Data Capture) dan lainnya. Termasuk juga pembuatan set top box untuk terestrial dan satelit.', 'kbli_26399', NULL, NULL),
(590, '26410', 'Industri Televisi Dan/Atau Perakitan Televisi', 'Kelompok ini mencakup pembuatan televisi, seperti pesawat penerima televisi dan kombinasi, monitor televisi dan pertunjukan. Termasuk perakitan televisi.', 'kbli_26410', NULL, NULL),
(591, '26420', 'Industri Peralatan Perekam, Penerima dan Pengganda Audio Dan Video, Bukan Industri Televisi', 'Kelompok ini mencakup pembuatan peralatan audio dan video elektronik untuk hiburan di rumah (home entertainment) untuk rumah tangga dan kendaraan bermotor, seperti pesawat penerima radio dan kombinasi, tape recorder dan video recorder. Termasuk industri peralatan stereo, pemutar CD dan VCD/DVD, kamera video jenis rumah tangga dan jukebox.', 'kbli_26420', NULL, NULL),
(592, '26490', 'Industri Peralatan Audio dan Video Elektronik Lainnya', 'Kelompok ini mencakup pembuatan peralatan elektronika untuk rumah tangga, seperti mikrofon, loudspeaker, headphone, amplifier dan sebagainya.  Termasuk industri mesin karaoke, headphone (radio, stereo, komputer) dan konsol video game dan lainnya.', 'kbli_26490', NULL, NULL),
(593, '26511', 'Industri Alat Ukur Dan Alat Uji Manual', 'Kelompok ini mencakup usaha pembuatan alat-alat pengukur, pemeriksa dan pengujian manual, baik yang ada maupun yang tidak ada hubungannya dengan penyelidikan ilmu pengetahuan dan bersifat mekanis, seperti pesawat ukur, thermometer, barometer, kompas, timbangan presisi, pesawat terapi mekanis, meteran air ledeng dan gas, serta instrumen ukur tanah. Termasuk juga perlengkapan dari peralatan-peralatan tersebut. Kelompok ini mencakup juga usaha pembuatan alat-alat pengukur, pemeriksa dan pengujian manual yang berhubungan dengan kesehatan, seperti timbangan badan dan timbangan bayi.', 'kbli_26511', NULL, NULL),
(594, '26512', 'Industri Alat Ukur Dan Alat Uji Elektrik', 'Kelompok ini mencakup usaha pembuatan alat-alat pengukur, pemeriksa dan pengujian elektrik/listrik, baik yang ada maupun yang tidak ada hubungannya dengan penyelidikan ilmu pengetahuan, seperti meteran arus listrik. Termasuk juga perlengkapan dari peralatan-peralatan tersebut.', 'kbli_26512', NULL, NULL),
(595, '26513', 'Industri Alat Ukur Dan Alat Uji Elektronik', 'Kelompok ini mencakup usaha pembuatan alat-alat instrumen analitis, skala, neraca dan inkubator laboratorium serta alat laboratorium lainnya untuk pengukuran dan pengujian, alat-alat pengukur dan pemeriksa elektronik, baik yang ada maupun yang tidak ada hubungannya dengan penyelidikan ilmu pengetahuan, seperti  pesawat pengatur elektronik otomatis, speedometer, argometer, elektronik sinar katoda, radar, radio kontrol dan instrumen navigasi, meteorologi, geofisika, hidrologi dan spectofotometer serta alat ukur digital (termasuk thermometer dan barometer). Termasuk juga perlengkapan dari peralatan-peralatan tersebut. Kelompok ini mencakup juga usaha pembuatan mikroskop proton dan elektron (kecuali mikroskop optis) dan timbangan digital.', 'kbli_26513', NULL, NULL),
(596, '26514', 'Industri Alat Uji Dalam Proses Industri', 'Kelompok ini mencakup pembuatan berbagai peralatan pengukuran dan kontrol dari barang-barang yang sedang diproses, baik alat ukur panas, tekanan, kekentalan, maupun alat ukur sifat-sifat barang.', 'kbli_26514', NULL, NULL),
(597, '26520', 'Industri Alat Ukur Waktu', 'Kelompok ini mencakup usaha pembuatan macam-macam jam seperti arloji tangan, arloji saku, arloji kalung, jam dinding, jam beker dan lonceng. Termasuk juga usaha pembuatan bagian-bagian dari jam/arloji, seperti movement part, dial plate/hand, pegas, batu baterai, lempeng jam, jarum dan bagian lainnya, case (badan) jam dan arloji, termasuk case (badan) dari logam mulia, alarm for watch, instrumen panel clocks, crono meter, stop watch, pencatat waktu parking, pencatat waktu datang dan pulang pegawai (pencatat waktu absen), time/date stamps dan pencatat waktu proses, time locks (pengunci waktu) dan lain-lain.', 'kbli_26520', NULL, NULL),
(598, '26601', 'Industri Peralatan Iradiasi/Sinar X, Perlengkapan Dan Sejenisnya', 'Kelompok ini mencakup usaha pembuatan peralatan dan tabung iradiasi (penyinaran) yang didasarkan pada penggunaan radiasi sinar X, Alpha, Beta, atau Gamma, baik yang digunakan pada bidang kesehatan dan industri, seperti peralatan industri, peralatan iradiasi susu dan makanan, diagnosa medis, terapi medis, penelitian dan ilmu pengetahuan, peralatan pengukuran (gauging), dan peralatan pengeboran (well logging). Misalnya peralatan radiasi sinar X, beta, gamma dan sinar lainnya. Termasuk pula pembuatan tabung sinar X, kontrol panel, screen dan yang terkait, serta peralatan sterilisasi dengan sinar ultra violet.', 'kbli_26601', NULL, NULL),
(599, '26602', 'Industri Peralatan Elektromedikal dan Elektroterapi', 'Kelompok ini mencakup pembuatan peralatan dan perlengkapan elektromedikal dan elektroterapi, seperti peralatan electrocardiograph, peralatan test mata (termasuk reflektor, endoscope dan lain-lain), ozone therapy, oxygen therapy, penangkap citra (scanner) untuk diagnosa medis, peralatan MRI (magnetic resonce imaging), peralatan ultrasound medis, peralatan endoskopi elektromedikal, peralatan laser medis, peralatan alat bantu dengar dan peralatan alat pacu jantung.', 'kbli_26602', NULL, NULL),
(600, '26710', 'Industri Peralatan Fotografi', 'Kelompok ini mencakup usaha pembuatan macam-macam kamera fotografi, seperti kamera foto biasa, kamera langsung jadi, kamera untuk micro film, kamera digital, kamera untuk still picture dan kamera untuk penelitian udara.', 'kbli_26710', NULL, NULL),
(601, '26791', 'Industri Kamera Cinematografi Proyektor Dan Perlengkapannya', 'Kelompok ini mencakup usaha pembuatan macam-macam kamera cinematografi, proyektor, seperti kamera cinematografi, proyektor cinematografi, image proyektor, slide projector, overhead transparancy projector, aparat cahaya kilat fotografi, frame kamera, tempat film dan lensa kamera zoom. Termasuk alat pengukur cahaya untuk fotografi.', 'kbli_26791', NULL, NULL),
(602, '26792', 'Industri Teropong Dan Instrumen Optik Bukan Kaca Mata', 'Kelompok ini mencakup usaha pembuatan teropong dan alat optik serta bagian-bagiannya untuk ilmu pengetahuan dan percetakan seperti teropong monoculer, teropong astronomi, elbow telescope, periscope, optik, spectroscope, spectograph, lensa berlapis diasah, lensa prisma.  Termasuk mikroskop optik, binokular dan teleskop, cermin optik, peralatan kaca pembesar optik, peralatan presisi (ketepatan) masinis optik, komparator optik, peralatan pembidik senjata optik, peralatan positioning optik, peralatan dan instrumen pengukuran dan pemeriksaan optik (misalnya peralatan pengontrol api/fire control equipment, pengukur jarak) dan peralatan laser. Kelompok ini juga mencakup industri pelapisan, penggosokan lensa dan mounting lensa (bukan opthalmik) dan lainnya.', 'kbli_26792', NULL, NULL),
(603, '26800', 'Industri Media Magnetik dan Media Optik', 'Kelompok ini mencakup usaha pembuatan media rekam magnetik dan optik untuk suara, gambar maupun data, yang bahan utamanya dari plastik, seperti pita audio dan video magnetik kosong, kaset audio dan video magnetik kosong, piringan hitam kosong, film yang belum peka terhadap cahaya, pita untuk merekam data dan disk/diskette kosong dan disk optik kosong dan media hard drive. Usaha pembuatan film yang peka terhadap cahaya dimasukkan dalam kelompok 20299. Usaha rekaman suara dengan media pita kaset, piringan hitam dimasukkan dalam kelompok 59201. Sedangkan rekaman gambar film dan pita video dimasukkan dalam subgolongan 5911 (Produksi gambar Bergerak, Video dan Program Televisi). Usaha rekaman data dengan pita, disk/diskette dan sejenisnya yang menggunakan jasa komputer dimasukkan dalam kelompok 62090.', 'kbli_26800', NULL, NULL),
(604, '27111', 'Industri Motor Listrik', 'Kelompok ini mencakup usaha pembuatan motor listrik dan komponen/bagiannya, seperti motor AC, motor DC, stator, rotor, brush dan commutator, kecuali mesin pembakaran dalam untuk menyalakan motor.', 'kbli_27111', NULL, NULL),
(605, '27112', 'Industri Mesin Pembangkit Listrik', 'Kelompok ini mencakup usaha pembuatan generator dan komponen/bagiannya seperti generator arus bolak-balik, generator arus searah, generator set, stator, rotor, commutator dan rotary converter. Termasuk generator tenaga (kecuali alternator pengisi baterai untuk mesin pembakaran dalam), perangkat generator motor (kecuali perangkat generator turbin) dan perangkat generator penggerak utama.', 'kbli_27112', NULL, NULL),
(606, '27113', 'Industri Pengubah Tegangan (Transformator), Pengubah Arus (Rectifier) Dan Pengontrol Tegangan (Voltage Stabilizer)', 'Kelompok ini mencakup usaha pembuatan transformator, pengubah arus, pengontrol tegangan dan komponen/bagiannya, seperti transformator distribusi, transformator tenaga, pengubah arus AC ke DC , pengontrol tegangan, radiator, ring bike lite dan commutator. Termasuk transformator distribusi listrik, transformator arc-welding, flourescent ballast atau lighting ballast, transformator sub stasiun untuk distribusi tenaga listrik dan pengatur transmisi dan distribusi voltase listrik.', 'kbli_27113', NULL, NULL),
(607, '27120', 'Industri Peralatan Pengontrol dan Pendistribusian Listrik', 'Kelompok ini mencakup usaha pembuatan panel listrik dan switch gear serta komponen/bagiannya, seperti control panel otomatis, ligthing distribution board, pemutus aliran listrik, pemutus arus dan control desk, control panel dan pengaliran sakelar tertutup. Termasuk sakelar pemutus aliran listrik, angker dinamo untuk untuk pabrik, surge suppressor/penindas sentakan listrik (untuk distribusi tingkat voltase), panel kontrol untuk distribusi tenaga listrik, relay listrik, pipa/saluran peralatan papan penghubung/switchboard aliran listrik, sekering listrik, peralatan pemindah tenaga (power switching), saklar tenaga listrik (kecuali tombol tekan, snap, solenoida, tumbler) dan KWH meter.', 'kbli_27120', NULL, NULL),
(608, '27201', 'Industri Batu Baterai', 'Kelompok ini mencakup usaha pembuatan segala macam batu baterai, seperti sel dan baterai listrik primer, baterai alkali, dan baterai mercury. Termasuk baterai dan sel-sel utama, baik yang mengandung mangan dioksida, merkuri dioksida, perak oksida atau lainnya, baterai asam timah, baterai Ni-Cad, baterai Ni-Mh, baterai Lithium, baterai cell kering dan baterai cell basah. Termasuk penggunaan untuk baterai HP dan baterai laptop.', 'kbli_27201', NULL, NULL),
(609, '27202', 'Industri Akumulator Listrik', 'Kelompok ini mencakup usaha pembuatan macam-macam akumulator listrik, aki dan komponennya seperti aki dari 6V atau 12V dengan kekuatan 200 amper atau kurang, pelat aki, separator, wadah, penutup, pole dan jepitan aki (tipe gigi).', 'kbli_27202', NULL, NULL),
(610, '27203', 'Industri Baterai Untuk Kendaraan Bermotor Listrik', 'Kelompok ini mencakup usaha pembuatan segala macam baterai untuk kendaraan bermotor listrik.', 'kbli_27203', NULL, NULL),
(611, '27310', 'Industri Kabel Serat Optik', 'Kelompok ini mencakup usaha pembuatan kabel serat optik.', 'kbli_27310', NULL, NULL),
(612, '27320', 'Industri Kabel Listrik Dan Elektronik Lainnya', 'Kelompok ini mencakup usaha pembuatan macam-macam kabel listrik dan kabel elektronik yang dibalut dengan isolator atau berpenyekat dari baja, tembaga atau aluminium, seperti kabel komunikasi atau telepon, kabel listrik jaringan tegangan rendah/menengah/ tinggi. Usaha pembuatan kawat/kabel logam tanpa dibalut dimasukkan dalam kelompok 24202.', 'kbli_27320', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(613, '27330', 'Industri Perlengkapan Kabel', 'Kelompok ini mencakup usaha pembuatan fitting, sakelar, stop kontak dan sebagainya, seperti batang penghantar, konduktor listrik (kecuali jenis switchgear), GFCI (ground fault circuit interrupter), lamp holder, penangkal petir dan koil, steker untuk untuk perangkat kawat listrik (misalnya penekan, tombol tekan, snap, tumbler switcher), outlet dan socket listrik (stop kontak), kotak untuk peralatan kawat listrik (seperti junction, outlet, switch box), kabel dan peralatan listrik, kutub transmisi dan line hardware dan plastik untuk peralatan kawat bukan pembawa arus termasuk kotak plastik junction, face plates dan sejenisnya dan peralatan pole line plastik.', 'kbli_27330', NULL, NULL),
(614, '27401', 'Industri Bola Lampu Pijar, Lampu Penerangan Terpusat Dan Lampu Ultra Violet', 'Kelompok ini mencakup usaha pembuatan macam-macam lampu pijar untuk penerangan, seperti bohlam tidak termasuk fitting dan perlengkapannya, penerangan fotografi (flash bulbs) dan penerangan untuk panggung/lampu sorot (spot light). Termasuk lampu ultra violet dan infra red, lampu senter, penerangan pada alat-alat kedokteran. Usaha pembuatan peralatan penerangan pada sepeda dan kendaraan bermotor dimasukkan pada kelompok 27403.', 'kbli_27401', NULL, NULL),
(615, '27402', 'Industri Lampu Tabung Gas (Lampu Pembuang Listrik)', 'Kelompok ini mencakup usaha pembuatan macam-macam lampu tabung gas dan discharge, seperti lampu neon, lampu helium, lampu argon, lampu natrium dan lampu mercury. Termasuk lampu listrik serangga.', 'kbli_27402', NULL, NULL),
(616, '27403', 'Industri Peralatan Penerangan Untuk Alat Transportasi', 'Kelompok ini mencakup pembuatan peralatan penerangan untuk alat transportasi motor, mobil, pesawat, kapal dan alat transportasi lainnya (lampu rem, lampu tanda berbelok, lampu interior dan sebagainya). Termasuk usaha pembuatan komponen dan perlengkapannya.', 'kbli_27403', NULL, NULL),
(617, '27404', 'Industri Lampu LED', 'Kelompok ini mencakup usaha pembuatan lampu LED, baik berupa lampu LED terpisah maupun dirakit menjadi lampu untuk kebutuhan tertentu. Misalnya lampu LED lampu senter, kendaraan mauapu pencahayaan umum.', 'kbli_27404', NULL, NULL),
(618, '27409', 'Industri Peralatan Penerangan Lainnya', 'Kelompok ini mencakup usaha pembuatan atau industri peralatan penerangan yang dipasang di langit-langit, tempat lilin (chandeliers), lampu meja, perangkat lampu hias pohon natal, batang perapian listrik, lentera (dengan bahan bakar karbit, listrik, gas, bensin, minyak tanah), peralatan lampu jalan (kecuali rambu-rambu lalu lintas) dan peralatan penerangan bukan listrik. Termasuk komponen lampu listrik seperti stater, filamen dan reflektor. Industri ballast tercakup di kelompok 27113.', 'kbli_27409', NULL, NULL),
(619, '27510', 'Industri Peralatan Listrik Rumah Tangga', 'Kelompok ini mencakup pembuatan selimut listrik, penghisap debu (vacuum cleaners), pengkilat lantai (floor polishers), tempat sampah listrik, peralatan untuk mengolah dan mempersiapkan makanan (grinders, blenders, pembuka kaleng, juicers, dan sebagainya) dan peralatan listrik lainnya seperti sikat gigi listrik, alat-alat cukur listrik dan alat-alat perawatan tubuh listrik lainnya, pengasah pisau listrik dan sebagainya.  Termasuk kulkas (refrigerator), mesin pencuci piring, mesin pencuci dan pengering pakaian, unit pembuangan/tempat sampah dan kap ventilasi.  Pembuatan mesin cuci, mesin pengering dan sejenisnya dalam bentuk yang besar atau untuk kepentingan niaga dimasukkan dalam kelompok 28262. Pembuatan mesin jahit baik untuk keperluan rumah tangga maupun tidak dimasukkan dalam kelompok 28262.', 'kbli_27510', NULL, NULL),
(620, '27520', 'Industri Peralatan Elektrotermal Rumah Tangga', 'Kelompok ini mencakup pembuatan kompor (misalnya oven, microwave oven, cookers, hot plates, toasters, pembuat kopi dan teh, frypans, roasters, penggorengan dan pemanggang listrik dan hoods dan sebagainya), alat pemanas dan alat masak dengan menggunakan arus listrik, kipas angin dan pemanas ruangan.  Termasuk  industri peralatan elektrotermal rumah tangga, seperti alat pemanas air listrik, selimut listrik, alat listrik untuk perawatan rambut (pengering, sisir, sikat, pengeriting), setrika listrik, alat resistor pemanas listrik dan lain-lain.', 'kbli_27520', NULL, NULL),
(621, '27530', 'Industri Peralatan Pemanas Dan Masak Bukan Listrik Rumah Tangga', 'Kelompok ini mencakup pembuatan atau industri peralatan masak dan pemanas bukan listrik rumah tangga, seperti kompor masak, panggangan, pemanas air, peralatan masak lain, penghangat makanan, penghangat piring dan lain-lain dan pemanas ruangan bukan listrik, seperti tungku atau perapian.', 'kbli_27530', NULL, NULL),
(622, '27900', 'Industri Peralatan Listrik Lainnya', 'Kelompok ini mencakup pembuatan dinamo lampu sepeda, dinamo magnetik, busi, alat-alat peringatan suara (sirine, klakson, alarm, bel, dan sebagainya), peralatan sinyal listrik seperti alat-alat pengatur lalu-lintas jalan raya, jalan kereta api, di pelabuhan laut dan udara dan sinyal untuk pejalan kaki, berbagai peralatan listrik dan elektronik yang tidak termasuk kelompok manapun, seperti charger (pengisi) baterai padat, alat pembuka dan penutup pintu listrik, mesin pembersih ultrasonik (kecuali untuk laboratorium, dokter gigi), tanning beds, peralatan solid state inverter, peralatan rektifikasi, fuel cells, penyuplai daya teregulasi dan tidak teregulasi, UPS (uninterruptible power supllies), supresor gelombang (kecuali untuk distribusi level voltase), kabel peralatan, kabel sambungan, perangkat kabel listrik lainnya yang berpenyekat dan berkonektor, karbon dan grafit elektroda, kontak dan produk karbon dan grafit listrik lainnya, akselerator partikel, kapasitor, resistor, kondenser listrik dan komponen sejenisnya, elektromagnet, papan skor listrik, reklame listrik, insulator (penyekat) listrik (kecuali penyekat kaca atau porselen), peralatan patri dan solder listrik, besi solder tangan dan pembuatan peralatan modul fotovoltaik (panel surya), rokok elektrik (vape). Termasuk usaha pembuatan komponen dan perlengkapannya.', 'kbli_27900', NULL, NULL),
(623, '28111', 'Industri Mesin Uap, Turbin Dan Kincir', 'Kelompok ini mencakup usaha pembuatan motor penggerak yang bukan berupa motor bakar dalam, seperti mesin uap, turbin dan bagian-bagiannya, turbin uap dan turbin sejenis lainnya, turbin hidrolik, kincir air dan regulatornya, turbin angin dan turbin gas/udara, kecuali turbojet atau turbo baling-baling untuk pesawat terbang; perangkat turbin-ketel (boiler-turbine), perangkat generator-turbin dan kincir angin.', 'kbli_28111', NULL, NULL),
(624, '28112', 'Industri Motor Pembakaran Dalam', 'Kelompok ini mencakup usaha pembuatan motor penggerak mula dengan bahan pembakaran dalam, baik berupa motor bakar cetus api maupun motor bakar nyala kompresi, seperti motor diesel, motor bensin, motor bakar dalam dengan bahan bakar gas/alkohol, dan sejenisnya. Termasuk Industri mesin piston pembakaran dalam (kecuali mesin kendaraan bermotor, pesawat terbang dan mesin penggerak putaran), seperti mesin kapal laut dan mesin kereta api. Usaha pembuatan motor pembakaran dalam untuk kendaraan bermotor roda empat atau lebih dimasukkan dalam kelompok 29101 dan 29102. Usaha pembuatan motor pembakaran dalam untuk kendaraan bermotor roda dua dan tiga dimasukkan dalam kelompok 30912, dan motor pembakaran dalam untuk pesawat terbang dimasukan dalam kelompok 30300.', 'kbli_28112', NULL, NULL),
(625, '28113', 'Industri Komponen Dan Suku Cadang Mesin Dan Turbin', 'Kelompok ini mencakup usaha pembuatan komponen/suku cadang, dari mesin-mesin penggerak mula (kelompok 28111 dan 28112), seperti engine block, piston, cincin piston, karburator cylinder head dan sejenisnya untuk semua jenis mesin pembakaran dalam, mesin diesel dan sebagainya dan inlet dan klep/katup pelepas gas dari mesin pembakaran dalam.', 'kbli_28113', NULL, NULL),
(626, '28120', 'Industri Peralatan Tenaga Zat Cair dan Gas', 'Kelompok ini mencakup usaha pembuatan komponen hidrolik dan pneumatik, termasuk didalamnya pompa hidrolik, motor hidrolik, silinder hidrolik dan pneumatik, klep/katup hidrolik dan pneumatik, perkakas dan pipa karet hidrolik dan pneumatik; peralatan pengolahan udara yang digunakan dalam sistem pneumatik; sistem tenaga zat cair dan gas; dan peralatan transmisi hidrolik.', 'kbli_28120', NULL, NULL),
(627, '28130', 'Industri Pompa Lainnya, Kompresor, Kran dan Klep/Katup', 'Kelompok ini mencakup usaha pembuatan kompresor udara dan gas, kompresor untuk refrigerator dan AC, kompresor untuk kendaraan bermotor, pompa laboratorium, pompa air, pompa udara, pompa vakum atau pompa udara, kompresor udara dan gas lainnya, pompa untuk zat cair baik terpasang alat pengukur ataupun tidak, pompa yang didesain untuk mesin pembakaran dalam, seperti pompa bahan bakar, oli, dan air untuk kendaraan bermotor dan sebagainya. Termasuk katup dan keran air dari logam, seperti klep/katup dan kran untuk keperluan industri, mencakup klep/katup regulasi dan kran pipa masuk; kran dan katup untuk kebersihan (sanitasi); kran dan katup untuk pemanasan; dan pompa tangan. Katup dari karet dimasukkan ke subgolongan  2219. Keran dari porselen dimasukkan ke subgolongan 23931.', 'kbli_28130', NULL, NULL),
(628, '28140', 'Industri Bearing, Roda Gigi dan Elemen Penggerak Mesin', 'Kelompok ini mencakup usaha pembuatan bola dan bantalan poros (ball and roller bearings), termasuk bola, bantalan guling, ring dan bagian-bagian lain dari bearings. Termasuk pula pembuatan komponen dan suku cadang peralatan transmisi mekanik, antara lain cam shafts, poros engkol (crank shafts), engkol, kerangka bearing dan bearing poros sederhana, persneling, roda gigi, bantalan blok, kopling dan poros kopling, roda gendeng dan kerek/katrol, mata rantai bersambung, rantai transmisi tenaga (rantai keteng) dan sebagainya.', 'kbli_28140', NULL, NULL),
(629, '28151', 'Industri Oven, Perapian dan Tungku Pembakar Sejenis Yang Tidak Menggunakan Arus Listrik', 'Kelompok ini mencakup usaha pembuatan tungku dan alat sejenis yang tidak menggunakan arus listrik, untuk memanaskan, memanggang dan melelehkan bijih besi, logam dan sejenisnya, tungku pembakar, peralatan pemanas rumah tangga bukan listrik permanen untuk daerah pegunungan, seperti peralatan pemanas solar, pemanas uap, pemanas minyak dan peralatan pemanas dan tungku sejenisnya. Termasuk pembuatan mechanical stokers, mechanical grates, mechanical ash discharges dan sejenisnya.', 'kbli_28151', NULL, NULL),
(630, '28152', 'Industri Oven, Perapian dan Tungku Pembakar Sejenis Yang Menggunakan Arus Listrik', 'Kelompok ini mencakup usaha pembuatan tungku, oven dan alat pemanas lainnya yang penggunaannya memerlukan arus listrik, misalnya peralatan induksi listrik untuk industri dan laboratorium termasuk incinerator, tungku pembakar, peralatan pemanas ruangan listrik permanen untuk daerah pegunungan, pemanas kolam renang listrik dan tungku listrik untuk rumah tangga.  Alat pengatur panas untuk makanan, minuman dan tembakau termasuk pula non-electric oven untuk pembuat roti dimasukkan dalam kelompok 28250, sedangkan alat pengatur panas untuk pulp, kertas dan bahan industri lainnya dimasukkan dalam kelompok 28292 dan 28299.', 'kbli_28152', NULL, NULL),
(631, '28160', 'Industri Alat Pengangkat Dan Pemindah', 'Kelompok ini mencakup pembuatan mesin pengangkat dan pemindah (pemuat dan pembongkar) barang dan orang yang digerakkan dengan tangan atau tenaga yang digunakan di pabrik, gudang, pelabuhan, terminal, stasiun kereta api, bandar udara dan sebagainya, seperti katrol kerek (alat kerek), winches, putaran/paksi jangkar dan dongkrak; derrick, crane, mobile lifting frame, staddle carriers dan lain-lain; truk kerja, baik yang memakai alat angkut dan alat angkat maupun tidak, baik yang tidak dilengkapi dengan pendorong maupun yang tidak, dan truk kerja yang digunakan dalam pabrik (termasuk alat angkut dengan tangan dan gerobak tangan); manipulator mekanik dan robot yang khusus dibuat untuk mengangkut, mengangkat, memuat dan membongkar.  Termasuk alat pembawa barang, teleferics (kereta gantung) dan lain-lain, lift, eskalator dan pemindah pejalan kaki (lantai bergerak) dan bagian-bagian, conveyor, komponen dan peralatan khusus alat angkut dan alat angkat. Alat pengangkat dan pemindah seperti traktor yang digunakan di sektor pertanian dimasukkan dalam kelompok 28210. Alat pengangkut dan pemindah yang dibuat khusus untuk penggunaan di bawah tanah dimasukkan dalam kelompok 28240.', 'kbli_28160', NULL, NULL),
(632, '28171', 'Industri Mesin Kantor Dan Akuntansi Manual', 'Kelompok ini mencakup usaha pembuatan macam-macam mesin kantor dan akuntansi secara manual, seperti mesin hitung manual, mesin tik manual, mesin stensil manual, mesin peruncing pensil, sempoa, alat timbang pos (postage meters), mesin pengelola surat (pengisi amplop, penyegel dan mesin pemberi alamat, membuka, mengurutkan, menscan), mesin pemeriksa, mesin stenografi, alat penjilid (penjilid plastik atau pita), mesin penghitung koin dan pembungkus koin, stapler dan pembersih stapler, mesin pemungutan suara, mesin isolasi (tape dispencer) dan mesin pembuat lubang kertas dan sejenisnya. Termasuk pembuatan komponen dan suku cadangnya. Jasa pemeliharaan dan perbaikannya tercakup dalam kelompok 33121.', 'kbli_28171', NULL, NULL),
(633, '28172', 'Industri Mesin Kantor Dan Akuntansi Elektrik', 'Kelompok ini mencakup usaha pembuatan macam-macam mesin kantor dan akuntansi elektrik, seperti mesin hitung elektrik, mesin tik elektrik, mesin stensil elektrik dan sejenisnya, kalkulator, alat timbang pos (postage meters), mesin pengelola surat (pengisi amplop, penyegel dan mesin pemberi alamat, membuka, mengurutkan, menscan), mesin pemeriksa, mesin stenografi, alat penjilid (contoh penjilid plastik atau pita), mesin pemeriksa tulisan, mesin penghitung koin dan pembungkus koin, peruncing pensil, stapler dan pembersih stapler, mesin pemungutan suara, mesin pembuat lubang kertas.  Termasuk usaha pembuatan komponen dan suku cadangnya. Jasa pemeliharaan dan perbaikannya tercakup dalam kelompok 33121.', 'kbli_28172', NULL, NULL),
(634, '28173', 'Industri Mesin Kantor Dan Akuntansi Elektronik', 'Kelompok ini mencakup usaha pembuatan macam-macam mesin kantor dan akuntansi elektronik, seperti mesin hitung elektronik, cash register dan sejenisnya. Usaha pembuatan sub assembly dan komponen elektronik mesin komputasi dimasukkan dalam kelompok 26120.', 'kbli_28173', NULL, NULL),
(635, '28174', 'Industri Mesin Fotocopi', 'Kelompok ini mencakup usaha pembuatan mesin fotocopi, mesin electronic sheet, mesin lightdruk dengan sistem optik atau contact type, termasuk perlengkapan dari mesin-mesin tersebut.', 'kbli_28174', NULL, NULL),
(636, '28179', 'Industri Mesin dan Peralatan Kantor Lainnya', 'Kelompok ini mencakup usaha pembuatan macam-macam mesin kantor lainnya, seperti toner cartridge,  papan tulis, seperti white board dan marker board dan mesin pendikte.', 'kbli_28179', NULL, NULL),
(637, '28180', 'Industri Perkakas Tangan Yang Digerakkan Tenaga', 'Kelompok ini mencakup usaha pembuatan perkakas tangan (pertukangan) yang digerakkan tenaga, baik dengan motor listrik atau motor bukan listrik atau yang digerakkan dengan tekanan udara, seperti gergaji sirkular dan reciprocating, bor dan bor palu, penabur pasir yang digerakkan dengan tangan, alat pemaku (pneumatik), penyangga (buffers), router, penggerinda, stepler, alat paku tembak, alat ketam/serut, gunting dan catut, kunci inggris dan alat pemaku (powder actuated).', 'kbli_28180', NULL, NULL),
(638, '28191', 'Industri Mesin Untuk Pembungkus, Pembotolan Dan Pengalengan', 'Kelompok ini mencakup pembuatan mesin pembungkus, pembotolan, dan pengalengan yang berfungsi sebagai pengisi, penutup, penyegel, pembungkus dan pemberian label di botol, kaleng dan kotak. Termasuk mesin untuk pengering dan pembersih botol minuman, mesin untuk mencampur udara ke dalam minuman dan sejenisnya.', 'kbli_28191', NULL, NULL),
(639, '28192', 'Industri Mesin Timbangan', 'Kelompok ini mencakup pembuatan mesin-mesin timbangan (bukan untuk laboratorium), seperti timbangan untuk keperluan toko, kantor dan rumah tangga, alat penimbang yang menyatu dengan kalkulator, timbangan stasiun, scale for continuous weighing, jembatan timbang dan timbangan lainnya,  baik bergerak atau tidak. Termasuk pembuatan komponen dan perlengkapannya.', 'kbli_28192', NULL, NULL),
(640, '28193', 'Industri Mesin Pendingin', 'Kelompok ini mencakup pembuatan mesin pendingin dan pembeku (cold storage) untuk tujuan komersial dan perakitan komponen utamanya, seperti lemari pamer (display cases), mesin-mesin penjual (dispense cases), mesin AC (air conditioning) termasuk untuk kendaraan bermotor, kipas angin dan exhaust hood untuk keperluan industri dan laboratorium termasuk pembuatan komponen dan perlengkapannya, dan mesin pendingin produk biologis (vaksin dan darah).', 'kbli_28193', NULL, NULL),
(641, '28199', 'Industri Mesin Untuk Keperluan Umum Lainnya Ytdl', 'Kelompok ini mencakup pembuatan mesin umum lainnya, seperti fire sprinklers, mesin penyaring dan pembersih cairan dan gas, unit penyulingan cairan, peralatan untuk proyeksi, penyebaran atau penyemprotan cairan atau bubuk, seperti pistol semprot, pemadam api, mesin penyemprot pasir, mesin pembersih dengan uap air dan lain-lain, mesin penyulingan atau rektifikasi untuk kilang minyak, industry kimia, industry minuman dan lain-lain, mesin penukar panas (heat exchanger), mesin untuk  mencairkan udara atau gas, generator gas, mesin penggulung lainnya dan silindernya (kecuali untuk logam dan kaca) termasuk calendering machine (mesin pres), mesin sentrifugal (kecuali mesin pemisah krim dan pengering pakaian), mesin paking dan tali untuk isolasi dan sejenisnya yang terbuat dari kombinasi bahan atau lapisan bahan yang sama, mesin penjual barang otomatis, kipas ventilasi loteng (kipas gable/dinding, ventilasi atap dan lain-lain), meteran pita dan perkakas tangan sejenis, alat presisi masinis (bukan optik) dan peralatan patri dan solder bukan listrik.  Termasuk pembuatan komponen dan peralatannya.', 'kbli_28199', NULL, NULL),
(642, '28210', 'Industri Mesin Pertanian Dan Kehutanan', 'Kelompok ini mencakup usaha pembuatan mesin-mesin untuk penyiapan dan pengolahan lahan pertanian dan kehutanan misalnya traktor dan mesin bajak; mesin-mesin penanam, pemupuk, pemeliharaan tanaman dan pemanenan hasil-hasil (misalnya mesin penabur benih, mesin penugal, mesin penabur pupuk, mesin pemanen, mesin penyemprot, mesin pemotong rumput dan mesin penuai); serta mesin-mesin untuk pengolahan awal hasil pertanian (misalnya mesin perontok, mesin pengupas, mesin penyosoh dan mesin penggilingan gabah), trailer (kereta gandeng) atau semi trailer bongkar muat secara otomatis untuk pertanian, mesin pembersih dan pemilih atau penyortir telur, buah-buahan dan hasil perkebunan, mesin pemerah susu, mesin penghangat unggas, mesin beternak lebah, peralatan untuk penyiapan makanan ternak dan mesin lainnya untuk keperluan tanaman pangan, peternakan, perkebunan dan kehutanan. Termasuk mesin pembuatan komponen dan perlengkapan/implement mesin-mesin pertanian.', 'kbli_28210', NULL, NULL),
(643, '28221', 'Industri Mesin dan Perkakas Mesin Untuk Pengerjaan Logam', 'Kelompok ini mencakup pembuatan mesin-mesin/peralatan untuk pengolahan dan pengerjaan logam, seperti mesin perkakas (misalnya mesin bubut, mesin freis, mesin gerinda, mesin gergaji, mesin press, mesin gunting), serta perlengkapan dan komponennya (seperti cutting tools, mould and dies, jig and fixture).', 'kbli_28221', NULL, NULL),
(644, '28222', 'Industri Mesin dan Perkakas Mesin Untuk Pengerjaan Kayu', 'Kelompok ini mencakup pembuatan mesin-mesin/peralatan untuk pengolahan dan pengerjaan kayu, bambu, rotan, gabus dan sejenisnya, seperti berbagai mesin/peralatan, baik yang sederhana maupun modern, yang digunakan untuk pabrik sawmill, plywood, pabrik pengolahan rotan dan sejenisnya. Termasuk pula usaha pembuatan komponen dan perlengkapannya.', 'kbli_28222', NULL, NULL),
(645, '28223', 'Industri Mesin dan Perkakas Mesin Untuk Pengerjaan Bahan Bukan Logam Dan Kayu', 'Kelompok ini mencakup pembuatan mesin-mesin/peralatan untuk pengolahan dan pengerjaan bahan selain logam dan kayu, seperti mesin/peralatan untuk pengolahan karet yang diperkeras (hardened rubber), plastik tebal (hard plastic), kaca, tulang dan lainnya.', 'kbli_28223', NULL, NULL),
(646, '28224', 'Industri Mesin dan Perkakas Mesin Untuk Pengelasan Yang Menggunakan Arus Listrik', 'Kelompok ini mencakup pembuatan mesin/peralatan untuk pengelasan dengan gas atau arus listrik, seperti mesin las listrik AC maupun DC. Termasuk pula pembuatan mesin sejenis yang menggunakan laser, photon beam, gelombang ultrasonic, electron beam dan magnetic pulse.', 'kbli_28224', NULL, NULL),
(647, '28230', 'Industri Mesin Metalurgi', 'Kelompok ini mencakup pembuatan mesin dan perlengkapannya untuk pengerjaan logam panas, seperti mesin pengubah (converter), cetakan baja (ingot moulds), pencedok dan penuang  dan mesin peleburan, mesin penggilingan penggulung logam dan penggulung untuk penggilingan sejenisnya. Termasuk pula pembuatan mesin canai logam baik panas maupun dingin.', 'kbli_28230', NULL, NULL),
(648, '28240', 'Industri Mesin Penambangan, Penggalian Dan Konstruksi', 'Kelompok ini mencakup pembuatan mesin-mesin peralatan untuk kegiatan pertambangan, penggalian, dan konstruksi, seperti alat pengangkat dan alat pengangkut (misalnya conveyor), mesin untuk menyaring, mensortir, memisahkan, mencuci, menghancurkan bahan-bahan mineral, mesin pengeboran, pemotongan dan mesin terowongan dan sinking (baik untuk penggunaan di bawah tanah atau tidak), traktor yang digunakan dalam kegiatan pertambangan dan konstruksi, mesin pemindah tanah, seperti bulldozer, angle dozer, graders, scrapers, leveler, sekop, sekop pemuatan dan perlengkapannya, dan berbagai mesin untuk kegiatan konstruksi, dan mesin pencampur beton dan mortar, mesin pile-driver dan pile ekstraktor, penyebar mortar dan aspal, mesin penghalus permukaan beton dan lain-lain, traktor tracklaying dan traktor yang digunakan dalam konstruksi atau pertambangan, pisau bulldozer dan angle dozer dan truk dumping off-road. Termasuk pembuatan bagian/komponen dan perlengkapannya. Pembuatan traktor untuk pertanian dimasukkan dalam kelompok 28210.', 'kbli_28240', NULL, NULL),
(649, '28250', 'Industri Mesin Pengolahan Makanan, Minuman Dan Tembakau', 'Kelompok ini mencakup pembuatan mesin-mesin untuk pengolahan berbagai makanan, minuman dan tembakau, seperti mesin pengolah makanan dan susu, mesin pengering pertanian, mesin pemisah krim, mesin pengolahan susu (misalnya homogenizers), mesin pengubah susu (misalnya pembuat keju, dan mesin pencetak keju) dan mesin pembuat keju (misalnya homogenizers, pencetakan, pengepresan), mesin untuk industri penggilingan padi atau biji-bjian, seperti mesin untuk membersihkan, memilih atau memilah benih padi atau biji-bijian dan sayuran kacang-kacangan yang dikeringkan (mesin penampi, lajur penyaring, pemisah, mesin penyikat biji-bijian dan lain-lain); dan mesin untuk memproduksi tepung dan bahan makanan dan lain-lain (mesin penggilingan biji-bijian, penyaring, pengayak tepung, pengisi, blender, pembersih kulit  padi, penggilingan padi, pemecah kacang kapri dan lainnya), mesin pembuat minuman anggur dan juice buah, mesin pembuat roti, mie dan spaghetti dan sejenis seperti oven roti, mixer, pembuat adonan, cetakan, pemotong, mesin pembuat roti dan lain-lain, mesin pembuat rokok dan berbagai mesin pengolahan makanan yang lain. Termasuk mesin untuk industri roti atau pembuat macaroni, mesin dan peralatan untuk pengolahan berbagai makanan, seperti mesin untuk membuat gula-gula, kokoa atau coklat, mesin untuk industri gula, mesin untuk pembuatan bir, mesin untuk pengolahan daging dan unggas, mesin untuk pengolahan buah-buahan, kacang-kacangan dan sayuran, mesin untuk pengolahan ikan, kerang-kerangan dan hasil laut lainnya; mesin untuk penyulingan dan pemurnian; dan mesin lainnya untuk industri dan pengolahan makanan dan minuman; mesin pengambilan dan pengolahan minyak dan lemah hewan dan tumbuhan; mesin untuk pengolahan tembakau dan untuk pembuatan rokok dan cerutu atau untuk tembakau pipa atau tembakau kunyah atau snuff; mesin pengolahan makanan di hotel dan restoran.', 'kbli_28250', NULL, NULL),
(650, '28261', 'Industri Kabinet Mesin Jahit', 'Kelompok ini mencakup pembuatan kabinet mesin jahit, baik dari kayu, plywood, maupun dari logam.', 'kbli_28261', NULL, NULL),
(651, '28262', 'Industri Mesin Jahit Serta Mesin Cuci Dan Mesin Pengering Untuk Keperluan Niaga', 'Kelompok ini mencakup pembuatan mesin jahit dan kepala mesin jahit, baik untuk keperluan rumah tangga maupun untuk untuk keperluan niaga, termasuk pembuatan mesin obras, mesin bordir, mesin oversum dan mesin-mesin untuk penatu dan dry cleaning (mesin cuci, mesin pengering, mesin penyeterika dan lain-lain). Pembuatan mesin cuci, mesin pengering dan sejenisnya untuk keperluan rumah tangga dimasukkan dalam kelompok 27510.', 'kbli_28262', NULL, NULL),
(652, '28263', 'Industri Mesin Tekstil', 'Kelompok ini mencakup usaha pembuatan mesin-mesin tekstil, seperti mesin persiapan pengolahan serat, mesin pintal, mesin persiapan pembuatan kain, mesin tenun, mesin rajut, mesin pemeriksa kesalahan kain, mesin-mesin penyelesaian (finishing), mesin konveksi dan sejenisnya.', 'kbli_28263', NULL, NULL),
(653, '28264', 'Industri Jarum Mesin Jahit, Rajut, Bordir Dan Sejenisnya', 'Kelompok ini mencakup pembuatan jarum untuk mesin jahit, rajut, bordir dan sejenisnya.', 'kbli_28264', NULL, NULL),
(654, '28265', 'Industri Mesin Penyiapan Dan Pembuatan Produk Kulit', 'Kelompok ini mencakup pembuatan mesin produk kulit, seperti mesin untuk penyiapan, penyamakan, atau pengerjaan kulit atau kulit jangat dan mesin untuk membuat atau memperbaiki alas kaki atau produk lainnya dari kulit, kulit jangat dan kulit berbulu.', 'kbli_28265', NULL, NULL),
(655, '28291', 'Industri Mesin Percetakan', 'Kelompok ini mencakup pembuatan mesin-mesin percetakan, seperti mesin press sederhana, mesin press silinder, mesin press putar dan mesin cetak lainnya. Termasuk mesin-mesin perlengkapan percetakan dan mesin penjilid, seperti mesin jahit buku, mesin penjilid dengan menggunakan spiral dan mesin penomor halaman.', 'kbli_28291', NULL, NULL),
(656, '28292', 'Industri Mesin Pabrik Kertas', 'Kelompok ini mencakup pembuatan mesin pabrik kertas,seperti mesin untuk pengolahan pulp, kertas dan karton misalnya mesin pembuatan bubur kertas, mesin pembuatan kertas dan papan kertas, mesin pengeringan kayu, bubur kertas, kertas atau papan kertas, dan mesin untuk pembuatan barang-barang dari kertas atau papan kertas, seperti mesin pemotong kertas, pembuat amplop, kantong kertas dan sejenisnya dan mesin-mesin lainnya', 'kbli_28292', NULL, NULL),
(657, '28299', 'Industri Mesin Keperluan Khusus Lainnya', 'Kelompok ini mencakup industri berbagai mesin-mesin industri khusus lainnya yang belum termasuk kelompok sebelumnya, seperti mesin untuk pengerjaan karet atau plastik lunak atau untuk pembuatan produk dari bahan tersebut, seperti mesin extrude, pencetak, mesin pembuatan ban angin (pneumatik) atau ban vulkanisir, mesin lainnya untuk pembuatan produk dari plastik atau karet khusus, mesin cetak dan penjilidan buku dan mesin untuk pendukung pencetakan pada berbagai macam bahan, mesin cetak 3 dimensi (3d printing), mesin untuk memproduksi ubin, batu bata, perekat keramik potongan, pipa, grafit elektroda, kapur tulis, cetakan besi tuang dan lain-lain, mesin pabrik semi konduktor, robot industri yang menjalankan berbagai tugas untuk keperluan khusus, mesin untuk merakit lampu listrik dan lampu elektronik, tabung atau bola lampu, mesin untuk memproduksi atau pekerjaan panas dari kaca atau barang-barang dari kaca, serat kaca atau benang dan mesin atau peralatan untuk pemisahan isotopik, peralatan meluruskan dan menyeimbangkan ban (kecuali penyeimbang roda), mesin untuk memasang dan melepas ban (termasuk ban untuk alat berat  dan alat pertahanan), sistem pelumasan pusat, persneling pesawat terbang (launching gear), pelontar pembawa pesawat terbang (carrier catapult) dan peralatan yang terkait, peralatan arena bowling otomatis (pin-setter), peralatan jalan berputar (roundabouts), ayunan, galeri menembak, gelanggang hiburan atau permainan lainnya, mesin pembuat briket dari produk pertanian dan mesin-mesin khusus lainnya.', 'kbli_28299', NULL, NULL),
(658, '29101', 'Industri Kendaraan Bermotor Roda Empat Atau Lebih', 'Kelompok ini mencakup usaha pembuatan atau perakitan kendaraan bermotor untuk penumpang atau barang, seperti sedan, jeep, truck, pick up, bus dan stasion wagon dan sejenisnya dengan menggunakan mesin piston pembakaran dalam bolak-balik cetus api atau berputar, mesin piston bolak balik nyala kompresi (diesel atau semi diesel), atau motor listrik untuk penggerak. Termasuk pembuatan kendaraan untuk keperluan khusus, seperti mobil pemadam kebakaran, mobil toko, mobil penyapu jalan, ambulans, mobil salju, mobil golf, kendaraan amfibi, perpustakaan mobil (travelling libraries), mobil berlapis baja, lori pencampur beton dan ATV, go cart, mobil balap dan sejenisnya. Kelompok ini juga mencakup usaha pembuatan mesin kendaraan bermotor, chasis mesin dan industri pembangunan kembali mesin kendaraan bermotor.', 'kbli_29101', NULL, NULL),
(659, '29102', 'Industri Kendaraan  Multiguna Pedesaan', 'Kelompok ini mencakup usaha pembuatan atau perakitan kendaraan multiguna pedesaan atau dikenal sebagai AMMDES (Alat Mekanis Multiguna Pedesaan) yang dilengkapi dengan komponen seperti Power Take off (PTO), differential lock dan lain-lain yang menjadikannya multifungsi, antara lain sebagai alat transportasi, alat produksi maupun menggerakkan alat bantu lainnya sehingga mampu menjalankan berbagai fungsi sebagai mesin pegolahan seperti mesin-mesin untuk pengolahan hasil pertanian (mesin perontok, mesin pengupas, mesin penyosoh dan mesin penggilingan gabah), mesin perjernih dan pengolahan air minum, dan fungsi lainnya untuk keperluan tanaman pangan, peternakan, perikanan, perkebunan, kehutanan dan lain-lain. Termasuk untuk alat bantu penunjang kebutuhan medis seperti pengumpan ambulan (ambulance feeder).', 'kbli_29102', NULL, NULL),
(660, '29200', 'Industri Karoseri Kendaraan Bermotor Roda Empat Atau Lebih dan Industri Trailer dan Semi Trailer', 'Kelompok ini mencakup usaha pembuatan bagian-bagian mobil atau karoseri kendaraan bermotor, seperti bak truk, bodi bus, bodi pick up, bodi untuk kendaraan penumpang, dan kendaraan bermotor untuk penggunaan khusus, seperti kontainer, caravan dan mobil tangki. Termasuk pembuatan trailer, semi trailer dan bagian-bagiannya.', 'kbli_29200', NULL, NULL),
(661, '29300', 'Industri Suku Cadang dan Aksesori Kendaraan Bermotor Roda Empat Atau Lebih', 'Kelompok ini mencakup usaha pembuatan komponen dan suku cadang kendaraan bermotor roda empat atau lebih, seperti leaf sporing, radiator, fuel tank, muffle, rem, gearboxes/persnelling, AS roda, road wheel, suspension shock absorber, silencer, pipa pembuangan, kataliser pengubah, kopling, roda kemudi, sistem kolom kemudi dan kotak kemudi;  suku cadang dan aksesori untuk bodi karoseri kendaraan bermotor, seperti sabuk pengaman, pintu, bamper, airbag; tempat duduk mobil;  peralatan listrik kendaraan bermotor, seperti generator, alternator, busi, ignition wiring harnesses/starter, sistem buka tutup pintu dan jendela otomatis, pemasangan argometer ke dalam panel instrumen, pengatur voltawse; inverter untuk kendaraan bermotor roda empat atau lebih; dan lain-lain.', 'kbli_29300', NULL, NULL),
(662, '30111', 'Industri Kapal Dan Perahu', 'Kelompok ini mencakup usaha pembuatan atau perakitan macam-macam kapal dan perahu komersil, yang terbuat dari baja, fibre glass, kayu atau ferro cement, baik yang bermotor maupun yang tidak bermotor, seperti kapal penumpang, kapal ferry, kapal kargo, kapal tanker, kapal penyeret, kapal layar untuk komersil, kapal perang, kapal untuk penelitian, kapal penangkap ikan dan kapal untuk pabrik pengolahan ikan.', 'kbli_30111', NULL, NULL),
(663, '30112', 'Industri Bangunan Lepas Pantai Dan Bangunan Terapung', 'Kelompok ini mencakup usaha pembuatan konstruksi atau bangunan lepas pantai dan bangunan terapung, termasuk peralatan dan perlengkapannya, seperti konstruksi platform, bangunan terapung atau penyelaman untuk kegiatan pengeboran; konstruksi bangunan terapung, seperti dok terapung, sekoci dan kran apung, jembatan apung, ponton, coffer-dam, bangunan tempat pendaratan terapung, living quarter, jacket, platform dan morring buoy, pelampung/buoys, tangki terapung, kapal barkas, tongkang, kapal derek,  rakit yang dapat diisi udara bukan untuk rekreasi dan lain-lain. Termasuk pembuatan hovercraft,  kecuali hovercraft jenis rekreasi.', 'kbli_30112', NULL, NULL),
(664, '30113', 'Industri Peralatan, Perlengkapan Dan Bagian Kapal', 'Kelompok ini mencakup usaha pembuatan perlengkapan, peralatan dan bagian kapal, seperti perlengkapan lambung, akomodasi kerja mesin geladak, alat kemudi dan alat bongkar muat.', 'kbli_30113', NULL, NULL),
(665, '30120', 'Industri Pembuatan Kapal dan Perahu Untuk Tujuan Wisata atau Rekreasi dan Olahraga', 'Kelompok ini mencakup usaha pembuatan kapal pesiar dan perahu untuk santai dan olahraga, seperti perahu dan rakit karet  yang dapat diisi udara, kapal atau perahu layar (yatch) dengan atau tanpa motor penggerak, motor boats, hovercraft untuk rekreasi, kendaraan air pribadi, perahu untuk olahraga dan kapal pesiar yang lain, seperti kano, kayak, perahu dayung, sampan dan lain-lain.', 'kbli_30120', NULL, NULL),
(666, '30200', 'Industri Lokomotif dan Gerbong Kereta', 'Kelompok ini mencakup usaha pembuatan atau perakitan lokomotif kereta api listrik, diesel, uap dan lainnya; gerbong kereta api self propelled (pendorong sendiri) atau gerbong kereta api listrik atau trem, vans dan truk, termasuk perawatan atau perbaikannya; gerbong keretra api atau kereta api listrik, tidak self-propelled (pendorong sendiri), seperti gerbong penumpang, gerbong barang, gerbong tangki, gerbong bengkel, gerbong mobil derek, gerbong dan kereta pembongkar, gerobak dan lain-lain; suku cadang khusus kereta api atau kereta api listrik atau gerbong, seperti bogies, as dan roda, rem dan suku cadang rem, peralatan kopling dan hook, buffer dan suku cadang buffer, sok breker, kerangka lokomotif dan gerbong; bodi karoseri, penghubung antarkoridor dan lain-lain; peralatan signal mekanik dan elektromagnetik, peralatan pengaman dan pengontrol rambu-rambu kereta api, kereta api listrik, lalu lintas air, jalan raya, fasilitas parkir, lapangan udara dan lain-lain; lokomotif tambang dan kendaraan rel tambang; dan tempat duduk kereta api.', 'kbli_30200', NULL, NULL),
(667, '30300', 'Industri Pesawat Terbang Dan Perlengkapannya', 'Kelompok ini mencakup usaha pembuatan atau perakitan dan modifikasi pesawat terbang untuk penumpang atau barang, seperti pesawat terbang bermesin jet, pesawat terbang propeller, helikopter, balon udara dan pesawat layang. Kelompok ini juga mencakup usaha pembuatan pesawat terbang untuk angkatan bersenjata, olahraga atau tujuan lain, pesawat peluncur dan pesawat peluncur gantung, wahana terbang tanpa awak (drone), kapal seplin/balon berkemudi dan balon udara panas, suku cadang dan aksesori pesawat terbang, seperti rakitan utama seperti badan pesawat terbang, sayap, pintu, pengontrol permukaan, roda gigi untuk mendarat, tanki bahan bakar, nacelles dan lain-lain; baling-baling, pisau rotor helikopter dan rotor pendorong; berbagai macam motor dan mesin yang terdapat di pesawat terbang; dan suku cadang jet turbo dan pendorong turbo untuk pesawat terbang, pesawat terbang latih darat, pesawat ruang angkasa dan pesawat peluncuran, satelit, satelit yang berhubungan dengan planet, stasiun orbit, shuttles dan intercontinental ballistic missiles (ICBM)/roket antarbenua. Termasuk pemeriksaan dan konversi pesawat atau mesin pesawat dan pembuatan tempat duduk pesawat terbang.', 'kbli_30300', NULL, NULL),
(668, '30400', 'Industri Kendaraan Perang', 'Kelompok ini mencakup pembuatan tank dan kendaraan lapis baja.  Termasuk  pembuatan kendaraan militer amfibi lapis baja dan kendaraan perang militer lainnya.', 'kbli_30400', NULL, NULL),
(669, '30911', 'Industri Sepeda Motor Roda Dua Dan Tiga', 'Kelompok ini mencakup usaha pembuatan dan perakitan secara lengkap dari macam-macam kendaraan bermotor roda dua dan tiga, seperti sepeda motor, moped, skuter, bemo, a side-cars dan sejenisnya dengan menggunakan mesin piston pembakaran dalam bolak-balik cetus api atau berputar, atau motor listrik untuk penggerak. Termasuk sepeda yang dilengkapi motor.', 'kbli_30911', NULL, NULL),
(670, '30912', 'Industri Komponen Dan Perlengkapan Sepeda Motor Roda Dua Dan Tiga', 'Kelompok ini mencakup usaha pembuatan komponen dan suku cadang kendaraan bermotor roda dua dan tiga, seperti motor pembakaran dalam, suspensi dan knalpot. Termasuk inverter untuk kendaraan bermotor roda dua dan tiga', 'kbli_30912', NULL, NULL),
(671, '30921', 'Industri Sepeda Dan Kursi Roda Termasuk Becak', 'Kelompok ini mencakup usaha pembuatan dan perakitan macam-macam sepeda dan becak, seperti sepeda tanpa motor, sepeda roda tiga (pengantar), tandem (sepeda gandeng),  dan sepeda anak-anak baik roda dua maupun roda tiga, termasuk pula pembuatan kereta bayi dan kendaraan difabel atau kursi roda baik bermotor maupun tidak.', 'kbli_30921', NULL, NULL),
(672, '30922', 'Industri Perlengkapan Sepeda Dan Kursi Roda Termasuk Becak', 'Kelompok ini mencakup usaha pembuatan suku cadang atau komponen dan aksesori sepeda, kereta bayi, kursi roda dan becak, seperti sadel, pedal, velg, rem, jari-jari, roda dan tire ventil. Usaha pembuatan ban sepeda (luar dan dalam) dimasukkan dalam kelompok 22111 dan 22112.', 'kbli_30922', NULL, NULL),
(673, '30990', 'Industri Alat Angkutan Lainnya YTDL', 'Kelompok ini mencakup usaha pembuatan alat angkut yang belum termasuk kelompok lainnya, baik  kendaran yang didorong oleh tangan maupun kendaraan yang ditarik binatang, seperti truk barang, handcart, sledge, troli, gerobak, delman, lori, kereta dorong, wheel barrows, kereta balap (sulkies), pedati yang ditarik keledai, kereta jenazah (keranda) dan alat pengangkutan lainnya.', 'kbli_30990', NULL, NULL),
(674, '31001', 'Industri Furnitur Dari Kayu', 'Kelompok ini mencakup usaha pembuatan furnitur dari kayu untuk rumah tangga dan kantor, seperti meja, kursi, bangku, tempat tidur, lemari, rak, kabinet, penyekat ruangan dan sejenisnya.', 'kbli_31001', NULL, NULL),
(675, '31002', 'Industri Furnitur Dari Rotan Dan Atau Bambu', 'Kelompok ini mencakup pembuatan furnitur dengan bahan utamanya dari rotan dan atau bambu, seperti meja, kursi, bangku, tempat tidur, lemari, rak, penyekat ruangan dan sejenisnya.', 'kbli_31002', NULL, NULL),
(676, '31003', 'Industri Furnitur Dari Plastik', 'Kelompok ini mencakup pembuatan furnitur yang bahan utamanya dari plastik, seperti meja, kursi, rak dan sejenisnya.', 'kbli_31003', NULL, NULL),
(677, '31004', 'Industri Furnitur Dari Logam', 'Kelompok ini mencakup pembuatan furnitur untuk rumah tangga dan kantor yang bahan utamanya dari logam, seperti meja, kursi, rak, spring bed dan sejenisnya.', 'kbli_31004', NULL, NULL),
(678, '31009', 'Industri Furnitur Lainnya', 'Kelompok ini mencakup usaha pembuatan furnitur yang bahan utamanya bukan kayu, rotan, bambu, logam, plastik dan bukan barang imitasi, seperti bahan pelengkap matras atau kasur, matras atau kasur dengan per atau pegas atau yang yang diisi atau disumpal atau dilengkapi dengan bahan pelengkap lainnya (kapok, dakron) dan matras atau kasur plastik atau karet yang tidak dilapisi dan matras atau kasur sejenisnya. Termasuk kereta restoran dekorasi, seperti kereta desert, kereta makanan.', 'kbli_31009', NULL, NULL),
(679, '32111', 'Industri Permata', 'Kelompok ini mencakup usaha pemotongan, pengasahan dan penghalusan batu berharga atau permata dan sejenisnya, seperti berlian perhiasan, intan perhiasan, batu aji/ batu akik dan intan tiruan.', 'kbli_32111', NULL, NULL),
(680, '32112', 'Industri Barang Perhiasan Dari Logam Mulia Untuk Keperluan Pribadi', 'Kelompok ini mencakup usaha pembuatan barang-barang perhiasan yang bahan utamanya dari logam mulia (emas, platina dan perak) untuk keperluan pribadi, seperti cincin, kalung, gelang, giwang, bross, ikat pinggang dan kancing, termasuk bagian dan perlengkapannya. Pembuatan perhiasan imitasi dimasukkan dalam kelompok 32120.', 'kbli_32112', NULL, NULL),
(681, '32113', 'Industri Barang Perhiasan Dari Logam Mulia Bukan Untuk Keperluan Pribadi', 'Kelompok ini mencakup usaha pembuatan perhiasan yang bahan utamanya dari logam mulia selain untuk keperluan pribadi, seperti peralatan makan dan minum, piring-piring ceper, wadah-wadah berongga, barang-barang toilet, barang hiasan untuk rumah tangga, barang-barang kantor atau meja, piala, medali dan noveltis atau barang-barang yang berhubungan dengan keagamaan, termasuk bagian dan perlengkapannya.', 'kbli_32113', NULL, NULL),
(682, '32114', 'Industri Barang Dari Logam Mulia Untuk Keperluan Teknik Dan Atau Laboratorium', 'Kelompok ini mencakup usaha pembuatan barang-barang untuk keperluan teknik dan atau laboratorium dari logam mulia (tidak termasuk instrument dan bagian-bagiannya), seperti spatula, crucibles, cuples, platinum grill yang digunakan sebagai katalisator dan electro-plating anodes.', 'kbli_32114', NULL, NULL),
(683, '32115', 'Industri Perhiasan Mutiara', 'Kelompok ini mencakup usaha pengerjaan mutiara dan pembuatan perhiasan dari mutiara atau perhiasan berbahan dasar utamanya adalah mutiara.', 'kbli_32115', NULL, NULL),
(684, '32119', 'Industri Barang Lainnya Dari Logam Mulia', 'Kelompok ini mencakup usaha pembuatan barang lainnya dari logam mulia, seperti tali jam tangan dari logam mulia, manset, ikat jam tangan dan kotak rokok. Termasuk pembuatan koin baik yang legal sebagai alat tukar maupun tidak dan jasa engraving baik pada perhiasan dari logam mulia atau bukan. Pembuatan case (badan) jam dan perhiasan jam dimasukkan dalam kelompok 26520.', 'kbli_32119', NULL, NULL),
(685, '32120', 'Industri Perhiasan Imitasi dan Barang Sejenis', 'Kelompok ini mencakup usaha pembuatan perhiasan imitasi dan sejenisnya, seperti cincin, gelang, kalung dan barang-barang sejenisnya yang dibuat dari logam dasar yang dilapisi logam mulia, perhiasan dengan batu imitasi seperti batu permata imitasi, berlian imitasi dan sejenisnya. Termasuk pembuatan tali jam tangan dari logam (kecuali logam mulia).', 'kbli_32120', NULL, NULL),
(686, '32201', 'Industri Alat Musik Tradisional', 'Kelompok ini mencakup usaha pembuatan alat-alat musik tradisional baik alat musik senar, tiup, pukul dan lainnya, seperti kecapi, seruling bambu, angklung, calung, kulintang, gong, gambang, gendang, terompet tradisional, rebab dan tifa. Termasuk pembuatan peluit, call horn (semacam terompet) dan alat sinyal suara yang ditiup lainnya.', 'kbli_32201', NULL, NULL),
(687, '32202', 'Industri Alat Musik Bukan Tradisional', 'Kelompok ini mencakup usaha pembuatan alat-alat musik non tradisional, seperti alat musik petik (gitar, bass dan sejenisnya), alat musik tiup (terompet, saxophone, clarinet, harmonika dan sejenisnya), alat musik gesek (biola, cello dan sejenisnya), alat musik perkusi (drum set, selofon, metalofon dan sejenisnya). Termasuk usaha pembuatan piano/organ, pianika gamitan, akordeon dan garpu tala. Usaha pembuatan mikrofon, loudspeaker, headphone dan komponen yang sejenisnya dimasukkan dalam kelompok 26420. Sedangkan alat-alat musik untuk mainan dimasukkan dalam kelompok 32402.', 'kbli_32202', NULL, NULL),
(688, '32300', 'Industri Alat Olahraga', 'Kelompok ini mencakup usaha pembuatan alat-alat olahraga, seperti bola sepak, bola basket, bola volley, raket tenis, raket bulu tangkis, net volley, net pingpong, stik golf, stik hockey, meja pingpong, ski bindings dan poles (galah), sepatu ski, papan layar dan papan selancar, peralatan untuk olahraga memancing termasuk jaring penyerok, peralatan untuk berburu, panjat gunung, sarung tangan dan tutup kepala olahraga dari kulit, ice skate, roller skate, busur dan panah, peralatan untuk olahraga ketangkasan, peralatan gimnastik (senam), peralatan pusat kebugaran (fitness centre) atau peralatan atletik dan matras. Kelompok ini tidak termasuk usaha pembuatan layar perahu (13929), pakaian olahraga (14111), pakaian kuda (15123), sepatu olahraga (15202), senjata untuk olahraga (25200), sepeda olahraga (30921), kapal/sampan olahraga (30120), meja billiard/perlengkapan bowling (32401), cambuk dan pecut (15123).', 'kbli_32300', NULL, NULL),
(689, '32401', 'Industri Alat Permainan', 'Kelompok ini mencakup usaha pembuatan alat/perlengkapan seperti kartu domino, remi dan sejenisnya, kelereng, bekel, papan permainan dan permainan sejenisnya (halma, ular tangga), permainan elektronik, permainan catur, permainan yang dioperasikan dengan koin, bilyard, meja khusus untuk permainan judi dan sebagainya, fun fair, table and parlour games, meja billiard, meja casino, meja bowling dan perlengkapannya, puzzle dan mainan edukatif dan alat-alat permainan lainnya.', 'kbli_32401', NULL, NULL),
(690, '32402', 'Industri Mainan Anak-anak', 'Kelompok ini mencakup usaha pembuatan macam-macam mainan, seperti boneka dari kayu, kain, karet, dan sejenisnya termasuk pakaian boneka dan aksesorinya, mainan berupa senjata, toys set, tokoh super hero seperti superman, batman dan lain-lain, binatang mainan, alat musik mainan, kartu permainan, scale model dan model rekreasional sejenisnya, kereta api listrik, permainan konstruksi, mainan beroda yang dirancang untuk dikendarai (mainan jenis kendaraan) termasuk sepeda roda dua dan sepeda roda tiga yang terbuat dari plastik. Sepeda anak-anak dimasukkan dalam kelompok 30921.', 'kbli_32402', NULL, NULL),
(691, '32501', 'Industri Furnitur Untuk Operasi, Perawatan Kedokteran Dan Kedokteran Gigi', 'Kelompok ini mencakup pembuatan perabot atau furnitur untuk kegiatan operasi, perawatan, kedokteran gigi dan kedokteran hewan, seperti meja operasi, tiang infus, tempat tidur rumah sakit dengan peralatan mekanik dan kursi untuk pemeriksaan dan perawatan gigi.', 'kbli_32501', NULL, NULL),
(692, '32502', 'Industri Peralatan Kedokteran Dan Kedokteran Gigi, Perlengkapan Orthopaedic Dan Prosthetic', 'Kelompok ini mencakup pembuatan peralatan dan perlengkapan untuk pemeriksaan kesehatan, operasi, kedokteran gigi dan kedokteran hewan, seperti electrocardiograph, alat-alat bor gigi, peralatan test mata (termasuk reflektor, endoscope, dan lain-lain), jarum suntik, peralatan sterilisasi, peralatan pijat, ozone therapy, oxygen therapy, peralatan pernapasan buatan, perlengkapan orthopaedic dan prosthetic (crutches, surgical belts and trussers, orthopaedic corsets and shoes dan lain-lain), thermometer kedokteran, tungku pembakar laboratorium kedokteran gigi, mesin pembersihan ultrasonik laboratorium, peralatan destilasi laboratorium, alat sentrifugal laboratorium, pelat dan baut tulang (bone plates and screws), alat suntik, jarum suntik, kateter, cannulae dan sebagaiya, peralatan kedokteran gigi (termasuk kursi periksa dokter gigi yang tergabung dengan perlengkapan dokter gigi lainnya), gigi buatan dan sebagainya yang dibuat di laboratorium kedokteran gigi, mata buatan dari gelas dan peralatan tubuh palsu lainnya, seperti mata palsu, tengkorak palsu dan bagian-bagian dalam tubuh palsu. Kelompok ini juga mencakup pembuatan berbagai peralatan dan perlengkapan dalam bentuk instrumen bedah, antara lain seperti gunting, pinset, tang.', 'kbli_32502', NULL, NULL),
(693, '32503', 'Industri Kaca Mata', 'Kelompok ini mencakup usaha pembuatan macam-macam barang-barang opthalmik dan kaca mata berikut frame, seperti kaca mata pembantu penglihatan, kaca mata peredam sinar matahari/cahaya (sunglasses) dan safety googles (kaca mata untuk penahan debu, renang, selam, las). Termasuk juga pembuatan lensa kaca mata dan lensa kontak.', 'kbli_32503', NULL, NULL),
(694, '32509', 'Industri Peralatan Kedokteran Dan Kedokteran Gigi Serta Perlengkapan Lainnya', 'Kelompok ini mencakup usaha pembuatan peralatan kedokteran dan kedokteran gigi serta perlengkapan lainnya yang belum tercakup dalam kelompok 32501 sampai dengan 32503, seperti kain dan benang steril/benang bedah dan kertas tisue untuk operasi, semen dan penambal gigi (kecuali perekat gigi palsu 20234), lilin gigi dan preparat plester gigi lainnya, semen rekonstruksi tulang, masker medis seperti surgical mask.', 'kbli_32509', NULL, NULL),
(695, '32901', 'Industri Alat Tulis Dan Gambar Termasuk Perlengkapannya', 'Kelompok ini mencakup usaha pembuatan macam-macam alat tulis dan gambar termasuk perlengkapannya, seperti pensil hitam, pensil berwarna, pulpen, pena boll point, tangkai pena, pena sablon, jangka, kuas gambar, batu tulis, meja gambar, rapido, sablon, letraset dan crayon. Termasuk pembuatan cat air dan cat minyak.', 'kbli_32901', NULL, NULL),
(696, '32902', 'Industri Pita Mesin Tulis/Gambar', 'Kelompok ini mencakup usaha pembuatan macam-macam pita mesin tulis/gambar, seperti pita mesin tik, pita pencetak komputer dan pita mesin tulis lainnya.', 'kbli_32902', NULL, NULL),
(697, '32903', 'Industri Kerajinan YTDL', 'Kelompok ini mencakup usaha pembuatan barang-barang kerajinan dari bahan tumbuh-tumbuhan dan hewan, seperti kerajinan pohon kelapa, tempurung, serabut, akar-akaran, kulit, gading, tanduk, tulang, bulu, rambut, binatang yang diawetkan, kegiatan taxidermy (mengisi kulit binatang dengan kapas dan lain-lain sehingga nampak seperti binatang hidup), karangan bunga, rangkaian bunga berbentuk lingkaran dan keranjang bunga; bunga, buah-buahan dan daun-daunan buatan dan barang-barang lukisan.  Termasuk usaha pembuatan barang-barang kerajinan dari kulit ikan dan kekerangan, baik dari kulit kerang mutiara seperti kerang Pinctada maxima, kerang mabe (mutiara setengah bulat), maupun kerang lainnya.', 'kbli_32903', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(698, '32904', 'Industri Peralatan Untuk Pelindung Keselamatan', 'Kelompok ini mencakup usaha pembuatan peralatan untuk pelindung keselamatan, seperti pakaian pelindung dan pakaian anti api, sabuk pengaman tukang kawat dan sabuk lain untuk keperluan pekerjaan, pelampung, topi plastik yang keras (helm bangunan) dan perlengkapan keamanan  lainnya yang terbuat dari plastik (helm olahraga dan segala macam helm sejenisnya), pakaian pelindung kebakaran, tutup kepala pengaman dari logam dan peralatan pengaman pribadi lain yang terbuat dari logam, penyumbat telinga dan hidung (misalnya untuk renang dan pengaman hidung) dan masker gas, masker non medis dan APD termasuk face shield.', 'kbli_32904', NULL, NULL),
(699, '32905', 'Industri Serat Sabut Kelapa', 'Kelompok ini mencakup usaha pengolahan sabut kelapa menjadi bahan baku, seperti cocofiber (serat sabut kelapa), cocopeat (serbuk sabut kelapa), Rubberized Curl Coir (RCC)/ serat sabut kelapa berkaret (sebutret), dan lainnya.   Contoh: cocofiber digunakan untuk pembuatan jok mobil, spring bed, dan lainnya  serta cocopeat biasanya digunakan untuk media tanaman, dan lainnya.', 'kbli_32905', NULL, NULL),
(700, '32906', 'Industri Produksi Radioisotop', 'Kelompok ini mencakup usaha yang melakukan kegiatan pembuatan radioisotop hasil dari aktivasi akselerator (pemercepat partikel) atau iradiasi dari reaktor nuklir.', 'kbli_32906', NULL, NULL),
(701, '32907', 'Industri Fabrikasi Elemen Bakar Uranium', 'Kelompok ini mencakup usaha yang melakukan kegiatan fabrikasi elemen bakar uranium.', 'kbli_32907', NULL, NULL),
(702, '32909', 'Industri Pengolahan Lainnya YTDL', 'Kelompok ini mencakup usaha pembuatan barang-barang yang tidak diklasifikasikan di tempat lain, seperti papan nama, papan reklame (papan atau lampu display), segala macam payung, pipa rokok, lencana, piala, medali, stempel, tongkat, kap lampu, lilin, segala macam kancing, sapu, sikat ijuk, tempat cerutu dan sirih, pipa rokok, sisir, penyemprot wangi-wangian, botol vakum dan bejana vakum untuk keperluan pribadi atau rumah tangga, wig (rambut palsu), janggut palsu, bulu mata palsu dan lainnya yang belum tercakup dalam golongan lainnya, termasuk pembuatan korek api dari logam dan pembuatan perhiasan imitasi, boneka yang digunakan oleh penjahit  untuk mengenakan baju, peti jenazah. Pembuatan sumbu lampu dimasukan dalam kelompok 13942.', 'kbli_32909', NULL, NULL),
(703, '33111', 'Reparasi Produk Logam Siap Pasang Untuk Bangunan, Tangki, Tandon Air Dan Generator Uap', 'Kelompok ini mencakup reparasi dan perawatan produk logam pabrikasi di golongan 251, seperti reparasi tangki, reservoir dan kontainer atau wadah logam, drum pengapalan baja, generator uap atau uap air lainnya, mesin tambahan yang digunakan dalam generator uap (Kondensator, pemanas, pengumpul/kolektor dan akumulator uap), reactor nuklir kecuali separator isotop, suku cadang mesin kapal laut atau ketel uap tenaga dan peralatan kerja dari radiator dan pemanas pusat dan sejenisnya.', 'kbli_33111', NULL, NULL),
(704, '33112', 'Reparasi Produk Senjata Dan Amunisi', 'Kelompok ini mencakup reparasi dan perawatan produk logam di golongan 252, yaitu  reparasi dan perawatan senjata api dan meriam/artileri (termasuk reparasi senjata untuk kegiatan olahraga atau rekreasional).', 'kbli_33112', NULL, NULL),
(705, '33119', 'Reparasi Produk Logam Pabrikasi Lainnya', 'Kelompok ini mencakup reparasi dan perawatan produk logam pabrikasi di golongan 259, seperti  reparasi dan perawatan alat potong, perkakas tangan dan peralatan umum (biasa digunakan umtuk pertanian, pertukangan dan rumah tangga), wadah dari logam, barang dari kawat, brankas, filling kabinet dan barang logam lainnya.  Termasuk las (keliling) yang berpindah-pindah,', 'kbli_33119', NULL, NULL),
(706, '33121', 'Reparasi Mesin Untuk Keperluan Umum', 'Kelompok  ini mencakup reparasi mesin untuk keperluan umum yang tercakup dalam golongan 281, seperti reparasi dan perawatan mesin kapal laut atau kereta api, pompa dan peralatan yang terkait, peralatan tenaga uap atau zat cair, katup atau klep, roda gigi (persneling) dan peralatan kemudi, tungku pembakar pada proses industri, alat pengangkat dan pemindah, mesin dan peralatan kantor kecuali komputer dan perlengkapannya (cash register, mesin fotokopi, kalkulator, mesin ketik), perkakas tangan yang digerakkan tenaga, peralatan pendingin dan pembersih udara, timbangan, mesin penjual otomatis dan keperluan umum lainnya.', 'kbli_33121', NULL, NULL),
(707, '33122', 'Reparasi Mesin Untuk Keperluan Khusus', 'Kelompok  ini mencakup reparasi dan perawatan mesin untuk keperluan khusus yang tercakup dalam golongan 282, seperti reparasi dan perawatan traktor pertanian, mesin pertanian dan mesin kehutanan dan penebangan, perkakas mesin pemotong logam dan pembentuk logam dan aksesorinya, perkakas mesin lainnya, mesin metalurgi, mesin pertambangan dan penggalian termasuk  mesin pada ladang minyak dan gas, mesin konstruksi, mesin pengolahan makanan dan minuman, mesin pengolahan tembakau, mesin tekstil, mesin pembuatan pakaian dan pakaian dari kulit, mesin pembuatan kertas dan mesin keperluan khusus lainnya.', 'kbli_33122', NULL, NULL),
(708, '33131', 'Reparasi Alat Ukur, Alat Uji dan Peralatan Navigasi Dan Pengontrol', 'Kelompok ini mencakup reparasi dan perawatan peralatan yang diproduksi dalam golongan 265, seperti reparasi dan perawatan peralatan mesin pesawat terbang, peralatan pengujian emisi mobil, peralatan meteorologi, peralatan pengujian dan pemeriksaan perlengkapan secara fisik, listrik dan kimia, peralatan penelitian atau survei, peralatan pendeteksi dan pemantauan radiasi dan sejenisnya.', 'kbli_33131', NULL, NULL),
(709, '33132', 'Reparasi Peralatan Iradiasi, Elektromedis Dan Elektroterapi', 'Kelompok ini mencakup reparasi dan perawatan peralatan iradiasi, elektromedis dan elektroterapi dalam golongan 266, seperti reparasi dan perawatan peralatan penggambaran resonansi magnetik (magnetic resonance imaging/MRI), peralatan kesehatan ultrasound, peralatan pembuka jalan (pacemaker), peralatan bantu pendengaran (hearing aids), peralatan elektrokardiografi, peralatan endoskopis elektromedis, peralatan iradiasi dan sejenisnya.', 'kbli_33132', NULL, NULL),
(710, '33133', 'Reparasi Peralatan Fotografi Dan Optik', 'Kelompok ini mencakup reparasi dan perawatan peralatan fotografi dan optik dalam golongan 267, jika utamanya digunakan secara komersial, seperti reparasi dan perawatan teropong, mikroskop (kecuali mikroskop elektron, proton), teleskop, prisma dan lensa (kecuali ophtalmik), peralatan fotografi dan sejenisnya.', 'kbli_33133', NULL, NULL),
(711, '33141', 'Reparasi Motor Listrik, Generator Dan Transformator', 'Kelompok ini mencakup reparasi dan perawatan mesin dan peralatan yang diproduksi dalam golongan 271, seperti reparasi dan perawatan mesin tenaga, distribusi dan khususnya transformator, motor listrik, generator dan perangkat motor generator, peralatan saklar dan papan hubung, peralatan relay dan pengontrol industri.', 'kbli_33141', NULL, NULL),
(712, '33142', 'Reparasi Baterai Dan Akumulator Listrik', 'Kelompok ini mencakup reparasi dan perawatan baterai dan akumulator motor listrik dan lainnya yang termasuk dalam golongan 272.', 'kbli_33142', NULL, NULL),
(713, '33149', 'Reparasi Peralatan Listrik Lainnya', 'Kelompok ini mencakup reparasi dan perawatan peralatan listrik lainnya dalam golongan 273, 274 dan 279, seperti reparasi dan perawatan peralatan penerangan listrik, peralatan kawat pembawa arus dan bukan pembawa arus untuk sirkuit kabel listrik dan peralatan listrik sejenis lainnya.', 'kbli_33149', NULL, NULL),
(714, '33151', 'Reparasi Kapal, Perahu Dan Bangunan Terapung', 'Kelompok ini mencakup jasa reparasi dan perawatan alat angkutan dalam golongan 301, seperti jasa reparasi dan perawatan kapal, perahu, kapal pesiar, kapal atau perahu untuk kepeluan rekreasi dan olahraga dan sejenisnya. Termasuk usaha jasa reparasi dan perawatan dan modifikasi bangunan lepas pantai.', 'kbli_33151', NULL, NULL),
(715, '33152', 'Reparasi Lokomotif Dan Gerbong Kereta', 'Kelompok ini mencakup jasa reparasi dan perawatan lokomotif dan gerbong kereta api dan kendaraan jalan rel lainnya (kecuali industri  pembangunan kembali dan pengubahan) dalam golongan 302.', 'kbli_33152', NULL, NULL),
(716, '33153', 'Reparasi Pesawat Terbang', 'Kelompok ini mencakup reparasi dan perawatan pesawat terbang (kecuali industri  pengubahan, pemeriksaan, dan pembangunan kembali), mesin pesawat terbang dan perlengkapannya dalam golongan 303.', 'kbli_33153', NULL, NULL),
(717, '33159', 'Reparasi Alat Angkutan Lainnya, Bukan Kendaraan Bermotor', 'Kelompok ini mencakup reparasi dan perawatan alat angkut lainnya bukan sepeda motor dan sepeda, seperti reparasi dan perawatan kendaraan perang, andong dan kereta yang ditarik binatang dan alat angkut sejenis lainnya.', 'kbli_33159', NULL, NULL),
(718, '33190', 'Reparasi Peralatan Lainnya', 'Kelompok ini mencakup reparasi peralatan lainnya, seperti reparasi jaring untuk menangkap ikan, tali jerat, tali temali, canvas dan terpal (tarp), kantong penyimpan pupuk dan bahan kimia, pallet kayu, drum pengapalan dan tong sejenisnya, mesin pinball dan mesin permainan yang dioperasikan dengan koin, orgel dan peralatan musik bersejarah lainnya.', 'kbli_33190', NULL, NULL),
(719, '33200', 'Instalasi/Pemasangan Mesin dan Peralatan Industri', 'Kelompok ini mencakup instalasi/pemasangan mesin dan peralatan industri, seperti instalsi/pemasangan mesin industri dalam pabrik, peralatan kendali/kontrol proses industri dan peralatan industri lainnya (peralatan komunikasi, mainframe dan komputer sejenis, peralatan iradiasi, peralatan gas medis dan elektromedis dan lain-lain), pembongkaran mesin dan peralatan berskala besar, kegiatan millwright, machine rigging dan integrasi/perakitan mesin seperti jasa perakitan peralatan arena bowling.', 'kbli_33200', NULL, NULL),
(720, '35111', 'Pembangkitan Tenaga Listrik', 'Kelompok ini mencakup usaha memproduksi tenaga listrik melalui pembangkitan tenaga listrik yang menggunakan berbagai jenis sumber energi. Sumber energi fosil seperti batubara, gas, bahan bakar minyak, dan diesel. Sumber energi terbarukan seperti panas bumi, angin, bioenergi, sinar matahari, aliran dan terjunan air, gerakan dan perbedaan suhu lapisan laut. Sumber energi hybrid yang menggabungankan sumber energi fosil dengan energi terbarukan, dan energi yang berasal dari teknologi energy storage.', 'kbli_35111', NULL, NULL),
(721, '35112', 'Transmisi Tenaga Listrik', 'Kelompok ini mencakup usaha pengoperasian sistem transmisi atau usaha penyaluran tenaga listrik dari pembangkit ke jaringan distribusi melalui jaringan tenaga listrik yang bertegangan tinggi (antara 35 kilovolt s.d 150 kilovolt) dan/atau bertegangan ekstra tinggi (antara 150 kilovolt s.d 500 kilovolt) dan/atau bertegangan ultra tinggi (di atas 500 kilovolt) termasuk gardu-gardu induknya, baik berasal dari produksi sendiri maupun dari produksi pihak lain.', 'kbli_35112', NULL, NULL),
(722, '35113', 'Distribusi Tenaga Listrik', 'Kelompok ini mencakup usaha pengoperasian sistem distribusi atau usaha penyaluran tenaga listrik melalui jaringan tenaga listrik yang bertegangan menengah ke bawah (di bawah 35 kilovolt) sampai ke konsumen atau pelanggan termasuk dengan gardu-gardu distribusinya baik berasal dari produksi sendiri maupun dari produksi pihak lain.', 'kbli_35113', NULL, NULL),
(723, '35114', 'Penjualan Tenaga Listrik', 'Kelompok ini mencakup usaha penjualan tenaga listrik kepada konsumen akhir.', 'kbli_35114', NULL, NULL),
(724, '35115', 'Pembangkit, Transmisi, Distribusi dan Penjualan Tenaga Listrik Dalam Satu Kesatuan Usaha', 'Kelompok ini mencakup kegiatan memproduksi tenaga listrik, penyaluran tenaga listrik melalui jaringan transmisi dan distribusi tenaga listrik, serta penjualan tenaga listrik kepada konsumen akhir yang dilaksanakan dalam satu kesatuan usaha.', 'kbli_35115', NULL, NULL),
(725, '35116', 'Pembangkit, Transmisi,  dan Penjualan Tenaga Listrik Dalam Satu Kesatuan Usaha', 'Kelompok ini mencakup kegiatan memproduksi tenaga listrik, penyaluran tenaga listrik melalui jaringan transmisi, dan  penjualan tenaga listrik kepada konsumen akhir yang dilaksanakan dalam satu kesatuan usaha.', 'kbli_35116', NULL, NULL),
(726, '35117', 'Pembangkit, Distribusi,  dan Penjualan Tenaga Listrik Dalam Satu Kesatuan Usaha', 'Kelompok ini mencakup kegiatan memproduksi tenaga listrik, penyaluran tenaga listrik melalui jaringan distribusi dan  penjualan tenaga listrik kepada konsumen akhir yang dilaksanakan dalam satu kesatuan usaha.', 'kbli_35117', NULL, NULL),
(727, '35118', 'Distribusi, dan Penjualan Tenaga Listrik Dalam Satu Kesatuan Usaha', 'Kelompok ini mencakup kegiatan penyaluran tenaga listrik melalui jaringan distribusi dan  penjualan tenaga listrik kepada konsumen akhir yang dilaksanakan dalam satu kesatuan usaha.', 'kbli_35118', NULL, NULL),
(728, '35121', 'Pengoperasian Instalasi Penyediaan Tenaga Listrik', 'Kelompok ini mencakup usaha pengoperasian yang dilakukan oleh pihak lain atas fasilitas pembangkit yang menghasilkan energi listrik, fasilitas sistem transmisi tenaga listrik dan sistem distribusi tenaga listrik.', 'kbli_35121', NULL, NULL),
(729, '35122', 'Pengoperasian Instalasi Pemanfaatan Tenaga Listrik', 'Kelompok ini mencakup usaha pengoperasian yang dilakukan oleh pihak lain atas fasilitas instalasi pemanfaatan tenaga listrik mencakup instalasi pemanfaatan tenaga listrik tegangan tinggi, instalasi pemanfaatan tenaga listrik tegangan menengah, dan instalasi pemanfaatan tenaga listrik tegangan rendah.', 'kbli_35122', NULL, NULL),
(730, '35129', 'Aktivitas penunjang tenaga listrik lainnya', 'Kelompok ini mencakup usaha jasa lain yang secara langsung berkaitan dengan penyediaan dan pemanfaatan tenaga listrik namun tidak tercakup dalam kelompok 35121 s.d. 35122, seperti jasa pencatatan meteran, pemberian tagihan dan kegiatan perdagangan pulsa/token listrik serta kegiatan penunjang kelistrikan lainnya.', 'kbli_35129', NULL, NULL),
(731, '35201', 'Pengadaan Gas Alam Dan Buatan', 'Kelompok ini mencakup usaha pengolahan bahan bakar gas yang dapat dimanfaatkan secara langsung sebagai bahan bakar di mana pembuatannya disertai usaha peningkatan mutu gas, seperti  pemurnian, pencampuran dan proses lainnya yang dihasilkan dari gas alam (termasuk LPG), karbonasi dan gasifikasi batu bara, atau bahan hidrokarbon lain.', 'kbli_35201', NULL, NULL),
(732, '35202', 'Distribusi Gas Alam Dan Buatan', 'Kelompok ini mencakup usaha penyaluran gas melalui jaringan yang bertekanan ekstra tinggi (lebih dari 10 bar); yang bertekanan tinggi (antara 4 bar s.d. 10 bar); dan yang bertekanan menengah ke bawah (di bawah 4 bar) baik berasal dari produksi sendiri maupun produksi pihak lain sampai ke konsumen atau pelanggan. Penyaluran gas melalui pipa atas dasar balas jasa atau fee, dimasukkan dalam kelompok 49300. Termasuk penyaluran, distribusi dan pengadaan semua jenis bahan bakar gas melalui sistem saluran, perdagangan gas kepada konsumen melalui saluran, kegiatan agen gas yang melakukan perdagangan gas melalui sistem distribusi gas yang dioperasikan oleh pihak lain dan pengoperasian pertukaran komoditas dan kapasitas pengangkutan bahan bakar gas.', 'kbli_35202', NULL, NULL),
(733, '35203', 'Pengadaan Gas Bio', 'Kelompok ini mencakup usaha pengolahan bahan bakar gas yang dapat dimanfaatkan secara langsung sebagai bahan bakar yang dihasilkan dari produk sampingan pertanian, perkebunan, peternakan, atau sampah/limbah dimana pembuatannya disertai usaha peningkatan mutu gas, seperti  pemurnian, pencampuran dan proses lainnya.', 'kbli_35203', NULL, NULL),
(734, '35301', 'Pengadaan Uap/Air Panas Dan Udara Dingin', 'Kelompok ini mencakup kegiatan memproduksi dan mendistribusikan uap dan air panas untuk pemanasan, pembangkit tenaga dan penggunaan lainnya. Kegiatannya seperti produksi, pengumpulan dan distribusi uap dan air panas untuk pemanas, energi dan kegunaan lain dan kegiatan produksi dan distribusi udara dingin.', 'kbli_35301', NULL, NULL),
(735, '35302', 'Produksi Es', 'Kelompok  ini mencakup kegiatan produksi dan distribusi air dingin/air es untuk kebutuhan pendinginan, dan produksi es, termasuk es untuk kebutuhan makanan atau minuman dan kegunaan lain (misal pendinginan).', 'kbli_35302', NULL, NULL),
(736, '36001', 'Penampungan, Penjernihan dan Penyaluran Air Minum', 'Kelompok ini mencakup usaha pengambilan air secara langsung dari mata air dan air tanah serta penjernihan air permukaan dari sumber air (sungai, danau, sumur dan sebagainya)  dan penyaluran air minum secara langsung dari terminal air melalui saluran pipa, mobil tangki (asal mobil tangki tersebut masih dalam satu pengelolaan administratif dari perusahaan air minum tersebut) untuk dijual kepada konsumen atau pelanggan, seperti rumah tangga, instansi/lembaga/badan pemerintah, badan-badan sosial, badan usaha milik negara, perusahaan/usaha swasta antara lain hotel, industri pengolahan dan pertokoan.', 'kbli_36001', NULL, NULL),
(737, '36002', 'Penampungan dan Penyaluran Air Baku', 'Kelompok ini mencakup usaha pengadaan dan penyaluran air baku untuk keperluan industri, pembangkit listrik dan lain-lain. Kelompok ini juga mencakup kegiatan pengelolaan jaringan irigasi, namun tidak mencakup pengoperasian peralatan irigasi seperti alat penyemprot untuk keperluan pertanian.', 'kbli_36002', NULL, NULL),
(738, '36003', 'Aktivitas Penunjang Treatment Air', 'Kelompok ini mencakup usaha atau kegiatan yang secara langsung berhubungan dengan usaha pengadaan dan penyaluran air bersih, seperti jasa pencatatan meteran, pemberian tagihan dan kegiatan penunjang lainnya. Kegiatan pada kelompok ini termasuk distribusi air yang dilakukan perorangan seperti pedagang air pikulan/dorongan/mobil tangki.', 'kbli_36003', NULL, NULL),
(739, '37011', 'Pengumpulan Air Limbah Tidak Berbahaya', 'Kelompok ini mencakup kegiatan pengumpulan dan pengangkutan air limbah industri atau air limbah rumah tangga yang tidak berbahaya melalui saluran dari jaringan pembuangan air limbah, pengumpul air limbah dan fasilitas pengangkutan lainnya (kendaraan pengangkutan limbah/kotoran). Kelompok ini juga mencakup kegiatan penyedotan dan pembersihan tangki septik (perigi jamban), bak dan lubang pembuangan limbah/kotoran; pengumpulan air limbah dari toilet kimia (toilet portable, toilet pesawat, toilet kereta).', 'kbli_37011', NULL, NULL),
(740, '37012', 'Pengumpulan Air Limbah Berbahaya', 'Kelompok ini mencakup kegiatan pengumpulan dan pengangkutan air limbah industri atau air limbah rumah tangga yang berbahaya melalui saluran dari jaringan pembuangan air limbah, pengumpul air limbah dan fasilitas pengangkutan lainnya (kendaraan pengangkutan limbah/kotoran). Kelompok ini juga mencakup kegiatan penyedotan dan pembersihan tangki, bak dan lubang pembuangan air limbah berbahaya.', 'kbli_37012', NULL, NULL),
(741, '37021', 'Treatment dan Pembuangan Air Limbah Tidak Berbahaya', 'Kelompok ini mencakup kegiatan pengoperasian sistem pembuangan air limbah atau fasilitas pengolahan air limbah tidak berbahaya, pengolahan air limbah tidak berbahaya (mencakup air limbah industri dan rumah tangga, air dari kolam renang dan lain-lain) melalui saluran secara proses fisika, kimia dan biologi seperti pengenceran, penyaringan dan sedimentasi dan lain-lain. Kelompok ini juga mencakup kegiatan pengelolaan dan pembersihan saluran air limbah tidak berbahaya dan saluran pembuangannya.', 'kbli_37021', NULL, NULL),
(742, '37022', 'Treatment dan Pembuangan Air Limbah Berbahaya', 'Kelompok ini mencakup kegiatan pengoperasian sistem pembuangan air limbah atau fasilitas pengolahan air limbah berbahaya, pengolahan air limbah berbahaya (mencakup air limbah industri dan rumah tangga dan lain-lain) melalui saluran secara proses fisika, kimia dan biologi seperti pengenceran, penyaringan dan sedimentasi dan lain-lain. Kelompok ini juga mencakup kegiatan treatment dan pembersihan saluran air limbah berbahaya dan saluran pembuangannya.', 'kbli_37022', NULL, NULL),
(743, '38110', 'Pengumpulan limbah dan sampah tidak berbahaya', 'Kelompok ini mencakup pengumpulan sampah padat yang tidak berbahaya dalam suatu daerah, misalnya pengumpulan sampah rumah tangga dan usaha dengan menggunakan tempat sampah, tempat sampah beroda, kontainer sampah dan lain-lain yang meliputi campuran bahan-bahan yang dapat dipulihkan, pengumpulan bahan-bahan yang dapat didaur ulang, pengumpulan minyak dan lemak masak bekas pakai dan pengumpulan sampah dari tempat sampah di tempat umum. Termasuk juga usaha pengumpulan sampah konstruksi dan pembongkaran bangunan, pengumpulan dan pembersihan runtuhan atau puing, pengumpulan sampah dari pabrik tekstil dan pengoperasian pos pemindah sampah untuk sampah yang tidak berbahaya.', 'kbli_38110', NULL, NULL),
(744, '38120', 'Pengumpulan Limbah Berbahaya', 'Kelompok ini mencakup pengumpulan limbah padat maupun tidak padat yang berbahaya serta sampah spesifik, misalnya bahan yang mudah meledak, bahan yang mudah teroksidasi, bahan yang mudah terbakar, bahan beracun, iritan, karsinogenik, korosif, bahan yang dapat menyebabkan infeksi dan substansi dan preparat lainnya yang berbahaya untuk kesehatan manusia dan lingkungan. Kegiatan ini juga memerlukan identifikasi, penanganan, pengemasan dan pelabelan limbah berbahaya dan sampah spesifik. Kelompok ini mencakup usaha pengumpulan limbah berbahaya dan sampah spesifik, seperti minyak bekas pakai dari kapal atau bengkel, sampah biologis yang berbahaya (bio-hazardous), aki dan baterai bekas pakai.', 'kbli_38120', NULL, NULL),
(745, '38211', 'Treatment dan Pembuangan Limbah dan Sampah Tidak Berbahaya', 'Kelompok ini mencakup usaha pengoperasian lahan untuk pembuangan limbah dan sampah yang tidak berbahaya, pembuangan limbah dan  sampah yang tidak berbahaya melalui pembakaran atau metode lain dengan atau tanpa menghasilkan produk berupa listrik atau uap, bahan bakar substitusi, biogas, abu atau produk ikutan lainnya untuk kegunaan lebih lanjut, dan sebagainya dan treatment limbah dan sampah organik untuk pembuangan.', 'kbli_38211', NULL, NULL),
(746, '38212', 'Produksi Kompos Sampah Organik', 'Kelompok ini mencakup usaha produksi kompos dari sampah organik dan abu tanaman (pupuk alam organik).', 'kbli_38212', NULL, NULL),
(747, '38220', 'Treatment dan Pembuangan Limbah Berbahaya', 'Kelompok ini mencakup usaha treatment dan pembuangan yang dikelola baik oleh pemerintah dan swasta, seperti pembuangan dan treatment limbah padat atau limbah tidak padat yang berbahaya serta limbah spesifik, mencakup bahan mudah meledak, bahan mudah teroksidasi, bahan yang mudah terbakar, bahan beracun, iritan, karsinogenik, korosif atau bahan yang dapat menyebabkan infeksi dan substansi dan preparat lainnya yang berbahaya untuk kesehatan manusia dan lingkungan.  Kegiatannya adalah usaha pengoperasian fasilitas untuk pembuangan limbah berbahaya dan sampah spesifik, treatment dan pembuangan binatang hidup atau mati yang beracun dan limbah terkontaminasi lainnya, pembakaran limbah berbahaya, treatment, pembuangan dan penyimpanan limbah radioaktif, seperti treatment dan pembuangan limbah radioaktif transisi, mencakup peluruhan pada masa/periode pembuangan limbah dan pembungkusan, penyiapan dan treatment lainnya terhadap limbah radioaktif.', 'kbli_38220', NULL, NULL),
(748, '38301', 'Pemulihan Material Barang Logam', 'Kelompok ini mencakup usaha pengolahan barang bekas dari logam dan sisa-sisa barang logam menjadi bahan baku sekunder. Hasil dari daur ulang/pemulihan material barang logam adalah bahan baku sekunder berbagai bentuk seperti potongan-potongan atau serpihan logam dan lainnya. Kegiatan pada kelompok ini mencakup pemisahan dan pemilihan sampah logam, penghancuran secara mekanik sampah logam, reduksi mekanik sampah logam, pembongkaran, pemotongan dan pengirisan sampah logam,  pemotongan kapal dan alat apung lainnya (ship breaking) dan lainnya. Pembuatan barang logam baru yang menggunakan bahan baku sekunder, barang logam bekas dan sisa-sisa barang logam dimasukkan dalam kelompok industri yang sesuai.', 'kbli_38301', NULL, NULL),
(749, '38302', 'Pemulihan Material Barang Bukan Logam', 'Kelompok ini mencakup usaha pengolahan barang bekas dari bukan logam dan sisa-sisa barang bukan logam menjadi bahan baku sekunder.  Hasil dari daur ulang/pemulihan material barang bukan logam adalah bahan baku sekunder berbagai bentuk seperti potongan-potongan atau serpihan bukan logam dan lainnya. Kegiatan pada kelompok ini mencakup pemisahan dan pemilihan sampah bukan logam, reklamasi karet dan ban bekas, pemilihan plastik, pengolahan sampah plastik atau karet menjadi butiran, penghancuran, pembersihan dan pemilihan kaca, pengolahan minyak dan lemak bekas pakai menjadi bahan sekunder, pengolahan sampah makanan, minuman dan tembakau dan sampah bukan logam lainnya. Pembuatan barang bukan logam yang baru dari bahan baku sekunder, barang bekas bukan logam dan sisa-sisa barang bukan logam dimasukkan dalam kelompok industri yang sesuai.', 'kbli_38302', NULL, NULL),
(750, '39000', 'Aktivitas Remediasi dan Pengelolaan Limbah dan Sampah Lainnya', 'Kelompok ini mencakup usaha jasa pembersihan dan pengelolaan limbah dan sampah lainnya oleh pemerintah dan swasta, seperti dekontaminasi tanah dan air tanah di tempat yang tercemar polusi, baik in situ dan ex situ, menggunakan metode mekanik, kimia atau biologi; dekontaminasi tempat atau pabrik industri, termasuk tempat dan penanaman nuklir; dekontaminasi dan pembersihan air permukaan akibat polusi, contoh karena terkumpulnya polutan atau karena bahan kimia lainnya; pembersihan minyak  yang tumpah (oil spill) dan polusi lain pada tanah, air permukaan, di samudera dan laut, termasuk pesisir pantai; pengurangan asbes, cat dan bahan-bahan beracun lainnya; kegiatan pengontrol polusi khusus lainnya; dan penyemprotan kuman,dan usaha jasa kebersihan lainnya yang sejenis', 'kbli_39000', NULL, NULL),
(751, '41011', 'Konstruksi Gedung Hunian', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan yang dipakai untuk hunian, seperti rumah tinggal, rumah tinggal sementara, rumah susun, apartemen dan kondominium. Termasuk pembangunan gedung untuk hunian yang dikerjakan oleh perusahaan real estat dengan tujuan untuk dijual dan kegiatan perubahan dan renovasi gedung hunian.', 'kbli_41011', NULL, NULL),
(752, '41012', 'Konstruksi Gedung Perkantoran', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan yang dipakai untuk gedung perkantoran, seperti kantor dan rumah kantor (rukan). Termasuk pembangunan gedung untuk perkantoran yang dikerjakan oleh perusahaan real estat dengan tujuan untuk dijual dan kegiatan perubahan dan renovasi gedung  perkantoran.', 'kbli_41012', NULL, NULL),
(753, '41013', 'Konstruksi Gedung Industri', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan yang dipakai untuk industri, seperti gedung perindustrian/pabrik, gedung workshop/bengkel kerja, bangunan pabrik untuk pengelolaan dan pemrosesan bahan nuklir. Termasuk kegiatan perubahan dan renovasi gedung industri.', 'kbli_41013', NULL, NULL),
(754, '41014', 'Konstruksi Gedung Perbelanjaan', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan yang dipakai untuk perbelanjaan, seperti gedung perdagangan/pasar/mall, toserba, toko, rumah toko (ruko) dan warung. Termasuk pembangunan ruko yang dikerjakan oleh perusahaan real estat dengan tujuan untuk dijual dan kegiatan perubahan dan renovasi gedung perbelanjaan.', 'kbli_41014', NULL, NULL),
(755, '41015', 'Konstruksi Gedung Kesehatan', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan,  dan/atau pembangunan kembali bangunan yang dipakai untuk sarana kesehatan, seperti rumah sakit, poliklinik, puskesmas, balai pengobatan, gedung pelayanan kesehatan dan gedung laboratorium. Termasuk kegiatan perubahan dan renovasi gedung kesehatan.', 'kbli_41015', NULL, NULL),
(756, '41016', 'Konstruksi Gedung Pendidikan', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan yang dipakai untuk sarana pendidikan, seperti gedung sekolah, tempat kursus, laboratorium dan bangunan penunjang pendidikan lainnya. Termasuk kegiatan perubahan dan renovasi gedung pendidikan.', 'kbli_41016', NULL, NULL),
(757, '41017', 'Konstruksi Gedung Penginapan', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan yang dipakai untuk penginapan, seperti gedung perhotelan, hostel dan losmen. Termasuk kegiatan perubahan dan renovasi gedung penginapan.', 'kbli_41017', NULL, NULL),
(758, '41018', 'Konstruksi Gedung Tempat Hiburan dan Olahraga', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan,  dan/atau pembangunan kembali bangunan yang dipakai untuk tempat hiburan,  seperti bioskop, gedung kebudayaan/kesenian, gedung wisata dan rekreasi serta gedung olahraga. Termasuk pembangunan gedung untuk tempat hiburan yang dikerjakan oleh perusahaan real estat dengan tujuan untuk dijual dan kegiatan perubahan dan renovasi gedung tempat hiburan dan olahraga.', 'kbli_41018', NULL, NULL),
(759, '41019', 'Konstruksi Gedung Lainnya', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan yang dipakai penggunaan selain dalam kelompok 41011 s.d. 41018, seperti tempat ibadah (masjid, gereja katolik, gereja kristen, pura, wihara, kelenteng), gedung terminal/stasiun, balai yasa (kereta api), bangunan monumental, gedung negara dan pemerintah pusat/daerah, bangunan bandara, gedung hangar pesawat, gedung PKPPK (Pemadam Kebakaran di Bandar Udara), gedung bersejarah, gedung penjara, gedung balai pertemuan, gudang, gedung genset, rumah pompa, depo, gedung power house, gedung gardu listrik, gedung gardu sinyal, gedung tower, gedung penyimpanan termasuk penyimpanan bahan peledak  dan lainnya. Termasuk kegiatan perubahan dan renovasi gedung lainnya.', 'kbli_41019', NULL, NULL),
(760, '41020', 'Jasa Pekerjaan Konstruksi Prapabrikasi Bangunan Gedung', 'Kelompok ini mencakup kegiatan pemasangan bahan hasil produksi pabrik seperti beton pracetak, baja, plastik, karet, dan hasil produksi pabrik lainnya dengan metode pabrikasi, erection, dan/ atau perakitan untuk bangunan gedung.', 'kbli_41020', NULL, NULL),
(761, '42101', 'Konstruksi Bangunan Sipil Jalan', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan jalan (raya, sedang, dan kecil), jalan bebas hambatan/jalan tol, dan jalan landasan terbang (pacu, taksi, dan parkir), dan lapangan penyimpanan peti kemas (containers yard). Termasuk kegiatan penunjang pembangunan, peningkatan, pemeliharaan konstruksi pagar/tembok penahan jalan. Tidak termasuk jalan layang.', 'kbli_42101', NULL, NULL),
(762, '42102', 'Konstruksi Bangunan Sipil Jembatan, Jalan Layang, Fly Over, dan Underpass', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan jembatan (termasuk jembatan rel), jalan layang, underpass, dan fly over. Termasuk kegiatan pembangunan, peningkatan, pemeliharaan penunjang, pelengkap dan perlengkapan jembatan dan jalan layang, seperti pagar/tembok penahan, drainase jalan, marka jalan, dan rambu-rambu.', 'kbli_42102', NULL, NULL),
(763, '42103', 'Konstruksi Jalan Rel', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan,  dan/atau pembangunan kembali jalan rel. Seperti jalan rel  untuk kereta api. Termasuk pekerjaan pemasangan rel dan bantalan kereta api dan penimbunan kerikil (agregat kelas A)  untuk badan jalan kereta api.', 'kbli_42103', NULL, NULL),
(764, '42104', 'Konstruksi Terowongan', 'Kelompok ini mencakup usaha pembangunan terowongan dengan menggunakan mesin bor dan/atau bahan peledak, bekisting, pembesian, dan pengecoran beton; pemeliharaan dan perbaikan bangunan terowongan di bawah permukaan air, di bukit atau pegunungan dan di bawah permukaan tanah.', 'kbli_42104', NULL, NULL),
(765, '42201', 'Konstruksi Jaringan Irigasi dan Drainase', 'Kelompok ini mencakup usaha pembangunan pemeliharaan,  dan/atau pembangunan kembali bangunan jaringan saluran air irigasi dan jaringan drainase.', 'kbli_42201', NULL, NULL),
(766, '42202', 'Konstruksi Bangunan Sipil Pengolahan Air Bersih', 'Kelompok ini mencakup usaha  pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan penyadap dan penyalur air baku, bangunan pengolahan air baku, bangunan pengolahan air minum, bangunan menara air minum, reservoir air minum, jaringan pipa/penyalur distribusi air bersih, tangki air minum dan bangunan pelengkap air minum lainnya.', 'kbli_42202', NULL, NULL),
(767, '42203', 'Konstruksi Bangunan Sipil Prasarana dan Sarana Sistem Pengolahan Limbah Padat, Cair, dan Gas', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan pengolahan limbah padat, cair, dan gas, reservoir limbah, jaringan perpipaan limbah,bangunan jaringan air limbah dalam kota (jaringan pengumpul air limbah domestik/manusia dan air limbah industri), bangunan tempat pembuangan dan pembakaran (incenerator) limbah, dan bangunan pelengkap limbah padat, cair, dan gas, bangunan tempat pembuangan akhir sampah beserta bangunan pelengkapnya, dan jasa pemasangan konstruksi sistem septik, konstruksi unit pengolahan limbah yang dihasilkan dari pembangkit  thermal, hydro, panas bumi, energi baru dan terbarukan (EBT) lainnya.', 'kbli_42203', NULL, NULL),
(768, '42204', 'Konstruksi Bangunan Sipil Elektrikal', 'Kelompok ini mencakup kegiatan pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan sipil elektrikal seperti bangunan sipil pembangkit, transmisi, distribusi dan instalasi pemanfaatan tenaga listrik, jaringan pipa listrik lokal dan jarak jauh termasuk pembangunan gardu induk dan pemasangan tiang listrik dan menara.', 'kbli_42204', NULL, NULL),
(769, '42205', 'Konstruksi Bangunan Sipil Telekomunikasi untuk Prasarana Transportasi', 'Kelompok ini mencakup kegiatan pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan fasilitas telekomunikasi sarana bantu navigasi laut, bangunan telekomunikasi navigasi udara, bangunan sinyal dan telekomunikasi kereta api, termasuk bangunan menara/tiang/ pipa/antena dan bangunan sejenisnya.', 'kbli_42205', NULL, NULL),
(770, '42206', 'Konstruksi Sentral Telekomunikasi', 'Kelompok ini mencakup kegiatan pembangunan, pemeliharaan dan perbaikan konstruksi bangunan sentral telekomunikasi beserta perlengkapannya, seperti bangunan sentral telepon, telegraf, bangunan menara pemancar, penerima radar gelombang mikro, bangunan stasiun bumi kecil dan stasiun satelit. Termasuk jaringan pipa komunikasi lokal dan jarak jauh, jaringan transmisi, dan jaringan distribusi kabel telekomunikasi/ telepon di atas permukaan tanah, di bawah tanah dan di dalam air.', 'kbli_42206', NULL, NULL),
(771, '42207', 'Pembuatan/Pengeboran Sumur Air Tanah', 'Kelompok ini mencakup kegiatan khusus pembuatan/pengeboran untuk mendapatkan air tanah, baik skala kecil, skala sedang, maupun skala besar dan tekanan tinggi sebagai bagian dari pekerjaan yang tercakup dalam konstruksi gedung. Termasuk pekerjaan pengeboran atau penggalian sumur air, pemasangan pompa dan pipanya.', 'kbli_42207', NULL, NULL),
(772, '42209', 'Konstruksi Jaringan Irigasi, Komunikasi, dan Limbah Lainnya', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan konstruksi lainnya yang belum tercakup dalam kelompok 42201 s.d. 42207. Termasuk penataan bangunan dan lingkungan, prasarana kawasan permukiman, industri, rumah sakit, dan lain-lain.', 'kbli_42209', NULL, NULL),
(773, '42911', 'Konstruksi Bangunan Prasarana Sumber Daya Air', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan,  dan/atau pembangunan kembali bangunan prasarana sumber daya air seperti bendungan (dam), bendung (weir), embung, pintu air, talang (viaduk), siphon, check dam, tanggul dan saluran pengendali banjir, tanggul laut, bangunan pengambilan (free intake), krib,  waduk dan sejenisnya, stasiun pompa dan/atau prasarana sumber daya air lainnya.', 'kbli_42911', NULL, NULL),
(774, '42912', 'Konstruksi Bangunan Pelabuhan Bukan Perikanan', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan dermaga (jetty), trestle,sarana pelabuhan, dan sejenisnya pelabuhan bukan perikanan. Termasuk konstruksi jalan air atau terusan, pelabuhan dan sarana jalur sungai, dok (pangkalan), lock (panama canal lock, hoover dam) dan lain-lain.', 'kbli_42912', NULL, NULL),
(775, '42913', 'Konstruksi Bangunan Pelabuhan Perikanan', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan,  dan/atau pembangunan kembali bangunan dermaga (jetty), trestle,sarana pelabuhan, dan sejenisnya pelabuhan perikanan. Termasuk konstruksi jalan air atau terusan, pelabuhan dan sarana jalur sungai, dok (pangkalan), lock (panama canal lock, hoover dam) dan lain-lain.', 'kbli_42913', NULL, NULL),
(776, '42914', 'Pengerukan', 'Kelompok ini mencakup usaha pengerukan atau normalisasi dan pemeliharaan sungai, pelabuhan, rawa, danau, alur pelayaran, kolam dan kanal, baik dengan sifat pekerjaan ringan, sedang, maupun berat. \r\nTermasuk pengerukan untuk pembuatan jalur transportasi air.', 'kbli_42914', NULL, NULL),
(777, '42915', 'Konstruksi Bangunan Sipil Minyak dan Gas Bumi', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan sipil pada kegiatan usaha hulu dan hilir minyak dan gas.', 'kbli_42915', NULL, NULL),
(778, '42916', 'Konstruksi Bangunan Sipil Pertambangan', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan,  dan/atau pembangunan kembali fasilitas eksplorasi dan operasi produksi pertambangan, termasuk pengendalian dampak lingkungan.', 'kbli_42916', NULL, NULL),
(779, '42917', 'Konstruksi Bangunan Sipil Panas Bumi', 'Kelompok ini mencakup jasa konstruksi untuk pembangunan, pemeliharaan, dan/atau pembangunan kembali, fasilitas hulu panas bumi, seperti sumur dan pipa penyalur.', 'kbli_42917', NULL, NULL),
(780, '42918', 'Konstruksi Bangunan Sipil Fasilitas Olah Raga', 'Kelompok ini mencakup kegiatan pembangunan, pemeliharaan, dan/atau pembangunan kembali bangunan fasilitas olah raga seperti bangunan stadion, olah raga lapangan (sepakbola, baseball, rugby, lintasan balap mobil dan motor), lapangan basket, hockey, lapangan tenis, lapangan golf, kolam renang termasuk kolam renang berdinding baja galvanized stainless steel standar olympic, lintasan atletik, lapangan panahan, gelanggang olahraga dan lain-lain.', 'kbli_42918', NULL, NULL),
(781, '42919', 'Konstruksi Bangunan Sipil Lainnya Ytdl', 'Kelompok ini mencakup usaha pembangunan, pemeliharaan dan perbaikan bangunan sipil lainnya yang belum tercakup dalam kelompok 42911 s.d. 42918, seperti lapangan parkir dan sarana lingkungan pemukiman (di luar gedung) lainnya. Kelompok ini mencakup pembagian lahan dengan pengembangannya (misalnya penambahan jalan, prasarana umum dan lain-lain). Termasuk pengadaan dan pelaksanaan konstruksi fasilitas mikroelektronika dan pabrik pengolahan, seperti yang memproduksi mikroprosesor, chip silikon dan wafer, mikrosirkuit, dan semikonduktor; pengadaan dan pelaksanaan konstruksi pabrik pengolahan tekstil dan pakaian; pengadaan dan pelaksanaan konstruksi pengolahan besi dan baja; dan/atau pengadaan dan pelaksanaan konstruksi pabrik pengolahan lainnya.', 'kbli_42919', NULL, NULL),
(782, '42921', 'Konstruksi Reservoir Pembangkit Listrik Tenaga Air', 'Kelompok ini mencakup kegiatan pembangunan reservoir, intake, control gate, penstock, dan outflow pada pembangkit listrik tenaga air.', 'kbli_42921', NULL, NULL),
(783, '42922', 'Jasa Pekerjaan Konstruksi Pelindung Pantai', 'Kelompok ini mencakup kegiatan pembangunan, pemeliharaan, dan/atau pembangunan kembali  bangunan pelindung pantai termasuk groin, breakwater, seawall,  artificial headland, beach nourishment, terumbu buatan dan pekerjaan lainnya  yang sejenis.', 'kbli_42922', NULL, NULL),
(784, '42923', 'Konstruksi Bangunan Sipil Fasilitas Pengolahan Produk Kimia, Petrokimia, Farmasi, dan Industri Lainnya', 'Kelompok ini mencakup kegiatan pembangunan, pemeliharaan,  dan/atau pembangunan kembali pabrik pengolahan bahan kimia dasar; pengolahan pupuk; pabrik plastik dan pabrik pengolahan karet; pengolahan hasil agrokimia; pabrik pengolahan kimia lainnya termasuk pabrik pengolahan produk farmasi dan petrokimia.', 'kbli_42923', NULL, NULL),
(785, '42924', 'Konstruksi Bangunan Sipil Fasilitas Militer dan Peluncuran Satelit', 'Kelompok ini mencakup kegiatan pembangunan, pemeliharaan,  dan/atau pembangunan kembali konstruksi bangunan untuk fasilitas militer seperti benteng, lubang perlindungan, pusat pengujian militer. Termasuk tempat peluncuran satelit.', 'kbli_42924', NULL, NULL),
(786, '42929', 'Konstruksi Khusus Bangunan Sipil Lainnya Ytdl', 'Kelompok ini mencakup kegiatan pembangunan, pemeliharaan, dan/atau pembangunan kembali konstruksi khusus bangunan sipil lainnya yang belum tercakup dalam kelompok 42921 s.d. 42924.', 'kbli_42929', NULL, NULL),
(787, '42930', 'Jasa Pekerjaan Konstruksi Prapabrikasi Bangunan Sipil', 'Kelompok ini mencakup kegiatan pemasangan bahan hasil produksi pabrik seperti beton pracetak, baja, plastik, karet, dan hasil produksi pabrik lainnya dengan metode pabrikasi, erection, dan/ atau perakitan untuk bangunan sipil.', 'kbli_42930', NULL, NULL),
(788, '43110', 'Pembongkaran', 'Kelompok ini mencakup usaha pembongkaran dan penghancuran atau perataan gedung atau bangunan lainnya serta pembersihannya. Tidak termasuk penyiapan lahan untuk pertambangan minyak dan gas.', 'kbli_43110', NULL, NULL),
(789, '43120', 'Penyiapan Lahan', 'Kelompok ini mencakup usaha penyiapan lahan untuk kegiatan konstruksi yang berikutnya, seperti pelaksanaan pembersihan dan pematangan lahan konstruksi, pembersihan semak belukar; pembukaan lahan/stabilisasi tanah, (penggalian, membuat kemiringan, pengurukan, perataan lahan konstruksi, penggalian parit, pemindahan, penghancuran atau peledakan batu dan sebagainya); pelaksanaan pekerjaan tanah dan/atau tanah berbatu, penggalian, membuat kemiringan, perataan tanah dengan galian dan timbunan untuk konstruksi jalan (raya, sedang, dan kecil), jalan bebas hambatan, jalan rel kereta api, dan jalan landasan terbang (pacu, taksi, dan parkir), pabrik, pembangkit, transmisi, gardu induk, dan distribusi tenaga listrik, fasilitas produksi, serta bangunan gedung dan bangunan sipil lainnya; pemasangan, pemindahan, dan perlindungan utilitas, tes/uji dengan sondir dan bor, pemboran, ekstraksi material, dan penyelidikan lapangan/pengambilan contoh untuk keperluan konstruksi, geofisika, geologi atau keperluan sejenis; dan penyiapan lahan untuk fasilitas ketenaganukliran. Kegiatan penunjang penyiapan lahan seperti pemasangan fasilitas alat bantu konstruksi (pemasangan sheet pile, papan nama proyek, dan gorong-gorong untuk pemasangan kabel, pekerjaan pembuatan kantor, basecamp, direksi kit, gudang, bengkel proyek), pengukuran kembali, pembuatan/pengalihan jalan sementara, perbaikan dan pemeliharaan jalan umum, dewatering/pengeringan, mobilisasi dan demobilisasi, dan pekerjaan sejenis lainnya.', 'kbli_43120', NULL, NULL),
(790, '43211', 'Instalasi Listrik', 'Kelompok ini mencakup kegiatan pembangunan, pemasangan, pemeliharaan,  pembangunan kembali instalasi listrik pada pembangkit, transmisi, gardu induk, distribusi tenaga listrik, sistem catu daya, dan instalasi listrik pada bangunan gedung baik untuk hunian maupun non hunian, seperti pemasangan instalasi jaringan listrik tegangan rendah. Termasuk kegiatan pemasangan dan pemeliharaan instalasi listrik pada bangunan sipil, seperti jalan raya, jalan kereta api dan lapangan udara.', 'kbli_43211', NULL, NULL),
(791, '43212', 'Instalasi Telekomunikasi', 'Kelompok ini mencakup kegiatan pemasangan instalasi telekomunikasi pada bangunan gedung baik untuk hunian maupun non hunian, seperti pemasangan antena. Kelompok ini juga mencakup kegiatan pemasangan, pemeliharaan dan perbaikan instalasi telekomunikasi pada sentral telepon/telegraf, stasiun pemancar radar gelombang mikro, stasiun bumi kecil/stasiun satelit dan sejenisnya. Termasuk kegiatan pemasangan transmisi dan jaringan telekomunikasi dan Instalasi telekomunikasi di bangunan gedung dan bangunan sipil.', 'kbli_43212', NULL, NULL),
(792, '43213', 'Instalasi Elektronika', 'Kelompok ini mencakup kegiatan pemasangan instalasi elektronika pada bangunan gedung baik untuk hunian maupun non hunian, dan elektronika bandara serta teknologi informasi (termasuk telekomunikasi dan sistem teknologi informasi), seperti pemasangan sistem alarm, close circuit TV dan sound system dan commercial management system (pre-paid electricity voucher). Termasuk juga instalasi access control, scoring board, timing system, perimeter pixel display, master clock dan fasilitas elektronik lainnya.', 'kbli_43213', NULL, NULL),
(793, '43214', 'Jasa Instalasi Konstruksi Navigasi Laut, Sungai, dan Udara', 'Kelompok ini mencakup kegiatan pemasangan dan perawatan konstruksi dan peralatan terkait dengan sarana bantu navigasi laut,sungai dan udara, telekomunikasi-pelayaran/penerbangan, hidrografi dan meteorologi, alur perlintasan, pemanduan, untuk kepentingan keselamatan pelayaran dan penerbangan.', 'kbli_43214', NULL, NULL),
(794, '43215', 'Instalasi Sinyal Dan Telekomunikasi Kereta Api', 'Kelompok ini mencakup pemasangan, pemeliharaan dan perbaikan instalasi sinyal dan telekomunikasi kereta api.', 'kbli_43215', NULL, NULL),
(795, '43216', 'Instalasi Sinyal Dan Rambu-rambu Jalan Raya', 'Kelompok ini mencakup kegiatan pemasangan, pemeliharaan dan perbaikan instalasi sinyal dan rambu-rambu jalan raya. Termasuk pemasangan perlengkapan jalan dan/atau rambu jalan, marka jalan, marka jembatan, termasuk reflector, deliniator, papan penunjuk jalan, patok pengarah, patok kilometer, patok hektometer, kerb pracetak, median beton, guardrail, dan perlengkapan lainnya yang sejenis.', 'kbli_43216', NULL, NULL),
(796, '43221', 'Instalasi Saluran Air (Plambing)', 'Kelompok ini mencakup kegiatan instalasi air bersih, air limbah dan saluran drainase, termasuk pekerjaan perpipaan pada bangunan gedung hunian maupun non hunian. Termasuk kegiatan pemeliharaan dan perbaikan instalasi saluran air, pipa distribusi air bersih dan instalasi Water Treatment Plant (WTP)/Reverse Osmosis (RO), pipa air kotor.', 'kbli_43221', NULL, NULL),
(797, '43222', 'Instalasi Pemanas Dan Geotermal', 'Kelompok ini mencakup kegiatan pemasangan dan perawatan peralatan pemanas (heating) dan geotermal pada bangunan gedung untuk hunian maupun bukan hunian, elektrik maupun non elektrik, termasuk pekerjaan pipa, ducting dan lembaran logam; sistem pengendali pemanasan sentral, penghubung ke sistem pemanasan area, termasuk boiler domestik alat pembakar (burner). Termasuk pekerjaan isolasi panas pada pipa atau tangki, pemasangan insulasi termal kedap cuaca sebelah luar dinding, pemasangan insulasi thermal (untuk pipa air panas dan dingin, ketel uap dan saluran pembuang), insulasi kedap kebakaran, dan pemasangan sistem pelindung kebakaran.', 'kbli_43222', NULL, NULL),
(798, '43223', 'Instalasi Minyak Dan Gas', 'Kelompok ini mencakup kegiatan pemasangan dan pemeliharaan instalasi minyak dan gas pada bangunan gedung hunian dan non hunian serta bangunan sipil lainnya, pekerjaan inspeksi, dan perawatan fasilitas produksi minyak, gas, petrokimia dan panas bumi termasuk pekerjaan instalasi perpipaannya di darat maupun di bawah laut.  Termasuk instalasi fasilitas produksi dan penyimpanan di darat dan di laut untuk minyak, gas, petrokimia dan panas bumi termasuk anjungan lepas pantai dan bawah laut.', 'kbli_43223', NULL, NULL),
(799, '43224', 'Instalasi Pendingin Dan Ventilasi Udara', 'Kelompok ini mencakup kegiatan pemasangan dan perawatan ventilasi (ventilation), lemari pendingin dan penyejuk udara (Air Conditioner/AC) untuk bangunan gedung baik untuk hunian maupun bukan hunian, termasuk pekerjaan pipa, ducting dan lembaran logam.', 'kbli_43224', NULL, NULL),
(800, '43291', 'Instalasi Mekanikal', 'Kelompok ini mencakup kegiatan pemasangan dan pemeliharaan instalasi mekanikal alat angkut dan alat angkat pada bangunan gedung hunian dan non hunian serta bangunan sipil lainnya, seperti lift, tangga berjalan (eskalator), ban berjalan (conveyor), jalan-tapak bergerak (travelator), gondola, dan pintu otomatis termasuk pekerjaan perlengkapan tangga keselamatan dari kebakaran.', 'kbli_43291', NULL, NULL),
(801, '43292', 'Instalasi Meteorologi, Klimatologi  Dan Geofisika', 'Kelompok ini mencakup kegiatan pemasangan instalasi meteorologi, klimatologi dan geofisika ukuran kecil, sedang atau besar.', 'kbli_43292', NULL, NULL),
(802, '43293', 'Instalasi Fasilitas Sumber Radiasi Pengion', 'Kelompok ini mencakup kegiatan instalasi terhadap fasilitas sumber radiasi pengion.', 'kbli_43293', NULL, NULL),
(803, '43294', 'Instalasi Nuklir', 'Kelompok ini mencakup kegiatan instalasi terhadap reaktor nuklir dan instalasi nuklir non reaktor.', 'kbli_43294', NULL, NULL),
(804, '43299', 'Instalasi Konstruksi Lainnya Ytdl', 'Kelompok ini mencakup kegiatan pemasangan instalasi gedung lainnya dan kegiatan pemasangan, pemeliharaan dan perbaikan instalasi bangunan sipil lainnya yang belum tercakup dalam kelompok 43291 s.d. 43294. Termasuk pemasangan dan pemeliharaan instalasi fasilitas pertambangan dan manufaktur seperti loading and discharging stations, winding shafts, chemical plants, iron foundaries, blast furnaces dan coke oven; pemasangan instalasi sistem pengolahan dan peralatan pemurnian air laut, air payau, air tawar menjadi air murni pada pembangkit listrik.', 'kbli_43299', NULL, NULL),
(805, '43301', 'Pengerjaan Pemasangan Kaca Dan Alumunium', 'Kelompok ini mencakup kegiatan pemasangan kaca, alumunium, dan bahan lainnya untuk dinding luar dan dalam dalam rangka penyelesaian bangunan gedung hunian dan non hunian serta bangunan sipil lainnya. Termasuk instalasi atau pemasangan pintu (kecuali pintu otomatis dan pintu putar), jendela, rangka pintu dan jendela dari kayu atau bahan lainnya.', 'kbli_43301', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(806, '43302', 'Pengerjaan Lantai, Dinding, Peralatan Saniter Dan Plafon', 'Kelompok ini mencakup kegiatan pengerjaan lantai, dinding, kolom, peralatan saniter dan plafon dalam rangka penyelesaian bangunan gedung hunian dan non hunian serta bangunan sipil lainnya. Termasuk aplikasi bangunan atau proyek konstruksi lainnya dari plester (pelapisan) interior dan eksterior, termasuk bahan-bahan lathing yang berkaitan, penyelesaian interior seperti langit-langit, pelapisan dinding dengan kayu, gypsum,  panel penutup akustik, partisi/sekat yang dapat dibongkar pasang dan sebagainya, pengubinan, penggantungan atau pemasangan dalam bangunan atau proyek konstruksi lainnya dari keramik, dinding, beton atau ubin lantai, parket (lantai dari papan yang bergambar) dan pelapisan lantai dengan kayu, pelapisan lantai linoleum dan karpet, termasuk karet atau plastik, teraso, marmer, granit atau pelapisan lantai atau dinding dan wallpaper (kertas dinding) serta dinding bangunan kedap suara.', 'kbli_43302', NULL, NULL),
(807, '43303', 'Pengecatan', 'Kelompok ini mencakup kegiatan pengecatan interior dan eksterior bangunan dalam rangka penyelesaian bangunan gedung hunian dan non hunian serta bangunan sipil lainnya. Tidak termasuk pengecatan atap bangunan.', 'kbli_43303', NULL, NULL),
(808, '43304', 'Dekorasi Interior', 'Kelompok ini mencakup kegiatan pengerjaan dekorasi interior dalam rangka penyelesaian bangunan gedung hunian dan non hunian serta bangunan sipil lainnya.  Kegiatan pengerjaan dekorasi interior mencakup aplikasi bangunan atau proyek konstruksi lainnya dari plester (pelapisan) interior, termasuk bahan-bahan lathing yang berkaitan, instalasi atau pemasangan pintu (kecuali pintu otomatis dan pintu putar), kusen, jendela, rangka pintu dan jendela dari kayu atau bahan lainnya, instalasi dapur (kitchen set), tangga dan sejenisnya, pagar, instalasi furnitur, penyelesaian interior seperti langit-langit, pelapisan dinding dengan kayu, partisi/sekat yang dapat dibongkar pasang dan sebagainya, pengubinan atau pemasangan dalam bangunan atau proyek konstruksi lainnya dari keramik, dinding beton atau ubin lantai, parket (lantai dari papan yang bergambar) dan pelapisan lantai dengan kayu, pelapisan lantai linoleum dan karpet, termasuk karet atau plastik, teraso, marmer, granit atau pelapisan lantai atau dinding dan wallpaper (kertas dinding). Termasuk pengecatan, pemasangan kaca, cermin dan pemasangan ornamen dan pekerjaan dekorasi interior seni lainnya pada permukaan dinding, kolom atau plafon dengan bahan logam, kayu dan bahan lainnya.', 'kbli_43304', NULL, NULL),
(809, '43305', 'Dekorasi Eksterior', 'Kelompok ini mencakup kegiatan pengerjaan dekorasi eksterior pada bangunan gedung hunian dan non hunian serta bangunan sipil lainnya, seperti konstruksi taman. Kegiatan pengerjaan dekorasi eksterior mencakup pelapisan eksterior bangunan atau proyek konstruksi lainnya dari plester, termasuk bahan-bahan lathing yang berkaitan, pelapisan eksterior dinding dengan keramik, teraso, marmer dan granit, kaca, batu alam, dan bahan lainnya.', 'kbli_43305', NULL, NULL),
(810, '43309', 'Penyelesaian Konstruksi Bangunan Lainnya', 'Kelompok ini mencakup kegiatan pembersihan dan perapihan gedung hunian dan non hunian serta bangunan sipil lainnya yang baru selesai dibangun, termasuk instalasi interior untuk toko, rumah bergerak, perahu, dan lain-lain dan pengerjaan penyelesaian konstruksi bangunan lainnya ytdl.', 'kbli_43309', NULL, NULL),
(811, '43901', 'Pemasangan Pondasi Dan Tiang Pancang', 'Kelompok ini mencakup kegiatan khusus pemasangan berbagai pondasi dan tiang pancang termasuk pengecoran beton dan pembesian pondasi untuk gedung, jalan/jembatan, bangunan pengairan, dermaga, bangunan lepas pantai dan sejenisnya sebagai bagian dari pekerjaan yang tercakup dalam konstruksi gedung hunian dan non hunian serta bangunan sipil lainnya.', 'kbli_43901', NULL, NULL),
(812, '43902', 'Pemasangan Perancah (Steiger)', 'Kelompok ini mencakup kegiatan khusus pemasangan perancah/steiger pada bangunan gedung, jalan/jembatan, bangunan pengairan, dermaga dan sejenisnya.', 'kbli_43902', NULL, NULL),
(813, '43903', 'Pemasangan Rangka dan Atap/Roof Covering', 'Kelompok ini mencakup kegiatan khusus pemasangan kerangka dan atap bangunan gedung hunian dan non hunian sebagai bagian dari pekerjaan yang tercakup dalam konstruksi gedung. Termasuk pekerjaan talang dan pengecatan atap.', 'kbli_43903', NULL, NULL),
(814, '43904', 'Pemasangan Kerangka Baja', 'Kelompok ini mencakup kegiatan khusus pemasangan kerangka baja sebagai bagian dari pekerjaan yang tercakup dalam konstruksi gedung.', 'kbli_43904', NULL, NULL),
(815, '43905', 'Penyewaan Alat Konstruksi Dengan Operator', 'Kelompok ini mencakup usaha penyewaan alat atau mesin konstruksi dan perlengkapannya dengan operator. Termasuk penyewaan alat produksi dan operasional minyak, gas, petrokimia, panas bumi, komunikasi seperti SCADA (Supervisory Control and Data Acquisition), dan penyewaan derek. Penyewaan mesin konstruksi dan perlengkapannya tanpa operator dicakup dalam kelompok 77393.', 'kbli_43905', NULL, NULL),
(816, '43909', 'Konstruksi Khusus Lainnya Ytdl', 'Kelompok ini mencakup kegiatan konstruksi khusus lainnya yang belum diklasifikasikan dalam kelompok 43901 s.d. 43905 yang memerlukan keahlian atau perlengkapan khusus, seperti kegiatan pengerjaan penahan lembab dan air, dehumidifikasi (pelembaban) bangunan, shaft sinking, pemasangan cerobong asap dan oven untuk keperluan industri dan pekerjaan yang memerlukan keahlian memanjat dan penggunaan perlengkapan yang berkaitan, misalnya bekerja pada gedung-gedung yang tinggi. Termasuk pekerjaan di bawah permukaan tanah, pekerjaan lapis perkerasan beton; pekerjaan perkerasan aspal; pekerjaan perkerasan berbutir; pekerjaan konstruksi pengeboran dan injeksi semen bertekanan; pekerjaan beton struktur; pekerjaan konstruksi beton pascatarik (post tensioned); pekerjaan konstruksi kedap air pada tangki penyimpanan air, minyak, gas, dan lainnya yang sejenis; serta pemasangan konstruksi tahan api (tanur, anneling, flare, incenerator) untuk bangunan gedung hunian dan non hunian serta bangunan sipil lainnya.', 'kbli_43909', NULL, NULL),
(817, '45101', 'Perdagangan Besar Mobil Baru', 'Kelompok ini mencakup usaha perdagangan besar mobil baru, termasuk mobil khusus (seperti ambulans, karavan, mikrobus, pemadam kebakaran, dan sebagainya), lori, trailer, semi-trailer dan berbagai kendaraan pengangkut bermotor lainnya.', 'kbli_45101', NULL, NULL),
(818, '45102', 'Perdagangan Besar Mobil Bekas', 'Kelompok ini mencakup usaha perdagangan besar mobil bekas, termasuk mobil khusus (seperti ambulans, karavan, mikrobus, pemadam kebakaran, dan sebagainya), lori, trailer, semi-trailer dan berbagai kendaraan pengangkut bermotor lainnya.', 'kbli_45102', NULL, NULL),
(819, '45103', 'Perdagangan Eceran Mobil Baru', 'Kelompok ini mencakup usaha penjualan eceran mobil baru, termasuk mobil khusus (seperti ambulans, karavan, mikrobus, pemadam kebakaran, dan sebagainya), lori, trailer, semi-trailer dan berbagai kendaraan pengangkut bermotor lainnya.', 'kbli_45103', NULL, NULL),
(820, '45104', 'Perdagangan Eceran Mobil Bekas', 'Kelompok ini mencakup usaha penjualan eceran mobil bekas, termasuk mobil khusus (seperti ambulans, karavan, mikrobus, pemadam kebakaran, dan sebagainya), lori, trailer, semi-trailer dan berbagai kendaraan pengangkut bermotor lainnya.', 'kbli_45104', NULL, NULL),
(821, '45201', 'Reparasi Mobil', 'Kelompok ini mencakup usaha reparasi dan perawatan mobil, seperti reparasi mekanik, reparasi elektrik, reparasi sistem injeksi elektronik, servis regular, reparasi badan mobil, reparasi bagian kendaraan bermotor, penyemprotan dan pengecatan, reparasi kaca dan jendela dan reparasi tempat duduk kendaraan bermotor. Termasuk reparasi, pemasangan atau penggantian ban dan pipa, perawatan anti karat, pemasangan bagian dan aksesori yang bukan bagian dari proses pembuatan dan usaha perawatan lainnya.', 'kbli_45201', NULL, NULL),
(822, '45202', 'Pencucian Dan Salon Mobil', 'Kelompok ini mencakup usaha pencucian mobil dan salon mobil, seperti pencucian dan pemolesan dan pemasangan bagian dan aksesori yang bukan bagian dari proses pembuatan di salon mobil.', 'kbli_45202', NULL, NULL),
(823, '45301', 'Perdagangan Besar Suku Cadang Dan Aksesori Mobil', 'Kelompok ini mencakup usaha perdagangan besar berbagai suku cadang, komponen dan aksesori mobil yang terpisah dari perdagangannya, seperti karet ban dan ban dalam, busi mobil, baterai (aki), perlengkapan lampu dan bagian-bagian kelistrikan.', 'kbli_45301', NULL, NULL),
(824, '45302', 'Perdagangan Eceran Suku Cadang Dan Aksesori Mobil', 'Kelompok ini mencakup usaha penjualan eceran berbagai suku cadang, komponen dan aksesori mobil yang terpisah dari perdagangannya, seperti karet ban dan ban dalam, busi mobil, baterai (aki), perlengkapan lampu dan bagian-bagian kelistrikan.', 'kbli_45302', NULL, NULL),
(825, '45401', 'Perdagangan Besar Sepeda Motor Baru', 'Kelompok ini mencakup usaha perdagangan besar sepeda motor baru, termasuk motor sepeda atau moped.', 'kbli_45401', NULL, NULL),
(826, '45402', 'Perdagangan Besar Sepeda Motor Bekas', 'Kelompok ini mencakup usaha perdagangan besar sepeda motor bekas, termasuk motor sepeda atau moped.', 'kbli_45402', NULL, NULL),
(827, '45403', 'Perdagangan Eceran Sepeda Motor Baru', 'Kelompok ini mencakup usaha penjualan eceran sepeda motor baru, termasuk motor sepeda atau moped.', 'kbli_45403', NULL, NULL),
(828, '45404', 'Perdagangan Eceran Sepeda Motor Bekas', 'Kelompok ini mencakup usaha penjualan eceran sepeda motor bekas, termasuk motor sepeda atau moped.', 'kbli_45404', NULL, NULL),
(829, '45405', 'Perdagangan Besar Suku Cadang Sepeda Motor Dan Aksesorinya', 'Kelompok ini mencakup usaha perdagangan besar suku cadang sepeda motor dan aksesorinya.', 'kbli_45405', NULL, NULL),
(830, '45406', 'Perdagangan Eceran Suku Cadang Sepeda Motor Dan Aksesorinya', 'Kelompok ini mencakup usaha penjualan eceran suku cadang sepeda motor dan aksesorinya.', 'kbli_45406', NULL, NULL),
(831, '45407', 'Reparasi Dan Perawatan Sepeda Motor', 'Kelompok ini mencakup usaha pemeliharaan dan reparasi sepeda motor, termasuk pencucian sepeda motor dan usaha perawatan lainnya.', 'kbli_45407', NULL, NULL),
(832, '46100', 'Perdagangan Besar Atas Dasar Balas Jasa (Fee) Atau Kontrak', 'Kelompok ini mencakup usaha agen yang menerima komisi, perantara (makelar), pelelangan, dan pedagang besar lainnya yang memperdagangkan barang-barang di dalam negeri, luar negeri atas nama pihak lain. Kegiatannya antara lain agen komisi, broker barang dan seluruh perdagangan besar lainnya yang menjual atas nama dan tanggungan pihak lain; kegiatan yang terlibat dalam penjualan dan pembelian bersama atau melakukan transaksi atas nama perusahaan, termasuk melalui internet; dan agen yang terlibat dalam perdagangan seperti bahan baku pertanian, binatang hidup; bahan baku tekstil dan barang setengah jadi; bahan bakar, bijih-bijihan, logam dan industri kimia, termasuk pupuk; makanan, minuman dan tembakau; tekstil, pakaian, bulu, alas kaki dan barang dari kulit; kayu-kayuan dan bahan bangunan; mesin, termasuk mesin kantor dan komputer, perlengkapan industri, kapal, pesawat; furnitur, barang keperluan rumah tangga dan perangkat keras; kegiatan perdagangan besar rumah pelelangan; agen komisi zat radioaktif dan pembangkit radiasi pengion. Termasuk penyelenggara pasar lelang komoditas. Tidak termasuk kegiatan perdagangan besar mobil dan sepeda motor, dimasukkan dalam golongan 451 s.d. 454.', 'kbli_46100', NULL, NULL),
(833, '46201', 'Perdagangan Besar Padi Dan Palawija', 'Kelompok ini mencakup usaha perdagangan besar hasil pertanian tanaman padi dan palawija sebagai bahan baku atau bahan dasar dari suatu kegiatan berikutnya, seperti padi, jagung, gabah, gandum dan seralia lainnya. Termasuk perdagangan besar benih dan bibit padi, palawija, dan serealia lainnya.', 'kbli_46201', NULL, NULL),
(834, '46202', 'Perdagangan Besar Buah Yang Mengandung Minyak', 'Kelompok ini mencakup usaha perdagangan besar hasil pertanian tanaman buah yang mengandung minyak, seperti kelapa dan kelapa sawit. Termasuk perdagangan besar bibit buah yang mengandung minyak.', 'kbli_46202', NULL, NULL),
(835, '46203', 'Perdagangan Besar Bunga Dan Tanaman Hias', 'Kelompok ini mencakup usaha perdagangan besar hasil pertanian tanaman bunga dan tanaman hias lainnya, seperti tanaman bunga mawar, melati, tanaman hias dan tumbuhan lainnya. Termasuk bibit tanaman hias, bunga dan sebagainya.', 'kbli_46203', NULL, NULL),
(836, '46204', 'Perdagangan Besar Tembakau Rajangan', 'Kelompok ini mencakup usaha perdagangan besar hasil pertanian tanaman tembakau, seperti daun tembakau yang belum diolah dan tembakau rajangan dan sebagainya.', 'kbli_46204', NULL, NULL),
(837, '46205', 'Perdagangan Besar Binatang Hidup', 'Kelompok ini mencakup usaha perdagangan besar yang berhubungan dengan binatang hidup, seperti unggas, ternak potong dan ternak atau binatang hidup lainnya. Termasuk perdagangan besar bibit binatang.', 'kbli_46205', NULL, NULL),
(838, '46206', 'Perdagangan Besar Hasil Perikanan', 'Kelompok ini mencakup usaha perdagangan besar hasil perikanan sebagai bahan baku atau bahan dasar dari kegiatan berikutnya, seperti ikan, udang, kepiting, tiram, mutiara, kerang, rumput laut, bunga karang dan kodok, termasuk ikan hidup, ikan hias, serta bibit hasil perikanan.', 'kbli_46206', NULL, NULL),
(839, '46207', 'Perdagangan Besar Hasil Kehutanan Dan Perburuan', 'Kelompok ini mencakup usaha perdagangan besar hasil pengusahaan kehutanan, pengambilan hasil hutan dan perburuan, seperti bambu, kayu cendana, getah damar dan sejenisnya. Termasuk perdagangan besar bibit tanaman kehutanan.', 'kbli_46207', NULL, NULL),
(840, '46208', 'Perdagangan Besar Kulit Dan Kulit Jangat', 'Kelompok ini mencakup usaha perdagangan besar kulit dan kulit jangat, termasuk kulit imitasi.', 'kbli_46208', NULL, NULL),
(841, '46209', 'Perdagangan Besar Hasil Pertanian Dan Hewan Hidup Lainnya', 'Kelompok ini mencakup usaha perdagangan besar hasil pertanian dan hewan hidup lainnya yang belum diklasifikasikan di tempat lain. Termasuk dalam kelompok ini perdagangan besar bahan baku pertanian, sisaan dan sampah pertanian, dan hasil ikutan pertanian yang digunakan untuk makanan hewan, serta tanaman dan bibit tanaman lainnya yang belum disebutkan di atas.', 'kbli_46209', NULL, NULL),
(842, '46311', 'Perdagangan Besar Beras', 'Kelompok ini mencakup usaha perdagangan besar beras untuk digunakan sebagai konsumsi akhir.', 'kbli_46311', NULL, NULL),
(843, '46312', 'Perdagangan Besar Buah-buahan', 'Kelompok ini mencakup usaha perdagangan besar buah-buahan untuk digunakan sebagai konsumsi akhir, seperti jeruk, apel, pear, mangga dan buah lainnya.', 'kbli_46312', NULL, NULL),
(844, '46313', 'Perdagangan Besar Sayuran', 'Kelompok ini mencakup usaha perdagangan besar sayur-sayuran untuk digunakan sebagai konsumsi akhir, seperti bayam, kangkung, kol dan sayuran lainnya.', 'kbli_46313', NULL, NULL),
(845, '46314', 'Perdagangan Besar Kopi, Teh Dan Kakao', 'Kelompok ini mencakup usaha perdagangan besar kopi, teh dan kakao.', 'kbli_46314', NULL, NULL),
(846, '46315', 'Perdagangan Besar Minyak dan Lemak Nabati', 'Kelompok ini mencakup usaha perdagangan besar minyak dan lemak nabati, termasuk margarin serta produk berbahan dasar lemak nabati seperti non-dairy cream, dan produk sejenis lainnya.', 'kbli_46315', NULL, NULL),
(847, '46319', 'Perdagangan Besar Bahan Makanan Dan Minuman Hasil Pertanian Lainnya', 'Kelompok ini mencakup usaha perdagangan besar bahan makanan dan minuman hasil pertanian lainnya, seperti tanaman bumbu-bumbuan dan rempah-rempah.', 'kbli_46319', NULL, NULL),
(848, '46321', 'Perdagangan Besar Daging Sapi Dan Daging Sapi Olahan', 'Kelompok ini mencakup usaha perdagangan besar daging sapi dan daging sapi olahan, termasuk daging sapi yang diawetkan.', 'kbli_46321', NULL, NULL),
(849, '46322', 'Perdagangan Besar Daging Ayam Dan Daging Ayam Olahan', 'Kelompok ini mencakup usaha perdagangan besar daging ayam dan daging ayam olahan, termasuk daging ayam yang diawetkan.', 'kbli_46322', NULL, NULL),
(850, '46323', 'Perdagangan Besar Daging Dan Daging Olahan Lainnya', 'Kelompok ini mencakup usaha perdagangan besar daging dan daging olahan lainnya, termasuk daging lainnya yang diawetkan.', 'kbli_46323', NULL, NULL),
(851, '46324', 'Perdagangan Besar Hasil Olahan Perikanan', 'Kelompok ini mencakup usaha perdagangan besar pengolahan hasil perikanan.', 'kbli_46324', NULL, NULL),
(852, '46325', 'Perdagangan Besar Telur Dan Hasil Olahan Telur', 'Kelompok ini mencakup usaha perdagangan besar telur dan hasil olahan telur.', 'kbli_46325', NULL, NULL),
(853, '46326', 'Perdagangan Besar Susu Dan Produk Susu', 'Kelompok ini mencakup usaha perdagangan besar susu dan produk susu.', 'kbli_46326', NULL, NULL),
(854, '46327', 'Perdagangan Besar Minyak Dan Lemak Hewani', 'Kelompok ini mencakup usaha perdagangan besar minyak dan lemak hewani.', 'kbli_46327', NULL, NULL),
(855, '46329', 'Perdagangan Besar Bahan Makanan Dan Minuman Hasil Peternakan Dan Perikanan Lainnya', 'Subgolongan ini mencakup perdagangan besar bahan makanan dan minuman hasil peternakan dan perikanan yang belum tercakup dalam kelompok 46321 s.d 46327, seperti perdagangan besar madu hasil peternakan lebah, dan pemungutan madu hasil hutan.', 'kbli_46329', NULL, NULL),
(856, '46331', 'Perdagangan Besar Gula, Coklat Dan Kembang Gula', 'Kelompok ini mencakup usaha perdagangan besar gula, coklat, kembang gula dan sediaan pemanis.', 'kbli_46331', NULL, NULL),
(857, '46332', 'Perdagangan Besar Produk Roti', 'Kelompok ini mencakup usaha perdagangan besar produk roti, kue dan bakeri lainnya.', 'kbli_46332', NULL, NULL),
(858, '46333', 'Perdagangan Besar Minuman Beralkohol', 'Kelompok ini mencakup usaha perdagangan besar minuman beralkohol, seperti minuman keras, anggur, malt, bir dan lain-lain.', 'kbli_46333', NULL, NULL),
(859, '46334', 'Perdagangan Besar Minuman Non Alkohol Bukan Susu', 'Kelompok ini mencakup usaha perdagangan besar minuman non alkohol, seperti sari buah, jus, minuman ringan, air mineral, air kemasan, dan produk sejenis lainnya.', 'kbli_46334', NULL, NULL),
(860, '46335', 'Perdagangan Besar Rokok Dan Tembakau', 'Kelompok ini mencakup usaha perdagangan besar hasil pengolahan tembakau dan bumbu rokok, seperti rokok kretek dan rokok putih.', 'kbli_46335', NULL, NULL),
(861, '46339', 'Perdagangan Besar Makanan Dan Minuman Lainnya', 'Kelompok ini mencakup usaha perdagangan besar makanan dan minuman lainnya, seperti tepung beras, tepung tapioka, premiks bakeri, karamel, madu olahan, kerupuk udang dan lain-lain. Termasuk pangan untuk keperluan gizi khusus (untuk bayi, anak, dan dewasa), bahan tambahan pangan (food additive), bahan penolong (processing aid), makanan ringan lainnya, serealia dan produk berbasis serealia yang belum diolah maupun telah diolah, minuman produk kedelai, makanan siap saji, serta perdagangan besar makanan untuk hewan piaraan dan makanan ternak.', 'kbli_46339', NULL, NULL),
(862, '46411', 'Perdagangan Besar Tekstil', 'Kelompok ini mencakup usaha perdagangan besar hasil industri tekstil, seperti bermacam-macam tekstil/kain, kain batik dan lain-lain. Termasuk barang linen rumah tangga (bahan kain untuk keperluan rumah tangga) dan lain-lain.', 'kbli_46411', NULL, NULL),
(863, '46412', 'Perdagangan Besar Pakaian', 'Kelompok ini mencakup usaha perdagangan besar pakaian, termasuk pakaian olahraga dan perdagangan besar aksesoris pakaian seperti sarung tangan, dasi dan penjepit. Termasuk perdagangan besar kaos kaki.', 'kbli_46412', NULL, NULL),
(864, '46413', 'Perdagangan Besar Alas Kaki', 'Kelompok ini mencakup usaha perdagangan besar alas kaki, seperti sepatu, sandal, selop dan sejenisnya.', 'kbli_46413', NULL, NULL),
(865, '46414', 'Perdagangan Besar Barang Lainnya Dari Tekstil', 'Kelompok ini mencakup usaha perdagangan besar hasil industri tekstil, seperti tali-temali, karpet/permadani dari bahan tekstil, karung, macam-macam hasil rajutan dan barang jadi lainnya dari tekstil selain pakaian jadi.', 'kbli_46414', NULL, NULL),
(866, '46419', 'Perdagangan besar tekstil, pakaian dan alas kaki lainnya', 'Kelompok ini mencakup usaha perdagangan besar haberdashery, seperti jarum, benang jahit dan lain-lain, perdagangan besar barang dari kulit berbulu dan perdagangan besar payung.', 'kbli_46419', NULL, NULL),
(867, '46421', 'Perdagangan Besar Alat Tulis Dan Gambar', 'Kelompok ini mencakup usaha perdagangan besar peralatan tulis dan gambar, seperti buku tulis, buku gambar, alat tulis dan alat gambar.', 'kbli_46421', NULL, NULL),
(868, '46422', 'Perdagangan Besar Barang Percetakan Dan Penerbitan Dalam Berbagai Bentuk', 'Kelompok ini mencakup usaha perdagangan besar barang percetakan dan penerbitan dalam berbagai bentuk, seperti buku-buku, majalah, surat kabar dan lain-lain.', 'kbli_46422', NULL, NULL),
(869, '46430', 'Perdagangan Besar Alat Fotografi dan Barang Optik', 'Kelompok ini mencakup usaha perdagangan besar alat fotografi dan barang optik (seperti kaca mata, teropong dan kaca pembesar).', 'kbli_46430', NULL, NULL),
(870, '46441', 'Perdagangan Besar Obat Farmasi Untuk Manusia', 'Kelompok ini mencakup usaha perdagangan besar obat farmasi untuk keperluan rumah tangga, seperti obat-obatan dan suplemen kesehatan untuk manusia.', 'kbli_46441', NULL, NULL),
(871, '46442', 'Perdagangan Besar Obat Tradisional Untuk Manusia', 'Kelompok ini mencakup usaha perdagangan besar obat tradisional atau jamu dan suplemen kesehatan untuk manusia.', 'kbli_46442', NULL, NULL),
(872, '46443', 'Perdagangan Besar Kosmetik Untuk Manusia', 'Kelompok ini mencakup usaha perdagangan besar kosmetik untuk manusia seperti parfum, sabun, bedak dan lainnya.', 'kbli_46443', NULL, NULL),
(873, '46444', 'Perdagangan Besar Obat Farmasi Untuk Hewan', 'Kelompok ini mencakup usaha perdagangan besar obat farmasi untuk hewan yang meliputi kegiatan pemasukan, pengeluaran dan distribusi.', 'kbli_46444', NULL, NULL),
(874, '46445', 'Perdagangan Besar Obat Tradisional Untuk Hewan', 'Kelompok ini mencakup usaha perdagangan besar obat tradisional atau obat alami untuk hewan yang meliputi kegiatan pemasukan, pengeluaran dan distribusi.', 'kbli_46445', NULL, NULL),
(875, '46446', 'Perdagangan Besar Kosmetik Untuk Hewan', 'Kelompok ini mencakup usaha perdagangan besar kosmetik untuk hewan, termasuk parfum, shampo, sabun, bedak, krim atau lotion, dan lainnya, yang meliputi kegiatan pemasukan, pengeluaran dan distribusi.', 'kbli_46446', NULL, NULL),
(876, '46447', 'Perdagangan Besar Bahan Farmasi Untuk Manusia Dan Hewan', 'Kelompok ini mencakup usaha perdagangan besar bahan baku farmasi baik untuk manusia maupun hewan.', 'kbli_46447', NULL, NULL),
(877, '46448', 'Perdagangan Besar Bahan Baku Obat Tradisional Untuk Manusia Dan Hewan', 'Kelompok ini mencakup usaha perdagangan besar bahan baku obat tradisional baik untuk manusia maupun hewan.', 'kbli_46448', NULL, NULL),
(878, '46491', 'Perdagangan Besar Peralatan Dan Perlengkapan Rumah Tangga', 'Kelompok ini mencakup usaha perdagangan besar peralatan dan perlengkapan rumah tangga, seperti perabot rumah tangga (furniture), peralatan dapur dan memasak, lampu dan perlengkapannya, elektronik konsumen seperti radio, televisi, perekam dan pemutar CD dan DVD, perlengkapan stereo, konsol video game; alat penerangan, bermacam peralatan makan minum porselen dan gelas, peralatan sendok, pisau, garpu, peralatan dari kayu, barang dari anyaman dan barang dari gabus, karpet dan sebagainnya.', 'kbli_46491', NULL, NULL),
(879, '46492', 'Perdagangan Besar Alat Olahraga', 'Kelompok ini mencakup usaha perdagangan besar berbagai alat olahraga (termasuk sepeda dan bagian-bagiannya serta aksesorinya).', 'kbli_46492', NULL, NULL),
(880, '46493', 'Perdagangan Besar Alat Musik', 'Kelompok ini mencakup usaha perdagangan besar berbagai alat musik, baik alat musik tradisional maupun alat musik modern, seperti kecapi, seruling bambu, calung, angklung, kulintang, gamelan, set, rebab, rebana, tifa, sasando, seruling (flute), saxophone, harmonika, trombone, gitar, mandolin, ukulele, harpa, bass, gambus, biola, cello, piano/organ, drum set dan garpu tala.', 'kbli_46493', NULL, NULL),
(881, '46494', 'Perdagangan Besar Perhiasan Dan Jam', 'Kelompok ini mencakup usaha perdagangan besar berbagai barang perhiasan dan jam.', 'kbli_46494', NULL, NULL),
(882, '46495', 'Perdagangan Besar Alat Permainan Dan Mainan Anak-anak', 'Kelompok ini mencakup usaha perdagangan besar berbagai alat permainan dan mainan anak-anak baik permainan tradisional maupun modern seperti boardgame.', 'kbli_46495', NULL, NULL),
(883, '46499', 'Perdagangan Besar Berbagai Barang Dan Perlengkapan Rumah Tangga Lainnya Ytdl', 'Kelompok ini mencakup usaha perdagangan besar berbagai barang dan perlengkapan rumah tangga lainnya, seperti barang-barang dari kulit, koper, alat-alat pembersih dan sebagainya. Termasuk rekaman suara dan video dalam kaset, CD dan DVD, barang kimia untuk rumah tangga (deterjen, pembersih lantai dan lain-lain), serta alat peraga pendidikan.', 'kbli_46499', NULL, NULL),
(884, '46511', 'Perdagangan Besar Komputer dan Perlengkapan Komputer', 'Kelompok ini mencakup usaha perdagangan besar komputer dan pelengkapan komputer.', 'kbli_46511', NULL, NULL),
(885, '46512', 'Perdagangan Besar Piranti Lunak', 'Kelompok ini mencakup usaha perdagangan besar piranti lunak.', 'kbli_46512', NULL, NULL),
(886, '46521', 'Perdagangan Besar Suku Cadang Elektronik', 'Kelompok ini mencakup usaha perdagangan besar katup dan tabung elektronik, peralatan semi konduktor, mikrochip dan IC dan PCB.', 'kbli_46521', NULL, NULL),
(887, '46522', 'Perdagangan Besar Disket, Flash Drive, Pita Audio dan Video, CD dan DVD Kosong', 'Kelompok ini mencakup usaha perdagangan besar disket, flash drive, pita audio dan pita video kosong, CD dan DVD kosong.', 'kbli_46522', NULL, NULL),
(888, '46523', 'Perdagangan Besar Peralatan Telekomunikasi', 'Kelompok ini mencakup usaha perdagangan besar peralatan telekomunikasi, seperti perlengkapan telepon dan komunikasi. Termasuk peralatan penyiaran radio dan televisi.', 'kbli_46523', NULL, NULL),
(889, '46530', 'Perdagangan Besar Mesin, Peralatan Dan Perlengkapan Pertanian', 'Kelompok ini mencakup usaha perdagangan besar mesin, peralatan dan perlengkapan pertanian, seperti : bajak, penyebar pupuk, penanam biji, alat panen, alat penebah, mesin pemerah susu, mesin beternak unggas dan mesin beternak lebah dan traktor yang digunakan dalam pertanian dan kehutanan. Termasuk mesin pemotong rumput.', 'kbli_46530', NULL, NULL),
(890, '46591', 'Perdagangan Besar Mesin Kantor dan Industri Pengolahan, Suku Cadang Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan besar mesin industri dan mesin kantor kecuali komputer, serta perlengkapannya, seperti mesin pengolahan kayu dan logam, macam-macam mesin untuk industri dan untuk keperluan kantor. Termasuk perdagangan besar robot-robot produksi pengolahan, mesin-mesin lain ytdl untuk keperluan industri, dan mesin yang dikendalikan komputer untuk industri tekstil serta mesin jahit dan rajut yang dikendalikan komputer.', 'kbli_46591', NULL, NULL),
(891, '46592', 'Perdagangan Besar Alat Transportasi Laut, Suku Cadang Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan besar macam-macam alat transportasi laut bermotor ataupun tidak bermotor, termasuk usaha perdagangan besar macam-macam suku cadang dan perlengkapannya.', 'kbli_46592', NULL, NULL),
(892, '46593', 'Perdagangan Besar Alat Transportasi Darat (Bukan Mobil, Sepeda Motor, Dan Sejenisnya), Suku Cadang Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan besar macam-macam alat transportasi darat, bermotor ataupun tidak bermotor (bukan mobil, sepeda motor dan sejenisnya), termasuk usaha perdagangan besar macam-macam suku cadang dan perlengkapannya.', 'kbli_46593', NULL, NULL),
(893, '46594', 'Perdagangan Besar Alat Transportasi Udara, Suku Cadang Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan besar macam-macam alat transportasi udara, termasuk usaha perdagangan besar macam-macam suku cadang dan perlengkapannya.', 'kbli_46594', NULL, NULL),
(894, '46599', 'Perdagangan Besar Mesin, Peralatan Dan Perlengkapan Lainnya', 'Kelompok ini mencakup usaha perdagangan besar mesin dan peralatan serta perlengkapan yang belum diklasifikasikan dalam kelompok 46591 s.d. 46594, seperti mesin penggerak mula, turbin, mesin pembangkit listrik dan mesin untuk keperluan rumah tangga. Termasuk perdagangan besar robot-robot produksi selain untuk pengolahan, mesin-mesin lain ytdl untuk perdagangan dan navigasi serta jasa lainnya, perdagangan besar kabel dan sakelar serta instalasi peralatan lain, perkakas mesin berbagai jenis dan untuk berbagai bahan, perkakas mesin yang dikendalikan komputer dan peralatan dan perlengkapan pengukuran.', 'kbli_46599', NULL, NULL),
(895, '46610', 'Perdagangan Besar Bahan Bakar Padat, Cair Dan Gas Dan Produk YBDI', 'Kelompok ini mencakup usaha perdagangan besar bahan bakar gas, cair, dan padat serta produk sejenisnya, seperti minyak bumi mentah, minyak mentah, bahan bakar diesel, gasoline, bahan bakar oli, kerosin, premium, solar, minyak tanah, batu bara, arang, ampas arang batu, bahan bakar kayu, nafta, bahan bakar nabati (biofuels) dan bahan bakar lainnya termasuk pula bahan bakar gas (LPG, gas butana dan propana, dan lain-lain) dan minyak semir, minyak pelumas dan produk minyak bumi yang telah dimurnikan, serta bahan bakar nuklir.', 'kbli_46610', NULL, NULL),
(896, '46620', 'Perdagangan Besar Logam Dan Bijih Logam', 'Kelompok ini mencakup usaha perdagangan besar bijih logam dan logam dasar, seperti bijih besi dan bijih bukan besi dalam bentuk dasar, seperti bijih nikel, bijih tembaga, alumunium, besi, baja dan perdagangan besar produk logam besi dan bukan besi setengah jadi ytdl dan lain-lainnya. Termasuk perdagangan besar emas dan logam mulia lain (perak, platina).', 'kbli_46620', NULL, NULL),
(897, '46631', 'Perdagangan Besar Barang Logam Untuk Bahan Konstruksi', 'Kelompok ini mencakup usaha perdagangan besar berbagai macam baja/besi untuk bahan konstruksi seperti baja tulangan, baja profil, pelat baja, dan baja lembaran, pipa besi/baja, kawat tali, kawat nyamuk, paku, mur/baut, engsel, gerendel, kunci, anak kunci, tangki air, menara air, rolling door, awning dan seng lembaran.', 'kbli_46631', NULL, NULL),
(898, '46632', 'Perdagangan Besar Kaca', 'Kelompok ini mencakup usaha perdagangan besar kaca lembaran untuk bahan konstruksi, seperti kaca lembaran bening, kaca lembaran buram, kaca lembaran bening berwarna dan kaca lembaran berukir.', 'kbli_46632', NULL, NULL),
(899, '46633', 'Perdagangan Besar Genteng, Batu Bata, Ubin Dan Sejenisnya Dari Tanah Liat, Kapur, Semen Atau Kaca', 'Kelompok ini mencakup usaha perdagangan besar genteng, batu bata dan ubin yang terbuat dari tanah liat, kapur, semen atau kaca untuk bahan konstruksi, seperti genteng pres, genteng kodok, batu bata pres, batu bata berongga, bata tahan api, ubin lantai, ubin dinding, ubin batako, termasuk juga lubang angin, bak mandi, kloset, eternit, pipa irigasi dan buis.', 'kbli_46633', NULL, NULL),
(900, '46634', 'Perdagangan Besar Semen, Kapur, Pasir Dan Batu', 'Kelompok ini mencakup usaha perdagangan besar semen, kapur, pasir, dan batu untuk bahan konstruksi, seperti semen portland putih, semen portland abu-abu, semen posolan kapur, semen portland posolan, kapur tohor, kapur tembok, pasir, kerikil, koral, batu, batu pecahan, batu lempengan, batu pualam dan kubus mosaik.', 'kbli_46634', NULL, NULL),
(901, '46635', 'Perdagangan Besar Bahan Konstruksi Dari Porselen', 'Kelompok ini mencakup usaha perdagangan besar bahan konstruksi dari porselen, seperti kloset, bidet, wastafel, winoir, bak cuci, bak mandi dan ubin dinding.', 'kbli_46635', NULL, NULL),
(902, '46636', 'Perdagangan Besar Bahan Konstruksi Dari Kayu', 'Kelompok ini mencakup usaha perdagangan besar bahan konstruksi dari kayu, seperti papan, galar, papan reng, papan lis, tiang telepon, tiang listrik, balok bantalan, kusen pintu/jendela, daun pintu/jendela, ubin kayu, atap kayu (sirap), kayu lapis tripleks, kayu lapis interior, teak wood, particle board, chip board, kayu pelapis dan kayu lapis untuk cetak beton.', 'kbli_46636', NULL, NULL),
(903, '46637', 'Perdagangan Besar Cat', 'Kelompok ini mencakup usaha perdagangan besar berbagai macam cat untuk bahan konstruksi, seperti cat dasar, cat logam, cat kayu dan cat tembok. Termasuk juga perdagangan eceran email, dempul dan plamir.', 'kbli_46637', NULL, NULL),
(904, '46638', 'Perdagangan Besar Berbagai Macam Material Bangunan', 'Kelompok ini mencakup usaha perdagangan besar macam-macam material bangunan, seperti semen, pasir, paku, cat dan lain-lain.', 'kbli_46638', NULL, NULL),
(905, '46639', 'Perdagangan Besar Bahan Konstruksi Lainnya', 'Kelompok ini mencakup usaha perdagangan besar bahan konstruksi lainnya yang belum tercakup dalam kelompok 46631 s.d. 46638, seperti  wallpaper, pipa dan selang dari plastik, formika, plastik lembaran bergelombang, asbes semen rata, asbes semen berlapis dan pipa saluran asbes semen. Termasuk perdagangan besar pemanas air (water heater).', 'kbli_46639', NULL, NULL),
(906, '46641', 'Perdagangan Besar Mineral Bukan Logam', 'Kelompok ini mencakup usaha perdagangan besar mineral bukan logam seperti intan, korundum, grafit, arsen, pasir kuarsa, fluorspar, kriolit, yodium, brom, klor, belerang, fosfat, halit, asbes, talk, mika, magnesit, yarosit, oker, fluorit, ball clay, zeolit, kaolin, feldspar, bentonit, gipsum, dolomit, kalsit, rijang, pirofilit, kuarsit, zirkon, wolastonit, tawas, batu kuarsa, perlit, garam batu, clay, dan batu gamping untuk semen.', 'kbli_46641', NULL, NULL),
(907, '46642', 'Perdagangan Besar Mineral Radioaktif', 'Kelompok ini mencakup usaha perdagangan besar mineral radio aktif seperti radium, torium, uranium, monasit, dan bahan galian radioaktif lainnya.', 'kbli_46642', NULL, NULL),
(908, '46643', 'Perdagangan Besar Zat Radioaktif Dan Pembangkit Radiasi Pengion', 'Kelompok ini mencakup usaha perdagangan besar zat radioaktif dan pembangkit radiasi pengion.', 'kbli_46643', NULL, NULL),
(909, '46651', 'Perdagangan Besar Bahan Dan Barang Kimia', 'Kelompok ini mencakup usaha perdagangan besar bahan dan barang kimia dasar atau kimia industri, seperti tinta printer, minyak esensial, gas industri, perekat kimia, pewarna, resin buatan, metanol, parafin, perasa dan pewangi, soda, garam industri, asam dan sulfur dan lain-lain.', 'kbli_46651', NULL, NULL),
(910, '46652', 'Perdagangan Besar Pupuk Dan Produk Agrokimia', 'Kelompok ini mencakup usaha perdagangan besar pupuk dan produk agrokimia atau kimia pertanian.', 'kbli_46652', NULL, NULL),
(911, '46653', 'Perdagangan Besar Bahan Berbahaya (B2)', 'Kelompok ini mencakup usaha perdagangan besar bahan berbahaya (B2).', 'kbli_46653', NULL, NULL),
(912, '46654', 'Perdagangan Besar Bahan Berbahaya Dan Beracun (B3)', 'Kelompok ini mencakup usaha perdagangan besar bahan berbahaya dan beracun (B3).', 'kbli_46654', NULL, NULL),
(913, '46691', 'Perdagangan Besar Alat Laboratorium, Alat Farmasi Dan Alat Kedokteran Untuk Manusia', 'Kelompok ini mencakup usaha perdagangan besar alat laboratorium, alat farmasi dan alat kedokteran untuk manusia.', 'kbli_46691', NULL, NULL),
(914, '46692', 'Perdagangan Besar Alat Laboratorium, Alat Farmasi Dan Alat Kedokteran Untuk Hewan', 'Kelompok ini mencakup usaha perdagangan besar alat laboratorium, alat farmasi dan alat kedokteran untuk hewan yang meliputi kegiatan pemasukan, pengeluaran dan distribusi.', 'kbli_46692', NULL, NULL),
(915, '46693', 'Perdagangan Besar Karet Dan Plastik Dalam Bentuk Dasar', 'Kelompok ini mencakup usaha perdagangan besar karet dan bahan plastik dalam bentuk dasar.', 'kbli_46693', NULL, NULL),
(916, '46694', 'Perdagangan Besar Kertas Dan Karton', 'Kelompok ini mencakup usaha perdagangan besar kertas dan karton.', 'kbli_46694', NULL, NULL),
(917, '46695', 'Perdagangan Besar Barang Dari Kertas Dan Karton', 'Kelompok ini mencakup usaha perdagangan besar barang dari kertas dan karton.', 'kbli_46695', NULL, NULL),
(918, '46696', 'Perdagangan Besar Barang Bekas Dan Sisa-sisa Tak Terpakai (Scrap)', 'Kelompok ini mencakup usaha perdagangan besar barang bekas dan sisa-sisa tak terpakai dan potongan logam dan non-logam bahan untuk daur ulang, termasuk pengumpulan, pengurutan, pemisahan, pelepasan barang yang masih berguna misalnya mobil agar mendapatkan bagian yang masih bisa digunakan, pengepakan dan pengepakan kembali, penyimpanan dan pengiriman, tapi tanpa proses perubahan yang nyata. Dimana pembelian dan penjualan barang sisaan masih mempunyai nilai.', 'kbli_46696', NULL, NULL),
(919, '46699', 'Perdagangan Besar Produk Lainnya YTDL', 'Kelompok ini mencakup usaha perdagangan besar produk lainnya yang belum tercakup dalam salah satu kelompok  perdagangan besar diatas. Termasuk perdagangan besar serat atau fiber tekstil dan lain-lain, perdagangan besar batu mulia (berlian, intan, safir dan lain-lain).', 'kbli_46699', NULL, NULL),
(920, '46900', 'Perdagangan Besar Berbagai Macam Barang', 'Kelompok ini mencakup usaha perdagangan besar berbagai macam barang yang tanpa mengkhususkan barang tertentu (tanpa ada kekhususan tertentu) termasuk perkulakan.', 'kbli_46900', NULL, NULL),
(921, '47111', 'Perdagangan Eceran Berbagai Macam Barang Yang Utamanya Makanan, Minuman Atau Tembakau Di Minimarket/Supermarket/Hypermarket', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis barang kebutuhan yang utamanya bahan makanan/makanan, minuman atau tembakau dengan harga yang sudah ditentukan serta pembeli mengambil dan membayar sendiri kepada kasir (self service/swalayan). Disamping itu juga dapat menjual beberapa barang bukan makanan seperti perabot rumah tangga, mainan anak-anak, dan pakaian. Misalnya minimarket atau supermarket atau hypermarket.', 'kbli_47111', NULL, NULL),
(922, '47112', 'Perdagangan Eceran Berbagai Macam Barang Yang Utamanya Makanan, Minuman Atau Tembakau Bukan Di Minimarket/Supermarket/Hypermarket (Tradisional)', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis barang kebutuhan yang utamanya bahan makanan/makanan, minuman atau tembakau di dalam bangunan bukan swalayan/minimarket/supermarket/hypermarket. Disamping itu juga dapat menjual beberapa barang bukan makanan seperti pakaian, perabot rumah tangga, dan mainan anak. Misalnya warung atau toko bahan kebutuhan pokok.', 'kbli_47112', NULL, NULL),
(923, '47191', 'Perdagangan Eceran Berbagai Macam Barang Yang Utamanya Bukan Makanan, Minuman Atau Tembakau Di Toserba (Department Store)', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis barang yang utamanya bukan makanan, minuman atau tembakau dalam toserba (department store), yang terintegrasi di bawah satu pengelolaan. Pada umumnya barang-barang yang diperdagangkan antara lain pakaian, mebel, perhiasan, mainan anak-anak, alat-alat olahraga dan kosmetik.', 'kbli_47191', NULL, NULL),
(924, '47192', 'Perdagangan Eceran Berbagai Macam Barang Yang Utamanya Bukan Makanan, Minuman Atau Tembakau (barang-barang Kelontong) Bukan Di Toserba (Department Store)', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis barang yang utamanya bukan makanan, minuman atau tembakau bukan toserba/department store. Pada umumnya barang-barang yang diperdagangkan antara lain pakaian, perabot rumah tangga, perhiasan, mainan anak-anak dan kosmetik, yang terintegrasi di bawah satu pengelolaan. Misalnya toko barang kelontong.', 'kbli_47192', NULL, NULL),
(925, '47211', 'Perdagangan Eceran Padi Dan Palawija', 'Kelompok ini mencakup usaha perdagangan eceran khusus padi dan palawija, di dalam bangunan seperti gabah, jagung, ubi jalar, ubi kayu, talas, kacang kedelai, kacang tanah, kacang hitam dan kacang polong.', 'kbli_47211', NULL, NULL),
(926, '47212', 'Perdagangan Eceran Buah-buahan', 'Kelompok ini mencakup usaha perdagangan eceran khusus buah-buahan di dalam bangunan, seperti apel, anggur, alpokat, belimbing, duku, durian, jambu, jeruk, mangga, manggis, nanas, pisang, pepaya, rambutan, sawo, salak dan semangka.', 'kbli_47212', NULL, NULL),
(927, '47213', 'Perdagangan Eceran Sayuran', 'Kelompok ini mencakup usaha perdagangan eceran khusus sayuran di dalam bangunan, seperti bawang merah, bawang putih, kentang, wortel, terong, buncis, mentimun, labu siam, kacang panjang dan kacang merah.', 'kbli_47213', NULL, NULL),
(928, '47214', 'Perdagangan Eceran Hasil Peternakan', 'Kelompok ini mencakup usaha perdagangan eceran khusus hasil peternakan di dalam bangunan, seperti susu dan telur, termasuk pula daging ternak dan unggas.', 'kbli_47214', NULL, NULL),
(929, '47215', 'Perdagangan Eceran Hasil Perikanan', 'Kelompok ini mencakup usaha perdagangan eceran khusus hasil perikanan di dalam bangunan, seperti udang segar, ikan segar, cumi-cumi segar, nener (benih bandeng), benur (benih udang), benih ikan, dan rumput laut.', 'kbli_47215', NULL, NULL),
(930, '47216', 'Perdagangan Eceran Hasil Kehutanan dan Perburuan', 'Kelompok ini mencakup usaha perdagangan eceran khusus komoditi hasil hutan dan perburuan, seperti kijang, buah kenari, dan bambu muda (rebung).', 'kbli_47216', NULL, NULL),
(931, '47219', 'Perdagangan Eceran Hasil Pertanian Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus komoditi hasil pertanian yang belum tercakup dalam kelompok 47211 s.d. 47216 di dalam bangunan seperti lada, pala, kunyit, kencur, temulawak, lengkuas dan madu.', 'kbli_47219', NULL, NULL),
(932, '47221', 'Perdagangan Eceran Minuman Beralkohol', 'Kelompok ini mencakup usaha perdagangan eceran khusus minuman beralkohol didalam bangunan yang tidak langsung diminum di tempat, seperti minuman keras (whisky, genever, brandy, gin, arak, rum, sake, tuak), minuman anggur dan minuman yang mengandung malt (bir, ale, stout, temulawak).', 'kbli_47221', NULL, NULL),
(933, '47222', 'Perdagangan Eceran Minuman Tidak Beralkohol', 'Kelompok ini mencakup usaha perdagangan eceran khusus minuman tidak beralkohol di dalam bangunan yang tidak langsung diminum di tempat, seperti minuman ringan (limun, air soda, markisa, teh botol, air mineral dan beras kencur). Termasuk perdagangan eceran minuman kopi.', 'kbli_47222', NULL, NULL),
(934, '47230', 'Perdagangan Eceran Khusus Rokok dan Tembakau di Toko', 'Kelompok ini mencakup usaha perdagangan eceran khusus rokok dan atau tembakau di dalam bangunan seperti rokok kretek, rokok putih, rokok cerutu, rokok kelembak, tembakau krosok, tembakau susur dan tembakau pipa/papier.', 'kbli_47230', NULL, NULL),
(935, '47241', 'Perdagangan Eceran Beras', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai jenis beras di dalam bangunan, seperti beras cianjur, beras cisadane, beras saigon dan beras ketan.', 'kbli_47241', NULL, NULL),
(936, '47242', 'Perdagangan Eceran Roti, Kue Kering, serta Kue Basah dan Sejenisnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai jenis roti, kue kering dan kue basah di dalam bangunan, seperti roti manis, roti tawar, bolu, cake/tart, biskuit, wafer, kue semprong dan cookies.', 'kbli_47242', NULL, NULL),
(937, '47243', 'Perdagangan Eceran Kopi, Gula Pasir dan Gula Merah', 'Kelompok ini mencakup usaha perdagangan eceran khusus kopi,gula pasir atau gula merah di dalam bangunan.', 'kbli_47243', NULL, NULL),
(938, '47244', 'Perdagangan Eceran Tahu, Tempe, Tauco dan Oncom', 'Kelompok ini mencakup usaha perdagangan eceran khusus tahu, tempe, tauco dan oncom di dalam bangunan.', 'kbli_47244', NULL, NULL),
(939, '47245', 'Perdagangan Eceran Daging dan Ikan Olahan', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai jenis produk daging olahan dan ikan, udang, kerang yang diasinkan atau dikeringkan di dalam bangunan, seperti sosis, bakso, abon, ikan teri, cucut, selar, kerapu, udang, rebon, petek, gabus, sepat, cumi-cumi, kepah, remis, dan kerang.', 'kbli_47245', NULL, NULL),
(940, '47249', 'Perdagangan Eceran Makanan Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus komoditi makanan hasil industri yang belum tercakup dalam kelompok 47241 s.d 47245 di dalam bangunan seperti asinan buah-buahan dan sayuran, buah-buahan dan sayuran yang diawetkan, kerupuk dan emping/ceriping.', 'kbli_47249', NULL, NULL),
(941, '47301', 'Perdagangan Eceran Bahan Bakar Minyak, Bahan Bakar Gas (BBG), dan Liquefied Petroleum Gas (LPG) di Sarana Pengisian Bahan Bakar Transportasi Darat, Laut, dan Udara', 'Kelompok ini mencakup usaha perdagangan eceran bahan bakar minyak, bahan bakar gas, LPG, atau jenis bahan bakar lain di sarana pengisian bahan bakar untuk transportasi darat, laut, dan udara (seperti SPBU, SPBG dsb) untuk kendaraan bermotor seperti mobil dan sepeda motor (misalnya bensin, solar, BBG, dan LPG), termasuk pula bahan bakar untuk speed boat dan genset. Biasanya kegiatan ini dikombinasikan dengan penjualan bahan-bahan pelumas, cooling products, bahan-bahan pembersih dan barang-barang lain untuk keperluan mobil dan sepeda motor. Perdagangan besar bahan bakar dimasukkan dalam kelompok 46610. Perdagangan eceran LPG dan bahan bakar untuk keperluan memasak atau pemanas dimasukkan dalam kelompok 47772.', 'kbli_47301', NULL, NULL),
(942, '47302', 'Perdagangan Eceran Bahan Bakar Minyak, Bahan Bakar Gas (BBG), dan Liquefied Petroleum Gas (LPG) Selain Di Sarana Pengisian Bahan Bakar Transportasi Darat, Laut, dan Udara', 'Kelompok ini mencakup perdagangan eceran bahan bakar minyak, bahan bakar gas, LPG, atau jenis bahan bakar lain selain di sarana pengisian bahan bakar untuk transportasi darat, laut, dan udara (seperti agen BBM, agen LPG dsb). Perdagangan eceran bahan bakar untuk mobil dan sepeda motor di SPBU dimasukkan dalam kelompok 47301.', 'kbli_47302', NULL, NULL),
(943, '47303', 'Perdagangan Eceran Minyak Pelumas Di Toko', 'Kelompok ini mencakup usaha perdagangan eceran minyak pelumas di toko. Termasuk perdagangan eceran produk pendingin untuk mobil.', 'kbli_47303', NULL, NULL),
(944, '47411', 'Perdagangan Eceran Komputer Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran khusus macam-macam komputer, peralatan dan perlengkapannya.', 'kbli_47411', NULL, NULL),
(945, '47412', 'Perdagangan Eceran Peralatan Video Game Dan Sejenisnya', 'Kelompok  ini mencakup perdagangan eceran peralatan video game.', 'kbli_47412', NULL, NULL),
(946, '47413', 'Perdagangan Eceran Piranti Lunak (Software)', 'Kelompok ini mencakup usaha perdagangan eceran khusus piranti lunak (software), seperti bermacam piranti lunak, termasuk piranti lunak untuk video game.', 'kbli_47413', NULL, NULL),
(947, '47414', 'Perdagangan Eceran Alat Telekomunikasi', 'Kelompok ini mencakup usaha perdagangan eceran alat  telekomunikasi, seperti handphone, pesawat telepon dan perlengkapannya lainnya.', 'kbli_47414', NULL, NULL),
(948, '47415', 'Perdagangan Eceran Mesin Kantor', 'Kelompok ini mencakup usaha perdagangan eceran khusus mesin kantor selain komputer, seperti bermacam mesin tik, mesin hitung, cash register dan sejenisnya.', 'kbli_47415', NULL, NULL),
(949, '47420', 'Perdagangan Eceran Khusus Peralatan Audio dan Video di Toko', 'Kelompok ini mencakup usaha perdagangan eceran khusus peralatan audio dan video, seperti radio, televisi, video, tape recorder, audio amplifier dan cassete recorder. Termasuk peralatan stereo dan peralatan perekam dan pemutar CD dan DVD.', 'kbli_47420', NULL, NULL),
(950, '47511', 'Perdagangan Eceran Tekstil', 'Kelompok ini mencakup usaha perdagangan eceran khusus tekstil, seperti macam-macam kain terbuat dari serat alam, sintetis, maupun campuran, kain tenun (kain sarung katun, kain sarung polister, kain suiting sutera, kain suiting serat campuran), kain cetak (kain cetak kapas, kain cetak polyamida, kain kedap air), kain batik (kain batik tulis, kain batik cap, kain batik kombinasi tulis dan cap) dan kain rajut (kain rajut wol, kain rajut rayon, kain rajut wol/kapas). Termasuk perdagangan eceran bahan dasar untuk pembuatan permadani, permadani hiasan dinding dan bordiran atau sulaman.', 'kbli_47511', NULL, NULL),
(951, '47512', 'Perdagangan Eceran Perlengkapan Rumah Tangga Dari Tekstil', 'Kelompok ini mencakup usaha perdagangan eceran khusus perlengkapan rumah tangga dari tekstil, seperti taplak meja, seprei, sarung bantal, kelambu, kain kasur, kain bantal, kain pel, linen rumah tangga dan lain-lain.', 'kbli_47512', NULL, NULL),
(952, '47513', 'Perdagangan Eceran Perlengkapan Jahit Menjahit', 'Kelompok ini mencakup usaha perdagangan eceran khusus perlengkapan jahit menjahit, seperti benang dan jarum jahit.', 'kbli_47513', NULL, NULL),
(953, '47521', 'Perdagangan Eceran Barang Logam Untuk Bahan Konstruksi', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang logam untuk bahan konstruksi seperti baja tulangan, baja profil, pelat baja, dan baja lembaran, pipa besi/baja, kawat tali, kawat nyamuk, paku, mur/baut, engsel, gerendel, kunci, anak kunci, tangki air, menara air, rolling door, awning dan seng lembaran.', 'kbli_47521', NULL, NULL),
(954, '47522', 'Perdagangan Eceran Kaca', 'Kelompok ini mencakup usaha perdagangan eceran khusus kaca lembaran untuk bahan konstruksi, seperti kaca lembaran bening, kaca lembaran buram, kaca lembaran bening berwarna dan kaca lembaran berukir.', 'kbli_47522', NULL, NULL),
(955, '47523', 'Perdagangan Eceran Genteng, Batu Bata, Ubin Dan Sejenisnya Dari Tanah Liat, Kapur, Semen Atau Kaca', 'Kelompok ini mencakup usaha perdagangan eceran khusus genteng, batu bata dan ubin yang terbuat dari tanah liat, kapur, semen, atau gelas untuk bahan konstruksi, seperti genteng pres, genteng kodok, batu bata pres, batu bata berongga, bata tahan api, ubin lantai, ubin dinding, ubin batako, termasuk juga lubang angin, bak mandi, kloset, eternit, pipa irigasi dan buis.', 'kbli_47523', NULL, NULL),
(956, '47524', 'Perdagangan Eceran Semen, Kapur, Pasir Dan Batu', 'Kelompok ini mencakup usaha perdagangan eceran khusus semen, kapur, pasir dan batu untuk bahan konstruksi, seperti semen portland putih, semen portland abu-abu, semen posolan kapur, semen portland posolan, kapur tohor, kapur tembok, pasir, kerikil, koral, batu, batu pecahan, batu lempengan, batu pualam dan kubus mosaik.', 'kbli_47524', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(957, '47525', 'Perdagangan Eceran Bahan Konstruksi Dari Porselen', 'Kelompok ini mencakup usaha perdagangan eceran khusus bahan konstruksi dari porselen, seperti kloset, bidet, wastafel, winoir, bak cuci, bak mandi dan ubin dinding.', 'kbli_47525', NULL, NULL),
(958, '47526', 'Perdagangan Eceran Bahan Konstruksi Dari Kayu', 'Kelompok ini mencakup usaha perdagangan eceran khusus bahan konstruksi dari kayu, seperti papan, galar, papan reng, papan lis, tiang telepon, tiang listrik, balok bantalan, kusen pintu/jendela, daun pintu/jendela, ubin kayu, atap kayu (sirap), kayu lapis tripleks, kayu lapis interior, teak wood, particle board, chip board, kayu pelapis dan kayu lapis untuk cetak beton.', 'kbli_47526', NULL, NULL),
(959, '47527', 'Perdagangan Eceran Cat, Pernis Dan Lak', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai macam cat untuk bahan konstruksi, seperti cat dasar, cat logam, cat kayu dan cat tembok. Termasuk juga perdagangan eceran email, dempul, plamir dan pernis dan lak.', 'kbli_47527', NULL, NULL),
(960, '47528', 'Perdagangan Eceran Berbagai Macam Material Bangunan', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai macam material bangunan, seperti semen, pasir , paku, cat dan lain-lain.', 'kbli_47528', NULL, NULL),
(961, '47529', 'Perdagangan Eceran Bahan Dan Barang Konstruksi Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus bahan dan barang  konstruksi lainnya yang belum tercakup dalam kelompok 47521 s.d. 47528, seperti pipa dan selang dari plastik, formika, plastik lembaran bergelombang, asbes semen rata, asbes semen berlapis dan pipa saluran asbes semen. Termasuk perdagangan eceran pemotong rumput dan alat mandi uap.', 'kbli_47529', NULL, NULL),
(962, '47530', 'Perdagangan Eceran Khusus Karpet, Permadani dan Penutup Dinding dan Lantai di Toko', 'Kelompok ini mencakup usaha perdagangan eceran khusus karpet, permadani dan  penutup dinding dan lantai, termasuk keset kamar mandi, sajadah, karpet, tirai, gorden dan lain-lain.', 'kbli_47530', NULL, NULL),
(963, '47591', 'Perdagangan Eceran Furnitur', 'Kelompok ini mencakup usaha perdagangan eceran khusus furniture, seperti meja, kursi, lemari, tempat tidur, rak buku, rak sepatu dan bufet. Termasuk juga usaha perdagangan eceran khusus kasur dan bantal/guling.', 'kbli_47591', NULL, NULL),
(964, '47592', 'Perdagangan Eceran Peralatan Listrik Rumah Tangga Dan Peralatan Penerangan Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran khusus peralatan listrik rumah tangga dan perlengkapan penerangan, seperti mesin cuci, lemari es, kipas angin, alat pengisap debu, alat penggosok lantai, mixer, seterika listrik, blender, lampu pijar, lampu neon, starter, ballast, reflektor, kabel, sakelar, stop kontak, fiting dan sekering.', 'kbli_47592', NULL, NULL),
(965, '47593', 'Perdagangan Eceran Barang Pecah Belah Dan Perlengkapan Dapur Dari Plastik', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang pecah belah dan perlengkapan dapur yang terbuat dari plastik, seperti piring, pisin, mangkok, cangkir, teko, sendok, garpu, rantang, stoples, botol susu bayi, panci, baki, ember, termos dan jerigen.', 'kbli_47593', NULL, NULL),
(966, '47594', 'Perdagangan Eceran Barang Pecah Belah Dan Perlengkapan Dapur Dari Batu Atau Tanah Liat', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang pecah belah dan perlengkapan dapur yang terbuat dari batu atau tanah liat, seperti piring, mangkok, cangkir, teko, kendi, periuk, cobek, tempayan, lumpang, asbak dan uleg-uleg.', 'kbli_47594', NULL, NULL),
(967, '47595', 'Perdagangan Eceran Barang Pecah Belah Dan Perlengkapan Dapur Dari Kayu, Bambu Atau Rotan', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang pecah belah dan perlengkapan dapur yang terbuat dari kayu, bambu atau rotan, seperti rak bambu, alu, lesung, parutan kelapa, talenan, papan gilesan, centong, bakul, tampah, kukusan, kipas, tudung saji, tusukan sate dan gilingan daging.', 'kbli_47595', NULL, NULL),
(968, '47596', 'Perdagangan Eceran Barang Pecah Belah Dan Perlengkapan Dapur Bukan Dari Plastik, Batu, Tanah Liat, Kayu, Bambu Atau Rotan', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang pecah belah dan perlengkapan dapur yang terbuat bukan dari plastik, batu, tanah liat, kayu, bambu atau rotan, seperti piring, pisau, mangkok, cangkir, teko, sendok, garpu, rantang, stoples, botol susu bayi, panci, baki, termos, kompor gas dan kompor minyak tanah. Baik yang terbuat dari kaca atau dari logam atau bahan lainnya.', 'kbli_47596', NULL, NULL),
(969, '47597', 'Perdagangan Eceran Alat Musik', 'Kelompok ini mencakup usaha perdagangan eceran khusus alat musik, baik alat musik tradisional maupun alat musik modern, seperti kecapi, seruling bambu, calung, angklung, kulintang, gamelan, set, rebab, rebana, tifa, sasando, seruling (flute), saksophone, harmonika, trombone, gitar, mandolin, ukulele, harpa, bass, gambus, biola, cello, piano/organ, drum set dan garpu tala.', 'kbli_47597', NULL, NULL),
(970, '47599', 'Perdagangan Eceran Peralatan Dan Perlengkapan Rumah Tangga Lainnya YTDL', 'Kelompok ini mencakup usaha perdagangan eceran khusus peralatan dan perlengkapan rumah tangga lainnya dalam subgolongan 4759 yang tidak diklasifikasikan di tempat lain.', 'kbli_47599', NULL, NULL),
(971, '47611', 'Perdagangan Eceran Alat Tulis Menulis Dan Gambar', 'Kelompok ini mencakup usaha perdagangan eceran khusus alat tulis-menulis dan gambar, seperti pensil, pulpen, spidol, balpoin, sign pen, pensil mekanik, jangka, kuas gambar, rapido, crayon dan pastel, papan tulis, meja gambar, white board, alat-alat sablon, pita mesin tulis, cat air, cat minyak, karet penghapus, kayu penghapus, tip-ex, tinta, pengasah pensil, penggaris dan kapur tulis.', 'kbli_47611', NULL, NULL),
(972, '47612', 'Perdagangan Eceran Hasil Pencetakan Dan Penerbitan', 'Kelompok ini mencakup usaha perdagangan eceran khusus hasil pencetakan dan penerbitan, seperti faktur, nota, kuitansi, kartu nama, etiket, amplop, agenda, buku alamat, kartu ucapan, kartu pos, perangko, materai, album, buku tulis, buku gambar, kertas bergaris, kertas grafik, atlas, huruf braile, surat kabar, majalah, buletin, kamus, buku ilmu pengetahuan dan buku bergambar.', 'kbli_47612', NULL, NULL),
(973, '47620', 'Perdagangan Eceran Khusus Rekaman Musik dan Video di Toko', 'Kelompok ini mencakup usaha perdagangan eceran khusus rekaman musik dan video, seperti audio tape, CD dan kaset dan video tape dan DVD. Termasuk perdagangan eceran kaset dan CD/DVD kosong.', 'kbli_47620', NULL, NULL),
(974, '47630', 'Perdagangan Eceran Khusus Peralatan Olahraga di Toko', 'Kelompok ini mencakup usaha perdagangan eceran khusus peralatan olahraga, seperti berbagai macam bola, raket, jaring/net, stik, bat, peralatan panahan, peralatan pancing, peralatan anggar, peralatan terjun payung, sepatu roda/skate board, sarung tinju, halter, sepeda olahraga, perlengkapan catur, meja biliar, meja pingpong, perlengkapan golf, alat pengaman olahraga, matras, spring board, scoring board, dan ring tinju. Termasuk perdagangan eceran peralatan untuk kemah, perahu dan sepeda standard, sepeda balap dan sepeda mini.', 'kbli_47630', NULL, NULL),
(975, '47640', 'Perdagangan Eceran Khusus Alat Permainan dan Mainan Anak-anak di Toko', 'Kelompok ini mencakup usaha perdagangan eceran khusus alat permainan dan mainan anak-anak, seperti boneka, kelereng, bekel, congklak, scrable, karambol, mainan yang berupa alat musik, mobil-mobilan, mainan berupa senjata, mainan berupa alat memasak dan mainan berupa perabotan rumah tangga yang terbuat dari berbagai bahan.', 'kbli_47640', NULL, NULL),
(976, '47650', 'Perdagangan Eceran Kertas, Kertas Karton Dan Barang Dari Kertas/Karton', 'Kelompok ini mencakup usaha perdagangan eceran khusus kertas, karton dan barang dari kertas/karton, seperti kertas HVS, kertas doorslag, kertas kraft, kertas tipis, kertas kalkir, kertas berwarna, karton manila, karton buffalo skin, karton serat (fiber board), kertas pembungkus (wrapping), karton kemasan untuk makanan/minuman, kantong kertas, kertas/karton berlapis, kertas surat (stationary), stensil sheet, kertas karbon dan kertas duplikator.', 'kbli_47650', NULL, NULL),
(977, '47711', 'Perdagangan Eceran Pakaian', 'Kelompok ini mencakup usaha perdagangan eceran khusus pakaian, baik terbuat dari tekstil, kulit, maupun kulit buatan, seperti kemeja, celana, jas, mantel, jaket, piyama, kebaya, blus, rok, daster, singlet, kutang/BH, gaun, rok dalam, baju bayi, pakaian tari, pakaian adat, mukena dan jubah.', 'kbli_47711', NULL, NULL),
(978, '47712', 'Perdagangan Eceran Sepatu, Sandal Dan Alas Kaki Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus sepatu, sandal dan alas kaki lainnya baik terbuat dari kulit, kulit buatan, plastik, karet, kain maupun kayu, seperti sepatu laki-laki dewasa, sepatu perempuan dewasa, sepatu anak, sepatu olahraga, sepatu sandal, sandal, selop dan sepatu kesehatan.', 'kbli_47712', NULL, NULL),
(979, '47713', 'Perdagangan Eceran Pelengkap Pakaian', 'Kelompok ini mencakup usaha perdagangan eceran khusus pelengkap pakaian, seperti selendang, kerudung, sapu tangan, ikat kepala, blangkon, peci, topi, dasi, ikat pinggang, cadar, sarung tangan, kaos kaki, handuk dan selimut. Termasuk juga perdagangan eceran kancing baju, ritsleting dan lainnya.', 'kbli_47713', NULL, NULL),
(980, '47714', 'Perdagangan Eceran Tas, Dompet, Koper, Ransel Dan Sejenisnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus tas, dompet, koper, ransel dan sejenisnya baik terbuat dari kulit, kulit buatan, tekstil, plastik ataupun karet, seperti tas tangan, tas belanja, tas sekolah, tas surat, tas olahraga, dompet, kotak rias, sarung pedang/pisau, tempat kamera, tempat kaca mata dan kotak pensil. Termasuk perdagangan eceran payung.', 'kbli_47714', NULL, NULL),
(981, '47721', 'Perdagangan Eceran Barang Dan Obat Farmasi Untuk Manusia Di Apotik', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang farmasi dan obat-obatan untuk manusia yang berbentuk jadi (sediaan) di apotik, misalnya dalam bentuk tablet, kapsul, salep, bubuk, larutan, larutan parenteral dan suspensi, seperti obat-obat untuk penyakit kulit, mata, gigi, telinga, saluran pernapasan, saluran pencernaan, darah tinggi, kelainan hormon dan vitamin-vitamin serta suplemen kesehatan, termasuk juga barang keperluan kesehatan dari karet, antara lain kondom, alat sedot susu ibu, dot susu, kantong darah, sarung tangan untuk pembedahan, pipet karet, alat keluarga berencana dan sumbat karet untuk botol kecil (vial) farmasi.', 'kbli_47721', NULL, NULL),
(982, '47722', 'Perdagangan Eceran Barang Dan Obat Farmasi Untuk Manusia Bukan Di Apotik', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang farmasi dan obat-obatan untuk manusia yang berbentuk jadi (sediaan) bukan apotik, misalnya dalam bentuk tablet, kapsul, salep, larutan, larutan parenteral dan suspensi, seperti obat-obatan untuk penyakit kulit, mata, gigi, telinga, saluran pernapasan, saluran pencernaan, darah tinggi, kelainan hormon dan vitamin-vitamin serta suplemen kesehatan. Contohnya adalah toko obat.', 'kbli_47722', NULL, NULL),
(983, '47723', 'Perdagangan Eceran Obat Tradisional Untuk Manusia', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai macam jamu (obat tradisional) untuk manusia yang bahannya berasal dari tumbuh-tumbuhan, hewan atau mineral misalnya yang berbentuk pil, kapsul, bubuk dan bentuk cair di dalam bangunan.', 'kbli_47723', NULL, NULL),
(984, '47724', 'Perdagangan Eceran Kosmetik Untuk Manusia', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang-barang kosmetik untuk manusia, seperti kosmetik untuk tata rias muka (eye shadow, maskara, krim wajah, lipstik, lipliner); preparat wangi-wangian (cologne, toilet water, parfum), preparat rambut (sampo, tonik rambut, minyak rambut); preparat kuku (base coat, nail polish, nail cream, cuticle remover); preparat perawat kulit (baby oil, cleansing lotion, masker, krim kaki); preparat untuk kebersihan badan (deodoran semprot, deodoran krim, douches); preparat cukur (sabun cukur, shaving cream); kosmetik tradisional (bedak, mangir, lulur); kosmetik lainnya antara lain bedak badan, kapas kecantikan dan baby powder. Contohnya toko kosmetik.', 'kbli_47724', NULL, NULL),
(985, '47725', 'Perdagangan Eceran Alat Laboratorium, Alat Farmasi Dan Alat Kesehatan Untuk Manusia', 'Kelompok ini mencakup usaha perdagangan eceran khusus alat laboratorium, alat farmasi dan alat kesehatan untuk manusia, antara lain berbagai macam alat laboratorium dari gelas (tabung uji, tabung ukur, kaca sorong mikroskop, cuvet, botol serum/infus); alat laboratorium dari porselen (tabung kimia, piring penapis, lumpang dan alu, cawan); alat dan perlengkapan profesi kedokteran (instrumen dan pesawat bedah, instrumen dan pesawat perawatan gigi, aparat elektro medis, termometer, pengukuran tekanan darah).', 'kbli_47725', NULL, NULL),
(986, '47726', 'Perdagangan Eceran Barang Dan Obat Farmasi Untuk Hewan Di Apotik Dan Bukan Di Apotik', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang dan obat farmasi untuk hewan seperti obat-obatan yang berbentuk jadi (sediaan), misalnya dalam serbuk, tablet, kapsul, salep, bubuk, larutan, suspensi, aerosol, dan lainnya.', 'kbli_47726', NULL, NULL),
(987, '47727', 'Perdagangan Eceran Obat Tradisional Untuk Hewan', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai macam obat tradisional atau obat alami untuk hewan.', 'kbli_47727', NULL, NULL),
(988, '47728', 'Perdagangan Eceran Kosmetik Untuk Hewan', 'Kelompok ini mencakup usaha perdagangan eceran kosmetik untuk hewan, seperti parfum, shampo, sabun, bedak, krim atau lotion, dan lainnya.', 'kbli_47728', NULL, NULL),
(989, '47729', 'Perdagangan Eceran Khusus Barang Dan Obat Farmasi, Alat Kedokteran, Parfum Dan Kosmetik Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus lainnya yang belum tercakup dalam kelompok 47721 s.d. 47728, seperti bahan obat farmasi dan bahan baku obat tradisional (simplisia) untuk manusia dan hewan; serta alat laboratorium, alat farmasi, dan alat kesehatan untuk hewan antara lain berbagai macam alat laboratorium dari gelas (tabung uji, tabung ukur, kaca sorong mikroskop, cuvet, botol serum/infus); alat laboratorium dari porselen (tabung kimia, piring penapis, lumpang dan alu, cawan); alat dan perlengkapan profesi kedokteran hewan seperti (instrumen dan pesawat bedah, instrumen dan pesawat perawatan gigi, aparat elektro medis, termometer, pengukuran tekanan darah, dan lainnya), alat kesehatan hewan, dan alat-alat diagnosa medis, dan lainnya.', 'kbli_47729', NULL, NULL),
(990, '47731', 'Perdagangan Eceran Alat Fotografi Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran khusus alat fotografi dan perlengkapannya, seperti kamera foto, kamera sinematografi, proyektor sinematografi, pesawat rekam suara, pesawat reproduksi suara proyektor gambar, over head projector, aparat cahaya kilat fotografi, frame kamera, camera bodies, perlengkapan proyektor gambar dan cassete film transfer.', 'kbli_47731', NULL, NULL),
(991, '47732', 'Perdagangan Eceran Alat Optik Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran khusus alat optik dan perlengkapannya, seperti kaca mata pengelas, teropong monokuler, teropong binokuler, kaca pembesar, kaca pengintip, strereoskop dan mikroskop.', 'kbli_47732', NULL, NULL),
(992, '47733', 'Perdagangan Eceran Kaca Mata', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai macam kaca mata, seperti kaca mata pembantu penglihatan, kaca mata peredam sinar matahari/cahaya, lensa kontak (contact lens, soft lens) dan frame kaca mata.', 'kbli_47733', NULL, NULL),
(993, '47734', 'Perdagangan Eceran Jam', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai jam, seperti arloji tangan, arloji saku, jam dinding, jam beker, lonceng dan alat ukur waktu lainnya, termasuk perdagangan eceran bagian dari arloji dan jam.', 'kbli_47734', NULL, NULL),
(994, '47735', 'Perdagangan Eceran Barang Perhiasan', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang perhiasan baik terbuat dari batu mulia, berlian, intan, batu aji, serbuk dan bubuk intan, batu permata, batu permata tiruan, logam mulia ataupun bukan logam mulia, seperti  cincin, kalung, gelang, giwang (anting-anting), tusuk konde peniti, bross, ikat pinggang dan kancing dari logam mulia (platina, emas dan perak).', 'kbli_47735', NULL, NULL),
(995, '47736', 'Perdagangan Eceran Perlengkapan Pengendara Kendaraan Bermotor', 'Kelompok ini mencakup usaha perdagangan eceran perlengkapan pengendara kendaraan bermotor, seperti helm, jaket, jas hujan, sarung tangan, masker dan lain-lainnya.', 'kbli_47736', NULL, NULL),
(996, '47737', 'Perdagangan Eceran Pembungkus Dari Plastik', 'Golongan ini mencakup perdagangan eceran barang pembungkus dari plastik, seperti plastik kiloan, plastik sampah, kantong plastik dan barang pembungkus dari plastik lainnya.', 'kbli_47737', NULL, NULL),
(997, '47739', 'Perdagangan eceran khusus barang baru lainnya ytdl', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang baru lainnya yang tidak diklasifikasikan di tempat lain, seperti kegiatan perdagangan eceran bahan pembersih, senjata dan amunisi, perangko dan uang logam dan produk bukan makanan ytdl.', 'kbli_47739', NULL, NULL),
(998, '47741', 'Perdagangan Eceran Barang Bekas Perlengkapan Rumah Tangga', 'Kelompok ini mencakup usaha perdagangan eceran barang bekas perlengkapan rumah tangga, seperti meja bekas, kursi bekas, lemari bekas, tempat tidur bekas, bufet bekas dan perangkat untuk makan dan minum bekas. Perdagangan eceran mobil dan sepeda motor bekas dimasukkan dalam kelompok 45104 dan 45404.', 'kbli_47741', NULL, NULL),
(999, '47742', 'Perdagangan Eceran Pakaian, Alas Kaki Dan Pelengkap Pakaian Bekas', 'Kelompok ini mencakup usaha perdagangan eceran pakaian, alas kaki dan pelengkap pakaian bekas, seperti baju bekas, celana bekas, mantel bekas, sepatu bekas, selendang dan topi bekas.', 'kbli_47742', NULL, NULL),
(1000, '47743', 'Perdagangan Eceran Barang Perlengkapan Pribadi Bekas', 'Kelompok ini mencakup usaha perdagangan eceran barang perlengkapan pribadi bekas, seperti jam tangan bekas, jam dinding bekas dan barang perhiasan bekas.', 'kbli_47743', NULL, NULL),
(1001, '47744', 'Perdagangan Eceran Barang Listrik Dan Elektronik Bekas', 'Kelompok ini mencakup usaha perdagangan eceran barang listrik dan elektronik bekas, seperti radio bekas, tape recorder bekas, televisi bekas, mesin cuci bekas, seterika listrik bekas dan pengering/pengeriting rambut bekas.', 'kbli_47744', NULL, NULL),
(1002, '47745', 'Perdagangan Eceran Bahan Konstruksi Dan Sanitasi Bekas', 'Kelompok ini mencakup usaha perdagangan eceran bahan konstruksi dan sanitasi bekas, seperti wastafel bekas, kloset bekas dan bak air bekas.', 'kbli_47745', NULL, NULL),
(1003, '47746', 'Perdagangan Eceran Barang Antik', 'Kelompok ini mencakup usaha perdagangan eceran barang-barang antik, seperti guci bekas, bokor bekas, lampu gantung bekas dan meja/kursi marmer bekas.', 'kbli_47746', NULL, NULL),
(1004, '47749', 'Perdagangan Eceran Barang Bekas Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran barang bekas lainnya yang belum tercakup dalam kelompok 47741 s.d. 47746.', 'kbli_47749', NULL, NULL),
(1005, '47751', 'Perdagangan Eceran Hewan Piaraan (Pet Animals)', 'Kelompok ini mencakup usaha perdagangan eceran hewan piaraan, seperti kucing, anjing, ular, kelinci, biawak, dan lain-lain, misalnya pet shop.', 'kbli_47751', NULL, NULL),
(1006, '47752', 'Perdagangan Eceran Hewan Ternak', 'Kelompok ini mencakup usaha perdagangan eceran hewan ternak, seperti sapi, kambing, dan unggas.', 'kbli_47752', NULL, NULL),
(1007, '47753', 'Perdagangan Eceran Ikan Hias', 'Kelompok ini mencakup usaha perdagangan eceran benih ikan hias dan ikan hias. Perdagangan ikan olahan dari perikanan masuk di kelompok 47245.', 'kbli_47753', NULL, NULL),
(1008, '47754', 'Perdagangan Eceran Pakan Ternak/Unggas/Ikan dan Hewan Piaraan', 'Kelompok ini mencakup usaha perdagangan eceran khusus pakan ternak/unggas/ikan dan makanan hewan piaraan di dalam bangunan, seperti ransum pakan ternak/unggas/ikan, konsentrat pakan ternak/unggas/ikan, tepung tulang, tepung darah dan tepung kerang.', 'kbli_47754', NULL, NULL),
(1009, '47761', 'Perdagangan Eceran Bunga Potong/Florist', 'Kelompok ini mencakup usaha perdagangan eceran bunga potong/florist.', 'kbli_47761', NULL, NULL),
(1010, '47762', 'Perdagangan Eceran Tanaman Dan Bibit Tanaman', 'Kelompok ini mencakup usaha perdagangan eceran khusus tanaman dan biji benih/bibit tanaman. Termasuk perdagangan eceran tanaman obat dan tanaman hias, seperti anggrek, mawar, melati, sedap malam dan bibit tanaman hias/obat.', 'kbli_47762', NULL, NULL),
(1011, '47763', 'Perdagangan Eceran Pupuk Dan Pemberantas Hama', 'Kelompok ini mencakup usaha perdagangan eceran khusus berbagai macam pupuk dan pemberantas hama, seperti pupuk buatan tunggal (urea, ZA, TSP, DSP), pupuk buatan majemuk dan campuran (mono amonium fosfat, diamonium fosfat, nitrogen fosfat kalium), pupuk alam (pupuk kompos, pupuk dolomit, pupuk kapur), insektisida, fungisida, rodentisida, herbisida, nematisida dan akarisida.', 'kbli_47763', NULL, NULL),
(1012, '47764', 'Perdagangan Eceran Perlengkapan Dan Media Tanaman Hias', 'Kelompok ini mencakup usaha perdagangan eceran perlengkapan tanaman hias, seperti pot, media tanam, dan lainnya.', 'kbli_47764', NULL, NULL),
(1013, '47771', 'Perdagangan Eceran Minyak Tanah', 'Kelompok ini mencakup usaha perdagangan eceran khusus minyak tanah.', 'kbli_47771', NULL, NULL),
(1014, '47772', 'Perdagangan Eceran Gas Elpiji', 'Kelompok ini mencakup usaha perdagangan eceran khusus gas elpiji.', 'kbli_47772', NULL, NULL),
(1015, '47773', 'Perdagangan Eceran Bahan Kimia', 'Kelompok ini mencakup usaha perdagangan eceran khusus bahan kimia di dalam bangunan, seperti soda kostik, soda abu, kalium hidroksida, amoniak, argon, bahan pewarna, bahan pengawet, bahan untuk pestisida, pelarut dan eter.', 'kbli_47773', NULL, NULL),
(1016, '47774', 'Perdagangan Eceran Aromatik/Penyegar (Minyak Atsiri)', 'Kelompok ini mencakup usaha perdagangan eceran khusus aromatik/penyegar minyak atsiri, seperti minyak kenanga, minyak sereh, minyak kayu putih, minyak cendana, minyak lawang, minyak tengkawang, minyak gandapura, minyak jarak, minyak kapulaga, minyak pala, minyak delas dan minyak akar wangi.', 'kbli_47774', NULL, NULL),
(1017, '47779', 'Perdagangan Eceran Bahan Kimia, dan Aromatik/Penyegar (Minyak Atsiri), Dan Bahan Bakar Bukan Bahan Bakar Untuk Kendaraan Bermotor Lainnnya', 'Kelompok ini mencakup usaha perdagangan eceran lainnya yang tidak tercakup dalam kelompok 47771 s.d. 47774, seperti gelatin, bahan isolasi panas selain plastik dan karet, bahan semir, kapur barus.', 'kbli_47779', NULL, NULL),
(1018, '47781', 'Perdagangan Eceran Barang Kerajinan Dari Kayu, Bambu, Rotan, Pandan, Rumput Dan Sejenisnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang kerajinan dari kayu, bambu, rotan, pandan, rumput dan sejenisnya, seperti patung, topeng, relief, ukiran nama, wayang, pigura, kap lampu, bingkai, talam/baki, tas, keranjang, tikar, topi/tudung, kerai, hiasan dinding dan keset. Termasuk kegiatan galeri kesenian yang menjual barang kerajinan tersebut.', 'kbli_47781', NULL, NULL),
(1019, '47782', 'Perdagangan Eceran Barang Kerajinan Dari Kulit, Tulang, Tanduk, Gading, Bulu Dan Binatang/Hewan Yang Diawetkan', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang kerajinan dari kulit, tulang, tanduk, bulu dan binatang/hewan yang diawetkan, seperti kipas dari kulit penyu, karangan bunga dari kulit kerang, pipa rokok dari tulang, pajangan dari tanduk, pajangan dari gading, pajangan dari bulu burung merak dan binatang/hewan yang diawetkan. Termasuk kegiatan galeri kesenian yang menjual barang kerajinan tersebut.', 'kbli_47782', NULL, NULL),
(1020, '47783', 'Perdagangan Eceran Barang Kerajinan Dari Logam', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang kerajinan dari logam, seperti vas bunga, patung, tempat lilin, piala, medali dan gantungan kunci. Termasuk kegiatan galeri kesenian yang menjual barang kerajinan tersebut.', 'kbli_47783', NULL, NULL),
(1021, '47784', 'Perdagangan Eceran Barang Kerajinan Dari Keramik', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang kerajinan dari keramik, seperti patung, vas bunga, asbak, tempat sirih, celengan dan pot bunga. Termasuk kegiatan galeri kesenian yang menjual barang kerajinan tersebut.', 'kbli_47784', NULL, NULL),
(1022, '47785', 'Perdagangan Eceran Lukisan', 'Kelompok ini mencakup usaha perdagangan eceran khusus lukisan, seperti lukisan orang, lukisan binatang dan lukisan pemandangan. Termasuk kegiatan galeri kesenian yang menjual lukisan.', 'kbli_47785', NULL, NULL),
(1023, '47789', 'Perdagangan Eceran Barang Kerajinan Dan Lukisan Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran khusus barang-barang kerajinan dan lukisan lainnya yang belum tercakup dalam kelompok 47781 s.d. 47785. Termasuk kegiatan galeri kesenian yang menjual barang kerajinan tersebut.', 'kbli_47789', NULL, NULL),
(1024, '47791', 'Perdagangan Eceran Mesin Pertanian Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran khusus mesin pertanian dan perlengkapannya, seperti traktor, mesin bajak, mesin pemupuk, mesin semai, mesin penanam, mesin penugal, mesin potong rumput, mesin penyemprot, mesin pengupas, mesin perontok, rice milling unit, mesin perah susu, serta komponen dan suku cadang mesin pertanian.', 'kbli_47791', NULL, NULL),
(1025, '47792', 'Perdagangan Eceran Mesin Jahit Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran khusus mesin jahit dan perlengkapannya, seperti mesin jahit tangan/kaki, mesin jahit listrik, mesin obras, mesin bordir, mesin oversum, serta komponen dan suku cadang mesin jahit.', 'kbli_47792', NULL, NULL),
(1026, '47793', 'Perdagangan Eceran Mesin Lainnya Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran khusus mesin lainnya yang belum terliput dalam kelompok 47791 dan 47792, seperti mesin pembangkit tenaga listrik/generator, mesin las, mesin giling kopi, mesin giling tepung, mesin gergaji, mesin bubut, turbin, kincir, mesin tenun, mesin rajut, dan mesin cetak.', 'kbli_47793', NULL, NULL),
(1027, '47794', 'Perdagangan Eceran Alat Transportasi Darat Tidak Bermotor Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran khusus alat transportasi darat tidak bermotor, seperti sepeda khusus untuk orang cacat, becak, pedati, gerobak, sado, kereta dorong, serta komponen dan perlengkapannya.', 'kbli_47794', NULL, NULL),
(1028, '47795', 'Perdagangan Eceran Alat Transportasi Air Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran alat transportasi air (bermotor atau tidak), seperti perahu dan sampan, beserta komponen dan perlengkapannya.', 'kbli_47795', NULL, NULL),
(1029, '47796', 'Perdagangan Eceran Alat-alat Pertanian', 'Kelompok ini mencakup usaha perdagangan eceran khusus alat-alat pertanian, seperti cangkul, bajak, sabit, linggis, alat perontok padi bukan mesin.', 'kbli_47796', NULL, NULL),
(1030, '47797', 'Perdagangan Eceran Alat-alat Pertukangan', 'Kelompok ini mencakup usaha perdagangan eceran alat-alat pertukangan, seperti pahat, gergaji, obeng, tang, palu, ketam, kampak.', 'kbli_47797', NULL, NULL),
(1031, '47811', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Komoditi Padi Dan Palawija', 'Kelompok ini mencakup usaha perdagangan eceran padi dan palawija, yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti gabah, jagung, ubi jalar, ubi kayu, talas, kacang kedelai, kacang tanah, kacang hitam dan kacang polong.', 'kbli_47811', NULL, NULL),
(1032, '47812', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Komoditi Buah-buahan', 'Kelompok ini mencakup usaha perdagangan eceran buah-buahan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti apel, anggur, alpokat, belimbing, duku, durian, mangga dan lain-lain.', 'kbli_47812', NULL, NULL),
(1033, '47813', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Komoditi Sayur-sayuran', 'Kelompok ini mencakup usaha perdagangan eceran sayur-sayuran yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti bawang merah, bawang putih, kentang, wortel, terong, buncis, mentimun, labu siam, kacang panjang dan kacang merah.', 'kbli_47813', NULL, NULL),
(1034, '47814', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Komoditi Hasil Peternakan', 'Kelompok ini mencakup usaha perdagangan eceran hasil peternakan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti susu dan telur, daging ternak dan unggas.', 'kbli_47814', NULL, NULL),
(1035, '47815', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Komoditi Hasil Perikanan', 'Kelompok ini mencakup usaha perdagangan eceran hasil perikanan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti udang segar, ikan segar, cumi-cumi segar, ikan hias, nener, benur, benih ikan dan rumput laut.', 'kbli_47815', NULL, NULL),
(1036, '47816', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Komoditi Hasil Kehutanan Dan Perburuan', 'Kelompok ini mencakup usaha perdagangan eceran komoditi hasil kehutanan dan perburuan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti kayu bakar, bambu, kayu cendana, getah damar dan sejenisnya.', 'kbli_47816', NULL, NULL),
(1037, '47819', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Komoditi Tanaman Hias Dan Hasil Pertanian Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran tanaman hias dan hasil pertanian lainnya yang belum tercakup dalam kelompok 47811 s.d. 47816 yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti anggrek, mawar, melati sedap malam, tanaman hias lainnya dan bibit tanaman hias, bibit buah-buahan dan obat-obatan.', 'kbli_47819', NULL, NULL),
(1038, '47821', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Beras', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis beras yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti beras cianjur, beras cisadane, beras saigon, beras ketan dan lain-lain.', 'kbli_47821', NULL, NULL),
(1039, '47822', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Roti, Kue Kering, Kue Basah Dan Sejenisnya', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis roti, kue kering dan kue basah yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti roti manis, roti tawar, bolu, cake/tart, biskuit, wafer, kue semprong dan cookies.', 'kbli_47822', NULL, NULL),
(1040, '47823', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Kopi, Gula Pasir, Gula Merah Dan Sejenisnya', 'Kelompok ini mencakup usaha perdagangan eceran kopi, gula pasir, gula merah dan teh yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47823', NULL, NULL),
(1041, '47824', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Tahu, Tempe, Tauco Dan Oncom', 'Kelompok ini mencakup usaha perdagangan eceran tahu, tempe, tauco dan oncom yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47824', NULL, NULL),
(1042, '47825', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Daging Olahan Dan Ikan Olahan', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis daging olahan dan ikan olahan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti abon, sosis, bakso, ikan teri, cucut, selar, kerapu dan ikan, udang, kerang yang diasinkan/dikeringkan.', 'kbli_47825', NULL, NULL),
(1043, '47826', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Minuman', 'Kelompok ini mencakup usaha perdagangan eceran  berbagai minuman yang tidak langsung diminum di tempat,  yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti minuman keras (whisky, genever, brandy, gin, arak, rum, sake, tuak), minuman anggur; minuman yang mengandung malt (bir, ale, stout, temulawak) dan minuman ringan (limun, air soda, markisa, teh botol, air mineral dan beras kencur).', 'kbli_47826', NULL, NULL),
(1044, '47827', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Rokok Dan Tembakau', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis rokok dan tembakau yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti tembakau krosok, tembakau susur dan tembakau pipa (papier), rokok (putih atau kretek).', 'kbli_47827', NULL, NULL),
(1045, '47828', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Pakan Ternak, Pakan Unggas Dan Pakan Ikan', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis pakan ternak/unggas/ikan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti  ransum pakan ternak/unggas/ikan, konsentrat pakan ternak/unggas/ikan, tepung tulang, tepung darah dan tepung kerang.', 'kbli_47828', NULL, NULL),
(1046, '47829', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Komoditi Makanan Dan Minuman Ytdl', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis makanan dan minuman lainnya yang belum tercakup pada kelompok 47821 s.d. 47828 yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti asinan buah-buahan dan sayuran, kerupuk dan emping/ceriping.', 'kbli_47829', NULL, NULL),
(1047, '47831', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Tekstil', 'Kelompok ini mencakup usaha perdagangan eceran macam-macam tekstil atau kain baik terbuat dari serat alam, sintetis, maupun campuran yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti kain tenun (kain sarung katun, kain sarung polister, kain suiting sutera, kain suiting serat campuran), kain cetak (kain cetak kapas, kain cetak polyamida, kain kedap air), kain batik (kain batik tulis, kain batik cap, kain batik kombinasi tulis dan cap) dan kain rajut (kain rajut wol, kain rajut rayon, kain rajut wol/kapas).', 'kbli_47831', NULL, NULL),
(1048, '47832', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Pakaian', 'Kelompok ini mencakup usaha perdagangan eceran macam-macam pakaian baik terbuat dari tekstil, kulit, maupun kulit buatan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti kemeja, celana, jas, mantel, jaket, piyama, kebaya, blus, rok, daster, singlet, kutang/BH, gaun, rok dalam, baju bayi, pakaian tari, pakaian adat, mukena dan jubah.', 'kbli_47832', NULL, NULL),
(1049, '47833', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Sepatu, Sandal Dan Alas Kaki Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam sepatu, sandal, selop dan alas kaki lainnya baik terbuat dari kulit, kulit buatan, plastik, karet, kain ataupun kayu yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti sepatu laki-laki dewasa, sepatu perempuan dewasa, sepatu anak, sepatu olahraga, sepatu sandal, sandal, selop dan sepatu kesehatan.', 'kbli_47833', NULL, NULL),
(1050, '47834', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Pelengkap Pakaian Dan Benang', 'Kelompok ini mencakup usaha perdagangan eceran pelengkap pakaian dan benang yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar),  seperti selendang, kerudung, sapu tangan, ikat kepala, blangkon, peci, topi, dasi, ikat pinggang, cadar, sarung tangan, handuk, dan selimut. Termasuk juga perdagangan eceran kancing baju, risleting dan benang jahit.', 'kbli_47834', NULL, NULL),
(1051, '47841', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Bahan Kimia', 'Kelompok ini mencakup usaha perdagangan eceran bahan kimia yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti soda kostik, soda abu, kalium hidroksida, amoniak, argon, bahan pewarna, bahan pengawet, bahan untuk pestisida, pelarut dan eter.', 'kbli_47841', NULL, NULL),
(1052, '47842', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Farmasi', 'Kelompok ini mencakup usaha perdagangan eceran farmasi atau obat-obatan yang berbentuk jadi (sediaan), misalnya dalam bentuk tablet, kapsul, salep, bubuk, larutan, larutan parenteral dan suspensi yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti obat-obat untuk penyakit kulit, mata, gigi, telinga, saluran pernapasan, saluran pencernaan, darah tinggi, kelainan hormon dan vitamin-vitamin, termasuk juga barang keperluan kesehatan dari karet, antara lain kondom, alat sedot susu ibu, dot susu, kantong darah, sarung tangan untuk pembedahan, pipet karet, alat keluarga berencana dan sumbat karet untuk botol kecil (vial) farmasi.', 'kbli_47842', NULL, NULL),
(1053, '47843', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Obat Tradisional', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam jamu (obat tradisional) yang bahannya berasal dari tumbuh-tumbuhan, hewan atau mineral misalnya yang berbentuk pil, kapsul, bubuk, dan bentuk cair yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar),', 'kbli_47843', NULL, NULL),
(1054, '47844', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Kosmetik', 'Kelompok ini mencakup usaha perdagangan eceran barang kosmetik yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti kosmetik untuk tata rias muka (eye shadow, maskara, krim wajah, lipstik, lipliner), preparat wangi-wangian (cologne, toilet water, parfum), preparat rambut (sampo, tonik rambut, minyak rambut), preparat kuku (base coat, nail polish, nail cream, cuticle remover), preparat perawat kulit (baby oil, cleansing lotion, masker, krim kaki), preparat untuk kebersihan badan (deodoran semprot, deodoran krim, douches), preparat cukur (sabun cukur, shaving cream), kosmetik tradisional (bedak, mangir, lulur) dan kosmetik lainnya antara lain bedak badan, kapas kecantikan dan baby powder.', 'kbli_47844', NULL, NULL),
(1055, '47845', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Pupuk Dan Pemberantas Hama', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam pupuk dan pemberantas hama  yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti pupuk buatan tunggal (urea, ZA, TSP, DSP), pupuk buatan majemuk dan campuran (mono amonium fosfat, diamonium fosfat, nitrogen fosfat kalium), pupuk alam (pupuk kompos, pupuk dolomit, pupuk kapur), insektisida, fungisida, rodentisida, herbisida, nematisida dan akarisida.', 'kbli_47845', NULL, NULL),
(1056, '47846', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Aromatik/Penyegar (Minyak Atsiri)', 'Kelompok ini mencakup usaha perdagangan eceran aromatik/penyegar (minyak atsiri) yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti minyak kenanga, minyak sereh, minyak kayu putih, minyak cendana, minyak lawang, minyak tengkawang, minyak gandapura, minyak jarak, minyak kapulaga, minyak pala, minyak delas dan minyak akar wangi.', 'kbli_47846', NULL, NULL),
(1057, '47849', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Bahan Kimia, Farmasi, Kosmetik Dan Alat Laboratorium dan Ybdi Ytdl', 'Kelompok ini mencakup usaha perdagangan eceran kaki lima dan los pasar lainnya yang belum tercakup dalam kelompok 47841 s.d. 47846, seperti gelatin, bahan isolasi panas selain plastik dan karet, bahan semir, kapur barus dan bahan jamu (simplisia).', 'kbli_47849', NULL, NULL),
(1058, '47851', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Kaca Mata', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam kaca mata yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti kaca mata pembantu penglihatan, kaca mata peredam sinar matahari/cahaya, lensa kontak (contact lens, soft lens) dan frame kaca mata.', 'kbli_47851', NULL, NULL),
(1059, '47852', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Perhiasan', 'Kelompok ini mencakup usaha perdagangan eceran barang perhiasan baik terbuat dari batu mulia, batu permata, batu permata tiruan, berlian, intan, batu aji, serbuk dan bubuk intan, logam mulia ataupun bukan logam mulia yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti cincin, kalung, gelang, giwang (anting-anting), tusuk konde peniti, bross, ikat pinggang dan kancing dari logam mulia (platina, emas dan perak).', 'kbli_47852', NULL, NULL),
(1060, '47853', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Jam', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam jam yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti arloji tangan, arloji saku, jam dinding, jam beker, lonceng dan alat ukur waktu lainnya, termasuk juga bagian dari arloji dan jam.', 'kbli_47853', NULL, NULL),
(1061, '47854', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Tas, Dompet, Koper, Ransel Dan Sejenisnya', 'Kelompok ini mencakup usaha perdagangan eceran tas, dompet, koper, ransel dan sejenisnya baik terbuat dari kulit, kulit buatan, tekstil, plastik ataupun karet yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti tas tangan, tas belanja, tas sekolah, tas surat, tas olahraga, dompet, kotak rias, sarung pedang/pisau, tempat kamera, tempat kaca mata dan kotak pen.', 'kbli_47854', NULL, NULL),
(1062, '47855', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Perlengkapan Pengendara Sepeda Motor', 'Kelompok ini mencakup usaha perdagangan eceran kaki lima dan los pasar perlengkapan pengendara sepeda motor yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti helm, jaket, jas hujan, sarung tangan, masker dan lain-lainnya.', 'kbli_47855', NULL, NULL),
(1063, '47859', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Keperluan Pribadi Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran barang keperluan pribadi lainnya yang belum tercakup dalam kelompok 47851 s.d. 47855 yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47859', NULL, NULL),
(1064, '47861', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Elektronik', 'Kelompok ini mencakup usaha perdagangan eceran barang elektronik yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti radio, televisi, video, tape recorder, audio amplifier dan cassete recorder.', 'kbli_47861', NULL, NULL),
(1065, '47862', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Alat Dan Perlengkapan Listrik', 'Kelompok ini mencakup usaha perdagangan eceran alat dan perlengkapan listrik yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti mesin cuci, lemari es, kipas angin, alat pengisap debu, alat penggosok lantai, mixer, seterika listrik, blender, lampu pijar, lampu neon, starter, ballast, reflektor, kabel, sakelar, stop kontak, fitting dan sekering.', 'kbli_47862', NULL, NULL),
(1066, '47863', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Pecah Belah Dan Perlengkapan Dapur Dari Plastik/Melamin', 'Kelompok ini mencakup usaha perdagangan eceran barang pecah belah dan perlengkapan dapur yang terbuat dari plastik atau melamin yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti piring, pisin, mangkok, cangkir, teko, sendok, garpu, rantang, stoples, botol susu bayi, panci, baki, ember, termos dan jerigen.', 'kbli_47863', NULL, NULL),
(1067, '47864', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Pecah Belah Dan Perlengkapan Dapur Dari Batu Atau Tanah Liat', 'Kelompok ini mencakup usaha perdagangan eceran barang pecah belah dan perlengkapan dapur yang terbuat dari batu atau tanah liat yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti piring, mangkok, cangkir, teko, kendi, periuk, cobek, tempayan, lumpang, asbak dan uleg-uleg.', 'kbli_47864', NULL, NULL),
(1068, '47865', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang  dan Perlengkapan Dapur Dari Kayu, Bambu Atau Rotan', 'Kelompok ini mencakup usaha perdagangan eceran barang dan perlengkapan dapur yang terbuat dari kayu, bambu atau rotan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti rak bambu, alu, lesung, parutan kelapa, talenan, papan gilesan, centong, bakul, tampah, kukusan, kipas, tudung saji, tusukan sate, gilingan daging.', 'kbli_47865', NULL, NULL),
(1069, '47866', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Pecah Belah Dan Perlengkapan Dapur Bukan Dari Plastik, Batu, Tanah Liat, Kayu, Bambu Atau Rotan', 'Kelompok ini mencakup usaha perdagangan eceran barang pecah belah dan perlengkapan dapur yang terbuat bukan dari plastik, batu, tanah liat, kayu, bambu atau rotan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti piring, pisau, mangkok, cangkir, teko, sendok, garpu, rantang, stoples, botol susu bayi, panci, baki, termos, kompor gas dan kompor minyak tanah.', 'kbli_47866', NULL, NULL),
(1070, '47867', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Alat Kebersihan', 'Kelompok ini mencakup usaha perdagangan eceran alat kebersihan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti sapu lidi, sapu ijuk, sikat, keset, alat/kain pel dan sejenisnya.', 'kbli_47867', NULL, NULL),
(1071, '47869', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Perlengkapan Rumah Tangga Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran perlengkapan rumah tangga dan perlengkapan dapur lainnya yang belum tercakup dalam kelompok 47861 s.d. 47867 yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti linen rumah tangga, taplak meja, seprei, kelambu, kain kasur, kain bantal, gordin, kain pel, keset kamar mandi, sajadah, permadani, karpet dan tenda.', 'kbli_47869', NULL, NULL),
(1072, '47871', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Kertas, Karton Dan Barang Dari Kertas', 'Kelompok ini mencakup usaha perdagangan eceran kertas, karton dan barang dari kertas/karton yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti kertas HVS, kertas doorslag, kertas kraft, kertas tipis, kertas kalkir, kertas berwarna, karton manila, karton buffalo skin, karton serat (fiber board), kertas pembungkus (wrapping), karton kemasan untuk makanan/minuman, kantong kertas, kertas/karton berlapis, kertas surat (stationary), kertas stensil, kertas karbon dan kertas duplikator.', 'kbli_47871', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(1073, '47872', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Alat Tulis Menulis Dan Gambar', 'Kelompok ini mencakup usaha perdagangan eceran alat tulis-menulis dan gambar yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti pensil, pulpen, spidol, balpoin, sign pen, pensil mekanik, jangka, kuas gambar, rapido, crayon dan pastel, papan tulis, meja gambar, white board, alat-alat sablon, pita mesin tulis, cat air, cat minyak, karet penghapus, kayu penghapus, tip-ex, tinta, pengasah pensil, penggaris dan kapur tulis.', 'kbli_47872', NULL, NULL),
(1074, '47873', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Hasil Pencetakan dan Penerbitan', 'Kelompok ini mencakup usaha perdagangan eceran hasil pencetakan dan penerbitan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti faktur, nota, kuitansi, kartu nama, etiket, amplop, agenda, buku alamat, kartu ucapan, kartu pos, perangko, materai, album, buku tulis, buku gambar, kertas bergaris, kertas grafik, atlas, huruf braile, surat kabar, majalah, buletin, kamus, buku ilmu pengetahuan, buku bergambar.', 'kbli_47873', NULL, NULL),
(1075, '47874', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Alat Olahraga Dan Alat Musik', 'Kelompok ini mencakup usaha perdagangan eceran alat-alat olahraga dan alat musik, baik alat musik tradisional maupun alat musik modern yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti berbagai macam bola, raket, jaring/net, stik, bat, peralatan panahan, peralatan pancing, peralatan anggar, peralatan terjun payung, sepatu roda (skate board), sarung tinju, halter, sepeda olahraga termasuk sepeda standar dan sepeda mini, perlengkapan catur, meja biliar, meja pingpong, perlengkapan golf, alat pengaman olahraga, matras, spring board, scoring board, dan ring tinju,  kecapi, seruling bambu, calung, angklung, kulintang, gamelan, set, rebab, rebana, tifa, sasando, flute, saksofon, harmonika, trombone, gitar, mandolin, ukulele, harpa, bass, gambus, biola, cello, piano/organ, drum set dan garpu tala.', 'kbli_47874', NULL, NULL),
(1076, '47875', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Alat Fotografi, Alat Optik Dan Perlengkapannya', 'Kelompok ini mencakup usaha perdagangan eceran alat fotografi, alat optik dan perlengkapannya yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti kamera foto, kamera sinematografi, proyektor sinematografi, pesawat rekam suara, pesawat reproduksi suara proyektor gambar, over head projector, aparat cahaya kilat fotografi, frame kamera, camera bodies, perlengkapan proyektor gambar, dan cassete film transfer, kaca mata pengelas, teropong monokuler, teropong binokuler, kaca pembesar, kaca pengintip, strereoskop dan mikroskop.', 'kbli_47875', NULL, NULL),
(1077, '47876', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Mesin Kantor', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam mesin kantor, seperti komputer, mesin tik, mesin hitung, cash register dan sejenisnya yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47876', NULL, NULL),
(1078, '47877', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Peralatan Telekomunikasi', 'Kelompok ini mencakup usaha perdagangan alat  telekomunikasi, seperti handphone, pesawat telepon dan perlengkapannya yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47877', NULL, NULL),
(1079, '47879', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Campuran Kertas, Karton, Barang Dari Kertas, Alat Tulis-menulis, Alat Gambar, Hasil Pencetakan, Penerbitan Dan Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam/campuran dari kertas, karton, alat tulis-menulis, alat gambar, hasil pencetakan, penerbitan dan lainnya yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47879', NULL, NULL),
(1080, '47881', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Kerajinan', 'Kelompok ini mencakup usaha perdagangan eceran kaki lima barang kerajinan dari kayu, bambu, rotan, pandan, rumput dan sejenisnya, kulit, tulang, tanduk, gading, bulu dan hewan yang diawetkan, logam, keramik yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti patung, topeng, relief, ukiran nama, wayang, keranjang, tikar, topi/tudung, kerai, keset, pajangan dari tanduk, pipa rokok dari tulang, vas bunga, tempat lilin piala dari logam, asbak, celengan pot bunga dari keramik dan lain-lain.', 'kbli_47881', NULL, NULL),
(1081, '47882', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Mainan Anak-anak', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam mainan anak-anak  yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti boneka, kelereng, bekel, congklak, scrable, karambol, mainan yang berupa alat musik, mobil-mobilan, mainan berupa senjata, mainan berupa alat memasak, dan mainan berupa perabotan rumah tangga.', 'kbli_47882', NULL, NULL),
(1082, '47883', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Lukisan', 'Kelompok ini mencakup usaha perdagangan eceran lukisan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti lukisan orang, lukisan binatang dan lukisan pemandangan.', 'kbli_47883', NULL, NULL),
(1083, '47891', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Hewan Hidup', 'Kelompok ini mencakup usaha perdagangan eceran hewan hidup, termasuk hewan peliharaan yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47891', NULL, NULL),
(1084, '47892', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Bahan Bakar Minyak, Gas, Minyak Pelumas Dan Bahan Bakar Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran bahan bakar minyak tanah, Premium, Premix dan Solar, Gas serta minyak pelumas dan bahan bakar lainnya yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47892', NULL, NULL),
(1085, '47893', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Antik', 'Kelompok ini mencakup usaha perdagangan eceran barang antik yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti guci antik, bokor antik, lampu gantung antik dan meja/kursi marmer antik.', 'kbli_47893', NULL, NULL),
(1086, '47894', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Bekas Perlengkapan Rumah Tangga', 'Kelompok ini mencakup usaha perdagangan eceran barang bekas perlengkapan rumah tangga yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti meja bekas, kursi bekas, lemari bekas, tempat tidur bekas, bufet bekas dan perangkat untuk makan dan minum bekas. Termasuk linen rumah tangga, kelambu, kain kasur, kain bantal, gordin, kain pel, keset kamar mandi, sajadah, permadani, karpet dan tenda.', 'kbli_47894', NULL, NULL),
(1087, '47895', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Pakaian, Alas Kaki, Perlengkapan Pakaian Dan Barang Perlengkapan Pribadi Bekas', 'Kelompok ini mencakup usaha perdagangan eceran pakaian, alas kaki, pelengkap pakaian dan barang perlengkapan pribadi bekas yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti baju bekas, celana bekas, mantel bekas, sepatu bekas, selendang dan topi bekas, jam tangan bekas, barang perhiasan bekas.', 'kbli_47895', NULL, NULL),
(1088, '47896', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Listrik Dan Elektronik Bekas', 'Kelompok ini mencakup usaha perdagangan eceran barang listrik dan elektronik bekas yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar), seperti radio bekas, tape recorder bekas, televisi bekas, mesin cuci bekas, seterika listrik bekas dan pengering/pengeriting rambut bekas.', 'kbli_47896', NULL, NULL),
(1089, '47897', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Bekas Campuran', 'Kelompok ini mencakup usaha perdagangan eceran berbagai macam barang bekas campuran yang dilakukan di pinggir jalan umum (kaki lima), serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar).', 'kbli_47897', NULL, NULL),
(1090, '47899', 'Perdagangan Eceran Kaki Lima Dan Los Pasar Barang Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran barang lainnya yang dilakukan di pinggir jalan umum (kaki lima),  serambi muka (emper) toko atau tempat tetap di pasar yang dapat dipindah-pindah atau didorong (los pasar) yang belum diklasifikasikan dalam kelompok 47891 s.d. 47897.', 'kbli_47899', NULL, NULL),
(1091, '47911', 'Perdagangan Eceran Melalui Media Untuk Komoditi Makanan, Minuman, Tembakau, Kimia, Farmasi, Kosmetik Dan Alat Laboratorium', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis barang makanan, minuman, tembakau, kimia, farmasi, kosmetik dan alat laboratorium melalui pesanan (surat, telepon atau internet) dan barang akan dikirim kepada pembeli sesuai dengan barang yang diinginkan berdasarkan katalog, iklan, model, telepon, radio, televisi, internet, media massa dan sejenisnya.', 'kbli_47911', NULL, NULL),
(1092, '47912', 'Perdagangan Eceran Melalui Media Untuk Komoditi Tekstil, Pakaian, Alas Kaki Dan Barang Keperluan Pribadi', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis barang tekstil, pakaian, alas kaki dan barang keperluan pribadi melalui pesanan (surat, telepon atau internet) dan barang akan dikirim kepada pembeli sesuai dengan barang yang diinginkan berdasarkan katalog, iklan, model, telepon, radio, televisi, internet, media massa dan sejenisnya.', 'kbli_47912', NULL, NULL),
(1093, '47913', 'Perdagangan Eceran Melalui Media Untuk Barang Perlengkapan Rumah Tangga Dan Perlengkapan Dapur', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis barang keperluan rumah tangga dan perlengkapan dapur melalui pesanan (surat, telepon atau internet) dan barang akan dikirim kepada pembeli sesuai dengan barang yang diinginkan berdasarkan katalog, iklan, model, telepon, radio, televisi, internet, media massa dan sejenisnya.', 'kbli_47913', NULL, NULL),
(1094, '47914', 'Perdagangan Eceran Melalui Media Untuk Barang Campuran Sebagaimana Tersebut Dalam 47911 S.D. 47913', 'Kelompok ini mencakup usaha perdagangan eceran berbagai jenis barang campuran sebagaimana tersebut dalam 47911 s.d. 47913 melalui pesanan (surat, telepon atau internet) dan barang akan dikirim kepada pembeli sesuai dengan barang yang diinginkan berdasarkan katalog, iklan, model, telepon, radio, televisi, internet, media massa dan sejenisnya.', 'kbli_47914', NULL, NULL),
(1095, '47919', 'Perdagangan Eceran Melalui Media Untuk Berbagai Macam Barang Lainnya', 'Kelompok ini mencakup usaha perdagangan eceran berbagai barang lainnya melalui pesanan dan barang akan dikirim kepada pembeli sesuai dengan barang yang diinginkan berdasarkan katalog, model, telepon, tv, internet, media massa, dan sejenisnya.', 'kbli_47919', NULL, NULL),
(1096, '47920', 'Perdagangan Eceran Atas Dasar Balas Jasa (Fee) Atau Kontrak', 'Kelompok ini mencakup usaha pedagang perantara (makelar), seperti agen komisi perdagangan eceran yang menerima komisi dari pedagang eceran lainnya yang memperdagangkan barang-barang di dalam negeri atas nama pihak lain.', 'kbli_47920', NULL, NULL),
(1097, '47991', 'Perdagangan Eceran Keliling Komoditi Makanan Dari Hasil Pertanian', 'Kelompok ini mencakup usaha perdagangan eceran komoditi makanan dari hasil pertanian yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau  menjualnya mendatangi rumah ke rumah masyarakat/langganan.', 'kbli_47991', NULL, NULL),
(1098, '47992', 'Perdagangan Eceran Keliling Komoditi Makanan, Minuman Atau Tembakau Hasil Industri Pengolahan', 'Kelompok ini mencakup usaha perdagangan eceran komoditi makanan, minuman atau tembakau dari hasil industri pengolahan yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau menjualnya mendatangi rumah ke rumah masyarakat/langganan.', 'kbli_47992', NULL, NULL),
(1099, '47993', 'Perdagangan Eceran Keliling Bahan Kimia, Farmasi, Kosmetik Dan Alat Laboratorium', 'Kelompok ini mencakup usaha perdagangan eceran bahan kimia, farmasi, kosmetik dan alat laboratorium yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau  menjualnya mendatangi rumah ke rumah masyarakat/langganan.', 'kbli_47993', NULL, NULL),
(1100, '47994', 'Perdagangan Eceran Keliling Tekstil, Pakaian, Alas Kaki Dan Barang Keperluan Pribadi', 'Kelompok ini mencakup usaha perdagangan eceran tekstil, pakaian, alas kaki dan barang keperluan pribadi yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau  menjualnya mendatangi rumah ke rumah masyarakat/langganan.', 'kbli_47994', NULL, NULL),
(1101, '47995', 'Perdagangan Eceran Keliling Perlengkapan Rumah Tangga Dan Perlengkapan Dapur', 'Kelompok ini mencakup usaha perdagangan eceran perlengkapan rumah tangga dan perlengkapan dapur yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau  menjualnya mendatangi rumah ke rumah masyarakat/langganan.', 'kbli_47995', NULL, NULL),
(1102, '47996', 'Perdagangan Eceran Keliling Bahan Bakar Dan Minyak Pelumas', 'Kelompok ini mencakup usaha perdagangan eceran bahan bakar dan minyak pelumas yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau  menjualnya mendatangi rumah ke rumah masyarakat/langganan.', 'kbli_47996', NULL, NULL),
(1103, '47997', 'Perdagangan Eceran Keliling Kertas, Barang Dari Kertas, Alat Tulis, Barang Cetakan, Alat Olahraga, Alat Musik, Alat Fotografi Dan Komputer', 'Kelompok ini mencakup usaha perdagangan eceran kertas, barang dari kertas, alat tulis, barang cetakan, alat olahraga, alat musik, alat fotografi dan komputer  yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau menjualnya mendatangi rumah ke rumah masyarakat/langganan.', 'kbli_47997', NULL, NULL),
(1104, '47998', 'Perdagangan Eceran Keliling Barang Kerajinan, Mainan Anak-anak Dan Lukisan', 'Kelompok ini mencakup usaha perdagangan eceran barang kerajinan, mainan anak-anak dan lukisan yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau  menjualnya mendatangi rumah ke rumah masyarakat/langganan.', 'kbli_47998', NULL, NULL),
(1105, '47999', 'Perdagangan eceran bukan di toko, kios, kaki lima dan los pasar lainnya YTDL', 'Kelompok ini mencakup usaha perdagangan eceran barang lainnya yang selain kelompok 47991 s.d. 47998 yang dilakukan dengan cara menjajakannya berkeliling dan tidak mempunyai tempat yang tetap atau menjualnya mendatangi rumah ke rumah masyarakat/langganan. Termasuk kegiatan perdagangan melalui sistem penjualan langsung atau pendistribusian khusus seperti single level marketing dan multi level marketing, serta agen komisi perdagangan eceran.', 'kbli_47999', NULL, NULL),
(1106, '49110', 'Angkutan Jalan Rel untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penumpang antarkota dengan kereta. Termasuk pengoperasian kereta tidur atau kereta makan sebagai operasi yang terpadu dari perusahaan kereta api. Kelompok ini tidak mencakup angkutan kereta untuk penumpang perkotaan (49441).', 'kbli_49110', NULL, NULL),
(1107, '49120', 'Angkutan Jalan Rel untuk Barang', 'Kelompok ini mencakup usaha pengangkutan barang melalui jalur utama jaringan rel kereta api jarak jauh maupun jalur khusus angkutan barang jarak pendek, seperti barang hasil pertanian pertambangan dan penggalian (termasuk bahan bakar minyak, minyak bumi, hasil olahan, LPG, LNG dan CNG), angkutan barang berbahaya, limbah bahan berbahaya dan beracun, serta industri dan lainnya.', 'kbli_49120', NULL, NULL),
(1108, '49211', 'Angkutan bus Antarkota Antarprovinsi (AKAP)', 'Kelompok ini mencakup usaha pengangkutan dengan menggunakan kendaraan bermotor bus umum tingkat, maxi, besar, sedang, dan/atau kecil berdasarkan jadwal tertentu dan dalam trayek AKAP yang ditetapkan.', 'kbli_49211', NULL, NULL),
(1109, '49212', 'Angkutan Bus Perbatasan', 'Kelompok ini mencakup usaha pengangkutan pada kabupaten/kota yang berbatasan langsung menggunakan kendaraan bermotor bus umum tingkat, maxi, besar, sedang, dan/atau kecil dan belum terlayani dalam trayek AKAP/AKDP.', 'kbli_49212', NULL, NULL),
(1110, '49213', 'Angkutan bus Antarkota Dalam Provinsi (AKDP)', 'Kelompok ini mencakup usaha pengangkutan dengan menggunakan mobil bus umum tingkat, maxi, besar, dan/atau sedang dengan jadwal dan dalam trayek AKDP yang ditetapkan.', 'kbli_49213', NULL, NULL),
(1111, '49214', 'Angkutan Bus Kota', 'Kelompok ini mencakup usaha pengangkutan dari satu tempat ke tempat lain dalam satu daerah kota atau wilayah ibu kota kabupaten atau dalam daerah khusus ibu kota dengan menggunakan mobil bus umum (bus besar/sedang) yang terikat dalam trayek.', 'kbli_49214', NULL, NULL),
(1112, '49215', 'Angkutan Bus Lintas Batas Negara', 'Kelompok ini mencakup usaha pengangkutan dari satu kota ke kota lain yang melewati batas negara dengan menggunakan mobil bus umum (besar/sedang) yang terikat dalam trayek.', 'kbli_49215', NULL, NULL),
(1113, '49216', 'Angkutan Bus Khusus', 'Kelompok ini mencakup usaha pengangkutan penumpang yang mempunyai asal dan/atau tujuan tetap, meliputi angkutan antar jemput, angkutan karyawan, angkutan permukiman dan angkutan pemadu moda menggunakan mobil bus umum (besar/sedang). Termasuk pengoperasian shuttle bus.', 'kbli_49216', NULL, NULL),
(1114, '49219', 'Angkutan Bus Dalam Trayek Lainnya', 'Kelompok ini mencakup usaha pengangkutan penumpang yang menggunakan bus dalam trayek lainnya yang tidak diklasifikasikan di tempat lain, seperti pengoperasian angkutan bus dengan jurusan kota ke bandara atau kota ke stasiun.', 'kbli_49219', NULL, NULL),
(1115, '49221', 'Angkutan Bus Pariwisata', 'Kelompok ini mencakup usaha pengangkutan penumpang dengan menggunakan kendaraan bus umum untuk keperluan pariwisata atau keperluan lain di luar pelayanan angkutan dalam trayek, seperti untuk keperluan perjalanan wisata perorangan atau kelompok menggunakan mobil bus umum kecil, sedang, besar, maxi, tempel, dan tingkat.', 'kbli_49221', NULL, NULL),
(1116, '49229', 'Angkutan Bus Tidak Dalam Trayek Lainnya', 'Kelompok ini mencakup angkutan darat bus tidak dalam trayek, selain angkutan bus pariwisata, seperti angkutan bus carter, ekskursi, dan angkutan bus berkala lainnya.', 'kbli_49229', NULL, NULL),
(1117, '49300', 'Angkutan Melalui Saluran Pipa', 'Kelompok ini mencakup usaha pengangkutan minyak dan gas bumi (minyak bumi, bahan bakar minyak, hasil olahan dan gas bumi), cairan, air, lumpur, dan komoditas lainnya dari tempat pembuat (produsen) ke tempat pemakai (konsumen) dengan saluran pipa atas dasar balas jasa (fee) atau kontrak. Termasuk pengoperasian gardu pompa.', 'kbli_49300', NULL, NULL),
(1118, '49411', 'Angkutan Perbatasan Bukan Bus, Dalam Trayek', 'Kelompok ini mencakup usaha pengangkutan orang pada kabupaten/kota yang berbatasan langsung menggunakan kendaraan bermotor bukan bus dan belum terlayani dalam trayek AKAP/AKDP.', 'kbli_49411', NULL, NULL),
(1119, '49412', 'Angkutan Antarkota Dalam Provinsi (AKDP) Bukan Bus, Dalam Trayek', 'Kelompok ini mencakup usaha pengangkutan orang dengan menggunakan kendaraan bermotor bukan bus dengan jadwal dan dalam trayek AKDP yang ditetapkan.', 'kbli_49412', NULL, NULL),
(1120, '49413', 'Angkutan Perkotaan Bukan Bus, Dalam Trayek', 'Kelompok ini mencakup usaha pengangkutan orang dari satu tempat ke tempat lain dalam kawasan perkotaan dengan menggunakan kendaraan bermotor bukan bus yang terikat dalam trayek.', 'kbli_49413', NULL, NULL),
(1121, '49414', 'Angkutan Perdesaan Bukan Bus, Dalam Trayek', 'Kelompok ini mencakup usaha pengangkutan penumpang dari satu tempat ke tempat lain dalam satu daerah kabupaten, yang tidak bersinggungan dengan trayek angkutan perkotaan, dengan menggunakan kendaraan bermotor bukan bus yang terikat dalam trayek.', 'kbli_49414', NULL, NULL),
(1122, '49415', 'Angkutan Darat Khusus Bukan Bus', 'Kelompok ini mencakup usaha pengangkutan penumpang yang mempunyai asal dan/atau tujuan tetap, meliputi angkutan permukiman dan angkutan pemadu moda menggunakan kendaraan bermotor bukan bus.', 'kbli_49415', NULL, NULL),
(1123, '49419', 'Angkutan Darat Bukan Bus untuk Penumpang Lainnya, Dalam Trayek', 'Kelompok ini mencakup pengangkutan darat untuk penumpang lainnya melalui sistem angkutan perkotaan atau perdesaan. Angkutan tersebut dalam trayek melalui rute normal dan menaikkan dan menurunkan penumpang pada tempat dan waktu yang tepat.', 'kbli_49419', NULL, NULL),
(1124, '49421', 'Angkutan Taksi', 'Kelompok ini mencakup usaha pengangkutan penumpang dengan menggunakan mobil penumpang yang diberi tanda khusus dan dilengkapi dengan argometer yang melayani angkutan dari pintu ke pintu, dengan wilayah operasi terbatas.', 'kbli_49421', NULL, NULL),
(1125, '49422', 'Angkutan Sewa', 'Kelompok ini mencakup usaha pengangkutan penumpang dengan menggunakan mobil penumpang umum yang melayani angkutan dari pintu ke pintu, dalam wilayah operasi yang tidak dibatasi oleh wilayah administratif dan tarif berdasarkan kesepakatan antara pengguna dengan penyedia angkutan. Termasuk layanan carter, ekskursi, dan angkutan carter musiman lainnya serta penyewaan mobil atau angkutan pribadi lainnya dengan sopir. Kelompok ini juga mencakup angkutan sewa bajaj, kancil, bentor dan lain-lain. Kelompok ini tidak mencakup angkutan taksi (49421) dan angkutan ojek motor (49424).', 'kbli_49422', NULL, NULL),
(1126, '49423', 'Angkutan Tidak Bermotor untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penumpang dengan kendaraan tidak bermotor, seperti angkutan delman/bendi/andong/dokar, becak dan sepeda. Kelompok ini tidak mencakup angkutan tidak bermotor untuk penumpang di kawasan wisata (49425).', 'kbli_49423', NULL, NULL),
(1127, '49424', 'Angkutan Ojek Motor', 'Kelompok ini mencakup usaha pengangkutan penumpang dengan kendaraan bermotor roda dua seperti ojek sepeda motor dan ojek online.', 'kbli_49424', NULL, NULL),
(1128, '49425', 'Angkutan Darat Wisata', 'Kelompok ini mencakup pengoperasian angkutan darat berupa kendaraan bermotor maupun tidak bermotor di destinasi/kawasan pariwisata.', 'kbli_49425', NULL, NULL),
(1129, '49426', 'Angkutan Sewa Khusus', 'Kelompok ini mencakup usaha pelayanan angkutan dari pintu ke pintu dengan pengemudi, menggunakan kendaraan bermotor umum (sedan/bukan sedan), memiliki wilayah operasi dalam wilayah perkotaan, dari dan ke bandar udara, pelabuhan, atau simpul transportasi lainnya serta pemesanan menggunakan aplikasi berbasis teknologi informasi, dengan besaran tarif tercantum dalam aplikasi. Kelompok ini tidak mencakup angkutan taksi (49421) dan angkutan ojek motor (49424).', 'kbli_49426', NULL, NULL),
(1130, '49429', 'Angkutan Darat Lainnya untuk Penumpang', 'Kelompok ini mencakup pengoperasian angkutan darat lainnya untuk penumpang, seperti usaha angkutan antar jemput, angkutan karyawan, angkutan pemukiman dan angkutan pemadu moda menggunakan kendaraan bermotor bukan bus.', 'kbli_49429', NULL, NULL),
(1131, '49431', 'Angkutan Bermotor untuk Barang Umum', 'Kelompok ini mencakup operasional angkutan barang dengan kendaraan bermotor dan dapat mengangkut lebih dari satu jenis barang, seperti angkutan dengan truk, pick up, bak terbuka dan bak tertutup (box).', 'kbli_49431', NULL, NULL),
(1132, '49432', 'Angkutan Bermotor untuk Barang Khusus', 'Kelompok ini mencakup operasional angkutan barang dengan kendaraan bermotor untuk barang yang secara khusus mengangkut satu jenis barang, seperti angkutan bahan bakar minyak, minyak bumi, hasil olahan, LPG, LNG dan CNG, angkutan barang berbahaya, limbah bahan berbahaya dan beracun, angkutan barang alat-alat berat, angkutan peti kemas, angkutan tumbuhan hidup, angkutan hewan hidup dan pengangkutan kendaraan bermotor.', 'kbli_49432', NULL, NULL),
(1133, '49433', 'Angkutan Tidak Bermotor untuk Barang Umum', 'Kelompok ini mencakup usaha pengangkutan barang dengan kendaraan tidak bermotor, seperti gerobak, pedati dan hewan/ternak beban.', 'kbli_49433', NULL, NULL),
(1134, '49441', 'Angkutan Jalan Rel Perkotaan', 'Kelompok ini mencakup usaha pengangkutan penumpang dengan berbagai moda angkutan jalan rel perkotaan, seperti trem, monorel, kereta listrik, kereta bawah tanah, kereta layang dan lain-lain. Mencakup juga pengoperasian kereta gantung, kereta api bukit, kereta kabel (gondola) dan lainnya apabila merupakan bagian dari sistem trayek perkotaan. Termasuk angkutan rel dengan jurusan kota ke bandara atau kota ke stasiun.', 'kbli_49441', NULL, NULL),
(1135, '49442', 'Angkutan Jalan Rel Wisata', 'Kelompok ini mencakup pengoperasian kereta yang menggunakan jalur khusus untuk wisata seperti angkutan jalan rel di kawasan wisata, seperti kereta wisata mak itam di Sumatera Barat, kereta wisata danau Singkarak Sumatera Barat, kereta wisata lori Kaliraga Jawa Timur, kereta wisata Ambawara Jawa Tengah.', 'kbli_49442', NULL, NULL),
(1136, '49450', 'Angkutan Jalan Rel Lainnya', 'Kelompok ini mencakup pengoperasian kereta gantung, kereta api bukit, kereta kabel (gondola) dan lainnya apabila merupakan bukan bagian dari sistem trayek perkotaan.', 'kbli_49450', NULL, NULL),
(1137, '50111', 'Angkutan Laut Dalam Negeri Liner dan Tramper untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penumpang melalui laut dengan menggunakan kapal laut antarpelabuhan dalam negeri dengan pelayanan angkutan laut yang dilakukan dengan trayek secara tetap dan teratur (liner) dengan berjadwal dan menyebutkan pelabuhan singgah, atau trayek tidak tetap dan tidak teratur (tramper). Termasuk kegiatan kapal penumpang yang dioperasikan perusahaan pemerintah dan swasta lainnya, serta usaha persewaan angkutan laut berikut operatornya.', 'kbli_50111', NULL, NULL),
(1138, '50112', 'Angkutan Laut Perairan Pelabuhan Dalam Negeri untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penumpang melalui laut pada pelabuhan-pelabuhan yang belum memiliki fasilitas lengkap, dengan menggunakan angkutan perairan pelabuhan (rede transport) sebagai penghubung dari dermaga (pelabuhan) ke kapal atau sebaliknya, dari kapal utama ke kapal lainnya di perairan pelabuhan atau sebaliknya, dan/atau dari dermaga dan/atau kapal ke bangunan/instalasi di perairan laut atau sebaliknya.', 'kbli_50112', NULL, NULL),
(1139, '50113', 'Angkutan Laut Dalam Negeri untuk Wisata', 'Kelompok ini mencakup usaha pengangkutan untuk wisata atau untuk rekreasi di laut, dan/atau wisata bahari. Termasuk usaha penyewaan angkutan laut berikut operatornya.', 'kbli_50113', NULL, NULL),
(1140, '50114', 'Angkutan Laut Dalam Negeri Perintis untuk Penumpang', 'Kelompok ini mencakup usaha angkutan laut untuk penumpang yang menghubungkan daerah-daerah terpencil serta daerah yang potensial namun belum berkembang serta belum menguntungkan untuk dilayari secara komersial ke daerah-daerah yang telah berkembang. Kegiatan angkutan laut perintis dengan trayek tetap dan teratur (liner) serta penempatan kapalnya untuk mendorong pengembangan daerah terpencil. Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50114', NULL, NULL),
(1141, '50121', 'Angkutan Laut Luar Negeri Liner dan Tramper untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penumpang melalui laut dengan menggunakan kapal laut antarpelabuhan di Indonesia dengan pelabuhan di luar negeri dengan melayari trayek secara tetap dan teratur (liner) dengan berjadwal, atau trayek tidak tetap dan tidak teratur (tramper). Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50121', NULL, NULL),
(1142, '50122', 'Angkutan Laut Luar Negeri untuk Wisata', 'Kelompok ini mencakup usaha pengangkutan wisatawan melalui laut dengan menggunakan kapal laut wisata antara pelabuhan di Indonesia dan pelabuhan di luar negeri. Termasuk usaha penyewaan angkutan laut berikut operatornya.', 'kbli_50122', NULL, NULL),
(1143, '50131', 'Angkutan Laut Dalam Negeri untuk Barang Umum', 'Kelompok ini mencakup usaha pengangkutan barang umum melalui laut dengan menggunakan kapal laut antarpelabuhan dalam negeri dengan melayari trayek secara tetap dan teratur (liner) dengan berjadwal, atau trayek tidak tetap dan tidak teratur (tramper). Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50131', NULL, NULL),
(1144, '50132', 'Angkutan Laut Perairan Pelabuhan Dalam Negeri untuk Barang', 'Kelompok ini mencakup usaha pengangkutan barang melalui laut pada pelabuhan-pelabuhan yang belum memiliki fasilitas lengkap, dengan menggunakan angkutan perairan pelabuhan (rede transport) sebagai penghubung dari dermaga (pelabuhan) ke kapal atau sebaliknya, dari kapal utama ke kapal lainnya di perairan pelabuhan atau sebaliknya, dan/atau dari dermaga dan/atau kapal ke bangunan/instalasi di perairan laut atau sebaliknya.', 'kbli_50132', NULL, NULL),
(1145, '50133', 'Angkutan Laut Dalam Negeri untuk Barang Khusus', 'Kelompok ini mencakup usaha pengangkutan barang dengan menggunakan kapal laut yang dirancang secara khusus untuk mengangkut suatu jenis barang tertentu, seperti angkutan barang berbahaya, limbah bahan berbahaya dan beracun, bahan bakar minyak, minyak bumi, hasil olahan, LPG, LNG dan CNG, ikan dan sejenisnya. Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50133', NULL, NULL),
(1146, '50134', 'Angkutan Laut Dalam Negeri Perintis untuk Barang', 'Kelompok ini mencakup usaha angkutan laut untuk barang yang menghubungkan daerah-daerah terpencil serta daerah yang potensial namun belum berkembang serta belum menguntungkan untuk dilayari secara komersial ke daerah-daerah yang telah berkembang. Kegiatan angkutan laut perintis ditetapkan dengan trayek tetap dan teratur atau liner serta penempatan kapalnya untuk mendorong pengembangan daerah terpencil. Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50134', NULL, NULL),
(1147, '50135', 'Angkutan Laut Dalam Negeri Pelayaran Rakyat', 'Kelompok ini mencakup usaha angkutan laut yang ditujukan untuk mengangkut barang dan/atau hewan dengan menggunakan kapal layar, kapal motor tradisional dan kapal motor dengan ukuran tertentu. Perusahaan pelayaran rakyat merupakan perusahaan angkutan laut berbadan hukum Indonesia. Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50135', NULL, NULL),
(1148, '50141', 'Angkutan Laut Luar Negeri untuk Barang Umum', 'Kelompok ini mencakup usaha pengangkutan barang melalui laut dengan menggunakan kapal laut antarpelabuhan di Indonesia dengan pelabuhan di luar negeri dengan melayari trayek secara tetap dan teratur (liner) dengan berjadwal, atau trayek tidak tetap dan tidak teratur (tramper). Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50141', NULL, NULL),
(1149, '50142', 'Angkutan Laut Luar Negeri untuk Barang Khusus', 'Kelompok ini mencakup usaha angkutan laut internasional untuk barang khusus, contohnya angkutan barang berbahaya, limbah bahan berbahaya dan beracun, termasuk ikan dan sejenisnya. Angkutan laut khusus dengan menggunakan kapal berbendera Indonesia dengan kondisi dan persyaratan kapalnya disesuaikan dengan jenis kegiatan usaha pokoknya serta untuk melayani trayek tidak tetap dan tidak teratur atau tramper antarpelabuhan di Indonesia dengan pelabuhan di luar negeri. Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50142', NULL, NULL),
(1150, '50143', 'Angkutan Laut Luar Negeri Pelayaran Rakyat', 'Kelompok ini mencakup usaha angkutan laut yang ditujukan untuk mengangkut barang dan/atau hewan dengan menggunakan kapal layar, kapal motor tradisional dan kapal motor dengan ukuran tertentu antarpelabuhan di Indonesia dengan pelabuhan di luar negeri. Perusahaan pelayaran rakyat merupakan perusahaan angkutan laut berbadan hukum Indonesia. Termasuk usaha persewaan angkutan laut berikut operatornya.', 'kbli_50143', NULL, NULL),
(1151, '50211', 'Angkutan Sungai dan Danau Liner (Trayek Tetap dan Teratur) untuk Penumpang', 'Kelompok ini mencakup usaha angkutan penumpang pada sungai dan danau yang dilakukan dalam jaringan trayek secara tetap dan teratur, dengan jadwal tetap dan berjadwal. Menurut jenisnya terdiri dari pelayanan angkutan dalam kabupaten/kota, pelayanan angkutan antarkabupaten/kota dalam provinsi dan pelayanan lintas batas antarnegara dan antarprovinsi.', 'kbli_50211', NULL, NULL),
(1152, '50212', 'Angkutan Sungai dan Danau Tramper (Trayek Tidak Tetap dan Tidak Teratur) untuk Penumpang', 'Kelompok ini mencakup usaha angkutan penumpang pada sungai dan danau dengan trayek yang tidak tetap dan tidak berjadwal serta tidak untuk keperluan pariwisata.', 'kbli_50212', NULL, NULL),
(1153, '50213', 'Angkutan Sungai dan Danau untuk Wisata dan YBDI', 'Kelompok ini mencakup usaha angkutan penumpang wisata di sungai dan danau, termasuk angkutan trayek untuk keperluan perorangan atau kelompok, keluarga maupun sosial.', 'kbli_50213', NULL, NULL),
(1154, '50214', 'Angkutan Penyeberangan Antarprovinsi untuk Penumpang', 'Kelompok ini mencakup usaha angkutan penumpang dari satu provinsi ke provinsi lain dengan menggunakan kapal penyeberangan yang terikat dalam trayek.', 'kbli_50214', NULL, NULL),
(1155, '50215', 'Angkutan Penyeberangan Perintis Antarprovinsi untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, danau, selat dan teluk antarprovinsi untuk penumpang yang menghubungkan daerah-daerah terpencil serta daerah yang potensial namun belum berkembang serta belum menguntungkan untuk dilayari secara komersial ke daerah-daerah yang telah berkembang. Termasuk usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50215', NULL, NULL),
(1156, '50216', 'Angkutan Penyeberangan Antarkabupaten/kota untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penyeberangan untuk penumpang di laut, danau, selat dan teluk, antarpelabuhan penyeberangan antarkabupaten/kota sebagai jembatan bergerak yang menghubungkan dua tempat tertentu, yang merupakan kelanjutan dari jaringan jalan raya dan atau kereta api. Termasuk usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50216', NULL, NULL),
(1157, '50217', 'Angkutan Penyeberangan Perintis Antarkabupaten/kota untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, danau, selat dan teluk antarkabupaten/kota untuk penumpang yang menghubungkan daerah-daerah terpencil serta daerah yang potensial namun belum berkembang serta belum menguntungkan untuk dilayari secara komersial ke daerah-daerah yang telah berkembang. Termasuk usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50217', NULL, NULL),
(1158, '50218', 'Angkutan Penyeberangan Dalam Kabupaten/kota untuk Penumpang', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, danau, selat dan teluk, antarpelabuhan penyeberangan dalam kabupaten/kota sebagai jembatan bergerak yang menghubungkan dua tempat tertentu, yang merupakan kelanjutan dari jaringan jalan raya dan atau kereta api. Termasuk usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50218', NULL, NULL),
(1159, '50219', 'Angkutan Penyeberangan Lainnya untuk Penumpang Termasuk Penyeberangan Antarnegara', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, selat, dan teluk, antarapelabuhan penyeberangan di Indonesia dengan pelabuhan di luar negeri sebagai jembatan bergerak yang menghubungkan dua tempat tertentu, yang merupakan kelanjutan dari jaringan jalan raya dan atau kereta api. Termasuk angkutan perairan pelabuhan untuk penumpang selain angkutan laut, serta usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50219', NULL, NULL),
(1160, '50221', 'Angkutan Sungai dan Danau untuk Barang Umum dan/atau Hewan', 'Kelompok ini mencakup usaha angkutan barang di sungai dan danau, dan barang yang diangkut bisa lebih dari satu jenis, kecuali barang berbahaya, barang khusus atau alat berat.', 'kbli_50221', NULL, NULL),
(1161, '50222', 'Angkutan Sungai dan Danau untuk Barang Khusus', 'Kelompok ini mencakup usaha angkutan barang di sungai dan danau dengan kapal atau perahu barang yang dimodifikasi secara khusus dan hanya mengangkut satu jenis barang, termasuk kapal yang memenuhi persyaratan teknis/kelaikan, sesuai dengan barang khusus yang diangkut dan diklasifikasikan sebagai berikut, yaitu angkutan kayu gelondongan/logs, angkutan batangan pipa/besi/rel, angkutan barang curah, angkutan barang cair, angkutan barang yang memerlukan fasilitas pendingin, angkutan tumbuh-tumbuhan dan hewan hidup, angkutan peti kemas, angkutan alat-alat berat dan angkutan barang khusus lainnya.', 'kbli_50222', NULL, NULL),
(1162, '50223', 'Angkutan Sungai dan Danau untuk Barang Berbahaya', 'Kelompok ini mencakup usaha angkutan barang di sungai dan danau yang melakukan kegiatan pengangkutan bahan berbahaya dari tempat kegiatan pemuatan sampai ke tempat pembongkaran akhir, termasuk limbah bahan berbahaya dan beracun, bahan bakar minyak, minyak bumi, hasil olahan, LPG, LNG dan CNG.', 'kbli_50223', NULL, NULL),
(1163, '50224', 'Angkutan Penyeberangan Umum Antarprovinsi untuk Barang', 'Kelompok ini mencakup usaha angkutan barang dari satu provinsi ke provinsi lain dengan menggunakan kapal penyeberangan yang terikat dalam trayek.', 'kbli_50224', NULL, NULL),
(1164, '50225', 'Angkutan Penyeberangan Perintis Antarprovinsi untuk Barang', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, danau, selat dan teluk antarprovinsi untuk barang yang menghubungkan daerah-daerah terpencil serta daerah yang potensial namun belum berkembang serta belum menguntungkan untuk dilayari secara komersial ke daerah-daerah yang telah berkembang. Termasuk usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50225', NULL, NULL),
(1165, '50226', 'Angkutan Penyeberangan Umum Antarkabupaten/kota untuk Barang', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, danau, selat dan teluk, antarpelabuhan penyeberangan antarkabupaten/kota sebagai jembatan bergerak yang menghubungkan dua tempat tertentu, yang merupakan kelanjutan dari jaringan jalan raya dan atau kereta api. Termasuk usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50226', NULL, NULL),
(1166, '50227', 'Angkutan Penyeberangan Perintis Antarkabupaten/kota untuk Barang', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, danau, selat dan teluk antarkabupaten/kota untuk barang yang menghubungkan daerah-daerah terpencil serta daerah yang potensial namun belum berkembang serta belum menguntungkan untuk dilayari secara komersial ke daerah-daerah yang telah berkembang. Termasuk usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50227', NULL, NULL),
(1167, '50228', 'Angkutan Penyeberangan Umum Dalam Kabupaten/kota untuk Barang', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, danau, selat dan teluk, antarpelabuhan penyeberangan dalam kabupaten/kota sebagai jembatan bergerak yang menghubungkan dua tempat tertentu, yang merupakan kelanjutan dari jaringan jalan raya dan atau kereta api. Termasuk usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50228', NULL, NULL),
(1168, '50229', 'Angkutan Penyeberangan Lainnya untuk Barang Termasuk Penyeberangan Antarnegara', 'Kelompok ini mencakup usaha pengangkutan penyeberangan di laut, selat, dan teluk, antara pelabuhan penyeberangan di Indonesia dengan pelabuhan di luar negeri sebagai jembatan bergerak yang menghubungkan dua tempat tertentu, yang merupakan kelanjutan dari jaringan jalan raya dan atau kereta api. Termasuk angkutan perairan pelabuhan untuk penumpang selain angkutan laut, serta usaha persewaan angkutan penyeberangan berikut operatornya.', 'kbli_50229', NULL, NULL),
(1169, '51101', 'Angkutan Udara Niaga Berjadwal Dalam Negeri untuk Penumpang atau Penumpang dan Kargo', 'Kelompok ini mencakup usaha pengangkutan penumpang atau penumpang dan kargo dengan pesawat udara dari satu bandar udara ke bandar udara lain di dalam wilayah Negara Kesatuan Republik Indonesia pada rute dan jadwal penerbangan yang tetap dan teratur dengan membayar sejumlah tarif tertentu yang dipublikasikan.', 'kbli_51101', NULL, NULL),
(1170, '51102', 'Angkutan Udara Niaga Tidak Berjadwal Dalam Negeri untuk Penumpang atau Penumpang dan Kargo', 'Kelompok ini mencakup usaha pengangkutan penumpang atau penumpang dan kargo dengan pesawat udara dari satu bandar udara ke bandar udara lain di dalam wilayah Negara Kesatuan Republik Indonesia pada rute dan jadwal penerbangan yang tidak tetap dan tidak teratur dengan membayar tarif yang merupakan kesepakatan antara penyedia jasa dan pengguna jasa angkutan udara dan tidak dipublikasikan.', 'kbli_51102', NULL, NULL),
(1171, '51103', 'Angkutan Udara NIaga Berjadwal Luar Negeri untuk Penumpang atau Penumpang dan Kargo', 'Kelompok ini mencakup usaha pengangkutan penumpang atau penumpang dan kargo dengan pesawat udara dari satu bandar udara di dalam negeri ke bandar udara lain di luar wilayah Negara Kesatuan Republik Indonesia atau sebaliknya pada rute dan jadwal penerbangan yang tetap dan teratur dengan membayar sejumlah tarif tertentu yang dipublikasikan.', 'kbli_51103', NULL, NULL),
(1172, '51104', 'Angkutan Udara Niaga Tidak Berjadwal Luar Negeri untuk Penumpang atau Penumpang dan Kargo', 'Kelompok ini mencakup usaha pengangkutan penumpang atau penumpang dan kargo dengan pesawat udara dari satu bandar udara di dalam negeri ke bandar udara lain di luar wilayah Negara Kesatuan Republik Indonesia atau sebaliknya pada rute dan jadwal penerbangan yang tidak tetap dan tidak teratur dengan membayar tarif yang merupakan kesepakatan antara penyedia jasa dan pengguna jasa angkutan udara dan tidak dipublikasikan.', 'kbli_51104', NULL, NULL),
(1173, '51105', 'Angkutan Udara Niaga Tidak Berjadwal Lainnya', 'Kelompok ini mencakup usaha pengangkutan selain penumpang, penumpang dan kargo, kargo dengan pesawat udara untuk penerbangan dalam negeri dan/atau luar negeri pada rute dan jadwal penerbangan yang tidak tetap dan tidak teratur dengan membayar tarif yang merupakan kesepakatan antara penyedia jasa dan pengguna jasa angkutan udara dan tidak dipublikasikan. Kegiatan ini termasuk diantaranya jasa pesawat udara untuk penyemprotan pertanian, jasa pesawat udara untuk pemadaman kebakaran, jasa pesawat udara untuk pembuatan hujan buatan, jasa pesawat udara untuk pemotretan udara, survei dan pemetaan, jasa pesawat udara untuk pencarian dan pertolongan, jasa pesawat udara untuk kalibrasi, jasa pesawat udara untuk patroli udara, jasa pesawat udara untuk medical evacuation, dan jasa pesawat udara lainnya.', 'kbli_51105', NULL, NULL),
(1174, '51106', 'Angkutan Udara untuk Olahraga', 'Kelompok ini mencakup usaha angkutan udara untuk keperluan olahraga. Termasuk usaha persewaan angkutan udara dengan operatornya.', 'kbli_51106', NULL, NULL),
(1175, '51107', 'Angkutan Udara untuk Wisata', 'Kelompok ini mencakup usaha pengangkutan untuk wisata dengan pesawat udara berdasarkan penerbangan tidak berjadwal yang dilakukan secara komersial pada penerbangan dalam negeri. Kegiatan penerbangan wisata ini bertujuan menghubungkan daerah-daerah pedalaman yang belum ada moda transportasi. Misalnya helicopter dan pesawat pribadi yang disewa secara khusus. Termasuk usaha penyewaan angkutan udara dengan operatornya.', 'kbli_51107', NULL, NULL),
(1176, '51108', 'Angkutan Udara Bukan Niaga', 'Kelompok ini mencakup usaha pengangkutan penumpang, kargo, penumpang dan kargo atau angkutan lainnya dengan pesawat udara untuk penerbangan dalam negeri dan/atau luar negeri dan tidak memungut bayaran yang digunakan untuk melayani kepentingan sendiri atau untuk mendukung kegiatan yang usaha pokoknya selain di bidang angkutan udara. Kegiatan ini termasuk penggunaan pesawat udara untuk kepentingan sendiri/pendukung usaha pokoknya diantaranya angkutan udara pendidikan penerbang, penyemprotan pertanian, pemadaman kebakaran, pembuatan hujan buatan, pemotretan udara, survei dan pemetaan, pencarian dan pertolongan, kalibrasi, patroli udara, medical evacuation, misi keagamaan, dan\r\nkegiatan yang menunjang usaha pokok lainnya.', 'kbli_51108', NULL, NULL),
(1177, '51109', 'Angkutan Udara untuk Penumpang Lainnya', 'Kelompok ini mencakup usaha pengangkutan udara untuk penumpang yang tidak diklasifikasikan di tempat lain. Termasuk usaha persewaan angkutan udara dengan operatornya.', 'kbli_51109', NULL, NULL),
(1178, '51201', 'Angkutan Udara Niaga Berjadwal Dalam Negeri untuk Kargo', 'Kelompok ini mencakup usaha pengangkutan kargo dengan pesawat udara dari satu bandar udara ke bandar udara lain di dalam wilayah Negara Kesatuan Republik Indonesia pada rute dan jadwal penerbangan yang tetap dan teratur dengan membayar sejumlah tarif tertentu yang dipublikasikan.', 'kbli_51201', NULL, NULL),
(1179, '51202', 'Angkutan Udara Niaga Tidak Berjadwal dalam Negeri untuk Kargo', 'Kelompok ini mencakup usaha pengangkutan kargo, termasuk bahan bakar minyak, minyak bumi, hasil olahan, LPG, LNG dan CNG dengan pesawat udara dari satu bandar udara ke bandar udara lain di dalam wilayah Negara Kesatuan Republik Indonesia pada rute dan jadwal penerbangan yang tidak tetap dan tidak teratur dengan membayar tarif yang merupakan kesepakatan antara penyedia jasa dan pengguna jasa angkutan udara dan tidak dipublikasikan.', 'kbli_51202', NULL, NULL),
(1180, '51203', 'Angkutan Udara Niaga Berjadwal Luar Negeri untuk Kargo', 'Kelompok ini mencakup usaha pengangkutan kargo dengan pesawat udara dari satu bandar udara di dalam negeri ke bandar udara lain di luar wilayah Negara Kesatuan Republik Indonesia atau sebaliknya pada rute dan jadwal penerbangan yang tetap dan teratur dengan membayar sejumlah tarif tertentu yang dipublikasikan.', 'kbli_51203', NULL, NULL),
(1181, '51204', 'Angkutan Udara Niaga Tidak Berjadwal Luar Negeri untuk Kargo', 'Kelompok ini mencakup usaha pengangkutan kargo dengan pesawat udara dari satu bandar udara di dalam negeri ke bandar udara lain di luar wilayah Negara Kesatuan Republik Indonesia atau sebaliknya pada rute dan jadwal penerbangan yang tidak tetap dan tidak teratur dengan membayar tarif yang merupakan kesepakatan antara penyedia jasa dan pengguna jasa angkutan udara dan tidak dipublikasikan.', 'kbli_51204', NULL, NULL),
(1182, '52101', 'Pergudangan dan Penyimpanan', 'Kelompok ini mencakup usaha yang melakukan kegiatan penyimpanan barang sementara sebelum barang tersebut di kirim ke tujuan akhir, dengan tujuan komersil.', 'kbli_52101', NULL, NULL),
(1183, '52102', 'Aktivitas Cold Storage', 'Kelompok ini mencakup usaha penyimpanan barang yang memerlukan pendinginan dalam jangka waktu pengawetan tertentu atas dasar balas jasa (fee) atau kontrak, sebelum barang tersebut dikirim ke tujuan akhir. Termasuk juga di kelompok ini gudang pembekuan cepat (blast freezing).', 'kbli_52102', NULL, NULL),
(1184, '52103', 'Aktivitas Bounded Warehousing atau Wilayah Kawasan Berikat', 'Kelompok ini mencakup usaha atau kegiatan yang merupakan bagian dari wilayah pabean yang dengan peraturan pemerintah diberikan perlakuan khusus seperti berada di luar wilayah pabean dan dikelola oleh suatu badan berbentuk perusahaan yang melakukan kegiatan pergudangan, seperti Daerah Industri Pulau Batam.', 'kbli_52103', NULL, NULL),
(1185, '52104', 'Penyimpanan Minyak dan Gas Bumi', 'Kelompok ini mencakup kegiatan usaha penyimpanan yang meliputi kegiatan penerimaan, pengumpulan, penampungan dan pengeluaran minyak bumi, bahan bakar minyak, bahan bakar gas, dan/atau hasil olahan pada lokasi di atas dan/atau di bawah permukaan tanah dan/atau permukaan air untuk tujuan komersial termasuk penyimpanan di zona perdagangan bebas.', 'kbli_52104', NULL, NULL),
(1186, '52105', 'Aktivitas Penyimpanan B3', 'Kelompok ini mencakup usaha penyimpanan barang yang memerlukan tempat penyimpanan sesuai dengan sifat/karakteristik bahan berbahaya dan beracun.', 'kbli_52105', NULL, NULL),
(1187, '52106', 'Fasilitas Penyimpanan Sumber Radiasi Pengion', 'Kelompok ini mencakup usaha yang melakukan kegiatan penyimpanan sumber radiasi pengion (zat radioaktif dan pembangkit radiasi pengion).', 'kbli_52106', NULL, NULL),
(1188, '52107', 'Penyimpanan yang Termasuk Dalam Naturally Occuring Radioactive Material (NORM)', 'Kelompok ini mencakup usaha yang melakukan kegiatan penyimpanan zat radioaktif yang termasuk dalam Naturally Occuring Radioactive Material (NORM) yang berasal dari penambangan pengolahan minyak dan gas bumi, fosfat, timah, zirkon, dll. Termasuk dalam kelompok ini mencakup usaha terkait dengan distribusi bahan baku.', 'kbli_52107', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(1189, '52108', 'Pengelola Gudang Sistem Resi Gudang', 'Kelompok ini mencakup usaha kegiatan pengelolaan gudang yang menyediakan Gudang Sistem Resi Gudang (G-SRG) meliputi penyimpanan, pemeliharaan dan penerbitan resi gudang atas barang yang disimpan di gudang sistem resi gudang oleh pemilik/pihak lain.', 'kbli_52108', NULL, NULL),
(1190, '52109', 'Pergudangan dan Penyimpanan Lainnya', 'Kelompok ini mencakup usaha pergudangan dan penyimpanan lainnya yang belum tercakup dalam kelompok 52101 s.d. 52108. Termasuk kegiatan depo peti kemas yang melakukan penyimpanan dan/atau penumpukan peti kemas, dan dapat dilengkapi dengan fasilitas lain.', 'kbli_52109', NULL, NULL),
(1191, '52211', 'Aktivitas Terminal Darat', 'Kelompok ini mencakup kegiatan usaha terminal darat, seperti pelayanan parkir, penjadwalan keberangkatan kendaraan (angkutan umum) dan pelayanan naik turun penumpang.', 'kbli_52211', NULL, NULL),
(1192, '52212', 'Aktivitas Stasiun Kereta Api', 'Kelompok ini mencakup kegiatan usaha stasiun kereta api, seperti pelayanan parkir, penjadwalan keberangkatan kereta api dan pelayanan naik turun penumpang.', 'kbli_52212', NULL, NULL),
(1193, '52213', 'Aktivitas Jalan Tol', 'Kelompok ini mencakup kegiatan usaha pelayanan lalu lintas kendaraan melalui jalan atau jembatan tol.', 'kbli_52213', NULL, NULL),
(1194, '52214', 'Aktivitas Perparkiran di Badan Jalan (On Street Parking)', 'Kelompok ini mencakup kegiatan usaha penyelenggaraan parkir yang dilakukan di badan jalan.', 'kbli_52214', NULL, NULL),
(1195, '52215', 'Aktivitas Perparkiran di Luar Badan Jalan (Off Street Parking)', 'Kelompok ini mencakup kegiatan usaha penyelenggaraan parkir diluar badan jalan, seperti gedung parkir, lapangan parkir yang terdapat di gedung perkantoran, pusat perbelanjaan, rumah sakit dan jasa perpakiran di luar badan jalan lainnya.', 'kbli_52215', NULL, NULL),
(1196, '52219', 'Aktivitas Penunjang Angkutan Darat Lainnya', 'Kelompok ini mencakup kegiatan usaha penggantian (switching) dan pelangsiran (shunting), bantuan derek, pencairan gas untuk tujuan transportasi dan jasa penunjang angkutan darat lainnya.', 'kbli_52219', NULL, NULL),
(1197, '52221', 'Aktivitas Pelayanan Kepelabuhanan Laut', 'Kelompok ini mencakup kegiatan usaha pelayanan kepelabuhan laut, yang berhubungan dengan angkutan perairan untuk penumpang, hewan atau barang, seperti pengoperasian fasilitas terminal misalnya pelabuhan dan dermaga, navigasi, pemeriksaan barang muatan dalam kargo dan/atau peti kemas dengan menggunakan sumber radiasi pengion (zat radioaktif dan pembakit radiasi pengion), pelayaran dan kegiatan berlabuh, jasa penambatan, jasa pemanduan dan penundaan.', 'kbli_52221', NULL, NULL),
(1198, '52222', 'Aktivitas Pelayanan Kepelabuhanan Sungai dan Danau', 'Kelompok ini mencakup kegiatan usaha penyelenggaraan pelabuhan sungai dan danau. Termasuk kegiatan yang berhubungan dengan angkutan perairan untuk penumpang, hewan atau barang, seperti pengoperasian fasilitas terminal misalnya pelabuhan dan dermaga, navigasi, pemeriksaan barang muatan dalam kargo dan/atau peti kemas dengan menggunakan sumber radiasi pengion (zat radioaktif dan pembakit radiasi pengion), pelayaran dan kegiatan berlabuh, jasa penambatan, jasa pemanduan dan penundaan.', 'kbli_52222', NULL, NULL),
(1199, '52223', 'Aktivitas Pelayanan Kepelabuhanan Penyeberangan', 'Kelompok ini mencakup kegiatan usaha penyelenggaraan pelabuhan penyeberangan. Termasuk kegiatan yang berhubungan dengan angkutan perairan untuk penumpang, hewan atau barang, seperti pengoperasian fasilitas terminal misalnya pelabuhan dan dermaga, navigasi, pemeriksaan barang muatan dalam kargo dan/atau peti kemas dengan menggunakan sumber radiasi pengion (zat radioaktif dan pembakit radiasi pengion), pelayaran dan kegiatan berlabuh, jasa penambatan, jasa pemanduan dan penundaan.', 'kbli_52223', NULL, NULL),
(1200, '52224', 'Aktivitas Pelabuhan Perikanan', 'Kelompok ini mencakup kegiatan usaha pelayanan kepelabuhan perikanan, yang berhubungan dengan angkutan perairan untuk kegiatan perikanan, seperti pengoperasian fasilitas pelabuhan dan dermaga, pemeriksaan barang muatan dalam kargo dan/atau peti kemas dengan menggunakan sumber radiasi pengion (zat radioaktif dan pembakit radiasi pengion), pelayanan tambat dan labuh kapal perikanan dan jasa pemanduan, pelayanan bongkar muat ikan, dan lain-lain.', 'kbli_52224', NULL, NULL),
(1201, '52225', 'Aktivitas Pengelolaan Kapal', 'Kelompok ini mencakup kegiatan jasa pengelolaan kapal di bidang teknis kapal meliputi perawatan, persiapan docking, penyediaan suku cadang, perbekalan, pengawakan, pengurusan asuransi dan pengurusan sertifikasi kelautan kapal.', 'kbli_52225', NULL, NULL),
(1202, '52229', 'Aktivitas Penunjang Angkutan Perairan Lainnya', 'Kelompok ini mencakup kegiatan navigasi, pelayaran dan kegiatan berlabuh, kapal lighterage, kegiatan salvage/pekerjaan bawah air (PBA), kegiatan mercusuar, operasi penguncian jalur air dan lain-lain, termasuk kapal Floating Production, Storage and Offloading (FPSO) dan Floating, Storage and Offloading (FSO) dan jasa penunjang angkutan perairan lainnya.', 'kbli_52229', NULL, NULL),
(1203, '52231', 'Aktivitas Kebandarudaraan', 'Kelompok ini mencakup kegiatan atau usaha jasa pelayanan pesawat udara dan penumpang yang terdiri atas penyediaan dan/atau pengembangan fasilitas untuk kegiatan pelayanan pendaratan, lepas landas, manuver, parkir dan penyimpanan pesawat udara (PJP4U) termasuk semua fasilitas yang terdapat di landas pacu (runway), taxiway, apron serta penanganan kecelakaan pesawat udara dan pemadam kebakaran, fasilitas terminal untuk pelayanan angkutan penumpang (PJP2U) termasuk pelayanan pemakaian garbarata (aviobridge) dan pelayanan pemakaian tempat pelaporan keberangkatan (check-in counter), dan kegiatan atau usaha jasa terkait untuk menunjang kegiatan pelayanan operasi pesawat udara di bandar udara termasuk penyediaan hanggar pesawat udara, perbengkelan pesawat udara, pelayanan teknis penanganan pesawat udara di darat (ground handling), pelayanan penumpang dan bagasi, pemeriksaan barang muatan dalam kargo dan/atau peti kemas dengan menggunakan sumber radiasi pengion (zat radioaktif dan pembakit radiasi pengion), dan depo pengisian bahan bakar pesawat udara (DPPU).', 'kbli_52231', NULL, NULL),
(1204, '52232', 'Jasa Pelayanan Navigasi Penerbangan', 'Kelompok ini mencakup kegiatan atau usaha Pelayanan Lalu Lintas Penerbangan (air traffic services/ATS) seperti pelayanan pemanduan lalu lintas penerbangan, informasi penerbangan dan kesiagaan, Pelayanan Telekomunikasi Penerbangan (aeronautical telecommunication/COM) seperti pelayanan aeronautika tetap, aeronautika bergerak dan radio navigasi aeronautika, Pelayanan informasi aeronautika (aeronautical information service/AIS) seperti pelayanan informasi aeronautika dan peta penerbangan, penerbitan dan penyebarluasan NOTAM (notice to airmen), pelayanan informasi aeronautika bandar udara, Pelayanan informasi meteorologi penerbangan (aeronautical meteorological service/MET), Pelayanan informasi pencarian dan pertolongan (search and rescue/SAR). Termasuk juga jasa penyediaan bangunan operasi dan bangunan penunjang kegiatan lalu lintas udara, misalnya menara pengawas, bangunan khusus penumpanan peralatan, briefing office untuk koordinasi terkait kegiatan lalu lintas penerbangan. Kegiatan yang berhubungan dengan pelayanan lalu lintas penerbangan, telekomunikasi penerbangan, konstruksi telekomunikasi navigasi penerbangan, instalasi peralatan navigasi penerbangan, dan pemberian informasi-informasi terkait penerbangan, misalnya pengoperasian fasilitas atau peralatan-peralatan navigasi penerbangan, telekomunikasi penerbangan, informasi aeronautika, informasi meteorologi penerbangan, dan informasi pencarian dan pertolongan, berikut fasilitas atau peralatan pendukungnya yaitu mekanikal, elektrikal, elektronika dan teknologi informasi.', 'kbli_52232', NULL, NULL),
(1205, '52240', 'Penanganan Kargo (Bongkar Muat Barang)', 'Kelompok ini mencakup usaha penanganan bongkar muat barang kargo dari angkutan darat, angkutan jalan, angkutan air dan angkutan atas dasar balas jasa (fee) atau kontrak. Kegiatannya mencakup kegiatan memuat dan membongkar barang kargo terlepas dari jenis angkutan yang digunakan, Kegiatan terminal kargo berikut fasilitas pendukungnya, kegiatan bongkar muat kapal dan kegiatan bongkar muat kendaraan dengan kereta gerbong barang.', 'kbli_52240', NULL, NULL),
(1206, '52291', 'Jasa Pengurusan Transportasi (JPT)', 'Kelompok ini mencakup usaha pengiriman dan atau pengepakan barang dalam volume besar, melalui angkutan kereta api, angkutan darat, angkutan laut maupun angkutan udara.', 'kbli_52291', NULL, NULL),
(1207, '52292', 'Aktivitas Ekspedisi Muatan Kereta Api dan Ekspedisi Angkutan Darat (EMKA & EAD)', 'Kelompok ini mencakup usaha pengiriman dan atau pengepakan barang dalam volume besar, baik yang diangkut melalui kereta api maupun alat angkutan darat.', 'kbli_52292', NULL, NULL),
(1208, '52293', 'Aktivitas Ekspedisi Muatan Kapal (EMKL)', 'Kelompok ini mencakup usaha pengiriman dan atau pengepakan barang dalam volume besar, yang diangkut melalui angkutan laut.', 'kbli_52293', NULL, NULL),
(1209, '52294', 'Aktivitas Ekspedisi Muatan Pesawat Udara (EMPU)', 'Kelompok ini mencakup usaha pengiriman dan atau pengepakan barang dalam volume besar, yang diangkut melalui alat angkutan udara.', 'kbli_52294', NULL, NULL),
(1210, '52295', 'Angkutan Multimoda', 'Kelompok ini mencakup angkutan barang dengan menggunakan paling sedikit 2 (dua) moda angkutan yang berbeda atas dasar 1 (satu) kontrak sebagai dokumen angkutan multimoda dari satu tempat diterimanya barang oleh badan usaha angkutan multimoda ke suatu tempat yang ditentukan untuk penyerahan barang kepada penerima barang angkutan multimoda. Badan usaha angkutan multimoda tidak semata-mata memberikan layanan angkutan barang dari tempat asal sampai ke tujuan, tetapi juga memberikan jasa tambahan berupa jasa pengurusan transportasi (freight forwarding), jasa pergudangan, jasa konsolidasi muatan, penyediaan ruang muatan, serta pengurusan kepabeanan untuk angkutan multimoda ke luar negeri dan ke dalam negeri.', 'kbli_52295', NULL, NULL),
(1211, '52296', 'Jasa Penunjang Angkutan Udara', 'Kelompok ini mencakup usaha yang secara langsung berhubungan dengan kegiatan angkutan udara niaga antara lain sistem reservasi melalui komputer (computerized reservation system), pemasaran dan penjualan tiket pesawat atau agen penjualan umum (ticket marketing and selling), pelayanan di darat untuk penumpang dan kargo (ground handling), penyewaan pesawat udara (aircraft leasing), organisasi perawatan pesawat udara (aircraft maintenance organization), agen pengurus persetujuan terbang (flight approval), regulated agent/known consignor.', 'kbli_52296', NULL, NULL),
(1212, '52297', 'Jasa Keagenan Kapal/Agen Perkapalan Perusahaan Pelayaran', 'Kelompok ini mencakup usaha untuk mengurus kepentingan kapal perusahan angkutan laut asing dan/atau kapal perusahaan angkutan laut nasional selama berada di Indonesia, mencakup pelaporan rencana dan realisasi kedatangan dan keberangkatan kapal, pengurusan jasa kepelabuhan, penunjukan perusahaan bongkar muat, penyelesaian dokumen kapal, pembukuan dan pencairan muatan, penerbitan konosemen untuk dan atas nama pemilik kapal, penyelesaian pengisian bunker bahan bakar minyak dan air tawar, serta pemenuhan kebutuhan perlengkapan dan perbekalan, dan pelaksanaan kegiatan lainnya yang disepakati pemiliki kapal atau operator kapal dengan pelaksana kegiatan keagenan kapal.', 'kbli_52297', NULL, NULL),
(1213, '52298', 'Aktivitas Tally Mandiri', 'Kelompok ini mencakup usaha menghitung, mengukur, menimbang dan membuat catatan mengenai muatan, untuk kepentingan pemilik muatan dan atau pengangkut. Termasuk kegiatan tally mandiri di pelabuhan.', 'kbli_52298', NULL, NULL),
(1214, '52299', 'Aktivitas Penunjang Angkutan Lainnya YTDL', 'Kelompok ini mencakup usaha pengiriman dan/atau pengepakan barang dalam volume besar lainnya, selain yang tercakup dalam kelompok 52291 s.d. 52298, seperti jasa pengiriman dan/atau pengepakan benda berharga asal muatan kapal yang tenggelam dan benda budaya lainnya. Jasa pengepakan atas dasar balas jasa (fee) atau kontrak yang tidak ada hubungannya dengan kegiatan pengangkutan dimasukkan dalam Jasa Pengepakan (82920).', 'kbli_52299', NULL, NULL),
(1215, '53100', 'Aktivitas Pos', 'Kelompok ini mencakup kegiatan layanan pos yang beroperasi di bawah kewajiban pelayanan universal, yaitu pengiriman pos jenis tertentu yang wajib dijamin oleh pemerintah untuk menjangkau seluruh wilayah NKRI yang memungkinkan masyarakat mengirimkan dan/atau menerima kiriman dari satu tempat ke tempat lain di dunia. Aktivitas ini dilaksanakan oleh penyelenggara pos yang ditunjuk oleh pemerintah dengan tarif layanan sebagaimana ditentukan oleh pemerintah. Kegiatan yang dilakukan meliputi penggunaan infrastruktur layanan universal, termasuk lokasi ritel, fasilitas sortir dan pengolahan, dan rute operator untuk pengambilan dan pengiriman surat. Pengiriman meliputi surat, kartu pos, barang cetakan (koran, majalah, item iklan, barang cetakan dalam kantong khusus, dll), bungkusan kecil, paket, sekogram, barang atau dokumen. Termasuk juga jasa lain yang diperlukan untuk mendukung kewajiban pelayanan universal. Kegiatan ini dapat dilakukan melalui satu atau lebih moda transportasi baik dengan angkutan milik sendiri maupun angkutan umum.', 'kbli_53100', NULL, NULL),
(1216, '53201', 'Aktivitas Kurir', 'Kelompok ini mencakup usaha jasa pelayanan pengiriman barang yang dilakukan secara komersial selain kegiatan pengiriman pos universal. Kegiatannya mencakup pengumpulan/pengambilan, penyortiran/pemrosesan, pengangkutan dan pengantaran surat, dokumen, parsel, barang, dan paket baik domestik maupun internasional melalui perusahaan dengan menggunakan satu atau lebih jenis angkutan dan kegiatannya dapat menggunakan angkutan pribadi atau angkutan umum. Aktivitas ini meliputi seluruh kegiatan penyelenggaraan pos yang jenis dan tarif layanannya ditetapkan oleh penyelenggara pos berdasarkan formula perhitungan berbasis biaya sebagaimana ditetapkan oleh pemerintah.', 'kbli_53201', NULL, NULL),
(1217, '53202', 'Aktivitas Agen Kurir', 'Kelompok ini mencakup usaha jasa swasta sebagai mitra usaha penyelenggara pos yang menyelenggarakan kegiatan pengumpulan dan pemrosesan barang baik domestik maupun internasional. Kelompok ini tidak mencakup pengangkutan, dan pengantaran.', 'kbli_53202', NULL, NULL),
(1218, '55110', 'Hotel Bintang', 'Kelompok ini mencakup usaha penyediaan jasa pelayanan penginapan yang memenuhi ketentuan sebagai hotel bintang, serta jasa lainnya bagi umum dengan menggunakan sebagian atau seluruh bangunan.', 'kbli_55110', NULL, NULL),
(1219, '55120', 'Hotel Melati', 'Kelompok ini mencakup usaha penyediaan jasa layanan penginapan bagi umum yang dikelola secara komersial dengan menggunakan sebagian atau seluruh bagian bangunan yang telah memenuhi ketentuan sebagai hotel melati yang ditetapkan dalam surat keputusan instansi yang membinanya.', 'kbli_55120', NULL, NULL),
(1220, '55130', 'Pondok Wisata', 'Kelompok ini mencakup usaha penyediaan jasa pelayanan penginapan bagi umum dengan pembayaran harian yang dilakukan perseorangan dengan menggunakan bangunan rumah tinggal yang dihuni oleh pemiliknya dan dimanfaatkan sebagian untuk disewakan dengan memberikan kesempatan kepada wisatawan untuk berinteraksi dalam kehidupan sehari-hari pemiliknya.', 'kbli_55130', NULL, NULL),
(1221, '55191', 'Penginapan Remaja (Youth Hostel)', 'Kelompok ini mencakup usaha penyediaan jasa penginapan yang biasanya digunakan wisatawan sebagai akomodasi dapat berupa ruangan/kamar yang dapat digunakan bermalam bersama-sama (sharing room) atau sendiri dalam rangka kegiatan pariwisata dengan tujuan untuk rekreasi, memperluas pengetahuan/pengalaman, dan perjalanan.', 'kbli_55191', NULL, NULL),
(1222, '55192', 'Bumi Perkemahan, Persinggahan Karavan dan Taman Karavan', 'Kelompok ini mencakup usaha penyediaan tempat penginapan di alam terbuka dengan menggunakan tenda atau dengan menggunakan karavan, termasuk pula karavan (kereta gandengan) yang dibawa sendiri. Misalnya Bumi Perkemahan Cibubur, dan Persinggahan Karavan Taman Safari.', 'kbli_55192', NULL, NULL),
(1223, '55193', 'Vila', 'Kelompok ini mencakup usaha penyediaan jasa pelayanan penginapan bagi umum yang merupakan rumah-rumah pribadi yang khusus disewakan kepada wisatawan berikut fasilitasnya dan dikelola sendiri oleh pemiliknya.', 'kbli_55193', NULL, NULL),
(1224, '55194', 'Apartemen Hotel', 'Kelompok ini mencakup usaha penyediaan jasa pelayanan penginapan bagi umum yang mengelola dan memfungsikan apartemen sebagai hotel untuk tempat tinggal sementara, dengan perhitungan pembayaran sesuai ketentuan. Misalnya apartemen hotel/kondominium hotel (apartel/kondotel).', 'kbli_55194', NULL, NULL),
(1225, '55199', 'Penyediaan Akomodasi Jangka Pendek Lainnya', 'Kelompok ini mencakup usaha penyediaan jasa pelayanan penginapan yang belum termasuk dalam kelompok 55191 sd. 55194, seperti usaha penyediaan akomodasi jangka pendek lainnya seperti bungalo, cottage dan lain-lain. Termasuk motel dan pondok tamu (guesthouse).', 'kbli_55199', NULL, NULL),
(1226, '55900', 'Penyediaan Akomodasi Lainnya', 'Kelompok ini mencakup usaha penyediaan jasa pelayanan penginapan dalam periode waktu yang tidak singkat. Termasuk usaha penyediaan akomodasi untuk jangka yang lebih lama atau sementara baik kamar sendiri atau kamar bersama atau asrama untuk pelajar, pekerja musiman dan sejenisnya. Misalnya kegiatan penyediaan akomodasi ini mencakup tempat tinggal pelajar, asrama sekolah, asrama atau pondok pekerja dan rumah kost, baik dengan makan maupun tidak dengan makan.', 'kbli_55900', NULL, NULL),
(1227, '56101', 'Restoran', 'Kelompok ini mencakup jenis usaha jasa menyajikan makanan dan minuman untuk dikonsumsi di tempat usahanya, bertempat di sebagian atau seluruh bangunan permanen, dilengkapi dengan jasa pelayanan meliputi memasak dan menyajikan sesuai pesanan.', 'kbli_56101', NULL, NULL),
(1228, '56102', 'Rumah/Warung Makan', 'Kelompok ini mencakup jenis usaha jasa penyediaan makanan dan minuman untuk dikonsumsi di tempat usahanya yang bertempat di sebagian atau seluruh bangunan tetap (tidak berpindah-pindah), yang menyajikan makanan dan minuman di tempat usahanya.', 'kbli_56102', NULL, NULL),
(1229, '56103', 'Kedai Makanan', 'Kelompok ini mencakup usaha jasa pangan yang menjual dan menyajikan makanan siap dikonsumsi yang melalui proses pembuatan di tempat tetap yang dapat dipindah-pindahkan atau dibongkar pasang, biasanya dengan menggunakan tenda, seperti kedai seafood, pecel ayam dan lain-lain.', 'kbli_56103', NULL, NULL),
(1230, '56104', 'Penyediaan Makanan Keliling/Tempat Tidak Tetap', 'Kelompok ini mencakup usaha jasa pangan yang menjual dan menyajikan makanan siap dikonsumsi yang didahului dengan proses pembuatan dan biasanya dijual dengan cara berkeliling, seperti tukang bakso keliling, tukang gorengan keliling, tukang otak-otak keliling, tukang empek-empek keliling dan lain-lain.', 'kbli_56104', NULL, NULL),
(1231, '56109', 'Restoran dan penyediaan makanan keliling lainnya', 'Kelompok ini mencakup kegiatan yang menyediakan jasa menyajikan makanan lainnya yang belum termasuk dalam kelompok 56101 - 56104, seperti penyediaan jasa makan siap saji di pasar, supermarket, di sebuah lokasi umum dan atau berhubungan dengan angkutan dimana aktivitas utamanya berhubungan dengan menyajikan makanan dan minuman. Termasuk usaha cake dan bakery dengan jasa pelayanan, food court, food truck, food stall.', 'kbli_56109', NULL, NULL),
(1232, '56210', 'Jasa Boga Untuk Suatu Event Tertentu (Event Catering)', 'Kelompok ini mencakup kegiatan yang menyediakan jasa makanan atas dasar kontrak perjanjian dengan pelanggan, lokasi ditentukan oleh pelanggan untuk suatu event tertentu. Kelompok ini mencakup usaha jasa makanan jadi (siap dikonsumsi) yang terselenggara melalui pesanan-pesanan kantor, perayaan, pesta, seminar, rapat, dan sejenisnya. Biasanya makanan saji diantar ke tempat kerja, pesta, seminar, rapat, dan sejenisnya berikut pramusaji yang akan melayani tamu-tamu/peserta seminar atau rapat pada saat pesta, seminar/kegiatan acara berlangsung.', 'kbli_56210', NULL, NULL),
(1233, '56290', 'Penyediaan Jasa Boga Periode Tertentu', 'Kelompok ini mencakup kegiatan yang menyediakan jasa boga/katering yaitu jasa penyediaan makanan atas dasar kontrak perjanjian dengan pelanggan, untuk periode waktu tertentu. Kegiatannya mencakup kontraktor jasa penyedia makanan (misalnya untuk perusahaan transportasi), jasa katering berdasarkan perjanjian di fasilitas olahraga dan fasilitas sejenis, seperti kantin atau kafetaria (misalnya untuk pabrik, perkantoran, rumahsakit, atau sekolah) atas dasar konsesi atau jasa katering yang melayani rumah tangga. Termasuk dalam kelompok ini jasa katering Industri yang melayani jangka panjang tempat pengeboran minyak dan lokasi tambang, rumah sakit, jasa angkutan.', 'kbli_56290', NULL, NULL),
(1234, '56301', 'Bar', 'Kelompok ini mencakup usaha yang kegiatannya menghidangkan minuman beralkohol dan nonalkohol serta makanan kecil untuk umum di tempat usahanya dan telah mendapatkan ijin dari instansi yang membinanya.', 'kbli_56301', NULL, NULL),
(1235, '56302', 'Kelab Malam Atau Diskotek Yang Utamanya Menyediakan Minuman', 'Kelompok ini mencakup suatu usaha penyediaan jasa pelayanan minum sebagai kegiatan utama di mana menyediakan juga tempat dan fasilitas untuk menari dengan diiringi musik hidup, atraksi pertunjukkan lampu sebagai layanan tambahan serta pramuria.', 'kbli_56302', NULL, NULL),
(1236, '56303', 'Rumah Minum/Kafe', 'Kelompok ini mencakup jenis usaha penyediaan utamanya minuman baik panas maupun dingin dikonsumsi di tempat usahanya, bertempat di sebagian atau seluruh bangunan permanen, baik dilengkapi dengan peralatan/perlengkapan untuk proses pembuatan dan penyimpanan maupun tidak dan baik telah mendapatkan surat keputusan sebagai rumah minum dari instansi yang membinanya maupun belum.', 'kbli_56303', NULL, NULL),
(1237, '56304', 'Kedai Minuman', 'Kelompok ini mencakup usaha penyediaan jasa pelayanan minum yang utamanya menyajikan minuman siap dikonsumsi yang melalui proses pembuatan di tempat tetap yang dapat dipindah-pindahkan atau dibongkar pasang, biasanya dengan menggunakan tenda, seperti kedai kopi, kedai jus dan minuman lainnya.', 'kbli_56304', NULL, NULL),
(1238, '56305', 'Rumah/Kedai Obat Tradisional', 'Kelompok ini mencakup jenis usaha yang bertempat di sebagian atau seluruh bangunan permanen yang menjual dan menyajikan minuman jamu atau obat tradisional untuk umum di tempat usahanya, baik dilengkapi dengan peralatan/perlengkapan untuk proses pembuatan dan penyimpanan maupun tidak dan baik telah mendapatkan surat keputusan sebagai rumah jamu dari instansi yang membinanya maupun belum. Kelompok ini juga mencakup usaha penyediaan jasa pelayanan minum yang menyajikan minuman jamu siap dikonsumsi yang melalui proses pembuatan di tempat tetap yang dapat dipindah- pindahkan atau dibongkar pasang, biasanya dengan menggunakan tenda, seperti kedai jamu.', 'kbli_56305', NULL, NULL),
(1239, '56306', 'Penyediaan Minuman Keliling/Tempat Tidak Tetap', 'Kelompok ini mencakup usaha penyediaan jasa pelayanan minum  yang menyajikan minuman siap dikonsumsi yang didahului dengan proses pembuatan dan biasanya dijual dengan cara berkeliling, seperti penyedia minuman es doger,  penyedia minuman es cincau, usaha jamu gendong dan lain-lain.', 'kbli_56306', NULL, NULL),
(1240, '58110', 'Penerbitan Buku', 'Kelompok  ini mencakup kegiatan penerbitan buku dalam bentuk cetak, elektronik (CD, CD-ROM, DVD dan lain-lain), audio atau pada internet. Kegiatan usahanya meliputi penerbitan buku, brosur, leaflet dan publikasi sejenis, termasuk penerbitan kamus dan ensiklopedia, penerbitan atlas, peta dan grafik, penerbitan buku dalam bentuk audio dan penerbitan ensiklopedia dan lain-lain dalam CD-ROM dan publikasi lainnya. Termasuk penerbitan elektroniknya.', 'kbli_58110', NULL, NULL),
(1241, '58120', 'Penerbitan Direktori dan Mailing List', 'Kelompok ini mencakup penerbitan daftar informasi (database). Penerbitan ini dapat dipublikasikan baik dalam bentuk elektronik atau cetak.  Kegiatan usahanya meliputi penerbitan daftar alamat (mailing list), penerbitan buku telepon dan penerbitan direktori dan kompilasi lainnya, seperti perkara hukum, kompendium farmasi dan lain-lain.', 'kbli_58120', NULL, NULL),
(1242, '58130', 'Penerbitan Surat Kabar, Jurnal Dan Buletin Atau Majalah', 'Kelompok ini mencakup usaha penerbitan surat kabar dan surat kabar iklan, jurnal, buletin, majalah umum dan teknis, komik, termasuk penerbitan jadwal siaran radio dan televisi dan sebagainya. Informasi ini dapat dipublikasikan dalam bentuk elektronik maupun cetak, termasuk di internet.', 'kbli_58130', NULL, NULL),
(1243, '58190', 'Aktivitas  Penerbitan lainnya', 'Kelompok ini mencakup usaha penerbitan foto-foto, seni grafis dan kartu pos, formulir, poster, reproduksi karya seni (lukisan) dan material periklanan dan materi cetakan lainnya. Termasuk penerbitan statistik dan informasi lainnya secara online dan rekaman mikro film.', 'kbli_58190', NULL, NULL),
(1244, '58200', 'Penerbitan piranti lunak (Software)', 'Kelompok ini mencakup kegiatan usaha penerbitan perangkat lunak yang siap pakai (bukan atas dasar pesanan), seperti sistem operasi, aplikasi bisnis dan lainnya dan video game untuk semua platform sistem operasi.', 'kbli_58200', NULL, NULL),
(1245, '59111', 'Aktivitas Produksi Film, Video dan Program Televisi Oleh Pemerintah', 'Kelompok ini mencakup usaha pembuatan dan produksi gambar bergerak, film, video, animasi, program televisi atau iklan bergerak televisi yang dikelola oleh pemerintah atas dasar balas jasa juga usaha pembuatan film untuk televisi dan jasa pengiriman film dan agen pembukuan film. Kelompok ini tidak mecakup aktivitas duplikasi film dan reproduksi audio/video dari master copies (18202) dan animasi pascaproduksi (5912).', 'kbli_59111', NULL, NULL),
(1246, '59112', 'Aktivitas Produksi Film, Video dan Program Televisi Oleh Swasta', 'Kelompok ini mencakup usaha pembuatan dan produksi gambar bergerak, film, video, animasi, program televisi atau iklan bergerak televisi yang dikelola oleh swasta atas dasar balas jasa juga usaha pembuatan film untuk televisi dan jasa pengiriman film dan agen pembukuan film. Kelompok ini tidak mecakup aktivitas duplikasi film dan reproduksi audio/video dari master copies (18202) dan animasi pascaproduksi (5912).', 'kbli_59112', NULL, NULL),
(1247, '59121', 'Aktivitas Pascaproduksi Film, Video dan Program Televisi Oleh Pemerintah', 'Kelompok ini mencakup kegiata usaha pascaproduksi, seperti editing, cutting, dubbing, titling dan credit film, closed captioning, pembuatan grafis komputer, animasi dan special effects dan transfer film atau tape termasuk kegiatan studio perfilman dan studio khusus film animasi yang melakukan pengembangan dan pemrosesan film dan reproduksi film untuk distribusi ke bioskop serta kegiatan dokumentasi potongan film atau gambar bergerak yang dikelola oleh pemerintah atas dasar balas jasa.', 'kbli_59121', NULL, NULL),
(1248, '59122', 'Aktivitas Pascaproduksi Film,  Video dan Program Televisi Oleh Swasta', 'Kelompok ini mencakup kegiata usaha pascaproduksi, seperti editing, cutting, dubbing, titling dan credit film, closed captioning, pembuatan grafis komputer, animasi dan special effects dan transfer film atau tape termasuk kegiatan studio perfilman dan studio khusus film animasi yang melakukan pengembangan dan pemrosesan film dan reproduksi film untuk distribusi ke bioskop serta kegiatan dokumentasi potongan film atau gambar bergerak yang dikelola oleh swasta atas dasar balas jasa.', 'kbli_59122', NULL, NULL),
(1249, '59131', 'Aktivitas Distribusi Film, Video dan Program televisi Oleh Pemerintah', 'Kelompok ini mencakup usaha pendistribusian film, video tape, DVD dan produksi sejenis untuk bioskop gambar bergerak atau film layar lebar, jaringan dan stasiun televisi dan penyelenggara pameran yang dikelola oleh pemerintah atas dasar balas jasa. Termasuk kegiatan perolehan hak distribusi gambar bergerak, film, video tape dan DVD.', 'kbli_59131', NULL, NULL),
(1250, '59132', 'Aktivitas Distribusi Film,  Video dan Program Televisi Oleh Swasta', 'Kelompok ini mencakup usaha pendistribusian film, video tape, DVD dan produksi sejenis untuk bioskop gambar bergerak atau film layar lebar, jaringan dan stasiun televisi dan penyelenggara pameran yang dikelola oleh swasta atas dasar balas jasa. Termasuk kegiatan perolehan hak distribusi gambar bergerak, film, video tape dan DVD.', 'kbli_59132', NULL, NULL),
(1251, '59140', 'Aktivitas Pemutaran Film', 'Kelompok ini mencakup usaha penyelenggara pemutaran film atau video tape di bioskop, di ruang terbuka atau di tempat pemutaran film lainnya dan kegiatan kelab cinema yang dikelola baik oleh pemerintah maupun swasta.', 'kbli_59140', NULL, NULL),
(1252, '59201', 'Aktivitas Perekaman Suara', 'Kelompok ini mencakup usaha pembuatan master rekaman suara asli di piringan hitam, pita tape, compact disc (CD) dan sejenisnya dan kegiatan jasa perekaman suara di studio atau tempat lain, termasuk hasil pemrograman radio yang direkam (tidak langsung), audio untuk film, televisi dan lain-lain. Penerbitan rekaman film dan video termasuk kelompok 59131 dan 59132. Penerbitan perangkat lunak komputer termasuk kelompok 58200.', 'kbli_59201', NULL, NULL),
(1253, '59202', 'Aktivitas Penerbitan Musik Dan Buku Musik', 'Kelompok ini mencakup usaha penerbitan musik, seperti perolehan dan pencatatan hak cipta untuk gubahan musik, promosi, pengesahan dan penggunaan gubahan dalam perekaman, radio, televisi, film, pertunjukkan langsung, media cetak dan lainnya dan pendistribusian rekaman suara ke pedagang besar, eceran atau langsung ke masyarakat. Termasuk penerbitan buku musik dan buku lembaran musik.', 'kbli_59202', NULL, NULL),
(1254, '60101', 'Penyiaran Radio Oleh Pemerintah', 'Kelompok ini mencakup kegiatan pemerintah dalam usaha penyelengggaraan siaran radio, seperti penyiaran sinyal suara melalui studio penyiaran radio dan fasilitas untuk transmisi pemograman sinyal suara kepada masyarakat atau pendengar; kegiatan jaringan radio, yaitu mengumpulkan dan mengirimkan program sinyal suara untuk para pendengar lewat udara, kabel atau satelit; kegiatan penyiaran radio lewat internet (stasiun radio internet); dan penyiaran data yang terintegrasi dengan penyiaran radio. Termasuk juga station relay (pemancar kembali) siaran radio. Kegiatan pemancaran radio dan televisi secara langsung atau pemancaran ulang yang didasarkan atas dasar balas jasa (fee) dan kontrak dimasukkan dalam kelompok 61991.', 'kbli_60101', NULL, NULL),
(1255, '60102', 'Penyiaran Radio Oleh Swasta', 'Kelompok ini mencakup kegiatan dalam usaha penyelenggaraan siaran radio yang dikelola oleh swasta, seperti penyiaran sinyal suara melalui studio penyiaran radio dan fasilitas untuk transmisi pemograman sinyal suara kepada masyarakat atau pendengar; kegiatan jaringan radio, yaitu mengumpulkan dan mengirimkan program sinyal suara untuk para pendengar lewat udara, kabel atau satelit; kegiatan penyiaran radio lewat internet (stasiun radio internet); dan penyiaran data yang terintegrasi dengan penyiaran radio. Termasuk juga station relay (pemancar kembali) siaran radio. Kegiatan pemancaran radio dan televisi secara langsung atau pemancaran ulang yang didasarkan atas dasar balas jasa (fee) dan kontrak dimasukkan dalam kelompok 61991.', 'kbli_60102', NULL, NULL),
(1256, '60201', 'Aktivitas Penyiaran dan Pemrograman Televisi Oleh Pemerintah', 'Kelompok ini mencakup kegiatan pemerintah dalam usaha penyelenggaraan siaran televisi, termasuk juga station relay (pemancar kembali) siaran televisi, seperti pembuatan program saluran televisi lengkap dari komponen program yang dibeli (seperti film, dokumenter dan lain-lain), komponen program yang dihasilkan sendiri (seperti berita lokal, laporan langsung) atau kombinasi keduanya); pemograman dari saluran video atas dasar permintaan; dan penyiaran data yang diintegrasikan dengan siaran televisi. Program televisi lengkap dapat disiarkan sendiri atau melalui distribusi pihak ketiga, seperti perusahaan kabel atau provider televisi satelit. Pemograman dapat bersifat umum atau khusus (misalnya format  terbatas seperti program berita, olahraga, pendidikan atau program yang ditujukan untuk anak muda), dapat dibuat dengan bebas tersedia untuk pemakai atau dapat hanya tersedia atas dasar langganan. Kegiatan pemancaran radio dan televisi secara langsung atau pemancaran ulang yang didasarkan atas dasar balas jasa (fee) dan kontrak dimasukkan dalam kelompok 61933.', 'kbli_60201', NULL, NULL),
(1257, '60202', 'Aktivitas Penyiaran dan Pemrograman Televisi Oleh Swasta', 'Kelompok ini mencakup kegiatan dalam usaha penyelenggaraan siaran televisi yang dikelola oleh swasta, termasuk juga station relay (pemancar kembali) siaran televisi, seperti pembuatan program saluran televisi lengkap dari komponen program yang dibeli (seperti film, dokumenter dan lain-lain), komponen program yang dihasilkan sendiri (seperti berita lokal, laporan langsung) atau kombinasi keduanya); pemrograman dari saluran video atas dasar permintaan; dan penyiaran data yang diintegrasikan dengan siaran televisi. Program televisi lengkap dapat disiarkan sendiri atau melalui distribusi pihak ketiga, seperti perusahaan kabel atau provider televisi satelit. Pemograman dapat bersifat umum atau khusus (misalnya format  terbatas seperti program berita, olahraga, pendidikan atau program yang ditujukan untuk anak muda), dapat dibuat dengan bebas tersedia untuk pemakai atau dapat hanya tersedia atas dasar langganan. Kegiatan pemancaran radio dan televisi secara langsung atau pemancaran ulang yang didasarkan atas dasar balas jasa (fee) dan kontrak dimasukkan dalam kelompok 61933.', 'kbli_60202', NULL, NULL),
(1258, '61100', 'Aktivitas Telekomunikasi Dengan Kabel', 'Kelompok ini mencakup kegiatan pengoperasian, pemeliharaan atau penyediaan akses pada fasilitas untuk pengiriman suara, data, teks,  bunyi dan video dengan menggunakan infrastruktur kabel telekomunikasi, seperti pengoperasian dan perawatan fasilitas pengubahan dan pengiriman untuk menyediakan komunikasi titik ke titik melalui saluran darat, gelombang mikro atau perhubungan saluran data dan satelit, pengoperasian sistem pendistribusian kabel (yaitu untuk pendistribusian data dan sinyal televisi) dan pelengkapan telegrap dan komunikasi non vocal lainnya yang menggunakan fasilitas sendiri. Dimana fasilitas transmisi yang melakukan kegiatan ini, bisa berdasarkan teknologi tunggal atau kombinasi dari berbagai teknologi. Termasuk pembelian akses dan jaringan kapasitas dari pemilik dan operator dari jaringan dan menyediakan jasa telekomunikasi yang menggunakan kapasitas ini untuk usaha dan rumah tangga dan penyediaan akses internet melalui operator infrastruktur dengan kabel. Kegiatan penyelenggaraan jaringan untuk telekomunikasi tetap yang dimaksudkan bagi terselenggaranya telekomunikasi publik dan sirkuit sewa. Termasuk kegiatan sambungan komunikasi data yang pengirimannya dilakukan secara paket, melalui suatu sentral atau melalui jaringan lain, seperti Public Switched Telephone Network (PSTN). Termasuk juga kegiatan penyelenggaraan jaringan teristerial yang melayani pelanggan bergerak tertentu antara lain jasa radio trunking dan jasa radio panggil untuk umum.', 'kbli_61100', NULL, NULL),
(1259, '61200', 'Aktivitas Telekomunikasi Tanpa Kabel', 'Kelompok ini mencakup kegiatan penyelenggaraan jaringan yang melayani telekomunikasi bergerak dengan teknologi seluler di permukaan bumi. Kegiatannya mencakup pengoperasian, pemeliharaan atau penyediaan akses pada fasilitas untuk mentranmisikan suara, data, teks, bunyi dan video menggunakan infrastruktur komunikasi tanpa kabel dan pemeliharaan dan pengoperasian nomor panggil (paging), seperti halnya jaringan telekomunikasi selular dan telekomunikasi tanpa kabel lainnya. Fasilitas transmisi menyediakan transmisi omni-directional melalui gelombang udara yang dapat berdasarkan teknologi tunggal atau kombinasi beberapa teknologi. Termasuk pembelian akses dan kapasitas jaringan dari pemilik dan operator jaringan serta menyediakan jasa jaringan tanpa kabel (kecuali satelit) untuk kegiatan bisnis dan rumah tangga dan penyediaan akses internet melalui operator infrastruktur jaringan tanpa kabel.', 'kbli_61200', NULL, NULL),
(1260, '61300', 'Aktivitas Telekomunikasi Satelit', 'Kelompok ini mencakup kegiatan penyelenggaraan jaringan yang melayani telekomunikasi bergerak melalui satelit Stasiun bumi, Sentral gerbang dan Jaringan penghubung. Kegiatan pada kelompok ini mencakup pengoperasian, perawatan atau penyediaan akses terhadap fasilitas untuk mentransmisikan suara, data, teks dan video menggunakan infrastruktur telekomunikasi satelit, pengiriman audio visual atau program teks yang diterima dari jaringan kabel, stasiun televisi lokal atau jaringan radio ke konsumen melalui sistem satelit yang langsung terhubung ke rumah (unit yang diklasifikasikan di sini umumnya tidak berasal dari materi pemrograman). Termasuk kegiatan penyediaan akses internet melalui operator infrastruktur satelit.', 'kbli_61300', NULL, NULL),
(1261, '61911', 'Jasa Panggilan Premium (Premium Call)', 'Kelompok ini mencakup usaha jasa panggilan atau percakapan ke nomor tertentu yang mempunyai awalan 0809, dan diberlakukan tarif premium. Sifat akses \"\"\"\"Premium Call \"\"\"\" adalah \"\"\"\"normally closed\"\"\"\" yaitu dibuka apabila ada permintaan dari pelanggan.', 'kbli_61911', NULL, NULL),
(1262, '61912', 'Jasa Konten SMS Premium', 'Kelompok ini mencakup usaha jasa untuk menyediakan konten melalui jaringan bergerak seluler yang pembebanan biayanya melalui pengurangan deposit prabayar atau tagihan telepon pascabayar pelanggan jaringan bergerak seluler. Konten yang disediakan adalah semua bentuk informasi yang dapat berupa tulisan, gambar, suara, animasi, atau kombinasi dari semuanya dalam bentuk digital, termasuk software aplikasi untuk diunduh dan SMS premium.', 'kbli_61912', NULL, NULL),
(1263, '61913', 'Jasa Internet Teleponi Untuk Keperluan Publik (ITKP)', 'Kelompok ini mencakup usaha jasa untuk mentransmisi panggilan melalui jaringan Internet Protocol (IP). Kegiatan ini menyelenggarakan internet teleponi yang bersifat komersial, dihubungkan ke jaringan telekomunikasi.', 'kbli_61913', NULL, NULL),
(1264, '61914', 'Jasa Panggilan Terkelola (Calling Card)', 'Kelompok ini mencakup usaha jasa untuk menyediakan layanan panggilan teleponi dengan tambahan fitur yang dapat mengelola panggilan dan/atau tagihan melalui proses tambahan autentikasi pemakai atau kode akses sebelum dilakukan panggilan teleponi.', 'kbli_61914', NULL, NULL),
(1265, '61919', 'Jasa Nilai Tambah Teleponi Lainnya', 'Kelompok ini mencakup kegiatan lainnya jasa nilai tambah teleponi dan termasuk jasa penunjang telekomunikasi lainnya.', 'kbli_61919', NULL, NULL),
(1266, '61921', 'Internet Service Provider', 'Kelompok ini mencakup usaha jasa pelayanan yang ditawarkan suatu perusahaan kepada pelanggannya untuk mengakses internet, atau bisa disebut sebagai pintu gerbang ke internet.', 'kbli_61921', NULL, NULL),
(1267, '61922', 'Jasa Sistem Komunikasi Data', 'Kelompok ini mencakup kegiatan jasa sistem komunikasi data yang dapat digunakan untuk pengiriman suara, gambar, data, informasi dan paket. Layanan ini disediakan dengan jaminan ketersambungan, kualitas dan keamanan.', 'kbli_61922', NULL, NULL),
(1268, '61923', 'Jasa Televisi Protokol Internet (IPTV)', 'Kelompok ini mencakup usaha jasa untuk menyediakan layanan konvergen radio dan televisi, video, audio, teks, grafik dan data yang disalurkan melalui jaringan protokol internet yang dijamin kualitas layanannya, keamanannya, kehandalannya, dan mampu memberikan layanan komunikasi dengan pelanggan secara dua arah (interaktif).', 'kbli_61923', NULL, NULL),
(1269, '61924', 'Jasa Interkoneksi Internet (NAP)', 'Kelompok ini mencakup kegiatan menyelenggarakan akses dan atau ruting bagi penyelenggara jasa akses internet. Dalam menyelenggarakan akses bagi penyelenggara jasa akses internet, penyelenggara jasa interkoneksi internet dapat menyediakan jaringanh untuk transmisi internet. Penyelenggara jasa interkoneksi internet wajib saling terhubung melalui interkoneksi. Penyelenggara jasa interkoneksi melelkukan pengaturan trafik penyelenggaraan jasa akses internet.', 'kbli_61924', NULL, NULL),
(1270, '61925', 'JASA PENYEDIA KONTEN MELALUI JARINGAN BERGERAK SELULER ATAU JARINGAN TETAP LOKAL TANPA KABEL DENGAN MOBILITAS TERBATAS', 'Kelompok ini mencakup usaha jasa untuk menyediakan konten melalui jaringan bergerak seluler atau jaringan tetap lokal tanpa kabel dengan mobilitas terbatas yang pembebanan biayanya melalui pengurangan deposit prabayar atau tagihan telepon pascabayar pelanggan jaringan bergerak seluler dan jaringan tetap lokal tanpa kabel dengan mobilitas terbatas. Konten yang disediakan adalah semua bentuk informasi yang dapat berupa tulisan, gambar, suara, animasi, atau kombinasi dari semuanya dalam bentuk digital, termasuk software aplikasi untuk diunduh', 'kbli_61925', NULL, NULL),
(1271, '61929', 'Jasa Multimedia Lainnya', 'Kelompok ini mencakup kegiatan jasa multimedia lainnya yang belum tercakup dalam kelompok 61921 sampai dengan 61924.', 'kbli_61929', NULL, NULL),
(1272, '61991', 'Aktivitas Telekomunikasi Khusus Untuk Penyiaran', 'Kelompok ini mencakup usaha penyelenggaraan telekomunikasi yang khusus digunakan untuk keperluan penyiaran, ciri-cirinya bersifat memancar satu arah dan terus menerus; diterima langsung oleh penerima; bersifat tetap dan bergerak; menampilkan gambar dan atau suara; dan peruntukan siarannya untuk masyarakat luas. Biasanya penyelenggara kegiatan ini menyewa jaringan sebagai sarana transmisi untuk keperluan penyiaran dari penyelenggaraan jaringan telekomunikasi  lain.', 'kbli_61991', NULL, NULL),
(1273, '61992', 'Aktivitas Telekomunikasi Khusus Untuk Keperluan Sendiri', 'Kelompok ini mencakup usaha penyelenggaraan telekomunikasi yang khusus digunakan untuk keperluan sendiri dalam hal pengembangan hobi dan latih diri.', 'kbli_61992', NULL, NULL),
(1274, '61993', 'Aktivitas Telekomunikasi Khusus Untuk Keperluan Pertahanan Keamanan', 'Kelompok ini mencakup usaha penyelenggaraan telekomunikasi yang khusus digunakan untuk keperluan pertahanan keamanan negara.', 'kbli_61993', NULL, NULL),
(1275, '61994', 'Jasa Jual Kembali Jasa Telekomunikasi', 'Kelompok ini mencakup usaha penyelenggaraan jasa jual kembali jasa telekomunikasi, seperti warung telepon (wartel) yang menyediakan jasa telepon, faksimili, teleks, dan telegraf, jasa jual kembali akses internet seperti Warung Internet/Internet Caf dan jasa jual kembali jasa telekomunikasi lainnya.', 'kbli_61994', NULL, NULL),
(1276, '61999', 'Aktivitas Telekomunikasi Lainnya YTDL', 'Kelompok ini mencakup usaha penyelenggaraan telekomunikasi lainnya yang belum dicakup di tempat lain. Termasuk dalam kelompok ini adalah kegiatan penjualan pulsa, baik voucher pulsa maupun elektronik dan penjualan kartu perdana telepon seluler.', 'kbli_61999', NULL, NULL),
(1277, '62011', 'Aktivitas Pengembangan Video game', 'Kelompok ini mencakup kegiatan pengembangan video game, seperi kegiatan desain konsep game, pengembangan piranti lunak video game, pembuatan aset grafis, pembuatan animasi yang berkaitan dengan video game, pembuatan suara dan musik, pengujian video game, dan dukungan lainnya untuk video game.', 'kbli_62011', NULL, NULL),
(1278, '62012', 'Aktivitas Pengembangan Aplikasi Perdagangan Melalui Internet (E-Commerce)', 'Kelompok ini mencakup kegiatan pengembangan aplikasi perdagangan melalui internet (e-commerce). Kegiatan meliputi konsultasi, analisi dan pemograman aplikasi untuk kegiatan perdagangan melalui internet.', 'kbli_62012', NULL, NULL),
(1279, '62013', 'Aktivitas Pemrograman dan Produksi Konten Media Imersif', 'Kelompok ini mencakup konsultasi dan produksi yang berkaitan dengan analisis, desain dan pemrograman dari sistem media imersif  seperti VR (Virtual Reality)/AR (Augmented Reality)/MR (Mixed Reality). Kegiatan ini biasanya menyangkut analisis kebutuhan pengguna sistem media imersif dan permasalahannya termasuk pula penulisan program sesuai kebutuhan pengguna media imersif. Pembuatan 3D visual dan video 360 serta modifikasinya khusus untuk media imersif.', 'kbli_62013', NULL, NULL),
(1280, '62014', 'Aktivitas Pengembangan Teknologi Blockchain', 'Kelompok ini mencakup kegiatan pengembangan teknologiblockchain, seperti kegiatanimplementasi smart contract,perancangan infrastrukturblockchainpublik danblockchainprivat. Kelompok ini tidak mencakup perdagangan berjangka komoditas aset kripto (6615).', 'kbli_62014', NULL, NULL),
(1281, '62015', 'Aktivitas Pemrograman Berbasis Kecerdasan Artifisial', 'Kelompok ini mencakup konsultasi yang dilanjutkan analisis dan pemrograman yang memanfaatkan teknologi kecerdasan artifisial (AI) termasuk subset dari AI seperti machine learning, natural language processing, expert system, dan subset AI lainnya.', 'kbli_62015', NULL, NULL),
(1282, '62019', 'Aktivitas Pemrograman Komputer Lainnya', 'Kelompok ini mencakup konsultasi yang berkaitan dengan analisis, desain dan pemrograman dari sistem yang siap pakai lainnya (selain yang sudah dicakup di kelompok 62011 dan 62015). Kegiatan ini biasanya menyangkut analisis kebutuhan pengguna komputer dan permasalahannya, pemecahan permasalahan, dan membuat perangkat lunak berkaitan dengan pemecahan masalah tersebut. Termasuk pula penulisan program sederhana sesuai kebutuhan pengguna komputer.   Perancangan  struktur dan isi dari, dan/atau penulisan kode komputer yang diperlukan untuk membuat dan mengimplementasikan, seperti piranti lunak sistem (pemutakhiran dan perbaikan), piranti lunak aplikasi (pemutakhiran dan perbaikan), basis data dan laman web. Termasuk penyesuaian perangkat lunak, misalnya modifikasi dan penyesuaian konfigurasi aplikasi yang sudah ada sehingga berfungsi dalam lingkungan sistem informasi klien. Kegiatan penyesuaian perangkat lunak sejenis yang dilaksanakan sebagai bagian yang tak terpisahkan dari penjualan perangkat lunak dimasukkan dalam subgolongan 47413.', 'kbli_62019', NULL, NULL),
(1283, '62021', 'Aktivitas Konsultasi Keamanan Informasi', 'Kelompok ini mencakup kegiatan layanan konsultasi perencanaan dan pengawasan keamanan informasi, pemeriksaan atau penjaminan (assurance) keamanan informasi, dan pembangunan dan penerapan keamanan informasi.', 'kbli_62021', NULL, NULL),
(1284, '62022', 'Aktivitas Penyediaan Identitas Digital', 'Kelompok ini mencakup kegiatan penyediaan identitas digital yang merupakan representasi entitas di dalam sistem elektronik. Identitas digital dapat diterbitkan dalam beberapa tingkat assurance/kepercayaan berdasarkan risiko dalam pembuktian identitas. Kegiatan ini dapat berupa proses digital dalam hal registrasi, validasi, penyimpanan, autentikasi, termasuk manajemen atribut biografis maupun biometrik yang diasosiasikan dengan kredensial untuk suatu entitas. Kredensial dibuat dalam dalam bentuk digital, seperti unique number, user account, dan sertifikat elektronik.', 'kbli_62022', NULL, NULL),
(1285, '62023', 'Aktivitas Penyediaan Sertifikat Elektronik dan Layanan yang Menggunakan Sertifikat Elektronik', 'Kelompok ini mencakup kegiatan penyelenggaraan sertifikasi elektronik dan penyelenggaraan layanan yang menggunakan sertifikat elektronik, seperti tanda tangan elektronik, segel elektronik, penanda waktu elektronik, layanan pengiriman elektronik tercatat, autentikasi situs web, dan preservasi tanda tangan elektronik dan/atau segel elektronik.', 'kbli_62023', NULL, NULL),
(1286, '62024', 'Aktivitas Konsultasi dan Perancangan Internet of Things (IoT)', 'Kelompok ini mencakup kegiatan layanan konsultasi, perancangan dan pembuatan solusi sistem terintegrasi berdasarkan pesanan (bukan siap pakai) dengan cara memodifikasi perangkat keras (hardware) yang sudah ada, seperti sensor, microcontroller, dan perangkat keras (hardware) lainnya. Modifikasi tersebut dilakukan pada perangkat keras (hardware) IoT dan/atau perangkat lunak (software) yang tertanam didalamnya. Kelompok ini tidak mencakup aktivitas manufaktur chip (26120) dan aktivitas penerbitan/pengembangan perangkat lunak IoT (58200 dan 62019).', 'kbli_62024', NULL, NULL),
(1287, '62029', 'Aktivitas Konsultasi Komputer dan Manajemen Fasilitas Komputer Lainnya', 'Kelompok ini mencakup usaha konsultasi tentang tipe dan konfigurasi dari perangkat keras komputer dengan atau tanpa dikaitkan dengan aplikasi piranti lunak. Perencanaan dan perancangan sistem komputer yang mengintegrasikan perangkat keras, piranti lunak dan teknologi komunikasi komputer. Konsultasi biasanya menyangkut analisis kebutuhan pengguna komputer dan permasalahannya, serta memberikan jalan keluar yang terbaik. Unit yang diklasifikasikan dalam subgolongan ini dapat menyediakan komponen sistem perangkat keras dan piranti lunak sebagai bagian dari jasa yang terintegrasi atau komponen ini dapat disediakan oleh pihak ketiga atau vendor. Unit yang diklasifikasikan dalam subgolongan ini pada umumnya menginstal sistem dan melatih serta mendukung pengguna sistem. Termasuk penyediaan manajemen dan pengoperasian sistem komputer klien dan/atau fasilitas pengolahan data di tempat klien, demikian juga jasa pendukung terkait.', 'kbli_62029', NULL, NULL),
(1288, '62090', 'Aktivitas Teknologi Informasi Dan Jasa Komputer Lainnya', 'Kelompok ini mencakup kegiatan teknologi informasi dan jasa komputer lainnya yang terkait dengan kegiatan yang belum diklasifikasikan di tempat lain, seperti pemulihan kerusakan komputer, instalasi (setting up) personal komputer dan instalasi perangkat lunak. Termasuk juga kegiatan manajemen insiden dan digital forensik. Kelompok ini mencakup berbagai usaha yang berkaitan dengan komputer yang belum tercakup dalam golongan 6201-6202.', 'kbli_62090', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(1289, '63111', 'Aktivitas Pengolahan Data', 'Kelompok ini mencakup kegiatan pengolahan dan tabulasi semua jenis data. Kegiatan ini bisa meliputi keseluruhan tahap pengolahan dan penulisan laporan dari data yang disediakan pelanggan, atau hanya sebagian dari tahapan pengolahan. Termasuk pembagian fasilitas mainframe ke klien dan penyediaan entri data dan kegiatan pengelolaan data besar (big data).', 'kbli_63111', NULL, NULL),
(1290, '63112', 'Aktivitas Hosting dan Ybdi', 'Kelompok ini mencakup usaha jasa pelayanan yang berkaitan dengan penyediaan infrastruktur hosting, layanan pemrosesan data dan kegiatan ybdi dan spesialisasi dari hosting, seperti web-hosting, jasa streaming dan aplikasi hosting.  Termasuk di sini penyimpanan komputasi awan (cloud computing).', 'kbli_63112', NULL, NULL),
(1291, '63121', 'Portal Web Dan/Atau Platform Digital Tanpa Tujuan Komersial', 'Kelompok ini mencakup pengoperasian situs web tanpa tujuan komersial yang menggunakan mesin pencari untuk menghasilkan dan memelihara basis data (database) besar dari alamat dan isi internet dalam format yang mudah dicari; pengoperasian situs web yang bertindak sebagai portal ke internet, seperti situs media yang menyediakan isi yang diperbarui secara berkala tanpa tujuan komersial; pengoperasian platform digital dan/atau situs/portal web yang melakukan transaksi elektronik berupa kegiatan usaha fasilitasi dan/atau mediasi pemindahan kepemilikan barang dan/atau jasa dan/atau layanan lainnya melalui internet dan/atau perangkat elektronik dan/atau cara dengan sistem elektronik lainnya tanpa tujuan komersial.', 'kbli_63121', NULL, NULL),
(1292, '63122', 'Portal Web Dan/Atau Platform Digital Dengan Tujuan Komersial', 'Kelompok ini mencakup pengoperasian situs web dengan tujuan komersial yang menggunakan mesin pencari untuk menghasilkan dan memelihara basis data (database) besar dari alamat dan isi internet dalam format yang mudah dicari; pengoperasian situs web yang bertindak sebagai portal ke internet, seperti situs media yang menyediakan isi yang diperbarui secara berkala, baik secara langsung ataupun tidak langsung dengan tujuan komersial; pengoperasian platform digital dan/atau situs/portal web yang melakukan transaksi elektronik berupa kegiatan usaha fasilitasi dan/atau mediasi pemindahan kepemilikan barang dan/atau jasa dan/atau layanan lainnya melalui internet dan/atau perangkat elektronik dan/atau cara sistem elektronik lainnya yang dilakukan dengan tujuan komersial (profit) yang mencakup aktivitas baik salah satu, sebagian ataupun keseluruhan transaksi elektronik, yaitu pemesanan, pembayaran, pengiriman atas kegiatan tersebut. Termasuk dalam kelompok ini adalah situs/portal web dan/atau platform digital yang bertujuan komersial (profit) merupakan aplikasi yang digunakan untuk fasilitasi dan/atau mediasi layanan-layanan transaksi elektronik, seperti pengumpul pedagang (marketplace), digital advertising, dan on demand online services. Kelompok ini tidak mencakup financial technology (Fintech). Fintech Peer to Peer (P2P) Lending (6495) dan Fintech jasa pembayaran (6641).', 'kbli_63122', NULL, NULL),
(1293, '63911', 'Aktivitas Kantor Berita Oleh Pemerintah', 'Kelompok ini mencakup kegiatan pemerintah dalam usaha mencari, mengumpulkan, mengolah dan sekaligus mempublikasikan berita melalui media cetak elektronik, dengan tujuan untuk menyampaikannya kepada masyarakat sebagai informasi, seperti Kantor Berita Antara.', 'kbli_63911', NULL, NULL),
(1294, '63912', 'Aktivitas Kantor Berita Oleh Swasta', 'Kelompok ini mencakup usaha mengumpulkan dan menyebarluaskan berita melalui media cetak maupun elektronik dengan tujuan untuk menyampaikannya kepada masyarakat sebagai informasi yang dikelola oleh swasta.', 'kbli_63912', NULL, NULL),
(1295, '63990', 'Aktivitas Jasa Informasi Lainnya YTDL', 'Kelompok ini mencakup usaha jasa informasi lainnya yang tidak dapat diklasifikasikan di tempat lain, seperti jasa informasi berbasis telepon, jasa pencarian informasi atas dasar balas jasa atau kontrak dan jasa kliping berita, jasa kliping pers dan lain-lain. Termasuk dalam kelompok ini kegiatan jasa penyedia konten.', 'kbli_63990', NULL, NULL),
(1296, '64110', 'Bank Sentral', 'Kelompok ini mencakup kegiatan bank sentral. Bank sentral adalah Bank Indonesia sebagai lembaga negara yang diamanatkan oleh Undang-Undang Dasar Negara Republik Indonesia tahun 1945 sebagai bank sentral Negara Republik Indonesia, yang memiliki tugas untuk menetapkan dan melaksanakan kebijakan moneter, menetapkan dan melaksanakan kebijakan sistem pembayaran dan pengelolaan uang rupiah, dan menetapkan dan melaksanakan kebijakan di bidang stabilitas sistem keuangan termasuk makroprudensial.', 'kbli_64110', NULL, NULL),
(1297, '64121', 'Bank Umum Konvensional', 'Kelompok ini mencakup kegiatan usaha bank secara konvensional, meliputi penghimpunan dana dari masyarakat dalam bentuk simpanan dan menyalurkannya kepada masyarakat dalam bentuk kredit dan/ atau bentuk-bentuk lainnya, serta menyelenggarakan kegiatan jasa dalam sistem pembayaran.', 'kbli_64121', NULL, NULL),
(1298, '64122', 'Bank Umum Syariah', 'Kelompok ini mencakup kegiatan usaha bank berdasarkan prinsip syariah, meliputi penghimpunan dana dari masyarakat dalam bentuk simpanan dan/atau investasi serta menyalurkannya kepada masyarakat dalam bentuk pembiayaan dan/atau bentuk lainnya berdasarkan prinsip syariah, serta memberikan jasa dalam sistem pembayaran.', 'kbli_64122', NULL, NULL),
(1299, '64123', 'Unit Usaha Syariah Bank Umum', 'Kelompok ini mencakup kegiatan usaha yang dilakukan oleh unit kerja dari kantor pusat bank umum konvensional yang berfungsi sebagai kantor induk dari kantor atau unit yang melaksanakan kegiatan usaha berdasarkan prinsip syariah, atau unit kerja di kantor cabang dari suatu bank yang berkedudukan di luar negeri yang melaksanakan kegiatan usaha secara konvensional yang berfungsi sebagai kantor induk dari kantor cabang pembantu syariah dan/atau unit syariah.', 'kbli_64123', NULL, NULL),
(1300, '64131', 'Bank Perkreditan Rakyat', 'Kelompok ini mencakup kegiatan usaha bank secara konvensional, meliputi penghimpunan dana dari masyarakat dalam bentuk simpanan berupa deposito, tabungan, dan/ atau bentuk lainnya yang dipersamakan dengan itu  dan menyalurkannya kepada masyarakat dalam bentuk kredit, yang dalam kegiatannya tidak memberikan jasa dalam lalu lintas pembayaran.', 'kbli_64131', NULL, NULL),
(1301, '64132', 'Bank Pembiayaan Rakyat Syariah', 'Kelompok ini mencakup kegiatan usaha bank berdasarkan prinsip syariah, meliputi penghimpunan dana dari masyarakat dalam bentuk simpanan dan/atau investasi serta menyalurkannya kepada masyarakat dalam bentuk pembiayaan dan/atau bentuk lainnya berdasarkan prinsip syariah, yang dalam kegiatannya tidak memberikan jasa dalam lalu lintas pembayaran.', 'kbli_64132', NULL, NULL),
(1302, '64141', 'Koperasi Simpan Pinjam Primer (KSP Primer)', 'Kelompok ini mencakup koperasi primer yang hanya melaksanakan usaha simpan pinjam. KSP Primer didirikan oleh dan beranggotakan orang seorang.', 'kbli_64141', NULL, NULL),
(1303, '64142', 'Unit Simpan Pinjam Koperasi Primer (USP Koperasi Primer)', 'Kelompok ini mencakup unit usaha koperasi primer yang bergerak di bidang usaha simpan pinjam. USP Koperasi Primer dibentuk oleh koperasi primer dan beranggotakan orang seorang.', 'kbli_64142', NULL, NULL),
(1304, '64143', 'Koperasi Simpan Pinjam Sekunder (KSP Sekunder)', 'Kelompok ini mencakup koperasi sekunder yang hanya melaksanakan usaha simpan pinjam. KSP Sekunder didirikan oleh dan beranggotakan koperasi yang melaksanakan usaha simpan pinjam.', 'kbli_64143', NULL, NULL),
(1305, '64144', 'Unit Simpan Pinjam Koperasi Sekunder (USP Koperasi Sekunder)', 'Kelompok ini mencakup unit usaha koperasi sekunder yang bergerak di bidang usaha simpan pinjam. USP Koperasi Sekunder dibentuk oleh koperasi sekunder dan beranggotakan koperasi yang melaksanakan usaha simpan pinjam.', 'kbli_64144', NULL, NULL),
(1306, '64145', 'Koperasi Simpan Pinjam dan Pembiayaan Syariah Primer (KSPPS Primer)', 'Kelompok ini mencakup koperasi primer yang melaksanakan usaha simpan pinjam dan pembiayaan syariah, termasuk mengelola zakat, infak, sedekah, dan wakaf (maal). KSPPS Primer didirikan oleh dan beranggotakan orang seorang.', 'kbli_64145', NULL, NULL),
(1307, '64146', 'Unit Simpan Pinjam dan Pembiayaan Syariah Koperasi Primer (USPPS Koperasi Primer)', 'Kelompok ini mencakup unit usaha koperasi primer yang bergerak di bidang usaha simpan pinjam dan pembiayaan syariah, termasuk mengelola zakat, infak, sedekah, dan wakaf (maal). USPPS Koperasi Primer dibentuk oleh koperasi primer dan beranggotakan orang seorang.', 'kbli_64146', NULL, NULL),
(1308, '64147', 'Koperasi Simpan Pinjam dan Pembiayaan Syariah Sekunder (KSPPS Sekunder)', 'Kelompok ini mencakup koperasi sekunder yang melaksanakan usaha simpan pinjam dan pembiayaan syariah, termasuk mengelola zakat, infak, sedekah, dan wakaf. KSPPS Sekunder didirikan oleh dan beranggotakan koperasi yang melaksanakan usaha simpan pinjam dan pembiayaan syariah.', 'kbli_64147', NULL, NULL),
(1309, '64148', 'Unit Simpan Pinjam dan Pembiayaan Syariah Koperasi Sekunder (USPPS Koperasi Sekunder)', 'Kelompok ini mencakup unit usaha koperasi sekunder yang bergerak di bidang usaha simpan pinjam dan pembiayaan syariah, termasuk mengelola zakat, infak, sedekah, dan wakaf (maal). USPPS Koperasi Sekunder dibentuk oleh koperasi sekunder dan beranggotakan koperasi yang melaksanakan usaha simpan pinjam dan pembiayaan syariah.', 'kbli_64148', NULL, NULL),
(1310, '64151', 'Lembaga Keuangan Mikro Konvensional', 'Kelompok ini mencakup usaha lembaga keuangan mikro yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi jasa pengembangan usaha dan pemberdayaan masyarakat, baik melalui pinjaman dalam usaha skala mikro kepada anggota dan masyarakat, pengelolaan simpanan, maupun pemberian jasa konsultasi pengembangan usaha, yang tidak semata-mata mencari keuntungan. Lembaga keuangan mikro konvensional yang termasuk kelompok ini antara lain bank desa, lumbung desa, bank pasar, bank pegawai, Badan Kredit Desa (BKD), Badan Kredit Kecamatan (BKK), Kredit Usaha Rakyat Kecil (KURK), Lembaga Perkreditan Kecamatan (LPK), Bank Karya Produksi Desa (BKPD), Badan Usaha Kredit Pedesaan (BUKP), dan sejenisnya.', 'kbli_64151', NULL, NULL),
(1311, '64152', 'Lembaga Keuangan Mikro Syariah', 'Kelompok ini mencakup usaha lembaga keuangan mikro syariah yang seluruhnya diselenggarakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi jasa pengembangan usaha dan pemberdayaan masyarakat, baik melalui pembiayaan dalam usaha skala mikro kepada anggota dan masyarakat, pengelolaan simpanan, maupun pemberian jasa konsultasi pengembangan usaha, yang tidak semata-mata mencari keuntungan. Lembaga keuangan mikro syariah yang termasuk dalam kelompok ini antara lain Bank Wakaf Mikro (BWM), Baitul Maal wa Tamwil (BMT), Baitul Tamwil Muhammaddiyah (BTM), dan sejenisnya.', 'kbli_64152', NULL, NULL),
(1312, '64190', 'Perantara moneter lainnya', 'Kelompok ini mencakup penerimaan simpanan dan/atau penutupan simpanan dan pemberian kredit atau pinjaman dana.  Bantuan kredit dapat berbagai macam bentuk, seperti pinjaman, pinjaman dengan jaminan, kartu kredit, dan lain-lain. Kegiatan ini pada umumnya dilakukan oleh lembaga keuangan selain bank sentral, seperti jasa perantara keuangan yang tidak diklasifikasikan di tempat lain, seperti rentenir, credit union, kegiatan giro pos,  dan laku pandai (tabungan pos), lembaga khusus yang berwenang memberikan kredit untuk pembelian rumah dan juga mengambil deposito dan kegiatan money order (pengiriman uang).', 'kbli_64190', NULL, NULL),
(1313, '64200', 'Aktivitas Perusahaan Holding', 'Kelompok  ini mencakup kegiatan dari perusahaan holding (holding companies), yaitu perusahaan yang menguasai aset  dari sekelompok perusahaan subsidiari dan kegiatan utamanya adalah kepemilikan kelompok tersebut.  \"\"\"\"Holding Companies\"\"\"\" tidak terlibat dalam kegiatan usaha perusahaan subsidiarinya.   Kegiatannya mencakup jasa yang diberikan penasihat (counsellors) dan perunding (negotiators) dalam merancang merger dan akuisisi perusahaan.', 'kbli_64200', NULL, NULL),
(1314, '64300', 'Trust, Pendanaan dan Entitas Keuangan Sejenis', 'Kelompok ini mencakup entitas legal yang dibentuk untuk mengumpulkan saham atau sekuritas atau aset keuangan lainnya, tanpa pengaturan, atas nama pemegang saham atau yang memperoleh keuntungan. Portofolionya disesuaikan untuk mendapatkan karakteristik investasi yang spesifik, seperti diversifikasi, risiko, tingkat pengembalian dan perubahan harga. Entitas ini memperoleh bunga, dividen, dan pendapatan properti lain, tetapi mempunyai sedikit bahkan tidak mempunyai pekerjaan dan tidak ada pendapatan dari penjualan jasa. Kelompok ini mencakup pembiayaan investasi open-end, pembiayaan investasi closed-end, trust, estates atau perantara account, diawasi atas nama penerima keuntungan berdasarkan perjanjian trust surat wasiat atau perjanjian perantara, unit pembiayaan trust investasi.', 'kbli_64300', NULL, NULL),
(1315, '64400', 'Otoritas Jasa Keuangan (OJK)', 'Kelompok ini mencakup kegiatan Otoritas Jasa Keuangan terkait dengan fungsi pengaturan, pengawasan, pemeriksaan, dan penyidikan terhadap: kegiatan jasa keuangan di sektor perbankan; kegiatan jasa keuangan di sektor pasar modal; dan kegiatan jasa keuangan di sektor perasuransian, dana pensiun, lembaga pembiayaan, dan lembaga jasa keuangan lainnya.', 'kbli_64400', NULL, NULL),
(1316, '64500', 'Lembaga Penjamin Simpanan (LPS)', 'Kelompok ini mencakup kegiatan perolehan dana yang berasal dari kontribusi bank saat pertama kali menjadi peserta, pembayaran premi penjaminan, dan hasil investasi. Dalam rangka memelihara stabilitas sistem perbankan, LPS melaksanakan penanganan (resolusi) bank gagal dengan beberapa metode yaitu Purchase and Assumptions (P&A), bridge bank, Penyertaan Modal Sementara (PMS), dan likuidasi bank.', 'kbli_64500', NULL, NULL),
(1317, '64911', 'Perusahaan Pembiayaan Konvensional', 'Kelompok ini mencakup usaha perusahaan pembiayaan yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi pembiayaan barang dan/atau jasa, yaitu: pembiayaan investasi; pembiayaan modal kerja; pembiayaan multiguna; dan/atau kegiatan usaha pembiayaan lain berdasarkan persetujuan Otoritas Jasa Keuangan. Selain kegiatan usaha tersebut, perusahaan pembiayaan konvensional dalam kelompok ini dapat melakukan sewa operasi (operating lease) dan/atau kegiatan berbasis imbal jasa sepanjang tidak bertentangan dengan ketentuan peraturan perundang-undangan di sektor jasa keuangan.', 'kbli_64911', NULL, NULL),
(1318, '64912', 'Perusahaan Pembiayaan Syariah', 'Kelompok ini mencakup usaha perusahaan pembiayaan yang seluruh kegiatan usahanya melakukan pembiayaan syariah, meliputi pembiayaan jual beli; pembiayaan investasi; dan/atau pembiayaan jasa.', 'kbli_64912', NULL, NULL),
(1319, '64913', 'Unit Usaha Syariah Perusahaan Pembiayaan', 'Kelompok ini mencakup kegiatan unit kerja dari kantor pusat perusahaan pembiayaan yang melaksanakan kegiatan pembiayaan syariah dan/atau berfungsi sebagai kantor induk dari kantor yang melaksanakan pembiayaan syariah.', 'kbli_64913', NULL, NULL),
(1320, '64921', 'Pergadaian Konvensional', 'Kelompok ini mencakup usaha pergadaian yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi: penyaluran uang pinjaman dengan jaminan berdasarkan hukum gadai; penyaluran uang pinjaman dengan jaminan berdasarkan fidusia; pelayanan jasa titipan barang berharga; pelayanan jasa taksiran; kegiatan lain yang tidak terkait usaha pergadaian yang memberikan pendapatan berdasarkan komisi (fee based income) sepanjang tidak bertentangan dengan peraturan perundang-undangan di bidang jasa keuangan; dan/atau kegiatan usaha lain dengan persetujuan Otoritas Jasa Keuangan.', 'kbli_64921', NULL, NULL),
(1321, '64922', 'Pergadaian Syariah', 'Kelompok ini mencakup usaha pergadaian syariah yang seluruhnya diselenggarakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi: penyaluran uang pinjaman dengan jaminan berdasarkan hukum gadai; penyaluran uang pinjaman dengan jaminan berdasarkan fidusia; pelayanan jasa titipan barang berharga; pelayanan jasa taksiran; kegiatan lain yang tidak terkait usaha pergadaian yang memberikan pendapatan berdasarkan komisi (fee based income) sepanjang tidak bertentangan dengan peraturan perundang-undangan di bidang jasa keuangan; dan/atau kegiatan usaha lain dengan persetujuan Otoritas Jasa Keuangan.', 'kbli_64922', NULL, NULL),
(1322, '64923', 'Unit Usaha Syariah Pergadaian', 'Kelompok ini mencakup kegiatan unit kerja dari kantor pusat perusahaan pergadaian konvensional yang melaksanakan kegiatan usaha pergadaian berdasarkan prinsip syariah atau berfungsi sebagai kantor induk dari kantor di luar kantor pusat perusahaan pergadaian konvensional yang melaksanakan kegiatan usaha pergadaian berdasar prinsip syariah.', 'kbli_64923', NULL, NULL),
(1323, '64931', 'Perusahaan Modal Ventura Konvensional', 'Kelompok ini mencakup usaha modal ventura yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi: penyertaan saham (equity participation); penyertaan melalui pembelian obligasi konversi (quasi equity participation); pembiayaan melalui pembelian surat utang yang diterbitkan pasangan usaha pada tahap rintisan awal (start-up) dan/atau pengembangan usaha; dan/atau pembiayaan usaha produktif. Dalam melakukan usaha modal ventura, perusahaan modal ventura dapat mengelola dana ventura. Selain usaha modal ventura, perusahaan modal ventura dapat menyelenggarakan kegiatan usaha lain yaitu kegiatan jasa berbasis fee dan/atau kegiatan usaha lain dengan persetujuan Otoritas Jasa Keuangan. Kegiatan usaha modal ventura dapat disertai dengan pendampingan kepada pasangan usaha dan/atau debitur.', 'kbli_64931', NULL, NULL),
(1324, '64932', 'Perusahaan Modal Ventura Syariah', 'Kelompok ini mencakup badan usaha yang melakukan kegiatan usaha modal ventura syariah, pengelolaan dana ventura, dan kegiatan usaha lain dengan persetujuan Otoritas Jasa Keuangan yang seluruhnya dilaksanakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi: investasi yang terdiri dari penyertaan saham (equity participation), pembelian sukuk atau obligasi syariah konversi, pembelian sukuk atau obligasi syariah yang diterbitkan pasangan usaha pada tahap rintisan awal (start-up) dan/atau pengembangan usaha, dan/atau pembiayaan berdasarkan prinsip bagi hasil; pelayanan jasa, dan/atau kegiatan usaha lain berdasarkan persetujuan Otoritas Jasa Keuangan.', 'kbli_64932', NULL, NULL),
(1325, '64933', 'Unit Usaha Syariah Modal Ventura', 'Kelompok ini mencakup unit kerja dari kantor pusat Perusahaan Modal Ventura (PMV) yang berfungsi sebagai kantor induk dari kantor yang melaksanakan kegiatan usaha modal ventura syariah.', 'kbli_64933', NULL, NULL),
(1326, '64941', 'Perusahaan Pembiayaan Infrastruktur Konvensional', 'Kelompok ini mencakup usaha perusahaan pembiayaan infrastruktur yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi pembiayaan dalam bentuk penyediaan dana pada proyek infrastruktur, yaitu pemberian pinjaman langsung (direct lending) untuk pembiayaan infrastruktur, refinancing atas infrastruktur yang telah dibiayai pihak lain, dan/atau pemberian pinjaman subordinasi (subordinated loans) yang berkaitan dengan pembiayaan infrastruktur. Untuk mendukung kegiatan usaha, perusahaan pembiayaan infrastruktur dapat pula melakukan pemberian dukungan kredit (credit enhancement), pemberian jasa konsultasi (advisory services), penyertaan modal (equity investment), upaya mencarikan swap market yang berkaitan dengan pembiayaan infrastruktur, dan/atau kegiatan atau pemberian fasilitas lain yang terkait dengan pembiayaan infrastruktur setelah memperoleh persetujuan dari Otoritas Jasa Keuangan.', 'kbli_64941', NULL, NULL),
(1327, '64942', 'Perusahaan Pembiayaan Infrastruktur Syariah', 'Kelompok ini mencakup usaha perusahaan pembiayaan infrastruktur syariah yang seluruhnya diselenggarakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi pembiayaan dalam bentuk penyediaan dana pada proyek infrastruktur, yaitu pemberian pembiayaan langsung (direct lending) untuk pembiayaan infrastruktur, refinancing atas infrastruktur yang telah dibiayai pihak lain, dan/atau pemberian pembiayaan subordinasi (subordinated loans) yang berkaitan dengan pembiayaan infrastruktur. Untuk mendukung kegiatan usaha, perusahaan pembiayaan infrastruktur syariah dapat pula melakukan pemberian dukungan kredit (credit enhancement), pemberian jasa konsultasi (advisory services), penyertaan modal (equity investment), upaya mencarikan swap market yang berkaitan dengan pembiayaan infrastruktur, dan/atau kegiatan atau pemberian fasilitas lain yang terkait dengan pembiayaan infrastruktur setelah memperoleh persetujuan dari Otoritas Jasa Keuangan berdasarkan prinsip syariah.', 'kbli_64942', NULL, NULL),
(1328, '64943', 'Unit Usaha Syariah Perusahaan Pembiayaan Infrastruktur', 'Kelompok ini mencakup kegiatan unit kerja dari kantor pusat perusahaan pembiayaan  infrastruktur konvensional yang melaksanakan kegiatan usaha pembiayaan infrastruktur berdasarkan prinsip syariah dan/atau  yang berfungsi sebagai kantor induk dari kantor di luar kantor pusat perusahaan pembiayaan infrastruktur yang melaksanakan kegiatan usaha pembiayaan infrastruktur berdasar prinsip syariah.', 'kbli_64943', NULL, NULL),
(1329, '64951', 'Layanan Pinjam Meminjam Uang Berbasis Teknologi Informasi (Fintech P2P Lending) Konvensional', 'Kelompok ini mencakup usaha layanan pinjam meminjam uang berbasis teknologi informasi (fintech peer to peer lending) yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi penyediaan, pengelolaan, dan pengoperasian layanan jasa keuangan untuk mempertemukan pemberi pinjaman dengan penerima pinjaman dalam rangka melakukan perjanjian pinjam meminjam dalam mata uang rupiah secara langsung melalui sistem elektronik dengan menggunakan jaringan internet.', 'kbli_64951', NULL, NULL),
(1330, '64952', 'Layanan Pinjam Meminjam Uang Berbasis Teknologi Informasi (Fintech P2P Lending) Syariah', 'Kelompok ini mencakup usaha layanan pinjam meminjam uang berbasis teknologi informasi (fintech peer to peer lending) yang diselenggarakan seluruhnya berdasarkan prinsip syariah,  dengan kegiatan usaha meliputi penyediaan, pengelolaan, dan pengoperasian layanan jasa keuangan untuk mempertemukan pemberi pinjaman dengan penerima pinjaman dalam rangka melakukan akad pembiayaan dalam mata uang rupiah secara langsung melalui sistem elektronik dengan menggunakan jaringan internet.', 'kbli_64952', NULL, NULL),
(1331, '64953', 'Unit Usaha Syariah Layanan Pinjam Meminjam Uang Berbasis Teknologi Informasi  (Fintech P2P Lending)', 'Kelompok ini mencakup kegiatan unit kerja dari kantor pusat penyelenggara layanan pinjam meminjam uang berbasis teknologi informasi (fintech peer to peer lending) konvensional yang melaksanakan kegiatan usaha layanan pinjam meminjam uang berbasis teknologi informasi (fintech peer to peer lending) berdasarkan prinsip syariah dan/atau berfungsi sebagai kantor induk dari kantor yang melaksanakan kegiatan usaha berdasarkan prinsip syariah.', 'kbli_64953', NULL, NULL),
(1332, '64991', 'Lembaga Pembiayaan Ekspor Indonesia', 'Kelompok ini mencakup usaha pembiayaan ekspor nasional, dengan kegiatan usaha meliputi pembiayaan, penjaminan, dan/atau asuransi. Kegiatan pembiayaan ekspor nasional dapat dilaksanakan secara konvensional atau berdasarkan prinsip syariah.', 'kbli_64991', NULL, NULL),
(1333, '64992', 'Perusahaan Pembiayaan Sekunder Perumahan', 'Kelompok ini mencakup usaha pembiayaan sekunder perumahan, dengan kegiatan usaha meliputi sekuritisasi, penyaluran pinjaman atau penyaluran pembiayaan kepada penyalur kredit pemilikan rumah, pelaksanaan tugas khusus dari pemerintah, dan kegiatan usaha lain berdasarkan persetujuan pemegang saham.', 'kbli_64992', NULL, NULL),
(1334, '64999', 'Aktivitas Jasa Keuangan Lainnya Ytdl, Bukan Asuransi dan Dana Pensiun', 'Kelompok ini mencakup kegiatan jasa keuangan lainnya selain fasilitas pembiayaan, penjaminan, dan/atau asuransi dalam ekspor nasional, kegiatan usaha pembiayaan sekunder perumahan yang ditugaskan oleh pemerintah.', 'kbli_64999', NULL, NULL),
(1335, '65111', 'Asuransi Jiwa Konvensional', 'Kelompok ini mencakup usaha asuransi jiwa yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi penyelenggaraan jasa penanggulangan risiko yang memberikan pembayaran kepada pemegang polis, tertanggung, atau pihak lain yang berhak dalam hal tertanggung meninggal dunia atau tetap hidup, atau pembayaran lain kepada pemegang polis, tertanggung, atau pihak lain yang berhak pada waktu tertentu yang diatur dalam perjanjian, yang besarnya telah ditetapkan dan/atau didasarkan pada hasil pengelolaan dana.', 'kbli_65111', NULL, NULL),
(1336, '65112', 'Asuransi Jiwa Syariah', 'Kelompok  ini mencakup usaha asuransi jiwa syariah yang seluruhnya diselenggarakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi pengelolaan risiko berdasarkan prinsip syariah guna saling menolong dan melindungi dengan memberikan pembayaran yang didasarkan pada meninggal atau hidupnya peserta, atau pembayaran lain kepada peserta atau pihak lain yang berhak pada waktu tertentu yang diatur dalam perjanjian, yang besarnya telah ditetapkan dan/atau didasarkan pada hasil pengelolaan dana.', 'kbli_65112', NULL, NULL),
(1337, '65113', 'Unit  Syariah  Asuransi Jiwa', 'Kelompok ini mencakup kegiatan unit syariah dari kantor pusat perusahaan asuransi jiwa konvensional yang berfungsi sebagai kantor induk dari kantor di luar kantor pusat yang menjalankan kegiatan usaha asuransi jiwa syariah.', 'kbli_65113', NULL, NULL),
(1338, '65121', 'Asuransi Umum Konvensional', 'Kelompok ini mencakup usaha asuransi umum yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi penyelenggaraan usaha jasa pertanggungan risiko yang memberikan penggantian kepada tertanggung atau pemegang polis karena kerugian, kerusakan, biaya yang timbul, kehilangan keuntungan, atau tanggung jawab hukum kepada pihak ketiga yang mungkin diderita tertanggung atau pemegang polis karena terjadinya suatu peristiwa yang tidak pasti.', 'kbli_65121', NULL, NULL),
(1339, '65122', 'Asuransi Umum Syariah', 'Kelompok ini mencakup usaha asuransi umum syariah yang seluruhnya diselenggarakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi pengelolaan risiko berdasarkan prinsip syariah guna saling menolong dan melindungi dengan memberikan penggantian kepada peserta atau pemegang polis karena kerugian, kerusakan, biaya yang timbul, kehilangan keuntungan, atau tanggung jawab hukum kepada pihak ketiga yang mungkin diderita peserta atau pemegang polis karena terjadinya suatu peristiwa yang tidak pasti.', 'kbli_65122', NULL, NULL),
(1340, '65123', 'Unit  Syariah  Asuransi Umum', 'Kelompok ini mencakup kegiatan unit kerja dari kantor pusat perusahaan asuransi umum konvensional yang berfungsi sebagai kantor induk dari kantor di luar kantor pusat yang melaksanakan kegiatan usaha asuransi umum berdasar prinsip syariah.', 'kbli_65123', NULL, NULL),
(1341, '65131', 'Perusahaan Penjaminan Konvensional', 'Kelompok ini mencakup usaha penjaminan yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi pemberian penjaminan oleh penjamin atas pemenuhan kewajiban finansial terjamin kepada penerima jaminan yang diselenggarakan secara konvensional. Kelompok ini memiliki kegiatan usaha sebagai berikut: penjaminan kredit, pembiayaan, atau pembiayaan berdasarkan prinsip syariah yang diberikan oleh lembaga keuangan; penjaminan pinjaman yang disalurkan oleh koperasi simpan pinjam atau koperasi yang mempunyai unit usaha simpan pinjam kepada anggotanya; dan penjaminan Kredit dan/atau pinjaman program kemitraan yang disalurkan oleh badan usaha milik negara dalam rangka program kemitraan dan bina lingkungan. Selain ruang lingkup usaha tersebut, perusahaan penjaminan dapat melakukan kegiatan penjaminan atas surat utang, penjaminan pembelian barang secara angsuran, penjaminan transaksi dagang, penjaminan pengadaan barang dan/atau jasa (surety bond), penjaminan bank garansi (kontra bank garansi), penjaminan surat kredit berdokumen dalam negeri, penjaminan letter of credit, penjaminan kepabeanan (customs bond), penjaminan cukai, pemberian jasa konsultasi manajemen terkait dengan kegiatan usaha penjaminan, dan kegiatan usaha lainnya setelah mendapat persetujuan dari Otoritas Jasa Keuangan.', 'kbli_65131', NULL, NULL),
(1342, '65132', 'Perusahaan Penjaminan Syariah', 'Kelompok ini mencakup usaha penjaminan syariah yang seluruhnya diselenggarakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi pemberian penjaminan oleh penjamin syariah atas pemenuhan kewajiban finansial terjamin kepada penerima jaminan. Kelompok ini memiliki kegiatan usaha sebagai berikut: penjaminan pembiayaan berdasarkan prinsip syariah yang diberikan oleh lembaga keuangan; penjaminan pinjaman atau pembiayaan yang disalurkan oleh koperasi simpan pinjam atau koperasi yang mempunyai unit usaha simpan pinjam kepada anggotanya; dan penjaminan pinjaman atau pembiayaan program kemitraan yang disalurkan oleh badan usaha milik negara dalam rangka program kemitraan dan bina lingkungan, yang dilaksanakan seluruhnya berdasarkan prinsip syariah. Selain ruang lingkup usaha tersebut, perusahaan penjaminan syariah juga dapat melakukan kegiatan berdasarkan prinsip syariah penjaminan atas surat utang, penjaminan pembelian barang secara angsuran, penjaminan transaksi dagang, penjaminan pengadaan barang dan/atau jasa (surety bond), penjaminan bank garansi (kontra bank garansi), penjaminan surat kredit berdokumen dalam negeri, penjaminan letter of credit, penjaminan kepabeanan (customs bond), penjaminan cukai, pemberian jasa konsultasi manajemen terkait dengan kegiatan usaha penjaminan, dan kegiatan usaha lainnya setelah mendapat persetujuan dari Otoritas Jasa Keuangan.', 'kbli_65132', NULL, NULL),
(1343, '65133', 'Unit Usaha Syariah Perusahaan Penjaminan', 'Kelompok ini mencakup kegiatan unit usaha syariah dari perusahaan penjaminan konvensional yang berfungsi sebagai kantor induk dari kantor atau unit yang melaksanakan kegiatan usaha penjaminan berdasarkan prinsip syariah.', 'kbli_65133', NULL, NULL),
(1344, '65211', 'Reasuransi Konvensional', 'Kelompok ini mencakup usaha reasuransi yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi usaha penyelenggaraan usaha jasa pertanggungan ulang terhadap risiko yang dihadapi oleh perusahaan asuransi, perusahaan penjaminan, atau perusahaan reasuransi lainnya.', 'kbli_65211', NULL, NULL),
(1345, '65212', 'Reasuransi Syariah', 'Kelompok ini mencakup usaha reasuransi syariah yang seluruhnya diselenggarakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi pengelolaan risiko berdasarkan prinsip syariah atas risiko yang dihadapi oleh perusahaan asuransi syariah, perusahaan penjaminan syariah, atau perusahaan reasuransi syariah lainnya, termasuk unit syariah dari perusahaan reasuransi konvensional.', 'kbli_65212', NULL, NULL),
(1346, '65213', 'Unit Syariah Reasuransi', 'Kelompok ini mencakup kegiatan unit kerja di kantor pusat perusahaan reasuransi konvensional yang berfungsi sebagai kantor induk dari kantor di luar kantor pusat yang melaksanakan kegiatan usaha reasuransi berdasarkan prinsip syariah.', 'kbli_65213', NULL, NULL),
(1347, '65221', 'Perusahaan Penjaminan Ulang Konvensional', 'Kelompok ini mencakup usaha perusahaan penjaminan ulang yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi pemberian jaminan atas pemenuhan kewajiban finansial perusahaan penjaminan.', 'kbli_65221', NULL, NULL),
(1348, '65222', 'Perusahaan Penjaminan Ulang Syariah', 'Kelompok ini mencakup usaha penjaminan ulang syariah yang diselenggarakan seluruhnya berdasarkan prinsip syariah, dengan kegiatan usaha meliputi pemberian jaminan  atas pemenuhan kewajiban finansial perusahaan penjaminan syariah.', 'kbli_65222', NULL, NULL),
(1349, '65311', 'Dana Pensiun Pemberi Kerja Konvensional', 'Kelompok ini mencakup usaha dana pensiun pemberi kerja yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi pengelolaan dana pensiun yang dibentuk oleh orang atau badan yang mempekerjakan karyawan, selaku pendiri, untuk menyelenggarakan program pensiun manfaat pasti atau program pensiun iuran pasti, bagi kepentingan sebagian atau seluruh karyawannya sebagai peserta, yang menimbulkan kewajiban terhadap pemberi kerja.', 'kbli_65311', NULL, NULL),
(1350, '65312', 'Dana Pensiun Pemberi Kerja Syariah', 'Kelompok ini mencakup usaha dana pensiun pemberi kerja yang diselenggarakan berdasarkan prinsip syariah, dengan kegiatan usaha meliputi pengelolaan dana pensiun yang dibentuk oleh orang atau badan yang mempekerjakan karyawan, selaku pendiri, untuk menyelenggarakan program pensiun manfaat pasti atau program pensiun iuran pasti, bagi kepentingan sebagian atau seluruh karyawannya sebagai peserta, yang menimbulkan kewajiban terhadap pemberi kerja.', 'kbli_65312', NULL, NULL),
(1351, '65313', 'Unit Syariah  Dana Pensiun Pemberi Kerja', 'Kelompok ini mencakup kegiatan unit syariah yang dibentuk oleh dana pensiun pemberi kerja konvensional untuk menyelenggarakan program pensiun berdasarkan prinsip syariah.', 'kbli_65313', NULL, NULL),
(1352, '65321', 'Dana Pensiun Lembaga Keuangan Konvensional', 'Kelompok ini mencakup usaha dana pensiun lembaga keuangan yang diselenggarakan secara konvensional, dengan kegiatan usaha meliputi penyelenggaraan  program pensiun iuran pasti bagi perorangan, baik karyawan maupun pekerja mandiri yang terpisah dari dana pensiun pemberi kerja bagi karyawan bank atau perusahaan asuransi jiwa yang bersangkutan.', 'kbli_65321', NULL, NULL),
(1353, '65322', 'Dana Pensiun Lembaga Keuangan Syariah', 'Kelompok ini mencakup usaha dana pensiun lembaga keuangan yang diselenggarakan berdasarkan prinsip syariah, yang meliputi penyelenggaraan program pensiun iuran pasti bagi perorangan, baik karyawan maupun pekerja mandiri yang terpisah dari dana pensiun pemberi kerja bagi karyawan bank atau perusahaan asuransi jiwa yang bersangkutan.', 'kbli_65322', NULL, NULL),
(1354, '66111', 'Bursa Efek', 'Kelompok ini mencakup kegiatan badan usaha yang menyelenggarakan dan menyediakan sistem dan/ atau sarana untuk mempertemukan penawaran (jual dan beli) efek pihak-pihak lain dengan tujuan memperdagangkan efek diantara mereka.', 'kbli_66111', NULL, NULL),
(1355, '66112', 'Lembaga Kliring dan Penjaminan Efek', 'Kelompok ini mencakup kegiatan usaha pihak yang menyelenggarakan jasa kliring dan penjaminan penyelesaian transaksi bursa yang teratur, wajar dan efisien. Termasuk kelompok ini adalah PT Kliring Penjaminan Efek Indonesia (KPEI).', 'kbli_66112', NULL, NULL),
(1356, '66113', 'Lembaga Penyimpanan dan Penyelesaian', 'Kelompok ini mencakup kegiatan usaha pihak yang menyelenggarakan kustodian sentral bagi bank kustodian, perusahaan efek dan pihak lain dan penyelesaian transaksi bursa yang teratur, wajar dan efisien. Termasuk kelompok ini adalah PT Kustodian Sentral Efek Indonesia (KSEI).', 'kbli_66113', NULL, NULL),
(1357, '66114', 'Lembaga Penilaian Harga Efek (LPHE)', 'Kelompok ini mencakup kegiatan pihak yang telah memperoleh izin usaha dari Otoritas Jasa Keuangan untuk melakukan penilaian harga efek dalam rangka menetapkan harga pasar wajar.', 'kbli_66114', NULL, NULL),
(1358, '66115', 'Penyelenggara Dana Perlindungan Pemodal (PDPP)', 'Kelompok ini mencakup kegiatan pihak yang telah mendapatkan izin usaha dari Otoritas Jasa Keuangan untuk dapat menyelenggarakan dan mengelola kumpulan dana perlindungan pemodal yang dibentuk untuk melindungi pemodal dari hilangnya aset pemodal.', 'kbli_66115', NULL, NULL),
(1359, '66116', 'Lembaga Pendanaan Efek', 'Kelompok ini mencakup kegiatan pihak yang telah memperoleh izin usaha dari Otoritas Jasa Keuangan untuk melakukan kegiatan usahapenyediaan fasilitas pinjaman berupa dana dan/atau efek yang diberikan dalam rangka transaksi efek.', 'kbli_66116', NULL, NULL),
(1360, '66117', 'Penyelenggara Pasar Alternatif', 'Kelompok ini mencakup kegiatan pihak yang menyelenggarakan dan menyediakan atau menggunakan sistem elektronik untuk mempertemukan transaksi efek atas efek bersifat utang dan/atau sukuk antar pengguna jasa secara terus-menerus di luar bursa efek.', 'kbli_66117', NULL, NULL),
(1361, '66118', 'Penyelenggara Penawaran Efek Melalui Layanan  Urun Dana Berbasis Teknologi Informasi (Securities Crowdfunding)', 'Kelompok ini mencakup kegiatan pihak yang menyediakan, mengelola, dan mengoperasikan penyelenggaraan penawaran Efek oleh Penerbit yang secara langsung kepada pemodal melalui jaringan sistem elektronik yang bersifat terbuka.', 'kbli_66118', NULL, NULL),
(1362, '66119', 'Penyelenggara Infrastruktur Perdagangan di Pasar Modal Lainnya', 'Kelompok ini mencakup kegiatan badan usaha atau lembaga yang menyediakan dan menyelenggarakan infrastruktur terkait transaksi di pasar modal, selain peran sebagai berikut: menyediakan sarana pelaksanaan transaksi; menyelenggarakan kliring, dan mengelola risiko; melaksanakan penyelesaian transaksi (setelmen); menyelenggarakan penatausahaan, pencatatan, dan pelaporan transaksi; melakukan penilaian harga efek dalam rangka menetapkan harga pasar wajar; menyelenggarakan dan mengelola dana perlindungan pemodal; melakukan pendanaan transaksi efek; dan menyediakan, mengelola, dan mengoperasikan penyelenggaraan layanan penawaran efek yang dilakukan oleh penerbit untuk menjual efek secara langsung kepada pemodal melalui jaringan sistem elektronik yang bersifat terbuka.', 'kbli_66119', NULL, NULL),
(1363, '66121', 'Bursa Berjangka', 'Kelompok ini mencakup kegiatan badan usaha yang menyelenggarakan dan menyediakan sistem dan/atau sarana untuk kegiatan jual beli komoditi berdasarkan kontrak berjangka, kontrak derivatif syariah, dan/atau kontrak derivatif  lainnya.', 'kbli_66121', NULL, NULL),
(1364, '66122', 'Lembaga Kliring dan Penjaminan Berjangka', 'Kelompok ini mencakup kegiatan badan usaha yang menyelenggarakan dan menyediakan sistem dan/atau sarana untuk pelaksanaan kliring dan penjaminan penyelesaian transaksi perdagangan berjangka.', 'kbli_66122', NULL, NULL),
(1365, '66123', 'Bursa Berjangka Penyelenggara Pasar Fisik', 'Kelompok ini mencakup kegiatan badan usaha yang menyelenggarakan dan menyediakan sistem dan/atau sarana untuk kegiatan jual beli komoditi dengan mekanisme pasar fisik di bursa berjangka.', 'kbli_66123', NULL, NULL),
(1366, '66124', 'Lembaga Kliring dan Penjaminan Berjangka Penyelenggara Pasar Fisik', 'Kelompok ini mencakup kegiatan badan usaha yang menyelenggarakan dan menyediakan sistem dan/atau sarana untuk pelaksanaan kliring dan penjaminan penyelesaian transaksi terhadap transaksi yang terjadi melalui pasar fisik di bursa berjangka dan pasar lelang komoditas.', 'kbli_66124', NULL, NULL),
(1367, '66131', 'Penyelenggara Sarana Pelaksanaan Transaksi di Pasar Uang dan Pasar Valuta Asing', 'Kelompok ini mencakup kegiatan badan usaha yang menyediakan teknologi dan menyelenggarakan sarana untuk melaksanakan transaksi di pasar uang dan pasar valuta asing terhadap rupiah. Kelompok ini mencakup antara lain: perusahaan pialang pasar uang dan pasar valuta asing; dan penyedia electronic trading platform di pasar uang dan pasar valuta asing.', 'kbli_66131', NULL, NULL),
(1368, '66132', 'Central Counterparty Transaksi Derivatif Suku Bunga dan Nilai Tukar', 'Kelompok ini mencakup kegiatan lembaga yang menempatkan dirinya di antara para pihak yang melakukan transaksi derivatif suku bunga dan nilai tukar sehingga bertindak sebagai pembeli bagi penjual dan sebagai penjual bagi pembeli, yang memiliki fungsi antara lain: novasi, yaitu proses pengakhiran kontrak awal antara pembeli dengan penjual kemudian menggantikannya dengan dua kontrak baru; penyelenggaraan kliring, yaitu penyelenggaraan proses yang dilakukan setelah terjadinya transaksi; dan pengelolaan risiko, atas transaksi derivatif suku bunga dan nilai tukar.', 'kbli_66132', NULL, NULL),
(1369, '66139', 'Penyelenggara Infrastruktur Pasar Uang dan Pasar Valuta Asing Lainnya', 'Kelompok ini mencakup kegiatan penyelenggara infrastruktur untuk transaksi di pasar uang dan pasar valuta asing terhadap rupiah yang tidak diklasifikasikan di tempat lain.', 'kbli_66139', NULL, NULL),
(1370, '66141', 'Penjamin Emisi Efek (Underwriter)', 'Kelompok ini mencakup kegiatan usaha pihak yang melakukan kegiatan penjaminan emisi efek, kegiatan lain yang berkaitan dengan aksi korporasi dari perusahaan  yang akan atau telah melakukan penawaran umum, seperti pemberian nasihat dalam rangka penerbitan efek, penggabungan, peleburan, pengambilalihan, dan/atau restrukturisasi, serta kegiatan lain yang ditetapkan dan/atau disetujui oleh Otoritas Jasa Keuangan.', 'kbli_66141', NULL, NULL),
(1371, '66142', 'Perantara Pedagang Efek (Broker Dealer)', 'Kelompok ini mencakup kegiatan usaha pihak yang melakukan transaksi efek untuk kepentingan sendiri dan pihak lain, dan/atau pemasaran efek untuk kepentingan perusahaan efek lain, serta kegiatan lain yang ditetapkan dan/atau disetujui oleh Otoritas Jasa Keuangan.', 'kbli_66142', NULL, NULL),
(1372, '66143', 'Perusahaan Efek Daerah (PED)', 'Kelompok ini mencakup kegiatan sebagai perusahaan efek yang telah memiliki izin usaha dari Otoritas Jasa Keuangan untuk melakukan kegiatan usaha sebagai perantara pedagang efek yang mengadministrasikan rekening efek nasabah dan khusus didirikan dalam suatu wilayah provinsi.', 'kbli_66143', NULL, NULL),
(1373, '66144', 'Perantara Pedagang Efek Untuk Efek Bersifat Utang dan Sukuk (PPE-EBUS)', 'Kelompok ini mencakup kegiatan pihak yang telah terdaftar di Otoritas Jasa Keuangan untuk melakukan kegiatan usaha jual beli efek bersifat utang dan sukuk untuk kepentingan sendiri dan/ atau nasabahnya.', 'kbli_66144', NULL, NULL),
(1374, '66145', 'Agen Perantara Pedagang Efek', 'Kelompok ini mencakup kegiatan pihak yang telah terdaftar di Otoritas Jasa Keuangan untuk melakukan kegiatan penawaran kepada calon nasabah untuk menjadi nasabah perantara pedagang efek dengan mendapat komisi berdasarkan kontrak kerjasama dan kegiatan lain yang diatur oleh Otoritas Jasa Keuangan.', 'kbli_66145', NULL, NULL),
(1375, '66146', 'Agen Penjual Efek Reksa Dana (APERD)', 'Kelompok ini mencakup kegiatan usaha  khusus untuk memasarkan efek reksa dana berdasarkan kontrak kerja sama dengan manajemen investasi pengelola reksa dana.', 'kbli_66146', NULL, NULL),
(1376, '66147', 'Gerai Penjualan Efek Reksa Dana', 'Kelompok ini mencakup tempat penjualan efek reksa dana, yang di buka berdasarkan kerja sama antara agen penjual efek reksa dana atau manajemen investasi dengan pihak lain yang memiliki jaringan usaha luas dalam kegiatan usahanya.', 'kbli_66147', NULL, NULL),
(1377, '66149', 'Perusahaan Efek Selain Manajemen Investasi Lainnya', 'Kelompok ini mencakup kegiatan usaha perusahaan efek di pasar modal, selain kegiatan manajemen investasi, yaitu selain kegiatan sbb: kegiatan penjaminan emisi efek, kegiatan lain yang berkaitan dengan aksi korporasi dari perusahaan  yang akan atau telah melakukan penawaran umum; melakukan transaksi efek untuk kepentingan sendiri dan pihak lain, dan/atau pemasaran efek untuk kepentingan perusahaan efek lain; melakukan kegiatan usaha jual beli efek bersifat utang dan sukuk untuk kepentingan sendiri dan/ atau nasabahnya; melakukan kegiatan penawaran kepada calon nasabah untuk menjadi nasabah perantara pedagang efek; memasarkan efek reksa dana berdasarkan kontrak kerja sama dengan manajemen investasi pengelola reksa dana.', 'kbli_66149', NULL, NULL),
(1378, '66151', 'Pedagang Berjangka', 'Kelompok ini mencakup kegiatan usaha pihak yang telah menjadi anggota bursa berjangka dan dalam aktivitas usahanya hanya berhak melakukan transaksi kontrak berjangka, kontrak derivatif syariah, dan/atau kontrak derivatif lainnya di bursa berjangka untuk diri sendiri atau kelompok usahanya, termasuk pedagang berjangka kontrak berjangka dan pedagang berjangka yang menjadi market maker.', 'kbli_66151', NULL, NULL),
(1379, '66152', 'Pialang Perdagangan Berjangka', 'Kelompok ini mencakup kegiatan badan usaha yang melakukan kegiatan jual beli komoditi berdasarkan kontrak berjangka, kontrak derivatif syariah, dan/atau kontrak derivatif lainnya atas amanat nasabah dengan menarik sejumlah uang dan/atau surat berharga tertentu sebagai margin untuk menjamin transaksi tersebut, termasuk bagi pihak yang menjalankan fungsi sebagai wakil pialang berjangka, pembukaan kantor cabang pialang berjangka, penyaluran amanat luar negeri, dan peserta sistem perdagangan alternatif.', 'kbli_66152', NULL, NULL),
(1380, '66153', 'Pedagang Fisik Komoditi', 'Kelompok ini mencakup kegiatan badan usaha yang menyediakan sarana sistem perdagangan untuk melakukan kegiatan jual beli komoditi yang telah ditetapkan sebagai komoditi yang dapat ditransaksikan melalui mekanisme pasar fisik komoditi di bursa berjangka baik atas nama diri sendiri, dan/atau memfasilitasi transaksi pelanggan.', 'kbli_66153', NULL, NULL),
(1381, '66154', 'Perantara Perdagangan Fisik Komoditi', 'Kelompok ini mencakup kegiatan badan usaha yang bertindak selaku perantara untuk menyalurkan transaksi jual atau beli Komoditi atas perintah Peserta ke pasar fisik komoditi.', 'kbli_66154', NULL, NULL),
(1382, '66159', 'Perantara Perdagangan Berjangka Komoditi Lainnya', 'Kelompok usaha ini mencakup kegiatan yang belum termasuk di dalam kelompok 66151, 66152, 66153 dan 66154. Kegiatan pada kelompok ini untuk aktivitas yang sebagian besar dilakukan dengan menjalankan fungsi keperantaraan yang berkaitan dengan nasabah, klien atau pelanggan.', 'kbli_66159', NULL, NULL),
(1383, '66160', 'Kegiatan Penukaran Valuta Asing (Money Changer)', 'Kelompok ini mencakup kegiatan usaha jual dan beli uang kertas asing serta pembelian cek pelawat.', 'kbli_66160', NULL, NULL),
(1384, '66171', 'Penyelenggara Sistem Perdagangan Alternatif', 'Kelompok ini mencakup bidang usaha yang melakukan kegiatan jual beli kontrak derivatif selain kontrak berjangka dan kontrak derivatif syariah, untuk dan atas nama sendiri dalam mekanisme sistem perdagangan alternatif.', 'kbli_66171', NULL, NULL),
(1385, '66172', 'Pengelola Sentra Dana Berjangka', 'Kelompok ini mencakup kegiatan usaha yang berkaitan dengan penghimpunan dan pengelolaan dana dari peserta sentra dana berjangka untuk diinvestasikan dalam kontrak berjangka, termasuk juga untuk pihak yang menjalankan fungsi sebagai wakil pengelola sentra dana berjangka.', 'kbli_66172', NULL, NULL),
(1386, '66173', 'Penasihat Berjangka', 'Kelompok ini mencakup kegiatan konsultasi (penasihat) perdagangan berjangka yaitu memberikan nasihat kepada pihak lain mengenai jual beli komoditas berdasarkan kontrak berjangka, kontrak derivatif syariah, dan/atau kontrak derivatif lainnya dengan menerima imbalan, termasuk juga untuk pihak yang menjalankan fungsi sebagai wakil penasihat berjangka.', 'kbli_66173', NULL, NULL),
(1387, '66174', 'Pengelola Tempat Penyimpanan Fisik Komoditi', 'Kelompok ini mencakup kegiatan pengelolaan tempat penyimpanan, pemeliharaan, pengawasan dan/atau penyerahan komoditi yang telah ditetapkan sebagai komoditi yang dapat ditransaksikan melalui pasar fisik di bursa berjangka.', 'kbli_66174', NULL, NULL),
(1388, '66179', 'Aktivitas Penunjang Perdagangan Berjangka Komoditi Lainnya', 'Kelompok usaha ini mencakup kegiatan yang belum termasuk di dalam kelompok 66171, 66172, 66173, dan 66174. Kegiatan pada kelompok ini mencakup  kegiatan usaha penunjang dan/atau kegiatan untuk memperoleh manfaat baik secara langsung maupun tidak langsung dari industri perdagangan berjangka komoditi dan/atau perdagangan fisik komoditi yang tidak diklasifikasikan di tempat lain.', 'kbli_66179', NULL, NULL),
(1389, '66191', 'Biro Administrasi Efek', 'Kelompok ini mencakup kegiatan usaha pihak yang berdasarkan kontrak dengan emiten melaksanakan pencatatan pemilikan efek dan pembagian hak yang berkaitan dengan efek.', 'kbli_66191', NULL, NULL),
(1390, '66192', 'Kustodian (Custodian)', 'Kelompok ini mencakup kegiatan usaha pihak yang memberikan jasa penitipan efek dan harta lain yang berkaitan dengan efek serta jasa lain, termasuk menerima deviden, bunga, dan hak-hak lain, menyelesaikan transaksi efek, dan mewakili pemegang rekening yang menjadi nasabahnya. Seperti bank kustodian dan sebagainya.', 'kbli_66192', NULL, NULL),
(1391, '66193', 'Wali Amanat (Trustee)', 'Kelompok ini mencakup kegiatan usaha pihak yang dipercayakan untuk mewakili kepentingan seluruh pemegang efek bersifat utang atau sukuk.', 'kbli_66193', NULL, NULL),
(1392, '66194', 'Perusahaan Pemeringkat Efek', 'Kelompok ini mencakup kegiatan usaha pihak yang memeringkat efek bersifat utang, sukuk, efek beragun aset atau efek lain yang dapat diperingkat serta pihak sebagai entitas (company rating), termasuk reksa dana dan dana investasi real estat berbentuk kontrak investasi kolektif. Pemeringkatan ini dilakukan untuk memberikan informasi kepada investor untuk mengetahui kemampuan suatu pihak untuk memenuhi kewajiban pembayaran secara penuh dan tepat waktu, yang dinyatakan dengan suatu sistem peringkat yang telah ditentukan.', 'kbli_66194', NULL, NULL),
(1393, '66195', 'Ahli Syariah Pasar Modal (ASPM)', 'Kelompok ini mencakup kegiatan orang perseorangan yang memiliki pengetahuan dan pengalaman di bidang syariah; atau badan usaha yang pengurus dan pegawainya memiliki pengetahuan dan pengalaman di bidang syariah, yang memberikan nasihat dan/atau mengawasi pelaksanaan penerapan prinsip syariah di pasar modal dalam kegiatan usaha perusahaan dan/atau memberikan pernyataan kesesuaian syariah atas produk atau jasa syariah di pasar modal.', 'kbli_66195', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(1394, '66199', 'Aktivitas Penunjang Jasa Keuangan Lainnya Ytdl', 'Kelompok ini mencakup usaha kegiatan penunjang keuangan lainnya yang tidak diklasifikasikan di tempat lain, seperti penasihat keuangan, mortgage advisers and brokers.', 'kbli_66199', NULL, NULL),
(1395, '66211', 'Aktivitas Penilai Risiko Asuransi', 'Kelompok ini mencakup usaha penilaian risiko atau pemberian pendapat ahli terhadap objek pertanggungan yang akan diasuransikan. Kegiatan penilai risiko asuransi (risk surveyor) dilakukan sebelum penutupan asuransi, dan tidak diatur secara khusus dalam ketentuan Otoritas Jasa Keuangan.', 'kbli_66211', NULL, NULL),
(1396, '66212', 'Aktivitas Penilai Kerugian Asuransi', 'Kelompok ini mencakup kegiatan usaha penilaian klaim dan/atau jasa konsultasi atas objek asuransi. Kegiatan penilai kerugian asuransi (loss adjuster) dilakukan pada saat terjadi klaim, dan diatur sesuai dengan ketentuan Otoritas Jasa Keuangan.', 'kbli_66212', NULL, NULL),
(1397, '66221', 'Aktivitas Agen Asuransi', 'Kelompok ini mencakup kegiatan usaha yang bertindak untuk dan atas nama perusahaan asuransi atau perusahaan asuransi syariah dan memenuhi persyaratan untuk mewakili perusahaan asuransi atau perusahaan asuransi syariah memasarkan produk asuransi atau produk asuransi syariah.', 'kbli_66221', NULL, NULL),
(1398, '66222', 'Aktivitas Pialang Asuransi', 'Kelompok ini mencakup kegiatan usaha jasa konsultasi dan/atau keperantaraan dalam penutupan asuransi atau asuransi syariah serta penanganan penyelesaian klaimnya dengan bertindak untuk dan atas nama pemegang polis, tertanggung, atau peserta.', 'kbli_66222', NULL, NULL),
(1399, '66223', 'Aktivitas Pialang Reasuransi', 'Kelompok ini mencakup kegiatan usaha jasa konsultasi dan/atau keperantaraan dalam penempatan reasuransi atau penempatan reasuransi syariah serta penanganan penyelesaian klaimnya dengan bertindak untuk dan atas nama perusahaan asuransi, perusahaan asuransi syariah, perusahaan penjaminan, perusahaan penjaminan syariah, perusahaan reasuransi, atau perusahaan reasuransi syariah yang melakukan penempatan reasuransi atau reasuransi syariah.', 'kbli_66223', NULL, NULL),
(1400, '66224', 'Aktivitas Agen Penjamin', 'Kelompok ini mencakup kegiatan usaha yang melakukan pemasaran kegiatan usaha penjaminan untuk dan atas nama perusahaan penjaminan atau perusahaan penjaminan syariah.', 'kbli_66224', NULL, NULL),
(1401, '66225', 'Aktivitas Broker Penjaminan', 'Kelompok ini mencakup kegiatan memberikan jasa konsultasi dan/atau keperantaraan dalam pemberian penjaminan serta penanganan penyelesaian klaimnya dengan bertindak untuk dan atas nama terjamin.', 'kbli_66225', NULL, NULL),
(1402, '66226', 'Aktivitas Broker Penjaminan Ulang', 'Kelompok ini mencakup kegiatan memberikan jasa konsultasi dan/atau keperantaraan dalam pemberian penjaminan ulang serta penanganan penyelesaian klaimnya dengan bertindak untuk dan atas nama terjamin.', 'kbli_66226', NULL, NULL),
(1403, '66291', 'Aktivitas Konsultan Aktuaria', 'Kelompok ini mencakup usaha aktuaria, dengan kegiatan usaha meliputi kegiatan yang menerapkan prinsip-prinsip matematika untuk menentukan atau menghitung kemungkinan-kemungkinan berdasarkan data-data statistik dalam menyusun atau merancang berbagai jenis program asuransi jiwa, dan menentukan besarnya tarif premi.', 'kbli_66291', NULL, NULL),
(1404, '66292', 'Aktivitas Pemeringkat Usaha Mikro, Kecil, Menengah dan Koperasi', 'Kelompok ini mencakup kegiatan usaha yang memberikan layanan pemeringkatan bagi usaha mikro, kecil, menengah dan koperasi.', 'kbli_66292', NULL, NULL),
(1405, '66299', 'Aktivitas Penunjang Asuransi,  dan Dana Pensiun Lainnya', 'Kelompok ini mencakup usaha penunjang asuransi, penjaminan, dan dana pensiun lainnya yang belum diklasifikasikan di tempat lain.', 'kbli_66299', NULL, NULL),
(1406, '66311', 'Manajer Investasi', 'Kelompok ini mencakup kegiatan usaha pihak yang mengelola portofolio efek untuk para nasabah atau mengelola portofolio investasi kolektif untuk sekelompok nasabah, kecuali perusahaan asuransi, dana pensiun, dan bank yang melakukan sendiri kegiatan usahanya berdasarkan peraturan perundang-undangan yang berlaku.', 'kbli_66311', NULL, NULL),
(1407, '66312', 'Manajer Investasi Syariah', 'Kelompok ini mencakup kegiatan usaha manajer investasi yang dalam anggaran dasarnya menyatakan bahwa: kegiatan dan jenis usaha; cara pengelolaan; dan/atau jasa yang diberikan, dilakukan berdasarkan prinsip syariah di pasar modal.', 'kbli_66312', NULL, NULL),
(1408, '66321', 'Penasihat Investasi Perorangan', 'Kelompok ini mencakup kegiatan penasihat investasi yang dilakukan oleh perorangan yaitu memberikan nasihat kepada pihak lain mengenai penjualan atau pembelian efek dengan menerima imbalan jasa.', 'kbli_66321', NULL, NULL),
(1409, '66322', 'Penasihat Investasi Berbentuk Perusahaan', 'Kelompok ini mencakup kegiatan penasihat investasi yang dilakukan oleh perusahaan yaitu memberikan nasihat kepada pihak lain mengenai penjualan atau pembelian efek dengan menerima imbalan jasa.', 'kbli_66322', NULL, NULL),
(1410, '66390', 'Aktivitas Manajemen Dana Lainnya', 'Kelompok ini mencakup kegiatan portofolio dan manajemen pendanaan atas dasar balas jasa atau kontrak, seperti manajemen dana bersama selain dana investasi dan dana pensiun di luar kegiatan manajemen investasi dan penasihat investasi.', 'kbli_66390', NULL, NULL),
(1411, '66411', 'Penyedia Jasa Pembayaran (PJP)', 'Kelompok ini mencakup kegiatan yang berkaitan dengan penyediaan jasa pembayaran kepada pengguna akhir (end user) jasa layanan Sistem Pembayaran (SP) pada sisi front end, yang mencakup aktivitas antara lain: menampilkan informasi sumber dana; menginisiasi transaksi/acquiring  (dompet elektronik, acquirer dan payment gateway); menerbitkan instrumen/akun pembayaran; layanan remitansi/transfer dana.', 'kbli_66411', NULL, NULL),
(1412, '66412', 'Penyelenggara Infrastruktur Sistem Pembayaran (PIP)', 'Kelompok ini mencakup kegiatan yang berkaitan dengan penyelenggaraan infrastruktur sistem pembayaran yang utamanya digunakan untuk memfasilitasi transaksi Penyedia Jasa Pembayaran (PJP), baik untuk kepentingan PJP sendiri maupun kepentingan pengguna akhir, yang mencakup aktivitas antara lain penyelenggaraan fungsi sebagai prinsipal, switching, kliring, penyelesaian akhir (setelmen).', 'kbli_66412', NULL, NULL),
(1413, '66413', 'Penyelenggara Penunjang Sistem Pembayaran', 'Kelompok ini mencakup kegiatan yang berkaitan dengan penyelenggaraan kegiatan yang mendukung pelaksanaan kegiatan Penyedia Jasa Pembayaran (PJP) dan/atau Penyelenggara Infrastruktur Sistem Pembayaran (PIP) dalam melakukan pemrosesan transaksi pembayaran. Contoh pencetakan kartu, personalisasi pembayaran, penyediaan pusat data dan/atau pusat pemulihan bencana, penyediaan terminal, penyediaan fitur keamanan instrumen pembayaran dan/atau transaksi pembayaran, penyediaan teknologi pendukung transaksi nirkontak (contactless), penyediaan penerusan (routing) data pendukung pemrosesan transaksi pembayaran.', 'kbli_66413', NULL, NULL),
(1414, '66420', 'Penyelenggara Kegiatan Jasa Pengolahan Uang Rupiah', 'Kelompok ini mencakup kegiatan yang berkaitan dengan distribusi uang rupiah, penyimpanan uang rupiah di khazanah, pemrosesan uang rupiah dan/atau, pengisian, pengambilan, dan/atau pemantauan kecukupan uang rupiah pada Automated Teller Machine (ATM), Cash Deposit Machine (CDM), Cash Recycling Machine (CRM) dan/atau mesin transaksi uang rupiah tunai lain. Kelompok ini termasuk dapat melakukan kerja sama untuk kegiatan pembawaan uang kertas asing ke dalam dan ke luar daerah pabean Indonesia, melakukan penyediaan dan pemeliharaan Automated Teller Machine (ATM), Cash Deposit Machine (CDM), Cash Recycling Machine (CRM) dan/atau mesin transaksi uang rupiah tunai lain.', 'kbli_66420', NULL, NULL),
(1415, '68111', 'Real Estat Yang Dimiliki Sendiri Atau Disewa', 'Kelompok ini mencakup usaha pembelian, penjualan, persewaan dan pengoperasian real estat baik yang dimiliki sendiri maupun disewa, seperti bangunan apartemen, bangunan hunian dan bangunan non hunian (seperti fasilitas penyimpanan/gudang, mall, pusat perbelanjaan dan lainnya) serta penyediaan rumah dan flat atau apartemen dengan atau tanpa perabotan untuk digunakan secara permanen, baik dalam bulanan atau tahunan. Termasuk kegiatan penjualan tanah, pengembangan gedung untuk dioperasikan sendiri (untuk penyewaan ruang-ruang di gedung tersebut), pembagian real estat menjadi tanah kapling tanpa pengembangan lahan dan pengoperasian kawasan hunian untuk rumah yang bisa dipindah-pindah.', 'kbli_68111', NULL, NULL),
(1416, '68112', 'Penyewaan Venue Penyelenggaraan Aktifitas MICE dan Event Khusus', 'Kelompok ini mencakup menyewakan tempat dan fasilitas untuk penyelenggaraan kegiatan pertemuan, perjalanan insentif, konvensi, dan pameran atau untuk penyelenggaraan event khusus. Penyewaan dilakukan dalam periode tertentu untuk masa persiapan, penyelenggaraan acara, dan masa pembongkaran. Tempat yang dimaksud mencakup convention center, exhibition center, special venue/ multi purpose venue.', 'kbli_68112', NULL, NULL),
(1417, '68120', 'Kawasan Pariwisata', 'Kelompok ini mencakup pengusahaan lahan dengan luas sekurang-kurangnya 100 hektar dengan menata dan membagi lebih lanjut menjadi satuan-satuan simpul atau lingkungan tertentu, membangun atau menyewakan satuan-satuan simpul untuk pembangunan usaha sarana dan prasarana wisata yang diperlukan dengan persyaratan yang telah dipersiapkan sebelumnya, melaksanakan dan atau mengawasi pembangunan usaha pariwisata sesuai persyaratan yang ada serta membangun atau menyediakan tempat untuk keperluan administrasi usaha kawasan pariwisata.', 'kbli_68120', NULL, NULL),
(1418, '68130', 'Kawasan Industri', 'Kelompok ini mencakup pengusahaan lahan dengan luas sekurang-kurangnya 50 hektar dalam satu hamparan yang dijadikan kawasan  tempat  pemusatan kegiatan industri yang dilengkapi dengan sarana dan prasarana penunjang yang  dikembangkan dan dikelola  oleh perusahaan kawasan industri yang telah memiliki izin usaha kawasan industri. Termasuk pengusahaan lahan kawasan industri tertentu untuk usaha mikro, kecil, dan menengah paling rendah 5 (lima) hektar dalam satu hamparan.', 'kbli_68130', NULL, NULL),
(1419, '68200', 'Real Estat  Atas Dasar Balas Jasa (Fee) Atau Kontrak', 'Kelompok ini mencakup kegiatan penyediaan real estat atas dasar balas jasa atau kontrak, termasuk jasa yang berkaitan dengan real estat seperti kegiatan agen dan makelar real estat, perantara pembelian, penjualan dan penyewaan real estat atas dasar balas jasa atau kontrak, pengelolaan real estat atas dasar balas jasa atau kontrak, jasa penaksiran real estat dan agen pemegang wasiat real estat.', 'kbli_68200', NULL, NULL),
(1420, '69101', 'Aktivitas pengacara', 'Kelompok ini mencakup kegiatan pengacara/penasihat hukum, lembaga bantuan hukum serta jasa hukum lainnya, dalam hal bantuan nasihat dan perwakilan dalam kasus perdata, kasus pidana, sengketa tata usaha negara, perselisihan tenaga kerja, legal audit dan kegiatan lainnya. Badan pelaksana peradilan dimasukkan dalam kelompok 84233.', 'kbli_69101', NULL, NULL),
(1421, '69102', 'Aktivitas konsultan hukum', 'Kelompok ini mencakup kegiatan persiapan dokumen hukum, dokumen badan hukum, perjanjian kerjasama atau dokumen yang serupa dalam kaitan dengan pembentukan perusahaan, penyiapan akta notaris, surat wasiat, trust dan sebagainya dan kegiatan lainnya', 'kbli_69102', NULL, NULL),
(1422, '69103', 'Aktivitas konsultan kekayaan intelektual', 'Kelompok ini mencakup kegiatan pengajuan dan pengurusan permohonan dan kegiatan lain yang terkait di bidang kekayaan intelektual meliputi paten, hak cipta, merek, indikasi geografis, desain industri, desain tata letak sirkuit terpadu, rahasia dagang, dan lainnya.', 'kbli_69103', NULL, NULL),
(1423, '69104', 'Aktivitas notaris dan pejabat pembuat akta tanah', 'Kelompok ini mencakup kegiatan notaris, dan kegiatan lainnya notaris umum, notaris hukum sipil, dan kegiatan lainnya juru sita, arbiter, pemeriksa dan liperi. Termasuk dalam kelompok ini kegiatan terkait perjanjian jual beli tanah dan bangunan oleh pejabat pembuat akta tanah.', 'kbli_69104', NULL, NULL),
(1424, '69109', 'Aktivitas hukum lainnya', 'Kelompok ini mencakup kegiatan hukum lainnya.', 'kbli_69109', NULL, NULL),
(1425, '69201', 'Aktivitas Akuntansi, Pembukuan dan Pemeriksa', 'Kelompok ini mencakup kegiatan penyediaan jasa pembukuan dan akuntansi, \r\npenyusunan dan analisis laporan keuangan, persiapan atau pemeriksaan/audit laporan keuangan dan pengujian laporan dan sertifikasi keakuratannya.', 'kbli_69201', NULL, NULL),
(1426, '69202', 'Aktivitas Konsultasi Pajak', 'Kelompok ini mencakup kegiatan penyediaan jasa konsultasi perpajakan seperti  penyiapan pengembalian pajak pendapatan usaha atau perorangan. Termasuk dalam kelompok ini penyediaan jasa bantuan nasihat dan perwakilan (selain perwakilan hukum) atas nama klien dihadapan petugas pajak.', 'kbli_69202', NULL, NULL),
(1427, '70100', 'Aktivitas Kantor Pusat', 'Kelompok ini mencakup pengawasan dan pengelolaan unit-unit perusahaan yang lain atau enterprise; pengusahaan strategi atau perencanaan organisasi dan pembuatan keputusan dari peraturan perusahaan atau enterprise. Unit-unit dalam kelompok ini melakukan kontrol operasi pelaksanaan dan mengelola operasi unit-unit yang berhubungan. Kegiatan yang termasuk dalam kelompok ini antara lain kantor pusat, kantor administrasi pusat, kantor yang berbadan hukum, kantor distrik dan kantor wilayah dan kantor manajemen cabang.', 'kbli_70100', NULL, NULL),
(1428, '70201', 'Aktivitas Konsultansi Pariwisata', 'Kelompok ini mencakup kegiatan penyedia jasa konsultansi pariwisata profesional, antara lain penyampaian pandangan, saran, dan atau kajian terkait studi kelayakan, perencanaan, pengorganisasian, pengarahan, pengkoordinasian, pengawasan, pelaporan, penganggaran dan atau fungsi manajemen lainnya di bidang kepariwisataan.', 'kbli_70201', NULL, NULL),
(1429, '70202', 'Aktivitas Konsultansi Transportasi', 'Kelompok ini mencakup kegiatan konsultansi transportasi, antara lain penyampaian pandangan, saran, penyusunan studi kelayakan, perencanaan, pengawasan, manajemen dan penelitian di bidang transportasi baik darat, laut, maupun udara. Termasuk manajemen keamanan pelabuhan.', 'kbli_70202', NULL, NULL),
(1430, '70203', 'Aktivitas Kehumasan', 'Kelompok ini mencakup pelaksanaan aktivitas komunikasi untuk membangun dan mempertahankan hubungan yang baik dan bermanfaat antara organisasi, bisnis, atau personal dengan publik yang mempengaruhi citra organisasi maupun personal.', 'kbli_70203', NULL, NULL),
(1431, '70204', 'Aktivitas Konsultansi Manajemen Industri', 'Kelompok ini mencakup kegiatan bantuan nasihat, bimbingan dan operasional usaha dan permasalahan organisasi dan manajemen perusahaan industri, seperti perencanaan strategi dan organisasi; keputusan berkaitan dengan keuangan; tujuan dan kebijakan pemasaran; perencanaan, praktik dan kebijakan sumber daya manusia; perencanaan penjadwalan dan pengontrolan produksi.', 'kbli_70204', NULL, NULL),
(1432, '70209', 'Aktivitas Konsultasi Manajemen Lainnya', 'Kelompok ini mencakup ketentuan bantuan nasihat, bimbingan dan operasional usaha dan permasalahan organisasi dan manajemen lainnya, seperti perencanaan strategi dan organisasi; keputusan berkaitan dengan keuangan; tujuan dan kebijakan pemasaran; perencanaan, praktik dan kebijakan sumber daya manusia; perencanaan penjadwalan dan pengontrolan produksi. Penyediaan jasa usaha ini dapat mencakup bantuan nasihat, bimbingan dan operasional berbagai fungsi manajemen, konsultasi manajemen olah agronomist dan agricultural economis pada bidang pertanian dan sejenisnya, rancangan dari metode dan prosedur akuntansi, program akuntansi biaya, prosedur pengawasan anggaran belanja, pemberian nasihat dan bantuan untuk usaha dan pelayanan masyarakat dalam perencanaan, pengorganisasian, efisiensi dan pengawasan, informasi manajemen dan lain-lain. Termasuk jasa pelayanan studi investasi infrastruktur.', 'kbli_70209', NULL, NULL),
(1433, '71101', 'Aktivitas Arsitektur', 'Kelompok ini mencakup kegiatan penyediaan jasa konsultasi arsitek, seperti penyusunan studi awal arsitektur, jasa desain arsitektural, jasa nasihat dan pradesain arsitektural, jasa arsitektural lainnya, jasa penilai perawatan dan kelayakan bangunan gedung, jasa pengembangan pemanfaatan ruang, wilayah, perkotaan, lingkungan bangunan dan lanskap, perancangan bangunan gedung dan lingkungannya, pelestarian bangunan gedung dan lingkungannya, perancangan tata bangunan dan lingkungannya, penyusunan dokumen perencanaan teknis, pengawasan aspek arsitektur pada pelaksanaan konstruksi bangunan gedung dan lingkungannya, perencanaan kota dan tata guna lahan, manajemen proyek dan manajemen konstruksi, pendampingan masyarakat, konstruksi lain. Objek berdasarkan klasifikasi Bangunan Gedung sesuai dengan International Building Code: Assembly/Pertemuan; Bussiness/Bisnis; Educational/Pendidikan; Factory and Industrial/Pabrik dan Bangunan Industri; High Hazard/Bangunan Resiko Tinggi; Institutional/Kelembagaan dan Pemerintahan; Mercantile/Perdagangan; Residential/Hunian; Storage/Gudang; dan Utility and Miscellanous/Bangunan utilitas dan lain-lain. Termasuk jasa inspeksi gedung atau bangunan, gudang, dan bangunan sipil lainnya.', 'kbli_71101', NULL, NULL),
(1434, '71102', 'Aktivitas Keinsinyuran dan Konsultasi Teknis YBDI', 'Kelompok ini mencakup kegiatan perancangan teknik, dan konsultansi, seperti permesinan, pabrik dan proses industri; proyek yang melibatkan teknik sipil, teknik hidrolik, teknik lalu lintas; jasa nasihat dan konsultansi rekayasa teknik,  jasa rekayasa konstruksi bangunan gedung hunian dan nonhunian, jasa rekayasa pekerjaan teknik sipil sumber daya air, jasa rekayasa untuk pekerjaan mekanikal dalam bangunan, jasa rekayasa bangunan fasilitas olahraga, jasa konsultansi teknik lingkungan, jasa konsultansi terkait konstruksi pekerjaan sistem kendali lalu lintas, jasa rekayasa konstruksi pembangkit jaringan transmisi, gardu induk, dan distribusi tenaga listrik serta jasa rekayasa untuk proses industrial, produksi dan fasilitas produksi, jasa rekayasa lainnya,  perluasan dan realisasi proyek yang berhubungan dengan teknik listrik dan elektro, teknik pertambangan, teknik kimia, mekanik, teknik industri dan teknik sistem dan teknik keamanan; proyek manajemen air; dan kegiatan manajemen proyek dan jasa penyelidikan lapangan yang berkaitan dengan konstruksi; kegiatan perluasan proyek yang menggunakan AC, pendingin, kebersihan dan teknik pengontrolan polusi, teknik akustik dan lain-lain; kegiatan survei geofisika, geologi dan survei seismik atau gempa bumi termasuk jasa pembuatan prospektus dan jasa interpretasi geologi dan geofisika sektor konstruksi; kegiatan survei geodetik meliputi kegiatan survei batas dan tanah, survei hidrologi, survei keadaan di atas dan di bawah permukaan tanah dan kegiatan informasi spasial dan kartografi termasuk kegiatan pemetaan dan jasa pembuatan peta. Termasuk jasa rekayasa pekerjaan teknik sipil transportasi, jasa fasilitasi teknis prasarana dan sarana umum sektor konstruksi.', 'kbli_71102', NULL, NULL),
(1435, '71201', 'Jasa Sertifikasi', 'Kelompok ini mencakup kegiatan lembaga sertifikasi produk, sistem manajemen mutu, HACCP (Hazard Analysis and Critical Control Points), sistem management lingkungan, sistem manajemen keamanan pangan, ekolabel, sistem manajemen keamanan informasi, sistem manajemen keselamatan dan kesehatan kerja (SMK3), sistem sertifikasi pangan organik, sistem pengolahan hutan produksi lestari, sistem validasi dan verifikasi termasuk verifikasi legalitas kayu, dan lain-lain. Termasuk kegiatan penilaian kesesuaian sistem manajemen mutu sistem resi gudang, dan sertifikasi industri hijau.', 'kbli_71201', NULL, NULL),
(1436, '71202', 'Jasa Pengujian Laboratorium', 'Kelompok ini mencakup kegiatan uji fisik, kimia, biologi, kelistrikan, mekanik dan analisis lainnya dari semua jenis material dan produk yang mencakup kegiatan pengujian di bidang kesehatan makanan, termasuk uji penyakit hewan dan kontrol yang berhubungan dengan produksi makanan; uji austik dan vibrasi (getar), uji komposisi dan kemurnian mineral dan sebagainya, uji karakteristik fisik dan kinerja material seperti kekuatan, ketebalan, daya tahan, radioaktif dan lain-lain, uji kualifikasi dan ketahanan, uji kinerja dari mesin keseluruhan seperti motor, automobil, perlengkapan elektronik, pengujian perangkat telekomunikasi, pengujian laboratorium sektor konstruksi, dan lain-lain, analisis kegagalan, uji dan pengukuran indikator lingkungan seperti polusi udara dan air, uji dengan menggunakan model atau maket seperti pesawat terbang, kapal, bendungan dan lain-lain. Termasuk kegiatan operasional laboratorium kepolisian dan penilaian kesesuaian uji mutu sistem resi gudang. Pengujian medis dimasukkan dalam kelompok 86903.', 'kbli_71202', NULL, NULL),
(1437, '71203', 'Jasa Inspeksi Periodik', 'Kelompok ini mencakup kegiatan pemeriksaan suatu desain produk, produk, jasa dan proses. Kegiatan yang tercakup dalam kegiatan ini misalnya pemeriksaan peralatan tekan, pre-shipment, proses produksi, pemeliharaan atau perawatan, pemeriksaan periodik mengenai kemananan jalannya kendaraan bermotor termasuk survey tanpa merusak objek (non destructive testing). Tidak termasuk jasa inspeksi bangunan atau gedung (71101).', 'kbli_71203', NULL, NULL),
(1438, '71204', 'Jasa Inspeksi Teknik Instalasi', 'Kelompok ini mencakup kegiatan pemeriksaan suatu desain instalasi dan proses instalasi, misalnya pemeriksaan instalasi tenaga listrik, inspeksi instalasi teknikal sektor konstruksi dan instalasi lainnya.', 'kbli_71204', NULL, NULL),
(1439, '71205', 'Jasa Kalibrasi/Metrologi', 'Kelompok ini mencakup kegiatan laboratorium kalibrasi untuk melakukan pengecekan/pengetesan suatu alat ukur atau alat kalibrasi, dan mencakup kegiatan laboratorium kalibrasi yang melakukan jasa kalibrasi alat ukur pada instansi/industri/organisasi lain sesuai permintaan, misalnya kalibrasi pressure gauge, termometer non medis, timbangan dan sebagainya. Kegiatan ini juga mencakup kalibrasi alat ukur radiasi, misalnya surveymeter, kontaminasi meter, dosimeter, dan alat ukur terkait lainnya serta pengukuran keluaran radiasi. Termasuk kegiatan pemberi tera untuk melakukan pengecekan/pengetesan/ pemeliharaan suatu alat ukur, misalnya timbangan jalan, meter pompa bensin dan sebagainya sehingga alat tersebut diyakini valid selama masa yang ditentukan.', 'kbli_71205', NULL, NULL),
(1440, '71206', 'Jasa Commissioning Proses Industrial, Quality Assurance (QA), dan Quality Control (QC)', 'Kelompok ini mencakup kegiatan memastikan semua komponen sesuai dengan standar dan spesifikasi owner; dilakukan oleh pihak ketiga penyedia jasa comissioning; layanan analisis serta commissioning  proses industrial dan produksi pada fasilitas produksi minyak, gas, petrokimia, dan panas bumi. Kelompok ini juga mencakup kegiatan Quality Assurance (QA) dan Quality Control (QC) yang dilakukan untuk memeriksa kandungan suatu zat secara kuantitatif dalam cuplikan yang menggunakan zat radioaktif dan pembangkit radiasi pengion, seperti X-Ray Fluorosence (XRF), X-Ray Diffraction (XRD), Spectrometer.', 'kbli_71206', NULL, NULL),
(1441, '71207', 'Jasa Klasifikasi Kapal', 'Kelompok ini mencakup kegiatan klasifikasi kapal (Ships Classification) yang dilakukan oleh badan klasifikasi kapal yang berupa pengklasifikasian kapal berdasarkan konstruksi lambung, mesin, listrik kapal, dan jaminan mutu marine kapal dengan tujuan memberikan penilaian teknis atas layak tidaknya kapal untuk berlayar termasuk survei dan sertifikasi untuk klasifikasi kapal.', 'kbli_71207', NULL, NULL),
(1442, '71208', 'Aktivitas Pengujian dan atau Kalibrasi Alat Kesehatan dan Inspeksi Sarana Prasarana Kesehatan', 'Kelompok ini mencakup kegiatan jasa pemeliharaan, pengujian dan/atau kalibrasi secara berkala terhadap peralatan kesehatan dan inspeksi sarana prasarana kesehatan yang dikelola oleh pemerintah dan swasta dalam rangka pengamanan fasilitas kesehatan melalui pengujian, kalibrasi dan proteksi radiasi untuk memenuhi kualitas dan standar keselamatan serta keamanan.', 'kbli_71208', NULL, NULL),
(1443, '71209', 'Analisis Dan Uji Teknis Lainnya', 'Kelompok ini mencakup kegiatan jasa analisis dan uji teknis lainnya yang belum diklasifikasikan pada 71201 s.d. 71208 misalnya operasional dari keamanan dan ketertiban laboratorium. Termasuk dalam kelompok ini mencakup uji teknis dengan menggunakan sumber radiasi pengion (zat radioaktif dan pembangkit radiasi pengion) serta penyelenggara uji profisiensi dan produsen bahan acuan.', 'kbli_71209', NULL, NULL),
(1444, '72101', 'Penelitian Dan Pengembangan Ilmu Pengetahuan Alam', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematis), yang diselenggarakan oleh swasta berkaitan dengan ilmu pengetahuan alam, seperti penelitian dan pengembangan matematika, fisika, biologi, kimia, astronomi, geologi, botani, zoologi, dan lainnya.', 'kbli_72101', NULL, NULL),
(1445, '72102', 'Penelitian Dan Pengembangan Teknologi Dan Rekayasa', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematik), yang diselenggarakan oleh swasta, berkaitan dengan teknologi dan rekayasa (engineering). Kegiatan yang tercakup dalam kelompok ini seperti penelitian dan pengembangan ilmu teknik dan teknologi, serta antar cabang ilmu pengetahuan terutama ilmu pengetahuan alam dan teknik.', 'kbli_72102', NULL, NULL),
(1446, '72103', 'Penelitian Dan Pengembangan Ilmu Kedokteran', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematik), yang diselenggarakan oleh swasta, berkaitan dengan ilmu kedokteran.', 'kbli_72103', NULL, NULL),
(1447, '72104', 'Penelitian Dan Pengembangan Bioteknologi', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematik), yang diselenggarakan oleh swasta, berkaitan dengan bioteknologi.', 'kbli_72104', NULL, NULL),
(1448, '72105', 'Penelitian Dan Pengembangan Ilmu Pertanian, Peternakan, dan Kehutanan', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematik), yang diselenggarakan oleh swasta, berkaitan dengan ilmu pertanian, peternakan, dan kehutanan.', 'kbli_72105', NULL, NULL),
(1449, '72106', 'Penelitian Dan Pengembangan Ilmu Perikanan dan Kelautan', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematik), yang diselenggarakan oleh swasta, berkaitan dengan ilmu perikanan dan kelautan.', 'kbli_72106', NULL, NULL),
(1450, '72107', 'Penelitian dan Pengembangan Ketenaganukliran', 'Kelompok ini mencakup penelitian dan pengembangan yang dilakukan secara teratur (sistematis) yang berkaitan dengan penggunaan teknologi nuklir.', 'kbli_72107', NULL, NULL),
(1451, '72109', 'Penelitian Dan Pengembangan Ilmu Pengetahuan Alam dan Teknologi Rekayasa Lainnya', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematik), yang diselenggarakan oleh swasta, berkaitan dengan teknologi dan rekayasa (engineering) lainnya.', 'kbli_72109', NULL, NULL),
(1452, '72201', 'Penelitian Dan Pengembangan Ilmu Pengetahuan Sosial', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematis), yang diselenggarakan oleh swasta, berkaitan dengan ilmu sosial, seperti penelitian dan pengembangan ilmu ekonomi, sosiologi, antropologi, politik, hukum, pemerintahan, pendidikan, perdagangan, komunikasi, kebiasaan,  adat istiadat, dan lainnya.', 'kbli_72201', NULL, NULL),
(1453, '72202', 'Penelitian Dan Pengembangan Linguistik dan Sastra', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematis), yang diselenggarakan oleh swasta, berkaitan dengan linguistik dan sastra.', 'kbli_72202', NULL, NULL),
(1454, '72203', 'Penelitian Dan Pengembangan Agama', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematis), yang diselenggarakan oleh swasta, berkaitan dengan agama.', 'kbli_72203', NULL, NULL),
(1455, '72204', 'Penelitian Dan Pengembangan Seni', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematis), yang diselenggarakan oleh swasta, berkaitan dengan seni.', 'kbli_72204', NULL, NULL),
(1456, '72205', 'Penelitian Dan Pengembangan Psikologi', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematis), yang diselenggarakan oleh swasta, berkaitan dengan psikologi.', 'kbli_72205', NULL, NULL),
(1457, '72206', 'Penelitian Dan Pengembangan Sejarah/Cagar Budaya', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematis), yang diselenggarakan oleh swasta, berkaitan dengan sejarah dan cagar budaya', 'kbli_72206', NULL, NULL),
(1458, '72209', 'Penelitian Dan Pengembangan Ilmu Pengetahuan Sosial dan Humaniora Lainnya.', 'Kelompok ini mencakup usaha penelitian dan pengembangan yang dilakukan secara teratur (sistematis), yang diselenggarakan oleh swasta, berkaitan dengan ilmu pengetahuan sosial dan humaniora lainnya.', 'kbli_72209', NULL, NULL),
(1459, '73100', 'Periklanan', 'Kelompok ini mencakup usaha berbagai jasa periklanan (baik dengan kemampuan sendiri atau disubkontrakkan), meliputi jasa bantuan penasihat, kreatif, produksi bahan periklanan, perencanaan dan pembelian media. Kegiatan yang termasuk seperti penciptaan dan penempatan iklan di surat kabar, majalah dan tabloid, radio, televisi, internet dan media lainnya; penciptaan dan penempatan iklan lapangan, misalnya papan pengumuman, panel-panel,  jenis poster dan gambar, selebaran, pamflet, edaran, brosur dan frames, iklan jendela, desain ruang pamer, iklan mobil dan bus dan lain-lain; media penggambaran, yaitu penjualan ruang dan waktu untuk berbagai macam media iklan permohonan; iklan udara (aerial advertising), distribusi atau pengiriman materi atau contoh iklan; penyediaan ruang iklan di dalam papan pengumuman atau billboard dan lain-lain; penciptaan stan serta struktur dan tempat pamer lainnya; dan memimpin kampanye pemasaran dan jasa iklan lain yang ditujukan pada penarikan dan pempertahankan pelanggan, seperti promosi produk, pemasaran titik penjualan (point of sale), iklan surat (direct mail), konsultasi pemasaran.', 'kbli_73100', NULL, NULL),
(1460, '73201', 'Penelitian Pasar', 'Kelompok ini mencakup usaha penelitian potensi pasar, penerimaan produk di pasar, kebiasaan dan tingkah laku konsumen, dalam kaitannya dengan promosi penjualan dan pengembangan produk baru.', 'kbli_73201', NULL, NULL),
(1461, '73202', 'Jajak Pendapat Masyarakat', 'Kelompok ini mencakup usaha penelitian mengenai opini masyarakat mengenai permasalahan politik, ekonomi, dan sosial.', 'kbli_73202', NULL, NULL),
(1462, '74111', 'Aktivitas Desain Alat Transportasi dan Permesinan', 'Kelompok ini mencakup kegiatan aktivitas desain industri untuk menghasilkan produk, alat pendukung produksi dan komponen dalam industri alat transportasi dan permesinan Kelompok ini mencakup: desain untuk produk sepeda dan kendaraan yang ditarik binatang; desain untuk produk kereta tangan, kereta dorong, kereta bayi, kursi roda, dan tandu; desain untuk produk kendaraan di atas rel; desain untuk produk pengangkat kursi dan ski; desain untuk produk elevator dan alat angkat; desain untuk produk kendaraan bermotor, kapal dan pesawat terbang serta pesawat luar angkasa; desain untuk produk ban dan rantai anti-slip dan komponen maupun aksesoris kendaraan; desain untuk produk mesin, pompa dan kompresor; desain untuk produk mesin pertanian dan konstruksi maupun mesin tekstil', 'kbli_74111', NULL, NULL),
(1463, '74112', 'Aktivitas  Desain Peralatan Rumah Tangga dan Furnitur', 'Kelompok ini mencakup kegiatan aktivitas desain industri untuk menghasilkan produk dalam industri peraltan rumah tangga dan furniture. Kelompok ini mencakup : desain untuk produk pecah belah, peralatan makan, memasak dan menyajikan serta mennyimpan makanan; desain untuk produk perlengkapan perapian; desain untuk produk peralatan tidur, meja dan kursi; desain untuk produk perabot (alat-alat) penyimpanan; desain untuk produk cermin dan bingkai; desain untuk produk gantunagan pakaian; desain untuk produk gorden dan tirai; desain untuk produk ornamen dinding/meja, vas, pot; desain untuk produk medali dan sabuk; desain untuk produk bendera dan dekorasi festival; desain untuk produk bunga, buah dan tanaman buatan', 'kbli_74112', NULL, NULL),
(1464, '74113', 'Aktivitas Desain Tekstil, Fashion dan Apparel', 'Kelompok ini mencakup kegiatan aktivitas desain industri untuk menghasilkan  produk dalam  industri tekstil, fashion dan apparel\r\nKelompok ini mencakup: desain untuk produk kain dan tenun; desain untuk produk sulaman; desain untuk produk pakaian dan pakaian dalam; desain untuk produk tutup kepala; desain untuk produk alas kaki, kaos kaki, stoking dan tali sepatu; desain untuk produk tas, koper, peti; desain untuk produk dasi, selendang, syal dan saputangan; desain untuk produk sarung tangan, payung, tongkat, kipas; desain untuk produk pita, ikat rambut, aksesoris pakaian dan hiasan lainnya; dan desain untuk produk perhiasan', 'kbli_74113', NULL, NULL),
(1465, '74114', 'Aktivitas Desain industri strategis dan pertahanan', 'Kelompok ini mencakup kegiatan usaha kreasi aktivitas desain industri untuk menghasilkan produk dalam industri strategis dan pertahanan. Kelompok ini juga mencakup: desain untuk produk pertahanan negara; desain untuk produk militer; desain untuk produk senjata; desain untuk produk pengamanan dan kepolisian; dan desain untuk produk tanggap darurat bencana.', 'kbli_74114', NULL, NULL),
(1466, '74115', 'Aktivitas Desain Alat Komunikasi dan Elektronika', 'Kelompok ini mencakup kegiatan aktivitas desain industri untuk menghasilkan produk dalam  industri alat komunikasi dan elektronika  Kelompok ini mencakup: desain untuk produk teknologi informasi, alat komunikasi dan kendali; desain untuk produk perekam suara atau gambar; desain untuk produk penyimpan data; desain untuk produk pembangkit daya dan penggerak motor; desain untuk produk penyimpan daya dan penguat daya; desain untuk produk distribusi dan kontrol listrik; desain untuk produk mesin pendingin, mesin cuci, mesin pengering dan pembersih.', 'kbli_74115', NULL, NULL),
(1467, '74116', 'Aktivitas Desain Peralatan Olahraga dan Permainan', 'Kelompok ini mencakup kegiatan usaha kreasi aktivitas desain industri untuk menghasilkan produk dalam  industri Peralatan Olahraga dan Permainan  Kelompok ini mencakup: desain untuk produk mainan dan hiburan; desain untuk produk peralatan olahraga; desain untuk produk tenda dan peralatan luar ruang (outdoor).', 'kbli_74116', NULL, NULL),
(1468, '74117', 'Aktivitas Desain Produk Kesehatan, Kosmetik dan Perlengkapan Laboratorium', 'Kelompok ini mencakup kegiatan aktivitas desain industri untuk menghasilkan produk dalam  industri Kesehatan, Kosmestik dan Perlengkapan Laboratorium  Kelompok ini mencakup: desain untuk produk peralatan dan bahan medis, laboratorium, rumah sakit; desain untuk produk prosthetik; desain untuk produk obat-obatan dan kosmetik; desain untuk produkperlengkapan salon kecantikan dan toilet; desain untuk produk rambut palsu dan sejenisnya.', 'kbli_74117', NULL, NULL),
(1469, '74118', 'Aktivitas Desain Pengemasan', 'Kelompok ini mencakup kegiatan aktivitas desain industri untuk menghasilkan produk dalam  industri pengemasan  Kelompok ini mencakup: desain untuk produk botol, tabung, kontainer, tempat sampah/rongsokan; desain untuk produk kaleng, drum, tong penyimpan, kotak; desain untuk produk penutup, keranjang, peti kayu, pallet, kantong, kapsul.', 'kbli_74118', NULL, NULL),
(1470, '74119', 'Aktivitas Desain Industri Lainnya', 'Kelompok ini mencakup kegiatan aktivitas desain industri untuk menghasilkan produk dalam  industri yang belum tercakup dalam kelompok 74111 s.d 74118, seperti: desain untuk produk Desain Peralatan Penunjuk Waktu, Peralatan Ukur dan Peralatan Kantor; desain untuk produk untuk menyikat; desain untuk produk peralatan dan perangkat keras; desain untuk produk peralatan fotografi, sinematografi dan optikal; desain untuk produk peralatan musik; desain untuk produk peralatan dan perangkat keras; desain untuk produk peralatan fotografi, sinematografi dan optikal; desain untuk produk alat tulis kantor; desain untuk produk peralatan sales dan iklan; desain untuk produk peralatan berburu dan memancing; desain untuk produk distribusi fluida, ventilasi dan alat pendingin ruangan dan alat pemanas; desain untuk produk bahan bakar padat; desain untuk produk pencahayaan; desain untuk produk elemen konstruksi; desain untuk produk peraltan pemadam kebakaran; desain untuk produk perawatan binatang; desain untuk produk industri makanan; desain untuk produk industri tembakau dan rokok; desain untuk produk kriya.', 'kbli_74119', NULL, NULL),
(1471, '74120', 'Aktivitas Desain Interior', 'Kelompok ini mencakup kegiatan penyediaan jasa konsultasi Desain Interior/Desain Ruang Dalam, yaitu merencanakan/merancang ruang dalam atau interior dari bangunan atau gedung berdasarkan kegiatan manusia, fungsi ruangan dan untuk mendapatkan hasil suasana/atmosphere dengan mempertimbangkan unsur-unsur: Keamanan, Kesehatan, Keselamatan, Kenyamanan, Penunjang penderita disabilitas, dan Estetika. Dalam bidang Desain Interior, selain jasa perencanaan, juga mencakup jasa survey, jasa studi kelayakan, jasa drafting, jasa desain artist impression, jasa supervisi/pengawasan interior bangunan/gedung, jasa estimasi harga/QS dan jasa manajemen proyek di dalam konstruksi perencanaan desain interior.  Termasuk Desain interior pada bangunan gedung maupun bangunan sipil lainnya.', 'kbli_74120', NULL, NULL),
(1472, '74130', 'Aktivitas Desain Komunikasi Visual/ Desain Grafis', 'Kelompok ini mencakup kegiatan penyediaan jasa desain komunikasi visual/desain grafis secara manual maupun digital, serta statis (tidak bergerak) maupun dinamis (bergerak, interaktif), pada media cetak, layar (gawai, tv, komputer, layar LED dan sejenisnya), luring, daring atau virtual, yang berhubungan dengan pembuatan materi dengan fungsi identifikasi, informasi dan persuasi yang diimplementasikan pada identitas jenama (brand), logo, desain iklan, infografik, dan stasioneri; pembuatan desain komunikasi (berupa poster, brosur, buku atau material tercetak lainnya) untuk profil, situs web, aplikasi, media sosial, materi laporan, presentasi, dan desain material promosi lainnya; desain kemasan (packaging) terutama desain permukaan kemasan; atau pada media tiga dimensi/desain grafis lingkungan untuk papan pameran/event, display produk, papan promosi (billboard), penunjuk arah (wayfinding), sistem tanda (signage), penanda bangunan/retail dan sebagainya. Kelompok ini juga mencakup kegiatan penyediaan jasa pembuatan tulisan huruf (lettering), perancangan rupa huruf (typeface), dan pembuatan ilustrasi.', 'kbli_74130', NULL, NULL),
(1473, '74141', 'Aktivitas Desain Khusus Film, Video, Program TV, Animasi dan Komik', 'Kelompok  ini mencakup kegiatan perencanaan konten kreatif khusus film, video, program tv, animasi dan komik antara lain: desain cerita; desain  ketokohan dan pemilihan peran; desain  artistik dan visual; desain  teknis produksi; dan kebutuhan penunjang lainya. Kegiatan pembuatan komik masuk dalam kelompok 90023.', 'kbli_74141', NULL, NULL),
(1474, '74142', 'Aktivitas Desain Konten Game', 'Kelompok ini mencakup kegiatan perencanaan konten kreatif game antara lain: desain logika mekanik permainan; desain cerita; desain artistic seperti desain visual karakter, desain user interface, desain level dan lain-lain; desain  teknis terkait teknologi yang digunakan; pembuatan dokumen desain; riset dan pengembangan; dan aktivitas penunjang lainnya. Kegiatan produksi alat permainan masuk dalam kelompok 32401 dan pengembangan video game 62011.', 'kbli_74142', NULL, NULL),
(1475, '74149', 'Aktivitas Desain Konten Kreatif Lainya', 'Kelompok ini mencakup kegiatan perencanaan konten kreatif lainya yang belum masuk dalam kelompok 74141- 74142.', 'kbli_74149', NULL, NULL),
(1476, '74201', 'Aktivitas Fotografi', 'Kelompok ini mencakup kegiatan fotografi atau pemotretan, baik untuk perorangan atau kepentingan bisnis, seperti fotografi untuk paspor, sekolah, pernikahan dan lain-lain; fotografi untuk tujuan komersil, publikasi, mode, real estat atau pariwisata; fotografi dari udara (pemotretan dari udara atau aerial photography) dan perekaman video untuk acara seperti pernikahan, rapat dan lain-lain. Kegiatan lain adalah pemrosesan dan pencetakan hasil pemotretan tersebut, meliputi pencucian, pencetakan dan perbesaran dari negatif film atau cine-film yang diambil klien; laboratorium pencucian film dan pencetakan foto; photo shop (tempat cuci foto) satu jam (bukan bagian dari toko kamera); mounting slide dan penggandaan dan restoring atau pengubahan sedikit tranparasi dalam hubungannya dengan fotografi. Termasuk juga kegiatan jurnalis foto dan pembuatan mikrofilm dari dokumen. Produksi film untuk bioskop dan video dan distribusinya dimasukkan dalam golongan 591.', 'kbli_74201', NULL, NULL),
(1477, '74202', 'Aktivitas Angkutan Udara Khusus Pemotretan, Survei Dan Pemetaan', 'Kelompok ini mencakup kegiatan angkutan udara untuk kegiatan pemotretan, survei dan pemetaan khusus dengan pesawat udara berdasarkan maksud dan tujuan tertentu dengan tujuan kota-kota atau provinsi di dalam negeri.', 'kbli_74202', NULL, NULL),
(1478, '74311', 'Aktivitas Sertifikasi Profesi Pihak 1', 'Kelompok ini mencakup kegiatan Lembaga Sertifikasi Profesi (LSP) Pihak 1 yang bersifat independen dari Kementerian/Lembaga/Industri untuk mensertifikasi kompetensi karyawan atau siswanya sendiri.', 'kbli_74311', NULL, NULL),
(1479, '74312', 'Aktivitas Sertifikasi Profesi Pihak 2', 'Kelompok ini mencakup kegiatan Lembaga Sertifikasi Profesi (LPS) Pihak 2 yang bersifat independen dari Kementerian/Lembaga/Industri untuk mensertifikasi mitra dan pemasoknya.', 'kbli_74312', NULL, NULL),
(1480, '74321', 'Aktivitas Sertifikasi Profesi Pihak 3', 'Kelompok ini mencakup kegiatan Lembaga Sertifikasi Profesi (LSP) Pihak 3 yang bersifat independen dari asosiasi industri/asosiasi profesi secara kolektif untuk mengukur dan mensertifikasi kompetensi pekerja profesional di sektor industri masing-masing.', 'kbli_74321', NULL, NULL),
(1481, '74322', 'Aktivitas Sertifikasi Personel Independen', 'Kelompok ini mencakup kegiatan lembaga yang independen dan imparsial melakukan jasa sertifikasi terhadap kompetensi seseorang berdasarkan uji kompetensi selain yang tercakup dalam kelompok 74321.', 'kbli_74322', NULL, NULL),
(1482, '74901', 'Aktivitas Penerjemah Atau Interpreter', 'Kelompok ini mencakup kegiatan penerjemahan dari bahasa asal (source language) ke dalam bahasa tujuan (target language), termasuk didalamnya parameter kesetaraan istilah, rasa bahasa (sense of language), budaya (culture), dan lain-lain.', 'kbli_74901', NULL, NULL),
(1483, '74902', 'Aktivitas Konsultasi Bisnis Dan Broker Bisnis', 'Kelompok ini mencakup usaha pemberian saran dan bantuan operasional pada dunia bisnis, seperti kegiatan broker bisnis yang mengatur pembelian dan penjualan bisnis berskala kecil dan menengah, termasuk praktik profesional, kegiatan broker hak paten (pengaturan pembelian dan penjualan hak paten), kegiatan penilaian selain real estat dan asuransi (untuk barang antik, perhiasan dan lain-lain), audit  rekening dan informasi tarif barang atau muatan, kegiatan pengukuran kuantitas dan kegiatan peramalan cuaca. Tidak termasuk makelar real estat.', 'kbli_74902', NULL, NULL),
(1484, '74909', 'Aktivitas Profesional, Ilmiah dan Teknis Lainnya YTDL', 'Kelompok ini mencakup kegiatan profesional, ilmiah dan teknik lainnnya yang tidak diklasifikasikan di tempat lain, seperti  jasa konsultasi ilmu pertanian (agronomist), konsultasi lingkungan, konsultasi teknik lain dan kegiatan konsultan selain konsultan arsitek, teknik dan manajemen. Termasuk juga jasa penyelaman dan pengangkatan benda muatan kapal tenggelam di kapal tenggelam.   Kelompok ini juga mencakup kegiatan yang dilakukan oleh agen atau perwakilan atas nama perorangan yang biasa terlibatkan dalam pembuatan gambar bergerak, produksi teater atau hiburan lainnya atau atraksi olahraga dan penempatan buku, permainan (sandiwara, musik dan lain-lain), hasil seni, fotografi dan lain-lain, dengan publiser, produser dan lain-lain.', 'kbli_74909', NULL, NULL),
(1485, '75000', 'Aktivitas Kesehatan Hewan', 'Kelompok ini mencakup kegiatan perawatan dan pemeriksaan kesehatan hewan untuk hewan ternak dan hewan piaraan yang dilakukan oleh dokter hewan, kegiatan asisten dokter hewan atau pembantu pribadi dokter hewan lainnya, kegiatan klinik patologi dan diagnosis lain terhadap hewan, kegiatan ambulans hewan, kegiatan vaksinasi hewan dan laboratorium penelitian kesehatan hewan.', 'kbli_75000', NULL, NULL),
(1486, '77100', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Mobil, Bus, Truk Dan Sejenisnya', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) semua jenis alat transportasi darat tanpa operatornya seperti mobil, truk dan mobil derek. Penyewaan atau sewa guna usaha tanpa hak opsi alat transportasi darat dengan operatornya dicakup dalam golongan 492 dan 494. Penyewaan sepeda dicakup dalam kelompok 77210.', 'kbli_77100', NULL, NULL),
(1487, '77210', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Alat rekreasi dan Olahraga', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) semua jenis barang untuk keperluan rekreasi dan olahraga, seperti peralatan olahraga air, perahu kano dan perahu layar, kurdi dan payung pantai, sepeda dan peralatan olahraga lainnya. Termasuk peralatan ski dan kapal pesiar. Sewa guna usaha dengan hak opsi (financial leasing) dicakup dalam 6491.', 'kbli_77210', NULL, NULL),
(1488, '77220', 'Aktivitas Penyewaan Kaset Video, CD, VCD/DVD Dan Sejenisnya', 'Kelompok ini mencakup kegiatan penyewaan barang-barang hasil perekaman, seperti video tape, kaset video, rekaman, CD, VCD/DVD, MP3 dan sejenisnya.', 'kbli_77220', NULL, NULL),
(1489, '77291', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Alat Pesta', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi semua jenis barang untuk keperluan pesta, seperti tenda, kursi tamu, kursi pelamin dan dekor serta kostum, peralatan makan dan saji, peralatan musik dan perlengkapan pesta lainnya.', 'kbli_77291', NULL, NULL),
(1490, '77292', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Barang Keperluan Rumah Tangga Dan Pribadi', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) semua jenis barang untuk keperluan rumah tangga dan pribadi termasuk furnitur, peralatan dapur dan alat rumah tangga dari listrik, seperti tekstil, pakaian jadi, alas kaki, perhiasan, tempat tidur, lemari, panci, kompor, pisau, mesin cuci, kulkas, dispenser, dan lain-lain. Sewa guna usaha dengan hak opsi (financial leasing) dicakup pada 6491.', 'kbli_77292', NULL, NULL),
(1491, '77293', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Barang Hasil Pencetakan Dan Penerbitan', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) barang-barang hasil pencetakan dan penerbitan, seperti buku, majalah, komik, kliping koran dan lain-lain.', 'kbli_77293', NULL, NULL),
(1492, '77294', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Bunga Dan Tanaman Hias', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (opeartional leasing) semua jenis bunga dan tanaman hias, seperti tanaman untuk pesta, dan lain-lain.', 'kbli_77294', NULL, NULL),
(1493, '77295', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Alat  Musik', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) peralatan musik, seperti gitar, drum, organ dan alat musik lainnya.', 'kbli_77295', NULL, NULL),
(1494, '77299', 'Aktivitas penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Barang Keperluan Rumah Tangga Dan Pribadi Lainnya YTDL', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) semua jenis barang untuk keperluan rumah tangga dan pribadi yang belum diklasifikan dalam kelompok 77291 s.d. 77295, seperti peralatan elektronik rumah tangga, televisi, radio, mesin dan perkakas rumah tangga yang biasanya merupakan peralatan hobi untuk memperbaiki peralatan rumah tangga, dan lain-lain. Termasuk kegiatan penyewaan ikan hias dengan akuarium, dapat dilengkapi dengan usaha jasa perawatan dan pembersihannya.', 'kbli_77299', NULL, NULL),
(1495, '77311', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Alat Transportasi Darat Bukan Kendaraan Bermotor Roda Empat Atau Lebih', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) semua jenis alat transportasi darat bukan kendaraan bermotor roda empat atau lebih (mobil, bis, truk dan sejenisnya) tanpa operatornya, seperti sepeda motor, caravan, camper, railroad vehicle dan sejenisnya. Kelompok ini juga mencakup usaha persewaan peti kemas (container). Persewaan alat transportasi darat dengan operatornya dicakup dalam subgolongan 4922, 4942 dan 4943. Penyewaan alat transportasi darat kendaraan bermotor roda empat atau lebih (mobil, bus, truk dan sejenisnya) tanpa operatornya masuk dalam 77100. Penyewaan sepeda dicakup dalam 77210.', 'kbli_77311', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(1496, '77312', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Alat Transportasi Air', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) alat transportasi air tanpa operatornya, seperti motor boat, perahu, kapal dan sejenisnya. Penyewaan alat transportasi air dengan operatornya dicakup dalam golongan pokok 50 pada kelompok yang bersesuaian. Penyewaan kapal pesiar dicakup dalam 77210.', 'kbli_77312', NULL, NULL),
(1497, '77313', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Alat Transportasi Udara', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) alat transportasi udara tanpa operatornya, seperti pesawat terbang, balon udara dan sejenisnya. Penyewaan alat transportasi udara dengan operatornya dicakup dalam golongan pokok 51 pada kelompok yang bersesuaian.', 'kbli_77313', NULL, NULL),
(1498, '77319', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Alat Transportasi Lainnya', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) alat transportasi lainnya.', 'kbli_77319', NULL, NULL),
(1499, '77321', 'Aktivitas Penyewaan dan Sewa Guna Tanpa Hak Opsi Alat Perekaman Gambar & Editing', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin, peralatan dan barang kebutuhan shooting yang mencakup sewa alat rekam gambar dan suara berupa kamera, media rekam, pencahayaan, alat editing, alat motion control dan kebutuhan alat penunjang lain yang terkait dengan aktivitas 5911 dan 5912.', 'kbli_77321', NULL, NULL),
(1500, '77322', 'Aktivitas Penyewaan dan Sewa Guna Tanpa Hak Opsi Alat Alat Bantu Teknologi Digital', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin, peralatan dan barang kebutuhan teknologi digital yang mencakup sewa render farm, sewa motion capture, sewa 3D scanner, dan kebutuhan penunjang lain yang terkait aktivitas 5911 dan 5912. Sewa lisensi software dicakup dalam 58200.', 'kbli_77322', NULL, NULL),
(1501, '77323', 'Aktivitas Penyewaan dan Sewa Guna Tanpa Hak Opsi Alat Kebutuhan MICE', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin, dan peralatan barang dekorasi kebutuhan Meeting, Incentive, Convention, and Exhibition (MICE) dan penunjang lainnya.', 'kbli_77323', NULL, NULL),
(1502, '77329', 'Aktivitas Penyewaan dan Sewa Guna Tanpa Hak Opsi Mesin dan Peralatan Industri Kreatif Lainnya', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin dan peralatan industri kreatif lainnya. Sewa lisensi software termasuk kelompok 58200.', 'kbli_77329', NULL, NULL),
(1503, '77391', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Mesin dan Peralatan Industri Pengolahan', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin dan peralatan industri tanpa operator yang secara umum digunakan sebagai barang modal oleh perusahaan, seperti mesin tekstil, mesin pengolahan atau pengerjaan logam dan kayu, mesin percetakan dan mesin las listrik. Termasuk perkakas mesin, alat untuk produksi alat pengukur dan pemeriksa dan mesin ilmiah, komersil dan industri lainnya.', 'kbli_77391', NULL, NULL),
(1504, '77392', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Mesin Pertanian Dan Peralatannya', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin dan peralatan pertanian dan kehutanan tanpa operator termasuk perlengkapannya, seperti mesin dan peralatan yang dihasilkan oleh subgolongan 2821, sebagai contoh traktor pertanian dan sejenisnya. Penyewaan mesin dan peralatan pertanian dan kehutanan dengan operatornya termasuk perlengkapannya secara berturut-turut dimasukkan dalam subgolongan 0161 dan 0240.', 'kbli_77392', NULL, NULL),
(1505, '77393', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Mesin Dan Peralatan Konstruksi Dan Teknik Sipil', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin dan peralatan konstruksi dan teknik sipil termasuk perlengkapannya tanpa operatornya, seperti lori derek (crane lorries), tangga dan panggung kerja (scaffold dan work platform) tidak termasuk pemasangan dan pemancangannya dan sejenisnya. Penyewaan mesin dan peralatan konstruksi dan teknik sipil termasuk perlengkapannya dengan operatornya dimasukkan dalam 43905.', 'kbli_77393', NULL, NULL),
(1506, '77394', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak opsi Mesin Kantor Dan Peralatannya', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) semua jenis mesin kantor dan peralatannya tanpa operator, seperti mesin tik, mesin akuntansi, mesin dan peralatan penghitung (cash register, kalkulator elektronik dan lain-lain), mesin pengolah data, mesin fotokopi, furnitur kantor dan sejenisnya. Termasuk penyewaan komputer dan perlengkapannya tanpa operatornya.', 'kbli_77394', NULL, NULL),
(1507, '77395', 'Aktivitas Penyewaan dan Sewa Guna Tanpa Hak Opsi Mesin Pertambangan dan Energi serta Peralatannya', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin dan peralatan pertambangan dan penggalian tanpa operator yang secara umum digunakan sebagai barang modal oleh perusahaan, seperti mesin pembangkit listrik. Termasuk mesin penggerak atau uap dan turbin, alat pertambangan dan perminyakan, peralatan radio dan komunikasi profesional.', 'kbli_77395', NULL, NULL),
(1508, '77399', 'Aktivitas Penyewaan dan Sewa Guna Usaha Tanpa Hak Opsi Mesin, Peralatan dan Barang Berwujud Lainnya YTDL', 'Kelompok ini mencakup kegiatan penyewaan dan sewa guna usaha tanpa hak opsi (operational leasing) mesin, peralatan dan barang berwujud ytdl dalam subgolongan 7730 yang secara umum digunakan sebagai barang modal, seperti kontainer untuk tempat tinggal atau kantor, palet (alat pengangkat kontainer) dan sejenisnya.Termasuk penyewaan alat pemindaian bagasi dengan sumber radiasi pengion dan penyewaan hewan ternak, kuda pacu dan sejenisnya.', 'kbli_77399', NULL, NULL),
(1509, '77400', 'Sewa Guna Usaha Tanpa Hak Opsi Intelektual Properti, Bukan Karya Hak Cipta', 'Kelompok ini mencakup usaha yang kegiatan memperbolehkan pihak lain menggunakan aset non finansial di mana pembayaran royalti atau balas jasa lisensi yang dibayar ke pemegang aset. Penggunaan aset tersebut dapat berbagai macam bentuk, seperti izin reproduksi, digunakan dalam proses atau produksi  berikut, pengoperasian bisnis di bawah sistem waralaba dan lain-lain. Pemilik intelektual properti dapat sekaligus pembuatnya atau juga bukan. kegiatan yang dicakup meliputi sewa guna usaha tanpa hak opsi (operational leasing) intelektual properti yang tak berwujud (bukan karya/hak cipta seperti buku atau piranti lunak) dan penerimaan royalti atau balas jasa lisensi untuk penggunaan, seperti entitas yang dipatenkan, trade mark dan service mark, brand name, hak eksplorasi barang tambang/mineral, perjanjian franchise/waralaba dan intelektual properti yang tak berwujud lainnya.', 'kbli_77400', NULL, NULL),
(1510, '78101', 'Aktivitas Penyeleksian Dan Penempatan Tenaga Kerja Dalam Negeri', 'Kelompok ini mencakup kegiatan pendaftaran, penyeleksian dan penempatan tenaga kerja dalam negeri di berbagai bidang usaha yang dilakukan atas dasar Perjanjian Kerja melalui aktivitas bursa kerja, mekanisme antar kerja lokal dan antar kerja antar daerah oleh Lembaga Penempatan Tenaga Kerja Swasta (LPTKS), dan perusahaan perekrutan dan penempatan awak kapal di dalam negeri berdasarkan perjanjian kerja laut dan/atau kesepakatan kerja bersama (colletive bargaining agreement). Termasuk pula penyediaan tenaga kerja eksekutif kepada pihak lain.', 'kbli_78101', NULL, NULL),
(1511, '78102', 'Aktivitas Penyeleksian Dan Penempatan Tenaga Kerja Luar Negeri', 'Kelompok ini mencakup kegiatan penyampaian informasi, pendaftaran, penyeleksian dan penempatan serta pelindungan pekerja migran indonesia yang bekerja pada pemberi kerja di luar negeri di berbagai bidang usaha melalui mekanisme antar kerja antar negara oleh Perusahaan Penempatan Pekerja Migran Indonesia (P3MI) atas dasar perjanjian kerja yang disepakati antara pemberi kerja dan pekerja migran indonesia dan diketahui pejabat yang ditunjuk, dan penempatan awak kapal niaga migran dan awak kapal perikanan migran di luar negeri berdasarkan perjanjian kerja laut dan/atau kesepakatan kerja bersama (colletive bargaining agreement). Termasuk penyediaan tenaga kerja eksekutif kepada pihak lain.', 'kbli_78102', NULL, NULL),
(1512, '78103', 'Aktivitas Penempatan Pekerja Rumah Tangga', 'Kelompok ini mencakup usaha jasa pendaftaran, pelatihan, penyeleksian dan penempatan serta pelindungan pekerja rumah tangga oleh Lembaga Penyalur Pekerja Rumah Tangga (LPPRT), seperti pekerja rumah tangga, pengasuh balita, perawat non-medis lansia, penjaga toko di dalam negeri oleh LPPRT atas dasar perjanjian kerja dan perjanjian penempatan yang mendapatkan izin dari pejabat yang ditunjuk.', 'kbli_78103', NULL, NULL),
(1513, '78104', 'Aktivitas Penempatan Tenaga Kerja Daring (Job portal)', 'Kelompok ini mencakup usaha jasa pendaftaran pencari kerja,lowongan kerja dan fasilitasi penempatan tenaga kerja yang aktivitasnya meliputi pemberian informasi lowongan kerja kepada pencari kerja dan memberikan informasi data dan kompetensi pencari kerja kepada pemberi kerja  yang dilakukan secara daring oleh Pelaksana Job Portal yang beroperasi di Indonesia dan mendapat legalisasi dari pemerintah.', 'kbli_78104', NULL, NULL),
(1514, '78200', 'Aktivitas Penyediaan Tenaga Kerja Waktu Tertentu', 'Kelompok ini mencakup kegiatan penyediaan tenaga kerja untuk pemberi kerja pada jangka waktu tertentu dalam rangka penambahan tenaga kerja, di mana penyediaan tenaga kerja adalah pegawai tidak tetap atau sementara yang membantu suatu unit. Kegiatan yang diklasifikasikan di sini tidak menyediakan pengawas langsung untuk pekerja yang ditempatkan pada pemberi kerja. Kegiatannya seperti jasa penyediaan tenaga penjaga stand pameran.', 'kbli_78200', NULL, NULL),
(1515, '78300', 'Penyediaan Sumber Daya Manusia dan Manajemen Fungsi Sumber Daya Manusia', 'Kelompok ini mencakup kegiatan penyediaan sumber daya manusia dan jasa manajemen sumber daya manusia untuk pemberi kerja. Kegiatan ini dikhususkan untuk menyelenggarakan sumber daya manusia dan tugas manajemen personil. Kegiatan ini menyajikan riwayat kerja pekerja dalam hal yang berhubungan dengan upah, pajak dan masalah keuangan dan sumber daya lainnya  termasuk penyedia jasa pekerja/buruh.', 'kbli_78300', NULL, NULL),
(1516, '78411', 'Pelatihan Kerja Teknik Pemerintah', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah   keterampilan/keahlian   dalam   bidang   mesin   produksi, instalasi  pipa,  kerja  pelat,  pengecoran  logam,  CNC,  las  industri,  las SMAW, las GMAW, las GTAW, las FCAW, las OAW, las fabrikasi, las bawah air, teknik kendaraan ringan, perbaikan body kendaraan ringan, teknik sepeda  motor,  mekanik  motor  tempel,    teknik  alat  berat,  instalasi penerangan, instalasi tenaga, Programmable Logic Control (PLC), otomasi industri, mekatronika, telekomunikasi, instrumentasi dan kontrol, audio video,  instalasi   satelit  (VSAT),   fiber  optik,  servis  telepon   seluler, penyolderan, robotik, refrigerasi domestik, teknik tata udara, konstruksi batu  dan  beton,  desain  interior,  desain  eksterior,    konstruksi  kayu, gambar    bangunan,   furniture/meubelair,    konstruksi    baja   ringan, pekerjaan gipsum, surveyor dan pemetaan, pembesian, dan lainnya yang diselenggarakan oleh pemerintah.', 'kbli_78411', NULL, NULL),
(1517, '78412', 'Pelatihan Kerja Teknologi Informasi dan Komunikasi Pemerintah', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah   ketrampilan/keahlian dalam bidang networking,   cloud computing,    website,         technical    support,    computer    engineering, programming,  multimedia,  database,  system  analyst,  graphic  design, office, animasi, artificial intelligence, IT governance, public relation, public speaking,  IT   software   solution   for   business, dan lainnya   yang diselenggarakan oleh pemerintah.', 'kbli_78412', NULL, NULL),
(1518, '78413', 'Pelatihan Kerja Industri Kreatif Pemerintah', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang teknik ukir logam, teknik ukir kayu, merenda, menyulam, menenun, sablon, anyaman, teknik batik tulis, teknik batik cap, penyamakan kulit, finishing kulit, pembuatan produk dari kulit, menjahit (knitting, woven), teknik bordir, teknik pola, fashion design, fashion  technology, penjahit pakaian, kecantikan kulit, kecantikan rambut, terapis spa, dan lainnya yang diselenggarakan oleh pemerintah.', 'kbli_78413', NULL, NULL),
(1519, '78414', 'Pelatihan Kerja Pariwisata dan Perhotelan Pemerintah', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian   dalam  bidang  perhotelan   laundry attendant, bakery, tour leader, roti dan pattiserie, waiters, house keeping, front  office,  restaurant  attendant,  room  attendant,  barista,  commercial cookery, tour guide, commis pastry, food and beverage  service, food and beverage  product, room divisiondan lainnya yang diselenggarakan oleh pemerintah.', 'kbli_78414', NULL, NULL),
(1520, '78415', 'Pelatihan Kerja Bisnis dan Manajemen  Pemerintah', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah keterampilan/keahlian dalam bidang bisnis dan manajemen yang  diselenggarakan  oleh  pemerintah. Kegiatan  yang  masuk  dalam kelompok ini adalah pelatihan sekretaris, administrasi perkantoran, ICT for secretary, akuntansi, keuangan, tata niaga/penjualan, bahasa asing, promosi produktivitas, bimbingan     konsultansi, pengukuran produktivitas,  manajemen peningkatan  produktivitas,  kewirausahaan, dan lainnya.', 'kbli_78415', NULL, NULL),
(1521, '78416', 'Pelatihan Kerja Pekerjaan Domestik  Pemerintah', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian   dalam  bidang     pengurus  rumah tangga, penjaga lanjut usia, pengasuh bayi/balita, pengasuh anak, juru masak, dan lainnya yang diselenggarakan oleh pemerintah.', 'kbli_78416', NULL, NULL),
(1522, '78417', 'Pelatihan Kerja Pertanian dan Perikanan Pemerintah', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian  dalam bidang mekanisasi  pertanian, tanaman    pangan,   hortikultura, smart    nutrition, smart  farming, pengolahan  tanah,  konservasi  lahan,  budidaya  tanaman,  hydroponic, penangkapan ikan, budidaya ikan,  permesinan  perikanan, pengolahan hasil   pertanian,   pengolahan    hasil   perikanan,   pengolahan   hasil peternakan,    agribisnis    produksi    tanaman,    agribisnis    produksi peternakan, agribisnis produksi sumber daya perairan dan lainnya yang diselenggarakan oleh pemerintah.', 'kbli_78417', NULL, NULL),
(1523, '78419', 'Pelatihan Kerja Pemerintah Lainnya', 'Kelompok   ini   mencakup   kegiatan   pelatihan   kerja   lainnya   yang diselenggarakan pemerintah yang belum dicakup dalam kelompok 78411 s.d. 78417,   termasuk   bidang   metodologi   pelatihan   kerja, Kesehatan dan Keselamatan   Kerja   (K3),   pelatihan   motivasi,   pengembangan   diri, pengembangan karir, neuro language programming, dan lainnya  yang diselenggarakan oleh pemerintah.', 'kbli_78419', NULL, NULL),
(1524, '78421', 'Pelatihan Kerja Teknik Swasta', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang mesin produksi, instalasi pipa, kerja pelat, pengecoran  logam, CNC, las  industri,  fabrikasi,  las bawah air, teknik kendaraan ringan, teknik  sepeda motor, teknik alat berat,   instalasi   penerangan,   instalasi    tenaga,   otomasi   industri, mekatronika,  telekomunikasi,  instrumentasi  dan kontrol, audio video, refrigerasi  domestik,  teknik  tata  udara,  konstruksi  batu  dan  beton, konstruksi kayu, gambar bangunan, furniture, konstruksi baja ringan, pekerjaan gipsum, survei dan pemetaan, pembesian, dan lainnya yang diselenggarakan oleh swasta.', 'kbli_78421', NULL, NULL),
(1525, '78422', 'Pelatihan Kerja Teknologi Informasi dan Komunikasi Swasta', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang networking,  technical support, computer engineering,   programming, multimedia, database, system analyst, graphic design, office tools, animasi, artificial intelligence, IT governance, public   relation, public speaking, dan lainnya   yang diselenggarakan oleh swasta.', 'kbli_78422', NULL, NULL),
(1526, '78423', 'Pelatihan Kerja Industri Kreatif  Swasta', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang teknik ukir logam, teknik ukir kayu, merenda, menyulam, menenun, sablon, anyaman, teknik batik tulis, teknik batik cap, penyamakan kulit, finishing kulit, pembuatan produk dari kulit, menjahit (knitting, woven), teknik bordir, teknik pola, fashion design, fashion technology, kecantikan kulit, kecantikan rambut, dan lainnya yang diselenggarakan oleh swasta.', 'kbli_78423', NULL, NULL),
(1527, '78424', 'Pelatihan Kerja Pariwisata dan Perhotelan Swasta', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang perhotelan yang diselenggarakan oleh swasta.', 'kbli_78424', NULL, NULL),
(1528, '78425', 'Pelatihan Kerja Bisnis dan Manajemen  Swasta', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah keterampilan/keahlian dalam bidang bisnis dan manajemen yang diselenggarakan oleh swasta. Kegiatan yang masuk dalam kelompok ini adalah  pelatihan sekretaris, administrasi perkantoran,   ICT  for secretary,keuangan, tata niaga/penjualan, bahasa  asing,  promosi produktivitas, bimbingan konsultansi, pengukuran produktivitas, manajemen peningkatan produktivitas, kewirausahaan, dan lainnya.', 'kbli_78425', NULL, NULL),
(1529, '78426', 'Pelatihan Kerja Pekerjaan Domestik  Swasta', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang pengurus rumah tangga, penjaga lanjut usia, pengasuh bayi/balita, pengasuh anak, juru masak, dan lainnya yang diselenggarakan oleh swasta.', 'kbli_78426', NULL, NULL),
(1530, '78427', 'Pelatihan Kerja Pertanian dan Perikanan Swasta', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang mekanisasi  pertanian, tanaman pangan, hortikultura, mix farming, pengolahan tanah, konservasi lahan, budidaya tanaman, penangkapan ikan, budidaya ikan, permesinan  perikanan, pengolahan  hasil  pertanian,  pengolahan  hasil perikanan, pengolahan hasil peternakan, agribisnis produksi tanaman, agribisnis produksi peternakan, agribisnis produksi sumber daya perairan dan lainnya yang diselenggarakan oleh swasta.', 'kbli_78427', NULL, NULL),
(1531, '78429', 'Pelatihan Kerja Swasta Lainnya', 'Kelompok   ini   mencakup   kegiatan   pelatihan   kerja   lainnya   yang diselenggarakan swasta yang belum dicakup dalam kelompok 78421 s.d. 78427,  termasuk   bidang   metodologi   pelatihan   kerja, Kesehatan dan Keselamatan   Kerja   (K3),   pelatihan   motivasi,   pengembangan   diri, pengembangan karir, neuro language programming, dan lainnya  yang diselenggarakan oleh swasta.', 'kbli_78429', NULL, NULL),
(1532, '78431', 'Pelatihan Kerja Teknik Perusahaan', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang mesin produksi, instalasi pipa, kerja pelat, pengecoran  logam, CNC, las  industri,  fabrikasi,  las bawah air, teknik kendaraan ringan, teknik sepeda motor, teknik alat berat, instalasi penerangan, instalasi    tenaga, otomasi industri, mekatronika, telekomunikasi,  instrumentasi dan kontrol, audio video, refrigerasi domestik, teknik tata udara, konstruksi batu dan beton, konstruksi kayu, gambar bangunan, furniture, konstruksi baja ringan, pekerjaan gipsum, survei dan pemetaan, pembesian, dan lainnya yang diselenggarakan oleh perusahaan.', 'kbli_78431', NULL, NULL),
(1533, '78432', 'Pelatihan Kerja Teknologi Informasi dan Komunikasi Perusahaan', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang networking,  technical support, computer engineering,   programming, multimedia, database, system analyst, graphic design, office tools, animasi, artificial intelligence, IT governance, public   relation, public speaking, dan lainnya   yang diselenggarakan oleh perusahaan.', 'kbli_78432', NULL, NULL),
(1534, '78433', 'Pelatihan Kerja Industri Kreatif Perusahaan', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang teknik ukir logam, teknik ukir kayu, merenda, menyulam, menenun, sablon, anyaman, teknik batik tulis, teknik batik cap, penyamakan kulit, finishing kulit, pembuatan produk dari kulit, menjahit (knitting, woven), teknik bordir, teknik pola, fashion design, fashion technology, kecantikan kulit, kecantikan rambut, dan lainnya yang diselenggarakan oleh perusahaan.', 'kbli_78433', NULL, NULL),
(1535, '78434', 'Pelatihan Kerja Pariwisata dan Perhotelan Perusahaan', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang perhotelan yang diselenggarakan oleh perusahaan.', 'kbli_78434', NULL, NULL),
(1536, '78435', 'Pelatihan Kerja Bisnis dan Manajemen  Perusahaan', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah keterampilan/keahlian dalam bidang bisnis dan manajemen yang diselenggarakan oleh perusahaan. Kegiatan yang masuk dalam kelompok ini adalah  pelatihan sekretaris, administrasi perkantoran,   ICT  for secretary,keuangan, tata niaga/penjualan, bahasa  asing,  promosi produktivitas, bimbingan konsultansi, pengukuran produktivitas, manajemen peningkatan produktivitas, kewirausahaan, dan lainnya.', 'kbli_78435', NULL, NULL),
(1537, '78436', 'Pelatihan Kerja Pekerjaan Domestik  Perusahaan', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang pengurus rumah tangga, penjaga lanjut usia, pengasuh bayi/balita, pengasuh anak, juru masak, dan lainnya yang diselenggarakan oleh perusahaan.', 'kbli_78436', NULL, NULL),
(1538, '78437', 'Pelatihan Kerja Pertanian dan Perikanan Perusahaan', 'Kelompok ini mencakup kegiatan pelatihan kerja yang bertujuan untuk menambah ketrampilan/keahlian dalam bidang mekanisasi  pertanian, tanaman pangan, hortikultura, mix farming, pengolahan tanah, konservasi lahan, budidaya tanaman, penangkapan ikan, budidaya ikan, permesinan  perikanan, pengolahan  hasil  pertanian,  pengolahan  hasil perikanan, pengolahan hasil peternakan, agribisnis produksi tanaman, agribisnis produksi peternakan, agribisnis produksi sumber daya perairan dan lainnya yang diselenggarakan oleh perusahaan.', 'kbli_78437', NULL, NULL),
(1539, '78439', 'Pelatihan Kerja Perusahaan Lainnya', 'Kelompok   ini   mencakup   kegiatan   pelatihan   kerja   lainnya   yang diselenggarakan perusahaan yang belum dicakup dalam kelompok 78431 s.d. 78437,   termasuk   bidang   metodologi   pelatihan   kerja, Kesehatan dan Keselamatan   Kerja   (K3),   pelatihan   motivasi,   pengembangan   diri, pengembangan karir, neuro language programming, dan lainnya  yang diselenggarakan oleh perusahaan.', 'kbli_78439', NULL, NULL),
(1540, '79111', 'Aktivitas Agen Perjalanan Wisata', 'Kelompok ini mencakup usaha yang kegiatannya sebagai perantara penjualan paket wisata, baik secara daring (online) maupun luring (offline), yang dikemas oleh biro perjalanan wisata; memesan tiket angkutan darat, laut, dan udara, baik untuk tujuan dalam negeri maupun luar negeri; memesan akomodasi, restoran, dan tiket pertunjukan seni budaya, serta kunjungan ke destinasi atau daya tarik wisata; dan mengurus dokumen perjalanan berupa paspor dan visa atau dokumen lain yang dipersamakan.', 'kbli_79111', NULL, NULL),
(1541, '79112', 'Aktivitas Agen Perjalanan Ibadah Umroh dan Haji Khusus', 'Kelompok ini mencakup usaha yang kegiatannya sebagai perantara penjualan paket ibadah umroh dan haji khusus, baik secara daring (<i>online</i>) maupun luring (<i>offline</i>), yang dikemas oleh biro perjalanan ibadah umroh dan haji khusus; memesan tiket angkutan darat, laut, dan udara, baik untuk tujuan dalam negeri maupun luar negeri; memesan akomodasi, restoran, dan tiket pertunjukan seni budaya, serta kunjungan ke destinasi atau daya tarik wisata; dan mengurus dokumen perjalanan berupa paspor dan visa atau dokumen lain yang dipersamakan.', 'kbli_79112', NULL, NULL),
(1542, '79119', 'Aktivitas Agen Perjalanan Lainnya', 'Kelompok ini mencakup usaha yang kegiatannya tidak termasuk dalam kelompok 79111 dan 79112, melakukan pemesanan dan penjualan tiket angkutan udara, laut dan darat, baik untuk tujuan dalam negeri maupun luar negeri.', 'kbli_79119', NULL, NULL),
(1543, '79121', 'Aktivitas Biro Perjalanan Wisata', 'Kelompok ini mencakup usaha yang kegiatannya melakukan perencanaan dan pengemasan komponen-komponen perjalanan wisata termasuk wisata alam, yang meliputi sarana wisata, destinasi atau daya tarik wisata dan jasa pariwisata lainnya terutama yang terdapat di wilayah Indonesia dalam  bentuk paket wisata, melakukan penyelenggaraan dan penjualan paket wisata dengan cara menyalurkan melalui agen perjalanan dan atau menjual langsung kepada wisatawan atau konsumen, melakukan penyediaan layanan pramuwisata yang berhubungan dengan paket wisata yang dijual, baik secara daring (online) maupun luring (offline), melakukan penyediaan layanan angkutan wisata, melakukan pemesanan akomodasi, restoran, tempat konvensi, dan tiket penjualan seni budaya serta kunjungan ke daya tarik wisata, melakukan pengurusan dokumen perjalanan berupa paspor dan visa atau dokumen lain yang dipersamakan.', 'kbli_79121', NULL, NULL),
(1544, '79122', 'Aktivitas Biro Perjalanan Ibadah Umroh dan Haji Khusus', 'Kelompok ini mencakup usaha yang kegiatannya melakukan perencanaan dan pengemasan komponen-komponen perjalanan ibadah umroh dan haji khusus dengan cara menyalurkan melalui agen perjalanan dan atau menjual langsung kepada konsumen, melakukan penyediaan layanan yang berhubungan dengan paket ibadah umroh dan haji khusus yang dijual, baik secara daring (<i>online</i>) maupun luring (<i>offline</i>), melakukan penyediaan layanan angkutan, akomodasi, restoran, melakukan pengurusan dokumen perjalanan berupa paspor dan visa atau dokumen lain yang dipersamakan.', 'kbli_79122', NULL, NULL),
(1545, '79129', 'Aktivitas Biro Perjalanan Lainnya', 'Kelompok ini mencakup usaha yang kegiatannya tidak termasuk dalam kelompok 79121 dan 79122, baik secara daring (online) maupun luring (offline), melakukan penyediaan layanan angkutan, akomodasi, restoran, tempat konvensi, dan melakukan pengurusan dokumen perjalanan berupa paspor dan visa atau dokumen lain yang dipersamakan.', 'kbli_79129', NULL, NULL),
(1546, '79911', 'Jasa Informasi Pariwisata', 'Kelompok ini mencakup kegiatan penyediaan informasi mengenai obyek dan sarana pariwisata, jasa pariwisata, transportasi dan informasi lain yang diperlukan oleh wisatawan. Penyebaran informasi tentang usaha pariwisata atau informasi lain yang diperlukan wisatawan melalui media cetak, elektronik atau media komunikasi lain. Termasuk juga kegiatan pemberian informasi mengenai layanan pemesanan, akomodasi, restoran, penerbangan, angkutan darat dan angkutan laut.', 'kbli_79911', NULL, NULL),
(1547, '79912', 'Jasa Informasi Daya Tarik Wisata', 'Kelompok ini mencakup kegiatan penyediaan informasi mengenai daya tarik wisata baik alam, buatan maupun budaya seperti penyediaan data, berita, feature, foto, video, dan laporan aktivitas kunjungan dari influencer, buzzer, endorser, hasil penelitian mengenai daya tarik wisata. Penyebaran informasi tentang wisata melalui media cetak, elektronik atau media komunikasi lain baik daring (online) maupun luring (offline).', 'kbli_79912', NULL, NULL),
(1548, '79921', 'Jasa Pramuwisata', 'Kelompok ini mencakup perusahaan yang menyediakan usaha jasa pramuwisata yang dikenal dengan pemandu wisata (tour guide), yaitu kegiatan usaha yang mencakup jasa pendampingan dan bimbingan, termasuk interpretasi budaya dan alam, serta membantu segala sesuatu yang diperlukan wisatawan. Termasuk mengkoordinasikan tenaga pramuwisata lepas untuk memenuhi kebutuhan wisatawan secara perorangan atau kebutuhan biro perjalanan wisata.', 'kbli_79921', NULL, NULL),
(1549, '79922', 'Jasa interpreter wisata', 'Kelompok ini menyangkut usaha jasa interpreter wisata, yaitu kegiatan yang memberikan bimbingan, penerangan, dan petunjuk tentang obyek wisata, membantu segala sesuatu yang diperlukan wisatawan, termasuk jasa interpreter wisata alam di kawasan hutan yang memberikan pemahaman dan edukasi akan pentingnya kelestarian alam. Termasuk juga dalam kelompok ini perusahaan yang menyediakan tenaga interpreter wisata dan atau mengkoordinasikan tenaga interpreter wisata lepas untuk memenuhi kebutuhan wisatawan secara perorangan atau kebutuhan biro perjalanan wisata.', 'kbli_79922', NULL, NULL),
(1550, '79990', 'Jasa Reservasi Lainnya YBDI YTDL', 'Kelompok ini mencakup usaha jasa perjalanan wisata lainnya yang belum termasuk pada subgolongan 7991 dan 7992, seperti penyediaan jasa pemesanan lainnya yang berkaitan dengan perjalanan, seperti transportasi, hotel, restoran, sewa mobil, kegiatan hiburan dan olahraga; peyediaan jasa time share exchange (akomodasi); kegiatan penjualan tiket untuk event tertentu seperti theater, olahraga dan acara hiburan, pertunjukan seni budaya, serta kunjungan ke obyek dan daya tarik wisata dan kesenangan lainnya dan kegiatan ybdi ytdl.', 'kbli_79990', NULL, NULL),
(1551, '80100', 'Aktivitas Keamanan Swasta', 'Kelompok ini mencakup usaha jasa penyelidikan, pengawasan, penjagaan dan kegiatan atau perlindungan untuk keselamatan perorangan dan harta milik. Termasuk kegiatan patroli, seperti pengawalan dalam perjalanan membawa barang berharga, bodyguard, patroli jalan raya, penjagaan gedung, kantor, pabrik, hotel dan sebagainya, penyelidikan sidik jari, tanda tangan dan tulisan tangan. Penjagaan dengan sistem instalasi alarm dimasukkan dalam kelompok 80200. Penyelidikan yang berhubungan dengan perasuransian dimasukkan dalam subgolongan 6621.', 'kbli_80100', NULL, NULL),
(1552, '80200', 'Aktivitas Jasa Sistem Keamanan', 'Kelompok ini mencakup kegiatan jasa sistem keamanan, seperti pengawasan sistem tanda bahaya keamanan elektronik, seperti tanda bahaya kebakaran dan pencurian, termasuk pemeliharaannya; pemasangan, perbaikan, pembangunan kembali dan pengaturan perlengkapan kunci mekanik atau elektronik, ruangan besi dan peti besi. Kegiatan penjualan, pemasangan dan perbaikan dari sistem keamanan, perlengkapan kunci mekanik atau elektronik, ruangan besi dan peti besi, jika menjadi satu kesatuan dengan pengoperasiannya tercakup pada kelompok ini. Jika tidak dimasukkan pada klasifikasi yang bersesuaian. Termasuk jasa sistem keamanan yang menggunakan pemindaian bagasi dengan sumber radiasi pengion.', 'kbli_80200', NULL, NULL),
(1553, '80300', 'Aktivitas Penyelidikan', 'Kelompok ini mencakup kegiatan penyedia jasa penyelidikan dan detektif. Kegiatan semua penyelidik pribadi atau swasta, tidak bergantung jenis klien atau tujuan dari penyelidikan dicakup pada golongan ini. Termasuk penyelidikan latar belakang seseorang, pencarian jejak orang yang hilang, pencurian dan penggelapan.', 'kbli_80300', NULL, NULL),
(1554, '81100', 'Aktivitas Penyedia Gabungan Jasa Penunjang Fasilitas', 'Kelompok ini secara khusus menyediakan sebuah gabungan jasa penunjang, seperti pembersihan interior umum, pemeliharaan, pembuangan sampah, penjagaan dan pengamanan, pengiriman surat, penerimaan tamu, pencucian pakaian dan jasa yang berhubungan untuk menunjang operasional dalam fasilitas klien. Kelompok ini juga menyediakan tenaga operasianal untuk melakukan kegiatan penunjang ini, akan tetapi tidak termasuk dengan atau tanggung jawab atas usaha atau kegiatan utama klien.', 'kbli_81100', NULL, NULL),
(1555, '81210', 'Aktivitas Kebersihan Umum Bangunan', 'Kelompok ini mencakup kegiatan penyedia jasa kebersihan bermacam jenis gedung milik perusahaan/lembaga/badan/instansi pemerintah atau swasta, seperti gedung perkantoran, pabrik, pertokoan, balai pertemuan dan gedung sekolah, termasuk jasa kebersihan interior gedung-gedung tersebut, seperti pembersihan lantai, dinding, furnitur, jendela, ventilasi dan unit exhaust. Pencucian karpet dan permadani serta pembersihan gorden dimasukkan dalam kelompok 96200. Kegiatan jasa kebersihan gedung yang dilakukan oleh pekerja yang melayani rumah tangga dimasukkan dalam kelompok 97000.', 'kbli_81210', NULL, NULL),
(1556, '81290', 'Aktivitas Kebersihan Bangunan Dan Industri Lainnya', 'Kelompok ini mencakup Kegiatan penyedia jasa pembersihan eksterior dari semua jenis bangunan, termasuk kantor, pabrik, toko, lembaga dan tempat bisnis dan profesional lainnya serta bangunan untuk tempat tinggal atau pemukiman multi unit, kegiatan pembersihan khusus dari bangunan seperti pembersihan jendela, cerbong asap dan tungku atau perapian, kompor, tungku bakar, tempat pembakaran sampah, ketel atau alat perebus, pipa atau saluran ventilasi, pembuangan gas atau uap, jasa pembersihan dan pemeliharaan kolam renang, jasa pembersihan mesin industri, jasa pembersihan kereta, bus, pesawat terbang dan lain-lain, jasa pembersihan bagian dalam kapal dan truk tanker , jasa pembasmian dan pemusnahan hama, jasa pembersihan jalan dan pembersihan salju dan es, dan jasa pembersihan bangunan dan industri lainnya.', 'kbli_81290', NULL, NULL),
(1557, '81300', 'Aktivitas Perawatan dan Pemeliharaan Taman', 'Kelompok ini mencakup kegiatan pengerjaan, perawatan dan pemelihaan pertamanan untuk lokasi bangunan hunian dan non hunian serta serta bangunan sipil lainnya, seperti taman dan kebun untuk perumahan pribadi dan umum, bangunan publik dan semi-publik (sekolah, rumah sakit, lembaga pemerintah, tempat ibadah dan lain-lain), kawasan perkotaan (taman, kawasan penghijauan, pemakaman atau kuburan dan lain-lain), jalur hijau jalan bebas hambatan (jalan, jalur kereta, jalur angkutan air) dan  bangunan industri dan komersial; penghijauan untuk bangunan (kebun di atas atap, penghijauan depan bangunan, tanaman dalam ruangan), taman olahraga, taman bermain dan taman rekreasi lainnya (lapangan olahraga, bermain, berjemur dan golf), dan tempat  air tenang dan mengalir (kolam, kolam renang, selokan, anak sungai, sistem saluran pembuangan); dan tanaman untuk perlindungan terhadap suara atau keributan, angin, erosi, jarak pandang dan panas atau silau matahari.', 'kbli_81300', NULL, NULL),
(1558, '82110', 'Aktivitas Penyedia Gabungan Jasa Administrasi Kantor', 'Kelompok ini mencakup penyediaan gabungan jasa administrasi perkantoran sehari-hari, seperti penerimaan tamu, perencanaan keuangan, pemeliharaan catatan dan tagihan rekening, jasa personalia dan surat menyurat.', 'kbli_82110', NULL, NULL),
(1559, '82190', 'Aktivitas Fotokopi, Penyiapan Dokumen dan Aktivitas Khusus Penunjang Kantor Lainnya', 'Kelompok ini mencakup aktivitas penyedia jasa khusus penunjang kantor atau perusahaan lainnya yang tidak dapat diklasifikasikan di tempat lain, seperti penyiapan dokumen, editing dan koreksi dokumen, pengetikan, pengolahan kata atau desktop publishing, jasa penunjang sekretariat, perekaman dokumen dan jasa sekretariat lainnya, penulisan surat atau ringkasan, persewaan kotak surat dan jasa postal dan surat menyurat lainnya (kecuali direct mail advertising), jasa fotokopi, penggandaan, blue printing, jasa pengolah kata, jasa penggandaan dokumen lain yang juga menyediakan jasa pencetakan, seperti pencetakan offset, pencetakan cepat, pencetakan digital dan pencetakan prepress.', 'kbli_82190', NULL, NULL),
(1560, '82200', 'Aktivitas call centre', 'Kelompok ini mencakup usaha jasa call center, seperti inbound call centre (panggilan ke dalam), menjawab panggilan dari pelanggan oleh operator manusia, distribusi panggilan otomatis, integrasi telepon dan komputer, sistem respon suara interaktif atau metode yang sejenis untuk menerima permintaan, menyediakan produk informasi yang berkaitan dengan permintaan bantuan pelanggan atau menyalurkan keluhan atau komplain dari pelanggan; outbond call centre (panggilan ke luar), menggunakan metode yang sejenis untuk menjual atau memasarkan barang atau jasa kepada pelanggan potensial, melakukan penelitian pasar atau jajak pendapat masyarakat dan kegiatan yang sejenis kepada pelanggan.', 'kbli_82200', NULL, NULL),
(1561, '82301', 'Jasa Penyelenggara Pertemuan, Perjalanan Insentif, Konferensi dan Pameran (MICE)', 'Kelompok ini mencakup usaha pengaturan, promosi dan atau pengelolaan acara, seperti jasa pelayanan bagi suatu pertemuan sekelompok orang (negarawan, usahawan, cendekiawan, dan sebagainya). Termasuk juga dalam kelompok ini usaha jasa yang merencanakan, menyusun dan menyelenggarakan program perjalanan insentif dan usaha jasa yang melakukan perencanaan dan penyelenggaraan pameran dagang dan usaha, konvensi, konferensi dan rapat atau pertemuan. Kegiatan ini disebut juga jasa MICE (meeting, incentive, convention and exhibition).', 'kbli_82301', NULL, NULL),
(1562, '82302', 'Jasa Penyelenggara Event Khusus (Special Event)', 'Kelompok ini mencakup kegiatan penyelenggara event khusus yang melakukan pengaturan dan penyelenggaraan event khusus, baik atas dasar permintaan client mewujudkan tujuan yang diharapkan melalui acara yang diadakan, maupun event khusus yang dirancang sendiri, dimulai dari proses pembuatan konsep, perencanaan, persiapan, eksekusi hingga rangkaian acara selesai. Kegiatan penyelenggaraan event khusus yang dicakup kelompok ini adalah festival, karnaval, event olahraga, event musik, event budaya, event personal dan acara sejenisnya.', 'kbli_82302', NULL, NULL),
(1563, '82911', 'Aktivitas Debt Collection', 'Kelompok ini mencakup kegiatan pungutan pembayaran klaim dan pengiriman pembayaran yang ditujukan untuk pelanggan, seperti jasa pungutan tagihan atau hutang kredit.', 'kbli_82911', NULL, NULL),
(1564, '82912', 'Aktivitas Lembaga Pengelola Informasi Perkreditan', 'Kelompok ini juga mencakup kegiatan lembaga atau badan yang menghimpun dan mengolah data kredit dan data lain untuk menghasilkan informasi perkreditan.', 'kbli_82912', NULL, NULL),
(1565, '82920', 'Aktivitas Pengepakan', 'Kelompok ini mencakup usaha jasa pengepakan/pengemasan atas dasar balas jasa (fee) atau kontrak, baik menggunakan atau tidak suatu proses otomatis. Termasuk pembotolan minuman dan makanan, pengemasan benda padat (blister packaging, pembungkusan dengan alumunium foil dan lain-lain), pengemasan obat dan bahan obat-obatan, pelabelan, pembubuhan perangko dan pemberian cap, pengemasan parsel atau bingkisan dan pembungkusan hadiah. Termasuk pengalengan dan sejenisnya. Jasa pengepakan untuk kegiatan pengangkutan dimasukkan dalam kelompok 52291 s.d. 52299 yang bersesuaian.', 'kbli_82920', NULL, NULL),
(1566, '82990', 'Aktivitas Jasa Penunjang Usaha Lainnya YTDL', 'Kelompok ini mencakup kegiatan penyedia jasa penunjang usaha lainnya yang tidak dapat diklasifikasikan di tempat lain, seperti jasa laporan pengadilan dan catatan stenotype dan jasa stenografi untuk umum, jasa siaran langsung televisi untuk acara rapat dan konferensi, jasa pengalamatan bar code, jasa pencetakan bar code, jasa organisasi pengumpulan dana atas dasar balas jasa atau kontrak, jasa sortir surat, jasa penyimpanan, jasa pungutan parkir yang menggunakan meter coin, kegiatan pelelangan independen, administrasi program loyalitas, dan kegiatan penunjang lain yang disediakan untuk usaha yang tidak diklasifikasikan di tempat lain. Termasuk kegiatan pusat registrasi sistem resi gudang.', 'kbli_82990', NULL, NULL),
(1567, '84111', 'Lembaga Legislatif', 'Kelompok ini mencakup kegiatan kelembagaan MPR, DPR dan DPRD serta kesekretariatannya, yang berfungsi utama mengambil keputusan-keputusan konstitusional yang bersifat dasar dan prinsip dalam perumusan kebijaksanaan pemerintah, yaitu membuat, merubah atau mencabut undang-undang atau peraturan pemerintah serta membina administrasi pemerintah untuk melaksanakan kebijaksanaan pemerintah dan undang-undang, peraturan pemerintah dan ketentuan-ketentuan lain yang berlaku, termasuk mengambil keputusan, penetapan dan pengesahan anggaran pendapatan dan pengeluaran, anggaran investasi serta rencana-rencana jangka panjang.', 'kbli_84111', NULL, NULL),
(1568, '84112', 'Penyelenggaraan Pemerintah Negara Dan Kesekretariatan Negara', 'Kelompok ini mencakup seluruh kegiatan proses penyelenggaraan pemerintah untuk mencapai tujuan negara yang telah ditetapkan oleh badan legislatif, yaitu Presiden, Wakil Presiden, Sekretariat Negara, Sekretariat Kabinet, Departemen Dalam Negeri, Gubernur, Bupati, Walikota, Camat dan Lurah/Kepala Desa, yang mempunyai tugas merencanakan, memimpin dan mengawasi penyelenggaraan pemerintah.', 'kbli_84112', NULL, NULL),
(1569, '84113', 'Lembaga Eksekutif Keuangan, Perpajakan Dan Bea Cukai', 'Kelompok ini mencakup kegiatan kelembagaan pemerintah di bidang keuangan, perpajakan dan bea cukai dalam membantu kelancaran penyelenggaraan pemerintahan, termasuk juga kegiatan-kegiatan kesekretariatannya. Misalnya lembaga pemerintahan bidang keuangan, Dirjen Pajak dan Bea Cukai.', 'kbli_84113', NULL, NULL),
(1570, '84114', 'Lembaga Eksekutif Perencanaan', 'Kelompok ini mencakup kegiatan lembaga pemerintahanan di bidang perencanaan dalam merumuskan koordinasi kebijaksanaan pemerintah dalam menyelenggarakan pemerintahan, termasuk juga kegiatan kesekretariatannya. Misalnya lembaga pemerintahanan bidang perencanaan pembangunan nasional (BAPPENAS).', 'kbli_84114', NULL, NULL),
(1571, '84115', 'Lembaga Pemerintah Non Kementrian Dengan Tugas Khusus', 'Kelompok ini mencakup kegiatan lembaga/badan/instansi pemerintah non lembaga pemerintahan bidang dengan tugas khusus serta kesekretariatannya, yang mempunyai kewajiban membantu kelancaran penyelenggaraan pemerintahan, seperti Arsip Nasional, BAKN, LAN, BKKBN, LIPI, Lembaga Sandi Negara, BPS, dan lainnya. Tidak tercakup dalam kode ini badan untuk penanggulangan bencana (84234).', 'kbli_84115', NULL, NULL),
(1572, '84119', 'Kegiatan Administrasi Pemerintahan Lainnya', 'Kelompok ini mencakup kegiatan lembaga/badan/instansi pemerintah lainnya dengan tugas khusus serta kesekretariatannya, yang mempunyai kewajiban membantu kelancaran penyelenggaraan pemerintahan yang belum tercakup dalam kelompok 84111 s.d. 84115. Misalnya Lembaga-lembaga Nonstruktural, dan lainnya.', 'kbli_84119', NULL, NULL),
(1573, '84121', 'Administrasi Pelayanan Pemerintah Bidang Pendidikan', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan pendidikan yang mempunyai kewajiban memberikan pengarahan, pertimbangan dan mengambil keputusan dalam bidang pendidikan. Misalnya lembaga pemerintahanan bidang pendidikan, baik  dasar, menengah maupun pendidikan tinggi.', 'kbli_84121', NULL, NULL),
(1574, '84122', 'Administrasi Pelayanan Pemerintah Bidang Kesehatan', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan kesehatan yang mempunyai kewajiban memberikan pengarahan, pertimbangan dan mengambil keputusan dalam bidang pelayanan kesehatan, pengadaan obat-obatan, kesehatan masyarakat dan pencegahan penyakit, termasuk pembinaan penyediaan air bersih. Misalnya lembaga pemerintahanan bidang kesehatan.', 'kbli_84122', NULL, NULL),
(1575, '84123', 'Administrasi Pelayanan Pemerintah Bidang Perumahan', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan sarana dan prasarana tempat tinggal yang memenuhi syarat perumahan, seperti kebersihan dan keindahan, dengan tujuan menjadikan masyarakat yang sehat dan sejahtera. Misalnya lembaga pemerintahan bidang perumahan rakyat.', 'kbli_84123', NULL, NULL),
(1576, '84124', 'Administrasi Pelayanan Pemerintah Bidang Kesejahteraan Sosial', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan penyelenggaraan jaminan sosial, bantuan sosial dan rehabilitasi sosial. Misalnya lembaga pemerintahan bidang sosial.', 'kbli_84124', NULL, NULL),
(1577, '84125', 'Administrasi Pelayanan Pemerintah Bidang Keagamaan', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan agama Islam, Kristen Protestan, Kristen Katholik, Hindu dan Budha, dengan tujuan untuk meningkatkan takwa kepada Tuhan Yang Maha Esa dan mencapai kerukunan umat beragama. Misalnya lembaga pemerintahan bidang keagamaan.', 'kbli_84125', NULL, NULL),
(1578, '84126', 'Administrasi Pelayanan Pemerintah Bidang Kebudayaan/Kesenian/Rekreasi/Olahraga', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan kebudayaan/kesenian/rekreasi/olahraga, seperti museum, galeri, perpustakaan, tempat/benda peninggalan bersejarah, cagar budaya, berbagai kesenian daerah dan penyelenggaraan rekreasi dan olahraga. Misalnya lembaga pemerintahanan bidang pemuda dan olah raga dan lembaga pemerintahanan bidang kebudayaan dan kesenian.', 'kbli_84126', NULL, NULL),
(1579, '84127', 'Administrasi Pelayanan Pemerintah Bidang Lingkungan Hidup', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan kelestarian lingkungan, dengan tujuan menjadikan masyarakat yang sehat dan sejahtera. Misalnya lembaga pemerintahan bidang lingkungan hidup.', 'kbli_84127', NULL, NULL),
(1580, '84129', 'Administrasi Pelayanan Pemerintah Bidang Sosial Lainnya Bukan Kesehatan, Pendidikan, Keagamaan Dan Kebudayaan', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan pelayanan sosial lainnya bukan kesehatan, pendidikan, keagamaan dan kebudayaan yang belum termasuk dalam kelompok 84121 s.d. 84127. Misalnya lembaga pemerintahanan bidang pemberdayaan perempuan dan perlindungan anak.', 'kbli_84129', NULL, NULL),
(1581, '84131', 'Kegiatan Lembaga Pemerintahan Bidang Pertanian', 'Kelompok ini mencakup kegiatan lembaga pemerintahan dalam hal pembinaan, pengembangan dan penyelenggaraan di bidang pertanian, seperti pertanian tanaman pangan/tanaman perkebunan, peternakan, kehutanan, perburuan dan perikanan. Misalnya lembaga pemerintahanan bidang pertanian,  lembaga pemerintahanan bidang kelautan dan perikanan, dan lembaga pemerintahanan bidang kehutanan.', 'kbli_84131', NULL, NULL),
(1582, '84132', 'Kegiatan Lembaga Pemerintahan Bidang Pertambangan Dan Penggalian, Listrik, Air dan Gas', 'Kelompok ini mencakup kegiatan lembaga pemerintahan dalam hal pembinaan, pengembangan dan penyelenggaraan di bidang pertambangan, penggalian, geologi dan sumber daya mineral dan bidang kelistrikan, gas dan air. Misalnya lembaga pemerintahanan bidang energi dan sumber daya mineral.', 'kbli_84132', NULL, NULL),
(1583, '84133', 'Kegiatan Lembaga Pemerintahan Bidang Perindustrian', 'Kelompok ini mencakup kegiatan lembaga pemerintahan dalam hal pembinaan, pengembangan dan penyelenggaraan di bidang perindustrian. Misalnya lembaga pemerintahanan bidang perindustrian.', 'kbli_84133', NULL, NULL),
(1584, '84134', 'Kegiatan Lembaga Pemerintahan Bidang Komunikasi Dan Informatika', 'Kelompok ini mencakup kegiatan pemerintah dalam pembinaan komunikasi dan informatika. Pembinaan komunikasi dan informatika meliputi pembinaan di bidang sumber daya dan perangkat pos dan informatika, penyelenggaraan pos dan informatika, aplikasi informatika, serta informasi dan komunikasi publik.  Misalnya lembaga pemerintahanan bidang Komunikasi dan Informatika.', 'kbli_84134', NULL, NULL),
(1585, '84135', 'Kegiatan Lembaga Pemerintahan Bidang Konstruksi', 'Kelompok ini mencakup kegiatan lembaga pemerintahan dalam hal pembinaan, pengembangan dan penyelenggaraan di bidang konstruksi. Misalnya lembaga pemerintahanan bidang pekerjaan umum.', 'kbli_84135', NULL, NULL),
(1586, '84136', 'Kegiatan Lembaga Pemerintahan Bidang Perdagangan Dan Pariwisata', 'Kelompok ini mencakup kegiatan lembaga pemerintahan dalam hal pembinaan, pengembangan dan penyelenggaraan di bidang perdagangan dan pariwisata. Misalnya lembaga pemerintahanan bidang perdagangan dan lembaga pemerintahanan bidang pariwisata.', 'kbli_84136', NULL, NULL),
(1587, '84137', 'Kegiatan Lembaga Pemerintahan Bidang Perhubungan', 'Kelompok ini mencakup kegiatan lembaga pemerintahan dalam hal pembinaan, pengembangan dan penyelenggaraan di bidang perhubungan. Misalnya lembaga pemerintahanan bidang perhubungan.', 'kbli_84137', NULL, NULL),
(1588, '84138', 'Kegiatan Lembaga Pemerintahan Bidang Ketenagakerjaan', 'Kelompok ini mencakup kegiatan lembaga pemerintahan dalam hal pembinaan, pengembangan dan penyelenggaraan di bidang ketenagakerjaan. Misalnya lembaga pemerintahanan bidang ketenagakerjaan.', 'kbli_84138', NULL, NULL),
(1589, '84139', 'Kegiatan Lembaga Pemerintahan Untuk Menciptakan Efisiensi Produksi Dan Bisnis Lainnya', 'Kelompok ini mencakup kegiatan lembaga pemerintahan dalam hal pembinaan, pengembangan dan penyelenggaraan untuk menciptakan efisiensi dan bisnis yang belum tercakup dalam kelompok 84131 s.d. 84138. Misalnya lembaga pemerintahanan bidang pendayagunaan aparatur negara dan lembaga pemerintahanan bidang koperasi dan usaha kecil menengah.', 'kbli_84139', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(1590, '84210', 'Hubungan Luar Negeri', 'Kelompok ini mencakup semua kegiatan yang dikelola oleh lembaga pemerintahan bidang luar negeri, antara lain kegiatan administrasi dan operasional yang ditempatkan di luar negeri (misi diplomatik dan konsuler), dan pada kantor-kantor badan organisasi internasional (PBB, ASEAN dan sebagainya). Administrasi, operasional dan bantuan untuk kebudayaan yang melewati batas negara termasuk juga bantuan ekonomi dan bantuan misi ekonomi ke luar negeri, kecuali bantuan militer dan anggota militer di luar negeri dimasukkan ke dalam kelompok 84221 sampai dengan 84224.', 'kbli_84210', NULL, NULL),
(1591, '84221', 'Lembaga Pertahanan Dan Angkatan Bersenjata', 'Kelompok ini mencakup seluruh kegiatan (administrasi, operasional dan lain-lain), termasuk juga pegawai sipil di lingkungan angkatan bersenjata serta usaha pengiriman bantuan anggota militernya, kecuali anggota angkatan bersenjata yang dikaryakan atau yang menjabat dalam pemerintahan. Misalnya lembaga pemerintahan bidang pertahanan dan Markas Besar Tentara Nasional Indonesia.', 'kbli_84221', NULL, NULL),
(1592, '84222', 'Angkatan Darat', 'Kelompok ini mencakup seluruh kegiatan (administrasi, opersional dan lain-lain), termasuk juga pegawai sipil di lingkungan angkatan darat, kecuali anggota angkatan darat yang dikaryakan atau yang menjabat dalam pemerintahan. Misalnya Markas Besar TNI Angkatan Udara.', 'kbli_84222', NULL, NULL),
(1593, '84223', 'Angkatan Udara', 'Kelompok ini mencakup seluruh kegiatan (administrasi, operasional dan lain-lain), termasuk juga pegawai sipil di lingkungan angkatan udara, kecuali anggota angkatan udara yang dikaryakan atau yang menjabat dalam pemerintahan.  Misalnya Markas Besar TNI Angkatan Udara.', 'kbli_84223', NULL, NULL),
(1594, '84224', 'Angkatan Laut', 'Kelompok ini mencakup seluruh kegiatan (administrasi, operasional dan lain-lain), termasuk juga pegawai sipil di lingkungan angkatan laut, kecuali anggota angkatan laut yang dikaryakan atau yang menjabat dalam pemerintahan.  Misalnya Markas Besar TNI Angkatan Laut.', 'kbli_84224', NULL, NULL),
(1595, '84231', 'Kepolisian', 'Kelompok ini mencakup seluruh kegiatan POLRI (administrasi, operasional dan lain-lain) yang melayani masyarakat umum, baik langsung ataupun tidak di berbagai bidang keamanan dan ketertiban, seperti pengaduan, kriminal, ketertiban hukum, mengusut tindak pidana, termasuk juga kegiatan polisi rahasia.', 'kbli_84231', NULL, NULL),
(1596, '84232', 'Pertahanan Sipil', 'Kelompok ini mencakup seluruh kegiatan (administrasi, operasional dan lain-lain), yang timbul dari organisasi masyarakat dan dikelola serta dibiayai oleh masyarakat untuk kepentingan keamanan dan ketertiban lingkungan. Misalnya Pertahanan Sipil, Perlawanan Rakyat dan Keamanan Rakyat.', 'kbli_84232', NULL, NULL),
(1597, '84233', 'Lembaga Peradilan', 'Kelompok ini mencakup seluruh kegiatan badan pelaksana peradilan yang mempunyai kewajiban memberikan pertimbangan dan mengambil keputusan dalam bidang hukum. Misalnya Mahkamah Agung, lembaga pemerintahan bidang Hukum dan Hak Asasi Manusia, Kejaksaan, Pengadilan Tinggi, Pengadilan Negeri, Mahkamah Konstitusi.', 'kbli_84233', NULL, NULL),
(1598, '84234', 'Badan Nasional Penanggulangan Bencana dan Pemadam Kebakaran', 'Kelompok  ini mencakup kegiatan Badan Nasional Penanggulangan Bencana dan lembaga pemerintahanan dalam bidang pemadam dan pencegah kebakaran, seperti administrasi dan operasi pasukan pemadam api umum maupun khusus untuk pencegahan kebakaran, pemadaman, penyelamatan manusia dan hewan, bantuan terhadap bencana nasional, banjir dan kecelakaan di jalan dan  penyediaan bantuan untuk keadaan darurat dalam negeri seperti keadaan damai setelah bencana dan lain-lain.', 'kbli_84234', NULL, NULL),
(1599, '84300', 'Jaminan Sosial Wajib', 'Kelompok ini mencakup usaha pendanaan dan administrasi jaminan sosial wajib yang diselenggarakan oleh pemerintah, seperti jaminan sosial kesehatan, kecelakaan, pengangguran dan pensiun, program untuk mengatasi masalah kehilangan pendapatan yang diakibatkan oleh persalinan, cacat sementara, status janda dan lain-lain.', 'kbli_84300', NULL, NULL),
(1600, '85111', 'Pendidikan Dasar/Ibtidaiyah Pemerintah', 'Kelompok ini mencakup pendidikan sekolah dasar dan berlangsung selama enam tahun yang dikelola oleh pemerintah termasuk sekolah dasar keagamaan dan pendidikan khusus yang sederajat, seperti Sekolah Dasar Negeri, Madrasah Ibtidaiyah Negeri dan Sekolah Luar Biasa Tingkat Dasar Negeri. Termasuk dalam kelompok ini adalah program pemberantasan buta huruf yang diselenggarakan pemerintah bagi anak-anak yang tidak mempunyai kesempatan bersekolah, juga pendidikan bagi anak-anak terbelakang pada jenjang pendidikan yang sederajat.', 'kbli_85111', NULL, NULL),
(1601, '85112', 'Pendidikan Menengah Pertama/Tsanawiyah Pemerintah', 'Kelompok ini mencakup pendidikan sekolah menengah pertama yang berlangsung selama tiga tahun yang dikelola oleh pemerintah termasuk sekolah menengah keagamaan dan pendidikan khusus yang sederajat, seperti Sekolah Menengah Pertama Negeri, Madrasah Tsanawiyah Negeri dan Sekolah Luar Biasa Menengah Pertama Negeri.', 'kbli_85112', NULL, NULL),
(1602, '85121', 'Pendidikan Dasar/Ibtidaiyah  Swasta', 'Kelompok ini mencakup pendidikan sekolah dasar dan berlangsung selama enam tahun yang dikelola oleh swasta termasuk sekolah dasar keagamaan dan pendidikan khusus yang sederajat, seperti Sekolah Dasar, Madrasah Ibtidaiyah dan Sekolah Luar Biasa Tingkat Dasar. Termasuk dalam kelompok ini adalah program pemberantasan buta huruf yang diselenggarakan pemerintah bagi anak-anak yang tidak mempunyai kesempatan bersekolah, juga pendidikan bagi anak-anak terbelakang pada jenjang pendidikan yang sederajat.', 'kbli_85121', NULL, NULL),
(1603, '85122', 'Pendidikan Menengah Pertama/Tsanawiyah Swasta', 'Kelompok ini mencakup pendidikan sekolah menengah pertama yang berlangsung selama tiga tahun yang dikelola oleh swasta termasuk sekolah menengah keagamaan dan pendidikan khusus yang sederajat, seperti Sekolah Menengah Pertama, Madrasah Tsanawiyah dan Sekolah Luar Biasa Menengah Pertama.', 'kbli_85122', NULL, NULL),
(1604, '85131', 'Pendidikan Taman Kanak-kanak Pemerintah', 'Kelompok ini mencakup pendidikan pra sekolah untuk anak usia dini dengan program pendidikan bagi anak berusia 4 (empat) tahun sampai dengan 6 (enam) tahun dengan prioritas usia 5 (lima) dan 6 (enam) tahun, yang berlangsung selama satu sampai dua tahun yang dikelola oleh pemerintah, seperti Taman Kanak-kanak.', 'kbli_85131', NULL, NULL),
(1605, '85132', 'Pendidikan Taman Kanak-kanak Swasta/Raudatul Athfal/Bustanul Athfal', 'Kelompok ini mencakup pendidikan pra sekolah untuk anak usia dini dengan program pendidikan bagi anak berusia 4 (empat) tahun sampai dengan 6 (enam) tahun dengan prioritas usia 5 (lima) dan 6 (enam) tahun, yang berlangsung selama satu sampai dua tahun yang dikelola oleh swasta, seperti Taman Kanak-kanak, Raudatul Athfal (RA) dan Bustanul Athfal (BA).', 'kbli_85132', NULL, NULL),
(1606, '85133', 'Pendidikan Kelompok Bermain', 'Kelompok ini mencakup pendidikan pra sekolah untuk anak usia dini yang mendapatkan program pendidikan sekaligus program kesejahteraan bagi anak sejak lahir sampai dengan 6 (enam) tahun dengan prioritas usia 2 (dua) sampai 4 (empat) tahun yang dikelola oleh pemerintah maupun masyarakat, seperti Kelompok Bermain.', 'kbli_85133', NULL, NULL),
(1607, '85134', 'Pendidikan Taman Penitipan Anak', 'Kelompok ini mencakup pendidikan untuk anak usia dini dengan program pendidikan bagi anak sejak lahir sampai dengan 6 (enam) tahun dengan prioritas sejak lahir sampai dengan usia 4 (empat) tahun, baik yang diselenggarakan oleh pemerintah maupun oleh masyarakat.', 'kbli_85134', NULL, NULL),
(1608, '85135', 'Pendidikan Taman Kanak-kanak Luar Biasa', 'Kelompok ini mencakup pendidikan untuk anak usia dini dengan program pendidikan khusus bagi anak berusia 4 (empat) tahun sampai dengan 6 (enam) tahun dengan prioritas usia 5 (lima) dan 6 (enam) tahun, baik yang diselenggarakan oleh pemerintah maupun oleh masyarakat.', 'kbli_85135', NULL, NULL),
(1609, '85139', 'Pendidikan anak usia dini sejenis lainnya', 'Kelompok ini mencakup pendidikan pra sekolah untuk anak usia dini dengan program pendidikan bagi anak usia lahir sampai dengan 6 (enam) tahun yang belum termasuk dalam kelompok 85131 s.d. 85135.', 'kbli_85139', NULL, NULL),
(1610, '85141', 'Satuan Pendidikan Kerjasama Kelompok Bermain', 'Kelompok ini mencakup satuan pendidikan jenjang Kelompok Bermain yang diselenggarakan atau dikelola atas dasar kerja sama antara Lembaga Pendidikan Asing yang terakreditasi/diakui di negaranya dengan Lembaga Pendidikan di Indonesia pada jalur formal yang sesuai dengan ketentuan perundang-undangan.', 'kbli_85141', NULL, NULL),
(1611, '85142', 'Satuan Pendidikan Kerjasama Taman Kanak-Kanak', 'Kelompok ini mencakup satuan pendidikan jenjang TK yang diselenggarakan atau dikelola atas dasar kerja sama antara Lembaga Pendidikan Asing yang terakreditasi/diakui di negaranya dengan Lembaga Pendidikan di Indonesia pada jalur formal yang sesuai dengan ketentuan perundang-undangan.', 'kbli_85142', NULL, NULL),
(1612, '85143', 'Satuan Pendidikan Kerjasama Pendidikan Dasar', 'Kelompok ini mencakup satuan pendidikan jenjang Sekolah Dasar yang diselenggarakan atau dikelola atas dasar kerja sama antara Lembaga Pendidikan Asing yang terakreditasi/diakui di negaranya dengan Lembaga Pendidikan di Indonesia pada jalur formal yang sesuai dengan ketentuan perundang-undangan.', 'kbli_85143', NULL, NULL),
(1613, '85144', 'Satuan Pendidikan Kerjasama Pendidikan Menengah Pertama', 'Kelompok ini mencakup satuan pendidikan jenjang Sekolah Menengah Pertama yang diselenggarakan atau dikelola atas dasar kerja sama antara Lembaga Pendidikan Asing yang terakreditasi/diakui di negaranya dengan Lembaga Pendidikan di Indonesia pada jalur formal yang sesuai dengan ketentuan perundang-undangan.', 'kbli_85144', NULL, NULL),
(1614, '85152', 'Satuan Pendidikan Muadalah/Pendidikan Diniyah Formal Ula', 'Kelompok ini mencakup satuan pendidikan pesantren pada jenjang pendidikan dasar yang diselenggarakan pada jalur pendidikan formal sederajat dengan sekolah dasar/madrasah ibtidaiyah, meliputi satuan pendidikan muadalah ula dan satuan pendidikan diniyah formal ula.', 'kbli_85152', NULL, NULL),
(1615, '85153', 'Satuan Pendidikan Muadalah/Pendidikan Diniyah Formal Wustha', 'Kelompok ini mencakup satuan pendidikan pesantren pada jenjang pendidikan dasar yang diselenggarakan pada jalur pendidikan formal sederajat dengan sekolah menengah pertama/madrasah tsanawiyah, meliputi satuan pendidikan muadalah wustha dan satuan pendidikan diniyah formal wustha.', 'kbli_85153', NULL, NULL),
(1616, '85154', 'Satuan Pendidikan Pesantren Pengkajian Kitab Kuning Ula', 'Kelompok ini mencakup satuan pendidikan pesantren pada jenjang pendidikan dasar yang lulusannya diakui sama dengan pendidikan formal sederajat dengan sekolah dasar/madrasah ibtidaiyah setelah dinyatakan lulus ujian. Termasuk dalam kelompok ini: pendidikan pesantren berbentuk pengkajian kitab kuning jenjang ula; dan pendidikan kesetaraan pada pondok pesantren salafiyah jenjang ula', 'kbli_85154', NULL, NULL),
(1617, '85155', 'Satuan Pendidikan Pesantren Pengkajian Kitab Kuning Wustha', 'Kelompok ini mencakup satuan pendidikan pesantren pada jenjang pendidikan dasar yang lulusannya diakui sama dengan pendidikan formal sederajat dengan sekolah menengah pertama/madrasah tsanawiyah setelah dinyatakan lulus ujian. Termasuk dalam kelompok ini: pendidikan pesantren berbentuk pengkajian kitab kuning jenjang wustha; dan pendidikan kesetaraan pada pondok pesantren salafiyah jenjang wustha.', 'kbli_85155', NULL, NULL),
(1618, '85161', 'Satuan Pendidikan Keagamaan Anak Usia Dini', 'Kelompok ini mencakup satuan pendidikan keagamaan selain pendidikan keagamaan Islam (lihat 8515) pada jenjang pendidikan anak usia dini yang diselenggarakan pada jalur pendidikan formal.', 'kbli_85161', NULL, NULL),
(1619, '85162', 'Satuan Pendidikan Keagamaan Dasar', 'Kelompok ini mencakup satuan pendidikan keagamaan selain pendidikan keagamaan Islam (lihat 8515) pada jenjang pendidikan dasar yang diselenggarakan pada jalur pendidikan formal sederajat dengan sekolah dasar/madrasah ibtidaiyah.', 'kbli_85162', NULL, NULL),
(1620, '85163', 'Satuan Pendidikan Keagamaan Menengah Pertama', 'Kelompok ini mencakup satuan pendidikan keagamaan selain pendidikan keagamaan Islam (lihat 8515) pada jenjang pendidikan dasar yang diselenggarakan pada jalur pendidikan formal sederajat dengan sekolah menengah pertama/madrasah tsanawiyah.', 'kbli_85163', NULL, NULL),
(1621, '85210', 'Pendidikan Menengah Atas/Aliyah Pemerintah', 'Kelompok ini mencakup pendidikan sekolah menengah tingkat atas yang bersifat umum dan berlangsung selama tiga tahun yang dikelola oleh pemerintah, termasuk sekolah keagamaan dan pendidikan khusus sederajat, seperti Sekolah Menengah Umum Negeri, Madrasah Aliyah Negeri dan Sekolah Luar Biasa Menengah Tingkat Atas Negeri.', 'kbli_85210', NULL, NULL),
(1622, '85220', 'Pendidikan Menengah/Aliyah Swasta', 'Kelompok ini mencakup pendidikan sekolah menengah atas yang bersifat umum dan berlangsung selama tiga tahun yang dikelola oleh swasta, termasuk sekolah keagamaan dan pendidikan khusus sederajat, seperti Sekolah Menengah Umum, Madrasah Aliyah dan Sekolah Luar Biasa Menengah Tingkat Atas.', 'kbli_85220', NULL, NULL),
(1623, '85230', 'Pendidikan Menengah Kejuruan dan Teknis/Aliyah Kejuruan Pemerintah', 'Kelompok ini mencakup pendidikan sekolah menengah kejuruan dan berlangsung selama tiga tahun yang dikelola oleh pemerintah, termasuk sekolah keagamaan dan pendidikan khusus yang sederajat, seperti Sekolah Menengah Kejuruan (SMK), dengan program studi seperti pariwisata, boga, manajemen, perkantoran, perhotelan, teknik, farmasi, kecantikan dan rambut, pertanian (termasuk kelautan dan perikanan) dan sekolah menengah kejuruan lainnya, termasuk sekolah khusus untuk peserta didik berkebutuhan khusus pada jenjang pendidikan menengah. Termasuk pendidikan kedinasan yang diselenggarakan oleh lembaga/badan/instansi pemerintah selain Kementerian Pendidikan dan Kebudayaan.', 'kbli_85230', NULL, NULL),
(1624, '85240', 'Pendidikan Menengah Kejuruan/Aliyah Kejuruan Swasta', 'Kelompok ini mencakup pendidikan sekolah menengah kejuruan dan berlangsung selama tiga tahun yang dikelola oleh swasta, seperti Sekolah Menengah Kejuruan (SMK), dengan program studi seperti pariwisata, boga, manajemen, perkantoran, perhotelan, teknik, farmasi, kecantikan dan rambut, pertanian dan sekolah menengah kejuruan lainnya, termasuk sekolah khusus untuk peserta didik berkebutuhan khusus pada jenjang pendidikan menengah.', 'kbli_85240', NULL, NULL),
(1625, '85251', 'Satuan Pendidikan Kerjasama Pendidikan Menengah Atas', 'Kelompok ini mencakup satuan pendidikan jenjang Sekolah Menengah Atas yang diselenggarakan atau dikelola atas dasar kerja sama antara Lembaga Pendidikan Asing yang terakreditasi/diakui di negaranya dengan Lembaga Pendidikan di Indonesia pada jalur formal yang sesuai dengan ketentuan perundang-undangan.', 'kbli_85251', NULL, NULL),
(1626, '85252', 'Satuan Pendidikan Kerjasama Pendidikan Menengah Kejuruan', 'Kelompok ini mencakup satuan pendidikan jenjang Sekolah Menengah Kejuruan yang diselenggarakan atau dikelola atas dasar kerja sama antara Lembaga Pendidikan Asing yang terakreditasi/diakui di negaranya dengan Lembaga Pendidikan di Indonesia pada jalur formal  yang sesuai dengan ketentuan perundang-undangan.', 'kbli_85252', NULL, NULL),
(1627, '85261', 'Satuan Pendidikan Muadalah/ Pendidikan Diniyah Formal Ulya', 'Kelompok ini mencakup satuan pendidikan pesantren pada jenjang pendidikan menengah yang diselenggarakan pada jalur pendidikan formal sederajat dengan sekolah menengah atas/madrasah aliyah, meliputi satuan pendidikan muadalah ulya dan satuan pendidikan diniyah formal ulya.', 'kbli_85261', NULL, NULL),
(1628, '85262', 'Satuan Pendidikan Pesantren Pengkajian Kitab Kuning Ulya', 'Kelompok ini mencakup satuan pendidikan pesantren pada jenjang pendidikan menengah yang lulusannya diakui sama dengan pendidikan formal sederajat dengan sekolah menengah atas/madrasah aliyah setelah dinyatakan lulus ujian. Termasuk dalam kelompok ini: pendidikan pesantren berbentuk pengkajian kitab kuning jenjang ulya; dan pendidikan kesetaraan pada pondok pesantren salafiyah jenjang ulya', 'kbli_85262', NULL, NULL),
(1629, '85263', 'Satuan Pendidikan Muadalah Wustha dan Ulya Berkesinambungan', 'Kelompok ini mencakup pendidikan pesantren berbentuk satuan pendidikan muadalah dengan menggabungkan penyelenggaraan satuan pendidikan muadalah wustha (lihat 85153) dan satuan pendidikan muadalah ulya (lihat 85261) secara berkesinambungan sesuai ketentuan peraturan perundang-undangan.', 'kbli_85263', NULL, NULL),
(1630, '85270', 'Satuan Pendidikan Keagamaan Menengah', 'Kelompok ini mencakup satuan pendidikan keagamaan selain pendidikan keagamaan islam pada jenjang pendidikan menengah yang diselenggarakan pada jalur pendidikan formal sederajat dengan sekolah menengah atas/madrasah aliyah.', 'kbli_85270', NULL, NULL),
(1631, '85311', 'Pendidikan Tinggi Akademik Pemerintah', 'Kelompok ini mencakup pendidikan yang memberikan tekanan pada pembentukan keahlian akademik di sekolah tinggi/institut/universitas, untuk mengenal penelitian dalam suatu bidang ilmu pengetahuan dan teknologi yang dikelola oleh pemerintah, meliputi jenis pendidikan akademik program sarjana, program magister dan program doktor.', 'kbli_85311', NULL, NULL),
(1632, '85312', 'Pendidikan Tinggi Vokasi dan Profesi Pemerintah', 'Kelompok ini mencakup pendidikan yang memberikan tekanan pada pembentukan keahlian profesional, yaitu keahlian yang menekankan pada ketrampilan dan penerapan suatu bidang ilmu pengetahuan dan teknologi dalam pekerjaan, meliputi jenis pendidikan vokasi program diploma satu, diploma dua, diploma tiga, dan diploma empat atau sarjana terapan, program magister terapan, program doktor terapan, serta jenis pendidikan profesi seperti program profesi dan program spesialis yang dikelola oleh pemerintah.', 'kbli_85312', NULL, NULL),
(1633, '85321', 'Pendidikan Tinggi Akademik Swasta', 'Kelompok ini mencakup pendidikan yang memberikan tekanan pada pembentukan keahlian akademik di sekolah tinggi/institut/universitas, untuk mengenal penelitian dalam suatu bidang ilmu pengetahuan dan teknologi yang dikelola oleh swasta, meliputi jenis pendidikan akademik program sarjana, program magister dan program doktor.', 'kbli_85321', NULL, NULL),
(1634, '85322', 'Pendidikan Tinggi Vokasi dan Profesi Swasta', 'Kelompok ini mencakup pendidikan yang memberikan tekanan pada pembentukan keahlian profesional, yaitu keahlian yang menekankan pada ketrampilan dan penerapan suatu bidang ilmu pengetahuan dan teknologi dalam pekerjaan, meliputi jenis pendidikan vokasi program diploma satu, diploma dua, diploma tiga dan diploma empat atau sarjana terapan, program magister terapan, program doktor terapan serta jenis pendidikan profesi seperti program profesi dan program spesialis yang dikelola oleh swasta.', 'kbli_85322', NULL, NULL),
(1635, '85331', 'Pendidikan Tinggi Keagamaan Pemerintah', 'Kelompok ini merupakan satuan perguruan tinggi yang menyelenggarakan Pendidikan Tinggi Keagamaan Pemerintah yang terdiri dari Universitas, Institut dan Sekolah Tinggi. Jenjang program studi yang diselenggarakan oleh perguruan tinggi keagamaan ini adalah program Diploma, program Sarjana dan program Magister, program Doktor, program Profesi dan program Spesialis.', 'kbli_85331', NULL, NULL),
(1636, '85332', 'Pendidikan Tinggi Keagamaan Swasta', 'Kelompok ini merupakan satuan perguruan tinggi yang menyelenggarakan Pendidikan Tinggi Keagamaan yang didirikan dan/atau diselenggarakan oleh masyarakat/swasta yang terdiri dari Universitas, Institut dan Sekolah Tinggi. Jenjang program studi yang diselenggarakan oleh perguruan tinggi keagamaan ini adalah program Diploma, program Sarjana dan program Magister, program Doktor, program Profesi dan program Spesialis.', 'kbli_85332', NULL, NULL),
(1637, '85410', 'Jasa Pendidikan Olahraga Dan Rekreasi', 'Kelompok ini mencakup penyediaan pengajaran dalam kegiatan keolahragaan untuk sekelompok individu, seperti dalam perkemahan dan sekolah. Kelompok ini juga mencakup pengajaran olahraga berkemah sehari semalam. Tidak termasuk sekolah akademis, perguruan tinggi dan universitas. Pengajaran dapat dilaksanakan dalam berbagai bentuk, seperti fasilitas pelatihan pendidikan, lembaga pendidikan, tempat kerja atau rumah dan melalui surat menyurat, televisi, internet atau dengan cara lain. Pengajaran yang dilaksanakan dalam kelompok ini diatur secara formal. Kegiatan yang tercakup pengajaran olahraga (baseball,  basket, cricket, sepak bola dan lain-lain), pengajaran olahraga dalam kegiatan berkemah, pengajaran cheerleading, pengajaran senam, pengajaran berkuda, baik akademis atau sekolah, pengajaran renang, instruktur, guru, pelatih olahraga profesional, pengajaran seni perang, pengajaran permainan kartu (seperti  bridge), pengajaran yoga.', 'kbli_85410', NULL, NULL),
(1638, '85420', 'Pendidikan Kebudayaan', 'Kelompok ini mencakup pengajaran seni, drama dan musik. Kegiatan pada kelompok ini dapat disebut dengan sekolah, studio, kelas dan lain-lain. Kegiatan ini  menyediakan pengajaran yang diatur secara formal, terutama untuk hobi, rekreasi atau untuk tujuan pengembangan diri, tetapi pengajaran tersebut tidak ditujukan untuk mendapatkan ijazah profesional, sarjana muda atau gelar sarjana. Kelompok ini mencakup kegiatan guru piano dan pengajaran musik lainnya, pengajaran seni, pengajaran dansa dan studio dansa, sekolah drama (bukan akademis), sekolah seni rupa (bukan akademis), sekolah seni pertunjukan (bukan akademis), sekolah fotografi (bukan akademis) dan lain-lain.', 'kbli_85420', NULL, NULL),
(1639, '85430', 'Pendidikan Lainnya Pemerintah', 'Kelompok ini mencakup kegiatan pendidikan di luar sekolah yang diselenggarakan oleh Pemerintah dan umumnya bersifat kursus/pendidikan pelatihan  untuk menambah/menunjang keterampilan/Kompetensi, seperti Kursus Pegawai Administrasi, Kursus Pegawai Administrasi Atas, Peningkatan dan Kompetensi Guru dan Tenaga Kependidikan, Balai Pelatihan Teknik, kursus kecantikan (perawatan tubuh, tata rias pengantin), kesejahteraan rumah tangga (pendidikan menjahit, memasak dan gizi), kesehatan (pendidikan PPPK, pijat, tusuk jarum/akupunktur), pendidikan terkait dengan topik ketenaganukliran dan kursus lainnya serta kelompok belajar usaha bagi orang dewasa.', 'kbli_85430', NULL, NULL),
(1640, '85440', 'Satuan Pendidikan Kerjasama Pendidikan NonFormal', 'Kelompok ini mencakup Satuan Pendidikan Nonformal yang diselenggarakan dan dikelola atas dasar kerja sama antara Lembaga Pendidikan Asing (LPA) yang terakreditasi/diakui di negaranya dengan Lembaga Pendidikan Indonesia (LPI) pada jalur nonformal yang sesuai dengan ketentuan perundang-undangan.', 'kbli_85440', NULL, NULL),
(1641, '85459', 'Pendidikan Keagamaan Lainnya YTDL', 'Kelompok ini mencakup satuan pendidikan keagamaan lainnya selain pendidikan keagamaan Islam (lihat 85451) yang diselenggarakan pada jalur pendidikan nonformal secara berjenjang maupun tidak berjenjang.', 'kbli_85459', NULL, NULL),
(1642, '85491', 'Jasa Pendidikan Manajemen Dan Perbankan', 'Kelompok ini mencakup kegiatan pendidikan manajemen dan perbankan yang diselenggarakan swasta. Kegiatan yang termasuk dalam kegiatan ini adalah jasa pendidikan atau kursus administrasi bisnis, administrasi perkantoran, administrasi kesehatan, administrasi, administrasi niaga, akuntansi, akuntansi bisnis, akuntansi perbankan, akuntansi perkantoran, akuntansi perpajakan, akuntansi perusahaan, asuransi, ekspor impor, kepabeanan dan cukai, kewirausahaan, manajemen, manajemen administrasi, manajemen bisnis, manajemen informatika, manajemen kesehatan, manajemen keuangan, manajemen keuangan dan perpajakan, manajemen pariwisata, manajemen pelatihan, manajemen pemasaran/perdagangan, manajemen perbankan, perkantoran, manajemen perusahaan, properti, manajemen terapan, mengetik, pemasaran/marketing, pemasaran busana, pengamanan/sekuriti, perbankan dan pasar modal, perkantoran, perpajakan, polibisnis, pramurukti, pramusiwi, pramuwisma, sales manajemen, sekretaris, tata kota, wira niaga dan lain-lain.', 'kbli_85491', NULL, NULL),
(1643, '85492', 'Jasa Pendidikan Komputer (Teknologi Informasi dan Komunikasi) Swasta', 'Kelompok ini mencakup kegiatan pendidikan yang bersifat kursus dengan tujuan untuk menambah ketrampilan/keahlian dalam bidang komputer dan teknologi informasi dan komunikasi yang diselenggarakan oleh swasta.', 'kbli_85492', NULL, NULL),
(1644, '85493', 'Pendidikan Bahasa Swasta', 'Kelompok ini mencakup kegiatan pendidikan yang bersifat kursus dengan tujuan untuk menambah keterampilan/keahlian dalam bidang bahasa yang diselenggarakan oleh swasta. Kegiatan yang masuk dalam kelompok ini adalah kursus bahasa Arab, Belanda, Indonesia, Inggris, Italia, Jawa, Jepang, Jerman, Korea, Mandarin, Perancis, Rusia, Sakura, Spanyol dan bahasa lainnya. Termasuk juga kursus TOEFL, TOEIC, IELTS dan penerjemah.', 'kbli_85493', NULL, NULL),
(1645, '85494', 'Pendidikan Kesehatan Swasta', 'Kelompok ini mencakup kegiatan pendidikan yang bersifat kursus dengan tujuan untuk menambah keterampilan/keahlian dalam bidang kesehatan yang diselenggarakan oleh swasta. Kegiatan pendidikan atau kursus yang termasuk dalam kelompok ini adalah tata kecantikan, akupuntur modern/tradisional, asisten perawat, baby sitter/pramubalita, echocardiology, farmasi, jamu tradisional, medical representative, pelatihan alat kesehatan, pengobatan tradisional, perawat kesehatan, PPPK, refleksi, refleksiologi, shinse, spa, tenaga penujang kesehatan, terapi anak autis, terapizona, TKK, TKR, ultrasonografi kedokteran dan lain-lain.', 'kbli_85494', NULL, NULL),
(1646, '85495', 'Pendidikan Bimbingan Belajar Dan Konseling Swasta', 'Kelompok ini mencakup pendidikan bimbingan belajar dan konseling yang dilakukan oleh pihak swasta. Kegiatan pendidikan atau kursus yang termasuk dalam kelompok ini adalah bimbingan belajar, bimbingan kesehatan, bimbingan organisasi, etika dan pergaulan; pendidikan konsultan bisnis, konsultan pajak, konsultan psikologi dan pengembangan SDM, megabrain, superbrain, powerbrain,  mental aritmatika; pembimbing kelompok bermain, pembimbing prasekolah, pembinaan keluarga, pendidikan anak dan lansia, pengembangan kepribadian, pengembangan metode belajar, pengembangan SDM, peningkatan kreatifitas anak, peningkatan potensi pendidik, PGTK, sempoa, tutor prasekolah.', 'kbli_85495', NULL, NULL),
(1647, '85496', 'Pendidikan Awak Pesawat dan jasa Angkutan Udara Khusus Pendidikan Awak Pesawat', 'Kelompok ini mencakup jasa pendidikan awak pesawat yang dilakukan oleh swasta. Termasuk usaha pengangkutan khusus awak pesawat dalam rangka pendidikan.', 'kbli_85496', NULL, NULL),
(1648, '85497', 'Pendidikan Teknik Swasta', 'Kelompok ini mencakup kegiatan pendidikan teknik diselenggarakan swasta. Kegiatan yang termasuk dalam kegiatan ini adalah jasa pendidikan atau kursus desain, desain grafis, desain interior, elektronika, engineering, instalasi listrik, konstruksi, las, mekanik otomotif mobil dan motor, sekolah mengemudi kendaraan bermotor (mengemudi), pemetaan, perminyakan, rancang/tata bangunan, riset, teknik, teknik industri, teknik kelautan, teknik mesin, teknik sipil, teknisi alat berat, teknisi handphone, teknisi komputer, telekomunikasi dan lain-lain.', 'kbli_85497', NULL, NULL),
(1649, '85498', 'Pendidikan Kerajinan Dan Industri', 'Kelompok ini mencakup kegiatan pendidikan kerajinan dan industri yang diselenggarakan swasta. Kegiatan yang termasuk dalam kegiatan ini adalah jasa pendidikan atau kursus anyaman dam kerajinan, bordir, hantaran, ketrampilan atau home industri, membatik, menjahit, meubelair, MPP, MPWA, pertukangan kayu, sablon, tata boga/memasak, tata busana, tenun, ukir kayu dan lain-lain.', 'kbli_85498', NULL, NULL),
(1650, '85499', 'Pendidikan Lainnya Swasta', 'Kelompok ini mencakup kegiatan pendidikan lainnya yang diselenggarakan swasta yang belum dicakup dalam kelompok 85491 s.d. 85498. Termasuk peningkatan kompetensi bagi guru dan tenaga kependidikan serta jasa kursus untuk meninjau ujian profesional, pengajaran membaca cepat, sekolah terbang, pelatihan penjaga keselamatan, pelatihan bertahan hidup dan pelatihan berbicara di depan umum, agribisnis, animasi dan sinema, anouncer, broad casting, budidaya jangkrik, cargo, entertainment dan modeling, hukum, hukum bisnis, hukum perpajakan, jurnalistik/reporter, kepelautan, komuinikasi, master of ceremony (MC), notaris/notariat, pariwisata dan perhotelan, pelayaran (anak buah kapal), penasihat hukum, penyiar, perikanan, pertanian, peternakan, public relation, public speaking, show biz, tours and travel, transportasi udara dan lain-lain. Termasuk juga dalam Kelompok ini mencakup kegiatan pendidikan di luar sekolah yang diselenggarakan oleh swasta yang ikut menyelenggarakan pendidikan terkait dengan topik ketenaganukliran.', 'kbli_85499', NULL, NULL),
(1651, '85500', 'Kegiatan Penunjang Pendidikan', 'Kelompok ini mencakup usaha pemberian saran dan bantuan operasional pada dunia pendidikan, seperti jasa konsultasi pendidikan, jasa penyuluhan dan bimbingan pendidikan, jasa evaluasi uji pendidikan, jasa uji pendidikan dan organisasi program pertukaran pelajar.', 'kbli_85500', NULL, NULL),
(1652, '86101', 'Aktivitas Rumah Sakit Pemerintah', 'Kelompok ini mencakup kegiatan perawatan kesehatan dan pengobatan fisik, baik untuk perawatan jalan maupun rawat inap (opname), yang dilakukan rumah sakit umum, rumah bersalin, rumah sakit khusus (sanatorium, rumah sakit kusta) yang dikelola pemerintah.', 'kbli_86101', NULL, NULL),
(1653, '86102', 'Aktivitas Puskesmas', 'Kelompok ini merupakan kegiatan pelayanan kesehatan yang mencakup upaya kesehatan masyarakat dan upaya kesehatan perseorangan tingkat pertama dengan lebih mengutamakan upaya promotif dan preventif di wilayah kerjanya. Puskesmas nonrawat inap dapat menyelenggarakan pelayanan rawat jalan, perawatan di rumah (home care), dan pelayanan gawat darurat serta dapat menyelenggarakan rawat inap pada pelayanan persalinan normal. Puskesmas rawat inap (dengan tempat tidur) menyelenggarakan tambahan pelayanan berupa rawat inap pada pelayanan persalinan normal dan pelayanan rawat inap pelayanan kesehatan lainnya.', 'kbli_86102', NULL, NULL),
(1654, '86103', 'Aktivitas Rumah Sakit Swasta', 'Kelompok ini mencakup kegiatan perawatan kesehatan dan pengobatan fisik, baik untuk perawatan jalan maupun rawat inap (opname), yang dilakukan rumah sakit umum swasta, rumah bersalin swasta, rumah sakit khusus swasta.', 'kbli_86103', NULL, NULL),
(1655, '86104', 'Aktivitas Klinik Pemerintah', 'Kelompok ini mencakup kegiatan perawatan kesehatan dan pengobatan fisik yang dikelola oleh pemerintah baik perawatan secara rawat jalan dan rawat inap.', 'kbli_86104', NULL, NULL),
(1656, '86105', 'Aktivitas Klinik Swasta', 'Kelompok ini mencakup kegiatan perawatan kesehatan dan pengobatan fisik yang dikelola oleh swasta baik perawatan secara rawat jalan dan rawat inap.', 'kbli_86105', NULL, NULL),
(1657, '86109', 'Aktivitas Rumah Sakit Lainnya', 'Kelompok ini mencakup kegiatan perawatan kesehatan dan pengobatan fisik lainnya selain yang tercakup dalam kelompok 86101 s.d. 86105.', 'kbli_86109', NULL, NULL),
(1658, '86201', 'Aktivitas Praktik Dokter', 'Kelompok ini mencakup kegiatan yang memberikan jasa perawatan dan pengobatan penyakit yang bersifat umum yang dilakukan secara berdiri sendiri oleh dokter.', 'kbli_86201', NULL, NULL),
(1659, '86202', 'Aktivitas Praktik Dokter Spesialis', 'Kelompok ini mencakup kegiatan yang memberikan jasa perawatan dan pengobatan penyakit yang bersifat khusus seperti mata, THT, penyakit dalam, penyakit kulit dan kelamin dan lainnya yang dilakukan secara berdiri sendiri oleh dokter spesialis.', 'kbli_86202', NULL, NULL),
(1660, '86203', 'Aktivitas Praktik Dokter Gigi', 'Kelompok ini mencakup kegiatan yang memberikan jasa perawatan dan pengobatan kesehatan gigi yang dilakukan secara berdiri sendiri oleh dokter gigi.', 'kbli_86203', NULL, NULL),
(1661, '86901', 'Aktivitas pelayanan kesehatan yang dilakukan oleh tenaga kesehatan selain dokter dan dokter gigi', 'Kelompok ini mencakup pemberian pelayanan kesehatan oleh tenaga kesehatan selain dokter dan dokter gigi. Aktivitas ini meliputi tenaga keperawatan, tenaga kebidanan, tenaga kefarmasian, tenaga kesehatan masyarakat, tenaga kesehatan lingkungan, tenaga gizi, tenaga keterapian fisik, tenaga keteknisian medis, tenaga teknik biomedika, tenaga kesehatan tradisional, tenaga psikologi klinis, dan tenaga kesehatan lain. Termasuk juga kegiatan pelayanan kesehatan tradisional komplementer yang dilakukan oleh Tenaga Kesehatan Tradisional (Nakestrad) meliputi pelayanan kesehatan tradisional ramuan dan keterampilan yang diselenggarakan di Griya Sehat/Fasilitas Pelayanan Kesehatan Tradisional (Fasyankestrad).', 'kbli_86901', NULL, NULL),
(1662, '86902', 'Aktivitas Pelayanan Kesehatan Tradisional', 'Kelompok ini mencakup pelayanan kesehatan promotif dan preventif melalui pelayanan kesehatan tradisional yang dilakukan oleh penyehat tradisional dapat berupa keterampilan dan/atau ramuan, seperti pijat/urut untuk kesehatan, refleksi, akupresur, ramuan Indonesia, hipnoterapi, patah tulang, bekam kering/kop, shinse, terapi energi yang diselenggarakan di panti sehat.', 'kbli_86902', NULL, NULL),
(1663, '86903', 'Aktivitas Pelayanan Penunjang Kesehatan', 'Kelompok ini mencakup kegiatan pelayanan penunjang kesehatan yang dikelola baik oleh pemerintah maupun swasta, seperti laboratorium medis (laboratorium pemeriksaan darah dan lainnya), laboratorium pengolahan sel/sel punca, gudang farmasi, bank mata, unit transfusi darah, bank sperma, bank transplantasi organ, bank sel dan jaringan, optikal, dan penunjang medik lainnya.', 'kbli_86903', NULL, NULL),
(1664, '86904', 'Aktivitas Angkutan Khusus Pengangkutan Orang Sakit (Medical Evacuation)', 'Kelompok ini mencakup usaha pengangkutan khusus orang sakit seperti pesawat udara, ambulans dan lainnya berdasarkan keadaan tertentu dengan tujuan kota-kota atau provinsi di dalam negeri.', 'kbli_86904', NULL, NULL),
(1665, '87100', 'Aktivitas sosial di dalam panti untuk perawatan dan pemulihan kesehatan', 'Kelompok ini mencakup kegiatan sosial di dalam panti untuk perawatan dan pemulihan kesehatan, memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi penyandang disabilitas bekas penyakit kronis agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat, seperti rumah untuk lanjut usia dengan perawatan, rumah pemulihan kesehatan, rumah peristirahatan dengan perawatan, fasilitas perawatan dan rumah perawatan.', 'kbli_87100', NULL, NULL),
(1666, '87201', 'Aktivitas Sosial di Dalam Panti untuk Penyandang Disabilitas Grahita', 'Kelompok ini mencakup penyediaan jasa di dalam panti yang dikelola baik oleh pemerintah maupun swasta  dalam   memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi penyandang cacat mental retardasi agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat.', 'kbli_87201', NULL, NULL),
(1667, '87202', 'Aktivitas Sosial di Dalam Panti untuk Penyandang Disabilitas Laras', 'Kelompok ini mencakup penyediaan jasa di dalam panti yang dikelola baik oleh pemerintah maupun swasta  dalam   memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisiK mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi penyandang cacat mental bekas psikotik agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat.', 'kbli_87202', NULL, NULL),
(1668, '87203', 'Aktivitas Sosial di Dalam Panti untuk Korban Penyalah Gunaan Narkotika, Alkohol , Psikotropika dan Zat adiktif  (NAPZA)', 'Kelompok ini mencakup penyediaan jasa di dalam panti yang dikelola baik oleh pemerintah maupun swasta  dalam memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi eks korban narkotika dan pengguna psikotropika sindroma ketergantungan agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat.', 'kbli_87203', NULL, NULL),
(1669, '87301', 'Aktivitas Sosial Pemerintah di Dalam Panti Untuk Lanjut Usia', 'Kelompok ini mencakup penyediaan jasa dalam  memberikan bimbingan, pelayanan, perawatan, dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bagi lanjut usia terlantar dan rawan terlantar agar dapat hidup secara wajar dalam kehidupan diri sendiri, keluarga, dan bermasyarakat,  yang dilakukan di dalam panti yang dikelola oleh pemerintah berdasarkan profesi pekerjaan sosial.', 'kbli_87301', NULL, NULL),
(1670, '87302', 'Aktivitas Sosial Swasta di Dalam Panti Untuk Lanjut Usia', 'Kelompok ini mencakup penyediaan jasa dalam  memberikan bimbingan, pelayanan, perawatan, dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bagi lanjut usia terlantar dan rawan terlantar agar dapat hidup secara wajar dalam kehidupan diri sendiri, keluarga, dan bermasyarakat,   yang dilakukan di dalam panti yang dikelola oleh swasta berdasarkan profesi pekerjaan sosial.', 'kbli_87302', NULL, NULL),
(1671, '87303', 'Aktivitas Sosial di Dalam Panti untuk Penyandang Disabilitas Netra', 'Kelompok ini mencakup penyediaan jasa dalam memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi para penyandang cacat netra agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat. Kegiatan ini dapat dilakukan baik oleh pemerintah maupun swasta.', 'kbli_87303', NULL, NULL),
(1672, '87304', 'Aktivitas Sosial di Dalam Panti untuk Penyandang Disabilitas Daksa', 'Kelompok ini mencakup penyediaan jasa dalam  memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif; rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi penyandang cacat tubuh agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat. Kegiatan ini dapat dilakukan baik oleh pemerintah maupun swasta.', 'kbli_87304', NULL, NULL),
(1673, '87305', 'Aktivitas Sosial di Dalam Panti untuk Penyandang Disabilitas Rungu Wicara', 'Kelompok ini mencakup penyediaan jasa dalam memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi penyandang tuna rungu wicara agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat. Kegiatan ini dapat dilakukan baik oleh pemerintah maupun swasta.', 'kbli_87305', NULL, NULL),
(1674, '87901', 'Aktivitas Panti Asuhan Pemerintah', 'Kelompok ini mencakup penyediaan jasa dalam memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi anak yatim, piatu dan yatim piatu yang kurang mampu, terlantar agar potensi dan kapasitas belajarnya pulih kembali, dapat berkembang secara wajar,  yang dilakukan di dalam panti yang dikelola oleh pemerintah berdasarkan profesi pekerjaan sosial.', 'kbli_87901', NULL, NULL),
(1675, '87902', 'Aktivitas Panti Asuhan Swasta', 'Kelompok ini mencakup penyediaan jasa dalam memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi anak yatim, piatu dan yatim piatu yang kurang mampu, terlantar agar potensi dan kapasitas belajarnya pulih kembali, dapat berkembang secara wajar,  yang dilakukan di dalam panti yang dikelola oleh swasta berdasarkan profesi pekerjaan sosial.', 'kbli_87902', NULL, NULL),
(1676, '87903', 'Aktivitas Sosial di Dalam Panti untuk Anak yang Berhadapan dengan Hukum', 'Kelompok ini mencakup penyediaan jasa dalam  memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi serta bimbingan lanjut bagi anak nakal agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat. Kegiatan ini dapat dilakukan baik oleh pemerintah maupun swasta.', 'kbli_87903', NULL, NULL),
(1677, '87904', 'Aktivitas Sosial di Dalam Panti untuk Bina Remaja', 'Kelompok ini mencakup penyediaan jasa dalam memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi anak terlantar, putus sekolah agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat. Kegiatan ini dapat dilakukan baik oleh pemerintah maupun swasta.', 'kbli_87904', NULL, NULL),
(1678, '87905', 'Aktivitas Sosial di Dalam Panti untuk Petirahan anak', 'Kelompok ini mencakup penyediaan jasa dalam memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi anak yang mengalami hambatan belajar karena menyandang masalah sosial agar potensi dan kapasitas belajarnya pulih kembali, dapat berkembang secara wajar. Kegiatan ini dapat dilakukan baik oleh pemerintah maupun swasta.', 'kbli_87905', NULL, NULL),
(1679, '87906', 'Aktivitas Sosial di Dalam Panti Sosial Karya Wanita', 'Kelompok ini mencakup penyediaan jasa dalam memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi para wanita tuna susila agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat. Kegiatan ini dapat dilakukan baik oleh pemerintah maupun swasta.', 'kbli_87906', NULL, NULL),
(1680, '87907', 'Aktivitas Sosial di Dalam Panti Gelandangan dan Pengemis', 'Kelompok ini mencakup penyediaan jasa dalam  memberikan bimbingan, pelayanan dan rehabilitasi sosial yang bersifat kuratif, rehabilitatif, promotif dalam bentuk bimbingan pengetahuan dasar pendidikan, fisik, mental, sosial, pelatihan keterampilan, resosialisasi bimbingan lanjut bagi para gelandangan, pengemis dan orang terlantar agar mampu mandiri dan berperan aktif dalam kehidupan bermasyarakat. Kegiatan ini dapat dilakukan baik oleh pemerintah maupun swasta.', 'kbli_87907', NULL, NULL),
(1681, '87909', 'Aktivitas Sosial Di Dalam Panti Lainnya YTDL', 'Kelompok ini mencakup kegiatan pelayanan sosial kepada masyarakat berdasarkan profesi pekerjaan sosial yang dilakukan di dalam panti yang dikelola baik oleh pemerintah maupun swasta selain yang telah disebutkan di atas.', 'kbli_87909', NULL, NULL),
(1682, '88101', 'Aktivitas Sosial Pemerintah Tanpa Akomodasi Untuk Lanjut Usia Dan Penyandang Disabilitas', 'Kelompok ini mencakup kegiatan berdasarkan profesi pekerjaan sosial untuk perorangan, keluarga atau masyarakat yang dilakukan oleh pemerintah, seperti penyediaan jasa kegiatan sosial, konseling, kesejahteraan, pengungsian, penyerahan dan jasa sejenis yang ditujukan untuk lanjut usia dan penyandang disabilitas di rumah atau di tempat lain dan dilakukan oleh kantor pemerintah atau oleh organisasi pemerintah khusus penyedia jasa konseling dan sebagainya, seperti kegiatan mengunjungi orang lanjut usia dan penyandang disabilitas, kegiatan perawatan harian untuk lanjut usia dan penyandang disabilitas dan kegiatan rehabilitasi dan habitasi pekerjaan untuk penyandang disabilitas di mana komponen pendidikannya terbatas, termasuk juga pembinaan, pengumpulan dan penyaluran dana bantuan sosial.  Tidak mencakup kegiatan yang digambarkan dalam subgolongan ini tapi mencakup akomodasi (8730) dan kegiatan perawatan harian untuk anak-anak penyandang disabilitas (8899).', 'kbli_88101', NULL, NULL),
(1683, '88102', 'Aktivitas Sosial Swasta Tanpa Akomodasi Untuk Lanjut Usia Dan Penyandang Disabilitas', 'Kelompok ini mencakup kegiatan berdasarkan profesi pekerjaan sosial untuk perorangan, keluarga, atau masyarakat yang dilakukan oleh swasta, seperti lembaga penyediaan jasa kegiatan sosial, konseling, kesejahteraan, pengungsian, penyerahan dan jasa sejenis yang ditujukan untuk orang lanjut usia dan penyandang disabilitas di rumah atau di tempat lain dan dilakukan oleh  oleh swasta, organisasi swadaya lokal maupun nasional dan atau lembaga khusus penyediaan jasa kegiatan sosial, mengunjungi orang lanjut usia dan penyandang disabilitas, kegiatan perawatan harian untuk lanjut usia dan penyandang disabilitas dan kegiatan rehabilitasi dan habitasi pekerjaan untuk penyandang disabilitas di mana komponen pendidikannya terbatas, termasuk juga pembinaan, pengumpulan dan penyaluran dana bantuan sosial.  Tidak mencakup kegiatan yang digambarkan dalam kelompok ini tapi mencakup akomodasi (8730) dan kegiatan perawatan harian, termasuk  untuk anak-anak penyandang disabilitas (8899).', 'kbli_88102', NULL, NULL),
(1684, '88911', 'Aktivitas Sosial Pengumpulan Dana Keislaman', 'Kelompok ini mencakup kegiatan pengumpulan, pendistribusian, dan pengelolaan dana sosial, mencakup zakat, infak, sedekah, wakaf dan Dana Sosial Keagamaan Lainnya (DSKL), baik yang dikelola oleh lembaga keislaman maupun bukan.', 'kbli_88911', NULL, NULL),
(1685, '88919', 'Aktivitas Sosial Pengumpulan Dana Lainnya', 'Kelompok ini mencakup kegiatan pengumpulan, pendistribusian, dan pengelolaan dana sosial yang tidak dikelola oleh lembaga keislaman, seperti Corporate Social Responsibility (CSR) dan sumbangan perusahaan.', 'kbli_88919', NULL, NULL),
(1686, '88991', 'Aktivitas Sosial Pemerintah Tanpa Akomodasi Lainnya YTDL', 'Kelompok ini mencakup kegiatan berdasarkan profesi pekerjaan sosial, penyediaan jasa kegiatan sosial, konseling, kesejahteraan, pengungsi, penyerahan dan jasa sejenis yang diberikan kepada perorangan dan keluarga di rumah atau tempat lain dan dilakukan oleh pemerintah, organisasi penanggulangan bencana alam dan organisasi khusus penyedia jasa konseling, seperti jasa kesejahteraan dan bimbingan untuk anak-anak dan remaja, kegiatan adopsi dan kegiatan pencegahan kenakalan anak, jasa konseling keuangan rumah tangga, pernikahan dan bimbingan keluarga, jasa konsultasi hutang-piutang, kegiatan kemasyarakatan dan lingkungan, kegiatan untuk korban bencana, pengungsi, imigran dan lain-lain termasuk rumah singgah sementara atau dalam jangka waktu yang lama, kegiatan rehabilitasi dan habitasi pekerjaan untuk pengangguran di mana komponen Pendidikan terbatas, kegiatan penentuan pemenuhan syarat dalam hubungannya dengan bantuan kesejahteraan, pinjaman atau kupon makanan, kegiatan perawatan harian anak, termasuk untuk anak-anak penyandang disabilitas, kegiatan fasilitas harian untuk tuna wisma dan kelompok sosial menengah ke bawah lain. Termasuk seperti pembinaan masyarakat terasing, konsultasi keluarga, pelatihan kepemimpinan wanita dan usaha swadaya wanita desa, adopsi, resosialisasi dan pembinaan.', 'kbli_88991', NULL, NULL),
(1687, '88992', 'Aktivitas Sosial Swasta Tanpa Akomodasi Lainnya YTDL', 'Kelompok ini mencakup kegiatan berdasarkan profesi pekerjaan sosial, penyediaan jasa kegiatan sosial, konseling, kesejahteraan, pengungsi, penyerahan dan jasa sejenis yang diberikan kepada perorangan dan keluarga di rumah atau tempat lain dan dilakukan oleh swasta, lembaga swadaya lokal maupun nasional, organisasi penanggulangan bencana alam dan organisasi khusus penyedia jasa konseling, seperti jasa kesejahteraan dan bimbingan untuk anak-anak dan remaja, kegiatan adopsi dan kegiatan pencegahan kenakalan anak, jasa konseling keuangan rumah tangga, pernikahan dan bimbingan keluarga, jasa konsultasi hutang-piutang, kegiatan kemasyarakatan dan lingkungan, kegiatan untuk korban bencana, pengungsi, imigran dan lain-lain termasuk rumah singgah sementara atau dalam jangka waktu yang lama, kegiatan rehabilitasi dan habitasi pekerjaan untuk pengangguran di mana komponen pendidikan terbatas, kegiatan penentuan pemenuhan syarat dalam hubungannya dengan bantuan kesejahteraan, pinjaman atau kupon makanan, kegiatan perawatan harian anak, termasuk untuk anak-anak penyandang disabilitas, kegiatan fasilitas harian untuk tuna wisma dan kelompok sosial menengah ke bawah lain . Termasuk seperti pembinaan masyarakat terasing, konsultasi keluarga, pelatihan kepemimpinan wanita dan usaha swadaya wanita desa, adopsi, resosialisasi dan pembinaan.', 'kbli_88992', NULL, NULL);
INSERT INTO `kategori_kbli` (`id`, `kode_kbli`, `kelompok_kbli`, `aktivitas_perusahaan`, `kbli_code`, `created_at`, `updated_at`) VALUES
(1688, '90011', 'Aktivitas Seni Pertunjukan', 'Kelompok ini mencakup kegiatan atau usaha menyelenggarakan pertunjukan kesenian dan hiburan panggung, seperti pertunjukan drama/teater, pagelaran musik, opera, sandiwara, pantomim, tari, perkumpulan kesenian daerah (wayang orang, lenong), jasa hiburan band, orchestra, kegiatan sastra dan sejenisnya.', 'kbli_90011', NULL, NULL),
(1689, '90012', 'Aktivitas Penunjang Seni Pertunjukan', 'Kelompok ini mencakup kegiatan penunjang seni pertunjukan, Termasuk usaha kegiatan dokumentator seni pertunjukan (video, digital, virtualising), dan skenografer/perupa (seni rupa panggung/artistik panggung), penata cahaya (lighting), penata suara (sound system).', 'kbli_90012', NULL, NULL),
(1690, '90021', 'Pelaku Kreatif Seni Pertunjukan', 'Kelompok  ini mencakup kegiatan pelaku kreatif seni pertunjukan, seperti kegiatan yang dilakukan oleh produser, manajer panggung (stage manager), aktor, penari, koreografer, sutradara, dramaturg, direktur artistik, pantomim, monolog, pembaca naskah teater/drama (dramatic reading), desainer kostum khusus pertunjukan, penari, periset seni, periset budaya, dan seniman panggung lainnya yang sejenis.', 'kbli_90021', NULL, NULL),
(1691, '90022', 'Pelaku Kreatif Seni Musik', 'Kelompok ini mencakup kegiatan pelaku kreatif di bidang industri musik yang di dalamnya termasuk pencipta lagu, komposer, penata musik, pemain musik, penyanyi, penyanyi latar, dan pelaku kreatif seni musik lainnya.', 'kbli_90022', NULL, NULL),
(1692, '90023', 'Aktivitas Pelaku Kreatif Seni Rupa', 'Kelompok ini melakukan praktik seni dengan berbagai macam medium dan metode yang mencakup kualitas tangible  dan intangible. Tangible dalam kerja dan karya seni dalam konteks kebudayaan meliputi segala hasil praktik kerja seni rupa melalui bermacam-macam pendekatan medium: lukis, gambar (drawing), patung, kriya, grafis, street art, instalasi, mixed-media, seni konseptual, happening, performance art, fotografi, video art, seni berbasis IPTEK (science art), sound art, site-specific, seni berbasis komunitas (community based art), seni media (media art), seni media baru (new media art). Termasuk dalam kelompok ini adalah para seniman seni rupa, artisan, kurator, pematung, kartunis, peneliti bidang kesenian, kolektor galeris, kritikus seni rupa, manajer seni, art handler, organisasi dan ruang seni, arsiparis seni, dan sebagainya.', 'kbli_90023', NULL, NULL),
(1693, '90024', 'Aktivitas Penulis dan Pekerja Sastra', 'Kelompok ini mencakup kegiatan menulis, menyunting (edit), menciptakan konten tulisan dalam bentuk apapun seperti cerpen dan novel, mengevaluasi bahan terkait literatur untuk dipublikasi, termasuk naskah dan narasi untuk film, TV, radio, permainan komputer dan animasi, penerjemahan verbal maupun tertulis ke dalam berbagai bahasa, penyair, kritikus sastra, pelaku musikalisasi puisi dan pekerja sastra lainnya yang sejenis. Produk akhir dapat disampaikan melalui berbagai media, baik cetak maupun digital.', 'kbli_90024', NULL, NULL),
(1694, '90025', 'Jurnalis Berita Independen', 'Kelompok ini mencakup usaha mencari berita yang dilakukan oleh perorangan sebagai bahan informasi, baik yang dipublikasikan melalui media cetak maupun digital.', 'kbli_90025', NULL, NULL),
(1695, '90029', 'Aktivitas Pekerja Seni dan Pekerja Kreatif Lainnya', 'Kelompok ini mencakup kegiatan pekerja seni dan kreatif lainnya, seperti fashion stylist yang belum termasuk di dalam 90021-90025.', 'kbli_90029', NULL, NULL),
(1696, '90030', 'Aktivitas Impresariat Bidang Seni dan Festival Seni', 'Kelompok ini mencakup kegiatan pengurusan dan penyelenggaraan pertunjukan hiburan baik yang berupa mendatangkan, mengirim maupun mengembalikan serta menentukan tempat, waktu dan jenis hiburan. Kegiatan usaha jasa impresariat pada kelompok ini khusus bidang seni.', 'kbli_90030', NULL, NULL),
(1697, '90040', 'Aktivitas Operasional Fasilitas Seni', 'Kelompok ini mencakup kegiatan atau usaha mengoperasikan fasilitas seni seperti ruang konser, teater dan fasilitas seni lainnya.', 'kbli_90040', NULL, NULL),
(1698, '90090', 'Aktivitas Hiburan, Seni dan Kreativitas Lainnya', 'Kelompok ini mencakup kegiatan dalam usaha menyelenggarakan hiburan dan seni kepada masyarakat oleh pemerintah maupun swasta yang belum tercakup dalam 9001 s.d. 9004 sebagai media hiburan.', 'kbli_90090', NULL, NULL),
(1699, '91011', 'Perpustakaan Dan Arsip Pemerintah', 'Kelompok ini mencakup kegiatan pemerintah yang berkaitan dengan  perpustakaan dan kearsipan yang tidak tergabung dalam suatu lembaga pendidikan atau lembaga kebudayaan lain. Kegiatannya mencakup pengorganisasian dari sebuah koleksi, baik khusus atau tidak, pembuatan daftar nama atau katalog dari koleksi, peminjaman dan penyimpanan buku, peta, majalah, film, rekaman, pita (kaset), karya seni dan lain-lain, kegiatan pencarian kembali dokumen dengan tujuan untuk memenuhi kebutuhan informasi dan lain sebagainya dan perpustakaan penyedia photo dan pelayanan lainnya.', 'kbli_91011', NULL, NULL),
(1700, '91012', 'Perpustakaan dan Arsip Swasta', 'Kelompok ini mencakup kegiatan perpustakaan dan pengelolaan arsip yang dilakukan oleh swasta.', 'kbli_91012', NULL, NULL),
(1701, '91021', 'Museum Yang Dikelola Pemerintah', 'Kelompok ini mencakup pengelolaan tempat dan fasilitas, serta kegiatan pameran cagar budaya, benda seni, koleksi dan/atau replika yang memiliki fungsi edukasi, rekreasi dan riset untuk mendukung pengembangan pariwisata dengan memperhatikan nilai pelestarian, dengan tujuan untuk memperoleh keuntungan yang dikelola oleh Pemerintah.', 'kbli_91021', NULL, NULL),
(1702, '91022', 'Museum Yang Dikelola Swasta', 'Kelompok ini mencakup kegiatan museum yang dikelola oleh swasta.', 'kbli_91022', NULL, NULL),
(1703, '91023', 'Peninggalan Sejarah/Cagar Budaya Yang Dikelola Pemerintah', 'Kelompok ini mencakup kegiatan pemerintah dalam usaha pengelolaan cagar budaya atau bangunan/tempat peninggalan bersejarah yang mempunyai nilai penting bagi sejarah, ilmu pengetahuan dan kebudayaan, berumur sekurang-kurangnya 50 tahun, atau mewakili masa gaya yang khas dan mewakili gaya sekurang-kurangnya 50 tahun, serta dianggap mempunyai nilai penting bagi sejarah, ilmu pengetahuan, pendidikan, agama, dan kebudayaan, misalnya candi, makam, masjid dan lainnya.', 'kbli_91023', NULL, NULL),
(1704, '91024', 'Peninggalan Sejarah/Cagar Budaya Yang Dikelola Swasta', 'Kelompok ini mencakup kegiatan swasta dalam usaha pengelolaan cagar budaya atau bangunan/tempat peninggalan bersejarah yang mempunyai nilai penting bagi sejarah, ilmu pengetahuan dan kebudayaan, berumur sekurang-kurangnya 50 tahun, atau mewakili masa gaya yang khas dan mewakili gaya sekurang-kurangnya 50 tahun, serta dianggap mempunyai nilai penting bagi sejarah, ilmu pengetahuan, pendidikan, agama, dan kebudayaan, misalnya candi, makam, masjid dan lainnya.', 'kbli_91024', NULL, NULL),
(1705, '91025', 'Taman Budaya', 'Kelompok ini mencakup kegiatan taman budaya yang menyediakan dan mengelola fasilitas atau tempat untuk pergelaran budaya.', 'kbli_91025', NULL, NULL),
(1706, '91029', 'Wisata Budaya Lainnya', 'Kelompok ini mencakup kegiatan wisata budaya yang meliputi sejarah, religi, tradisi, desa adat, kampung adat dan seni budaya yang belum dicakup pada kelompok 91021 s.d. 91025, baik dikelola oleh pemerintah maupun swasta.', 'kbli_91029', NULL, NULL),
(1707, '91031', 'Taman Konservasi Di Luar Habitat Alami (Ex-Situ)', 'Kelompok ini mencakup kegiatan lembaga konservasi di luar habitat alami (ex-situ) untuk kepentingan pengembangbiakan dan atau penyelamatan tumbuhan dan satwa dengan tetap mempertahankan kemurnian jenisnya dan digunakan sebagai tempat pendidikan, peragaan dan penelitian serta pengembangan ilmu pengetahuan dan tujuan rekreasi, seperti kebun binatang, taman safari, taman satwa, taman satwa khusus, pusat latihan satwa khusus, kebun botani, herbarium dan taman tumbuhan khusus.', 'kbli_91031', NULL, NULL),
(1708, '91032', 'Taman Nasional', 'Kelompok ini mencakup kegiatan kawasan pelestarian alam yang mempunyai ekosistem asli dikelola secara zonasi untuk menyelenggarakan usaha penyediaan sarana wisata alam di zona pemanfaatan dan usaha penyediaan jasa wisata alam yang bertujuan meningkatkan pemanfaatan gejala keunikan dan keindahan alam untuk kegiatan pariwisata dan rekreasi, penelitian, ilmu pengetahuan, pendidikan,  dan kebudayaan, menunjang budidaya, penyimpanan dan/atau penyerapan karbon serta konservasi sumber daya alam yang diselenggarakan oleh pemerintah, seperti : Taman Nasional Gunung Gede Pangrango (di Jawa Barat),  Taman Nasional Gunung Leuser (Aceh), Taman Nasional Kelimutu (NTT), Taman Nasional Komodo (NTT),  Taman Nasional Gunung Palung (Kalimatan Barat), dan Taman Nasional Bromo Tengger Semeru (Jawa Timur).', 'kbli_91032', NULL, NULL),
(1709, '91033', 'Taman Hutan Raya', 'Kelompok ini mencakup kegiatan kawasan pelestarian alam untuk tujuan koleksi tumbuhan dan atau satwa yang alami atau bukan alami, jenis asli dan atau bukan asli, untuk menyelenggarakan usaha penyediaan sarana wisata alam di blok pemanfaatan dan usaha penyediaan jasa wisata alam yang bertujuan meningkatkan pemanfaatan gejala keunikan dan keindahan alam untuk kegiatan pariwisata dan rekreasi, penelitian, ilmu pengetahuan, pendidikan, dan kebudayaan, menunjang budidaya, penyimpanan dan/atau penyerapan karbon serta konservasi sumber daya alam, seperti Tahura Cut Nyak Dhien (Aceh), Tahura Bukit Barisan (Sumatra Utara), Tahura Juanda (Jawa Barat), Tahura Sultan Adam (Kalimantan Selatan), Tahura R. Suryo (Jawa Timur), Tahura Ngurah Rai (Bali), dan Tahura Bukit Soeharto (Kalimantan Timur).', 'kbli_91033', NULL, NULL),
(1710, '91034', 'Taman Wisata Alam', 'Kelompok ini mencakup kegiatan kawasan pelestarian alam untuk menyelenggarakan usaha penyediaan sarana di blok pemanfaatan dan usaha penyediaan jasa wisata alam yang bertujuan untuk pariwisata dan rekreasi alam, seperti Taman Wisata Alam Pulau Weh (Aceh), Taman Wisata Alam Tangkuban Perahu (Jawa Barat), Taman Wisata Alam Teluk Lasolo (Sulawesi Tenggara), Taman Wisata Alam Pananjung Pangandaran (Jawa Barat), Taman Wisata Alam Batu Putih (Sulawesi Utara), dan taman wisata alam lainnya.', 'kbli_91034', NULL, NULL),
(1711, '91035', 'Suaka Margasatwa', 'Kelompok ini mencakup kegiatan penyelenggaraan dan usaha penyediaan pengelolaan jasa wisata alam, yaitu kawasan   suaka   alam yang mempunyai ciri khas berupa keanekaragaman dan atau keunikan jenis satwa dan untuk kelangsungan hidup dilakukan pembinaan terhadap habitatnya, yaitu kawasan suaka alam yang mempunyai kekhasan tumbuhan, satwa dan ekosistemnya atau ekosistem tertentu yang dilindungi dan perkembangannya berlangsung secara alami. Misalnya SM Pulau Rambut (DKI Jakarta), SM Rawa Singkil (Aceh) dan SM Dataran Tinggi Yang (Jawa Timur).', 'kbli_91035', NULL, NULL),
(1712, '91036', 'Taman Laut', 'Kelompok ini mencakup kegiatan taman laut yang terdiri dari wilayah laut yang dilindungi dapat digunakan sebagai daerah rekreasi atau hanya wilayah untuk melestarikan habitat tertentu dan menjamin ekosistem berkelanjutan untuk organime di wilayah tersebut. Misalnya Taman Laut Pahawang (Lampung), Taman Laut Raja Ampat (Papua Barat), dan Taman Laut Gili Matra (NTB).', 'kbli_91036', NULL, NULL),
(1713, '91037', 'Kawasan Buru', 'Kelompok ini mencakup kegiatan suatu kawasan yang didalamnya terdapat potensi satwa buru, baik berupa kebun buru, taman buru ataupun areal buru yang diperuntukan untuk rekreasi berburu, mencakup penyediaan sarana dan prasarana berburu, seperti Taman Buru Lingga Isaq (Aceh), Taman Buru Gunung Masigit Kareumbi (Jawa Barat), Taman Buru Komara (Sulawesi Selatan) dan Taman Buru Moyo.', 'kbli_91037', NULL, NULL),
(1714, '91038', 'Hutan Lindung', 'Kelompok ini mencakup kegiatan pemerintah dalam pengelolaan dan pemanfaatan/penggunaan kawasan hutan yang mempunyai fungsi sebagai pelindung ekosistem, tata air, erosi, dan memelihara kesuburan tanah. Contoh : Hutan Lindung Bukit Daun di Bengkulu.', 'kbli_91038', NULL, NULL),
(1715, '91039', 'Aktivitas Kawasan Alam Lainnya', 'Kelompok ini mencakup kegiatan kawasan alam lainnya seperti konservasi alam, dan cagar alam, yang belum tercakup pada kelompok 91031 s.d. 91038.', 'kbli_91039', NULL, NULL),
(1716, '92000', 'Aktivitas Perjudian Dan Pertaruhan', 'Golongan ini mencakup kegiatan perjudian dan pertaruhan seperti penjualan tiket lotere, kegiatan operasianal mesin perjudian yang dioperasikan dengan koin, pengoperasian web site perjudian virtual, penyelenggaraan taruhan, \"\"\"\"off-track beating\"\"\"\" dan kegiatan kasino termasuk \"\"\"\"floating casino\"\"\"\".', 'kbli_92000', NULL, NULL),
(1717, '93111', 'Fasilitas Stadion', 'Kelompok ini mencakup usaha yang menyediakan tempat dan fasilitas untuk olahraga sepak bola, hoki, cricket, baseball, jai-alai, atletik (lari, lempar lompat dan lain-lain) sebagai usaha pokok,  dan sarana stadion lainnya. Penyelenggaraan sekolah/pendidikan olahraga sepak bola, hoki, cricket, baseball, jai-alai, atletik (lari, lempar lompat dan lain-lain) yang dikelola sendiri dicakup dalam kelompok ini.', 'kbli_93111', NULL, NULL),
(1718, '93112', 'Fasilitas Sirkuit', 'Kelompok ini mencakup usaha yang menyediakan tempat dan fasilitas olahraga yang berbentuk jalan yang melingkar atau berbentuk lingkaran, dipakai untuk berbagai perlombaan balap otomotif, pacuan kuda, balap anjing sebagai usaha pokok dan sarana sirkuit lainnya.', 'kbli_93112', NULL, NULL),
(1719, '93113', 'Fasilitas Gelanggang/Arena', 'Kelompok ini mencakup usaha yang menyediakan tempat dan fasilitas olahraga darat, air dan udara di dalam atau luar ruangan\r\nseperti: pengelolaan gelanggang/arena renang, bowling, biliar, slingshot, hoki es, bungee jumping, olahraga musim dingin; pengelolaan gelanggang/arena paragliding, hang gliding; sebagai usaha pokok dan sarana gelanggang/arena lainnya.', 'kbli_93113', NULL, NULL),
(1720, '93114', 'Fasilitas Lapangan', 'Kelompok ini mencakup usaha yang menyediakan tempat dan fasilitas olahraga golf, bulu tangkis, bola voli, bola basket, tenis sebagai usaha pokok dan sarana lapangan lainnya.', 'kbli_93114', NULL, NULL),
(1721, '93115', 'Fasilitas Olahraga Beladiri', 'Kelompok ini mencakup usaha yang menyediakan tempat dan fasilitas olahraga beladiri pencak silat (padepokan), karate (dojo), taekwondo (doljang), tinju (sasana) dan lainnya sebagai usaha pokok dan sarana lapangan lainnya.', 'kbli_93115', NULL, NULL),
(1722, '93116', 'Fasilitas Pusat Kebugaran/ Fitness Center', 'Kelompok ini mencakup usaha yang menyediakan tempat dan fasilitas untuk fitness atau kebugaran lainnya sebagai usaha pokok. Penyelenggaraan sekolah/ pendidikan kebugaran/ fitness yang dikelola sendiri dicakup dalam kelompok ini.', 'kbli_93116', NULL, NULL),
(1723, '93119', 'Pengelolaan Fasilitas Olah raga Lainnya', 'Kelompok ini mencakup usaha yang menyediakan tempat dan fasilitas olahraga sebagai usaha pokok dan sarana lainnya selain yang tercakup pada kelompok 93111 s.d. 93116, Kelompok ini termasuk sport center.', 'kbli_93119', NULL, NULL),
(1724, '93121', 'Klub Sepak Bola', 'Kelompok ini mencakup usaha organisasi/klub sepak bola profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.', 'kbli_93121', NULL, NULL),
(1725, '93122', 'Klub Golf', 'Kelompok ini mencakup usaha organisasi/ klub golf profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.', 'kbli_93122', NULL, NULL),
(1726, '93123', 'Klub Renang', 'Kelompok ini mencakup usaha organisasi/klub renang profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.', 'kbli_93123', NULL, NULL),
(1727, '93124', 'Klub Tenis Lapangan', 'Kelompok ini mencakup usaha organisasi/klub tenis lapangan profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.', 'kbli_93124', NULL, NULL),
(1728, '93125', 'Klub Tinju', 'Kelompok ini mencakup usaha organisasi/klub tinju profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.', 'kbli_93125', NULL, NULL),
(1729, '93126', 'Klub Bela Diri', 'Kelompok ini mencakup usaha organisasi/klub bela diri profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.', 'kbli_93126', NULL, NULL),
(1730, '93127', 'Klub Kebugaran/Fitness Dan Binaraga', 'Kelompok ini mencakup usaha organisasi/klub kebugaran/fitness profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.', 'kbli_93127', NULL, NULL),
(1731, '93128', 'Klub Bowling', 'Kelompok ini mencakup usaha organisasi/klub bowling profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.', 'kbli_93128', NULL, NULL),
(1732, '93129', 'Klub Olahraga Lainnya', 'Kelompok ini mencakup kegiatan klub olahraga profesional, semi profesional atau amatir yang memberikan anggotanya kesempatan untuk ikut dalam kegiatan olahraga, baik yang menyediakan tempat dan fasilitas untuk olahraga atau tidak.selain klub olahraga yang tercakup pada kelompok 93121 s.d. 93128.', 'kbli_93129', NULL, NULL),
(1733, '93191', 'Promotor Kegiatan Olahraga', 'Kelompok ini mencakup kegiatan pengurusan dan penyelenggaraan pertunjukan hiburan baik yang berupa mendatangkan, mengirim maupun mengembalikan serta menentukan tempat, waktu dan jenis hiburan. Kegiatan usaha jasa impresariat pada kelompok ini khusus bidang olah raga.', 'kbli_93191', NULL, NULL),
(1734, '93192', 'Olahragawan, Juri dan Wasit Profesional', 'Kelompok ini mencakup kegiatan olahragawan, juri dan wasit profesional yang bertindak atas nama perorangan.', 'kbli_93192', NULL, NULL),
(1735, '93193', 'Aktivitas Perburuan', 'Kelompok ini mencakup kegiatan untuk menyelenggarakan usaha atau operasional olahraga berburu di blok pemanfaatan, cagar alam dan suaka margasatwa.', 'kbli_93193', NULL, NULL),
(1736, '93194', 'Badan Regulasi Dan Liga Olahraga', 'Kelompok ini mencakup kegiatan badan regulasi dan liga olahraga yang menyediakan peraturan pertandingan dan pertandingan berkala untuk sejumlah orang atau kelompok orang atau kelab yang berkompetisi dalam suatu olahraga.', 'kbli_93194', NULL, NULL),
(1737, '93195', 'Aktivitas Olahraga Tradisional', 'Kelompok ini mencakup semua usaha pengurusan, penyelenggaraan serta regulasi yang berkaitan dengan olahraga tradisional untuk mempertahankan nilai tradisi dan budaya baik secara perseorangan atau kelompok, seperti pencak silat, lompat batu dari nias, pasola sumba, debus,dan silek minang.', 'kbli_93195', NULL, NULL),
(1738, '93199', 'Aktivitas Lainnya Yang Berkaitan Dengan Olahraga', 'Kelompok ini mencakup kegiatan lain yang berkaitan dengan olahraga yang tidak diklasifikasikan pada kelompok 93191 s.d. 93195, seperti kegiatan yang berkaitan dengan promosi kegiatan olahraga, kegiatan kandang kuda pacu, kandang anjing pacu dan sejenisnya dan kegiatan penunjang untuk olahraga atau kegiatan memancing dan berburu sebagai sebuah rekreasi.', 'kbli_93199', NULL, NULL),
(1739, '93211', 'Taman Rekreasi', 'Kelompok ini mencakup kegiatan pengoperasian berbagai macam atraksi seperti permainan menggunakan mekanik, permainan menggunakan air, menyewakan alat/fasilitas yang berkaitan rekreasi, pertunjukan, parade, pameran dengan tema tertentu dan lapangan piknik, pengoperasian transportasi di dalam taman rekreasi, hingga penyediaan aktivitas di taman atau pantai. Usaha taman rekreasi mengandung unsur hiburan dan dapat memiliki unsur edukasi. Pengoperasian usaha ini dapat dilengkapi dengan penyediaan jasa pelayanan makanan dan minuman, cendera mata, akomodasi.', 'kbli_93211', NULL, NULL),
(1740, '93219', 'Aktivitas taman bertema atau taman hiburan lainnya', 'Kelompok ini mencakup usaha pengoperasian taman rekreasi, termasuk taman bertema atau taman hiburan dan pasar malam hiburan rakyat,  yang dilakukan  di dalam  ataupun di luar ruangan selain yang tercakup pada kelompok 93211.', 'kbli_93219', NULL, NULL),
(1741, '93221', 'Pemandian Alam', 'Kelompok ini mencakup suatu usaha yang menyediakan tempat dan fasilitas untuk mandi dengan memanfaatkan air panas dan atau air terjun sebagai usaha pokok dan dapat dilengkapi dengan penyediaan jasa pelayanan makan dan minum serta akomodasi. Misalnya Pemandian Alam Ciater (Jawa Barat), Pemandian Alam Umbul Ponggok Klaten (Jawa Tengah) dan Pemandian Alam Soa (Bajawa-NTT)', 'kbli_93221', NULL, NULL),
(1742, '93222', 'Wisata Gua', 'Kelompok ini mencakup suatu usaha pengelolaan untuk mengadakan kegiatan petualangan dan penelusuran gua sebagai usaha pokok di suatu kawasan tertentu dan dapat dilengkapi dengan penyediaan berbagai jenis pemandu, pelayanan makan dan minum serta akomodasi.', 'kbli_93222', NULL, NULL),
(1743, '93223', 'Wisata Petualangan Alam', 'Kelompok ini mencakup suatu usaha pengelolaan aktivitas pariwisata yang melibatkan eksplorasi atau perjalanan yang mengandung resiko dan membutuhkan ketrampilan khusus dan pengerahan tenaga fisik, seperti paralayang, paramotor, layang gantung, bungee jumping, terbang layang, canyoning, orienteering, offroad, dan mountain biking', 'kbli_93223', NULL, NULL),
(1744, '93224', 'Wisata Pantai', 'Kelompok ini mencakup suatu usaha yang menyediakan tempat dan fasilitas untuk menikmati keindahan alam dengan menggunakan pantai sebagai usaha pokok dan dapat dilengkapi dengan penyediaan pelayanan makan dan minum serta akomodasi. Misalnya Pantai Parangtritis (Jogjakarta), Pantai Pandawa (Bali), Pantai Mandeh (Sumatera Barat).', 'kbli_93224', NULL, NULL),
(1745, '93229', 'Daya Tarik Wisata Alam Lainnya', 'Kelompok ini mencakup suatu usaha pengelolaan untuk mengadakan kegiatan daya tarik wisata alam yang belum dicakup pada kelompok 93221 s.d. 93224.', 'kbli_93229', NULL, NULL),
(1746, '93231', 'Wisata Agro', 'Kelompok ini mencakup suatu usaha pengelolaan daya tarik wisata dengan memanfaatkan kawasan pertanian yang meliputi tanaman pangan dan holtikultura, perkebunan, perikanan dan peternakan sebagai usaha pokok dan dapat dilengkapi dengan penyediaan berbagai jenis fasilitas termasuk jasa pelayanan makan dan minum serta akomodasi. Jenis-jenis kegiatannya meliputi produksi, koleksi, konservasi, pengolahan, dan kegiatan budaya masyarakatnya, seperti Taman Buah Mekarsari (Jawa Barat), Wisata Kebun Salak Sleman (Jogjakarta), dan Wisata Kebun Apel Batu (Malang, Jawa Timur) serta Coffeenery dan Winery.', 'kbli_93231', NULL, NULL),
(1747, '93239', 'Daya Tarik Wisata Buatan/Binaan Manusia Lainnya', 'Kelompok ini mencakup suatu usaha pengelolaan untuk mengadakan kegiatan daya tarik wisata buatan/binaan manusia yang belum dicakup pada kelompok 93231 s.d. 93233. Termasuk wisata outbond.', 'kbli_93239', NULL, NULL),
(1748, '93241', 'Arung Jeram', 'Kelompok ini mencakup suatu usaha pengelolaan dengan pemanfaatan sungai-sungai arus deras untuk mengadakan kegiatan arung jeram sebagai usaha pokok di kawasan tertentu. Misalnya Arung Jeram Sobek Bali, Arung Jeram Arus Liar Citarik. Termasuk rafting tubing, river boarding, canoeing kayaking body rafting experience.', 'kbli_93241', NULL, NULL),
(1749, '93242', 'Wisata Selam', 'Kelompok ini mencakup suatu usaha pengelolaan untuk mengadakan kegiatan selam, menyediakan penjualan dan penyewaan serta perbaikan peralatan selam (equipment), mengorganisasikan perjalanan wisata selam baik skala lokal, nasional dan internasional (experience). Termasuk kegiatan-kegiatan yang terkait dengan tujuan untuk menjaga dan merawat kondisi lingkungan laut dan pesisir (environment), serta kegiatan sejenis lainnya yang mendukung pelestarian lingkungan pada kawasan tertentu sebagai usaha pokok. Termasuk kegiatan snorkeling. free diving, dan sea walker.', 'kbli_93242', NULL, NULL),
(1750, '93243', 'Dermaga Marina', 'Kelompok ini mencakup suatu usaha penyediaan dan pengelolaan tempat untuk penambatan atau berlabuh kapal pesiar/wisata dan atau perahu layar wisata dan pelayanan jasa lain yang berkaitan dengan kegiatan kelautan. Misalnya Marina Ancol, Benoa Marine.', 'kbli_93243', NULL, NULL),
(1751, '93244', 'Kolam Pemancingan', 'Kelompok ini mencakup suatu usaha yang menyediakan tempat dan fasilitas untuk memancing sebagai usaha pokok dan dapat dilengkapi dengan penyediaan jasa pelayanan makan dan minum.', 'kbli_93244', NULL, NULL),
(1752, '93245', 'Wisata Memancing', 'Kelompok ini mencakup suatu usaha pengelolaan dan penyediaan jasa pemandu wisata memancing (recreational fishing guide) untuk mengadakan kegiatan memancing, baik untuk kesenangan dan rekreasi serta perlombaan yang dilakukan di air tawar (fresh water fishing) seperti di sungai, muara, danau, pantai, perairan kepulauan, dan kegiatan memancing di air asin (salt water fishing) seperti di laut lepas untuk tujuan wisata pada kawasan tertentu sebagai usaha pokok. Termasuk olahraga memancing (sport fishing).', 'kbli_93245', NULL, NULL),
(1753, '93246', 'Aktivitas Wisata Air', 'Kelompok ini mencakup suatu usaha pengelolaan untuk mengadakan berbagai aktivitas wisata air seperti selancar angin, paralayar (parasailing) dan motor air (jet ski), perahu motor (motor boating) pelayaran (sailing), selancar ombak (surfing), rakit (rafting), kano (canoeing), kayak (kayaking), perahu tradisional/naga (traditional/dragon boat race), berpetualang dengan perahu/kapal (boating adventures), pelatihan petualangan berlayar (sail training adventures), kapal selam wisata (submarine experience) dan flying board sebagai usaha pokok di suatu kawasan tertentu dan dapat dilengkapi dengan penyediaan berbagai jenis fasilitas termasuk jasa pelayanan makan dan minum serta akomodasi dan berbagai fasilitas pendukung lainnya.', 'kbli_93246', NULL, NULL),
(1754, '93249', 'Wisata Tirta Lainnya', 'Kelompok ini mencakup suatu usaha pengelolaan untuk mengadakan wisata tirta lainnya yang belum tercakup di kelompok 93241 s.d. 93246 seperti wisata rekreasi tematik bawah laut sebagai usaha pokok di suatu kawasan tertentu dan dapat dilengkapi dengan penyediaan berbagai jenis fasilitas termasuk jasa pelayanan makan dan minum serta akomodasi.', 'kbli_93249', NULL, NULL),
(1755, '93291', 'Klub Malam', 'Kelompok ini mencakup suatu usaha yang menyediakan tempat dan fasilitas untuk menari dengan diiringi musik, atraksi pertunjukan lampu dan menyediakan jasa pelayanan makanan dan minuman.', 'kbli_93291', NULL, NULL),
(1756, '93292', 'Karaoke', 'Kelompok ini mencakup suatu usaha yang menyediakan tempat dan fasilitas untuk karaoke sebagai usaha pokok dan dapat dilengkapi dengan penyediaan jasa pelayanan makanan dan minuman.', 'kbli_93292', NULL, NULL),
(1757, '93293', 'Usaha Arena Permainan', 'Kelompok ini mencakup suatu usaha yang menyediakan tempat dan fasilitas untuk permainan ketangkasan dan atau mesin permainan dengan koin atau kartu sebagai usaha pokok dan dapat dilengkapi dengan penyediaan jasa pelayanan makan dan minum. Misalnya Timezone, Kidzania.', 'kbli_93293', NULL, NULL),
(1758, '93294', 'Diskotek', 'Kelompok ini mencakup suatu usaha yang menyediakan tempat dan fasilitas yang dilengkapi dengan tata cahaya dan suara, untuk mendengarkan musik atau menari mengikuti irama musik, dan menyediakan jasa pelayanan makanan dan minuman.', 'kbli_93294', NULL, NULL),
(1759, '93299', 'Aktivitas Hiburan dan Rekreasi Lainnya Ytdl', 'Kelompok ini mencakup kegiatan hiburan dan rekreasi yang tidak tercakup  dalam 93291 s.d. 93294, seperti kegiatan operasional bukit ski, penyewaan perlengkapan rekreasi dan hiburan yang merupakan bagian yang tidak terpisahkan dari fasilitas rekreasi, kegiatan operasional pekan raya dan pertunjukan rekreasi alami , dan kegiatan hiburan dan rekreasi lainnya. Termasuk kegiatan produser atau pengusaha pertunjukan langsung selain pertunjukan olahraga atau seni, dengan atau tanpa fasilitas.', 'kbli_93299', NULL, NULL),
(1760, '94110', 'Aktivitas Organisasi Bisnis Dan Pengusaha', 'Kelompok ini mencakup kegiatan organisasi pengusaha perdagangan, kegiatan organisasi yang kepentingan anggotanya berpusat pada pengembangan dan kesejahteraan perusahaan dalam bisnis atau perdagangan tertentu, termasuk pertanian atau pertumbuhan ekonomi dan iklim area geografis atau bagian politik tertentu tanpa memperhatikan bidang usaha, kegiatan federasi dari beberapa perkumpulan atau asosiasi, kegiatan kamar dagang dan organisasi sejenisnya, penyebaran informasi, perwakilan di hadapan lembaga pemerintah, hubungan masyarakat dan perundingan ketenagakerjaan dari organisasi bisnis dan pengusaha, seperti Kamar Dagang Indonesia (KADIN), GINSI (Gabungan Importir Nasional Seluruh Indonesia), Asosiasi Pengusaha Indonesia (APINDO), Gabungan Pengusaha Makanan dan Minuman Indonesia (GAPMMI), organisasi pedagang dan organisasi pengusaha lainnya.', 'kbli_94110', NULL, NULL),
(1761, '94121', 'Aktivitas Organisasi Ilmu Pengetahuan Sosial Dan Masyarakat', 'Kelompok ini mencakup kegiatan organisasi profesional yang bergerak di bidang ilmu pengetahuan sosial dan masyarakat, seperti Himpunan Insan Pers Seluruh Indonesia (HIPSI), Persatuan Wartawan Indonesia (PWI), Ikatan Dokter Indonesia (IDI), Persatuan Guru Republik Indonesia (PGRI), Ikatan Sarjana Ekonomi Indonesia (ISEI), Ikatan Sekretaris Indonesia (ISI) dan Ikatan Bidan Indonesia (IBI).', 'kbli_94121', NULL, NULL),
(1762, '94122', 'Aktivitas Organisasi Ilmu Pengetahuan Alam Dan Teknologi', 'Kelompok ini mencakup kegiatan organisasi profesional yang bergerak di bidang ilmu pengetahuan alam dan teknologi, seperti Perhimpunan Insinyur Indonesia (PII)  dan Ikatan Surveyor Indonesia (ISI).', 'kbli_94122', NULL, NULL),
(1763, '94200', 'Aktivitas Organisasi Buruh', 'Kelompok ini mencakup kegiatan organisasi yang bergerak dalam bidang ketenagakerjaan, dalam memperjuangkan kepentingan baik organisasi buruh atau anggotanya,  seperti Serikat Pekerja Seluruh Indonesia (SPSI), Sentral Organisasi Karya Swadiri Indonesia (SOKSI) dan Korps Pegawai Republik Indonesia (KORPRI).', 'kbli_94200', NULL, NULL),
(1764, '94910', 'Aktivitas Organisasi Keagamaan', 'Kelompok ini mencakup kegiatan organisasi keagamaan yang bergerak dalam penyelenggaraan kegiatan agama dan penyebaran agama. Kegiatan yang dicakup meliputi kegiatan organisasi keagamaan atau perorangan yang menyelenggarakan layanan secara langsung untuk jamaah yang beribadah dalam masjid, gereja, kuil atau tempat ibadah lain, kegiatan organisasi yang menyediakan layanan biara, kegiatan keagamaan retreat (pengasingan diri) dan kegiatan agama lainnya.', 'kbli_94910', NULL, NULL),
(1765, '94920', 'Aktivitas Organisasi Politik', 'Kelompok ini mencakup kegiatan organisasi yang bergerak dalam bidang politik dan organisasi penunjang seperti organisasi pemuda yang berhubungan dengan partai politik. Organisasi tersebut terutama berkaitan dalam memberikan pengaruh terhadap pengambilan keputusan dalam badan umum pemerintah dengan menempatkan anggota pada partai atau yang bersimpatik terhadap partai tersebut dalam badan politik dan menyangkut penyebaran informasi, hubungan masyarakat, pengumpulan uang dan lain-lain.', 'kbli_94920', NULL, NULL),
(1766, '94990', 'Aktivitas Organisasi Keanggotaan Lainnya YTDL', 'Kelompok ini mencakup kegiatan organisasi keanggotaan lainnya ytdl yang bergerak di bidang sosial dan kemasyarakatan, seperti Lembaga Swadaya Masyarakat (LSM), Komite Nasional Pemuda Indonesia (KNPI), KOWANI, kegiatan pergerakan protes atau inisiatif warga negara (demo); pergerakan yang berkaitan dengan ekologi dan lingkungan; organisasi yang mendukung fasilitas umum dan fasilitas pendidikan ytdl; organisasi untuk perlindungan dan kemajuan kelompok khusus, perkumpulan veteran perang, asosiasi konsumen, asosiasi automobil, klub rotari, asosiasi pemuda, asosiasi remaja, asosiasi pelajar, klub dan kelompok persaudaraan dan sebagainya, asosiasi untuk pencarian kegiatan kebudayaan atau rekreasi atau hobi (selain olahraga dan permainan). Termasuk kegiatan pemberian bantuan oleh organisasi keanggotaan atau lainnya.', 'kbli_94990', NULL, NULL),
(1767, '95110', 'Reparasi Komputer dan Peralatan Sejenisnya', 'Kelompok ini mencakup usaha jasa reparasi dan perawatan komputer dan peralatannya, seperti komputer desktop, laptop, disk drive magnetik, flash drives dan media penyimpanan lain, disk drive optik (CD-RW, CD-ROM, DVD-ROM, DVD-RW), printer, monitor, keyboard,  mouse, joysticks dan trackball, modem komputer internal dan eksternal, terminal komputer, server komputer, scanner termasuk scanner bar code, pembaca smart card, virtual reality helmet dan proyektor komputer. Termasuk jasa reparasi dan perawatan terminal komputer seperti automatic teller machine (ATM), terminal point of sale (POS), yang tidak dioperasikan secara mekanik dan komputer genggam (PDA).', 'kbli_95110', NULL, NULL),
(1768, '95120', 'Reparasi Peralatan Komunikasi', 'Kelompok ini mencakup usaha khusus reparasi dan perawatan peralatan komunikasi, seperti reparasi perangkat telekomunikasi tanpa kabel (telepon seluler, RFID, komputer tablet, komputer genggam, modem nirkabel, alat pelacak kendaraan); reparasi perangkat telekomunikasi kabel (mesin FAX, pesawat telepon analog, ADSL/HDSL, PABX, modem, router, bridges); reparasi peralatan transmisi berbasis kabel (sentral telepon analog); reparasi perangkat transmisi radio (microwave link, Studio To Transmitter Link/STL, Trans Horizon Link/Troposcatter); reparasi radio dua arah (komunikasi radio trunking, komunikasi radio konvensional, walky talky); dan reparasi perangkat pengirim dan/atau penerima radio/transceiver (perangkat pemancar TV siaran, pesawat TV/smart TV, radio siaran, perangkat pemancar dan penerima jaringan bergerak seluler, dan kamera video).', 'kbli_95120', NULL, NULL),
(1769, '95210', 'Reparasi Alat-alat Elektronik Konsumen', 'Kelompok ini mencakup usaha khusus jasa reparasi dan perawatan alat elektronik konsumen, seperti televisi dan radio penerima (termasuk pemasangan antena),, perekam kaset video (VCR), CD player dan kamera video jenis untuk pengguna rumah tangga.', 'kbli_95210', NULL, NULL),
(1770, '95220', 'Reparasi Peralatan Rumah Tangga Dan Peralatan Rumah Dan Kebun', 'Kelompok ini mencakup usaha khusus jasa reparasi dan perawatan peralatan rumah tangga, seperti kulkas, kompor, mesin cuci, pengering pakaian, pendingin ruangan (AC), seterika listrik, alat penghisap debu  dan berbagai barang/perabot listrik lainnya untuk keperluan rumah tangga. Termasuk jasa reparasi dan perawatan peralatan rumah dan kebun, seperti mesin pemotong rumput, edger, penyapu salju dan daun, trimmer dan sebagainya.', 'kbli_95220', NULL, NULL),
(1771, '95230', 'Reparasi Alas Kaki Dan Barang Dari Kulit', 'Kelompok ini mencakup usaha khusus jasa reparasi alas kaki dan barang dari kulit, seperti sepatu, sepatu boot,  sandal, koper, tas dan sebagainya. Termasuk jasa pemasangan tumit sepatu.', 'kbli_95230', NULL, NULL),
(1772, '95240', 'Reparasi Furnitur Dan Perlengkapan Rumah', 'Kelompok ini mencakup usaha khusus jasa reparasi furnitur dan perlengkapan rumah, seperti pelapisan, penyelesaian, reparasi dan pemulihan kembali perabot dan perlengkapan rumah termasuk perabot kantor dan perakitan perabotan self-standing.', 'kbli_95240', NULL, NULL),
(1773, '95291', 'Aktivitas Vermak Pakaian', 'Kelompok ini mencakup usaha vermak pakaian, yang melayani masyarakat umum dengan tujuan komersil.', 'kbli_95291', NULL, NULL),
(1774, '95299', 'Reparasi Barang Rumah Tangga Dan Pribadi Lainnya', 'Kelompok ini mencakup usaha khusus jasa reparasi barang rumah tangga dan pribadi lainnya tidak diklasifikasikan di tempat lain, seperti sepeda, perhiasan, jam tangan, jam dinding dan bagian-bagiannya, alat olahraga (kecuali senapan untuk olahraga), buku, alat musik, mainan dan barang sejenisnya, barang pribadi dan rumah tangga lainnya. Termasuk setem piano dan duplikasi kunci.', 'kbli_95299', NULL, NULL),
(1775, '96111', 'Aktivitas Pangkas Rambut', 'Kelompok ini mencakup usaha jasa pemangkas dan perawatan rambut yang melayani masyarakat umum, termasuk juga pemangkas kumis, jambang maupun jenggot, yang biasanya dilakukan oleh perorangan. Umumnya untuk kaum pria, seperti barber shop.', 'kbli_96111', NULL, NULL),
(1776, '96112', 'Aktivitas Salon Kecantikan', 'Kelompok ini mencakup usaha jasa pemeliharaan rambut dan perawatan kecantikan, seperti perawatan muka dan kulit muka, pijat muka, make-up, manikur, pedikur, pencucian, perapian dan pemotongan, penataan, pencelupan, pewarnaan, pengeritingan, pelurusan dan kegiatan serupa untuk rambut pria dan wanita dan jasa salon sejenisnya.', 'kbli_96112', NULL, NULL),
(1777, '96121', 'Rumah Pijat', 'Kelompok ini mencakup suatu usaha yang menyediakan tempat dan fasilitas pelayanan pijat tradisional Indonesia, pijat refleksi, pijat siatsu, pijat tuina, dan pijat thailand yang nyaman, aman dan bermanfaat.  Menjunjung tinggi etika profesi dan tersedianya makanan dan minuman.', 'kbli_96121', NULL, NULL),
(1778, '96122', 'Aktivitas SPA (Sante Par Aqua)', 'Kelompok ini mencakup usaha wisata berupa pelayanan jasa kesehatan dan perawatan dengan memadukan metode tradisional dan modern secara holistik. Aktivitas ini menggunakan air dan pendukung perawatan lainnya berupa pijat menggunakan ramuan, terapi aroma, latihan fisik, terapi warna, terapi musik, makanan dan minuman. Tujuan aktivitas ini menyeimbangkan antara tubuh (body), pikiran (mind), dan jiwa (soul), sehingga terwujud kondisi relaks dan bugar untuk kesehatan yang optimal. Aktivitas ini juga merupakan upaya mempertahankan tradisi dan budaya bangsa.', 'kbli_96122', NULL, NULL),
(1779, '96129', 'Aktivitas Kebugaran Lainnya', 'Kelompok ini mencakup usaha jasa pelayanan kebugaran lainnya,  yang berkaitan dengan kebugaran jasmani dan kenyamanan, seperti kegiatan mandi turki, mandi sauna, dan steam, solarium (mandi sinar matahari), salon untuk merampingkan tubuh (reducing  dan slendering salon), dan fish spa.', 'kbli_96129', NULL, NULL),
(1780, '96200', 'Aktivitas penatu', 'Kelompok ini mencakup usaha jasa pelayanan pencucian dan dry cleaning, penatu, pencelupan dan tisi barang-barang tekstil jadi (termasuk berbahan kulit bulu binatang) dan tekstil lainnya untuk keperluan rumah tangga maupun industri perorangan, dilakukan dengan peralatan mekanik, baik yang dioperasikan dengan tangan atau dengan koin, seperti taplak meja, seprei, karpet, termasuk juga pakaian dan barang tekstil jadi. Termasuk kegiatan pencucian (shampooing) carpet, dan rug serta curtain gorden; jasa pengumpulan penatu dan pengirimannya; jasa penyediaan linen, seragam kerja dan barang lain yang terkait oleh penatu; reparasi dan alterasi atau pengubahan kecil dari pakaian atau tekstil lain yang terkait dengan pencucian.', 'kbli_96200', NULL, NULL),
(1781, '96910', 'Aktivitas Pemakaman Dan Kegiatan YBDI', 'Kelompok ini mencakup usaha jasa pemakaman dan kegiatan ybdi, seperti penggalian kubur, penyediaan mobil jenazah, pemakaman dan pembakaran mayat manusia atau hewan dan kegiatan yang terkait, seperti jasa penyiapan jenasah untuk pemakaman atau pengabuan (kremasi) dan pembalsaman dan pemakaman, penyediaan jasa pemakaman atau kremasi dan penyewaan ruang dalam lahan pekuburan, penyewaan atau penjualan kuburan dan perawatan kuburan dan hal-hal yang menyangkut proses pemakaman untuk melayani masyarakat.', 'kbli_96910', NULL, NULL),
(1782, '96990', 'Aktivitas Jasa Perorangan Lainnya YTDL', 'Kelompok ini mencakup usaha jasa perorangan lainnya ytdl, seperti tukang semir sepatu, tukang pijat, tukang ramal, penunjuk jalan yang dilakukan atas dasar balas jasa, konsultasi pernikahan. Termasuk kegiatan astrologi dan spiritual;  jasa pendamping, layanan kencan, jasa dari biro pernikahan;  jasa pemeliharaan hewan peliharaan seperti perawatan, pengasuhan dan pelatihan hewan peliharaan baik dengan akomodasi atau tidak; organisasi keturunan atau kesilsilahan; kuli/buruh angkut barang, juru parkir mobil dan lain-lain; operasional konsensi dari mesin yang dioperasikan dengan koin (kamar foto, mesin timbang, mesin untuk pemeriksaan tekanan darah, loker yang dioperasikan dengan koin); kegiatan pengelolaan WC umum; jasa pengupasan kulit udang, jasa pengupasan kulit kepiting/rajungan, jasa penyiangan paha kodok (yang usahanya berdiri sendiri dan tidak bergantung pada usaha industrinya).', 'kbli_96990', NULL, NULL),
(1783, '97000', 'Aktivitas Rumah Tangga Sebagai Pemberi Kerja Dari Personil Domestik', 'Kelompok ini mencakup kegiatan rumah tangga sebagai pemberi kerja yang mempekerjakan personil rumah tangga, seperti asisten rumah tangga, juru masak, tukang cuci, tukang kebun, pengurus rumah tangga, pengasuh bayi, guru privat yang mengajar di rumah, sekretaris pribadi dan sopir pribadi.', 'kbli_97000', NULL, NULL),
(1784, '98100', 'Aktivitas Yang Menghasilkan Barang Oleh Rumah Tangga Yang Digunakan Untuk Memenuhi Kebutuhan Sendiri', 'Kelompok ini mencakup kegiatan menghasilkan barang pokok rumah tangga yang sejenis, dengan kata lain kegiatan rumah tangga tersebut digunakan dalam berbagai macam kegiatan yang menghasilkan barang untuk kebutuhan mereka sendiri. Kegiatan ini mencakup perburuan dan pengumpulan, pertanian, pengadaan tempat berlindung dan pakaian dan barang lain yang diproduksi oleh rumah tangga untuk kebutuhannya. Dalam praktiknya, jika rumah tangga juga diikutsertakan dalam produksi barang yang dipasarkan, maka digolongkan ke dalam industri penghasil barang yang sesuai dengan KBLI. Jika utamanya digunakan dalam kegiatan produksi barang pokok khusus, maka diklasifikasikan ke dalam industri produksi barang yang sesuai dari KBLI.', 'kbli_98100', NULL, NULL),
(1785, '98200', 'Aktivitas yang menghasilkan jasa oleh rumah tangga yang digunakan untuk memenuhi kebutuhan sendiri', 'Kelompok ini mencakup kegiatan rumah tangga dalam menghasilkan jasa pokok, seperti memasak, mengajar atau mendidik, merawat atau menjaga anggota rumah tangga dan jasa lain yang dihasilkan oleh rumah tangga untuk kebutuhannya sendiri. Dalam praktiknya, jika rumah tangga tersebut juga terkait dalam memproduksi berbagai macam jasa untuk memenuhi kebutuhan sendiri, maka diklasifikasikan dalam kegiatan rumah tangga yang menghasilkan jasa untuk memenuhi kebutuhan sendiri.', 'kbli_98200', NULL, NULL),
(1786, '99000', 'Aktivitas Badan Internasional Dan Badan Ekstra Internasional Lainnya', 'Kelompok ini mencakup kegiatan lembaga/badan/instansi dari perwakilan negara asing, badan internasional dan regional lainnya, badan keuangan dan moneter internasional, bank dunia, organisasi bea cukai dunia, organisasi untuk kerjasama dan pengembangan ekonomi, organisasi negara-negara pengekspor minyak, perhimpunan negara-negara Eropa, perhimpunanperdagangan bebas negara-negara Eropa dan lain-lain, seperti  perwakilan PBB dan suborganisasi, UNICEF, UNESCO, UNDP, WHO, ILO, ASEAN, IMF, OECD dan OPEC dan lain-lain serta  kedutaan besar, dan konsulat yang ditentukan oleh negara dimana berada daripada negara yang diwakilinya.', 'kbli_99000', NULL, NULL);
